INSERT INTO `bitacora` VALUES (857,32,'Inicio del proyecto','Relevacin y anlisis del proyecto en cuestin para poder realizarlo de la mejor manera posible','2019-02-13'),(858,32,'Proyecto Restaurante','En el da de hoy realic el diagrama de Gantt donde se indican todas las tareas a realizar','2019-02-14'),(859,32,'Desarrollo aplicacin web','Comenc a desarrollar las funcionalidades que tiene la aplicacin web','2019-02-15'),(860,32,'Funcionalidades','Me habia olvidado de cargar la bitacora del dia 16, pero basicamente lo que hice fue programar una funcion llamada reservas que permite al usuario reservar mesas para x dia','2019-02-17'),(861,32,'Funcionalidades app','Hoy continue con las funcionalidades de la aplicacin web, desarrollando otras 4 mas, llamadas Productos, categoras, mesas y an me falta por finalizar la ultima, llamada Ventas. donde queda un registro de lo que se vendi hoy.','2019-02-18'),(862,32,'Pruebas unitarias del proyecto','Se est probando la aplicacin web para ver si hay fallos','2019-02-19'),(863,32,'Proyecto','Pruebas integrales de la aplicacion web','2019-02-20'),(864,32,'Proyecto restaurante','documentacin e implementacin del proyecto.','2019-02-22'),(865,42,'Introduccin y cv','Escuche los objetivos de la materia y cree un cv desde 0. ','2019-03-21'),(866,47,'Desarrollo de CV','Hoy el profesor nos explico de que va la materia, me registre a esta pgina (encuentro tecnologico) y hice el cv. ','2019-03-21'),(867,36,'desarrollo de cv','hoy me registre a esta pagina, me saque foto de mi cara para enviarselo al profe, me hice un curriculum para mandarlo tmb y termine. ','2019-03-21'),(868,51,'Introduccion y CV','hoy tuvimos la introduccin a la materia, que es lo que vamos a realizar durante el ao, como nos vamos a organizar, hablamos de la posibilidad de hacer practicas afuera del cole y nos dimos a la tarea de crear un Curriculum Vitae','2019-03-21'),(869,43,'Presentacin de la materia y creacin del CV','Hoy estuvimos en clase aprendiendo de lo que bamos a hacer en el ao, tambin creamos el CV y lo enviamos.','2019-03-21'),(870,44,'Desarrollo de CV e introduccion a la materia.','El profesor Olaso nos explico como nos vamos a manejar en la materia y nos separaron por grupos.Tambin hice mi CV y me registre a esta pagina.','2019-03-21'),(871,48,'Presentacin de la materia, registro en la pag de la materia y hacer cv','Escuchamos de que se trataba esta materia, nos registramos en la pag web de la materia y realizamos nuestro cv ','2019-03-21'),(872,41,'Presentacin de la materia y creacin del cv','En el da del 21/03 los profesores se presentaron y explicaron de que se va a tratar la materia  y nos pidieron que creemos nuestro Curriculum vitae.','2019-03-21'),(873,55,'Presentacin de la materia y creacin del curriculum ','Hoy no presentaron la metera y nos explicaron las pautas y objetivos de esta misma, tambin creamos un curriculum.','2019-03-21'),(874,50,'Introduccin a la materia','El profesor nos presento la metodologa de trabajo de las practicas profesionalizantes seguido de registrarnos en la pagina de &quot;encuentrotecnologico&quot;. Por ultimo, creamos un curriculum para cada uno y se lo enviamos al profesor.','2019-03-21'),(875,39,'Introduccion a la materia','El profesor nos presentaron la metodologia de trabajo de las practicas profesionalizantes seguido de registrarnos en la pagina de &quot;encuentro tecnologico&quot;. Por ultimo, creamos un curriculum para cada estudiante y se lo enviamos al profesor.','2019-03-21'),(876,53,'Introduccin de la materia','El profesor hablo sobre la materia y como la cursaramos, escribi un mail al que se tenia que enviar un curriculum, si ya lo tenias armado no hacia falta armarlo y el que no bueno, tenia que hacerlo. Al terminar eso escuche la radio.   ','2019-03-21'),(877,46,'Introduccion de la materia','Hoy el profesor nos hablo de como sera el trabajo en la materia, respondio nuestras dudas y terminamos armando el curriculum vitae ','2019-03-21'),(878,56,'','Se hizo la presentacin de la materia &quot;Practicas Profecionalizantes&quot;, se realizo un registro de usuarios en el dominio &quot;www.encuentrotecnologico.com/pp&quot; y se finalizo la jornada con una realizacin y entrega de curriculums vitae','2019-03-21'),(879,37,'Presentacin + CV','Los profesores Damian Olaso y Gonzalo Consorti nos explicaron de qu trata la materia, las diferentes opciones de estudio que tenemos durante el ao (Ya sea dentro del colegio o yendo afuera a la empresa que se nos sea designada), las formas de calificacin, los requisitos para aprobar la materia, los horarios mnimos que debemos cumplir a lo largo del ao, y la web mediante la que nos manejaremos(sta misma).\nTambin tuvimos la tarea de crear un Curriculum Vitae y enviarlo mediante un e-mail, para brindar a los profesores.','2019-03-21'),(880,45,'Introduccin de la materia','olaso nos introdujo a la materia practicas profecionalizante despejo dudas cada uno se matriculo en encuentro tecnolgico e \nhicimos nuestro propio curriculum','2019-03-21'),(881,36,'preguntas y git','escribimos en un papel entre todos las preguntas para el programa de preceptores y respondi las preguntas de git','2019-03-22'),(882,43,'Preguntas y Git','Hoy nos tuvimos que sentar todos en una mesa para pensar preguntas para hacrselas al preceptor y que las responda. Luego, tuvimos que responder dos preguntas acerca del Git que se trataban de que se trataba y cuales eran los comandos, tambin una tarea para casa sobre hacer un proyecto.','2019-03-22'),(883,48,'Realizamos preguntas, y buscamos informacion sobre git','Nos reunimos en el medio del aula conversando para realizar una serie de preguntas que usaremos para programar una aplicacion que tiene que ver con la preceptoria del colegio, Luego buscamos en internet informacion de que se trataba el GIT y buscar cuales eran sus comandos mas usados.','2019-03-22'),(884,51,'Sistema para preceptoria y &quot;GIT&quot;','hoy estuvimos pensando en preguntas que se le pueden hacer a un preceptor/a para hacer a futuro una app donde digitalice todo sus tareas y averiguamos sobre el termino &quot;GIT&quot;. buscamos cual es su funcin y describimos la funcin de sus comandos mas utilizados','2019-03-22'),(885,42,'Introduccin a GIT','El profesor nos presento un nuevo tipo de sistema o comando, del cual tuvimos que investigar los conceptos bsicos, tambin tuvimos que formularnos unas preguntas para un futuro proyecto en el cual tendremos que entrevistar a los preceptores para hacer un tipo de aplicacin o pagina web para simplificar sus tareas.\n','2019-03-22'),(886,47,'Preguntas y investigacion sobre GIT','Escribimos preguntas para hacerle a los preceptores sobre la gestin de preceptoria y investigue y respond preguntas sobre GIT.','2019-03-22'),(887,37,'Proyecto preceptoria + .GIT','En el da de hoy tuvimos la tarea de escribir preguntas para realizar en un futuro a preceptoria, con el fin de crear una aplicacin que facilite su trabajo con las respuestas a stas preguntas. Luego de esto, averiguamos sobre .GIT, sus funciones, sus comandos y los ms utilizados. Deberemos usar .GIT a lo largo de todo el ao para todos nuestros proyectos.','2019-03-22'),(888,54,'sistema de gestin para preceptoria','En el da de la fecha nos encargamos de realizar un cuestionario para luego resolver dudas cuestionando le las mismas a los preceptores del colegio para confeccionar el sistema de gestin para preceptora ','2019-03-22'),(889,39,'Introduccion a git','Hoy vimos un tipo de comando llamado Gitlab y Github, realizamos un trabajo en el cual describimos su funcion y codigo. Sumado a una actividad grupal en al que desarrollamos preguntas para una aplicacion sobre preceptoria.','2019-03-22'),(890,50,'Introduccin a GIT','El profesor nos presento el concepto bsico del sistema &quot;GIT&quot;, el cual utilizaremos para el desarrollo del proyecto final. Seguido de esto, de manera grupal sugerimos distintas preguntas para llevar a cabo una entrevista con los preceptores y otras entidades de la escuela.','2019-03-22'),(891,44,'Preguntas para prefceptoria y GIT','Desarrollamos varias preguntas para hacercelas a los preceptores y as realizar una aplicacion para ayudarlos en su trabajo. Una vez terminadas las preguntas buscamos informacion sobre GIT (GIT HUB Y GIT LAB). ','2019-03-22'),(892,57,'Preguntas y Git','Realizamos preguntas para para preceptora para completar los datos en una aplicacin para as facilitarles el trabajo y respondimos algunas preguntas sobre lo que significaba el Git.','2019-03-22'),(893,55,'Realizacin de preguntas y Git','Nos sentamos en el centro del aula y estuvimos haciendo preguntas al preceptor, luego tuvimos que responder dos preguntas relacionadas con el GIT. ','2019-03-22'),(894,38,'Proyecto preceptoria y .GIT','En el da de hoy tuvimos la tarea de escribir preguntas para hacerles  a preceptoria, con el fin de tomar esas preguntas como referencia para, nosotros,  crear una aplicacin que facilite su trabajo. Luego de esto, averiguamos sobre .GIT, sus funciones, sus comandos y los ms utilizados. ','2019-03-22'),(895,52,'Introduccin a GIT','en este dia aprendimos sobre git para futuros proyectos de fin de ao','2019-03-22'),(896,53,'Introduccin sobre el proyecto','Empezamos la clase con una charla de que se tendra que crear un proyecto para ayudar o veneficiar el trabajo a los preceptores, el profesor nos dijo que tengamos que armar preguntas para as luego los preceptores tengan que responder( o eso pienso hoy), buscar informacin sobre GIT y sus comandos.','2019-03-22'),(897,40,'Sistema para preceptoria y &quot;GIT&quot;','Hoy realizamos una serie de preguntas junto con todo el curso sobre las tareas que hace la preceptoria, para luego desarrollar una aplicacion que facilite sus tareas, luego investigamos sobre una aplicacion llamada GIT como funciona y los comandos mas utilizados.','2019-03-22'),(898,41,'Reunin entre todos y buscamos informacin sobre git','En el da de 22/03 nos juntamos todos los alumnos a hacer preguntas para realizar una aplicacin de sistemas de gestin de preceptoria, despus buscamos informacin sobre cules son las funciones del git. ','2019-03-22'),(899,58,'realizar preguntas y buscar informacion sobre el git','hoy nos juntamos en la mesa todos e hicimos preguntas para desarrollar una aplicacion sobre como mejorar preceptoria y despues de hacer la preguntas. Busque informacion sobre el git que es? cuales su funcion? los comandos mas utilizados del git.','2019-03-22'),(900,45,'sistema de gestin para preceptoria','hoy hicimos un cuestionario de gestin de preceptoria y vimos algunas cuestiones con el git','2019-03-22'),(901,60,'Introduccion a GIT','El dia de hoy tuvimos que organizarnos con todo el curso para comenzar hacer una aplicacin que ayudara a la preceptoria.\nLuego tuvimos que investigar la funcin y los comandos mas utilizados en GiT.\nComo ultimo punto tenemos que hacer un mini proyecto para poder aprender a utilizar esos comandos.','2019-03-22'),(902,56,'Introduccin a GIT','se empez con una explicacin sobre el tema, entre todos pensamos un cuestionario para posteriormente comenzar un proyecto para un sistema de gestin para preceptoria.','2019-03-22'),(903,47,'Preguntas para preceptoria en grupo','En grupo hicimos preguntas para preguntar a los preceptores, mi grupo era de observar comportamiento de alumnos.','2019-03-28'),(904,51,'Preguntas de Preceptoria','Formamos grupos de 4 y anotamos preguntas que les tenemos que hacer a los preceptores, nuestro tema era &quot;Pasar Notas&quot;','2019-03-28'),(905,42,'Trabajo en grupo','Comenzamos con una breve charla del profesor, luego hicimos una lluvia de ideas entre todo el curso y para finalizar el da de trabajo formamos grupos e hicimos preguntas para las encuestas que se van a hacer a los preceptores en base al programa que vamos a desarrollar a lo largo del ao. ','2019-03-28'),(906,44,'Preguntas para la preceptoria.','Desarrollamos varias preguntas dirigidas para los preceptores de la seccin &quot;Cumincados a alumnos&quot; .','2019-03-28'),(907,48,'Realizamos Preguntas sobre el software que desarrolaremos en lo largo del ao','Comenzamos la clase sobre un resumen, luego comenzamos a realizar preguntas entre todos relacionado al software.\nMas tarde nos separamos en diferentes grupos para realizar preguntas basado al tema que le toco a cada grupo','2019-03-28'),(908,38,'Brainstorm y Desarrollo de preguntas sobre el tema de solicitud de certificados','En el dia de hoy el profesor nos dividi en grupos de aproximadamente 4 personas por equipo en el cual los equipos tenian que desarrollar diferentes tipos de preguntas sobre algun tema en especifico, esos temas fueron elegidos por los profesores y los alumnos mediante una brainstorm(lluvia de ideas) . El tema que nos toco fue solicitud de certificados','2019-03-28'),(909,53,'Seguimientos de las preguntas ','Este dia 27/03/2019 Al iniciar la clase charlamos un rato para armar las preguntas, luego nos dividieron en grupos para los mismo pero ahora cada uno se dedicaba a diferentes temas para armar las preguntas.','2019-03-28'),(910,36,'preguntas de preceptor para un programa','escribimos enuna hoja las preguntas a realizar a los preceptores en grupo ','2019-03-28'),(911,56,'Preparacin de cuestionario en grupos','Se dialogo de forma grupal distintas tareas que realizan los preceptores da a da en su trabajo. Nos dividimos en subgrupos y formamos un cuestionario, segn cada tarea hablada anteriormente.','2019-03-28'),(912,43,'Que pasaba si reprobabamos la materia y preguntas al preceptor','Primero el profesor nos dijo que pasaba si reprobbamos su materia y que tendramos que hacer. Tambin, tuvimos que hacer grupos y hacer preguntas que le haramos al preceptor de cierto tema. ','2019-03-28'),(913,40,'Desarrollo de Preguntas','hoy hicimos una lluvia de ideas sobre como realizan las tareas los preceptores entre todo el curso, luego nos dividimos en grupos encargndonos de realizar preguntas sobre cada tarea.','2019-03-28'),(914,58,'cuestionario para los preceptores','comenzamos con una charla sobre la materia de que pasaria si no aprobamos la materia ,luego hicimos unas preguntas para los preceptores de como es su materia','2019-03-28'),(915,37,'Brainstorm y preguntas para el software.','Hoy hicimos una Brainstorm entre todo el curso, para definir sobre qu temas se van a basar las preguntas que hagamos en un futuro para el desarrollo del software. Luego de sto, fuimos separados en grupos para realizar stas preguntas. Cada grupo tenia un tema en particular.','2019-03-28'),(916,57,'Preguntas de Preceptoria','Realizamos preguntas para agilizar el trabajo de los preceptores y para contestar algunas de nuestras dudas, todo esto para introducirlo en un programa a futuro. Nos dividimos las diferentes tipos de preguntas que podramos hacerle a los preceptores.','2019-03-28'),(917,49,'preguntas sobre el tema de solicitudes de certificados ','Hoy hicimos la lluvia de ideas para poder implemetar los temas,  el profesor nos dividio en grupos de a 4 para hacer preguntas sobre el tema de solicitudes de certificados y tambien entregamos el curriculum vitae.\n\n','2019-03-28'),(918,52,'Trabajo en grupo','el dia de la fecha realizamos una serie de preguntas para el desarrollo de una aplicacin web, luego fuimos divididos en grupos para realizar distintas tareas con esta aplicacin con preguntas realizadas para tener mas preguntas con conceptos distintos.','2019-03-28'),(919,41,'preguntas sobre el sistema de gestion de preceptoria','en el da 28/03 nos reunimos entre todos a hacer preguntas sobre la aplicacin y despus nos juntamos de a grupos mas chicos a centrarnos en algunas preguntas especificas sobre el software ','2019-03-28'),(920,46,'Preparacin de cuestionario en grupos','en la clase de hoy dimos un brebe repaso de la introduccion y como es el metodo para aprobar la materia los que se la llavan a diciembre.\narmanos 6 grupos de cuatro personas para trabajar con la tarea asignada que concta en el metodo que trabaja la esc