or Damian Olaso nos introdujo con una breve explicacin a la materia, se nos dividi en los grupos de trabajo que conformaremos para realizar a cabo uno de los proyectos y comenzamos haciendo el CV (Curriculum Vitae).','2019-04-11'),(990,53,'Nuevos integrantes y secciones de grupo','El profesor explico a lo nuevos alumnos como iba a hacer las clases, proyectos, grupos y tambin explico que hicimos anteriores clases e como se aprobaba. Buscar informacin de GIT, y probarlo al mismo tiempo que se iba viendo. ','2019-04-11'),(991,45,'introduccin  a GIT','hoy empezamos a ver los fundamentos de GIT bsicamente sus funciones como usarlo y tambin se definieron los grupos de trabajo y sus sectores correspondientes con sus lideres respectivos','2019-04-11'),(992,83,'hacer cv','hoy hice mi cv y me pusieron en el grupo  de infraestructura compuesto por 4 integrantes. nos explicaron como se maneja esta materia ','2019-04-11'),(993,42,'Formacin de grupos e investigacin sobre GIT','Investigamos acerca de GIT ms profundamente, tuvimos la formacin de grupos en base a las cualidades individuales de cada uno y se eligieron los lideres de los grupos respectivamente. ','2019-04-11'),(994,46,'Division de los grupos','el dia de hoy nos juntamos con los de 6 del turno maana, luego nos dividimos en grupos para el trabajo que consta en: diseo, bd, desarrollo e infraestructura y posteriormente nos explicaron la modalidad del trabajo','2019-04-11'),(995,51,'Nuevos Integrantes y division de grupos','vinieron nuevos compaeros que son del turno maana y los profesores separaron  a todo el curso en 4 grupos, a mi me toca el grupo de Base de Datos y tambin nombraron a los lideres de cada seccin','2019-04-11'),(996,55,'Probamos el programa GIT','Estuvimos buscando informacin sobre el programa GIT, luego de eso procedimos a probar los cdigos que encontramos.  ','2019-04-11'),(997,81,'Introduccin','Hoy nos dieron una introduccin a la materia, dada que es la primera vez que la tenemos. Nos explicaron cmo funciona, cules son las tareas y el proyecto que vamos a realizar. Luego nos separamos en secciones donde cada una se encarga de una parte del proyecto: desarrollo, diseo, infraestructura y base de datos. Los profesores nos dijeron con quin nos toc en cada grupo y que yo iba a ser la lider de este.\nParalelamente a esto, arm mi curriculum vitae.','2019-04-11'),(998,50,'GIT y division de areas','Tuvimos un vistazo individual del funcionamiento de GIT como herramienta de trabajo grupal. Seguido de esto nos dividimos en distintas reas de trabajo, siendo estas: desarrollo, diseo, infraestructura y bases de datos. ','2019-04-11'),(999,78,'CV','Trabajamos en la busqueda de plantillas para armar un cv. Vimos que informacin debe tener, sobre las experiencias, aptitudes, formacin, etc.\nDescargamos tambin la plantilla para poder empezar a armar el cv. \nAdems hablamos de los requisitos para aprobar la materia (cumplir las horas reloj, tener buenas prcticas).','2019-04-11'),(1000,79,'Introduccin','Hoy fue nuestro primer da, nos presentaron la materia, lo que se hara aproximadamente, los proyectos y los requisitos para aprobar la materia (216hs, entrega de proyectos, buenas practicas, presentismo, llegar a horario). Ademas de todo eso se nos asigno una seccin (en mi caso infraestructura) segn nuestras capacidades, la de los dems y las secciones que cada uno prefiera. Ademas de eso empece mi curriculum vitae para presentar en caso de que sea necesario en un futuro.  ','2019-04-11'),(1001,80,'Primer dia ','11/04\nEl da de hoy estuvimos dedicando nuestras horas de prcticas profecionalisantes en desarrollar un currculum vitae. Busque planillas, ejemplos de cvs, imgenes, etc. Tambin completamos una evaluacin personal que se trat sobre describirme puntundome del 1 al 10. Me pareci una evaluacin interesante e inusual.\n','2019-04-11'),(1002,56,'GIT y division de areas','Nos organizamos y dividivos en areas de trabajo (Desarrollo, Diseo, Infraestructura y Base de datos), se designaron los lideres de cada area e hicimos investigacion sobre las herramientas que nos brindan GIT','2019-04-11'),(1003,84,'divisin de reas','primer de las practicas, nos explicaron las reas y cada uno desido que tipo de reas le gustaran hacer, en mi caso diseo,y base de datos junto con sus lideres, que por acto de suerte me toco ser el lider de infraestructura, una divertida y simptica primer clase. ','2019-04-11'),(1004,72,'Tercera clase','09/04/19\nEl da de hoy fue la primera clase de prcticas, lo que me dejo bastante emocionado.\nFue la primera vez que hago un cv con tanta velocidad y adems fue una experiencia bastante interesante.\nAdems volv a escribir una bitcora despus de tanto tiempo.\nSe me olvido subir.\n16/04/19\nVamos a comenzar un proyecto de diseo de pginas web. La web ser de utilidad para la oficina de alumnos.\nMe parece que estoy aprendiendo un poco ms de que va la materia y todas sus funciones. Aparte de eso, estoy pensando en mi nuevo grupo, el cual, comienza la semana que viene y se trata de la parte de desarrollo de la pgina web que vamos a implementar.\nDespus de esto, hoy estuve viendo vdeos de un programa llamado git, por el que estoy aprendiendo a usar.\nAdems empec con la parte borrador de la pgina, pudiendo escribir diferentes utilidades para la misma.\n','2019-04-16'),(1005,63,'Tercera clase.','Hoy nos asignaron los grupos de trabajo en los que vamos a estar (mi grupo es el de diseo). Tambin finalizamos la lluvia de ideas de la clase anterior.\nPor ltimo estuvimos continuando con el curso de git.','2019-04-16'),(1006,71,'tercera clase','Terminamos el formulario de preguntas para la entrevista con oficina de alumnos, division de grupos para distintas areas y descargamos de git','2019-04-16'),(1007,66,'Tercera clase','Hoy se volvi a hacer una lluvia de ideas para ver si podemos agregar mas preguntas para poder hacerle a la oficina de alumnos, luego se nos asigno a que grupo debemos ir, en mi caso temporalmente estoy en diseo hasta que me lo confirmen maana, tambien seguimos viendo guias de git.','2019-04-16'),(1008,65,'GIT','comenc a programar en git con algunos cdigos simples\n','2019-04-16'),(1009,69,'tercera clase','terminar de formular preguntas, seguimos viendo videos de como hacer cdigos en GIT, descargar el programa GIT , divisin de reas.','2019-04-16'),(1010,68,'Aprendizaje de Git','Dimos nuestros primeros pasos en Git, creando un usuario y mostrndolo por pantalla','2019-04-16'),(1011,72,'Cuarta clase, primer da del grupo.','Creo que hoy fue una de las clases que mas cosas realice y aprend.\n\nPuede que el da de hoy, las cosas se hayan complicado pero tengo grandes expectativas sobre la materia. ademas pude aprender lo bsico del Codeigniter, y pude ensearle a mi grupo como es que este framework funcionaba.\n\nMi grupo ya es capas de escribir los cdigos y usar las funcionalidades bsicas del programa. El programa me parece bastante interesante aun que, an no le agarro la mano para utilizarlo con libertad. ','2019-04-17'),(1012,41,'Git y codeigniter','En el da de hoy nos separaron en diferentes reas de trabajo que eran base de datos, servidores,diseo y desarrollo a m me toc diseo estuvimos investigando sobre el git descargamos la aplicacin y empezamos a ver algunos cdigos tambin espezamos a ver sobre codeigniter','2019-04-17'),(1013,43,'Nos separamos en sectores y probamos el Git','Todos nos tuvimos que ir con el sector que nos eligieron y luego de eso, empezamos a ver vdeos de Git mientras bamos probando los cdigos en su respectiva aplicacin. Tambin vimos el CodeIgniter.','2019-04-17'),(1014,36,'tutorial','me asignaron al sector desarrollo. vi tutrial de git y codeignite y lo probamos.','2019-04-17'),(1015,47,'Aprendiendo CodeIgniter','Nos dividieron en sectores y me toco en desarrollo. Empezamos a aprender como usar codeigniter','2019-04-17'),(1016,66,'Cuarta clase','Hoy me asignaron al equipo de desarrollo y eligieron a los lideres, tambien seguimos viendo un poco de git pero dado que hay un error en las maquinas no podemos avanzar mucho. Nos dijeron que investiguemos un framework, CodeIgniter, estuve viendo unos tutoriales en youtube sobre el tema, tal parece que nos ayudara a la hora de darle seguridad al proyecto. ','2019-04-17'),(1017,64,'Aprendimos a usar CodeIgniter y otras cosas','Aprendimos a utilizar el programa ya mencionado en el titulo, a como configurarlo, y aprender sus funciones ya que lo vamos a implementar en nuestro futuro proyecto. Tambin nos asignaron al rea de Infraestructura por alrededor de dos meses','2019-04-17'),(1018,39,'Aprendimos a usar CodeIgniter y otras cosas','Aprendimos a utilizar el programa ya mencionado en el titulo, a como configurarlo, y aprender sus funciones ya que lo vamos a implementar en nuestro futuro proyecto. Tambin nos asignaron al rea de Infraestructura por alrededor de dos meses','2019-04-17'),(1019,54,'Aprender bit y Codeigniter','Hoy aprendimos lo bsico de Git y Codeigniter mediante tutoriales en Internet  y practicamos probando algunos cdigos bsicos ','2019-04-17'),(1020,40,'GIT y Codeigniter','hoy vimos los tutoriales de git, practicamos los diferentes codigos y empezamos a probar codeigniter','2019-04-17'),(1021,71,'Git y CodeIgniter','Descargamos  y creamos un usuario en Git. Descargamos y trabajamos con CodeIgniter','2019-04-17'),(1022,52,'agrupacion y estudio','me pusieron en el grupo de desarrollo con siete personas mas para empezar el proyecto y estudiamos git dandole un repaso y estudiando codeignite  ','2019-04-17'),(1023,63,'Cuarta clase','Hoy terminamos de ver el contenido de git y empezamos a ver codeigniter. Anteriormente se aclaro el mbito en el que va a estar cada uno; ayer me dijeron diseo pero resulta que estoy en desarrollo.\nEn cuanto a codeigniter vimos que es un framework que va a ser utilizado para brindarle seguridad al proyecto que estaremos realizando en breve.','2019-04-17'),(1024,57,'Avanzando con GIT e introduccin a Codeigniter','Avanzamos con los cdigos de GIT separados en grupos de trabajo en el cual qued en &quot;desarrollo&quot; y nos introducimos a Codeigniter.','2019-04-17'),(1025,65,'GIT y CodeIgniter','Terminamos con GIT y empezamos con CodeIgniter\n','2019-04-17'),(1026,49,'GIT y Codeigniter','hoy terminamos con GIT y empezamos con Codeigniter.','2019-04-17'),(1027,61,'GIT y  CodeIgniter','en el dia de hoy vimos tutoriales de como usar GIT y codeigniter tambien probamos algunos codigos que vimos en el dia ','2019-04-17'),(1028,38,'GIT y Codeigniter','Hoy finalizamos con los tutoriales de git, pusimos en funcion algunos codigos como practicar,  ademas de eso hoy comenzamos con codeigniter','2019-04-17'),(1029,68,'Aprendizaje de CodeIgniter','Con ayuda de un canal de YouTube, comenzamos a aprender CodeIgniter','2019-04-17'),(1030,43,'Vimos un poco de videos de Git','Estuvimos viendo lo que nos quedaba por ver de videos de Git y hablamos un poco del Diagrama de Gantt, cosa que haremos y entregaremos la prxima clase.','2019-04-23'),(1031,47,'Segui con la guia de CodeIgniter','Segui con la guia de CodeIgniter','2019-04-23'),(1032,36,'git','seuimos on la guia de git en youtube. se corto la luz','2019-04-23'),(1033,64,'Problemas Tecnicos','En el da de la fecha en el establecimiento se cort lo luz y no pudo trabajar de la forma ms adecuada, por ese caso en esta ocasin no se pudo adelantar tanto en el proyecto, lo que si llegamos a hacer es que el profesor presente no paso un ejemplo de los diagramas de  Gantt de los alumnos de la cursada del ao anterior.','2019-04-23'),(1034,41,'Codeigniter','En el da de hoy estuvimos viendo la gua de vdeos de codigofacilito sobre codeigniter. ','2019-04-23'),(1035,63,'Quinta clase','Hoy continu viendo el contenido de CodeIgniter, estaba en la mitad de la parte 6 hasta que se corto la luz, pero llegue a ver sobre controladores y estructuras de archivos.\nPor ultimo nos agrupamos en nuestros mbitos de trabajo para la realizacin del diagrama de Gantt que adjuntara las actividades que trabajaremos prximamente cuando tengamos toda la informacin necesaria.','2019-04-23'),(1036,54,'Guia Codeigniter y diagrama de gantt','En el da de la fecha continuamos viendo la gua de codeigniter, luego vimos un diagrama de Gantt para poder realizar uno para el rea de trabajo que nos corresponde','2019-04-23'),(1037,52,'repaso','hoy fue un da de repaso sobre el git quien no lo vio y tambin un repaso de codeigniter.\ntambin se propuso Empezar y terminar el diagrama de gantt por area','2019-04-23'),(1038,69,'23/04','Seguimos con los tutoriales de CodeIgniter y empezamos a ver el diagrama de Gantt por area. ','2019-04-23'),(1039,57,'Seguimos con la guia de CodeIgniter y vimos Gantt','Nos seguimos capacitando sobre Codeigniter mediante videos y empezamos a realizar el diagrama de Gantt','2019-04-23'),(1040,66,'Quinta clase','Hoy continu viendo guas de Codeigniter hasta que se corto la luz, por lo cual no pude profundizar demasiado. Ademas de eso nos pidieron que realizamos un diagrama de gantt y nos mostraron uno realizado por los anteriores chicos de sexto ao para tomarlo como gua.','2019-04-23'),(1041,71,'23/04','Continuamos viendo la Guia de CodeIgniter y empezamos a ver el diagrama de Gantt para entregar por area','2019-04-23'),(1042,38,'GANTT','Hoy nos introduccimos en lo que es GANTT mediante un excell que nos envi el profesor, en el cual tendremos que implementar lo aprendido para realizar nuestro diagrama','2019-04-23'),(1043,49,'GANTT','hoy el profesor nos paso la introducciones de lo que seria gantt','2019-04-23'),(1044,65,'CodeIgniter Y Gantt','Finalizamos con codeigniter y introducimos Gantt','2019-04-23'),(1045,68,'Aprendizaje de CodeIgniter','El poco tiempo que tuvimos disponible fue dedicado a continuar con dicho framework y ver ejemplos de diagramas de Gantt.','2019-04-23'),(1046,67,'Diagrama de Gantt y CodeIgniter','El dia de hoy hicimos una parte del diagrama de Gantt y despus aprendimos un poco de codeigniter viendo codigofacilito','2019-04-24'),(1047,67,'Diagrama de Gantt y CodeIgniter','El dia de hoy hicimos una parte del diagrama de Gantt y despus aprendimos un poco de codeigniter viendo codigofacilito','2019-04-24'),(1048,72,'Clase seis, Codeigniter','24/04\nAprend y termine de hacer el diagrama de Gantt. Tambin puedo decir que fue una clase bastante tranquila pero igual trabaje  porque si no me aburra.\nEstuvimos viendo cmo se realizaba la montura de Codeigniter en Git e intentamos hacer funcionar la pgina.\nPor otro lado hoy mezcle todo lo que aprend de css, html, y base de datos con git y Codeigniter. Lo que fue bastante interesante ver como todo se juntaba para hacer algo de un nivel ms avanzado.\n','2019-04-24'),(1049,63,'Sexta clase','En esta clase empezamos haciendo el diagrama de Gantt, pero no pusimos cosas como las fechas ya que no sabemos cuando vamos a empezar. Posteriormente seguimos viendo contenido de CodeIgniter y realizamos un trabajo sencillo con html y css para ver la ejecucin del mismo mediante CodeIgniter.','2019-04-24'),(1050,68,'Prctica con CodeIgniter','Hicimos una pgina bsica de html con css y php para probar el uso de CodeIgniter, lo que result en un error de acceso denegado (error 403) por razones relacionadas a los controladores.','2019-04-24'),(1051,71,'24-04-19','Hicimos el diagrama de Gantt, una pagina web para montarlo en CodeIgniter, y volvimos a ver CodeIgniter en codigofacilito','2019-04-24'),(1052,66,'Sexta Clase','Hoy con el grupo de desarrollo trabajamos con el diagrama de Gantt, y ademas de eso continue viendo un par de guias de Codeigniter y ademas para implementar lo visto cree una pagina con html y css.','2019-04-24'),(1053,73,'Diagrama de gantt y codeigniter','Hoy hicimos un diagrama de gantt para el proyecto de diseo y aprendimos a usar el codeigniter ','2019-04-24'),(1054,69,'CodeIgniter','Terminamos el diagrama de Gantt y lo enviamos.\nSeguimos con los tutoriales del codeigniter, lo descargamos y lo probamos.\nHicimos una pagina web en atom para despus monstarlo al CodeIgniter.','2019-04-24'),(1055,64,'Realizacin de Cosas Importantes','En el dia de la fecha hicimos el gantt respectivo del grupo, vi como montar un servidor en Linux y empeze con mi grupo a probar el CodeIgnater.','2019-04-24'),(1056,65,'GANTT y Codeigniter','Finalizamos el diagrama de gantt para la seccion de diseo con proyect y comenzamos a programar con codeigniter.','2019-04-24'),(1057,48,'Realizamos preguntas y utilizamos el project','Nos reunimos a realizar un par de preguntas que se le realizarian a los preceptores con el fin de poder desarrolar el programa en el que estamos trabajando.\nLuego realizamos el diagrama de gantt con el microsoft project ','2019-04-25'),(1058,60,'Investigacion y preguntas.','El dia de hoy se investigo sobre GiT y CI.\nAdemas de terminar las preguntas, los lideres de cada grupo tomaron las preguntas y fueron hablar con el jefe de preceptores.\nTan empezamos a hacer un prototipo de GANTT de cada grupo para luego hacer una reunin y completarlo juntos.','2019-04-25'),(1059,51,'Diagrama de Gant','hoy nos reunimos todos para hacer preguntas acerca de &quot;inasistencias&quot; para el proyecto y luego nos separamos en los grupos que ya tenamos estipulados e hicimos un diagrama de gantt acerca de nuestra area que en este caso es el de Base de Datos','2019-04-25'),(1060,75,'Etapa investigacin y aprendizaje','En esta clase empece a trabajar ya en el sector que me corresponde (Desarrollo). Investigue del uso de CodeIgniter y se me delego aprender el Materialize (CSS). ','2019-04-25'),(1061,44,'Aprendi a usar github con alguno comnados y busque informacion sobre CodeIgniter y como usarlo','En el primer modulo aprendi a como instalar y agrega a las carpetas de sublime text 3 el frame work &quot;CodeIgniter&quot;. Aprendi para que sirven algunas de sus carpetas y como hacer los controllers. Busque informacion de github y como usar los codigos; crear un perfil y agregar archivos.','2019-04-25'),(1062,37,'Investigacin sobre GIT y GITHub.','Hoy v un conjunto de videos explicativos sobre qu es GIT, para qu sirve, y cmo utilizarlo. En stos videos aprend algunos de los comandos esenciales de GIT. Tambin aprend qu es la plataforma GITHub y para qu se utiliza, cmo se utiliza y cul es su fin.\nPor ltimo, junto con todo el curso, dimos por finalizado el tema de las preguntas sobre presentismo para preceptoria. Nos juntamos y escribimos todas las preguntas sobre presentismo que se nos ocurrieron, y un grupo fue a preceptora a solventar nuestras dudas','2019-04-25'),(1063,53,'Variedad de tareas','Tareas que se realizaron:\n-Armar mas preguntas con todos los grupos.\n-Buscar informacion sobre codeigniter y probarlo\n-4 personas fueron a preguntar al preceptor sobre las preguntas que se hicieron.\n','2019-04-25'),(1064,83,'organizacion','hoy nos juntamos y empezamos a trabajar con el diagrama gantt, nos guiamos con unos ejemplos, nos consultamos entre todos y sacamos conclusiones, luego nos dividiremos las tareas para trabajar. \nTambin  se empez la carpeta de campo que con  el tiempo se ira estableciendo a su modo final.','2019-04-25'),(1065,78,'Proyecto y CodeIgniter','Ya con los grupos asignados, definimos el proyecto que vamos a trabajar, el cual es el de oficina de alumnos. Se requiere informatizar las faltas, ingresos posteriores y retiros anticipados.\nPara este proyecto se pensaron preguntas entre todos para hacerles a los clientes. Son preguntas como: Cmo se computan las faltas? Cmo funciona las reincorporaciones? falta con presencia? Cundo el alumno llegue al lmite de faltas que se procede? Etc.\nTambin designamos el rol que tenemos cada miembro del grupo de desarrollo. Uno se ocupa del framework Materialize, otro de Git, otros del diagrama de Gantt y yo de CodeIgniter.\nAntes de aprenderlo me informo sobre el lenguaje, ventajas y desventajas y a partir de ah empiezo a aprenderlo, viendo una introduccin y sobre su estructura de archivos.\n','2019-04-25'),(1066,45,'introduccin al campo de diseo','hoy desarrollamos un diagrama de gantt usando una guia que paso el profe va pendrive y lo usamos para adaptarlo particularmente a nuestra seccin, en mitad de la clase hicimos una reunin en medio del saln para hacer otro cuestionario esta vez del presentismo de los alumnos con respecto a los preceptores los lideres de los grupos luego de eso fueron a hacer las preguntas personalmente.','2019-04-25'),(1067,80,'Clase 2','El da de hoy investigue sobre git, codeline, un framework PHP para el desarrollo rpido de aplicaciones web. viendo algunos videos en youtube sobre como hacer uso de el. Tambin trabajamos en el Gantter para as organizar los tiempos del proyecto.','2019-04-25'),(1068,42,'entrevista y GANTT','Empezamos haciendo el diagrama de Gantt que utilizaremos a futuro, formulamos de nuevo las preguntas para la entrevista al jefe de preceptores y luego fuimos a hacerle la entrevista para poder recolectar mas datos, tambien grabamos un poco en grabadora de voz. ','2019-04-25'),(1069,46,'organizacion','hoy nos juntamos en grupos para empesar el proyecto de infraestructura, luego con la ayuda del lider armamos el diagrama de gantter en el cual se planteo del plan de trabajo de los siguientes dias. Tambien se empezo la carpeta de campo ','2019-04-25'),(1070,82,'comienzo de diseo','hicimos preguntas sobre el presentismo de los  alumnos, empezamos a hacer el diagrama de gantt, los lideres de cada seccin fueron a hacer en persona las preguntas del cuestionario de presentismo a los preceptores y comienzo de carpeta de campo.','2019-04-25'),(1071,85,'Investigacion y preguntas.','Como lider del el grupo organize las tareas de investigacion de los integrantes del grupo, tambien estuve investigando sobre el framework CodeIgniter y empeze a realizar el diagrama GANTT, tambien junto a los lideres de los demas grupos hicimosuna pequea encuesta al subjefe de preceptores sobre el funcionamiento de la preceptoria','2019-04-25'),(1072,50,'Investigacion y GANTT','Realizamos en la aplicacion Gantter el diagrama de GANTT de cada departamento, seguido de finalizar en grupo las preguntas para la entrevista. Por ultimo, llevamos a cabo la fase inicial de dicha entrevista.','2019-04-25'),(1073,55,'Realizamos nuevamente preguntas y utilizamos el project','Hicimos nuevas preguntas que posteriormente se las dijimos al preceptor el cual las respondio, ademas de eso estuvimos realizando el diagrama de gantt.','2019-04-25'),(1074,56,'inicio de diseo','Investigacion sobre Codeigniter\nRevision de preguntas para la gestion en preceptoria\nDiagramacion de Gantt, describiendo las etapas y tiempos de avance de nuestra area (DISEO)\n','2019-04-25'),(1075,74,'Diagrama de Gant','como lder del grupo  de infraestructura, empec creando lazos hablando con los integrantes y hacer que entre ellos establezcan conexin asi no se sienten incmodos y tratar de trabajar lo ms bien posible a pesar de que me cuesta hablar con extraos pude hacer que se establezcan lazos y trabajamos de lo mas bien. Nos organizamos las tareas  que vamos a hacer en un futuro con un programa llamada gantt, vamos en camino a realizaras, nos pasamos datos personales como numero de telfono, correo, redes sociales, etc. para pasarnos informacin y colaborar lo mas posible con el trabajo de forma mas unida si bien por lo vi, no somos el grupo ms listo, pero con el esfuerzo de todos los integrantes  vamos a poder lograr algo grande. maana ya vamos a empezar realizar dichas tareas que tenemos organizadas.  ','2019-04-25'),(1076,42,'Finalizacin de diagrama de Gantt','Terminamos de armar el diagrama y di una charla acerca de como vamos a manejarnos el tema de la informacin que debe repartirse por los grupos para tener una mejor coordinacin. ','2019-04-26'),(1077,51,'Diagrama de Gantt2','me junte con mi jefa y nos pusimos a hacer en papel como haramos el diagrama de gantt en la computadora','2019-04-26'),(1078,83,'investigacion','hoy a mi me toco investigar git, hosting y servidores al igual que a mi los otros tambien tenian trabajo por hacer.Por el momento solo e hecho la investigacion de git pero me falta terminar','2019-04-26'),(1079,75,'Aprendiendo Materialize CSS','En esta clase he visto vdeos de aprendizaje y de como funciona &quot;Materialize&quot;, para ms adelante poder usarlo en el desarrollo del proyecto final. ','2019-04-26'),(1080,53,'Proyecto galicia ','Introductorio de como poder realizar la app web para ayudar a los que estn en situacin de calle, el resto de la clase siguiendo lo de codeigniter','2019-04-26'),(1081,81,'Diagrama de Gantt','Hoy estuve trabajando con mi equipo sobre el diagrama de Gantt sobre la base de datos. Tambin empezamos a analizar cmo sera posiblemente la base de datos porque todava no nos pasaron la entrevista con Miguel. Escribimos las cosas bsicas que supusimos y empezamos un primer boceto de entidad-relacin.','2019-04-26'),(1082,76,'Diagrama Entidad Relacin','Basndome en la necesidad bsica del propio proyecto, estuve trabajando en la creacin del diagrama entidad relacin de lo que en un futuro sera la base de datos que contendr toda la informacin. Trabaje en base a una maqueta que me dio la lder del grupo, lo comenc a pasarlo al programa Draw.io, para tenerlo digitalizado.','2019-04-26'),(1083,37,'GIT, GITHub y Proyecto Solidario','Hoy continu viendo los videos sobre Git/GITHub, hice algunas pruebas para experimentar cmo funciona GIT por mi cuenta, y el profesor Olaso nos coment de qu trata la aplicacin que debemos realizar para el Banco Galicia, una aplicacin solidaria. Nos dio las pautas y los requisitos para dar por finalizada la misma. Tambin pensamos el diseo y toda la parte visual de sta.','2019-04-26'),(1084,50,'Actualizacion y finalizacion de diagrama de GANTT','Reformulamos y actualizamos el diagrama de GANTT con el que guiaremos al equipo de trabajo para realizar de forma ordenada las actividades.','2019-04-26'),(1085,46,'investigacion del proyecto','hoy investigamos sobre los servidores, git y otros para tener una gua mas adelante sobre como funciona, definicin y caractersticas','2019-04-26'),(1086,44,'Estudie github','Me estuve interiorizando en git y practicando con un poco de codigo y lineas de comando de git.','2019-04-26'),(1087,82,'continuacin ','el lider intento hacer las preguntas al preceptor Miguel pero no pudo as que no pudimos continuar y finalizancin del diagrama de gantter.','2019-04-26'),(1088,85,'Fui ingresado en un proyecto nuevo','fui ingresadoa unproyecto de un simulador de desfribilidador con los chicos de mecanica','2019-04-26'),(1089,45,'finalizacion y actualizacion de gantt','los lideres de los grupos intentaron entregar el cuestionario de preceptores, y terminamos y finalizamos el diagrama de gantt.','2019-04-26'),(1090,58,'finalizacion y actualizacion de gantt','los lideres de los grupos intentaron entregar el cuestionario de preceptores, y terminamos y finalizamos el diagrama de gantt.','2019-04-26'),(1091,58,'finalizacion y actualizacion de gantt','los lideres de los grupos intentaron entregar el cuestionario de preceptores, y terminamos y finalizamos el diagrama de gantt.','2019-04-26'),(1092,74,'comenzando la investigacin ','el da de hoy  repartimos y empezamos las tareas ya que tardamos mucho para pensar exactamente lo que bamos a hacer en el futuro, as que pusimos manos a la obra, uno hacia la carpeta de campo, y los dems investigacin para poder hacer el proyecto  para al finalizar la clase juntar todo, avanzamos bastante y desellamos los siguientes temas: servidores web, git, hosting, fps, dns, etc. con estos temas en mente nos vamos guiando para realizar los objetivos que son: disear redes, crear servidores, crear un mtodo de acceso privado para la seguridad, etc. \nuna vez juntado todos los datos recolectados charlamos organizarnos en estos das para avanzar lo mas posible. ','2019-04-26'),(1093,79,'Segundo da','No asist a la clase pasada por tener que ir al medico, por ende este es mi segundo da. Hoy mis compaeros me pusieron al da con lo entregado y hecho en nuestro grupo. El profesor resolvi las dudas que tenia con respecto a como bamos a empezar a trabajar con el proyecto. Ademas de eso nos asignaron a mi y aun compaero a un grupo donde haremos un proyecto paralelo que consiste en disear un desfibrilador simulador pedaggico (mi deber puntualmente sera disear todo lo relacionado al circuito electrnico) . Por consiguiente me voy a dedicar al proyecto de sistema de preceptoria los jueves y al de desfibrilador los viernes. De momento con respecto al proyecto de preceptoria estamos haciendo un diagrama de gantt. En el proyecto de desfibrilador nos estamos coordinando con el grupo, pero ya podemos empezar a hace cosas funcionales. ','2019-04-26'),(1094,75,'Aprendiendo Materialize','Segu con el aprendizaje de materialize, aprendi el uso de los colores, grillas y tipografas. ','2019-05-02'),(1095,83,'hoy hosting ','hoy continuo con mi labor y hoy trabaje buscando sobre hosting.\ninvestigue sobre para que  es o que es y sus caracteristicas.','2019-05-02'),(1096,76,'Diagrama Entidad Relacion 2','Segu con el diagrama entidad relacin mencionado en el anterior, pero no pude concluirlo por cuestiones de falta de informacin acerca del propio proyecto, por falta de los audios grabados que contenan los detalles que el usuario espera en el mismo.','2019-05-02'),(1097,82,'preguntas','se pudo hacer la entrevista a los preceptores ','2019-05-02'),(1098,85,'Investigacion parte 2','estuvimos practicando la implementacion de codeigniter y materialize, como lider de grupo estuve al tanto del trabajo de mis compaeros','2019-05-02'),(1099,79,'Investigacion sobre nuestra tarea mas proxima','Primero que todo trabaje con el profesor en verificar las aplicaciones (tanto que esten instaladas como que funcionen) de la computadora base de la cual despues vamos a clonar a las demas computadoras para que todos tengamos los programas necesarios para trabajar. Despues de hacer todo eso hable con el profesor sobre la tarea mas proxima que debe hacer el grupo, que es basicamente establecer un servidor linux (ubuntu servidor) donde va estar establecido un serviodor git-hub y un lamp (linux, apache, mysql, lamp) aunque posiblemente instalaremos todo aparte. Tambien vi un poco de el diagrama de Gantt generico que tiene todo el proyecto, para pensar un poco a futoro como tiene que seguir nuestras tareas. ','2019-05-02'),(1100,44,'Sigo explorando la utilidad de git y su funcionalidad.','Segu buscando informacin sobre como funciona git y para que sirve; tambin busque mas comandos programa.','2019-05-03'),(1101,60,'Conclucion de investigacion ','El dia de la fecha se finalizo las investigaciones sobre GiT, CI y FODA, tambien se concluyo con el trabajo de crear un archivo GANTT.\nLos sectores de diseo empezaron a crear un prototipo para la clases siguientes.','2019-05-03'),(1102,76,'Audio y FODA','Comenc por investigar como realizar el FODA y luego escuche el audio que contena la charla del subjefe de preceptores con los alumnos y en un Word escrib resumidamente todo lo que puede ser til para llevar a cabo la maquetacin bsica de la pgina. No lo finalice por cuestiones de tiempo.','2019-05-03'),(1103,51,'Audio y Prototipo','ya me pasaron el audio que le habian grabado al preceptor y de ahi se empez a hacer el FODA y tambien se arranc a hacer el prototipo de la app de preceptoria','2019-05-03'),(1104,53,'Inicio con el prototipo ','El dio de hoy fue sobre un poco de bsqueda de informacin aunque no se concentro tanto en eso, el trabajo a realizarse era un prototipo de la pagina web','2019-05-03'),(1105,80,'Tercer clase','El da de hoy realizamos un poco de investigacin sobre el diagrama de FODA para as poder realizar un diagrama con respecto de el proyecto de preceptoria.\n','2019-05-03'),(1106,82,'foda','comenzamos con foda y prototipado','2019-05-03'),(1107,82,'foda','comenzamos con foda y prototipado','2019-05-03'),(1108,83,'investigacion de servidores y foda','hoy busque sobre los servidores y un poco de foda ademas en  grupo  nos reunimos para volver a pensar las cosas y ver como avanzamos  ','2019-05-03'),(1109,56,'comienzo de FODA','-INvestigacion de FODA\n-Comienzo de realizacion de FODA para proyecto de preceptoria\n-Revision de diagrama de GANTT','2019-05-03'),(1110,37,'CodeIgniter y Audios.','Comenc a ver el tutorial sobre codeigniter en youtube, escuche los 5 audios que grabaron dos compaeros la clase pasada en preceptoria con las respuestas que nos brindaron a las preguntas que habamos formulado anteriormente. Con stos audios debemos realizar las posibles vistas prototipo que va a tener nuestro software.','2019-05-03'),(1111,85,'Investigacion para proyecto DEA','estuve investigando con mi compaero Alvaro el funcionamiento y las cualidades de un DEA, al mismo tiempo que elegimos componentes y comparamos precios de estos mismos. Tambin tomamos medidas de los componentes para proveerlas a los chicos de mecnica encargados en la estructura. Por ultimo estuvimos viendo el codigo necesario para hacer funcionar un modulo de Audio','2019-05-03'),(1112,45,'introduccion a foda','investigamos sobre foda y pronto comenzaremos con el prototipado','2019-05-03'),(1113,46,'investigacion de servidores y foda','hoy investigamos sobre los servidores y el foda, tambien hablamos nuevamente sobre el diagrama de gantt y al final armamos un grupo de whatsapp para mentenernos en contacto','2019-05-03'),(1114,75,'Materialize - CSS y Componentes','En esta clase termine de ver el CSS en materialize y empece a ver los diferentes componentes entre ellos los diversos botones que cuenta este programa.  ','2019-05-03'),(1115,79,'Diagrama de Gantt y listando componoentes para el DEA','En primer lugar me dedique hoy a buscar con mi amgio los componetes necesarios para armar el proyecto del DEA, en total contamos: una pantalla lcd 16x2, un Arduino UNO R3, unos botones, unos leds (y sus respectivas resistencias), una bateria  (al menos de 5v, lo necesario para alimentar el arduino), un modulo DFPlayer (o similiar) para reproducir audio. \nDespues me dedique a trabajar en el diagrama de Gantt de mi seccion (infraestructura)  y determinan cuanto nos tomarian las tareas (ya que empezamos despues de lo previsto, estamos atrasados con los tareas).','2019-05-03'),(1116,48,'Busqueda de informacion','Realizamos busqueda sobre el Foda','2019-05-03'),(1117,58,'busqueda sobre foda','realizamos una busqueda sobre foda y revisamos archivos','2019-05-03'),(1118,74,'Audio y FODA','investigamos FODA y nos planteamos para hacer un prototipo,terminamos con gantt, reunimos informacin de servidores. +\n','2019-05-03'),(1119,55,'introduccion a FODA','Realizamos una bsqueda de informacion sobre el FODA.','2019-05-03'),(1120,67,'Tablas de Base de Datos para Oficina de Alumnos','El dia de hoy nos juntamos con el grupo de Base de Datos y hicimos unas tablas para la futura Base de Datos ','2019-05-07'),(1121,47,'Entrevistas y prototipo de estructura de la pagina','Cada integrante de nuestra seccin empez a  hacer prototipos de la estructura de la aplicacin para oficina de alumnos. Tambin hicimos las entrevistas y concluimos que hay que usar una base de datos.','2019-05-07'),(1122,41,'Codeigniter  y diseo','En el da de hoy estuvimos viendo la gua de vdeos de codigofacilito sobre codeigniter y tambin empezamos a centrarnos en nuestra rea que es diseo, realizando la aplicacin de oficina de alumnos haciendo la barra de men con codeigniter.','2019-05-07'),(1123,40,'Diseo','En el dia de hoy se realizo la entrevista a oficina de alumno y empezamos a repartir las tareas en el grupo de diseo para disear la pagina web','2019-05-07'),(1124,54,'Empezar con la base de datos','El da de hoy empezamos a realizar una estructura de base de datos a modo de borrador','2019-05-07'),(1125,43,'Ver vdeos de CodigoFacilito y poner cdigos','Hoy estuvimos viendo ms vdeos de CodeIgniter y abrimos su respectiva app, para ya empezar a hacer nuestro trabajo que sera un men. Tambin, estuvimos probando algunos comandos para ver como iba la cosa.','2019-05-07'),(1126,64,'Dia de la Primera entrevista','En el da de la fecha con el lder de Diseo y la lder de Desarrollo y yo lder de Infraestructura nos seleccionaron para ir a hacer la primera entrevista a ofician de alumnos sobre el proyecto que vamos a llevar acabo en el futro de esta materia, as aclaramos bien lo que necesitan los que estn a cargo del lugar,  y as tambin saber cmo llevar acabo el dichoso proyecto','2019-05-07'),(1127,69,'07/05','Hicimos un borrador con los registros para la base de datos','2019-05-07'),(1128,63,'Septima clase','El da de hoy se realizaron las entrevistas en oficina de alumnos y nos dividimos en nuestras respectivas reas (en mi caso desarrollo) para hacer trabajos que involucren la utilizacin del CodeIgniter. Adems de eso seguimos viendo las guas del CodeIgniter. \nSe estima que vamos a empezar a trabajar a partir de la prxima clase, es decir, maana.','2019-05-07'),(1129,71,'07/05','Hicimos un borrador con los registros para la base de datos','2019-05-07'),(1130,49,'diseo','hoy se realizo la entrevista a oficina de alumnos y empezamos a separa el trabajo por partes. ','2019-05-07'),(1131,66,'Septima clase','Hoy fue la entrevista con la oficina de alumnos para poder obtener respuestas de las preguntas que previamente hicimos, tambin nos dijeron que el equipo de desarrollo trabaja en paralelo al equipo de diseo as que aun debemos esperar un poco para poder saber que hacer, por mi parte tambin continu con las guas de codeigniter para poder trabajar sin problemas','2019-05-07'),(1132,38,'Inicio al diseo de la pagina','Hoy algunos integrantes del grupo fueron a realizar las preguntas anteriormente establecidas a oficina de alumnos, despues de eso dividimos em diferentes grupos las tareas del diseo que va a tener la pagina web.','2019-05-07'),(1133,73,'CodeIgniter y diseo de la pagina','En el dia de hoy con el grupo de diseo realizamos un diseo para la pagina de oficina de alumnos ','2019-05-07'),(1134,52,'clase 1 ayada a oficina de alumnos','hoy