egando campos en cada una. Despus de acordar en esto, nos dividimos en dos grupos donde uno se encarga de crear la base de datos e ingresar algunos datos para probarla, y el otro, donde estoy yo, a hacer el diagrama de relacin entidad. \nUna vez terminado me puse a leer cmo relacionar tablas.','2019-05-08'),(1143,54,'Base de datos, diagrama de entidad relacin ','En el dia de la fecha realizamos una base de datos bsica e hicimos un diagrama de entidad relacion','2019-05-08'),(1144,64,'Uso de Ubuntu y VMWare para montar un servidor','En el da de la fecha mi grupo y yo empezamos a averiguar cmo montar un Servidor.\nYa sabido eso empezamos por descargar Ubuntu que ofrece un sistema operativo predominantemente enfocado a ordenadores de escritorio aunque tambin proporciona soporte para servidores, para montar este sistema utilizamos el programa VMWare Workstation que sirve para este tipo de cosas.\n','2019-05-08'),(1145,72,'Clase 8, VMware, Ubuntu y Monto de servidores.','En esta clase monte servidores con VMware, que lo utilizo para simular el sistema operativo de Linux. Por lo que esta clase aprend a montar servidores y manejar pginas web con un servidor lo que me parece muy til para un futuro trabajo.\nPor otro lado, creo que al fin estoy entendiendo que todo lo que estamos haciendo sirve y es til para un trabajo en el exterior. \n','2019-05-08'),(1146,52,'clase 2 de oficina de alumnos','el dia de la fecha los alumnos que fueron a hablar nos comunicaron de las preguntas que les dijieron a los de oficina de alumnos para empezar el proyecto','2019-05-08'),(1147,38,'Bootstrap, Adobe xd','En el dia de hoy vimos tutoriales e intentamos descargar programas como boostrap u adobe xd en los cuales podiamos facilitar el trabajo al desarrollo de las paginas web antes que elaborar codigo html y css desde atom.','2019-05-08'),(1148,63,'Octava clase','El da de hoy nos confirmaron que si bamos a trabajar; en un principio nos explicaron sobre la entrevista que se realiz ayer:\n- Lo fundamental es trabajar en las inscripciones.\n- No podemos hacer nada respecto a las previas.\n- Adems de trabajar en las inscripciones, podemos enfocarnos en los cambios de turno.\nA partir de ah cada grupo trabajo su parte correspondiente; por mi lado realice una base de datos vinculada con CodeIgniter para ir viendo bien como funciona cada cosa. Creo que la situacin va a seguir as hasta que ms o menos haya una parte definida en cuanto al rea de diseo.','2019-05-08'),(1149,67,'Creacion de la Base de Datos y Diagrama de entidad-relacin','El dia de hoy los chicos del area de infraestructura nos hablaron sobre la entrevista con Hernan sobre los problemas para Oficina de Alumnos. Despues con el grupo de Base de Datos hicimos la creacion de esta y el Diagrama de entidad-relacion. ','2019-05-08'),(1150,69,'08/05','Empezamos a desarrollar la base de datos de la aplicacin para la oficina de alumnos.Tambin realizamos el diagrama de entidad de relacin.','2019-05-08'),(1151,49,'Bootstrap, Adobe xd','En el dia de hoy intentamos descargar bootstrap y abobe xd para facilitar el codigo de la pagina web.','2019-05-08'),(1152,40,'bootstrap','hoy descargamos el bootstrap, investigamos como funciona y avanzamos con el desarrollo de la pagina web','2019-05-08'),(1153,66,'Octava Clase','Hoy ya nos dijeron las problemticas que tiene oficina de alumnos por lo cual los equipos de diseo y desarrollo empezamos a trabajar, por mi parte aun sigo viendo vdeos tutoriales de Codeigniter para el manejo de bases de datos desde este mismo.','2019-05-08'),(1154,65,'Presentacion ,distribucion de tareas y comienzo del proyecto','Presentamos los jefes de las secciones de diseo, sistema y desarrollo explicaron la conclucion de la entrevista. Repartimos las primeras tareas entre las secciones y comenzamos a trabajarlas.','2019-05-08'),(1155,86,'Practica del servidor','En la clase de hoy hicimos todo lo relacionado con el montaje del servidor y las descarga de sus elementos. Ya est el servidor disponible pero est en blanco sin pagina de inicio. ','2019-05-08'),(1156,75,'Materialize - Componentes Card','Hoy aprend el manejo de las diferentes cards. Card con imagenes, conos, horizontales, interactivas o con diferentes secciones. ','2019-05-10'),(1157,85,'Proyecto DEA, consultas y diagrama GANTT','Nos quitamos dudas sobre el proyecto con el profesor puma, tambin empezamos a trabajar el diagrama GANTT y accedimos a la carpeta de campo de los chicos de mecnica. Tambin nos planteamos nuevas tareas de investigacin sobre el DEA su funcionamiento y su forma de uso.','2019-05-10'),(1158,83,'carpeta de campo','hoy hice la carpeta de campo, tambin me fije sobre si me faltaba algo a mi trabajo. fue muy tranquilo hoy y pude terminar con mis labores.  ','2019-05-10'),(1159,74,'carpeta de campo ','hoy por excursin al cmd (Centro Metropolitano de Diseo) la falta es justificada as que algunos de mis compaeros no vinieron sin embargo nos pusimos a avanzaren las cosas que vamos atrazados como la carpeta de campo. Nos distanciamos cada uno hizo lo que tenia que hacer, de todas maneras compartimos lo que avanzamos porque nadie se puede acordar de cada clase con detalles, ese fue mi pensamiento como lder, le pedi a cada uno que suba su parte con su nombre as no hay plagio con el nico fin de guiarse.   ','2019-05-10'),(1160,79,'Proyecto DEA','Hoy nos enfocamos principalemente en el proyecto DEA. Primero revise mis bitacoras para revisar que cosas estuve o no haciendo. A las 16:00 fuimos a hablar con Puma (el profesor encargado de supervisar el proyecto del DEA) para sacarnos dudas con respecto al diseo del DEA, especificamente sobre el uso de una pantalla lcd. Ademas de eso hablamos sobre una cuestiones de falta de sincronia que teniamos con la otra parte del grupo del DEA y el profesor tambien nos pidio que para dentro de dos semanas maximo tengamos una lista de componetes bien hecha, despues fuimos a revisar la carpeta de campo ya hecha que se tenia sobre el proyecto. Cuando terminamos c