a la aplicacin para agregar, editar o borrar alumnos en la base de datos. ','2019-05-15'),(1185,73,'Diseo de las paginas','En el dia de hoy estuvimos trabajando con los diseos para la pagina','2019-05-15'),(1186,52,'clase 4 de oficina de alumnos','el da de la fecha estuve adquiriendo informacin de vdeos y preguntando sobre como va a ser el futuro desarrollo de la APP','2019-05-15'),(1187,41,'Diseo de vista de inscripcin','En el da de hoy empez hacer la vista de inscripcin y arreglando algunas cosas del diseo de la vista de la clase pasada como agregar botones sus colores de fondo las fuente del texto tambin los profesores nos explicaron que para aprobar se necesitan hacer 14 vistas y acumular un total de 50 horas.','2019-05-15'),(1188,57,'Investigacin','Estuve investigando y viendo tutoriales sobre cmo usar el framework de CodeIgniter y Bootstrap para realizar los trabajos correspondientes a mi rea de trabajo','2019-05-15'),(1189,66,'Decima clase','Hoy nos dijeron sobre todo lo que debemos hacer para el proyecto, mi equipo el de desarrollo, se encarga de varias tareas relacionadas a dar funcionalidad a lo que el los de diseo hagan, ademas debemos manejar las consultas sql para poner en funcin las bases de datos. ','2019-05-15'),(1190,63,'Decima clase','En este da nos explicaron todo lo que tenamos que realizar para la aprobacin del trimestre y, con un compaero de mi misma rea, fuimos con los profesores a averiguar lo que nos corresponda de forma mas detallada y yo me encargue de tomar nota de todo lo que considere importante.\nPosteriormente segu trabajando con CodeIgniter y base de datos.','2019-05-15'),(1191,54,'Finalizar Diagrama de Gantt ','En el da de hoy termine de modificar el diagrama de Gantt','2019-05-15'),(1192,49,'Diseo de vistas','hoy terminamos la vista de registro y comenzamos la vista de becas donde se encuentra las opciones de buscar y agregar alumno.','2019-05-15'),(1193,71,'base de datos y UML','Terminamos el diagrama de Gantt. hicimos el uml de la base de datos, relacionamos las tablas, agregamos registros y tablas, modificamos tambien algunas cosas','2019-05-15'),(1194,67,'Manual de Usuario, Diagrama de Gantt y UML','El da de hoy con el grupo de base de datos nos dividimos las tareas, un grupo se encargo de hacer el Diagrama de Gantt, otro de hacer el UML, y yo de hacer el Manual de Usuario ','2019-05-15'),(1195,38,'Diseo de vistas','Hoy finalizamos el diseo de la vista de registro en la aplicacion bootstrap, tambien le dimos comienzo al diseo de la vista de becas en donde se encuentraran las opciones de buscar y agregar alumnos','2019-05-15'),(1196,64,'Mas Trabajo','En el da de la fecha se realiz la misma tarea de ayer y la semana anterior pero hoy se le agrego que al instalar el servidor Ubuntu en VMWare, le sigo instalar un servidor web en el propio Ubuntu, ya que en el Ubuntu hay que instalar un Servidor DB, Servidor Web, Servidor FTP, Servidor Git. Para realizar la instalacin del servidor busque un par de videos o pginas para ver cmo se haca, y luego se lo aplique en  mi servidor.','2019-05-15'),(1197,65,'Vistas proyecto','5 vistas en bootstrap, inico, login, bcas, registro y previas','2019-05-15'),(1198,37,'Investigacin Leaflet y prueba','El da de hoy estuve investigando sobre qu es Leaflet y cmo se utiliza. Vi varios videos en youtube e incluso comenc a leer los tutoriales iniciales que se encuentran en la pgina oficial de Leaflet con el fin de aprender de stos, para luego realizar la aplicacin solidaria que tengo como proyecto. ','2019-05-16'),(1199,53,'maquetacion o prototipado de la app web','Dibujar e disear un prototipo de como podira llegar a hacer el diseo de la web y viendo que campos y tablas de ingresaran en la base de datos. ','2019-05-16'),(1200,51,'Gantt y Foda','hoy, con mi equipo hicimos el diagrama de Gantt para tener un control del tiempo y de cada tarea que tenemos y que nos toca hacer a cada uno y para terminar, nos pusimos a ver para hacer el FODA y depaso le mostr al grupo de Diseo mi prototipo de la aplicacion','2019-05-16'),(1201,85,'Investigacion Y finalizacion GANTT','Hoy nos centramos en terminar definitivamente el diagrama gannt y nos pusimos a investigar los componentes a usar (consultamos tambien con los profesores) y investigamos precios para hacer un lista de los componentes con sus respectivos precios','2019-05-16'),(1202,83,'diagrama terminado','se trabajo con el diagrama de gantt y cuando estaba &quot;finalizado&quot; ocurri un apagn por lo que se perdi lo que tenamos trabajado hasta el momento. \nSe tuvo que volver a empezar con el diagrama gantt una vez vuelto la luz, luego de finalizar ocurri una reunin que solo los lideres participaron. \nFinalizando eso, se termino el diagrama y se envi por e-mail al profesor.  ','2019-05-16'),(1203,60,'Comienzo de prototipado','EL dia de la fecha, la seccion de diseo, BdD y infraestructura, comenzaron con los prototipos, mientras que la seccion de  Desarrollo comenzo a utilizar CodeIgniter para hacer un prototipo y comenzar a usar sus respectivas bibliotecas.','2019-05-16'),(1204,36,'codeigniter','Programamos y diseamos un poco en codeigniter','2019-05-16'),(1205,82,'continuacin de proyecto ','Desarrollo y Finalizacin del prototipado 1, actualizacin del diagrama de Gantt y entrega del mismo y Desarrollo de la carpeta decampo','2019-05-16'),(1206,74,'FODA','El da de hoy terminamos gantt pero en el momento dela entrega hubo un apagn que termino con todo lo que avanzamos perdimos un gran tiempo, fue un gran atraso pero aun as logramos terminar, una vez terminados el profe nos dijo que nos agrepemos con los chicos de los das martes y mircoles ellos por das que nosotros no tuvimos practicas estn ms avanzados sin embargo me encargue de ese tema, busque a mis compaeros, les ped todo lo que investigaron, como usaron los programas, consejos, etc.\nEn el grupo somos pocos pero como lder me voy a encargar de estar a la altura de mis compaeros,pienso que ya esto no solo hace un cambio en mi nota trimestral, siento un peso en mi hombro, ese peso es hacer que mi grupo apruebe yo.\nTambin entre los lideres nos juntamos a debatir el FODA del proyecto.  ','2019-05-16'),(1207,42,'Comienzo del prototipado y finalizacion de encuesta. ','Comenzamos con el prototipado, asi los del grupo de desarrollo pueden empezar a trabajar con el proyecto. Tambien hicimos el FODA para sacar las conclusiones de como vamos a trabajar. ','2019-05-16'),(1208,44,'Codeigniter','Programamos los controllers, views y models de Codeigniter.','2019-05-16'),(1209,45,'actualizacion','actualizacion del diagrama de gantt y prototipado 1 y finalizacion y entrega de ambas','2019-05-16'),(1210,76,'Gantt, FODA y Diagrama ER','Luego de que la lder de nuestro grupo se cambio de turno, se me asigno este rol a mi. Se comenz finalizando un modelo bsico de de un diagrama de Gantt para ya tener buena base de trabajo, el diagrama se ira cambiando segn como se proceda con el proyecto. Luego con los otros Lideres de grupos hicimos el FODA en papel, para luego digitalizarlo y presentarlo. Finalice rehaciendo y agregando datos al diagrama entidad relacin que no haba tenido en cuenta anteriormente.','2019-05-16'),(1211,80,'foda - vistas ','El da de hoy nos dedicamos al desarrollo de la primera versin de las vistas para cada parte de la interfaz web. iniciando con un login en el cual el/la preceptor/a se registrara.\n\nLuego analizamos las Fortalezas, Oportunidades, Debilidades y Amenazas del proyecto, las escribimos en papel, para luego digital-izarlas.','2019-05-16'),(1212,75,'Aprendizaje final de Materialize','Ya en esta clase termine de ver lo que faltaba de materialize, entre ellos:\n\n- Los diferentes &quot;nav&quot;, con link, dropdown, sus distintas alineaciones (centrado-izquierdo-derecho) y sus posiciones (fixed).\n- Los botones flotantes, sus diferentes opciones (alineacin, hover y toolbarEnabled) y estilos.\n- Los Carouseles y sus diferentes opciones (duracin, con o sin indicadores, tamao, etc).\n- Los S