tro grupo y le complementamos con lo que pensamos que era lo que le faltaba, desgraciadamente no se guard a la primera y tuvimos que volverla a hacer','2019-05-23'),(1275,78,'Login preceptores y superiores (23/05/19)','Trabaje hoy con la comprobacin de si el usuario que se logea es preceptor o un superior y segn cual sea se le da ciertos privilegios.\nMe di una idea bsica de como sera la metodologa para determinar los privilegios del usuario. Se me haba ocurrido hacer SELECT en dos tablas, una que guarda usuarios de preceptores y otra que guarda usuarios de superiores. Comprobar cuantas filas contena cada resultado (Si la tabla de preceptores tiene 1 fila y la de superiores 0, se da privilegios de preceptor). Pero no es muy eficaz. Lo correcto es usar una librera de CodeIgniter la cual es Session, que sirve para manejar sesiones.\n','2019-05-23'),(1276,42,'Organizacin y terminacin de prototipado ','Se creo una carpeta con los integrantes del grupo de diseo, para poder estar todos en contacto y no perder tiempo pidiendo material si nos falta en algun momento, terminamos los prototipos en word y photoshop  y avanzamos en html con las vistas del Listado y Notas. ','2019-05-23'),(1277,45,'organizacin de sector  y terminacin de prototipado','nos organizamos una carpeta compartida en el google drive para todo el trabajo en el sector y luego hicimos la finalizacion del prototipo para comenzar con la pagina web','2019-05-23'),(1278,76,'Codificacin','Comenzamos finalizando la maquetacion del diagrama Entidad Relacion, entrelazando nuestra parte con la que se hizo en el otro grupo de practicas. Luego de haber finalizado esta, comenzamos codificando la propia maqueta, la cual llegamos a finalizar, pero no a hacer las pruebas suficientes par aconfirmar su funcioamiento.Finalice realizando la documentacion de nuestro grupo, para tener escrito todos los procedimientos que se llevan a cabo en el grupo.  ','2019-05-23'),(1279,50,'Finalizacion de documentacion','Se terminaron los ltimos archivos de los primeros crokies del prototipado. Se creo una carpeta compartida para el grupo y se inicio con la etapa de desarrollo en cdigo.','2019-05-23'),(1280,36,'codeigniter controller','ya hice controladores y model de mostrar,agreagar,editar,eliminar y buscar','2019-05-23'),(1281,55,'Complementacin de la base se datos','Estuvimos complementando la base de datos que haba  realizado el grupo de los martes y mircoles agregando tablas. En el proceso hubo una complicacin ya que al no guardarse correctamente se borraron 4 de estas que tuvieron que volver a hacerse.','2019-05-23'),(1282,83,'ultima investigacin ','hoy se hizo una nueva informacin en la cual a mi se me reparti un par de cosas por hacer al igual que a mi compaera. \ncomo ponerla lamp en el server?,como poner un servidor git- hub? y como poner un servidor de correo electronico?.\nEsto se logro terminarlo  ','2019-05-23'),(1283,60,'Seguimiento del proyecto','El dia de hoy se continuo con dicho proyecto.\nEn el sector de desarrollo nos reunimos para discutir que hacer mientras esperamos las vistas que nos deben el sector de diseo.\nSe logro empezar con los controladores.','2019-05-23'),(1284,46,'servidores linux,voip y ftp','el da de hoy dividimos los temas para investigar con mi compaera, a cada una nos toco 3 temas de servidores ','2019-05-23'),(1285,44,'Terminamos la conexion con la bd y los controladores de codeigneter','Terminamos la conexion con la bd y los controladores de codeigneter y estamos esperando a que nos den las vistas y la base de datos para terminar nuestra parte del trabajo','2019-05-23'),(1286,56,'Desarrollo de pestaas','-Diseo de la pestaa &quot;sanciones&quot;\n-Desarrollo del maquetado y estilo de la pestaa\n','2019-05-23'),(1287,74,'desarrollo','empece a aprender a usar cdigos bsicos  de linux, ','2019-05-23'),(1288,79,'Atraso en proyecto de preseptoria','Hoy me coordine con mi grupo del proyecto de preceptoria y me di cuenta que estamos bastante atrasados y a destiempo con