es un superior. Hoy me propongo a trabajar esa parte, pero sin meterme en el tema de sesiones en CodeIgniter para no tardar hoy con aprender ese tema y para probar.\nVoy probando y me trabo en algunas partes porque, estaba intentando usar funciones y siguiendo las reglas que aprend de base de datos en CodeIgniter y al parecer tengo que usar un foreach si o si para tratar al registro como un array-objeto (Es decir que me deje acceder de la manera $fila-&gt;nombreCampo).\nAl final funciono el intento que hice de sesiones. Ingreso con un usuario preceptor y me manda al perfil del preceptor. Ingreso un usuario superior y muestra el perfil del superior.\n','2019-05-24'),(1296,75,'Simulacion con base da datos','En esta clase empeze a ver como hacer la simulacin para agregar o modificar una nota. Para ello esta el codeigniter que nos ayuda a crear los modelos. Para llevar a cabo mi labor, en primer lugar tuve que ver como funcionaba la base da datos y a raiz de eso se procedera a realizar en primera instancia lo visual para despues trabajar en las consultas (INSERT INTO y SELECT ).','2019-05-24'),(1297,76,'Base de Datos','Importamos la base de datos y comenzamos trabajando en ella. Hicimos un breve testeo y comenzamos con una pequea busqueda de errores, para la correccin de estos (Tuvimos ayuda de gente externa al grupo para un punto de vista mas amplio). Tambien nos adentramos un poco mas dentro del lenguaje SQL. Realizamos un cambio en una de las tablas de base de datos, la cual optimiza y mejora la misma. ','2019-05-24'),(1298,76,'Base de Datos','Importamos la base de datos y comenzamos trabajando en ella. Hicimos un breve testeo y comenzamos con una pequea busqueda de errores, para la correccin de estos (Tuvimos ayuda de gente externa al grupo para un punto de vista mas amplio). Tambien nos adentramos un poco mas dentro del lenguaje SQL. Realizamos un cambio en una de las tablas de base de datos, la cual optimiza y mejora la misma. ','2019-05-24'),(1299,79,'Servidor Infraestructura y Prepuesto DEA ','Hoy empece mi da buscando presupuestos de componentes del DEA y anotndolos para ya hacer el primer presupuesto serio. Mi compaero Nacho tambin estuvo buscando presupuestos, yo busque en la pagina &quot;SYC semiconductores y componentes&quot; y el en la pagina &quot;candy ho electronics&quot;. Tuvo principalmente dos problemas, el primero fue que la pagina no tenia todos los componentes que pens que tendra y el segundo problema es que tenamos que instalar con el grupo de infraestructura el Exsi en el servidor (a la vez que estaba buscando presupuestos). Asi que estuvo yendo y viniendo intentado hacer las dos cosas. Puede (junto a mis compaeras) instalar el servidor correctamente y hacer la documentacin pero no pude hacer el presupuesto como quera.','2019-05-24'),(1300,82,'cdigo','el da de hoy empezamos con el codigo  de login  para lo cual utilizamos html y css y buscamos informacin en school3, googlefonts  y boostrap','2019-05-24'),(1301,46,'instalacion','el da de hoy se instalo el ex-el  en un servidor, en el cual lo instalamos configurando ciertas cosas incluido el idioma, creando una contrasea y usuario.\nel profesor fue el que nos dio el pendraip, para la instalacin, al terminar  cerramos cesin y guardamos todo  ','2019-05-24'),(1302,45,'cdigo html','empezamos con la realizacin del cdigo del login en el cual usamos css y html.','2019-05-24'),(1303,67,'Usuarios','El da de hoy con Eugenia, la lder del grupo, pensamos crear un usuario nuevo para la base de datos y eliminar el usuario root, pero preferimos cambiar la contrasea y dejarlo asi por las dudas, ya que tuvimos un error y podamos romper toda la base de datos.','2019-05-28'),(1304,72,'Clase 13, terminar manual de usauario.','La clase de hoy nos dedicamos a terminar todas los manuales de usuario para el siguiente grupo.\n\nAdemas me la pase configurando FTP y resolviendo problemas con PHP del server web de Ubuntu.','2019-05-28'),(1305,71,'Entrega de lo hecho en clase','Hicimos