letamos las carpetas de campo respectivas y se las entregamos al profe para que las mire y nos de una devolucion','2019-05-28'),(1316,49,'Vistas finalizadas','En el da de hoy terminamos con todas las vistas pedidas por el profesor.','2019-05-28'),(1317,68,'Formulacin del manual de usuario. Entrega del proyecto.','En base a los comentarios del cdigo de HTML y PHP encontrados dentro de la carpeta de proyecto de CodeIgniter, formulamos un archivo de texto .docx de estilo manual de usuario con la informacin necesaria para poder editar y/o mejorar el proyecto sin necesidad de pasar horas entendindolo.\nHicimos entrega al profesor de los archivos de CodeIgniter y dos .docx de manual de usuario a travs de pendrives.','2019-05-28'),(1318,73,'Finzalizacion de las vistas y carpeta de  campo','con el grupo hoy terminamos las vistas y la carpeta de campo ','2019-05-28'),(1319,41,'Correccin de vistas','En el da de hoy el profesor reuni a cada una de las reas para ver como van con el proyecto ya que hoy termina el primer trimestre, arreglamos y terminamos las vistas que el profesor nos dijo que estaban mal y que faltaban, tambin creamos el manual de usuario y las vistas las exportamos como html.','2019-05-28'),(1320,52,'clase 7 de oficina de alumnos','el dia de la fecha no se pudo terminar de entregar el proyecto completo con sus resultados deseados\npero pude conectar casi todas la vistas del proyecto menos los diseos','2019-05-28'),(1321,78,'Cargar base de datos automticamente 30/05/19','Hoy me cans de estar creando una base de datos y cargar todas las tablas manualmente en phpmyadmin. Para solucionar esto pense en un algoritmo que se ejecute \ncuando se llama al index del controlador (Este index era el encargado de cargar la vista de login). Antes de cargar la vista lo que hara es llamar a un mtodo del\nmodelo que tomara de un archivo sql todos los comandos y las guardara en un string. Posteriormente, se conecta con la base de datos y la crea. Luego de esto\ncargara todas las tablas.\nCuando escriba el cdigo me quede con una dificultad y es que no poda leer el archivo sql.\nIntente con la funcin fopen() concatenando con la funcin base_url() para establecer una ubicacin base. Luego intente con file_get_contents() y tampoco. Tambin se me\nhaba ocurrido revisar la documentacin de CodeIgniter sobre los files_helpers, ya que como son helpers de archivos, pens que me podan ayudar. Haba una funcin que era \nla read_file(), pero la misma documentacin recomendaba usar file_get_contents() en lugar de read_file(), ya que este qued obsoleto. En conclusin, no tuve exito.\nLa ltima opcin (algo bruta) sera pegar todo el SQL en un string, sin leer de archivos ni nada. Es decir que ya exista una variable con todas sentencias. No es algo\nmuy profesional pero sirve como ltimo recurso, o aunquesea, sirve como algo temporal hasta que encuentre una solucin. Mientras tanto usar esta ltima.','2019-05-30'),(1322,74,'Linux ','este dia estuve viendo como usar Sphere VMware cuyo programa es para es la plataforma de virtualizacin lder del\nsector para construir infraestructuras de cloud. Permite a los usuarios ejecutar aplicaciones crticas para el negocio con\nconfianza y responder con mayor rapidez a las necesidades empresariales. \nsegui con la investigacion de como usar ubuntu. \n','2019-05-30'),(1323,53,'Realizar la carpeta de campo','completar mas la carpeta de campo del da de hoy mejorando algunos aspectos.','2019-05-30'),(1324,76,'Finalizacion de BD funcional','Comenzamos el dia con una restructuracion de la maquetacion de la base de datos, la cual optimiza y mejora la misma. Luego de comprobar su funcionamiento y acoplamiento con los comandos ingresados, nos pusimos al dia con la documentacion de nuestra seccion. Por mi parte, actualice y mejore el diagrama de Gantt hecho anteriormente.','2019-05-30'),(1325,36,'codeigniter php asistencia','haciendo php de asistencia. esperando que me den la vista y base de datos porque no se como funciona.','2019-05-30'),(1326,51,'ultimando detalles','creamos tablas en la base de datos que ya tenamos y las conectamos con el &quot;foreign key&quot; y de paso editamos el diagrama de gantt y le agregamos mas cosas que ya habamos echo','2019-05-30'),(1327,44,'Segui con el php de Asistencias','Adelantamos la pagina de asistencias y modificamos algunos controladores.','2019-05-30'),(1328,75,'Prototipo ingresar nota','En esta clase realice un prototipo para agregar nota, implementando Codeigniter. Por otra parte tambin pude mostrar esos datos por pantalla a travs de  una tabla, esto se realiz con materialize. ','2019-05-30'),(1329,56,'Desarrollo de pestaas','-Revisin del cdigo ya realizado\n-Correccin de errores\n-Actualizado de maquetado y seguir el desarrollo','2019-05-30'),(1330,83,'carpeta y investigacin','hoy actualice la carpeta y la envie. Ademas  investigamos vmware vsphere  para poder saber como funciona y como trabajarlo despues ','2019-05-30'),(1331,55,'Remplasando las tablas existentes por una mas completas ','Remplasamos las tablas existentes por una mas completas (aun que eran minimos detalles) y utilizamos la misma base de datos para no crear otra, en un momento al estar retrasado con mi carpeta de campo me aparte del grupo pra completarla.','2019-05-30'),(1332,79,'Investigacion de audio-arduino para proyecto DEA','Hoy me dedique practicamente todo el dia a informararme sobre reproduccion de audio en arduino, leyendo el libro &quot;Arduino Curso Practico de Formacion&quot;. Obtuve informacion importante, mas que nada sobre medidias de seguirdad sobre la conexion entre los parlantes y el arduino (divisor de tension, potenciometro como divisor de tension, condensador &quot;by pass&quot;, amplificador). Sin embargo no se hasta que punto pueden ser necesario este conocimiento, ya que si usamos un shield (que no creo posible) o un modulo de audio (bastante mas factible), podria no ser necesario estas medidas de seguridad. Es necesario seguir investigando.  ','2019-05-30'),(1333,45,