rmacion sobre array ','Entrar a dos paginas, solo utilizar una ya que no se logro llegar a la segunda, por estar sentrada en la primera ','2019-05-31'),(1343,51,'detalles finales','me dediqu a terminar la carpeta de campo, ver si no tenia algo mas que hacer y ayudar a un compaero a que termine ','2019-05-31'),(1344,75,'Prototipo actualizar nota','En esta clase realice la funcin &quot;actualizar nota&quot;. Lo que hace es mostrar al usuario la lista de los alumnos con la opcin de cambiar nota. Al precionar esta opcin, te lleva a otro sitio donde se veran los datos especificamente de ese alumno y con la opcin de cambiarle la nota. Para la realizacin de esto se utiliz codeigniter y materialize. ','2019-05-31'),(1345,37,'Etapa final investigacin Leaflet.','Entr en lo que considero yo, la etapa final de mi investigacin sobre Leaflet. Di un vistazo ms bien general a casi todos los tutoriales que proporciona la pgina https://leafletjs.com/index.html, para tener una idea un poco ms general, y luego adentrarme ms detalladamente en cada uno de stos. ','2019-05-31'),(1346,55,'Pequeos detalles','Hoy me dedique a complementar la carpeta de campo con las partes que faltaban, mis compaeros realizaron lo mismo.','2019-05-31'),(1347,74,'FTP, servidores web, base de datos, diseo, etc','pude convencer a un compaero del otro turno a que nos de una mano, ya que nos quedamos muy trabados, sin nada que hacer mas que investigar, ahora ya podemos empezar a usar los dichos programas que hay en el titulo para ya terminar este proyecto una vez finalizado el trimestre. ','2019-05-31'),(1348,79,'Proyecto DEA presupuesto y tal vez nuevo proyecto ','Hoy empeze a trabajar un buen rato antes de clase. primero fui a hablar con el grupo de DEA correspondiente a mecanica sobre unas ideas que tenia y que me parecia importante hacereles saber (agregar puerto usb, jack 3.5mm). De paso a eso hable con otro chico de mecanica que necesitaban para el proyecto a alguien que sepa Arduino para el proyecto, cuestion que hablamos (y despues lo hable con Puma) y es posible que entre a otro proyecto. Despues de todo esto fui a trabajar al aula de pp (antes de que comienze la hora) a seguir trabajando en el presupuesto, esta vez busque precios por la pagina emakers y por sus publicaciones de mercado libre. Despues de trabajar un buen rato en eso (y ya siendo hora de pp) fui a hablar con el profesor Puma sobre mis ideas, despues de quedar en que no agregariamos el jack y el usb porque la idea es hacer el DEA lo mas fiel y acotado posible, volvi a hablar con los chicos de mecanica del nuevo proyecto y despues volvi al aula a buscar presupuestos e Emakers.','2019-05-31'),(1349,78,'Seleccin de alumnos segn criterios (31/05/19)','Charlamos las cosas en las que trabaj cada uno, que cosas tenemos terminadas y que falta hacer. Buchi, que se encarg de la vista que muestra los alumnos y sus notas, dejo una parte para que lo programe haga otro. Esa parte es la que voy a hacer yo. La consigna es la siguiente: como ya tenemos la seleccin de todos los alumnos (SELECT *) y la seleccin por id (SELECT * alumnos WHERE ID = \'$id\'), habra que hacer otra seleccin tipo SELECT * FROM alumnos WHERE pero concatenando varias condiciones WHERE con operador AND, es decir, una seleccin ms especfica que solo por id. Ya hay una vista de action de tipo option para elegir al alumno segn el trimestre, curso y divisin. Ahora mi tarea es hacer aadir otro input tipo submit para mandar los datos seleccionados, adems de hacer esa parte de formulario con el form_helper de CodeIgniter. Veo fcil la cosa, pero como voy a trabajar con los archivos de otro compaero, puede que me tarde.','2019-05-31'),(1350,82,'finalizacion ','hoy finalizamos el proyecto de html con informacin de paginas webs como boostrap y materialize y subimos todo lo realizado al drive\n','2019-05-31'),(1351,45,'finalizacion del html','hoy finalizamos el proyecto de html con informacin de paginas webs como boostrap y materialize y subimos todo lo rea