rfaz grfica al servidor as se nos hace ms fcil trabajar al grupo. ','2019-06-04'),(1362,41,'Hablamos con el profesor sobre las notas y seguimos con las vistas','En el da de hoy el profesor nos llam a cada uno para el tema de las notas. Despus, seguimos haciendo las vistas que nos faltaban, para proceder a pasarlos a HTML para los compaeros de otras areas.','2019-06-04'),(1363,66,'Dcimo cuarta clase ','Hoy nos dieron la opcin de poder asignar una nota a los compaeros de equipo, tambin nos dijeron que debamos continuar con las tareas habituales con lo cual debamos combinar nuestro trabajo con el del equipo de diseo. Tras la espera notamos que les falt hacer la vista del login. ','2019-06-04'),(1364,87,'Usuarios','Hoy estuvimos anotando los privilegios para los usuarios. Al final llegamos al acuerdo de que son 3: administrador (todos los privilegios), oficina de alumnos(escritura) y alumnos (lectura).\nTambin estuvimos calificando a nuestros compaeros','2019-06-04'),(1365,54,'Usuarios','Hoy junto a mis compaeros debatimos sobre los usuarios de la base de datos','2019-06-04'),(1366,52,'clase 8 de oficina de alumnos','el dia de hoy estuvimos continuando con la union de vistas de diferentes programas de paginas web \ny nos hicieron puntuar a nuestros compaeros de area del 1 a 4','2019-06-04'),(1367,40,'Trimestre finalizado','Hoy terminamos con los detalles que quedaron y  vistas extras','2019-06-04'),(1368,69,'Usuarios','En el da de hoy definimos los usuarios que van administrar la base de datos.','2019-06-04'),(1369,71,'Usuarios','Hoy junto a mis compaeros estuvimos hablando para definir los usuarios de la base de datos, llegamos hasta ahora a tres; administrativo, oficina de alumnos y alumnos.\nTambien calificamos a nuestros compaeros','2019-06-04'),(1370,65,'vistas','Seguimos retocando las vistas, despues de una charla constructiva con el jefe del proyecto','2019-06-04'),(1371,72,'Clase 14 montar servers PHP, Mysql, Apache2','La clase de hoy me enfoque en la tarea de resolver un par de problemas que tuvimos el server de PHP, aparte monte el server de Apache, myql y PHP. Tambien utilice el php para configurarlo, para maana utilizarlo.','2019-06-04'),(1372,86,'Instalacion y configuracion de Thunderbird','Hoy despues de perder una hora tratando de resolver un problema de sincronizacion de google y thunderbird pude conectarlo despues de una re-instalacion','2019-06-04'),(1373,68,'Puesta en comn de archivos con Diseo y puntuacin de los integrantes','Comparamos los archivos con el jefe de Diseo para as tener todas las vistas actualizadas.\nPuntu, ante el jefe de proyecto, a los integrantes de mi grupo en valores entre el 1 y el 4, siendo 1 &quot;No trabaj o casi no trabaj&quot;, y 4 &quot;Trabaj todo el tiempo o casi todo el tiempo&quot;.','2019-06-04'),(1374,72,'Clase 15, solucin a problemas en FTP','Aparentemente hoy segu teniendo conflictos con el servidor de FTP, lo que me obligo a configurarlo mejor. Gracias a esta idea arragle el problema ocasionado la clase pasada, y consegu montarlo para que funcionen todo tipo de transferencia de datos.\nPor otra parte conecte el  server FTP con una pagina html, la cual utilizaremos mas adelante para la implementacion rpida de paginas.\nEsta clase pude concretarme en vatios tema de los servidores ademas de eso, logre adaptarme al cambio de lder y a las diferentes tareas que nos asignaron esta clase.\n','2019-06-05'),(1375,57,'Nuevo lider','Cambiamos de lider en nuestra seccin e intentamos hacer algunas de las vistas que faltaban por hacer','2019-06-05'),(1376,47,'Nuevo lider e intentar hacer la vista previas','Cambi el lder de seccin y le mostramos todo lo que habamos hecho hasta ahora. Tambin volv a empezar a tratar de hacer la vista de previas, no me est saliendo','2019-06-05'),(1377,64,'Cambio de lider, ftp y mas','En el da de la fecha deje de ser el lder y el liderazgo se lo pasaron a otra persona. Tambin instale la interfaz grfica en la versin final del Ubuntu y luego instale el php 7.3 tambin en la versin final, luego les pase a mis compaeros que estn trabajando con Thunderbird la versin del Ubuntu que ya tiene la interfaz instalada par que ellos trabajen ah.  ','2019-06-05'),(1378,39,'Mysql y Thunderbird.','En la clase de hoy probamos el servidor de base de datos (Mysql) y tuvimos algunos problemas con el usuario, pero pudimos finalmente lograr que funcione correctamente. Ademas juntamos todos los trabajos en un mismo servidor.','2019-06-05'),(1379,52,'clase 9 de oficina de alumnos','hubo un cambio de jefe y termine de cambiar, modificar y arreglar todas las vistas de la aplicacion \nsolo falta los diseos del area de diseo y las ultimas vistas funcionales para oficina de alumnos','2019-06-05'),(1380,66,'Decimo quinta clase','Hoy se el grupo de desarrollo cambio un integrante y de lider, hasta ahora se hizo una carpeta de drive para poder trabajar mejor accediendo de una manera mas rapida a los archivos, tambien nos dijeron que tenemos que hacer las funciones que estaban planeadas para este trimestre, por mi parte debo encargarme de conectar las funciones que hicimos con las vistas de la gente de sieo, que por cierto aun no estan ya que se gestiono mal la creacion de vistas, habra que esperar.','2019-06-05'),(1381,87,'Nueva seccin','Hoy me cambiaron de seccin y soy el nuevo lider de desarrollo. Me encontr una mala organizacin en los cdigos y las vistas. Estuve leyendo el manual de usuario y viendo los cdigos que haban hasta el momento. ','2019-06-05'),(1382,67,'Inicio de trimestre','El da de hoy empezamos el 2do trimestre y hubo un cambio en el grupo, nuestra lider de grupo fue cambiada a otra seccin, por lo dems averigue un poco sobre la seguridad en la base de datos y poco mas.','2019-06-05'),(1383,68,'Cambio de jerarqua y edicin de manual de usuario','Al comenzar un nuevo trimestre, tuvimos un cambio de reas y/o jerarquas. En lo personal, yo qued en Desarrollo pero ya no soy lder.\nComenc a editar el manual de usuario para que sea de lectura ms sencilla y comprensible, al igual que modifiqu cuestiones de formato (tamao de letra, resaltado, etctera). La siguiente clase seguir con esta tarea.','2019-06-05'),(1384,86,'Mysql Thunderbird.','Hoy me dijeron de ser lder de rea y result relativamente bien.\nTodos habian terminado sus trabajos menos la parte del FTP, que necesitbamos para continuar con PHP, interfaz y Thunderbird. \nCon Marcos hicimos la base de datos con MySQL y preparamos el Thunderbird para cuando tengamos la oportunidad de instalarlo con la nueva interfaz que Guido aadir.','2019-06-05'),(1385,65,'Vistas','Ajustamos algunas vistas','2019-06-05'),(1386,63,'Decimoquinta clase','En esta clase se cambiaron los lderes, como a su vez algunos miembros; en el caso de nuestra rea, se fue Sanginetti y entro Tuffano (actual lider).\nLa idea de hoy era unir el trabajo realizado en Codeigniter con las vistas desarrolladas anteriormente por el rea de diseo. El problema es que su trabajo estaba mal gestionado, por lo que en esta clase no se pudo hacer mucho.','2019-06-05'),(1387,76,'Mantenimiento y Correcciones','Hice una revisin de todo lo hecho hasta el momento. Me adentre un poco mas dentro de lo que haban hecho nuestros compaeros de Martes y Jueves, para luego poder acoplar nuestro proyecto al de ellos para mayor facilidad. Luego realice pequeos cambios dentro de la documentacin del grupo de BD.','2019-06-06'),(1388,53,'Buscando ong ','Buscando ong\n','2019-06-06'),(1389,50,'Maquetado de vistas en paralelo','Continuamos con el desarrollo de la pagina web logrando una estructura comn entre la mayoria de las vistas para lograr homogeneidad durante el desarrollo.  ','2019-06-06'),(1390,42,'Maquetado de vistas en paralelo','Continuamos con el desarrollo de la pagina web logrando avances los cuales nos van a servir para estructurar las diferentes vistas para lograr una homogeneidad en este proceso. ','2019-06-06'),(1391,74,'mitad de trabajo ','hoy todos estuvimos programando para realizar el proyecto, yo use virtual box - ubuntu y me encargue mas de la base de datos y los demas de servidor web y otras cosas en relacion, seguimos avanzando con el proyecto.','2019-06-06'),(1392,85,'Debate sobre componentes','Estuvimos hablando sobre  los componentes a utilizar en el proyecto, por ejemplo si es o no necesario la implementacion de un amplificador, tambien vimos sobre que salidas de sonifo utilizat etc. Tambien estuvimos viendo que simuladores podriamos usar para diagramar el proyecto en arduino. concluimos que pasaresmos directamente a hacer las pruebas fisicamente','2019-06-06'),(1393,83,'ubunto','hoy me encargue de ver unos codigos para el servidor pero no me habaian avisado que habia que descargar ubunto por lo que lo empece a hacer pero eso lleva un tiempo. mi lider me dijo que volviera a investigar cosas que ya habia hecho. de paso tambien fui completando la carpeta.','2019-06-06'),(1394,46,'armado de manual de usuario','hoy investige sobre el servidor ubunto y arme el manual de usuario de el mismo','2019-06-06'),(1395,80,'vistas y html','el da de hoy continuamos con el desarrollo de las vistas en cdigo, ayudndonos con materialize y w3 School.\nconfiguramos la parte de informacin personal del alumno y el listado.','2019-06-06'),(1396,75,'Adaptacin del prototipo a la base de datos','En esta clase, ya realizados los diferentes prototipos, se procede a adaptar a la base de datos. Es decir, adaptar el prototipo para que haga las consultas correspondiente en la tabla correcta. Tambin que muestre en la tabla los datos necesarios de la tabla requerida. ','2019-06-06'),(1397,55,'No hay mucho que hacer','Hoy nuestro grupo al tener nuestra parte del trabajo completada no pudimos hacer mucho mas que esperar a que los dems grupos terminen.','2019-06-06'),(1398,45,'final de trimestre','hoy hicimos modificaciones en el proyecto carpeta de campo etc...\nel trimestre que viene continuaremos si no nos cambian de seccion','2019-06-06'),(1399,60,'Finalizacion de trimestre','El dia de la fecha se cerraron los trimestre y se continuo con el proyecto en el cual no hubo mucho avance, diria que casi se queda estancado.','2019-06-06'),(1400,58,'final de trimestre','Hoy realizamos el final del proyecto de diseo en html y termine de hacer algunos retoques en el proyecto.','2019-06-06'),(1401,78,'Nuevas tareas a futuro (06/06/2019)','No hice mucho. Tuve un problema al traer lo que haba hecho en casa (buscar alumno segn criterio). Le configure el puerto 8080 al xampp y al CodeIgniter. Hable con mi jefe sobre tareas a futuro, por ejemplo: Que al mostrarse los alumnos, haya botones desplegables. Al elegir un curso se despliega las opciones de turnos. Es tarea del equipo de diseo, pero la funcionalidad nos encargamos los de desarrollo.','2019-06-06'),(1402,79,'Problemas con el servidor y un proyecto de DEA ','Hoy decidi dedicarme a mi tarea de infraestructura, asi que me dedique a investigar sobre github. Cosas como por ejemplo como instalarlo y como funciona. Sin embargo antes de eso (o en medio de eso) revise con Nacho el diagrama que hizo de Arduino. Le marque unos problemas que tenia, que causarian un corto circuito o un algun led quemado. Le dije a Nacho que si podia utilize otro simulador que le permita programar los componentes pero no habia encontrado ninguno, asi que ni bien pueda voy a buscar un simulador a ver si lo encuentro. Despues de eso decidimos mostrarselo a profesor Gonzalo para ver si obviando los errores de corto, habia algo que agregarle (como capacitores o diodos para proteger lso componentes) pero no pudimos porque estaba muy ocupado. Despues de eso, al investigar los suficiente de github como para instalarlo, decidi instalarlo en el servidor pero tuvimos problemas. Primero no tomaba la contrasea, probamos con mayusculas, con miniusculas, incluso con contraseas modificadas por si nos hubieramos equiivocado al guardarla pero nada. Asi que decidi reinstalar el esxi. Pero tuvimos problemas con el booteo, probamos ejectuarla en modo efi, bootear desde la bios, formatear el pendrive, cambiar el puerto, pero nada. Despues de estar mucho rato intentando retome mi investigacion de github. ','2019-06-06'),(1403,82,'final de trimestre','agre algunos detalles en mi proyecto y ayude a los de mas es sus proyectos\n','2019-06-06'),(1404,51,'Clase de ayuda','hoy mir si podia agregarle/modificar algo de la base de datos y depaso me puse a ayudar a unos compaeros que su proyecto es con la base de datos','2019-06-07'),(1405,79,'Comunicacion con el grupo de mecanica y continuando con infraestructura','Primero me dedique a terminar por completo el presupuesto de DEA, fueron en total cuatro o cinco medios de compra difernetes. De igual forma estoy desconforme con el presupuesto ya que seguramente cuando continuemos un poco con el diagrama del proyecto vamos a tener que agregar mas componentes, ademas de que no puede estudiar vien las especificaciones de los componentes. Despues de terminar con eso fui con Nacho a entregarles eso y las medidas del arduino al grupo de mecanica, tardamos un buen rato porque no sabiamos donde estaban y recorrimos varias aulas. Nos quedamos hablando un poco con la compaera Damila de mecanica sobre lo que estabamos decidiendo todavia (eleccion de pilas y otras cosas) y despues volvimos al aula. Despues de todo eso me dedique a infraestructura, ante lo mas importante que habia leido de github la clase pasada y de mientras decidi intentar otra vez bootear el servidor. Como no puede hacerlo con exito volvi a hablar con los profesores. Gonzalo llego a la conclusion de que no estaba booteando bien asi que decidimos usar otro pendrive, queda por ver si podre instalarlo con exito o no. ','2019-06-07'),(1406,53,'Colocacion de mapa ','Rellenar la carpeta de campo sobre lo realizado el 07/06//2019.\nBuscar un video sobre como crear mapa, buscar alternativa sobre googlemaps.\nutilizar esa alternativa ','2019-06-07'),(1407,50,'Implementacion de Dialog y Collapse','Se continuo con el maquetado de la pagina, implementando nuevos elementos a la interfaz. Tales como la etiqueta &quot;Dialog&quot; y los elementos &quot;Collapse&quot;.','2019-06-07'),(1408,36,'esperando la vista y bd','observe la vista de falta','2019-06-07'),(1409,85,'programacion del arduino y comunicacion con los chicos de mecanica','Hoy me concentre en programar gran parte del cdigo para el funcionamiento del arduino, aun as no pude verificar su funcionamiento y fue mas una tarea de investigacin para luego poder hacer una prueba mas especifica con un arduino de verdad fsicamente, por otra parte le dimos las medidas exactas del arduino a los chicos de mecanica al mismo tiempo que los presupuestos y la carpeta de campo, tambin hablamos sobre el tamao del DEA ya que ellos tenian la idea de achicarlo aun mas y necesitaban nuestra confirmacion y las piezas que utilizaremos.\n','2019-06-07'),(1410,76,'Mantenimiento y Apoyo','Se recorrieron las diferentes reas que usan la base de datos para ayudarlos a comprender la misma y de paso conocer si alguno discrepa con la manera en al que esta hecha la misma, para poder corregir los errores o mejorar en caso de ser posible. Luego, con el tiempo libre que quedo, comenc aprendiendo y informndome acerca de GIT, ya sea su uso o funcionamiento. Anteriormente no lo haba hecho porque los horarios y la carga de trabajo no lo permita.','2019-06-07'),(1411,42,'Implementacion de Dialog y Collapse','Se siguio trabajando con el maquetado de las vistas de la pagina, implementando nuevos elementos a la interfaz. Tales como la etiqueta &quot;Dialog&quot; y los elementos &quot;Collapse&quot;, para poder tener un mejor aspecto y rendimiento. ','2019-06-07'),(1412,60,'continuacion del desarrollo de proyecto ','El dia de la fecha sigue en proceso el desarrollo del proyecto trimestral, cada vez esta mas cerca de la finalizasacion de tal objetivo.','2019-06-07'),(1413,78,'avance de carpeta de campo (07/06/19)','Como no me asignaron ms tareas aproveche a completar mi carpeta de campo, poniendo imgenes del cdigo de la anterior tarea que haba hecho, la cual era la de seleccionar alumnos especificando su curso y trimestre de la nota (La ltima especificacin sin hacer)','2019-06-07'),(1414,83,'ubuntu','hoy estaba con el procedimiento de descargar ubuntu, pero tuve un  contratiempo con la descarga por lo cual no se pudo instalar. intente hacerlo mas de una vez pero falle. como no estaba mi lider no podia preguntarle porque el me encargo esta tarea pero bueno.','2019-06-07'),(1415,75,'Adaptacin del prototipo a la base de datos (II)','En esta clase segui adaptando el prototipo a la base de datos. Me costo ya que hay que adapta la consula con INNER JOIN con codeigniter. ','2019-06-07'),(1416,55,'Seguimos esperando','Hoy al tener toda nuestra parte terminada seguimos esperando a que los dems grupos terminen sus respectivas partes.','2019-06-07'),(1417,44,'Observamos y pedimos la bd y la vista de faltas.','Estamos a la espera de la vista de la pag de faltas para poder avanzar.','2019-06-07'),(1418,44,'Observamos y pedimos la bd y la vista de faltas.','Estamos a la espera de la vista de la pag de faltas para poder avanzar.','2019-06-07'),(1419,46,'descarga de ubuntu','visitamos varias paginas para descargar ubuntu, al final descargamos 3 versiones diferentes pero no pudimos abrir ninguna ','2019-06-07'),(1420,82,'final del trimestre','cambie y agregue  diseos  a los proyectos del css y utilice la pagina w3school','2019-06-07'),(1421,48,'Busqueda de informacion','Realice busqueda sobre html para ver que poder agregar a la pagina','2019-06-07'),(1422,45,'mejoras de diseo','hoy realizamos mejoras de diseo tales como fondo, cambio de letra(fuente), entre otros detalles con la ayuda de w3school.','2019-06-07'),(1423,58,'Esperando a los demas para terminar el proyecto','Estuve buscando informacion sobre como poder mejorar mi proyecto y agregue un par de cosas ','2019-06-07'),(1424,49,'vistas','En el dia de hoy continuamos retocando las vistas para mejorarlas aun mas.','2019-06-11'),(1425,43,'Mejores diseos de vistas','Hoy estuvimos charlando entre nuestro grupo como sera la mejor vista, cosa que estuvimos de acuerdo cada uno. Luego, estuve creando una carpeta que se trate de los fondos y all ingresar distintos de ellos, para que todos puedan hacerlo de manera ms fcil sin necesidad de buscar. ','2019-06-11'),(1426,41,'Reunin sobre las vistas','En el da de hoy el profesor nos reuni a todos para hablar sobre el temas de las notas tambin nos comento cosas de la bitcoras y la carpeta de campo que cosas agregar para que queden mejor y nos dio ideas sobre las vistas.','2019-06-11'),(1427,38,'Edicion de las vistas','En el dia de hoy seguimos con la edicion de las vistas, aunque ya tenemos unos diseos, continuamos con la creacion de otras para poder tener diferentes formas de poder visualizarlas.','2019-06-11'),(1428,38,'Edicion de las vistas','En el dia de hoy seguimos con la edicion de las vistas, aunque ya tenemos unos diseos, continuamos con la creacion de otras para poder tener diferentes formas de poder visualizarlas.','2019-06-11'),(1429,66,'Decima sexta clase','Hoy el grupo de desarrollo hablo sobre lo que se hizo y se comentaron las mejores o correciones que debemos hacer respecto a las funciones que ya tenemos hechas, tambien nos repartimos el trabajo de lo que queda por hacer.','2019-06-11'),(1430,64,'Comienzo Segundo Trimestre: Interfaz.','En el da de la fecha nuestro profesor al inicio de la clase nos brind una charla para aclarar algunas cosas ocurridas en el trimestre anterior. Luego cuando iba a proceder a levantar el servidor apache, me doy cuenta que la interfaz no estaba instalada, tuve que instalarla de vuelta, en lo que tardo unos 20 min en hacerlo, al finalizar instala el paquete de idioma y algunas aplicacin para trabajar mas cmodo y en lo que me doy cuenta la clase ya termina, por eso voy a postergar lo de php para el 12/06/2019.','2019-06-11'),(1431,57,'Nos organizamos e hicimos previas','La lider de seccin organiz bien cada vista que iba a hacer cada participante de la seccin de desarrollo, a mi me toc modificar completamente la vista de previas','2019-06-11'),(1432,69,'11/06','En el da de hoy investigamos como encriptar  la contrasea de la tabla usuario de la base de datos, y la aplicamos con MD5. Adems,  agregamos dos campos a la tabla previa, los campos previa1 y previa2.','2019-06-11'),(1433,47,'Segu trabajando en la vista de previas.','Nuestra lider de seccin organiz que vista tena que hacer cada uno, me toco previas. Segu trabajando en la vista de previas.','2019-06-11'),(1434,73,'11-06-2019 vista previa de las paginas ','hoy estuvimos viendo las vistas previas para las paginas, los modelos,  vimos como ejemplo navbar css ux, login ux examples y tambien trabajamos con los fondo de pantalla del incio','2019-06-11'),(1435,70,'Carpeta de campo','Us el tiempo de la clase para extender mi carpeta de campo (Con el permiso del profesor) y unirlas todas (Estaban todos los das desparramados, resultado de haber subido dia por dia a encuentrotecnologico). Recibimos una tarea del profesor que era basicamente encontrar vulnerabilidades con la seguridad de la base de datos.','2019-06-11'),(1436,52,'clase 10 de oficina de alumnos','el dia de la fecha se charlo con el jefe del area de practicas profecionalizantes para una organizacion de los equipos.\ny hubo una charla con la lider de area de desarrollo para una mejor forma de ordenar los proyectos a hacer','2019-06-11'),(1437,71,'MD5 y modificaciones el campo previas','Encriptamos la clave en usuario con MD5, y agregamos &quot;previa1&quot; y &quot;previa2&quot; en campo previa','2019-06-11'),(1438,87,'Organizacin','Hoy nos juntamos y estuvimos probando la pgina para ver qu faltaba o andaba mal. Hicimos una lista de tareas, nos la repartimos y cada uno empez a hacerlas.','2019-06-11'),(1439,54,'Investigacin y encriptado de password','En el dia de la fecha investigamos vulnerabilidades de la base de datos y tambin MD5 posteriormente encriptamos la password de usuarios','2019-06-11'),(1440,65,'Investigacion y Carpeta de campos','Segui investigando para mejorar las vistas, pero mas que nada estuve mejorando mi carpeta de campos ya que se encontraba incompleta','2019-06-11'),(1441,68,'Organizacin y cambio de formato del manual de usuario','Tuvimos una reunin de los integrantes del rea para tomar nota de elementos faltantes y defectuosos, al igual que posibles mejoras a la pgina.\nComenc a modificar el formato del manual de usuario, incluyendo capturas de pantalla para mejorar la legibilidad y esttica.','2019-06-11'),(1442,43,'Ms vistas ','Hoy estuvimos creando las vistas con un diseo diferente. Por ejemplo, estuvimos creando la vista de: Recuperar cuenta, pero con un diseo mejor al que hicimos del trimestre pasado. Igualmente, an nos quedan ms vistas por renovar. ','2019-06-12'),(1443,49,'continuacion de vistas','En el dia de hoy seguimos con la continuacion de mejorar las vistas.','2019-06-12'),(1444,38,'Edicion de vistas','Seguimos con la edicion de las vistas en bootstrap, tuvimos algunas vistas que realizamos con html y css y estamos pasando todo a bootstrap con sus herramientas para poder facilitar su elavoracion y asimismo consiguiendo diferentes aspectos de las paginas.','2019-06-12'),(1445,64,'Clase fallida, DNS, correo, interfaz (de vuelta) etc...','En el da de la fecha cuando se bamos a trabajar con el Ubuntu, nos dimos cuenta que no funcionaba, por eso tuvimos que trabajar con el backup de la clase del 5 de junio de 2019, ya solucionado el problema con mi compaero Gonzalo instalamos el programa Thunderbird es un cliente de correo electrnico, pero en el medio de la instalacin nos dimos cuenta que el programa necesitaba  una interfaz grfica, que era la que tenamos en la versin ms reciente de nuestro proyecto que no anduvo por eso esta vez instalamos de forma distinta la interfaz y tomamos algunos recados as se evitaban futuros problemas. Al final no era necesario instalar el ThunderBird, ya que haba na manera ms fcil de hacerlo y ya q no pudimos resolver el problema que tenamos con esta aplicacin optamos instalar de otra forma el server de correo electrnico. Lo que nos queda pendiente para la clase siguiente es configurar el DNS y el servidor de correo.','2019-06-12'),(1446,52,'clase 11 de oficina de alumnos','estubimos arreglando algunos problemas de la pagina que desarrollamos y creando alugunos codigos de verificacion , agregar y borrar','2019-06-12'),(1447,86,'Fallar repetivamente','En la clase de hoy no hicimos progreso alguno. Perdimos muchisimo tiempo en la instalacion de Ubuntu cuando no era necesario. Buscamos alternativas pero aun tenemos que ver si son vlidas y/o funcionales','2019-06-12'),(1448,70,'MD5, Tablas, Stored Procedures','Hoy segui investigando sobre MD5, despus de eso, ya que no tenia demasiada importancia, fui a ver las vistas proveidas por diseo para agregar mas tablas, despues de unos problemas con Bootstrap termin por empezar a ver stored procedures y a tratar de aplicarlas a nuestra base de datos.','2019-06-12'),(1449,47,'Buscadores para previas','Hice 2 buscadores para las previas, uno para buscar a los alumnos que quers agregar a la tabla previas y el otro para buscar a los alumnos que quers agregarle las materias previas que tiene.','2019-06-12'),(1450,40,'Edicin de vistas','En el da de hoy editamos las vistas de becas para una mejor visualizacin para el usuario y las adaptamos a los diferentes dispositivos.','2019-06-12'),(1451,72,'Clase 17, Mas problemas y aprendizaje (FTP, PHP)','En la clase de hoy estuve viendo los distintos problemas que se me presentaron durante toda la clase, quede en que no pude iniciar el server PHP, pero para la clase siguiente seguir intentndolo. Ademas me dedique a investigar la configuracin de FTP y progrese en el entendimiento de los servidores. Creo que cada clase me acerca mas a saber como montar distintos servidores web, y de transferencia de datos.','2019-06-12'),(1452,65,'Mejorar vistas','Trabaje en la vista &quot;men inicio&quot;, la comenc de 0 con un nuevo diseo','2019-06-12'),(1453,41,'Creacin de vistas','En el da de hoy, segu terminando lo que faltaba agregar de la vista de recuperar cuenta terminando de colocar los botones y colores, tambin le agregue un cuadrado de color blanco transparente en el centro de la vista donde estn los campos para completar. Faltara agregar el logo y retocar algunas cosas para que quede mejor.','2019-06-12'),(1454,69,'12 de junio','En el da de hoy encriptamos el campo password de la tabla USUARIO. Y generamos distintas contraseas/claves.Y el permiso. \nAdems  modificamos el manual de usuario, agregamos los campos previa1 y previa2 a la tabla PREVIAS, y que trabajamos con MD5 para encriptar el campo password.','2019-06-12'),(1455,67,'Modificar tablas y encriptamos la tabla password','El da de hoy un grupo del rea se dedico a modificar las tablas segn las necesidades de el rea de Diseo y el otro se dedico a la seguridad de la base de datos como encriptar la tabla password','2019-06-12'),(1456,54,'Manual de usuario,MD5','En el da de hoy volvimos a encriptar las password,modificamos el manual de usuario agregando contenido y consultamos con el area de diseo las tablas que deberamos agregar a la base de datos','2019-06-12'),(1457,66,'decima septima clase','Hoy solo vinieron 3 integrantes del equipo de desarrollo, pero igual cada uno tenia tareas asignadas con lo cual estuvimos ocupados, por mi parte tuve que corregir ciertos errores que se presentaban, los cuales algunos los pude resolver pero otros se complicaron.','2019-06-12'),(1458,71,'Manual de usuario,MD5','En el dia de hoy encriptamos  ya en nuestra base de datos el campo password a la tabla Usuarios, usando en el cdigo MD5. Adems consultamos con el rea de diseo para poder agregar tablas a la base de datos y modificamos el manual de usuario con todo lo hecho hoy','2019-06-12'),(1459,51,'Clase de mentenimiento y Ayuda','en la clase de hoy me puse a hacer el mantenimiento de la base de datos, depaso tuve q modificar los datos de la tabla PREVIAS, cambiar los nombres y poner &quot;foreing key&quot; y de paso me puse a ayudar a mi compaero a que haga la documentacion de nuestro progreso como grupo','2019-06-13'),(1460,53,'Verificacion y busqueda','Darme cuenta de que hay que buscar otros metodos para colocar el un mapa en la app web que se armo porque el codigo anterior no se funciono, al buscar informacion se encontro otro metodo y se probara ese.','2019-06-13'),(1461,83,'ftp reparacion','hoy cada una se sento una maquina diferente. \ninvestigamos rapido sore el ftp y el ubunto.\nuna vez hecho eso tuvimos una charla con el profesor porque nuestro equipo no tiene lider por el momento, nos diejron que las dos nos juntaramos para reparar un trabajo de ftp que se necesitaba para el correo electronico. lamentablemente  cuando entramos al programa para trabajar el usuario y contrasea era invalidos, consultamos con los profesores y nos comunicamos con el grupo de los martes y miercoles  pero no se pudo porque  los datos no concidian por lo que no podeiamos avanzar.','2019-06-13'),(1462,58,'modificamos las vistas','Hoy tuvimos un nuevo lider y estamos arreglando los errores para  hacer el index para poder juntar todas las vistas de html  de los integrantes del grupo de desarrollo ','2019-06-13'),(1463,77,'Asimilacin del Framework','Horas utilizadas para revisar el entorno en el que trabaja el grupo de DESARROLLO, vista general del proyecto hasta el momento e inicio de asimilacin del CodeIgniter que se utiliza en la pgina. ','2019-06-13'),(1464,45,'rediseo de la pestaa','hoy inicie unas modificaciones en la pestaa y hubo cambio de jefe el cual esta aplicando cambios en el grupo','2019-06-13'),(1465,82,'nuevo trimestre','tenemos un nuevo lider y nos estuvimos organizando con el nuevo lider, nos hizo modificar los trabajos anteriores ','2019-06-13'),(1466,78,'CRUD completo de alumnos (13/06/19)','Hoy hicimos una revisin de lo que tenemos y lo que falta. Se dividi todas las tareas en dos grupos, un grupo de alumnos, que tiene lo que falta desarrollar, esto sera la funcin de agregar un alumno, actualizar los datos del alumno y eliminar un alumno. Leer y mostrar alumno ya estara hecho. El otro grupo es el de las notas, las taras correspondientes a este grupo son las agregar nota, trimestre, etc. Yo tengo asignado el grupo de alumnos. \n\n\nLas tareas se pensaron de la siguiente manera:\n\n-Agregar alumno tendra una sola vista: un formulario en el que se ingresan solo los datos importantes (nombre, apellido, curso) excluyendo otros datos como telfono, direccin, etc. Luego se mandara un alert() con javascript avisando que se agreg el alumno. Luego se redirige a la vista donde muestra a todos los alumnos, donde se mostrara al final de la tabla, el alumno agregado.\n\n-Actualizar tiene tres vistas: La primera son dos inputs que reciben ao y divisin. Cuando se ingresen esos datos, aparece la segunda vista que muestra todos los alumnos de ese curso ingresado. Al lado de todos los alumnos habr un botn actualizar, que mandara a otra vista la cual tiene el mismo formulario del de agregar con todos los inputs llenos, es decir, obtiene los datos del alumno y se autocompletan en los inputs. Se modifica el que quiera el usuario y se vuelve a mandar a la base de datos.\n\n-eliminar tiene dos vistas: la primera con dos inputs que reciben ao y divisin. La segunda vista muestra tambin la tabla con todos los alumnos de ese curso. As como la tarea de actualizar tiene un botn al lado de los alumnos, esta tendr un botn de eliminar.\n\nPara actualizar y eliminar tengo que ver un tema de CodeIgniter, el cual es segmentos.','2019-06-13'),(1467,36,'haciendo vista, modelo y controller de asistencia','no nos dieron vista todavia...','2019-06-13'),(1468,85,'Cambios al diagrama de conexion de la interfaz del DEA','estuve cambiando el diagrama debido a algunos errores y debido a que no pude conseguir un simulador que funcionara de la manera que yo necesitaba decidi hacer el diagrama a mano','2019-06-13'),(1469,46,'reparacion de ftp + intalacion de correo','el dia de hoy el profesor nos pidio que trabajaramos con la maquina virtual y ereglemos el error que tenia el ftp que el otro grupo configuro y de paso intalar el &quot;coso del correo&quot; , para hacer eso me junte con belen en una maquina a falta de computadoras y nos turnamos mutuamente para que una investige y otra configure la maquina virtual.   Al intentar empesar a configurar tubimos un problema con el usuario y contrasea, ya que necesitabamos usar la que el otro grupo uso, el profesor intento comunicarse con el otro grupo pero las contraseas que nos dieron no funcionaban.\nhaci que nos quedamos en espera hasta que nos den los datos que nesecitamsop ','2019-06-13'),(1470,76,'Correcciones y Mejoras','Desde desarrollo nos llego una sugerencia para una mejora dentro de la base de datos, y luego de analizar esta, se decidio aplicarla dentro de la misma. Lo que se hizo fue cambiar y adaptar mejor dos tablas de la base de datos, las cuales facilitan suuso. Luego de eso se actualizo la documentacion y se hizo un manual de uso para el usuario.','2019-06-13'),(1485,44,'Hicimos el nuevo controler, la vista y el modelo de inasistencias','Estamos desarrollando la ventana de inasistencias.','2019-06-13'),(1486,48,'Comence el segundo trimestre con nuevo lider','Hoy cambiron el lider y lo estuvimos poniendo al dia con las cosas que teniamos, nos organizamos con todo el grupo para ver los trabajos que teniamos realizados y los que nos faltaban ademas me hizo cambiar mi trabajo anterior.','2019-06-13'),(1487,75,'Realizacin de la funcin actualizar Nota','En esta clase ya empece a ser lider  del sector de desrrollo. Por ende se nombraron todas las funciones faltantes y se distribuyeron con el equipo. Yo empece a realizar la funcin actualizar nota ya que haba hecho anteriormente la funcin agregar nota. ','2019-06-13'),(1488,60,'Cambio de personal','En el dia de la fecha, yo me cambien de la seccion de Desarrollo a la seccion de Infraestructura en la cual comenzamos a crear una maquina virtual que fuera el hosting del servidor, tambien dividimos el trabajo en el cual me encargo de crear una maquina virtual para E-mail, DHCP y DNS','2019-06-13'),(1489,79,'Trabajando con el servidor, intentando migrar MV y resolviendo pequeas dudas de arduino para proyecto DEA','Lo primero que hice en el dia, despues de llegar es hablar con el profesor Gonzalo Consorti sobre el aruduino, especificamente sobre como proteger el arduino de otros componentes y las formas de conexion de un boton y me explico de dos formas, pull-up y pull-down. Despues tuvimos una interrupcion por una simulacro de emergencia en el colegio. Despues de volver fuimos a buscar el servidor fisco al aula de al lado, hice la conexion de las fuentes, a la red y el monitor. Tuve que lidiar luego que con lo que crei que eran problemas de conexion de red, que no fue mas que una confucion. Despues me quize dedicar a como instalar el github, para lo cual tuve que primero esperar a que el profesor Damian Olaso me de el pendrive con el VMWare vSphere para conectarme al servidor y poder crear o emigrar de hay una maquina virutal. Cuestion que tuvimos problemas con el instalador por cuestiones de licencia, desinstalamos, probamos con otro instalador. Llegamos a la conclusion de que el problema era posiblememte las licencias del Esxi, por lo tanto es probable que dentro de 60 dias tengamos que migrar todas las maquinas virtuales de Exsi a una pc y luego volver a guardarlas en el Exsi. Despues de este problema intentamos pasar una maquina virtual del VMWare vSphere al Exsi (exportar quizas sea el termino correcto), cuestion que no pudimos. Probamos varias cosas, conectamos el disco del profe tanto al servidor como a  la computadora con VMware, el profesor Gonzalo creo una maquina virtual e intento varios procedimientos y no lo logro, el profesor Damian tambien estuvo intentando resolver el problema, no hubo forma, no tomaba el disco (el servidor). Procedimos a leer algunas guias por internet y un tutorial por you tube, llegamos a la conclusion de que teniamos que usar un programa llamado VMware vCenter Stand Alone y tenemos que pasar la maquina virtual por red. Vimos la opcion de en vez de usar Exsi usar un open source pero hay que seguir viendo. La proxima vez vamos a usar un ruter para hacer una conexion directa con el servidor y pasar rapidamente la VM. ','2019-06-13'),(1490,56,'Desarrollo de pestaas','-Se cambio el jefe de area\n-Rediseo de pestaas\n-Correcion de errores en el maquetado\n-Nuevo diseo de tablas y pestaa de inicio\n-Correccin con la distribucin de botones en la pagina\n','2019-06-13'),(1491,74,'Diseo','el dia de hoy me nombraron jefe de diseo, me cambiaron de especialidad porque vieron que me centro mas en ese ambiente, lo primero fue hablar con los chicos para ver que estaban haciendo y ponerme al dia, tenian un par de errores y estaban desordenados, por suerte logre ponerme al dia y los oriente para avanzar, fue una corrida intensa nisiquiera tuve tiempo para trabajar yo pero hable con integrantes del grupo para que vean como estoy haciendo la pagina que esten lo mas sincronizado posible para poder los datos de los alumnos del todo el colegio. \nalgunos de mis nuevos integrantes no tienen mucha experiencia con los leguajes de programacion pero les di una mano y muchas fuentes de informacion e incluso les di una guia impresa que tenia guardada hace un tiempo que les servio mucho. \n','2019-06-13'),(1492,43,'Vistas ','Hoy estuve haciendo una vista nueva con un diseo un tanto peculiar, se trataba del fondo transparente, con el cuadro de igual forma slo que un poco azulado. Cree una vista llamada &quot;Registro&quot; que me quedo por ahora bien. Aparte de eso, el profe me dio un par de consejos para mejorarla y ya s que hacer en la otra clase.','2019-06-18'),(1493,72,'Clase 18, nuevos comienzos','La clase de hoy no fue muy productiva pero, eso nos dio la ventaja de organizarnos y hacer las cosas de una forma mejor. Los problema que se nos presentaron fueron eliminados , ya que vamos a empezar todo, ya sabiendo cosas que antes no era as.','2019-06-18'),(1494,69,'stored procedure','En el dia de hoy investigamos y miramos tutoriales de stored procedure para trabajarlo en la base de datos que ya tenemos hecha.','2019-06-18'),(1495,47,'Intentando mejorar al vista previas','Intent hacer que en la vista de previas muestre la tabla materias (de la base de datos), para cuando quieras agregar una previa te muestre las materias que estn disponibles.','2019-06-18'),(1496,71,'stored procedure','Hoy averiguamos, vimos videos y tutoriales acerca de stored procedure, para poder aplicarla en nuestra base de datos hecha','2019-06-18'),(1497,38,'Edicion de vistas','En el dia de hoy utilic bootstrap para posicionar de diferentes formas algunas cosas del login y del sector de becas, a su vez tambien seguimos modificando diseos como para ir probando distintas apariencias de la pagina ','2019-06-18'),(1498,41,'Modificando las vistas','En el dia de hoy estuvimos hablando con el profesor sobre el tema de las vistas y nos comento sobre que tenemos que cambiar para que quede mejor, y cambie algunas cosas de las vistas de recuperar cuenta y cambiar contrasea cambiando los colores el fondo los botones y agregando el logo de la escuela.','2019-06-18'),(1499,64,'Dia Fatidico!!!','En el da de la fecha tuvimos un inconveniente muy grande, en materia que no avanzamos nada y que tenemos que realizar los servidores correspondientes de nuevo, por ese motivo esta clase fue un dolor de cabeza para m y mis compaeros al enterarnos de esta fatdica notica.','2019-06-18'),(1500,52,'clase 11 de oficina de alumnos','nos reunimos para discutir como serian las nuevas vistas con respecto al proyecto y seguir haciendo las asignaciones correspondientes','2019-06-18'),(1501,49,'Edicion de vistas','En el dia de hoy seguimos con la edicion de las vistas que quedan por terminar.','2019-06-18'),(1502,57,'Optimizacin de la vista de previas','Intentamos agregar a la vista de previas la tabla materias, para poder mostrar las materias disponibles en caso de querer agregar una previa a algn alumno.','2019-06-18'),(1503,54,'Store procedures','Hoy investigamos sobre store procedures para luego implementarlo a nuestra base de datos','2019-06-18'),(1504,66,'Decimoctava clase','Se charlo sobre si hacer cambios en las vistas para optimizarlas, pero por diversos motivos se descarto la idea. Y yo continu trabajando solucionando errores los cuales pude resolver.','2019-06-18'),(1505,63,'Decimoctava clase','Hoy nos reunimos para debatir al respecto de posibles cambios para el proyecto final, pero por diversos motivos se descarto la idea.\nA partir de ah nos fuimos a trabajar en nuestras partes correspondientes, por mi parte, ayude a Chipana en el funcionamiento de la funcin borrar.','2019-06-18'),(1506,70,'CREATE PROCEDURE ','Estamos trabajando con CREATE PROCEDURE, el tema es que al parecer en esta computadora no funciona bien, estuve probando con distintas formas y al parecer al eliminar los parentesis en &quot;MostrarAlumnos ()&quot; hay un avance, pero solo cuando usamos DROP, maana vamos a probarlo desde la notebook del profe y si hay suerte, podremos avanzar.','2019-06-18'),(1507,87,'Actualizacin','En el da de hoy estuve viendo como iba cada uno en su tarea que ya haba asignado hace dos clases. Despus agarr cada uno de los cdigos de mis compaeros e hice uno con todas las nuevas modificaciones. Al terminar esto empec a hacer la vista de becas.','2019-06-18'),(1508,65,'No muy productivo','Hoy no avance mucho, intente arreglar la vista para que sea responsive y no pude.','2019-06-18'),(1509,68,'Reparto de tareas y re-escritura del manual de usuario','Dividimos las tareas de acuerdo con las funciones faltantes dentro de las vistas.\nVolv a comenzar la reescritura del manual de usuario, reformulando las explicaciones de forma que resultasen de fcil lectura y correctas, y eliminando los fragmentos de cdigo en texto plano para poner, en su lugar, capturas de pantalla de dichos fragmentos en un editor de texto (Sublime), de forma que se mantuviesen los cdigos de color del mismo. De esta forma, facilit la lectura y comprensin general, al igual que mejor la diferenciacin entre cdigo (cita) y explicacin.','2019-06-18'),(1510,68,'Edicin del manual de usuario','Continuando con la tarea de los ltimos das, prosegu con la formulacin de la tercera versin del manual de usuario. Conclu, al menos por el momento, con la descripcin de los controladores en controller.php, y comenc con las funciones de model.php e inscripcin.php.','2019-06-19'),(1511,66,'Decima novena clase','Hoy se charlo sobre la falta de funciones que hay, entre ellas agregar datos de padres. Luego continuamos con nuestro trabajo y me salio un error el cual no puedo resolver. Estuve intentando toda la tarde. ','2019-06-19'),(1512,72,'Clase 19, Un gran progreso.','En la clase de hoy me dedique a hacer todo el primer server de nuevo, lo que me llevo gran parte de la clase. Por otro lado logre configurar y preparar los servidores para su total funcionamiento. Tambin logre terminar exitosamente su configuracin y transferencia de datos por lo que creo que la siguiente clase ya podre pasarlo al server fsico.\n\n\n\n','2019-06-19'),(1513,43,'Arreglo de vista y error.','Hoy estuve arreglando la vista de Registro, la cual, por ahora le he agregado ms cosas. Por ejemplo: Usuario, Nombre,Apellido y Repetir contrasea. Por ahora tiene errores que ni el mismo profe pudo solucionar, vase: No se ve la palabra Usuario, Nombre, Apellido. No s cul es el error cuando todo iba bien. ','2019-06-19'),(1514,87,'Problemas y botones','En el da de hoy habl con la seccin de diseo para poder organizarnos bien con el tema de los botones en las vistas.\nCuando me puse a ver el cdigo tuve algunos problemas con el xampp lo que me llev a reiniciar ola computadora dos veces. Luego agregu un botn para poder agregar los datos del adulto responsable del chico que est inscrito. Pero antes de guardar todo se puso la pantalla azul y tuve que volver a empezar.','2019-06-19'),(1515,70,'STORED PROCEDURE, SOLUCIONADO, AGREGAMOS MAS TAREAS.','Como ayer mencione, tuve problemas con el, stored procedures y phpmyadmin en general, el jefe de proyecto me dijo que busque alguna forma de hacerlo, en el caso de que no encontrase nada (aparte de lo que ya busque ayer), lo hariamos en su computadora. Despues de buscar por un rato, encontr una forma de hacerlo funcionar en forma de rutina, en vez de con codigo, a continuacion de eso, agregu un par de rutinas basicas y procedures ms.','2019-06-19'),(1516,54,'Stored procedure','En el da de hoy realic un stored procedure bsico, con lo investigado de ayer y lo investigado de hoy. tuve algunos problemas pero fueron resueltos con ayuda de vdeos e informacin de Internet.','2019-06-19'),(1517,52,'clase 13 de oficina de alumnos','hoy continuamos trabajando nuestras reas,y estuve viendo vdeos para orientarme','2019-06-19'),(1518,47,'Avanzando con la vista previas','Continu avanzando con el funcionamiento de la vista previas. Avanc en algunas cosas, pero en otras sigo igual, me tira errores.','2019-06-19'),(1519,65,'Vista inico botones y barra de navegacion','Hice responsive el navbar y estuve tratando de hacer los mismo con botones.\n','2019-06-19'),(1520,86,'Instalacin de DNS','No solo intent instalar el DNS sin tambien aprendi mucho de la instalacin de la nueva maquina virtual y la instalacion del sistema operativo VoIP en los tiempos libres de instalacion de cosas u otros tiempos libres como en los recreos.\nAparte de eso, al principo de la clase vimos como organizarnos con las tareas. Y cada uno trabajo individualmente. (apesar de que estuve con Guido)','2019-06-19'),(1521,49,'vistas finalizadas','En el dia de hoy finalizamos con las vistas de becas.','2019-06-19'),(1522,41,'Cambiando y creando  vistas','En el da de hoy estuve retocando la vista de cambio de cuenta haciendo que el fondo se vea bien y hoy empec con la vista de cambio de contrasea ','2019-06-19'),(1523,40,'vistas becas','Hoy cambiamos todas las vistas de becas cambiando el fondo y los botones e hicimos que se adapten a todos los dispositivos cambiando los pixeles por porcentajes.  ','2019-06-19'),(1524,64,'Instalacion en el Servidor Fisico','En el da de la fecha empezamos a trabajar con los servidores fsicos, para lograr eso podemos decir que arreglamos los problemas fatdicos que tuvimos en clases anteriores con xito ya que encontramos los servidores extraviados.\nPara llevar a cabo la migracin del servidor que hicimos todas las clases pasadas a los servidores fiscos  que posee el establecimiento  utilizamos dos programas importantes el primero es el VMware vCenter Converter Standalone que sirve para migrar la mquina virtual del VMWare al servidor fsico (Exsi) y el segundo es el VMware vSphere Client que sirve para manejar la mquinas virtuales en el (Exsi). Luego al final de la clase cree una nueva mquina virtual para  con el nombre VoIP, vacio y le metimos la ISO.\n','2019-06-19'),(1525,63,'Decimonovena clase','Por la falta de computadoras tuve que seguir trabajando en equipo con Chipana; hoy continuamos con cosas pertinentes al apartado de becas y despus estuvimos viendo la funcin eliminar para la parte de usuarios.','2019-06-19'),(1526,38,'Vistas sector de becas','Hoy finalizamos con la edicion de las vistas del sector de becas agregandole nuevos botones, cambiando imagenes de fondo y a su vez cambiando diferentes formatos de vista asi pueden verse bien en diferentes dispotivos como computadoras y tambien moviles','2019-06-19'),(1527,69,'procedimientos almacenados','en el da de hoy trabajamos con el stored procedure, implementamos lo visto ayer en tutoriales y lo que investigamos hoy, hicimos un tabla nueva en nuestra base de datos para practicar con ella.','2019-06-19'),(1528,71,'procedimientos almacenados','Hoy practicamos ya con stored prucedure, viendo tutoriales y siguiendo lo visto el dia de ayer, hicimos una tabla nueva para practicar y agregamos en ella campos','2019-06-19'),(1529,57,'Continuando con la edicin de la vista de &quot;previas&quot;','Continuamos mejorando la vista, haciendo cambios significativos para que se entienda y que el individuo no tenga complicaciones para usarla, sin embargo, nos encontramos con algunos errores que todava debemos solucionar para que todo funcione correctamente.','2019-06-19'),(1530,85,'Arreglando carpeta de campo','debido a falta de tiempo hoy me concentre en arreglar y organizar la carpeta de campo con los criterios y ejemplos que nos dieron los profesores','2019-06-21'),(1531,76,'Backups','Se hizo una breve revisin de que es lo que falta dentro del rea, y con el tiempo sobrante se realizaron copias de seguridad y se repartio el material terminado a otras reas que pueden llegar a necesitarla.','2019-06-21'),(1532,75,'Agregar Materia','En esta clase lo que lleve a cabo fue realizar la funcin agregar materia. Para que sea agregada en la base de datos. Ya en la prxima clase realizare la funcin actualizar y eliminar materia. ','2019-06-21'),(1533,58,'termine el proyecto','hoy termine el proyecto del prototipado de boletin , hice algunos retoques mas y lo pude finalizar. ','2019-06-21'),(1534,56,'Desarrollo de pestaas','-se continuo con el nuevo diseo de las pestaas\n','2019-06-21'),(1535,83,'descarga de vmware','hoy descargamos el vmware, luego de eso intentamos levantar el servidor de vmware para hacer todo lo que se nos pidio \npero por X motivo no pudimos lograrlo\n','2019-06-21'),(1536,36,'solucionando problema de que no me carga el id alumno','Error Number: 1048\n\nColumn \'id_alumno\' cannot be null\n\nINSERT INTO `asistencias_inasistencias` (`id_alumno`, `tipo`, `fecha`, `reincorporaciones`) VALUES (NULL, \'on\', \'2019-06-21\', NULL)\n\nFilename: C:/xampp/htdocs/Codeigniter/system/database/DB_driver.php\n\nLine Number: 691\nsolucionando eso xd','2019-06-21'),(1537,51,'mantenimiento','hoy me encargu de modificar la documentacin ya que mi compaero falt y de paso me puse a ver si poda ayudar a algn compaero en su sector con respecto a agregar la base de datos','2019-06-21'),(1538,60,'Creacion de Servidor emails','Hoy se sigui con el servidor de emails. Se creo una maquina virtual en VMware en el cual se agrego Ubuntu server 64bits, No se pudo seguir por falta de tiempo y con problemas en el login .','2019-06-21'),(1539,50,'Finalizacion','Se termino el primer prototipo de la interfaz general de las vistas. Se continuara con el contenido individual de cada vista con lo realizado por parte del equipo de base de datos y desarrollo.','2019-06-21'),(1540,74,'pulimento de vistas ','empec a ayudar a los chicos que tenan complicaciones con el cdigo al tener ms experiencia con html ayude a hacer partes del cdigo de un par de integrantes porque al ser nuevo no tenia definido que iba a hacer, ademas tuvimos un retraso de tiempo, el docente tuve que ir a una reunin por lo tanto nos quito una gran parte de la clase. pero aun asi pude charlar con los lideres de base de datos y desarrollo y tome en cuenta lo que me pedan, empezar a hacer las cosas con &quot;Materialize&quot;. ','2019-06-21'),(1541,77,'Inicio del Proyecto Work Studio','Luego de charlar con los profesores a cargo. Se confirmo el proyecto con la condicin de realizar una investigacin profunda para la realizacin de la aplicacin. Se encuentra la versin y manuales de Android Studio para el desarrollo del proyecto y comienzo de busqueda de fuentes de informacion ya sea para competencias, usuarios y herramientas necesarias.','2019-06-21'),(1542,46,'razones','el dia de hoy intentamos continuar con la configuracion de ftp en la computadora virtual, nuevamente no tenemos la contrasea para trabajar con la version vieja(porque no se acuardan)y por x motivos no pudimos continual el trabajo','2019-06-21'),(1543,53,'Buscar informacin de nuevo ','Sobre leaflet','2019-06-21'),(1544,78,'AgregarAlumno y actualizar (21/06/19)','Ya haba terminado en mi casa la parte de agregar un alumno y haba demostrado en la carpeta de campo su funcionamiento. Hoy no trabaje mucho ya que tuve poco tiempo y tuve problemas con el puerto 8080. Luego con el problema arreglado empiezo a hacer la primera vista de ActualizarAlumno, reciclando el formulario de AgregarAlumno sacando algunos inputs y as. Como no termine toda la parte de actualizar, lo voy a continuar en casa.','2019-06-21'),(1545,44,'Buscamos y tratamos de arreglar algunos problemas del ID del alumno.','Tratamos de solucionar el problema de la carga del ID del alumno.','2019-06-21'),(1546,82,'continuacin del proyecto','resolv un problema que tenia con el men por lo cual investigue  y solucione el problema, ','2019-06-21'),(1547,79,'Dia poco productivo','Hoy llegue un poco mas tarde que de costumbre y decid dedicrselo al DEA, en vez de al proyecto de preceptoria, ya que hoy no iba alcanzar el tiempo para migrar los servidores, entre que tenemos que bajar el servidor (fisco )y ver como se hace. As que como dije me quise dedicar a trabajar en DEA pero no pude hacer mucho, tuvimos muchas interrupciones y entre que preparaba  las cosas y investigaba un poco realmente lo nico que pude hacer es probar un programa para diseo de circuitos que me recomend el profesor Damian Olaso cuando le pregunte por alguno, se llamaba Eagle, que fue comprado por autodesk. Otra cosa que estuve viendo fue de conseguir la contrasea de la vieja maquina virtual de ubuntu (hablando con Guido Marzoratti, un compaero de infraestructura del otro curso), pero no pude.','2019-06-21'),(1548,41,'Vista de cambio de contrasea','En el da de hoy estuve retocando algunas cosas de la vista de cambio de contrasea agregando iconos y centrando la vista.','2019-06-25'),(1549,72,'Clase 20, intalaciones.','La clase de hoy, logre hacer funcionar el server de PHP y que se muestre por la consola, Ademas intente descargar el bind9 y el vim pero tuve un par de problemas los cuales estuve intentanto resolver durante la clase. Por otro lado ya vi como tengo que soluciones el problema por lo que la clases que vienen espero que todo este bien.','2019-06-25'),(1550,64,'Instalacion DNS (Incompleto)','En el da de la fecha ayude a mi compaero a instalar/montar el servidor de DNS, avanzamos un poco con el tema, pero lamento decir que est incompleto, por eso para la prxima clase ya vamos a tener listo este servidor como el de correo.','2019-06-25'),(1551,40,'Vistas becas','En el da de hoy modificamos las vistas de becas para que sean ms dinmicas a la hora de utilizar la pagina, cambiamos los campos, pusimos un buscador en buscar alumno y agregamos una tabla en donde saldran los resultados','2019-06-25'),(1552,70,'Aplicando','Aplicamos las stored procedures para hacer la base de datos ms dinamica mediante rutinas (Mostrar cursos, materias, alumnos, ordenados mediante)','2019-06-25'),(1553,67,'Stored Procedure','El da de hoy tuvimos una charla con el ex lder del grupo de Diseo y aparte tambin empezamos a implementar Stored Procedure en la base de datos automatizando algunas cosas en la base.','2019-06-25'),(1554,43,'Ms vistos','Hoy estuve tratando de arreglar la vista de Registro de usuarios pero no pude, lo voy a seguir en mi casa','2019-06-25'),(1555,49,'vistas becas','En el dia de hoy estamos modificando las vistas de becas.','2019-06-25'),(1556,66,'Clase veinte','Hoy segu tratando de resolver el error que tuve la clase pasada, me ayudo Flor pero no se pudo hacer mucho, comprobamos que el controlador funciona, pero a la hora de pasar como parmetro los datos, no los toma, o por lo menos el id.','2019-06-25'),(1557,54,'Funcionalidad','Hoy aplicamos store procedure a nuestras tablas para darle funcionalidad a la base de datos ','2019-06-25'),(1558,68,'Formulacin de funciones relacionadas a la vista de Becas','Se realizaron dos funciones necesarias para mostrar a los alumnos becados.\nSe realizaron correcciones en la vista de Becas.\nSe hizo un pedido a la seccin de Base de Datos para aadir el campo Beca en la misma.','2019-06-25'),(1559,69,'stored procedure','seguimos con los procedimientos almacenados pero ahora se lo agregamos a una tabla de nuestra base de datos.','2019-06-25'),(1560,71,'stored procedure','El dia de hoy continuamos con Stored Procedure, vimos mas videos y esta vez la usamos para modificar en nuestra base de datos','2019-06-25'),(1561,65,'Menu inico progreso','Redise el area de los botones.','2019-06-25'),(1562,86,'Instalacion DNS 2','Intentamos nuevamente de instalar el DNS en el servidor, y apesar de que no hicimos mucho por el poco tiempo pudimos hacer un proreso en el proyecyo, y tener una vision mas clara para la clase que viene para poder trabajar tranquilamente. Tambien empezamosa tener problemas de organizacion de los servidores en el pensrive de Ubuntu con las distintas copias de serguridad.','2019-06-25'),(1563,38,'Vistas sector becas','En el dia de hoy diseamos nuevamente la pagina de una forma mas formal, mas organizada y asi tambien ahorrando la creacion de nuevas vistas como ejemplo en la vista de buscar alumnos que este inscriptos en las becas y dentro de esa vista de buscador de alumnos se agreg una tabla dentro de la misma vista donde podran visualizar aquel alumno que desea buscar','2019-06-25'),(1564,47,'Modificando las previas','Agregue a la vista previa las funciones para agregar, editar y borrar previas. Tambin arregle algunos errores que tena,  excepto el buscador.','2019-06-25'),(1565,57,'Modificando las previas','Continu avanzando con el funcionamiento de la vista previas. Avanc en algunas cosas, pero en otras sigo igual, me tira errores.','2019-06-25'),(1566,73,'mejoras de la pagina para previas 25-06-19','hoy estuve cambiando las vistas de la pagina para previas, agrengando mas campos en el formulario','2019-06-25'),(1567,87,'Becas','En el da de hoy estuve haciendo el funcionamiento de la vista becas. Para eso hice dos funciones y empec la parte grfica que es previsora.','2019-06-25'),(1568,63,'Ventigesima clase','El da de hoy contine trabajando con Chipana tratando de resolver lo que nos quedo la clase pasada, verificamos que el controlador funciona pero, a la hora de pasar como parmetros los datos, no los reconoce.','2019-06-25'),(1569,83,'problemas','hoy hubo un problema con las maquinas virtuales.\neso llevo a que en el transcurso del da nos detuviramos a resolverlo.\nasi que eso fue lo que se hizo.','2019-06-27'),(1570,37,'Diagramacin de las prximas clases','Diagramamos lo que vamos a continuar haciendo las prximas clases en la materia en el poco tiempo que nos qued de clase, ya que tuvimos una charla de la UBA sobre orientacin laboral que ocup gran parte del da.','2019-06-27'),(1571,75,'Actualizar y eliminar Materia','En esta clase realice la funciones faltantes,que eran: Actualizar y Eliminar','2019-06-27'),(1572,46,'problemas','el dia de hoy continuamos teniendo problemas con las maquinas virtuales por lo que no pude continuar con el trabajo.\nacordamos empezar una maquina virtual desde 0 para la siguiente clase','2019-06-27'),(1573,36,'CHARLA UBA','vinieron 2 personas de uba a darnos charla sobre nuestra carrera lo que vamos hacer a futuro y como es la universidad','2019-06-27'),(1574,76,'Mas mantenimiento','Por falta de horario debido a una charla relacionado a la universidad (UBA) se perdi mucho tiempo de trabajo. Luego, con el tiempo sobrante, se ordeno todo lo del rea de manera que sea cmodo para cualquiera acceder a la informacin. ','2019-06-27'),(1575,45,'guia vocacional','Hoy vinieron unos psiclogos de la uba a consultar a los cursos sobre el futuro en tanto a carreras universitarias y que tan flexibles son para nosotros resolviendo nuestras dudas.','2019-06-27'),(1576,78,'Terminando el CRUD y comentando (27/06/2019)','Ya haba terminado la parte de agregar un alumno, actualizar los datos y eliminar. Sin embargo, la parte de eliminar alumno, por ms que funcione, falta que cuando se haya eliminado, vuelva a la primera vista en forma de ciclo. Tambin trabaj con eso de volver a la primera vista con actualizarAlumno. Estuve varias horas programando esa parte e intentando hacer que vuelva a la primera vista, esto fue lo que me llevo ms tiempo.\nYa con un 99% terminado, aprovech hoy a revisar el cdigo de actualizar (que es el que ms mareo da) y comente las funcionalidades para que otro de mi equipo entienda como funciona.\nSolo me ocupe de comentar ya que tuvimos una charla en la que nos sacaron varias horas.','2019-06-27'),(1577,53,'Charla ostentativa ','Dos personas llegaron al curso para danos una charla, se trato mas en que pensbamos hacer luego de terminar la secundaria.','2019-06-27'),(1578,42,'Labor','En el comienzo del dia adelante las vistas de la pagina web que estamos armando con el grupo de diseo, luego vinieron unos psicologos de orientacion los cuales nos dieron una charla sobre lo que queremos para el futuro y algunas cosas mas, finalizada la charla volvi al trabajo y termine una de las vistas en las que estaba trabajando para poder continuar con mi parte del proyecto.','2019-06-27'),(1579,74,'enlaces ','ya empec a rellenar los iframes, crear tablar, y que estn conectados, pienso que es un pequeo paso para ir conectando las las vistas,aunque todava no hay ninguna conectada pero ya estoy cerca.\nhoy nos visitaron psiclogos de la UBA pero usando 4:40 horas de la clase de hoy, hoy en clases normales, tuvimos la misma charlas as que solo yo fui el nico que estuvo trabajando cuando nos visitaron porque su charla no me pareca interesante, en ese momento ya empece a rellenar los inframes, con las tablas que luego las mismas van a llenarse con datos de alumnos ingresados esto se encarga desarrollo. utilice materialize porque al charlar con los lideres me dijeron que se les hace mas fcil y les quito tiempo de trabajo. \ntambin ayude a mis compaeros mostrandoles sus errores, cuando veia que se quedaban trabados me ocupaba de solucionar sus errores. \n ','2019-06-27'),(1580,85,'Charla uba','hoy no tuvimos tiempo de trabajar debido a una charla que tuvimos con unos empleados de la uba','2019-06-27'),(1581,79,'Dia con interrumpido ','Hoy tuvimos una importante interrupcin en el da, iba a dedicarme al proyecto DEA (casi seguro) y nos avisan que vamos a tener una charla sobre orientacin vocacional con psiclogos del DOE de la UBA, por lo tanto tuvimos casi todo el da ocupado con la charla. El poco tiempo que nos quedo estuvimos hablando con los profes sobre las tareas del grupo de infraestructura. Nos reasigno tareas especificas con respecto al grupo de infraestructura del la parte del proyecto de alumnos. De esa manera no hacemos trabajo doble.','2019-06-27'),(1582,44,'Tuvimos una charla con gente de la UBA','Nos estuvieron explicando como podria llegar a ser el ingreso a la uba despues de terminar el secundario y nos explicaron algunas de las carreras.','2019-06-27'),(1583,50,'Charla informativa UBA','Tuvimos una charla con dos psiclogos de la UBA sobre continuar estudiando luego de terminar el secundario, ademas de el mundo laboral.','2019-06-27'),(1584,56,'Desarrollo de pagina','-Hubo una charla de la UBA hasta el segundo recreo\n-configure los botones de los menus de la pagina\n-Entreviste a un preceptor para saber cuales divsiones hay exactamente por cada ao para posteriormente editar el contenido de cada ao en la pgina para que no aparezcan divisiones inexistentes en el listado. ','2019-06-27'),(1585,82,'orientacin vocacional  ','Hoy vinieron Lautaro y Emmauel psicologos de la UBA  a darnos un taller de orientacin vocacional, en la cual me resolvieron algunas dudas que tena y realizamos algunas actividades en grupos, luego con el poco tiempo que quedo segu con mi proyecto en el cual tengo algunos de problemas los cuales estoy resolviendo con materialize y ayude a un compaero a resolver unos problemas que tenia.  ','2019-06-27'),(1586,80,'Charla de Orientacion vocacional','El da de hoy vinieron dos psiclogos orientadores de la UBA para charlar con nosotros sobre las posibles carreras a segur luego de la secundaria, sus correspondientes salidas laborales y como lograr decidir cual carrera seguir.','2019-06-27'),(1587,48,'Orientacion vocacional','Hoy tuvimos una charla sobre de lo que ibamos a hacer al terminar el secundario y las opciones de estudio que teniamos al terminar el secundario ademas con el corto tiempo que tuvimos me puse al dia con los trabajos que debia entregar\n','2019-06-27'),(1588,58,'Nos visitaron profesores','Hoy nos visitaron profesores que venan de la UBA para hablar sobre el mundo laboral y dar ideas sobre nuestro primero trabajo o en la universidad','2019-06-27'),(1589,83,'dns( instalacion ubuntoserver)','Hoy se vio el tema del DNS:\nPorque es lo primero que se necesita para que mi compaero pueda trabajar.\nhubo un nico problema y es que la maquina es muy lenta.\n Por lo que no pude empezar a configurar. \n Pero se logro la instalacin. \n- instalacin del ubuntoserver','2019-06-28'),(1590,46,'dns( instalacion ubuntoserver)','el dia de hoy se instalo el ubuntu y a continuacin el dns en el que ayude a beln a instalar.\nel proceso de instalacin del dns se completo pero a la vez no porque falto que el equipo se reinicie, lo cual no paso porque la maquina es muy lenta.','2019-06-28'),(1591,82,'cambios ','realice algunos cambios en el formulario que el lder dijo que cambiara, para el cual utilice materialize y w3schools  y pude resolver problemas que tenia anteriormente tambin dijo que hubo cambios en le menu y tendr que cambiar el menu ','2019-06-28'),(1592,78,'Ms comentarios y diagrama de flujo (28/06/19)','Hoy me dedique a comentar el mtodo eliminarAlumno. Enrealidad no est terminada la ltima parte pero por lo menos lo que ya est escrito es necesario comentarlo. Aparte de eso me dedique a hacer un diagrama de flujo del mtodo actualizarAlumno, ya que al ser un mtodo complejo de entender se lo merece.\nAlgo que identifiqu recin y que tengo que arreglar, es que hago muy mala re utilizacin de cdigo. Copio el mismo cdigo dos veces y no hago uso de funciones. Lo que est claro es que el mtodo funciona a la perfeccin, pero para facilitar la asimilacin del cdigo, es necesario arreglar eso.\nCon el poco tiempo que me qued despus de esto, me dedique a continuar con la carpeta de campo y aadir lo que hice del mtodo actualizarAlumno y el diagrama de flujo. no es nada la verdad, pero es algo.','2019-06-28'),(1593,77,'Investigacion 1','Se comenz la investigacin del proyecto:\n  Aplicaciones para analizar como competencias ya fueron encontradas.\n  Cmo iniciar a utilizar el entorno de desarrollo (Android Studio).\n  Algunos comentarios de usuarios que criticando caractersticas que desean en distintas aplicaciones.\nCon esos datos se empieza la base de la construccin y planificacin del proyecto\n\n','2019-06-28'),(1594,51,'ayuda y seguridad','hoy, mientras veiamos el partido estuve charlando con compaeros sobre si necesitan ayuda en su sector a la hora de usar la base de datos y depaso me puse a ver sistemas de seguridad para la base de datos','2019-06-28'),(1595,53,'Proyecto','Ver varios proyectos en los cuales basarme para poder seguir con el proyecto que tengo que terminar','2019-06-28'),(1596,48,'revisando codigo','Estuve modificando los codigos del programa, jugando para ver los cambios e intentar mejorar la pagina ','2019-06-28'),(1597,74,'ciclo basico ao2 ','el da de hoy me encargue de continuar con las conexiones tuve problemas porque al parecer no me lea la pagina que haba creado perd mucho tiempo con eso y resultaba ser que era porque tenia dos carpetas una en el escritorio y otra en el pendrive y todas mis paginas creadas que estaba utilizando era del pendrive y resulta que mi pagina estaba en la carpeta del escritorio y por eso no me lo leia, una vez arreglado ese error continuo haciendo las conexiones al 2 ao del curso bsico en adelante me faltara hacer las conexiones para todos los aos y divisiones con sus respectivas especialidades esto mostrara cada alumno del colegio dependiendo lo que el usuario elija. \n','2019-06-28'),(1598,45,'codigo facilito','hoy estuve viendo vdeos en youtube en el canal de cdigo facilito sobre HTML del 1 al 5','2019-06-28'),(1599,79,'Trabajando en DEA','Hoy me dedique al DEA, tengo la intencin de hacer una investigacin y especialmente una documentacin sobre la comparacin de usar un modulo sd y un dfplayer para reproducir audio, con el fin de cerciorarme de que sea la mejor opcin, ya que vimos que el mp3 dfplayer era la mejor opcin, pero no hicimos pruebas ni investigaciones muy profundas. Hice una lista de paginas de un libro sobre arduino que tengo que leer, consulte una pagina sobre modulo sd y audio por Internet, a partir de ah encontr un programa interesante de diseo de circuitos que era algo que estaba buscando (llamado fritzing). Ademas de eso empece a leer un poco de la informacin que seleccione. Tambin le pregunte una cosa al Profesor Consorti sobre el consumo de los leds y investigue un poco sobre eso en Internet. Tambin quize empezar a trabajar en el circuito fisco del DEA con arudino pero el profesor Consorti me dijo que no se poda hasta la semana que viene por un problema que hubo con los arduino. ','2019-06-28'),(1600,64,'Problemas, Soluciones, y Transferencia de la Maquina Virtual a la Maquina Fsica.','Tambin se inform que se dividiran las tareas con los del jueves y viernes, nosotros nos encargamos de ciertos servidores y ellos de otros.\nEn el da de la fecha que hice fue instalar de vuelta el VMWare Converter y convertir la mquina virtual en un solo archivo para que sea transportado a la maquina fsica. Tuvimos unos inconveniente tras sufrir un corte de luz en el establecimiento en el que estbamos trabajando dado ese motivo se perdi parte de lo que trabajamos. Cuando la luz volvi retomamos el trabajo y pusimos a transferir la mquina virtual convertida al servidor fsico. \n','2019-07-03'),(1601,72,'Clase 21, Un problema con final feliz.','En la clase de hoy tuvimos varios cambios en el sistema del orden de las cosas que debamos hacer en la clase por lo que tuve que adaptarme y me dedique la clase a desintalar servidores, darle los toques finales al servidor para al fin migrarlo e investigar la instalacin del server Git, el cual, utilizaremos para que todo los dems equipo puedan guardar sus datos.\nAs que puedo decir que la mayor actividad fue preparar todo para que el servidor este listo.','2019-07-03'),(1602,87,'Organizacion','Hoy nos dieron los criterios para aprobar la materia as que me sent a anotar qu es lo que tenemos, qu es lo que nos falta y qu es lo que va a hacer cada uno de lo que falta dado que se van a ir dos compaeros de la seccin. Arregl la base de datos porque tiraba error y estuve juntando todas las carpetas para hacer una sola.','2019-07-03'),(1603,65,'Avanzar con las vistas','No progrese en el dia de la fecha, debido a que no me sentia bien','2019-07-03'),(1604,68,'Puesta en perspectiva de tiempo y tareas restantes, y reparacin de errores relacionados a la vista de becas','Se nos notific de los requisitos para la aprobacin de este trimestre, los que fueron anotados y comparados con las tareas ya cumplidas.\nRepar errores relacionados a la vista de Becas, como la llamada desde la pgina principal y la muestra de elementos.','2019-07-03'),(1605,52,'clase 14 de oficina de alumnos','lo que realizamos fue seguir el desarrollo de la pagina para oficina de alumnos corrigiendo errores y viendo las siguientes cosas a desarrollar ya para entregar una parte del proyecto funcional, con un cambio de rea de mi parte a diseo.','2019-07-03'),(1606,38,'Vistas Finalizadas y envio del material','Como siempre queda algo que retocar en cada vista, en el da de hoy nos seguimos encargando de editar algunas cosas o de agregar nuevo contenido a las vistas, ya sea atajos o caractersticas que las hacen mejor visualmente. Luego de eso, realizamos