en mejor las diferentes vistas despus pasamos las vistas finalizadas a html y se lo pasamos al grupo de desarrollo.','2019-07-03'),(1616,66,'Clase veintiuno','Hoy flor y yo seguimos con el mismo error que llevamos durante 2 clases pasadas, pedimos ayuda a gente con mas conocimiento en el tema aun as no se soluciono completamente.','2019-07-03'),(1617,63,'Ventigesima primer clase','El da de hoy contine trabajando con chipana; acudimos a gente con ms conocimiento para resolver el problema que tenamos sobre eliminar permisos pero apenas se pudo resolver en un 50%.','2019-07-03'),(1618,51,'cosas varias','en el dia de la fecha me puse a ayudar a mi compaero a modificar/agregar cosas en la documentacin, de paso me puse a ver cosas de seguridad para la base de datos y por ultimo estuve recordando sobre los trminos &quot;stored procedures&quot; y &quot;trigger&quot; para poder implementarlos en la base de datos','2019-07-04'),(1619,75,'Coordinacin con el equipo de diseo','En esta clase, ya habiendo terminado nuestras funciones modelos de prueba, nos pusimos a implementar nuestras funciones segn las vistas que realiz el equipo de diseo. Para ello hablamos con sus integrantes y llegamos a una decisin de mutuo acuerdo para realizar ya las vistas finales.  ','2019-07-04'),(1620,76,'Mas Mantenimiento ','Comenc ayudando al grupo de Desarrollo por la peticin que me hicieron, sobre ingresar cierta cantidad de alumnos en cada curso y divisin que se encuentra dentro de la base de datos. Por un infortunio hubo un doble apagn de luz lo cual retraso mi trabajo, pero logre terminarlo. Luego de eso investigue hasta el final de las clase las funciones Stored Procedure y Trigger de SQL para aplicarlo en un futuro a la base de datos y as facilitar su uso.','2019-07-04'),(1621,36,'arreglando el buscador y el seleccionador de cursos','todo el dia probando codigos para que funcione','2019-07-04'),(1622,44,'Probando distintos codigos para solucionar problemas','Probamos codigo para solucionar el problema del buscador y la seleccion de cursos.','2019-07-04'),(1623,55,'Complementando la documentacin y bsqueda de informacin','En el da de hoy junto a un compaero estuve complementando la Documentacin de nuestro grupo, aparte de eso busque informacin sobre los procedimientos &quot;Stored Procedure&quot; y &quot;Trigger&quot; para implementarlas en nuestra Base de Datos y logre un avance en los apuntes de mi carpeta de campo. ','2019-07-04'),(1624,53,'Terminar de mostrar el mapa ','La informacin buscada anteriormente no sirvi para mostrar el mapa pero si para adquirir algunos conocimientos, hoy solo fue buscar mas informacin y al final fue ingresar a la pagina oficial de leaflet, ingresar donde dice tutorial y se pudo mostrar ','2019-07-04'),(1625,77,'Investigacin 2','En el da de la fecha se corto la luz en dos ocasiones, perdiendo documentacin en una de ellas. Por este motivo se comienza a trabajar desde Google Drive para evitar problemas similares en el futuro. \nLogrado un avance bastante significativo en la investigacin de la competencia, al mismo tiempo se utilizaron comentarios para tomar en cuenta las preferencias de los usuarios de algunas de las funciones del proyecto. Tambin se comenz a desarrollar los puntos fuertes y falencias de cada una de estas aplicaciones de competencia/referencia.\nSe busc y encontr un par de aplicaciones para realizar el apartado de diseo y bocetos. ','2019-07-04'),(1626,74,'uniendo todo ','el dia de hoy conecte todos los aos con sus respectivas divisiones y tambin ordene todo con carpetas me va a general un monton de errores pero en casa voy a encargarme de eso. tambin hable con el lder de desarrollo y ver como podemos conectar todo, que ya tenemos una idea concisa, estamos cada vez mas cerca de terminar aunque todava nos faltan 2 vistas para hacer y mas vistas de los integrantes de mi grupo que hay que conectar, con el index inicial. a las 2:40 pm tuvimos  un inconveniente, se fue la luz borrando todo lo que avanzamos pero a pesar de eso nos pusimos las pilas y logramos avanzar bastante. tambin hable con el profesor sobre ciertos inconvenientes con mi grupo porque un integrante se quejo del mtodo que tenia y me culpaba de sus actitudes o cosas que no poda realizar pero por suerte ya se arreglo todo y pasamos del tema.\ntambin ayude a mis integrantes, dando consejos, brindando informacin y ayudando.\n ','2019-07-04'),(1627,42,'Finalizacion de vistas ','Trabaje en la terminacion de las vistas de sanciones y la de boletines, a su vez mire unos tutoriales para poder recordar algunas lineas de codigo las cuales se me complicaban','2019-07-04'),(1628,83,'connfiguracion del dns','primero hoy se empezo con la configuracion del dns pero mientras se estaba haciendo nos pedia tener ya instalado en ubunto el bin9 por lo que se iba hacer eso pero luego  se corto la luz dos veces por lo que se opto hacer lo siguiente y fue que lo uniramos con el webmin  de esta manera seria mucho mas facil pero estando cerca de tarminar  nos dio error por lo que me canse !!! y bueno al final busque y me di cuenta de que se puede arreglar asi que e eso estoy asi todo lo que haga con el dns lo podre hacer desde la wedmin y sera mucho mas facil instalar el bin9\n','2019-07-04'),(1629,82,'supuesta finalizacion del proyecto ','Llegue y el lder dijo que lo que hice esta bien pero que tenia que cambiar el men, lo cual me llevo mucho tiempo porque surgieron muchos problemas en el camino tambin tuvimos una charla con el profesor para ver el progreso del grupo en el cual nos dijo que agregramos unas cosas y modificramos otras, y tambin recibimos ayuda del grupo de desarrollo, luego de la charla pude solucionar los problemas y otros problemas con ayuda del compaero (by facundo). Y el lder me dijo que voy a comenzar con otro proyecto.','2019-07-04'),(1630,85,'Prueba fisica de kit arduino','una vez recibido un diagrama hecho por alvaro me concentre en generar un cdigo de prueba para utilizar en un kit arduino que el mismo trajo, tambin lo ayude con la conexiones del mismo y una vez conectado hicimos pruebas de los leds y del parlante, pudimos hacer sonar el parlante sin ningun modulo de control de audio y esto nos abre a consideracion el hecho de no utilizar ninguno en el proyecto final, sin contar un potenciometro','2019-07-04'),(1631,50,'Unificacion','Se empez a trabajar en conjunto con los dems departamentos para la finalizacion del primer prototipo de la aplicacin, haciendo las conexiones entre las vistas de la interfaz con la base de datos.','2019-07-04'),(1632,78,'Combinando vistas con controlador (04/07/19)','Primero que nada complete la carpeta de campo con lo que me faltaba, esto era fotos del cdigo y explicacin del CRUD de alumnos. Tambin termine al 100% el mtodo eliminar con la funcionalidad de que vuelva al inicio. Adems arregle el tema de la reutilizacin de cdigo en el actualizar, pero hubo un problema y es que nos cortaron la luz dos veces y perd eso que hice. No lo volv a hacer porque el profe llam a todo el grupo de desarrollo para hablar la situacin actual, como vamos con el proyecto y tal.\nPor ltimo hablamos con el equipo de diseo para que nos pasen sus vistas con el fin de poder volcar lo que hicimos el equipo de desarrollo con lo de ellos y lo mismo hicimos con el equipo de base de datos para que nos pasen la bd con datos de alumnos falsos.\nEmpec a trabajar con las vistas y tuve problemas con la disposicin de los archivos ya que, los estilos y el JS lo tengo que tener en una carpeta dentro de la carpeta \'styles\' (carpeta que est fuera de \'applications\'). Tambin tengo una tarea tediosa y es cambiar la extensin de los archivos, ya que me lo dieron en .html los tengo que cambiar a .php, porque en la mayora de las vistas uso php para ciertas cosas, como por ejemplo la funcin base_url() para las direcciones de los archivos.\nYa teniendo todo arreglado me ocupo de mi tarea asignada la cuales agregar botones que llamen a los mtodos del CRUD.','2019-07-04'),(1633,48,'Modificacion total del proyecto','Hoy realice los debidos cambios que tenia que hacer para mi vista de la pagina, tuvimos una charla grupal con el profesor para ver el progreso del grupo, y continue con mi trabajo, luego el lider del grupo me dijo que debia hacer otro cambio, asi que borre todo y maana seguire con los cambios ','2019-07-04'),(1634,58,'Modificacion del proyecto','Hoy el lider del grupo hizo que modifiquemos el proyecto y lo pasemos a materialize para facilitar el trabajo a los demas y el profesor nos llamo para saber que habiamos hecho con el grupo de diseo y nos dijo que ibamos bien .','2019-07-04'),(1635,79,'Mucho trabajo productivo en DEA','Hoy empece trabajando en los diagramas del DEA, primero hice algunos diagramas para guiarme en cuanto al armado del prototipo en protoboard. Despus de hacerlos se los presente al profesor Consorti para que verifique que no haya ningn error. No encontr nada que genere corto pero vio que serie preferible utilizar otro sistema de encendido, ya que el actual podra general un problema con el modulo tp4056 o con el arduino, hay que agregarle un transistor conectado al tp4056. Ademas de esa observacin haba que cambiar el posicionamiento de un capacitor que estaba conectado al parlante. Al terminar los diagramas empece a construir el prototipo de protoboard pero tuve un problema, me faltaron traer algunos materiales, pero principalmente cables para hacer las conexiones. Ademas tuve que ir a soldar unas fichas a unos cables de par trenzado que no servan para conectar los parlantes ya que con los cables del colegio no poda hacerlo porque eran del colegio. Despus de eso probamos el circuito con Nacho y no funciono. Entonces el profesor Consorti lo reviso y dijo que los pines que estaba usando (A0, A1, A2, A3) solo eran de input, no de output, por lo tanto los leds jamas se encenderan. Despus de corregir eso vimos que segua sin funcionar, revisamos con el profesor Consorti todo el circuito. Pasamos a revisar los leds para ver si estaban rotos o quemados. Fui a buscar un multimetro y el profe reviso el arduino (que efectivamente mandaba 5v) y despus alimento directamente a los leds. Al hacer eso el profesor pens que la protoboard esta defectuosa o algo as, pero rpidamente se percato de que la protoboard que era de aproximadamente 400 pins estaba dividida a la mitad (las hileras de positivos y negativos) algo insulsa. Despus de eso hicimos otra vez el circuito y vimos que el cdigo todo funcionaba bien. En medio de todo esta proceso revisamos el cdigo tambin. Despus de eso fumos probamos los parlantes y funcionaron bien, pero bajos, profe dijo que podramos subir el volumen o, brindando energa estrena del arduino (ya que el arduino no brindaba suficiente) ya sea con una pila o baterias por medio de un transistor y en caso de querer cambiar el volumen tambin un potenciometro. Pero tambin dijo que podemos usar un amplificador, pequeo y que incluso venga con un potenciometro, pero ademas nos sugiri que podramos usar el que tiene unos parlantes, por lo que buscamos unos parlantes viejos, los desarmamos y los revisamos para utilizar su amplificador, falta desoldarlo y adaptarlo al circuito. ','2019-07-04'),(1636,46,'connfiguracion del dns','el dia de hoy configuramos el dns pero se nos corto la luz 3 veces, se reinicio nuestra maquina y otras cosas que no quiero mencionar.\nmaana continuaremos con la configuracion porque hoy apenas pudimos instalar el webmin en el dns ','2019-07-04'),(1637,75,'Coordinacin con el equipo de diseo II','En esta clase, seguimos trabajando con el equipo de diseo para ya compactar nuestros trabajos. Han habido dificultades pero an seguimos trabajando en ello para dar un resultado para ambas partes.   ','2019-07-05'),(1638,78,'Un problema grande','Hoy cambi el ruteo de las vistas ya que me dieron una carpeta con la nueva organizacin de los archivos, me explicaron como funcionan los iframse. Esto es un iframe que contiene las divisiones y otro general que es el curso. Hice mucho uso del base_url() para los nuevos ruteos. Tambin tuve un problema con el uso de jquery, ya que me tira un error de que no conoce una funcin del jquery en el segundo iframe (el de las divisiones). Anda perfecto el index con el primer iframe (curso), pero el de divisiones no. Tengo que trabajar en casa eso.','2019-07-05'),(1639,51,'seguridad','hoy me puse a investigar posibles metodos de seguridad para la base de datos y me adentre acerca de los procedimientos &quot;stard prodecudures&quot; y &quot;triggers&quot;','2019-07-05'),(1640,83,'instalacion del bind9','hoy hubo bastantes problemas con el webmin, no podia instalar la librerias que me faltaban.\n por lo que decedi  instalar el bind9 y luego de eso empece a configurarlo ','2019-07-05'),(1641,50,'Unificacion - Routing','Durante el proceso de unificacin se inicio la labor de reorganizar las rutas de los archivos para su correcto funcionamiento. ','2019-07-05'),(1642,56,'Diseo de pestaa de usuario para preceptores','-diseo en html del perfil del usuario para preceptor y uso de materialize para el estilo','2019-07-05'),(1643,45,'materialize','hay que pasar nuestras paginas webs a materialize as que esta clase vi instructivos de como hacerlo aparte hay que hacer otra pagina web con el listado de cada alumno con las notas en sus respectivas materias.','2019-07-05'),(1644,36,'solucionando errores que faltan','error de buscador y seleccionador de curso','2019-07-05'),(1645,80,'Diseo de pestaa de usuario','hoy nos dedicamos al diseo de la visa del usuario , utilizando materialize para organizar la infromacion personal del preceptor.','2019-07-05'),(1646,55,'Charla ','Me puse a ayudar a una compaera de otro sector con respecto a la base de datos y a complementar mi carpeta de campo. ','2019-07-05'),(1647,74,'problemas uniendo back-end y front-end ','En esta clase use muy poco la computadora porque tenia otros que avanzar para que yo pueda seguir con lo mio sin embargo me puse a disear como estara conectado el back-end y el front-end en una hoja para luego tomar ese diseo y a la vez debatiendo sobre con el lder de desarrollo sobre como tienen que quedar, para luego confirmarme si esta bien como lo tenemos planeado, di nuevas tareas como: perfil del preceptor, perfil del alumno, y todas las notas de las materias, algo que es distinto al boletn,  ayude con los enlaces que estn teniendo el otro sector con las vistas. ','2019-07-05'),(1648,44,'buscando solucion del buscador y porque no anda el code','no funciona correctamente el codigo del buscador y estamos buscando como solucionarlo','2019-07-05'),(1649,58,'materialize','Hoy continue con la pagina web en materialize y pude terminarlo tuve que ver unos videos instructivos de como hacerlo y por otra parte el lider del grupo me dio otro trabajo que hacer otra pagina web con el listado de cada alumno con las notas en sus respectivas pmaterias\n\n\n','2019-07-05'),(1650,53,'Realizar mejoras para el mapa ','colocar punto en el mapa, ventana emergente, al dar click en el mapa mostrar latitud y longitud ','2019-07-05'),(1651,82,'comienzo de un nuevo trabajo','hoy comenc con el nuevo proyecto para el cual investigue y pregunte en preceptoria, pude averiguar que informacin contena la ficha de alumnos  con ayuda de Miguel (jefe de preceptores). Realice un prototipo en papel el cual el lder me pidi que realizara, con ayuda del prototipo comenc a pasarlo a html utilizando materialize. \n','2019-07-05'),(1652,85,'Prueba de potenciometro y modulo de tarjeta microsd con arduino','probamos y logramos hacer funcionar un potenciometro, para poder aumentar el volumen del sonido que sale por los parlantes, de forma exitosa a lo hora de hacer funcionar el modulo sd pudimos hacerlo funcionar pero se escuchaba con una mala calidad de sonido y muy bajo y no pudimos solucionarlo al final ','2019-07-05'),(1653,79,'Trabajando en DEA, integracion del amplificador provisional ','Hoy empezamos a trabajar en la integracin de la plaqueta amplificadora provisional que sacamos de un parlante. Empece a armando otra vez el circuito en protoboard, y mi compaero se ocupo del codigo. Ademas de eso le di una netbook que venia con slot para sd y un adaptador de sd a micro sd para que formatear la tarjeta y el le pase un archivo .wav. Mientras armaba el circuito que estaba compuesto por los leds, el modulo de tarjeta micro sd, el amplificador y el arduino vino el profesor Puma y me pidi que vayamos ayudar a nuestros compaeros de mecnica con un tema de las almohadillas del DEA (buscar unas almohadillas). Fui y hable con los chicos y le dije que en vez de buscar una (que me dijeron que eran muy caras) podamos hacerlas y me dijeron que vaya a hablar eso con el profesor Puma que les pareci bien la idea (cosa que no pude hacer). Despus volv  con a trabajar con el circuito. Primero probamos los leds y el amplificador, cosa que no funcionaron, por un problema de conexin que haba, nada grave. Despus vimos que algunos leds funcionaban pero uno no y el parlante tampoco. Revisamos el cdigo y el circuito y encontramos el problema y funciono el parlante y el led que faltaba pero un de los leds encenda poco porque el amplificador lo conectamos al arduino ya que no tenamos un cable usb extra para conectar a una computadora. Entonces buscamos un usb en la aula de sistemas de control pero no encontramos ninguno. Despus de que el profesor Olaso volviera, de casualidad tenia un usb que no le servia, entonces pedimos un alicate y probamos con ese usb. Cuestin que el parlante funciono y con un volumen alto (algo bueno). Despus de eso decidimos en vez de probar tons, probar con un archivo .wav desde el modulo micro sd, pero no funcionaba. Estuvimos revisando el circuito y no encontramos problema. Mi compaero reviso su cdigo y busco en unas paginas y vio que para reproducir audio el parlante tenia que estar conectado al pin 9 (cosa que de casualidad estaba) y el modulo tenia que estar conectado en otros pines determinados. Hice esos cambios en el circuito y funciono, lo nico malo es que el volumen y la calidad del audio eran malas. Hablamos de eso con los profes y vimos que era por temas de conversin de archivos y la calidad de conversin (que en teora tenemos que limitar porque sino el arduino no lo puede reproducir) tenamos estos problemas, igual tenemos que probar con otro archivo y con otra calidad de conversin, a ver si por alguna razn funciona. ','2019-07-05'),(1654,39,'Charla con galicia','En el dia de la fecha se realizo una charla sobre las distintas ramas de nuestra especialidad (tecnico computacion).','2019-07-10'),(1655,52,'Charla con galicia,  reunion','El dia de la fecha si hizo sobre el galicia para una ayuda de trabajo o una idea de q clase de cosa queremos realizar mas adelante y organizacion de equipo de desarrollo con los del otro curso','2019-07-10'),(1656,47,'Charla y reunin','Algunos empleados del banco Galicia vinieron a darnos una charla para ayudarnos a elegir lo que queremos hacer en el futuro. Luego como estaban los compaeros del otro turno pusimos en comn nuestros progresos en la aplicacin.','2019-07-10'),(1657,66,'Clase veintids ','Hoy hubo una charla del banco Galicia, en la que nos orientaron sobre las posibilidades que tenemos para estudiar, fue bastante til, note que debo aprender muchas cosas ms, demasiadas, luego hubo una charla con el grupo de desarrollo de los jueves y viernes hablamos sobre ms cosas que hizo cada grupo y las complicaciones que tenemos.','2019-07-10'),(1658,70,'Charla, organizacin.','Tenemos una charla proveida por Galicia sobre las distintos caminos que podemos seguir, teniendo en base los distintos sectores que tenemos en PP, sumando unos ms (Seguridad, comunicacin, infraestructura, desarrollo, base de datos, diseo) y despus nos juntamos con los chicos de los Jueves y los Viernes y nos organizamos con los distintos avances y cosas hechas y por hacer de cada grupo.','2019-07-10'),(1659,49,'charla','En el dia de hoy tuvimos una charla con empleados del banco galicia y nos reunimos a hablar en grupo para ver como veniamos con el tema de las vistas.\n','2019-07-10'),(1660,87,'Charla del Galicia','En el da de hoy vino un hombre que trabaja en el rea de seguridad Galicia para darnos una charla sobre las salidas laborales que tiene una profesin de informtica y lo importante que es tener un ttulo universitario. Luego de esto, nos juntamos con el grupo de desarrollo de jueves y viernes que estuvo presente en la charla para discutir qu cosas tenemos hechas de cdigo y las cosas que faltan. Tambin estuvimos charlando sobre las tecnologas y cmo fuimos programando el programa.','2019-07-10'),(1661,51,'Charla','En el da de la fecha vine para escuchar una charla orientadora de un representante del banco Galicia, pasado eso me puse a charlar ciertos puntos con los chicos del sector de Base de Datos de los dias Martes y Miercoles ','2019-07-10'),(1662,43,'Hablar del futuro y con otro grupo','Hoy vino gente del Banco Galicia, para hablarnos de las grandes cosas que podramos hacer en el futuro. Pero que primero debamos de seguir la universidad, para tener un camino ms amplio, y tambin aprender otros idiomas. No slo eso, nos juntamos con nuestra misma rea, pero de otro da, en este caso, los de Martes/Mircoles, con los de Jueves/Viernes. Estuvimos charlando de cmo iban ambas partes, qu tan adelantado iba uno y cuntas mejoras podan hacer.','2019-07-10'),(1663,40,'Charla y reunin por areas','En el da de hoy tuvimos una charla con los empleados del banco Galicia sobre la orientacin vocacional, nos explicaron de que trata cada cosa sobre lo que podramos estudiar o trabajar y las salidas laborales que hay. Al terminar la charla nos juntamos por reas con el otro turno para compartir los puntos en comn y ayudarnos con algunas dudas sobre el diseo o exportacin de las vistas.','2019-07-10'),(1664,67,'Charla de Orientacin Escolar','El da de hoy nos dieron una charla sobre orientacin vocacional dndonos ideas de los futuras salidas laborales que tenemos gracias a cursar en un colegio tcnico como es la gloriosa 32. Despus un par de horas de charla aprovechamos que estbamos los distintos turnos de practicas y nos juntamos a hablar sobre el rea de Base de Datos.','2019-07-10'),(1665,71,'Charla, organizacin.','Tuvimos una charla proveida por Galicia sobre las distintos caminos que podemos seguir terminando el secundario, teniendo en base los distintos sectores que tenemos en PP, y despus nos juntamos con los chicos de los Jueves y los Viernes y nos organizamos  a hablar sobre los distintos avances y cosas hechas y por hacer de cada grupo, teniendo en cuenta que el proyecto es similar al de nosotros','2019-07-10'),(1666,73,'Charla de Orientacin Escolar','El da de hoy nos dieron una charla sobre orientacin vocacional dndonos ideas de los futuras salidas laborales que tenemos gracias a cursar en un colegio tcnico como es la gloriosa 32. Despus un par de horas de charla aprovechamos que estbamos los distintos turnos de practicas y nos juntamos a hablar sobre el rea de Diseo.','2019-07-10'),(1667,54,'Orientacin vocacional','En el da de hoy tuvimos una reunin en la que nos dieron una charla empleados del Banco Galicia. Esta consisti en una orientacin vocacional  obviamente en el entorno de la especialidad en la que nos explicaron como seguir a futuro, nos dieron recomendaciones, despejaron dudas entre otras cosas. Posteriormente nos juntamos con el mismo rea  (en mi caso base de datos) de los chicos que concurren los jueves y viernes para establecer puntos en comn de la materia.','2019-07-10'),(1668,45,'charla vocacional','hoy tuvimos una charla orientadora sobre diferentes vocaciones  sobre el rubro informtico y sus fines como por ejemplo comunicaciones infraestructura etc...','2019-07-10'),(1669,41,'Charla sobre orientacin vocacional y salida laboral ','En el da de hoy tuvimos una charla con empleados del banco Galicia que nos hablaron sobre orientacin vocacional y las diferentes salidas laborales, tambin nos explicaron sobre los diferentes trabajos con sus caractersticas despus aprovechamos que estbamos con los otros compaeros de los jueves y viernes y nos juntamos lo de las mismas reas de diseo para hablar y ayudarnos sobre las vistas.','2019-07-10'),(1670,68,'Exposicin de parte de un representante del Banco Galicia','En el da de la fecha las actividades habituales fueron reemplazadas por una exposicin, en conjunto con el grupo con horario jueves y viernes, que fue dada por un representante del Banco Galicia. La charla se bas en las diversas subdivisiones de la carrera, y se habl de los distintos programas y elementos utilizados en cada una de las secciones. Luego de la charla tuvimos un espacio para hablar sobre los proyectos con los integrantes de la misma rea del horario contrario.','2019-07-10'),(1671,78,'Charla y reunin','Hoy nos dieron una charla los del banco galicia sobre las reas que hay en la informtica. Explicaron que se trabaja en cada una y dems cosas. Nombraron las reas de desarrollo (programacin, paradigmas de lenguajes), seguridad, anlisis de datos, bases de datos y hardware.\nTambin nos reunimos con el equipo de desarrollo para ver como bamos. El equipo de la otra comisin dijeron que tienen login con tema de sesiones y privilegios. Tambin contaron que se estn ocupando de las becas.','2019-07-10'),(1672,38,'Charla con trabajador del banco Galicia y charla grupal sobre la materia','En el da de hoy tuvimos una charla dirigida por un trabajador del Banco Galicia donde nos contaba sobre sus estudios, que habia estudiado en una secundaria industrial mas que nada mostrndonos diferentes cosas acerca de la computacion y sus sectores para orientarnos el dia que nosotros decidamos trabajar en alguno de los roles que se mencionaron, como por ejemplo en seguridad, en desarrollo, testing, etc. Al finalizar la charla nos juntamos en grupo con compaeros de diferente turno, que claramente cursamos la misma materia y pusimos puntos en comun acerca de los trabajos que estamos realizando.','2019-07-10'),(1673,57,'Charla para futuro','En el da de la fecha un empleado del banco Galicia especializado en el rea seguridad nos vino a dar una charla sobre qu especialidades tenemos la posibilidad de elegir para futuro y nos fue dando detalle de cada una ','2019-07-10'),(1674,64,'Charla y Reunin','En el da de la fecha nos vinieron a dar una charla del Banco Galicia sobre la Informtica y como debemos capacitarnos si queremos ser alguien en un futuro, si queremos trabajar de lo que estudiamos y otros temas interesante que profundizo con profesionalidad, ademas nos brindo un servicio de catering que inclua jugos y alfajores.','2019-07-10'),(1675,82,'charla ','el da de hoy tuvimos una charla de orientacin vocacional sobre que carreras podemos estudiar la cual me ayudo un poco. luego de la charla me reun con  diseo de los das martes y jueves, platicamos sobre lo realizado hasta el momento y las dificultades que tuvimos ','2019-07-10'),(1676,46,'reunin de secciones y otros','el da de hoy nos pidieron venir(sin avisar con anticipacin)  para un charla con Galicia, en la cual nos hablaron de los distintos tipos de trabajos que  podramos tener en el futuro cuando nos graduemos que fue muy interesante. Al venir un da mircoles de nos informo que el da viernes no tenemos clases este viernes, aprovechando que tenemos tiempo el profe nos dijo  que nos dividiramos en grupos para tener una reunin de secciones con los  del turno martes/mircoles y hablar sobre algunas dudas que tengamos.  ','2019-07-10'),(1677,65,'Charla y reunion','Tuvimos una charla constructiva sobre nuestro futuro en el empleo y charlamos con nuestros iguales en areas del otro turno para ayudarnos mutuamente.','2019-07-10'),(1678,74,'Charla y reunion','hoy nos comunicaron que una persona nos iba a dar un charla sobre diversas ramas de computacin seguridad, infraestructura,  base de datos, etc. \nfue una charla de una hora y media aproximadamente. Luego me puse en una mesa hablando con los integrantes de diseo de martes y mircoles hablamos sobre los problemas que tenan con bootstrap studio, dicen que todo lo que hacan los borraba as que les recomend bootstrap que es solo copiar y pegar el link y el contenido que vas a utilizar, a pesar de que fue corto el tiempo fue una clase interesante ya que es la primera vez que vengo a clase un mircoles y poder interactuar con los chicos de diseo.\n ','2019-07-10'),(1679,53,'Probando mas funciones de leaflet ','Se realizaron varias funciones, como por ejemplo que sea toda la pantalla completa el mapa, que te ubique matemticamente si lo permits, despus otra funcin se pudo realizar pero era necesario tener varios divs para que funcione con su totalidad y los divs no se pudo terminar. ','2019-07-11'),(1680,45,'pestaa de notas','hoy empece con el diseo de la pagina de notas de preceptores tambin tuve problemas con la carpeta de campo la cual esta archivada mal y esta incompleta despus de las vacaciones terminare el diseo y corregir la carpeta de campo.','2019-07-11'),(1681,83,'dhcp','hoy continuamos con la configuracin del dns pero en el transcurso del procedimiento tuvimos problemas con la ip por lo que se hablo al profesor y nos dijo que lo dejemos y que continuramos con el dhcp por lo que haba que instalar y configurar. Eso tuvo sus complicaciones porque la maquina nos falla un poco pero se hizo hasta que la parte de iniciarlo o detenerlo como que nos dijo un error, lo cual tratare de ver porque puede ser que hallamos hecho algo mal, asi que eso se vera. ','2019-07-11'),(1682,36,'haciendo javascript ','boton de submit con javascript para mandar todo el formulario de una y poner la fecha una vez nomas.','2019-07-11'),(1683,46,'configuracin de dhcp','el dia de hoy el profe nos dijo que dejramos de lado la configuracin de dns por un problema de la ip, as que empezamos  con el dhcp\ndel cual nos fue muy bien?  hasta que empezamos a &quot;usarlo&quot; ','2019-07-11'),(1684,50,'Unificacion - Estructura de tablas de datos','Se inicio