se de datos','2019-07-12'),(1697,83,'terminado','estaba viendo el pequeo problema que teniamos  en la anterior clases y al final si funciono. me llevo mi tiempo. pero lo logre, asi que ahora tengo el dhcp terminado.\npor ultimo decidi en ver mi carpeta de campo con el tiempo restante\n','2019-07-12'),(1698,76,'Fin de los Procedures','Se termino de crear los procedures y se espera una devolucin de parte del equipo de desarrollo para ver que es posible cambiar y mejorar en estos, en caso de haber mejoras y seguir con el mantenimiento y backup de los datos al igual que la documentacin.','2019-07-12'),(1699,36,'haciendo que funcione dropdown de curso','use javascript tmb y nose puede. pregunto a olaso y tampoco asi que nose.','2019-07-12'),(1700,55,'Complemento','En el da de la fecha complemente mi carpeta de campo y busque en que puedo complementar la documentacin.','2019-07-12'),(1701,78,'Nada','Hoy no hice casi nada. Llegue un poco tarde por una reunin que tuve en una empresa. Cuando entro me pongo a ver lo que tengo que trabajar para combinar las vistas con las funcionalidades. Hable con el jefe de diseo y me facilit nuevas vistas con la extensin php. Lo nico que tengo que trabajar son el tema de las URL. Las direcciones de los archivos estn medio mal y hay que adaptar la carpeta raz con el base_url.','2019-07-12'),(1702,53,'Informacion nueva y objetivo logrado ','Mediante buscar en google leaflet se encontro en github archivos subidos sobre leaflet, sirvieron por que estaban bien explicados y lo el objetivo que se logro fue poder poner una opcin para mostrar y ocultar el la ubicacin que aparece en el mapa.','2019-07-12'),(1703,77,'Diseo de interfaces','Se tuvieron en cuenta las investigaciones previas para empezar a disear las interfaces principales de la aplicacin. Tambin se consideran los mtodos principales que se utilizarn y que diferenciara al proyecto a las dems aplicaciones investigadas. Como por Ej las funciones de &quot;tiempo libre&quot; o &quot;descansos 