ta de previas y la de materias por carrera, terminando con el dropdown menu para seleccionar la materia previa que le corresponde a cada alumno. Luego, la lder me pidi simplificar todas mis tareas realizadas al principio de este trimestre.','2019-08-07'),(1752,39,'Las vistas','En la clase de hoy tuvimos una charla con los compaeros de diseo sobre las tareas que realizara cada uno.  Tuve unos problemas con el programa Bootstrap y lo volvi a instalar.','2019-08-07'),(1753,86,'GIT','El objetivo de hoy era crear un servidor con Git y configurarlo. Pero debido a la falta de informacin, tuve varios problemas por los cuales se me dificulto la realizacin de dicha tarea. ','2019-08-07'),(1754,71,'8/7','Terminamos los campos para las tablas faltantes para la base de datos, quedo pendiente relacionarlas y ponerle el store procedure en la snuevas tablas. Por falta de internet no pudimos averiguar bien lo de los backup y otras cosas que nos faltaban','2019-08-07'),(1755,65,'Charla de grupo','El dia de la fecha tuvimos una charla en la seccion de diseo, y estuve trabajando en el diagrama de gantt y en el manual de usuario','2019-08-07'),(1756,54,'Creacin de nuevas tablas ','Hoy creamos nuevas 5 tablas nuevas e hicimos algunos insert de las mismas','2019-08-07'),(1757,52,'clase 1 en diseo','nos reunimos con todo el grupo de diseo para saber que tipo de proyecto va a realizar cada uno y despus nos pusimos a ver todas las vistas pero nos apareca un error el la aplicacin y luego no tuvimos Internet ha si que tuvimos que trabajar con otro compaero','2019-08-07'),(1758,73,'diseo de la pagina para buscar alumnos en previas','trabajamos con la pagina de previas para poder buscar alumnos que estn en previas','2019-08-07'),(1759,67,'Tablas y Store Procedures','El da de hoy con el grupo de base de datos terminamos de finalizar las nuevas tablas y las agregamos a la base de datos que estaba haciendo Gian con los stores procedures.','2019-08-07'),(1760,63,'Vigsima quinta clase','El da de hoy 