rama de gantt y para eso me ayud en las bitcoras de un compaero junto a las mas. Aunque no pude terminarlo por varios inconvenientes que tuve con la configuracin de los das laborables.','2019-08-14'),(1784,70,'Encriptacin, login, problema solucionado.','El problema anteriormente mencionado fue solucionado. En el da de la fecha seguimos con encriptacin e hice unos login que desafortunadamente no funcionaron, seguir con estos la proxima clase si se requiere, de lo contrario terminare los stored que faltan y poco ms.','2019-08-14'),(1785,40,'Github','En el da de la fecha buscamos como crear y subir archivos a github, creamos una cuenta de github para probar creando un repositorio y subir un archivo, y estuvimos buscando informacin y probando sobre como trabajar con github.','2019-08-14'),(1786,69,'Backup Automtico','el dia de hoy estuvimos investigando sobre el backup automatico para la base de datos.','2019-08-14'),(1787,38,'Continuacion manual de usuario y video instructivo.','En el da de hoy continu con el manual de usuario explicando algunas funciones como ejemplo controller, construct, idex, etc. Ademas de eso, vi un vdeo con mis compaeros sobre validacin de usuarios.','2019-08-14'),(1788,71,'investigacion','Continuamos investigando en este caso sobre el verificador de datos en varias fuentes para evitar duplicar datos, buscamos en cdigo php y consulta sql, probamos con ambos en nuestra base  de datos para practicar pero por ahora no tenemos nada terminado con el verificador ','2019-08-14'),(1789,68,'Unin de versiones del proyecto','Para solucionar un error de una funcin, un en una nueva versin del proyecto las funciones que escribieron unos compaeros en controller.php y modelo.php con las que yo haba escrito para la vista de Becas en esos mismos archivos.','2019-08-14'),(1790,54,'Divisin e investigacin ','Hoy dividimos las tareas para optimizar el tiempo. Junto a una compaera nos encargamso de investigar como evitar duplicar los registros en la base de datos mediante una consulta sql','2019-08-14'),(1791,57,'No hubo avances','No pudimos implementar los archivos en las vistas que nos pas el sector de diseo, todava estamos en proceso de investigacin para averiguar cmo combinar las vistas con nuestro cdigo para hacerlo funcional.','2019-08-14'),(1792,47,'Intentando e investigando','Continu intentando como implementar los estilos que nos pas el sector de diseo la clase pasada. Continuo investigando.','2019-08-14'),(1793,66,'Clase Veintisiete','Hoy flor y yo solucionamos el problema de borrar personas registradas y ademas se charlo sobre el tema de que el admin valide a los usuarios que se registren. Mi pendrive se murio :c','2019-08-14'),(1794,86,'Fin del GIT','Finalmente instale e hize funcionar correctamente el git y subir archivos desde la concola.','2019-08-14'),(1795,73,'Ultimas modificaciones ','Ultimas modificaciones de la pagina de busqueda de alumnos que tengan previas','2019-08-14'),(1796,63,'Vigsima sptima clase ','Hoy, con Chipana, logramos solucionar el problema de borrar usuarios mediante un modal y posteriormente nos informamos sobre el tema siguiente: validacin de usuarios. ','2019-08-14'),(1797,65,'Vista menu gral. y aprovacion de usuario','termine con la vista menu gral. y empec con la vista aprovacion de usuario.','2019-08-14'),(1798,72,'Clase 27, Dia de problemas con soluciones difciles.','La clase de hoy tuve diversos problema que me dificultaron el servidor y todo su mantenimiento por lo que no pude hacer mucho.\n\nPor otro lado tuve que un inconveniente con los servidores al compartirlos atravez des servidor por lo que me impidi mostrar la pagina principal. Por estas razones tuve que instalar de nuevo ciertos servidores, lo cual era una de las soluciones que tenia planteado y al final del da de hoy termine comprendiendo que el problema estaba en un cotafuego de la configuracin del myql.','2019-08-14'),(1799,75,'Reportes con PHP','En esta clase investigue sobre los reportes manejados por php. El objetivo es crean un entorno visual para que muestre al usuario una especie de libretas de notas del alumno. ','2019-08-15'),(1800,83,'noticia ','hoy me puse a completar la carpeta de campo, que me faltaba aun terminar,luego de eso lo envi.\nnos informaron que nuestro profesor sufri un accidente y que estara ausente dejando a cargo al otro profesor. Por lo que nos sorprendi un poco y es que todo lo que se tenia hecho lo tenia el guardado para mas seguridad, lo que uno no imagino es que le pasara tal accidente as que si bien se haba terminado de hacer lo que se tenia que hacer en  su momento ... ahora no se poda avanzar  porque no poseamos  los trabajos trabajados por eso tratamos de comunicarnos con el profesor para que nos envi el trabajo/trabajos por email, pero no a podido respondernos por el momento, y es que nos han informado hoy que nuestro lder que estaba faltando, lo siguiera haciendo por lo que el trabajo que el tenia nos tocara resolver pero para eso se necesita los anteriores trabajos.\nOtra cosa que paso es que al final me confirmaron que asistira a practicas externas en unas dos semanas o en tres ... eso se discute.   ','2019-08-15'),(1801,53,'Organizar','Solo organizar archivos y codigos que estaban desparramados ','2019-08-15'),(1802,58,'El dia de hoy termine la pagina','hoy termine el diseo y estilo de la pagina web que tenia que realizar, tuve algunos problemas pero los pude solucionar se los ensee al lider y le gusto la pagina, se lo pase al pendrive y lo guardo. Tambien nos enseo a como crear un archico php y abrirlo con el xampp ','2019-08-15'),(1803,36,'termine el post con array','agregue algo que fataba y ya funciona ','2019-08-15'),(1804,82,'final y comienzo ','El da de hoy entre en trabajo de la ficha, como ya termine los trabajos que me tocaba el lder dijo que ayude a un compaero a terminar su trabajo para lo que se utiliz javaScritp para ayudar un compaero, tuvimos problemas pero pudimos resolverlo, terminamos con el trabajo y se lo entregamos al lder y dijo que estaba bien despus el lder explico cmo abrir el index en PHP y aparentemente kevin perdi mi trabajo del formulario de alumno. El index parece que est en finalizacin. ','2019-08-15'),(1805,42,'Optimizacion de vistas','Se mejoraron los aspectos visuales y se implemento el uso de responsive para la adaptacion de la pantalla','2019-08-15'),(1806,44,'acabamos para agregar las asistencias','ya funciona el post con array','2019-08-15'),(1807,45,'tablas en materialize','hoy desarrolle unas tablas de alumno en materialize aprovechando que el lder del sector nos dio una orientacin pequea de materialize','2019-08-15'),(1808,51,'mantenimiento','hoy estuve viendo si la base de datos necesitaba algo y me puse a placticar acerca de posibles cosas que se le puede agregar a la base de datos','2019-08-15'),(1809,74,'limpieza','este da despus de hace mucho tiempo pude avanzar, ayudar y solucionar el problema que tengo con los enlaces aun as estuve haciendo las vistas que tienen pequeas cosas pero que aun as son importantes para el desarrollo del proyecto, tambin estuve guiando a los integrantes y dando consejos y hice una pequea clase para que ya aprendan a abrir archivos .php y con el CDN dar estilos con materialize, en un futuro voy a aprender  a abrir los archivos de los integrantes de desarrollo para unir todo. \nya para el final hice una limpieza al ver que tenia los mismo archivos pero des actualizados  y desordenados.\na partir del da de hoy todos los integrantes de diseo tienen el archivo donde se va a poner todo solo si esta 100% bien analizando cada linea de cdigo de esta manera las vistas de ahora y las de un futuro pueden estar conectadas, aun nos faltan mas vistas pero por suerte no son tan complicadas como las que hicimos anteriormente, solo nos llevara tiempo pero no seria algo complicado de desarrollar por lo que pienso. \n','2019-08-15'),(1810,85,'Otra fase de pruebas para modulo dfplayer','empezamos el dia hablando con mi comaero sobre que modulos de carga de baterias de litio y cuantos  utilizar para el proyecto, una vez obtuvimos el equipo para trabajar probamos un modulo dfplayer con archivos mp3 para poder ingresar cualquier tipo de audio. hubieron algunos problemas como por ejemplo conectamos a 5v de energia y el modulo funciona solamente con 3.3 pero una vez hecha la fase de pruebas pudimos utilizar el modulo correctamente con una buena aclidad de audio y con un buen volumen','2019-08-15'),(1811,78,'Corrigiendo errores','Hoy revise lo que tena hecho y me puse a corregir unos errores con los iframes. El problema era que no cargaba un iframe dentro de otro. Es decir, una pagina que sea de 1 de ciclo bsico que tenga un iframe donde muestre la divisin seleccionada. Eso ya se arreglo, lo que falta es mostrar en un iframe del index cuando se seleccione un curso de ciclo bsico, la lista de divisones del curso, es decir, desde un iframe del index llamar al iframe de la pgina con las divisiones.','2019-08-15'),(1812,46,'','el dia de hoy actualice ,i carpeta de campo y tambin empezamos a organizarnos(con belen) para los siguientes trabajos que tenemos q comenzar a hacer','2019-08-15'),(1813,79,'DEA, preguntas y pruebas con el dfplayer','El da hoy empece consultando al profe sobre conversares dc dc, mdulos protectores/cargadores de bateras de litio (especificamente sobre modulos de dos celdas), amplificadores. El profe me recomend que para lo que lo bamos a usar consigamos los integrados que no son variables que son baratos y chicos, que son adecuados a pesar del ruido. Despus empezamos  a trabajar en la conexin del dfplayer, tuvimos varios problemas. Para empezar me olvide el conector usb que utilizamos para alimentar el amplificador, as que tuvimos que conseguir otro. Despus empece a armar el circuito del dfplayer. Tuvimos varios problemas de cablerio para empezar (confucion de cables, problemas con los puertos de la computadora, malas guas de como usar el dfplayer). Despus tuvimos problemas para que encienda el dfplayer (se me paso el gnd). Despus tuvimos problemas con el amplificador (otro problema de cablerio, estaba al revs la alimentacin). Despus, cuando encendi, tuvimos problemas de audio. Esto fue a causa de que en realidad, la alimentacin del arduino no era suficiente, cosa que luego solucionamos, pero resulta despus que seguamos teniendo problemas. El dfplayer funciona aprox a 3.3v, cosa que las guas no especificaban. Pudimos darnos cuenta gracias a la ayuda del profe y despus lo confirmamos con el datasheet. Probamos con otros parlantes tambien. ','2019-08-15'),(1814,64,'Git, y otras cosas Vol.2','En el da de la fecha al principio ayude a mi compaero a instalar y/o actualizar el vSphere para que pueda manipular la mquina virtual que tenemos alojada en el servidor que contamos en el aula donde estamos, as l se encarga en instalar el git en el servidor. Tambin  investigue como crear un usuario de git, y estuve buscando en internet como llegar a realizar esta tarea, hasta que llegue a unos videos de YouTube que pude llegar a funcionar y me estuve orientando de cmo hacerlo. Cabe destacar que haya encontrado la manera de hacerlo posible, ya que se nos pas algo que podra ser la clave de todos nuestros tropiezos. ','2019-08-21'),(1815,41,'Vista de inscripciones','En el da de hoy estuve terminando la vista de inscripciones que mi compaero Aymard no lo pudo terminar agregndole ms campos de informacin y algunos colores ','2019-08-21'),(1816,57,'En investigacin','Seguimos investigando como cargar los archivos CSS en las vistas usando CodeIgniter. No hubo solucin a este problema por ardua que fue la bsqueda de variados videos y explicaciones en foros.\n\n','2019-08-21'),(1817,87,'Ultimos detalles de Gantt','Hoy termin el diagrama de Gantt, agregu tareas, pude arreglar los errores y cosas que no me salan de la clase pasada. Tambin estuve viendo como van los dems del grupo y fui a hablar con el lder de diseo sobre algunas cosas que tiene que cambiar porque no estamos pudiendo agregar las vistas al proyecto.','2019-08-21'),(1818,70,'Verificacin de datos, monitor roto.','Hoy trabajamos con verificacin de datos, tratando de aprender y aplicar las mismas, un ejemplo de esto sera que cuando un usuario quiera registrarse y quiera tener como username un nombre ya existente, este recibira un mensaje para que lo cambie, ademas, el monitor de mi maquina usual est roto, por lo que tuve que compartir PC con un compaero.','2019-08-21'),(1819,52,'diseo','hoy estuve editando las vistas y cambiando los estilos de las mismas tambin acoplando las vistas','2019-08-21'),(1820,67,'Relaciones de tablas y Backup','Hoy estuvimos trabajando con las relaciones entre tablas de la base de datos y aparte investigue un poco mas sobre el backup ademas de esto tuve que compartir pc con un compaero y el investigo un poco sobre el verificador de datos.','2019-08-21'),(1821,69,'relaciones ','El da de hoy relacionamos todas las tablas de la base de datos, las tablas que ya estaban y las tablas que fuimos agregando despus. ','2019-08-21'),(1822,66,'Clase veintisiete','Hoy continuamos con el tema de la autorizacion de usuarios, y aun me queda hacer el tema de los permisos. Y bueno ya quedan solo 6 clases\ny aun debemos terminar todas las funcionalidades.','2019-08-21'),(1823,47,'Continuo intentando agregar los estilos','Segu investigando como cargar los archivos CSS en las vistas usando CodeIgniter. Vi muchos tutoriales, o gente dejando sus cdigos, pero ninguno me funciona, ni siquiera me carga un simple archivo CSS.','2019-08-21'),(1824,65,'Re modele y rehce ','Estuve re modelando vistas de compaeros para que estn iguales y rehce la vista de Aprovacion de usuario ya que precisaba algunos cambios.','2019-08-21'),(1825,73,'modificacion de vistas','en el dia de hoy modiciamos las vistas para poder juntar todas las vistas de los demas compaeros','2019-08-21'),(1826,63,'Vigesima octava clase','Hoy estuvimos viendo sobre la autorizacin de usuarios, hicimos diferentes planteos y ya para