datos, me puse a buscar posibles mtodos para tener la base de datos mas segura, correg la documentacin de la base de datos y me puse a completar la carpeta de campo','2019-08-22'),(1835,46,'voip','el da de hoy descargamos nuevamente ubuntu para empezar con la descarga de voip y su configuracin, para eso vimos unos videos de como configurarlo','2019-08-22'),(1836,78,'nuevos archivos','El jefe de diseo me paso una nueva carpeta con cosas nuevas. Tengo que trabajar otra vez las conexiones de los iframes porque vuelvo a tener los mismos problemas que tuve anteriormente con los iframes viejos.','2019-08-22'),(1837,58,'Termine la planilla de notas ','Hoy termine la planilla de notas que me haba asignado el jefe se sector adems de algunas modificaciones que me hizo hacer a lo largo del trabajo pero logre terminarlo y le gusto como quedo el diseo ','2019-08-22'),(1838,75,'Modificaciones BD y boletn','En esta clase modifique la tabla &quot;notas&quot;. Es decir en vez de cargar 3 registros para cargar una nota de diferente trimestre; lo minimice en un registro agregando 2 campos ms. Esto fue para pasarle una cantidad mnima de parmetros al momento de realizar el pdf del boletn. \nAl cambiar la tabla tuve que cambiar las funciones para que se adapten al nuevo cambio. ','2019-08-22'),(1839,55,'Al dia','Al tener que faltar en algunas clases por temas de salud, en el da de hoy tuve que ponerme al da tanto con mi carpeta de campo como con la base de datos, a la cual le estuve buscando errores para poder corregirlos.','2019-08-22'),(1840,42,'Conexion de vistas con el area de desarrollo','Colabore con mis compaeros de el sector de desarrollo, para hacer la conexion de las vistas. Para luego que el grupo de desarrollo vaya teniendo interaccion con ellas. ','2019-08-22'),(1841,48,'Hoy estuve ayudando a un compaero','Como sigo sin un proyecto a realizar estuve ayudando a terminar la vista de uno de mis compaeros, pudimos terminarlo y al jefe le convencio el trabajo asi que ya lo finalizamos ','2019-08-22'),(1842,50,'Vistas de usuario','Creamos dos vistas adicionales, dedicadas a la creacin e ingreso de usuarios de la aplicacin. ','2019-08-22'),(1843,80,'22-08','En la clase de hoy realice un formulario que solicita el e-mail y la contrasea del usuario, utilizando materialize y con un poco de ayuda de w3school.','2019-08-22'),(1844,60,'Servidor de E-mail','En el dia de la fecha se continuo con la construccion de un servidor de email, se instalo el Vshare Helpe, pero por problemas no se pudo lograr terminar.','2019-08-22'),(1845,56,'Actualizacion de vistas','actualice el diseo del index pincipal y corregi errores','2019-08-22'),(1846,85,'Estuve escribiendo codigo??','basicamente estuve escribiendo y entendiendo de manera correctael codigo utilizado para hacer las pruebas del la clase pasada, ademas de hacer algunos testeos extra sobre elfuncionamiento del modulo dfplayer\n','2019-08-22'),(1847,79,'DEA, mdulos de carga, mdulos de balanceo, proteccin y sobrecarga, posible solucin con el tp4056, etc. ','Hoy empece el da investigando mdulos de carga ya que los mdulos que yo pens que eran de carga, proteccin y balanceo (de dos celdas) no lo eran en realidad de carga. La solucin es integrar las dos placas (una con carga y la otra con proteccin, balanceo, etc.). Estuve buscando mdulos de carga de bateras de litio y no encontr ninguno para dos celdas. Investigue otras soluciones, conectarlos sin placa, etc. Pero esas opciones eran peligrosas segn el profesor. Le consulte al profe sino podramos hacer nuestra propia placa pero segn el profe seria laborioso de disear, complicado de armar (ya que seria difcil no conseguir los componentes necesarios que no sean de montaje superficial) y si lo hacemos mal seria peligrosos tambin y es algo complicado de testear. Por lo tanto esta opcin quedo descartada. \nDespus de investigar y pensar pase a hacerle otras preguntas al profe, especficamente que deberamos usar para cambiar el flujo de alimentacin del circuito, si relees o transistores. El profe me dijo que use transistores y que sean mosfets.\nDespus de eso prosegu en buscar una solucin para el problema de las bateras de litio. Se me ocurri usar dos mdulos tp4056 y puentearlos de manera tal que este en serie para cuando el DEA no se este cargando y cuando se este cargando estn cada una siendo cargadas por su respectivo modulo y el resto del circuito este alimentado por la corriente que viene del jack. ','2019-08-22'),(1848,74,'desarrollo y diseo','este dia fue corto por el acto pero estuve movindome para ver los trabajamos de mis integrantes, y ya esta pasada la primera vista que tiene relacin con desarrollo solo nos falta pulir las vistas ya para que el usuario lo vea.\n','2019-08-22'),(1849,79,'DEA, charla con el grupo de mecnica, almohadillas para el DEA, puertas logicas, transistores pnp npn, cambiar flujo de alimentacion','Hoy empece el da charlando con los chicos del grupo de mecnica sobre el espacio que ocuparan los componentes, su enganche en la carcasa que estn desarrollando, los fichas que vamos a utilizar y su disposicin (de alimentacin y el potenciometro), los agujeros para estos. Despus de eso me dedique a trabajar un poco en mis croquis y de ah pasa a hablar con el profe sobre lo que hable con los chicos de mecnica y le explique sobre una idea que tenia con las almohadillas. De ah trabaje un poco mas en mis croquis y despus de dirig en busca del profesor Mestrovich para hacerle una preguntas sobre electrnica, cosa que no puede hacer ya que no estaba en el colegio. Intente un rato mas solucionar mis dudas en los bosquejos que hacia y despus me fui a la biblioteca a investigar sobre &quot;uso del interruptor del jack para conmutar de batera a cargador &quot; (algo que el profe Mestrovich dijo que buscara), cosa que no me sirvi de mucho ya que no me apareci lo que se supona que tenia que aparecerme. Entonces busque como desviar energa con transistores (tema del que tenia dudas), cosa de ayudarme con el cambio de alimentacin que tengo que hacer con las bateras. Lo que encontr de eso me sirvi as que pase a probar lo que aprend en el emulador &quot;circuits&quot; de autodesk','2019-08-23'),(1850,41,'Cambio de diseo','En el da de hoy el profesor nos reuni para ver como venamos con las vistas hasta ahora, tambin nos coment sobre las faltas que tenamos, y nos explico algunas cosas sobre el bootstrap. \nDespus le cambiamos un poco el diseo de las vistas para que queden parecidas.','2019-08-27'),(1851,54,'Stored procedure','Hoy empezamos a volver a hacer los stored procedure porque debido a un problema con el pendrive los perdimos','2019-08-27'),(1852,47,'Diagnostico e investigacin','El profesor llam a cada seccin para ver cmo iba cada una, nos falta que sea funcional la parte de permiso de usuarios y tambin falta enlazar lo de sector de diseo con lo nuestro. Segu investigando e intentando ver como hacerlo visitando distintos pginas y foros.','2019-08-27'),(1853,49,'vitas ','En el dia de hoy seguimos terminando las vistas que nos quedan por hacer y le seguimos dando los ultimos retoques.','2019-08-27'),(1854,63,'Vigsima novena clase ','Hoy tuvimos una charla con el profesor acerca de como iba el grupo, tambin estuvimos modificando la base de datos para usar solo una tabla en vez de dos (en la parte de usuarios). Pero ahora hay un problema con el cifrado md5 de las contraseas, de todas formas, se pudo poner la parte del estado.','2019-08-27'),(1855,69,'Stored procedure','El da de hoy vimos tutoriales de stored procedure de nuevo para agregar a las demas tablas nuevas.','2019-08-27'),(1856,66,'clase veintinueve','Hoy se hablo sobre las fechas de entrega y todo eso. Tambin trabajamos con las bases de datos y algunas vistas con el fin de optimizar el manejo de tablas ya que se decidi trabajar con una sola para la parte de registro y login.','2019-08-27'),(1857,64,'Registro de reas en la Plataforma GitHub','En el da de la fecha seguimos revisando el Git y tambin empezamos a registrar en la plataforma de GitHub a todas las reas involucradas en este proyecto, Base de Datos, Diseo y Desarrollo, as se les facilita subir sus archivos a un lugar seguro y confiable. Le pedimos a cada lder de rea que nos pase su email para poder registrarlos, en la siguiente clase se terminara de registrar a las reas faltantes. ','2019-08-27'),(1858,72,'Clase 29, Dia de organizacin.','En esta clase me encargue de hacer un paneo general de las actividades de mi seccin, ademas, comenc a definir el comienzo de nuevos proyecto de la seccin. Gran mayora de los proyecto, tareas, y actividades estn terminadas.\n\nPero esto no es el final, que la mantencin de los servidores y la charla de como utilizarlos, por lo que el trabajo no acabo y las prximas clases voy a estar dando los toques finales al servidor migrado.','2019-08-27'),(1859,71,'27/08','El dia de hoy llamaron a toda el rea para comentar que tan adelantados estbamos desde la ultima clase. Nos dedicamos hoy investigar el stored procedure para las tablas nuevas que agregamos anteriormente','2019-08-27'),(1860,38,'Informacion de material y reunion de grupos','En el da de hoy me encargu de pedirle distintos tipos de material a mis compaeros de grupo como por ejemplo screenshots de partes de cdigos para poder visualizarlos y de paso brindar informacin al manual de usuario. Ademas, el profesor llam a todos los sectores para poder charlar acerca de como llevamos el proyecto. ','2019-08-27'),(1861,73,'Exportacion de vistas','En el dia exportamos las vistas para poder juntarlas','2019-08-27'),(1862,68,'Finalizacin de la vista becas; Reunin con el jefe de proyecto.','La vista becas fue finalizada, con la correccin de las funciones de buscar y eliminar becas.\nSe llev a cabo una reunin con el jefe de proyecto, con el objetivo de estar al tanto de la fecha de entrega y los requerimientos, informacin emitida por su parte, y los avances en el proyecto y elementos faltantes, emitida por nuestra parte.','2019-08-27'),(1863,86,'Organizacion y charla.','Hoy no habia practica que se pudiera hacer asi que nos enfocamos con el Gantt con Leandro y una charla para organizarnos sobre los multi-usuarios del GIT','2019-08-27'),(1864,65,'Unificacion de las vistas.','Hoy segu trabajando en la unificacin de las vistas en un solo proyecto, llegue a meter algunas vistas y ver cmo iban quedando. Y tuvimos una charla con el jefe de proyecto sobre el tiempo que nos queda para el final del trimestre','2019-08-27'),(1865,40,'Usuarios en github ','En el dia de hoy continuamos investigando github y comenzamos con la creacin de los usuarios por cada rea ademas nos estuvimos organizando para terminar con lo que falta en cuanto a manual de usuario.','2019-08-27'),(1866,67,'Store Procedure','El dia de hoy comenzamos con los stores procedures de las tablas que nos faltaban.','2019-08-27'),(1867,87,'Reunion ','En el da de hoy estuvimos hablando con el profesor sobre como vamos en nuestra rea, y sobre las clases que nos quedan. Luego estuve juntando los archivos de mis compaeros para drselo a quien se est encargando del manual de usuario y tambin para yo poder ir agregando las vistas.','2019-08-27'),(1868,70,'Verificacion de datos','Hoy seguimos con la verificacin de datos, insert y stored procedures terminados con todas las tablas.','2019-08-27'),(1869,70,'Verificacin con notepad, phpmyadmin, ejemplos','En el da de hoy estuve haciendo y probando distintos ejemplos de verificacion de datos, en notepad como los login y despues, a pedido del jefe de proyecto, en phpmyadmin mismo. Al parecer ninguno de esos funciona, ya sea porque la maquina/server est malfuncionando (ya hemos tenido problemas confirmados por el jefe de proyecto) o por mis propios errores, sea cual sea la razn, espero poder terminar con esto la proxima semana, antes de que llegue la fecha final (una o dos semanas)','2019-08-28'),(1870,66,'Clase treinta','Hoy resolvimos toda la parte del login y registro y nos hablaron de que el equipo de diseo unira las vistas con codeigniter para facilitar luego el agregado de las funciones. Ahora solo me queda por hacer la parte de poder darles permisos a los usuarios.','2019-08-28'),(1871,41,'Exportacin de vistas actualizadas a html','En el da de hoy el profesor nos reuni para explicarnos sobre las cosas que deberamos de tener ya terminadas para pasrselo a la otra rea que es desarrollo para que sigan trabajando, despus estuve ordenando todas las vistas y cambindolas ya que haba varias de distintos colores y tipografas y volvindolas a exportar a html, y faltara juntar las vistas todas en una.','2019-08-28'),(1872,47,'Finalmente encontr la solucin','Finalmente con la ayuda de un compaero encontramos la forma para enlazar los estilos con las funcionalidades hechas en nuestro sector. Por lo tanto solo tengo que esperar a que el sector de diseo una todas las carpetas en una.','2019-08-28'),(1873,38,'28/08/19','Hoy con mis compaeros terminamos todo lo que vendria a ser el login, despues nos reunimos con el profesor y un integrante de diseo para explicarnos que van a unir las vistas con codeigniter para despues facilitar las vistas con las funciones. Ademas de eso sigo agregando cosas al manual de usuario para luego brindarlo.','2019-08-28'),(1874,69,'stored procedure','el da de hoy agregamos el stored procedure a casi todas las tablas de la base de datos, nos falto agregarlo en la tabla &quot;pases/equivalencias&quot; por un error que no se pudo solucionar todava. ','2019-08-28'),(1875,52,'diseo','hoy estuve acomodando las vistas y mandndolas todas a una carpeta para poder abrirlas sin muchas extensiones hasta que se me ocurrio de mandarlas al codeigniter para que sea mas fcil abrirlas y editarlas en cdigo para el rea de desarrollo aunque tuve unos problemas con las extensiones de bootstrap para visualizarlo ','2019-08-28'),(1876,57,'Encontramos el error','Encontramos el error que tanto nos impeda avanzar, un compaero nos ayud con esto, por lo que pudimos enlazar los estilos con las funcionalidades hechas por nuestro sector. ','2019-08-28'),(1877,64,'Dia agitado, php, auditoria, charla, etc','En el da de la fecha seguimos cargando los usuarios correspondientes a GitHub, ya que ayer habamos empezado este trabajo y no podemos llegar a terminarlo por falta de tiempo, luego con mi compaero se nos asign buscar como instalar el phpmyadmin ya que hubo que instalar la mayora de servidores de vuelta en el servidor madre que tenemos fsico en el aula donde realizamos nuestras tareas, por eso se nos dijo que busquemos una manera sencilla y que probemos que funcione ya que si no llegar a pasar eso, se tendra que instalar todo de vuelta. Y nadie quiere eso. Tambin se habl de cmo sera la charla que la vamos a dar a las dems reas acerca de cmo subir archivos a la plataforma web de GitHub y sus respectivas normas de convivencia dentro del mismo, ya s que no se renombren carpetas o que se metan a carpetas ajenas de grupos que no les pertenece.\nPor suerte unos de mi compaeros encontr la solucin al problema y se pudo solucionar la problemtica que tuvimos por do clases, ahora solo hay que instalar el Git y hacer el usuario madre para as poder invitar a las dems reas a participar/acceder al repositorio que hicimos para ellos, para que suban cada uno una parte del proyecto y que este concentrado en un mismo lugar.\nPara la prxima clase seguramente estaremos terminando nuestra etapa de instalacin, configuracin, para empezar con la etapa de mantenimiento de todo lo que logramos hacer.  \nCabe destacar que en el dia de la fecha hubo una auditoria de parte de una de mis compaeras, tendra que haber sido un secreto pero la que lo haca era Micaela Mascialino.\n','2019-08-28'),(1878,67,'Stores Procedures y un poco de todo.','El da de hoy con el grupo de base de datos avanzamos un poco ms con el tema de los store procedures que nos faltaban y aparte averiguamos sobre el tema del verificador de datos y un poco sobre el backup.\n\n\n','2019-08-28'),(1879,54,'Revisin ','En el da de la fecha me encargu de revisar que cosas nos faltan,completar, corrigiendo e investigando cosas que nos faltan','2019-08-28'),(1880,71,'stored procedure','Hoy, agregamos el stored procedure a las tablas nuevas que agregamos con basandonos con otra base de datos que teniamos ya hecha','2019-08-28'),(1881,40,'Usuarios terminados, investiagacion y pruebas','En el da de hoy finalizamos los usuarios de github para las distintas reas, nos otorgaron la tarea de investigar sobre como instalar phpmyadmin en ubuntu y realizar pruebas en la maquina virtual ya que en se encontraban problemas en el servidor central, un compaero lo pudo resolver e hicimos la prueba de acceder desde otra pc solo que falto modificar los privilegios para todos.','2019-08-28'),(1882,73,'Exportacin de vistas finales ','En el da de hoy estuvimos exportando las vistas para poder juntarlas en una misma carpeta para que quede todo en un mismo proyecto as se lo podemos mandar al rea de desarrollo, y ellos trabajen con las vistas.','2019-08-28'),(1883,63,'Treintava clase','Hoy arreglamos los problemas que tenamos con el md5, tambin hicimos el cdigo necesario para que cambie el estado del usuario al ser aceptado y que este salga de la vista de usuarios por aceptar.','2019-08-28'),(1884,72,'Clase 30, Arreglos','La clase de hoy me la pase haciendo distintos arreglar para que el server este terminado de una vez por todas.Puesto que el servidor migrado tuvo problemas, intale los programa de la mejor manera para que todo este en perfectas condiciones.','2019-08-28'),(1885,86,'Creacion del Manual de Usuario de GitHub','Cre un manual de usuario con imgenes, explicaciones y pasos para la creacin, configuracin de un repositorio. La creacin, configuracin y subida de archivo.','2019-08-28'),(1886,68,'Auditora','Durante esta clase, me encargu de auditar la clase y formular un informe sobre el trabajo de cada alumno.\nLa auditora se dividi en dos etapas; una sin conocimiento de los participantes, y otra con el mismo, para comparar las actitudes.','2019-08-28'),(1887,44,'Terminamos el agregar alumnos.','pudimos solucionar algunos inconvenientes que surgieron en el desarrollo de agregar alumnos.Ya que no cargaba el foreing key porque mandaba un solo id','2019-08-29'),(1888,36,'solucionamos el problema en el insert del formulario con array ','no podia cargar el foreign key porque me mandaba un solo id pero solucionado. Me ayudo el gran profe olaso mis respetos hacia el.','2019-08-29'),(1889,74,'terminando mas vistas, problema complicad0','este dia se estuvo terminando vistas frinde ayuda, hice que mis integrantes tengan tareas para hacer, estuve buscando informacion de como arreglar un problema que nos deja muy trabados al ser una vista muy importante pero no obtuve resultados sin embargo ya vamos haciendo muchas cosas, somo muchos y ya no hay tantas vistas nuevas para hacer asi que como lider simplemente mande a que hagan la carpeta de campo. ','2019-08-29'),(1890,74,'terminando mas vistas, problema complicad0','este dia se estuvo terminando vistas frinde ayuda, hice que mis integrantes tengan tareas para hacer, estuve buscando informacion de como arreglar un problema que nos deja muy trabados al ser una vista muy importante pero no obtuve resultados sin embargo ya vamos haciendo muchas cosas, somo muchos y ya no hay tantas vistas nuevas para hacer asi que como lider simplemente mande a que hagan la carpeta de campo. ','2019-08-29'),(1891,53,'Plugins ','Buscar cdigo para colocar algunos plugins que ayudan a que sea mas rpido a la colocacin de algunas opciones que proporciona la pagina, se encontraron mtodos pero de la muchas paginas que se buscaron todas daban error ','2019-08-29'),(1892,80,'Login','En la clase del da de hoy termine de configurar el cdigo para la pagina de inicio donde el usuario ingresara su email y contrasea. Tambin avance en el desarrollo de mi carpeta de campo.','2019-08-29'),(1893,51,'cosas varias','En el da de la fecha lo que hice fue ver la base de datos ya que la modificaron, agregu un poco de informacin a la documentacin e implemente cosas en mi carpeta de campo','2019-08-29'),(1894,45,'carpeta de campo','hoy complete carpeta de campo de las clases anteriores debido a que se perdi','2019-08-29'),(1895,82,'modificaciones del proyecto','El da de hoy  pregunte al lder que hacer ya que termine el trabajo que me tocaba dijo que hiciera mi carpeta porque ya terminamos casi todo el proyecto tambin que por el momento ayude a los de ms , si no terminaron pero ya todos haban terminado sus trabajos aparentemente , por lo cual agregue y cambia cosas de mi carpeta de campo hasta que el lder llego tarde y dijo que el grupo de desarrollo tuvo problemas con las vistas, algunas haba que rehacer.me dijo que mi vista no funcionaba del todo y que hiciera algunos cambios, despus vino el lder de desarrollo, pregunto a cada integrante que estaba haciendo.','2019-08-29'),(1896,48,'Hoy nos dieron nuevos trabajos','Hoy estuve completando mi carpeta de campo, tambien respondiendo un par de preguntas que me realizaron de como iba el trabajo luego de eso fui a preguntar que habia para hacer ya que no tenia ningun trabajo para completar asi que el lider me dio un nuevo trabajo en el cual debia arreglar una vista para dejarlo mas comodo para trabajar a los demas entonces fui a hablar con uno de los integrantes del otro grupo para ver que debia arreglar, pero revisando la vista y hablando con el lider concordamos en que la vista estaba muy completa ya y bien echa entonces ahora debo trabajar en arreglar la vista con mi compaera ','2019-08-29'),(1897,58,'Modificando mi trabajo','Hoy organice la carpeta de campo, vino el lder de desarrollo para ver que estbamos haciendo y ver si estamos terminado el trabajo de cada uno, despus llego el lder y me me dijo que la vista que haba echo lo tenia que modificar y arreglar luego tuve que rehacer la pagina y hice un botn con pop up vinculando con el trabajo de mi compaero y me falta crear otro botn con el trabajo de otro compaero ya que todo mi trabajo se une con ambos trabajos.','2019-08-29'),(1898,50,'Replanteamiento de interfaz y carpeta de campo','Debido a numerosas problemticas con respecto al routing de los iframes, se evalu la posibilidad de cambiar el sistema de despliegue de informacin de las vistas. Paralelamente se desarroll la parte correspondiente al segundo trimestre de la carpeta de campo','2019-08-29'),(1899,75,'Boletn y conexiones ','En esta clase termine de hacer el PDF para el boletn. Ademas, estamos haciendo las conexiones con las diferentes paginas que nos paso el rea de diseo. ','2019-08-29'),(1900,76,'Mantenimiento y Cambios','Se sigui con el mantenimiento de la base de datos y se eliminaron dos campos de una tabla y por consiguiente se agregaron tres, para corregir los pequeos inconvenientes que esto generaba a los chicos dedesarrollo.','2019-08-29'),(1901,85,'Depuracion de codigo ','estuve optimizando el codigo del dfplayer y experimentando con el codigo orientandome mas en el producto final, no se pudieron hacer pruebas ya que hoy no se pudo disponer del hardware','2019-08-29'),(1902,76,'Sostenimiento y Actualizacion','Se sigui con el mantenimiento de la base de datos y se dio una mano a los chico de diseo con algunas tablas de la base de datos que no entendan. Se hizo tambin una actualizacin de  la Documentalista del rea para que sea mas ordenada, entendible y completa para el lector.','2019-08-30'),(1903,51,'minimos cambios ','me informaron que ayer le hicieron una modificacin a la base de datos para que a futuro sea mas fcil su uso as que lo que hice hoy fue ver esa modificacin y escribir acerca de eso en la documentacin y a mi carpeta de campo','2019-08-30'),(1904,80,'30-08','En la clase de hoy me dedique a completar la carpeta de campo, pidiendo imgenes y buceando informacin en la web. Con el fin de poder llegar a terminar la documentacin general del rea de diseo.','2019-08-30'),(1905,55,'Buscando informacin ','En el da de hoy tuve que volver a buscar informacin sobre  &quot;Stored Procedure&quot; y &quot;Trigger&quot; ya que mis compaeros se encontraban ocupados. No logre hacer un gran avance en mi carpeta de campo mas aya de unas capturas de pantalla. ','2019-08-30'),(1906,36,'mejorando dropdown curso','pensando como hacerlo','2019-08-30'),(1907,53,'Tutorial','Estuve leyendo sobre una explicacin de para realizar el proyecto, obviamente es para agregar un plugin pero tambin tiene otras opciones ver si las puedo implementar.','2019-08-30'),(1908,44,'Arreglando y completando la carpeta de campo y manual de usuario.','Dedique esta clase a mejorar la carpeta de campo y el completa el manual de usuario.','2019-08-30'),(1909,48,'Hoy investigamos que agregarle a la vista','Hoy debido a un cambio inesperado de aula no pudimos avanzar mucho en el trabajo de la vista xq las computadoras que posiamos eran lentas y no tenian las herramientas de trabajo que utilizabamos normalmente entonces,solo pudimos investigar y preguntar a los otros sectores que era lo que debia tener nuestra vista. una vez que teniamos los datos que debia tener nuestra vista comenzamos a realizar un boceto con mi compaera ','2019-08-30'),(1910,85,'Estuvimos poniendonos al dia con el profesor puma sobre el proyecto','hablamos con puma y olaso sobre caracteristicas y componentes del proyecto ademas de definir cual es es el siguiente paso a dar para seguir trabajando','2019-08-30'),(1911,58,'Terminando la pagina de inicio','Hoy segu con la modificacin del trabajo de la pagina de inicio que me quedaba pendiente de ayer, termine los botones que me me faltaron agregar pero sigo sin terminarlo porque estoy esperando a mi compaera que termine su trabajo ya que tengo que juntar lo con el mio ','2019-08-30'),(1912,50,'Desarrollo de documentacin','Se recopilaron los avances del equipo de desarrollo para la manufactura de la documentacin de la divisin','2019-08-30'),(1913,75,'Finalizacin del boletin','En esta clase ya se pudo finalizar esta funcin. Se listan los