on belen terminar con lo ultimo que nos queda que es voip (el lder del grupo es el encargado de hacer el correo)\npero tuvimos un problema al ingresar, fue que la maquina virtual no abra   ','2019-08-30'),(1920,69,'stored procedure','terminamos de hacer el stored procedure en todas las tablas de la base de datos.','2019-09-03'),(1921,54,'Finalizacin de Stored procedures','En el dia de hoy finalizamos con los stored procedures (select,update,delete,edit) de todas las tablas de la base de datos','2019-09-03'),(1922,49,'vistas','En el dia de hoy terminamos con todas las vistas \n','2019-09-03'),(1923,67,'Stores Procedures terminados','El da de hoy terminamos con los stores procedures de todas las tablas y despus el profe nos llamo para preguntarnos que otra rea preferamos ya que en el 3rd trimestre no iba a estar mas el rea de base de datos.','2019-09-03'),(1924,41,'diseo de vistas','En el da de hoy estuve retocando algunos diseos de mis vistas  ','2019-09-03'),(1925,71,'stored procedure','en el dia de hoy nos encargamos de terminar de hacer el stored procedure a una sola tabla que nos quedaba pendiente en nuestra base de datos, nos sigue quedando pendiente el backup y el verificador','2019-09-03'),(1926,47,'Esperando al sector de diseo','Aunque ya se cmo implementar los estilos, todava sigo esperando a que el sector de diseo una todos sus archivos en una carpeta para que as lo podamos implementar ms fcilmente a lo hecho por nuestro sector.','2019-09-03'),(1927,64,'Usuario Madre..git','En el da de la fecha uno de los integrantes de mi grupo intento instalar Git en el servidor final, pero tuvimos un inconveniente que nos llev a decidir que este proceso se realice maana 03-09-2019. Por mi parte cree el usuario madre donde voy a invitar a las otras reas para que se unan al repositorio, las reas son las de Base de Datos, Diseo y Desarrollo.','2019-09-03'),(1928,65,'Unificar las vistas','Hoy segui con la unificacion de las vistas, pero me cambiaron las indicaciones y empece de nuevo con las nuevas ordenes.','2019-09-03'),(1929,38,'03/09/2019','En el dia de hoy finalic con la carpeta de campo. Me encargu de completar cosas que faltaban como por ejemplo algunas explicaciones o fotos detalladas de los cdigos. Maana realizaremos entrega de parte del material asi que hoy nos enfocamos grupalmente de completar lo que faltaba.','2019-09-03'),(1930,43,'Mejorando vistas','Hoy estuve mejorando un poco las vistas y viendo como quedaron las del da que yo falt por cuestiones personales. Por lo que vi, cambiaron varias cosas.\n','2019-09-03'),(1931,70,'Stored procedures con todas las tablas (insert incluido). Areas del 3er trimestre.','Las SP de todas las tablas (nuevas agregadas, insert incluido) estn terminados. En el 3er trimestre, cuando base de datos termine con sus tareas, los individuos se cambiaran de lugar, seremos esparcidos y ayudaremos con las tareas restantes en otras areas.','2019-09-03'),(1932,86,'Problemas con el servidor.','Hubo una nueva particion del disco del servidor por lo cual no pudimos ingresar. Esto no me permitio hacer la instalacion del git. Esperemos que para maana ya est disponible','2019-09-03'),(1933,63,'Trigsima primer clase','Hoy arreglamos una falla de seguridad que permita al usuario ingresar sin haber sido habilitado','2019-09-03'),(1934,57,'Esperando','Estamos esperando a que el sector de diseo termine con las vistas para poder seguir con nuestro trabajo.','2019-09-03'),(1935,73,'Exportacion de vistas','hoy estuvimos exportando las vistas para poder juntar las paginas y as tener todo en una misma carpeta','2019-09-03'),(1936,72,'Clase 31, Particiones.','La clase de hoy la seccin de infraestructura se atraso en la entrega de las  correctas condiciones del servidor. De esta forma la entrega del servidor queda implicada a la clase de maana. la cual resulta ser la ultima para la instalacin de los servidores.','2019-09-03'),(1937,52,'diseo','estuve arreglando las vistas en codeigniter con bootstrap  y porfin se muestran  pero si saco algo de codigo se rompe','2019-09-03'),(1938,66,'clase treinta y uno','Hoy solucione un error de seguridad, se charlo sobre los futuros cambios del equipo de desarrollo.','2019-09-03'),(1939,41,'Reunin sobre las vistas y charla sobre prcticas externas','En el da de hoy nos reunimos lo de nuestra rea de diseo y empezamos a ver qu vistas son las que faltan tambin los profesores nos comunicaron sobre las prcticas externas dndonos los horarios y explicndonos que tambin tenemos que seguir con la bitcora y la carpeta de campo.','2019-09-04'),(1940,43,'Ver ms vistas','Hoy estuve viendo y arreglando con mis compaeros acerca de la vistas que nos faltaban. En realidad, nos quedan muy pocas, por no decir que solamente es una sola que es parecida a otra pero de manera diferente.','2019-09-04'),(1941,64,'Privilegios phpmyadmin, agaragar reas, buscar informacin.','En el da de la fecha se me asigno buscar en internet como adminstrelems privilegios a phpmyadmin. Agregue  a las otras reas a el repositorio madre, as tiene un lugar para agregar todos los avances que vayan haciendo mientras vaya pasando las clases. Como hacer accesos directos de carpetas en Ubuntu, y estuve mejorando y agregando cosas a la carpeta de campo para que este ms correcta y ordenada. \nhttp://mysql.conclase.net/curso/?cap=013 \nConsulte en esta pgina como dar privilegios\n','2019-09-04'),(1942,38,'04/09/19','Hoy finalic con el manual de usuario, realizaremos entrega de parte del material as que hoy nos enfocamos grupalmente de completar lo que faltaba, como por ejemplo, detalles minimos como alguna modificacion de codigo y carpetas de campo incompletas.','2019-09-04'),(1943,54,'Finalizar tareas','En el da de la fecha estuvimos estancados con el verificador de datos, se lo comunicamos al profesor y el nos gui para poder investigar mejor. Logramos encontrar informacin que nos dio una base para poder empezar','2019-09-04'),(1944,66,'Clase treinta y dos','Hoy agregamos una lista desplegable para que los usuarios elijan sus niveles de permiso, pero no los pueden usar antes de ser aceptados. As que no habr errores. Tambin estuve tratando de poder utilizar las variables del usuario que se establecen al loguearse. ','2019-09-04'),(1945,69,'4 de septiembre','Mostramos la base de datos con el stored procedure terminado, buscamos como validar datos y que no se repitan, pero no encontramos nada para hacerlo en mysql solo en php, y subimos la base de datos al servidor que nos indico el profesor,','2019-09-04'),(1946,65,'Unificacion de las vistas','Hoy finalice mi parte de la unificacion de las vistas.','2019-09-04'),(1947,70,'Validacin de datos.','En el da de la fecha estuve habilitando la validacin,que bsicamente chequea en la base de datos si un username est disponible o no, entre otras, al parecer su funcionamiento es correcto pero no estoy seguro, ver como funciona la proxima clase.','2019-09-04'),(1948,40,'Crear y otorgar permisos usuarios phpmyadmin','En el da de la fecha tuve la tarea de investigar sobre como crear y otorgar permisos a los usuarios en phpmyadmin por consola MySQL, encontr distintas fuentes en las que se utilizaban una sintaxis similar y un vdeo en el cual explica paso a paso como realizar esta tarea, el cual fue utilizado por el grupo.','2019-09-04'),(1949,47,'Ya tengo los estilos','El sector de diseo me paso algunos estilos ya bien hechos, pero como me queda poco tiempo en la clase no tuve demasiado tiempo como para probar, solo enlace algunos archivos para probar y efectivamente anda bien.','2019-09-04'),(1950,71,'base de datos terminada','Finalizado lo del stored procedure en nuestra base de datos y ya presentado a los profesores, continuamos buscando el backup automatico y el verificador con ideas que nos da el profe para buscar pero se nos complica bastante','2019-09-04'),(1951,49,'vistas y manual de vistas','En el dia de hoy terminamos las vistas que nos quedaban por terminar y empezamos a hacer el manual de vistas. ','2019-09-04'),(1952,72,'Clase 32, problemas que obstaculizan el avance.','La clase de hoy contemplamos diversos problema que nos impidieron el avance de los servidores web, por lo que nos queda soluciones el tema de la Web y verificar que ellos funcionan.','2019-09-04'),(1953,63,'Trigsima segunda clase','Hoy hicimos la lista desplegable para que el usuario pueda elegir el permiso que le corresponde al momento de registrarse pero para poder ejercer dicho permiso, anteriormente tiene que ser habilitado por el administrador.\nTambin, estuvimos viendo para mostrar los nombres por pantalla para posteriormente sealar que hace cada permiso.','2019-09-04'),(1954,52,'Diseo','El proyecto de la union de las vistas para el equipo de desarrollo esta casi completada solo faltan algunas vistas mas poner','2019-09-04'),(1955,86,'Git hub difinitivo.','Tras resolver el problema de la particion del disco, intal GitHub en el servidor.','2019-09-04'),(1956,75,'Completar carpeta de campo','Me puse al da con la carpeta de campos,transcribiendo todo lo hecho en las anteriores clases.','2019-09-05'),(1957,85,'Componentes del DEA y ultima correccion del codigo','Hablamos juntos con mi compaero sobre los transitores, diodos, Triacs sobre donde posicionarlos y cual usar especificamente tambien solucionamos el problema de los modulos de carga para las baterias de litio, tambien termine de corregir el codigo del DEA y esta listo para ser usado: Nota personal en la siguiente clase preparar los archivos de sonidos','2019-09-05'),(1958,76,'Actualizaciones y Mantenimiento','Debido a cambios en la parte de base de datos de los martes y mircoles, se debi acoplar y adaptar lo ya hecho a las nuevas actualizaciones hechas. Se volvieron a agregar los procedures y se hicieron cambios en tablas de la base de datos Se hizo tambin una pequea actualizacin de la documentacin y se ayud en temas del rea a los chicos de diseo.','2019-09-05'),(1959,80,'05-09','En el da de hoy me dedique a terminar la carpeta de campo insertando unas imgenes que faltaban sobre cdigo y la vista que me toco hacer. \nEsta terminada hasta la fecha.','2019-09-05'),(1960,53,'Ejemplo encontrado ','Anteriormente se busco la forma de colocar el plugin de leaflet.draw, hoy se pudo encontrar pero surgieron inconvenientes, uno era que al colocar el cdigo del ejemplo a mi archivo no mostraba lo que se quera mostrar, se tendr que buscar otras alternativas, pero con el ejemplo encontrado ','2019-09-05'),(1961,48,'Hoy arreglamos la vista','Estuvimos terminando la vista que nos encargaron, y nos dimos cuenta a ultima hora de clase de que estabamos haciendo la vista incorrecta asi que, estuvimos chequeando los campos que debiamos integrar en la vista que debiamos hacer y nos dedicamos a corregir los campos y a arreglar algunos problemas que tuvimos ','2019-09-05'),(1962,74,'al ultimo momento','este dia me puse a  trabajar de 2 con un compaero integrante de desarrollo, decidimos borrar los iframes y agregar oto mtodo para llegar a las vistas, en este momento llegando a la finalizacion del segundo trimestre estamos mejorando conectando las vistas y ya pasndolo a los integrantes de desarrollo ahora solo nos falta hacer la carpeta de campo y mejorar algunas cosas pero ya estamos por terminar considero que se avanzo bastante desde que entre en diseo. \n','2019-09-05'),(1963,78,'Nuevos diseos y login','El jefe de diseo me cont que se van a hacer vistas nuevas sin iframes, todo con hipervnculos. Esos diseos los trabajo junto al jefe de diseo para que hagamos esto en Codeigniter, esto para evitar problemas de compatibilidad con las vistas, url y dems.\nOtra cosa con la que estuve trabajando era el login que se compone de dos botones que tienen una ventana modal.\nYa puse el form para ingresar a la cuenta en el modal, falta que me pasen el form para crear una cuenta','2019-09-05'),(1964,79,'Plano del DEA II','Este da segu trabajando en el plano del DEA, revise un poco el diseo, correg algunas partes que estaban mas diseadas. Lo pase a un crockis mucho mas prolijo y marque todos lo componentes. Hable un poco con el profe Damian sobre componentes y resulta que ademas de transistores puedo usar un triac, que es otro componente que puede realizar la misma tarea. As que despues voy a investigar mas sobre el. Ya bien terminado el crockis creo que puedo decir que ya tengo toda la lista de componentes, serian: un jack de alimentacin, dos transistores npn, y pnp, un pulsador-interruptor, dos modulos tp4056, dos bateras de litio 18650 de 3.7v, un regulador de tension de 5v 2A, otro de 3.3v 2A, tres leds, tres resistencias de 220 ohms, otra resistencia para el transistor npn (hace falta calcular su valor), un modulo dfplayer, un amplificador pam (el de 5v), un arduino UNO, un parlante de 3w y 4 ohms, y dos capacitores (queda por ver cuales deben ser sus valores). Estos serian los componentes mas esenciales, despus quedara seguro un placa de pcb recubierta de cobre, una placa pcb perforada, pines para arduino macho y hembra.','2019-09-05'),(1965,50,'Nuevos diseos de interfaz de usuario ','Se hicieron modificaciones a las vistas de registro y log-in para usuarios. En paralelo, se complet el confeccionamiento de la carpeta de campo. ','2019-09-05'),(1966,82,'continuacin con el trabajo ','El da de hoy continua con los cambios del trabajo con mi compaero, estuvimos agregando y modificando el estilo, tuvimos problemas pero pudimos resolverlo, le mostramos nuestros avances al lder y nos dijo que le agreguemos funcin de Script, para que los campos sean iguales y que si no son iguales mande una alerta, despus de modificar le mostramos el trabajo al lder y luego el nos dijo que debamos preguntar si necesitbamos agregar otros campos al grupo que se encarga de base de datos, cuando preguntamos al integrante del base de datos nos dijo que lo que nos haba pasado era incorrecta, as que tuvimos que rehacer en tp y lo logramos y terminamos.','2019-09-05'),(1967,51,'cosas varias','hoy me puse a ver la base de datos y vi que 