e fecha terminado','Logre que ingresendo una vez la fecha se cargue para todos los alumnos la misma fecha. Estaba viendo si podia poner alertas, contar las faltas y ordenar ascndentemente y esas cosas.','2019-09-06'),(1976,80,'06-09','en la clase de hoy  se logro insertar el login que hice en la pantalla emergente de la pagina principal. no esta con la imagen que eleg en un principio pero se ve bien, el nico inconveniente es que queda una parte en blanco debajo del formulario lo cual aun no se ha podido solucionar.','2019-09-06'),(1977,77,'Tutoriales Android Studio','El da de la fecha me dediqu a investigar el entorno de desarrollo que se utiliza en el proyecto Android Studio y organizar la carpeta de campo','2019-09-06'),(1978,51,'lo que faltaba','mi jefe me pas la base de datos con los &quot;stored procedure&quot; y yo me encargu de ponerle los &quot;trigger&quot;, luego lo plasm en la documentacin del proyecto y en mi carpeta de campo y complement un poco mas mi carpeta de campo que me faltaban un par de detalles para poder entregarla esta noche','2019-09-06'),(1979,53,'Realizar la carpeta de campo','Por eliminar la carpeta de campo actualizada, tengo que completar la carpeta de campo que tengo des-actualizada. 7 fechas para escribir en la carpeta de campo.','2019-09-06'),(1980,48,'Terminamos la vista','Desde que comenzamos a trabajar en la vista nos dedicamos a eliminar codigo y carpetas, archivos etc del archivo asi solo usabamos un archivo de la vista, tuvimos errores y complicaciones ya qe al borrar nos surgieron varios errores, se nos desacomodaba el diseo, entonces estuvimos arreglandolos, ademas de la limpieza de codigo en el cual el lider nos aviso que nos no podiamos usar otra parte de diseo que no sea materialize entonces tambien corregimos eso','2019-09-06'),(1981,58,'Finalizacin de la pagina de inicio','Hoy como me quedaba pendiente agregar el botn de registro ya lo pude realizar ya que la compaera me paso la planilla de registro , y que a mi me tocaba agregarlo a la pagina, luego termine la pagina de inicio con todos los diseos y botones, despus el jefe nos pidi que completemos la carpeta de campo, que el profesor nos iba a evaluar y lo complete ','2019-09-06'),(1982,82,'finalizacion de la vista ','el da de hoy realizamos con mi compaero una limpieza de archivos, y cdigo de la vista que venamos trabajando ya que el lder del grupo, nos dijo que el trabajo deba estar en un solo archivo con extensin php as que modificamos el cdigo, eliminamos archivos pero eso nos ocasiono errores en la vista, con el diseo y cdigo despus de arreglarlo y que todo funcionara correctamente, le pasamos el archivo al lder en extensin php','2019-09-06'),(1983,78,'Carpeta de campo','Mi jefe de diseo dijo que me ocupara solo de la carpeta de campo ya que para la semana que viene hay que tenerla hecha para pasrsela a uno del equipo que las junte todas. Hoy me ocupe de rellenar cosas que me faltaban de la carpeta. No termine pero sigo en casa','2019-09-06'),(1984,45,'actualizacin de la carpeta de campo','hoy termine de desarrollar la carpeta de campo al da de hoy agregando imgenes links corriendo fechas etc','2019-09-06'),(1985,54,'Comienzo prcticas externas ','En el da de hoy comenc las prcticas profesionalizantes fuera del colegio. La tarea que debo hacer en el registro civil consiste en revisar que en las partidas (ya sea  defuncin matrimonio nacimiento) coincida la imagen de la partida con el nombre del titular. Si es as apruebo la partida y si no coincide la rechazo especificando el motivo','2019-09-09'),(1986,54,'Control de actas','Continuamos con el control de actas','2019-09-10'),(1987,49,'Actas','En el da de hoy me ensearon a aprobar y rechazar actas de nacimiento y de matrimonio.','2019-09-10'),(1988,64,'Ultima clase del Segundo Trimestre.','En el da de la fecha se realiz el cierre del Segundo Trimestre, por ese motivo en esta clase el docente a cargo nos llam a todos y no hico un par de preguntas a cada uno sobre nuestros compaeros de rea, tambin para el final de la clase de me asigno la tarea de buscar cmo cambiar el men raz del FTP.','2019-09-10'),(1989,72,'Clase 33, retoques finales.','La clase de hoy, me dedique a arreglar los ultimo problema de desaparezca, de esta forma me queda resolviendo dichos problemas para que el servidor este en buenas condicin de uso, ademas ayude a resolver problemas con el Git ya que no permita sacar los datos que se suban al repositorio.','2019-09-10'),(1990,43,'Diagrama de Gantt','Hoy estuve charlando con un compaero y ayudndolo a hacer el Diagrama de Gantt, entre ambos tiramos varias ideas y fechas para completarlo y as hacerlo ms largo y mejor.','2019-09-10'),(1991,38,'10/09/19','En el dia de hoy el profesor nos llam a todos de forma individual para poder calificar a nuestros compaeros segun sus desempeos en el sector de trabajo. Tambien, se aprovech para conversar dificultades y explicar que tipo de trabajo realizamos.','2019-09-10'),(1992,71,'10-09','El da de hoy calificamos a los miembros de nuestra rea para cerrar nota de este trimestre, tambin  le pasamos una carpeta por e-mail de nuestra rea con todo lo hecho hasta ahora al profesor ','2019-09-10'),(1993,47,'Nos pasaron los estilos','El sector de diseo nos termin de pasar los estilos que tenan pendientes. La clase que viene empiezo a enlazar los archivos.','2019-09-10'),(1994,86,'ltimo dia de clases','El dia de hoy habia que entregar los manuales de usuarios de los cuales tuve que terminar y tambien probar hacer un &quot;pull&quot; en el servidor con git','2019-09-10'),(1995,63,'Trigsima tercer clase','Hoy tuvimos la que evaluar a nuestros compaeros de reas y dar una nota de nosotros mismos. Tambin estuvimos juntando las cosas que vamos a entregar para el cierre de trimestre. ','2019-09-10'),(1996,65,'Evaluacion y cierre de trimestre','Hoy el jefe de proyecto no llamo uno por uno para calificarnos, ademas estuve finalizando y organizando el contenido del area de diseo. ','2019-09-10'),(1997,70,'Auditorio, validacion no terminada','el jefe de proyecto nos llamo para calificarnos del 1 al 4 a nosotros y a nuestros compaeros de seccion, la clase pasada estuve haciendo una validacion de usuario que funcion al principio pero despus de agregar el useravail dej de mostrar la pagina principal, esta clase trat de hacerlo de vuelta sin exito.','2019-09-10'),(1998,57,'Evaluacin','El docente nos pidi que nos evaluramos y a nuestros compaeros por la finalizacin del trimestre y el sector de diseo nos pas los estilos.','2019-09-10'),(1999,52,'Diseo','hoy termine de nir las vistas y se las pase a el sector de diseo para que pedan trabajar con ya con las vistas terminadas','2019-09-10'),(2000,69,'2 trimetre','completamos la carpeta de campo mientras el profesor cerraba la nota','2019-09-10'),(2001,66,'Clase treinta y tres','Hoy fue la fecha de entrega de todos los archivos y la evaluacin del rea.','2019-09-10'),(2002,41,'Comienzo de prcticas externas','En el da de hoy entramos a las 13 y nos explicaron que cada vez que entremos o nos vayamos tenemos que firmar poniendo la hora,apellido, nombrey nuestro dni, despus nos presentaron a los tutores y nos explicaron lo que tenamos que hacer primero: entramos a la pgina engage webagent y nos dieron un usuario con contrasea para que podamos acceder, despus nos explicaron los pasos a seguir y tenemos que verificar algunos documentos que coincidan su nombre y apellido y aceptarlos en caso de que no llegasen a coincidir tenemos que rechazarlo o si no estamos seguro o no entendemos lo tildamos cmo pendiente.','2019-09-12'),(2003,40,'Registro civil','En el da de la fecha  vinimos por primera vez a realizar las practicas en el registro civil, y estuvimos trabajando con el control de calidad de las solicitudes partidas de nacimiento, verificando que estas tengan los mismo datos tanto en la partida como en los datos digitales, de esta forma aprobamos o no la solicitud.','2019-09-12'),(2004,83,'primer dia de practicas externas dia 12 de septiembre','la seora claudia fue muy amable al darnos una explicacion sobre lo que hariamos. \n Me designaron el trabajo de actas de nacimiento, me explicaron como actuar ante un error y como dar algunas aprobaciones.\nPor mi parte me siento agusto haciendo lo que hago, al principio si tuve mis dudas, pero luego pude dominarlo, solo me encarghaba de ver que los dastos coincidan y que estn sellados, en caso de no ser, iban a hacer rechazados o si habia alguna duda, serian denominados como pendientes. \nhoy pude terminar con mi parte de control de actas y parte de la calidad.','2019-09-12'),(2005,46,'pasantias externas','el dia de hoy fui a hacer mis pasantias en jean jaures 970, al llegar me condugeron en mi sitio de trabajo y Claudia se encargo de decirme lo que tengo que hacer y como manejarme con cada caso diferente que puede tocarme. Luego de guiarme un poco ella se fue y yo continu con las actas ','2019-09-12'),(2006,56,'Control de actas comunes','Revise partidas de nacimiento, corroborando que sean correctos los datos de las partidas digitalizadas, con los datos registrados en la base de datos, determinando si tenian que ser aprobados o rechazados.','2019-09-12'),(2007,45,'Distribucin del grupo y final de trimestre','Hoy nos organizamos y dividimos el grupo para realizar diferentes tablas en materialize para el proyecto a m me toco una tabla de computacin junto con otro compaero, tambin calificamos al resto del grupo para el cierre del trimestre.','2019-09-12'),(2008,51,'revision','mas que nada hoy me encargu de ver si tenia algo que hacer con respecto a mi sector y luego complete un poco mi carpeta ','2019-09-12'),(2009,82,'nuevo trabajo tercer trimestre ','Hoy el lder nos puso en grupo de dos para terminar el index en el cual me toco  hacer trabajo de automotores y el lder explico que tenamos que hacer. Comenzamos con el trabajo con traslavia ','2019-09-12'),(2010,76,'Cambios y Mantenimiento','Debido a que dentro de algunas tablas haba campos que utilizaban la letra &quot;&quot; se producan errores al momento de codificar en los otros lenguajes de desarrollo. Se les cambio el nombre para evitar este error. Se hizo tambin una breve revisin de la base de datos en busca de errores, mejoras o cambios.','2019-09-12'),(2011,58,'Empezando el nuevo trabajo','Hoy el lder nos llam a todo el grupo de diseo y nos dijo que tenamos que hacer un trabajo de a dos y a mi toco con nayeli, el trabajo se trata de completar la vista del botn de automotriz. ','2019-09-12'),(2012,42,'Carpeta de campo y carpeta general.','Recolecte las carpetas de campo de mis compaeros del sector de diseo y comence a preparar la carpeta general o manual de usuario, estuve leyendo todas las carpetas que me fueron entregadas e intentando resumirlas en papel, debido a que es un conjunto de todas las carpetas para poder llegar al manual de usuario. \n','2019-09-12'),(2013,36,'arreglando diseo','arreglando los link de bootstrap y cambiando y buscando diseo a algunas cosas. ','2019-09-12'),(2014,80,'12-09','El da de hoy nos dedicamos a la compilacin de las carpetas de campo en un documento general. Aun no esta terminado debido a el tiempo que lleva su desarrollo, pero pronto lo estar.','2019-09-12'),(2015,75,'Solucionar problemas','En esta clase estuve solucionado algunos problemas que surgieron en el cdigo entre ellos estaba:\n1-  Los archivos de la carpeta &quot;Codeigniter&quot; no se abran, la solucin era modificar la url del raz y agregarle el 8080/Codeigniter.\n2-  Al hacer una consulta para la generacin de la BD me daba error. El problema era que el campo contena , por ende daba error.\n\nY por ultimo, mejore los estilos del PDF. ','2019-09-12'),(2016,50,'Desarrollo de documentacion','Los integrantes del equipo me pasaron sus carpetas de campo respectivamente, con ellas, finalizare la documentacin del departamento de desarrollo para su entrega en los das subsiguientes.','2019-09-12'),(2017,77,'Integracin con Android Studio','Se continu con los tutoriales y PDFs 