uye por ejemplo ayer trabaje con la fecha 5  y por lo tanto las actas de partidas de nacimiento eran totalmente distintas a las de hoy que fue con la fecha 10 y bueno hoy si hubo unosotros errores porque ciertos datos no coincidian pero despues no hubo problema alguno. algo distinto acomparacion de ayer fue que se trabajo con otros usuarios a comparacion de ayer, tambien se nos infomo otro dato mas sobre las partidas de nacimiento que puede ser que tengan en un margue por lo cual se nos pidio que eso lo dejaramos como pendiente. hay que recordar que nosotros tenemnos varias funciones pero las mas conocidas y primordiales son el de la opcion pendiente, rechazar y aprobar. pero dentro de todo fue bueno el dia de hoy.','2019-09-13'),(2024,56,'Control de actas comunes','Con mis compaeros continuamos realizando la misma tarea que se nos asigno ayer, jueves, y terminamos de verificar los datos de todos los registros, de partidas de nacimiento, que tenamos para verificar.','2019-09-13'),(2025,41,'Control de actas comunes ','En el da de hoy nos presentamos a la 13hs y firmamos despus estuvimos siguiendo con el control de actas comunes verificando si coinciden los nombres y apellidos y si estn los sellos tambin nuestro tutor nos enseo sobre las actas de nacimiento defuncin y matrimonio despus firmamos  a las 16hs y nos fuimos.','2019-09-13'),(2026,40,'Control actas comunes','En el dia de hoy continuamos con el control de actas comunes, realizamos alrededor de 700 solicitudes en las cuales aprobamos y rechazamos algunas por error de datos.','2019-09-13'),(2027,55,'Segunda da en practicas externas  ','Hoy en practicas externas mi tutor me enseo a como realizar actas de defuncin, que es lo que realizara durante el resto del da, luego de la explicacin procedi a darme una lista con los nombres de las personas que tendra que buscar.\nResulto ser mas complicado de lo que esperaba ya que me encontr con que varias personas que fueron registradas con algunas variaciones en las letras 