mo que la ves anterior, aprob algunos certificados pero otros la maquina no me dejaba aprobarlos y rechace un par por que estaban mal escritos','2019-09-19'),(2047,83,'tercer dia de practicas externas','hoy como los otros dias, seguimos trabajando con las actas de nacimiento, pero con diferente fecha. Se  pudo apreciar las mismas caracteristicas de trabajo como los anteriores, hubo algunos errores y a la vez no. Algunos actas se dejaban en modo pendiente y otras tan solo se aprobaban o se rechazaban, incluso al aprobarlas podian darte un leve error, pero no era cosa que no tenga solucion. Aunque admito que habia cosas que no se podian arreglar por lo que directamente se dejaban y pasabamos a otras actas de nacimiento. Otras de las cosas que se pudo ver hoy es que a veces los nombres o apellidos estan mal escritos, es decir, si una letra esta mal, ya sea porque le falte o est de mas,  pues eso no me sirve y tiene que ser rechazado o dejado en pendiente si es que se puede salvar esa acta de nacimiento por otra persona.\nun dia muy tranquilo','2019-09-19'),(2048,40,'Actas comunes','En el da de hoy continuamos realizando control de actas comunes de solicitudes de nacimiento, matrimonio y defuncin. Adems nos explicaron algunas excepciones en las que debemos rechazar las solicitudes.','2019-09-19'),(2049,40,'Practicas externas registros civil','En el da de hoy continuamos con  el control de actas comunes aprobando y rechazando distintas solicitudes de nacimiento, matrimonio y defuncin, realizamos alrededor de 400 solicitudes.','2019-09-20'),(2050,41,'Practicas Externas registro civil','En el da de hoy seguimos siguiendo con el tema de actas de control de calidad  verificando si coinciden los nombres y apellidos y si estn los sellos.','2019-09-20'),(2051,83,'Otro da ms ','Hoy se trabajo con o mismo( partidas de nacimiento) pero con diferente fecha.\nComo de costumbre se pudo ver errores en los apellidos o simplemente no podan ser aceptadas algunas partidas por &quot;X&quot; problema que tena que ser vista por otros. Adems de eso  tambin hubo casos no donde se aprobaron actas de nacimiento aunque tambin como dije en otro momento cuando toda la partida sea correctan pero tenga escrito algo en el margen izquierdo no podr ser aprobado a pesar de que todo aparente estar en buenas condiciones por lo que ser pendiente y eso a pasado hoy en ciertos casos ','2019-09-20'),(2052,55,'4to da de Practicas Externas','En el da de hoy continu haciendo actas de defuncin con el detalle que me encontr con varios inconvenientes como por ejemplo no encontrar a la persona o que este ingresada con un apellido diferente.       ','2019-09-20'),(2053,51,'mas trigger','hoy me di cuenta que podia ponerle mas trigger`s a la base de datos asique me di a la tarea de ello, ya agregue uno mas de &quot;eliminar&quot;, luego me fijar en donde mas puedo poner mas','2019-09-20'),(2054,45,'REALIZADO DE TABLA','Hoy se finalizo la tabla de computacin con el nombre apellido e informacin del alumno en esta ultima hay diferentes botones a para acceder a determinada informacin,\npara la prxima se me asigno poner 2 botones mas no solo para la tabla de computacin sino para todas las tablas.','2019-09-20'),(2055,58,'Terminamos la vista de automotriz','Hoy con nayeli terminamos la planilla que tenamos que hacer de automotriz que habamos empezado la semana pasada y lo terminamos hoy tambin le pusimos un fondo al inicio para que quede mejor el diseo. El jefe tambin vino y me dio un nuevo trabajo que se trata de crear un modal de crear cuenta para la prxima clase','2019-09-20'),(2056,74,'poniendo estilos ','este da puse estilos a los aos de ciclo bsico y tambin a los las listas desplazables para mas prolijidad o dndole mas color porque a}las listas son transparentes y los sub titulos (h3) no se ven muy bien con el fondo que le aad a todos los archivos, index, aos, distintas especialidades, etc. \n\nhice un prototipados de las vistas futuras a hacer para que mis integrantes lo terminen es un futuro. \n','2019-09-20'),(2057,53,'Ver cdigo, verificar cdigo y modificar','Solo se extrajo un archivo que contena ejemplos con los cuales solo se utilizo uno para verificar cada funcin del cdigo.','2019-09-20'),(2058,77,'Creacin de primera App de prueba','El da de la fecha se logr emular un cdigo simple en un dispositivo android de uno de los alumnos. La aplicacin fue reconocida y el cdigo funcion de la manera esperada. Se mostr un mensaje emergente con los datos introducidos en la PC. Asimismo, se continu con la investigacin del entorno de desarrollo en Android Studio y sus herramientas. ','2019-09-20'),(2059,36,'solucionar problema con bootstrap ','arregle el link de bootstrap que etaba mal y majore editar','2019-09-20'),(2060,76,'Mantenimiento y Mejoras','Se hizo otra revisin para volver a ver si haba algo faltante en la base de datos o si era posible facilitar algo para que las diferentes reas tuvieran mas comodidad a la hora de trabajar con ella. Se llego a la conclusion de que agregar unos cuantos Triggers era la opcin correcta. Se empez con ellos pero no se pudo terminar.','2019-09-20'),(2061,80,'20-09','En la clase de hoy me dedique especficamente a seleccionar las cosas que iban y no iban en la documentacin general, ya que hay muchas cosas que no estn actualizadas, y faltan muchas fotos, y algunas carpetas de campo que aun no estn terminadas, hacen que se demore su finalizacin. Lo estuve haciendo sola ya que el compaero con quien lo iba a hacer falto hoy.','2019-09-20'),(2062,48,'Poniendome al dia con las tareas','Completamos la actividad que nos dio kevin, fue bastante sencilla asi que lo terminamos rapido luego kevin nos dio un trabajo con una compaera asi que la siguiente clase vamos a empezar con las vistas  ','2019-09-20'),(2063,78,'Combinando agregarAlumno','Comenc a combinar back-end con front-end de la funcionalidad agregarAlumno usando la vista hecha por el equipo de diseo y mi cdigo php del modelo y la llamada a la vista desde el controlador. A su vez, cambio el form de la vista ya que estas eran con la etiqueta &lt;form&gt;. Esto lo cambio a las funciones que me proporciona el form_helper de CodeIgniter.\nNo tuve problemas combinando, sin embargo hay un problema con la imgen de fondo ya que esta no se muestra. Eso lo ver en casa. Otro problema que tengo es cuando uso el form_open(). De argumento lleva la ruta al controlador y el mtodo que va a usar los datos en los inputs. El problema es que por ms que tenga la ruta correcta al controlador y al mtodo, la pgina tira error de que no la encuentra. Eso tambin lo ver en mi casa por mi cuenta.\nEl cdigo con las funciones del form_helper lo copie de un formulario de agregarAlumno que ya haba hecho y lo pegue en el nuevo, cambiando muy pequeas cosas como una clase de un elemento.','2019-09-20'),(2064,82,'finalizacin y comienzo de un nuevo trabajo ','Hoy terminamos con mi compaero el trabajo que el lider nos dio se lo presentamos y dijo que estaba bien por lo cual nos dio otro trabajo pero me asigno a otro compaero asi que hablando con el nos dijo que  debemos realizar varias vistas y paginas, comenzamos hacer el trabajo y  en la siguiente clase continuaremos con las vistas y el lider dijo que si tenemos alguna duda de como hacer el tp lo consultemos con el grupo de desarrollo,','2019-09-20'),(2065,79,'DEA dudas','Hoy empece mi da completando un poco de la lista de componentes del circuito que ya tenemos, luego le consulte al los profesores Consorti y Olaso una duda sobre el circuito (si tenia que haber o no un capacitor en un lugar especifico). Consorti me recomend que pase el circuito a en limpio a algn programa. Les pregunte si livewire era un programa viable, me dijeron que si pero no tenia los componentes de Arduino. Por ende me puse a buscarlos, como nos los encontr, voy a optar por usar proteus que es mas factible que tenga las libreras que deseo. Despus de eso, al continuar mi bsqueda de componentes me di cuenta que no encontraba un componente en especifico el regulador de tensin 78S03, asi que tendremos que usar un equivalente como las serie de los LM317 o los ld1117. ','2019-09-20'),(2066,60,'Volver a la seccion','El da de la fecha luego de unas semana de recuperacin volv a clases.\nEn este da se descargo el asteriskNow(llamado FreePBX) para hacer un servidor VoIP, se proseguio a la instalacin y a crear una maquina virtual nueva para este sistema operativo(Por problema de espacio en el disco no se pudo terminar la instalacin)','2019-09-20'),(2067,46,'P.','Hoy nuevamente trabaje con las partidas de nacimiento pero, por accidente cerr la cuenta que estaba\nusando y no pude trabajar por un rato despus de las 02:20pm porque Claudia se fue despus de\nponerme su cuenta en la computadora, que fue en cuanto llegue. Por suerte me acorde de la\ncontrasea y contine.','2019-09-20'),(2068,54,'Control de actas','El dia de hoy continuamos con el control de actas comunes especficamente partidas de nacimiento','2019-09-23'),(2069,49,'Actas ','En el da de hoy seguimos aprobando y rechazando actas ','2019-09-23'),(2070,54,'Control de actas','En el dia de la fecha continuamos realizando la tarea de control de actas','2019-09-24'),(2071,43,'Materialize','Hoy estuvimos hablando con el profe Nahuel acerca de lo que tenamos que hacer en el tercer trimestre, por consecuente, terminar las vistas que nos faltaban. Tambin, ya no vamos a usar ms Boostrap, simplemente utilizaremos algo mejor que lleva por nombre &quot;Materialize&quot;, algo que supuestamente es mejor que el que estbamos usando. Hoy nada ms veremos vdeos de cmo funciona y qu es.','2019-09-24'),(2072,64,'Filezilla Listo, Ya casi....','En el da de la fecha se me comunico que como volvan a considerar para volver a ser el lder de rea de la seccin de Infraestructura por mi buen desempeo en el primer trimestre.\nTambin se asign a seguir investigando de cmo cambiar el men raz del Filezilla para que cuando uno abra el programa, salga una carpeta en especfica en vez de que nos salgan un montn que no nos interesan. Para finalizar se me comunico que se encontr lo que se me mando hacer, por eso, en la prxima clase me tocara a mi aginarle las tareas a los chicos, pero como que no queda mucho para hacer, as que veremos en la marcha cmo va la cosa. \n','2019-09-24'),(2073,38,'24/09/2019','En el da de hoy estuve observando a mis compaeros con los cdigos que estaban editando de la fecha pasada, ademas de eso nos llamaron los profesores para conversar de quienes serian los lideres de rea el prximo trimestre. A su vez tambin nos mencion que algunos de los sectores se desintegraran como por ejemplo infraestructura, base de datos y los alumnos que integraban esos sectores sern distribuidos en las reas de diseo y desarrollo.','2019-09-24'),(2074,72,'Clase 35, Comienzo del final.','La clase de hoy me dedique a arreglar el men raiz del FTP. Ademas vi el tema de los permisos para carpetas de usuarios annimos. Puesto que todos esto fue investigado y puesto en practica el da de hoy, maana va a ser la ultima clase donde se van a elegir los retoques.','2019-09-24'),(2075,86,'Pull y Push (GitHub)','En el dia de hoy en el corto plaso de tiempo que teniamos, pude probar despues de tantas clases probar hacer los comandos Pull y Push. Estos no fueron complicados ni hubo complicacion alguna. Hubo una perdida de tiempo debido a que no sabia prender el servidor pero no nos quedamos cortos de tiempo.','2019-09-24'),(2076,70,'Entrega de notas, otro intento','Hoy se nos hizo saber que nuestras notas ya han sido cerradas por el fin de trimestre, aunque todavia es posible que las notas cambien en algunos casos, con respecto a la verificacion de datos, en vez de seguir con el anterior, pas a otra forma que (al parecer) es ms practica.','2019-09-24'),(2077,71,'24 de septiembre','Hoy el profesor nos charlo del cambio de rea que va haber para este trimestre, aclarando que el rea de base de datos no va a estar mas este trimestre. Por nuestra parte seguimos investigando lo del backup automatico y se nos complica cada vez mas','2019-09-24'),(2078,67,'Finalizacion de tareas','El da de hoy empezamos a finalizar las cosas que nos faltaban en el rea de base de datos para as poder terminar y despus pasarnos a otras reas. ','2019-09-24'),(2079,69,'24 de septiembre','El da de hoy el profesor reuni todas las reas para comentarnos las tareas y los cambios del ltimo trimestre, en cuanto terminemos lo que nos falta, nuestra rea base de datos no va a estar mas y nos van a repartir en otras reas. Seguimos buscando la manera de hacer el Backup automtico, y el verificador de datos. ','2019-09-24'),(2080,65,'Notas y cambios en el area de diseo','Hoy el jefe de proyecto nos coment las notas del segundo trimestre y nos dio las tareas a realizar para este ltimo trimestre.\nEn el rea de diseo decidimos hacer las vistas de cero con materialize. Estuve viendo tutoriales de materialize, tambin descargue e instale un editor de texto recomendado por el tutorial pero no hice tiempo para darle uso.','2019-09-24'),(2081,73,'Materialize','En el dia de hoy estuvimos viendo video tutoriales para aprender a usar el materialize CSS ','2019-09-24'),(2082,52,'Diseo','el desarrollo de nuevas vistas y el tipo de estilos que van a tener cada una de ellas reformando las por materialeze como modelo','2019-09-24'),(2083,66,'Clase Treinta y Cinco','Hoy tras leer la gua de la librera session de codeiginiter descubr como hacer para poder obtener informacin. Estar terminando de hacer estas cosas estos das. Tambin hay nueva lder.','2019-09-24'),(2084,63,'Trigsima quinta clase','Hoy lemos la documentacin sobre la librera session en codeigniter. Tambin me asignaron como lder de rea por lo que me puse a revisar el diagrama de gantt, el manual de usuario y trat de unificar la parte de becas con la carpeta principal.','2019-09-24'),(2085,49,'Actas','En el da de hoy seguimos con el control de actas ','2019-09-24'),(2086,54,'Control de actas','En el dia de la fecha al comenzar haba pocas actas para la cantidad de personas que haba trabajando entonces al cabo una hora terminamos con todas, pero a medida que pasaba el tiempo iban llegando solicitudes nuevas. ','2019-09-25'),(2087,49,'Actas','En el da de hoy seguimos con el control de actas de nacimiento y defuncin.','2019-09-25'),(2088,47,'Enlazando estilos con nuestro trabajo','Empec a unir los estilos con nuestro trabajo, un algunos pero otros no saba dnde ubicarlos porque estn organizados distintos a como hicimos el trabajo. \nHabl con un integrante del sector de diseo y me dijo que iban a hacer todos los estilos otra vez, porque haba muchos errores en el anterior y no estaban bien organizados. \nEl sector de base de datos nos pas una nueva base de datos, as que tenemos que modificar algunas cosas.','2019-09-25'),(2089,71,'backup automatico','.Empezamos a buscar el backup automatico y encontramos varios ejemplos de como hacerlo, practicamos algo,  pero nada que todava impletemos en la base de datos.','2019-09-25'),(2090,72,'Clase 36, retoques finales.','La clase de hoy, me dedique a los retoques finales de del servidor la revisin del mismo. Por lo que al arreglar el men raz y asignar las propiedades de las carpetas correspondientes. termine de arreglar todo las tareas y as es como concluyo mi participacin en infraestructura hasta que surga un nuevo problema.  \n\nAdemas para terminar el da, instale un programa que me permite ver y gestionar el servidor desde otras computadoras de forma grfica sin necesidad de ver todo por consola.\n','2019-09-25'),(2091,69,'backup automatico','El da de hoy empezamos a tratar de hacer el backup automtico con php como nos pidi el profe.','2019-09-25'),(2092,52,'diseo','hoy estuve trabajando en las vistas con materialize lo que hice fue hacer las vistas de inscripciones por alumnos y inscripciones por usuarios con tablas que muestren a cada uno lo que necesitas  y para las &quot;Inscripciones por usuario&quot; hice un men que me permita editar el privilegio que tienen y aceptarlo para poder cambiar sus privilegios en la base de datos y tenga acceso a algunas vistas ','2019-09-25'),(2093,38,'25/09/2019','En el dia de hoy me explic y brind una pequea ayuda a las modificaciones que mi compaero realiz, a su vez tambin aprovech para explicarme algunas de funciones con ejemplos de cdigo.  Tambin, aprovech para poder poner contenido nuevo  a mi carpeta de campo.','2019-09-25'),(2094,73,'Materialize css','En el da de hoy estuve viendo tutoriales de Materialize css para poder trabajar con los diseos de la pagina ','2019-09-25'),(2095,86,'Finalizando tareas','Debido a que mis tareas estaban finalizadas proced a ayudar a Leandro con su parte. Arreglamos los problemas que haban respecto a la transferencia de archivos.\nPor ltimo hice el index de la pgina principal del servidor.','2019-09-25'),(2096,63,'Trigsima sexta clase','Hoy nos dieron la base de datos definitiva y encargue a cada integrante adaptar su trabajo a dicha base de datos.\nTambin estuve modificando el word con lo que tiene habilitado cada permiso actualizndolo con las nuevas funcionalidades.','2019-09-25'),(2097,67,'Finalizacion del Backup Automatico','El dia de hoy investige un poco mas sobre lo del backup automatico. Pude hacer un archivo .bat que me genera una copia de seguridad pero me falta automatizarlo.','2019-09-25'),(2098,66,'Clase Treinta y Seis','Hoy empece a manejar el tema de los permisos. Tambin nos dijeron que nuestra rea debe hacer mas funciones y tambin que debamos estar trabajando con la base de datos que se creo. Tras la actualizacin de la base de datos debemos actualizar principalmente los modelos y vistas para que estas funcionen como corresponden.','2019-09-25'),(2099,46,'lo de siempre','hoy hice lo de siempre con las actas, la maquina me funciono bien y hubo algunos casos de imagen mal cargadas y algunos que los deje pendiente. Use las fechas del 28-08 al 26-09 y continuo usando la cuenta de Claudia','2019-09-26'),(2100,83,'quinto dia','hoy se realizo las mismas tareas que se hizo desde el principio que se llego a este lugar, ingresamos con un usuraio y contrasea, luego de eso entramos a actas de nacimiento y empezamos a verificar los datos, es decir, nos fijamos que cada archivo tenga el sello y que tenga los nombres y apellidos bien escritos y que sobre todo concuerden con los datos del titutar, obviamente tambien ocurren otros tipos de casos en donde no se respetan y cuando suele suceder eso tenesmos las opciones de dejar lo en pendiente o inluso rechazarlo. hoy tuve unos de estos impercanses pero no era algo que no se pueda manejar, de todos modos podiamos consultar al Seor Pablo, pero en esta ocacion no hubo necesidad, muy aparte de eso fue todo muy tranquilo.','2019-09-26'),(2101,56,'Control de actas comunes - Nacimientos','Hoy revise registros de partidas de nacimientos con fechas de 28-08-19 al 26-09-19. Aprobando las que les correspondian los datos correctos con la partida digitalizada y los de la base de datos del registro civil. ','2019-09-26'),(2102,40,'Control de actas comunes','En el dia de hoy continuamos con el control de actas verificando que en las solicitudes concuerden los datos enviados con los digitales ingresados.','2019-09-26'),(2103,41,'practicas externas registros civil','En el da de hoy comenzamos con los controles de actas de nacimiento, matrimonio y defuncion y nos explicaron que la proxima clase nos van a explicar mas cosas del sistema ','2019-09-26'),(2104,74,'Estilos CSS','este dia ayude a mis compaeros agregando estilos en las paginas, tambin le puse estilos a todos los aos de todas las especialidades del colegio, ahora tengo pensando hacer un nav para poner informacin no tan importante, creo que se podra hacerse rapido. esto mostrara la informacin del preceptor y los cambios que se pueden hacer. ','2019-09-26'),(2105,45,'Perdida de trabajo','Hoy estuve realizando cambios en las tablas agregando 2 botones pero la PC se reinicio retrasando mi tarea','2019-09-26'),(2106,37,'Aplicacin Banco Galicia','Termin el cdigo de html para la aplicacin con el mapa y sus funciones unificando un cdigo obtenido de github con otro creado por un compaero, hice la base de datos de la misma, y realizamos la conexin mediante php. Estuve investigando sobre &quot;mapeo&quot; en html para guardar las coordenadas de la funcin &quot;marker&quot; en la base de datos previamente creada. Surgieron errores al unificar dos cdigos, ya que nos encontrabamos llamando dos veces al mapa, pero fueron solucionados.','2019-09-26'),(2107,50,'Documentacion 2','Utilizando el material desarrollado por los integrantes del equipo, se continu armando el contenido de la documentacin.','2019-09-26'),(2108,48,'hoy no avanzamos demasiado debido a problemas','Hoy estuvimos teniendo muchos problemas y no sabiamos bien como resolverlos, comenzamos teniendo dificultades para encontrar el archivo actualizado y problemas para agregar los debidos campos, problemas que fueron resuletos por el lider al pedirle ayuda, e investigar por internet ademas de que debiamos encuadrar los campos para lograr que no se camufle con el fondo y no pudimos, investigando y buscando ni asi pudimos lograrlo asi que lo dejamos para la clase siguiente','2019-09-26'),(2109,44,'Estuve completando la carpeta de campo','Estuve completando la carpeta de campo y arreglando algunas cosas','2019-09-26'),(2110,58,'hoy continue con el user de la pagina','el da de hoy el lder me dijo que agregara el botn y un modal de crear cuenta para la pagina de inicio llamada user, tambien me dijo que agregara los botones de cancelar para que cuando se abre el &quot;modal&quot;, con el botn de cancelar se pueda volver a cerrar y me quedaron un par de cosas pendientes que lo voy a continuar la siguiente clase','2019-09-26'),(2111,51,'ayuda','hoy me puse a ayudar a los chicos del sector de diseo con la base de datos para que su parte encaje con las tablas y demas cosas de la base de datos y me puse a agregarle &quot;trigger&quot; a la base de datos y ver en que parte le puedo poner mas','2019-09-26'),(2112,36,'termine de arreglar el dorpdown de curso','le agregue en el index controller otra variable con el array de cursos ','2019-09-26'),(2113,75,'Etapas finales','En esta clase ya el sector de diseo pudo darme las vistas ultimas (les faltan algunos detalles). Y se empez a poner nuestro codigo de codeigniter en dichas vistas. Hubo algunos inconvenientes para compatibilizar los archivos con codeigniter. Dicho problema ya se soluciono pero retraso nuestro trabajo. ','2019-09-26'),(2114,79,'Bsqueda de componentes y presupuesto, retoque del plano','Hoy empece buscando los reguladores que necesitamos para armar el circuito y los transistores. Encontr el regulador de 3.3v adecuado, ahora falta encontrar el adecuado de 5v, al menos que logre ahrranos el regulador con un re diseo del plano, que es posible. El transistor de 3.3v que encontr es un Ld1117. Los transistores que encontr son un TIP35 y TIP36. Para determinar que regulador de tensin necesitaba busque cuanto consuma el Dfplayer, si embargo no encontr nada acerca de su consumo de corriente, as que intente poder determinar a mano su consumo. Fui a pedir un muletillero y conecte el Arduino y el dfplayer y lo encend. Al intentar medir el consumo pero se apagaba el led de encendido del Dfplayer, resulta que estaba haciendo corto circuito de la manera que media la corriente. El profesor Damian me enseo a hacerlo y vimos que consuma muy poco (unos 0,02A), resulta que al no reproducir msica ni ninguna parlante conectado no haba consumo, as que lo que queda es probarlo pero con el circuito, y con una fuente de alimentacin adecuada, ya que la corriente del Arduino no es muy alta.\n\nAl comps de la bsqueda de los componentes fui revisando el consumo del circuito, para que los reguladores no me queden cortos. Me percate de que al hacer unas modificaciones podra usar menos reguladores y/o usar reguladores mas comunes, por lo menos teniendo en cuenta las bsquedas que hice por Internet. Ademas de eso vi que faltaba un diodo en un lugar critico, que si no estuviera hara que un transistor pase de corte a saturacion y viceversa continuamente, ademas que segn la fuente de alimentacin prevista habra que agregar algunas resistencias a las bases de los transistores ','2019-09-26'),(2115,85,'Investigacion sobre pcb y busqueda de componentes','con alvaro estuvimos viendo algunos componentes de menor tamao, tambien vi como el pcb puede llegar a cambiar el codigo final que tengo preparado en arduino','2019-09-26'),(2116,82,'continuacin de la vista de agregar alumno ','Continuamos con  la vista de agregar alumnos para el cual tuvimos muchas dificultades como el diseo y formulario ya que todo estaba en materialize, preguntamos al grupo de base de datos para saber que contena el campo de alumnos y as saber que tenamos que agregar y con los problemas nos ayud el lder y continuaremos por que no terminamos aunque agregamos algunos de los botones ','2019-09-26'),(2117,77,'Primera emulacion de Android','El da de la fecha se logro emular un cdigo simple en una virtualizacion de un celular. Se trat de instalar dicha aplicacin en el celular, pero por problemas de compatibilidad con android viejo se pospone dicha actividad.','2019-09-26'),(2118,55,'5to da de Practicas Externas','En el da de hoy realice la misma tarea que e venido haciendo desde que comenc, la cual quiero explicar mas detalladamente. Lo que yo realizo es buscar datos topogrficos de defunciones que me asignan para buscarla en el libro fsico de las mismas, es decir que me dan una lista con varias defunciones las cuales debo buscar sus respectivos datos (como por ejemplo fecha de defuncin) para posteriormente enviarla y que sea buscada en el libro fsico.   ','2019-09-26'),(2119,41,'Prcticas externas registro civil','En el da de hoy seguimos con el tema de actas de control de comunes  verificando si coinciden los nombres y apellidos y si estn los sellos y nos explicaron algunos funcionamientos de la pgina.','2019-09-27'),(2120,48,'No encontramos el archivo actualizado','Hoy a la hora de entrar a clases no pudimos encontrar el archivo en el que veniamos trabajando, y teniamos el archivo con las vistas viejas,lo cual quiere decir que lo que hicimos ayer fue todo en vano para hoy, el lider del grupo no estaba asi que tampoco pudimos pedir el archivo lo cual yo comence a investigar como encuadrar los divs que era la tarea que debiamos hacer ayer y no pudimos, investigando logre encuadrar los divs y ponerle un fondo translucido asi que guarde el codigo y lo usaremos para la siguiente clase cuando ya tengamos el archivo actualziado e implementar el codigo que encontre mientras tanto mi compaera estaba estudiando codigo en php ','2019-09-27'),(2121,56,'Control de actas comunes - Nacimientos','Continuamos con la misma tarea de revisar las partidas de nacimientos y, aprobarlas o rechazarlas, segn corresponda.','2019-09-27'),(2122,51,'ayuda a otro sector','en el dia de hoy me ocup en ayudar a los chicos del sector de diseo, ellos se encargan del diseo de la app y necesitaban ver como esta conformada la base de datos, las tablas y si hay alguna modificacin para que las vistas estn acorde a todo','2019-09-27'),(2123,53,'Leyendo codigo y completando la carpeta de campo ','Se completo la carpeta de campo de ayer y hoy, se busco una forma de almacenar las ordenadas pero al final no se encontr eso. Por ultimo fue ver el cdigo de como funciona el marker','2019-09-27'),(2124,75,'Etapas finales II','En esta clase segu compaginando el cdigo con las vistas pasadas desde el sector de diseo. Pude terminar todas las conexiones y link de los botones. \nPor ende empece a realizar las consultas de la BD para que muestre a los alumnos segn su curso y divisin. ','2019-09-27'),(2125,85,'Siguiendo la investigacion de transitores','Estamos aprendiendo aun el tema de uqe transitores con mas convenientes para el proyecto, es un tema amplio y estamos siguiendo recomendacion del profesor mestrovich.','2019-09-27'),(2126,76,'C# en Unity','Por comando de uno de los profesores, empece a ver el lenguaje de programacin C# en la plataforma de desarrollo en tiempo real de Unity, entrando a la pagina de la misma y leyendo su contenido terico y viendo los tutoriales de la misma. Dentro del rea no se realizo nada, se estuvo presente en caso de que otra rea necesitase ayuda con la misma.','2019-09-27'),(2127,37,'Investigacin Ajax jquery mapeo en html','Estoy investigando cmo hacer para almacenar las coordenadas obtenidas de los marker del mapa en la base de datos. Busqu distintas alternativas, pero todo indica que hay que hacerlo utilizando Ajax y jquery, por lo que estoy investigando sobre stos.','2019-09-27'),(2128,80,'27-09','la clase de hoy continu con lo de las ultimas clases, me costo ya q hay partes q no tengo la foto de la vista actual, pero esta encaminado','2019-09-27'),(2129,46,'lo mismo de ayer','hoy hice lo mismo que todos los das, salimos temprano porque no tenamos mucho trabajo ','2019-09-27'),(2130,79,'Completando el presupuesto DEA','Hoy al empezar el da me notificaron que el profesor Puma quera hablar de algo as que fui a buscarlo, me dijo que quera que le entregara la lista de componentes, entonces me dedique el resto de la clase a terminar la lista para entregrsela','2019-09-27'),(2131,82,'investigacin  ','El da de hoy continuamos con la vista de agregar alumnos pero me como no se mucho de PHP estuve investigando en google y viendo videos de YouTube para poder resolver los problemas que tenemos como con la trasparencia del formulario en la cual mi compaero estuvo investigando y yo me ocup de los cambios de la vista de notas  y como el lder no vino no pude preguntar que tena que hacer con la vista de notas aunque pregunte al grupo de base de datos y me dio informacin con la que pude saber ms de que hay que hacer en la vista de notas. ','2019-09-27'),(2132,49,'Actas ','En el da de hoy seguimos con el control de actas.','2019-09-30'),(2133,54,'Control de actas','En el da de la fecha continuamos con el control de actas comunes ','2019-09-30'),(2134,43,'Ms vdeos','Hoy, al igual que el otro da estuve viendo vdeos para informarme de cmo es la app que voy a utilizar para el diseo de las vistas que voy a hacer. Hoy ms que nada estuve viendo el &quot;Sistema de Rejillas o Columnas&quot;.','2019-10-01'),(2135,38,'01/10/19','En esta clase  me encargu de informarme sobre FDP mediante tutoriales, textos para luego poder usarlos como documentos digitales de los alumnos por ejemplo poder visualizar los datos completos de algun alumno en especial.','2019-10-01'),(2136,64,'Listo!','En el da de la fecha estuve realizado con mis compaeros de rea las charlas correspondientes con cada lder de rea, para explicarle el funcionamiento del github, de como abrir y descargar sus archivos, como organizarlos y las otras funciones correspondientes que deben hacer en la plataforma. \nTambin est sean unas de la ltima clase que este en el rea de Infraestructura ya que terminamos todo lo que tenamos que hacer.\n','2019-10-01'),(2137,69,'backup','seguimos intentando hacer el backup con php y todavia no logramos hacer que funcione, hubo un problema con la base de datos porque no funcionaba el delete en la tabla alumnos.','2019-10-01'),(2138,72,'Clase 37, Final','La clase de hoy probablemente sea la ultima de las seccin, as que le explicamos cosas a los dems chicos de las secciones ambiguas a la nuestra como funcionaban ciertas cosas. y creo que desde que empece todo, aprend un montn de cosas por mi cuenta y siento que eso me va a servir un montn para mi futuro.','2019-10-01'),(2139,66,'Clase treinta y siete','Hoy segu adaptando el cdigo a la base de datos mas actualizada la cual presenta algunos errores pero se ya se les informo al equipo de base de datos para que los solucionen. Cambien se nos informo que ya podremos unir cdigo y vistas.','2019-10-01'),(2140,65,'Aprendizaje Materialize ','En el da de la fecha se me otorgo la tarea de seguir aprendiendo a manejar la herramienta de trabajo Materialize, esto lo hice continuando la serie de videos tutoriales que empec la semana pasada. ','2019-10-01'),(2141,73,'Materialize CSS','En el dia de hoy estuvimos trabajando con materialize modificando las vistas, a mi me toco hacer la parte de definir materias previas, que se basa en las materias previas que tiene el colegio. y todos sus datos.','2019-10-01'),(2142,63,'Trigsima sptima clase','Hoy trabaje un poco con Chipana acerca de la adaptacin del cdigo a la nueva base de datos.\nTambin los de infraestructura me explicaron como subir archivos a GitHub y opte por hacer un word con los pasos para que los dems integrantes del rea puedan implementarlo.','2019-10-01'),(2143,70,'Notas y horas necesarias a confirmar, perdida de archivos.','En la clase de hoy se nos inform que las notas finales ya se pasaron a los boletines, tambien, se nos dijo que las horas necesarias para este trimestre y el ao en general se reevaluarian y ultimamente se bajarian, ya que aunque toda la clase tuviese asistencia perfecta, apenas se llegaria al 216 anual. En cuanto a la verificacin de datos, perd los archivos cuando saqu el pendrive sin guardarlos, los rehar en mi casa ya que esta es la ultima clase que tendremos hasta el 22, ya que maana no hay y despus tendremos 2 semanas de vacaciones por viaje de egresados.','2019-10-01'),(2144,67,'Backup Automatico y php','El dia de hoy el profe nos dijo que lo del backup automatico tenia que ser con mysql y php entonces estamos investigando devuelta ','2019-10-01'),(2145,86,'Manual de usuario y ultimo dia de clases antes de las vacaciones.','En el dia de hoy empeze bremenete con los cuarenta minutos de clases a hacer el manual de usuario de GitHub para nuestros compaeros de clase.','2019-10-01'),(2146,71,'backup','continuamos averiguando lo del backup por php para la base de datos y hicimos un ejempo que nos sali buscando, despues hubo un inconveniente con el delete en la base d datos intentamos corregirlo','2019-10-01'),(2147,47,'Segu con los enlaces','Hoy nos pasaron algunos de los nuevos estilos, as que empec a enlazarlos empezando con el login as que esa parte ya est. Tambin el sector de infraestructura nos pas el server de GIT as que vamos a tener que pasar todos los archivos ah para tener as ms fcil el acceso a los archivos.','2019-10-01'),(2148,52,'diseo','hoy me asignaron como lder de rea y empece a cambiar la pagina y modificando la con materialize y creando nuevas vistas para desarrollo','2019-10-01'),(2149,57,'Continuando con el enlazamiento','En el da de la fecha nos pasaron nuevos estilos, por lo que el enlazamiento con el login ya est hecho. ','2019-10-01'),(2150,68,'Finalizacin de la parte grfica de la vista Mi Dia y comienzo de la parte funcional','Durante el da de hoy finalic el HTML y el CSS de la vista que haba comenzado la fecha pasada, basada en las capturas que se nos proporcionaron. Comenzamos con el lado funcional, utilizando JSON para crear datos y Ajax, junto con edicin de elementos desde el DOM para introducirlos en la vista.','2019-10-01'),(2151,87,'Vista y ajax','En el da de hoy terminamos con la vista que habamos empezado el martes pasado y para poder probarlo, hicimos un archivo json para poder mostrar datos con ajax.Tuve un problema y no funcionaba pero era porque me confund y puse &quot;value&quot; en vez de innerHTML para poder modificar el html.','2019-10-01'),(2152,54,'Control de actas','Hoy continuamos con el control de actas comunes. El dia de la fecha me dedique mas a actas de defuncin ','2019-10-01'),(2153,49,'Actas ','En el da se la fecha continuamos con el control de calidad de las actas comunes, aprobando o rechazando las distintas solicitudes de las actas','2019-10-01'),(2154,49,'Actas','En el da de hoy seguimos aprobando actas y rechazando','2019-10-02'),(2155,54,'Control de actas','En el da de hoy continuamos con el control de calidad de actas comunes','2019-10-02'),(2156,45,'Finalizada la actividad','Hoy logre finalizar y corregir la actividad donde tena que agregar 2 nuevos botones a todas la tablas y cambiarle el nombre al tercer botn.','2019-10-03'),(2157,60,'Servidor VoIP','En el dia de hoy despues de varios retrasos se pudo completar un 60% del servidor VoIP de telefonia. faltaria crear una cuenta en el bowser de la aplicacion (FreePBX) para poder acceder como administrador y controlar los telefonos.','2019-10-03'),(2158,58,'Pagina de inicio completada','Hoy jueves termine la pagina de inicio del trabajo ya que me quedaban cosas que completar y mejorar el diseo de la pagina que me pidio que haga el jefe, lo hice mejore los botones les puse un tamao de letra mejor, tambien le cambie la fuente y el diseo, despues mejore el diseo de pagina, luego de hacer todo eso, le ensee al jefe y me dijo que estaba bien y que se lo pasara ya que estaba terminada y la pone en la carpeta.','2019-10-03'),(2159,77,'Avances varios','El da de la fecha se agrego una herramienta de calculo de promedio a la aplicacin prototipo, en la cual tendremos ya 2 vistas realizadas. Tambin se comenz con el diseo de un par de vistas a futuro desarrollo. ','2019-10-03'),(2160,74,'terminando definitivamente','el da de hoy ayude a mis compaeros, dicindoles como quera la vista, ahora me puse a hacer el header, para seguir conectando vistas, me sente un rato  a ayudar a cada uno, tambien estamos haciendo vistas ya para que el quede definitivo, sin ningun cambio','2019-10-03'),(2161,36,'uniendo la pagina de asistencia con los otros','juntando todas las paginas para ir finalizando','2019-10-03'),(2162,44,'Uniendo el trabajo','Dedicamos esta clase a unir las distintas partes de la pagina para finalizar el trabajo','2019-10-03'),(2163,82,'Finalizacin de la vista de agregar alumno','Hoy nos dimos cuenta, cuando abrimos el proyecto que no estaba al parecer no hicimos la copia desde el xampp. Por lo que tuvimos que volver hacer la vista de agregar alumnos,  pudimos hacer lo rpido pero tuvimos problemas aun que se resolvieron rpidamente y con lo que investigamos la clase pasada pudimos hacer la trasparencia del formulario y el diseo de los botones. Mientras mi compaero hacia la transparencia yo estaba ayudando a un compaero con su vista. Cuando volv contina con los botones y modificar la informacin del formulario. Se lo mostramos al lder y dijo que estaba bien por lo que quisimos continuar con la vista de notas pero nos dijo que ya estaba hecho que lo hizo el grupo de desarrollo. Dijo que la clase que vine nos dar un nuevo trabajo para hacer.','2019-10-03'),(2164,76,'Unity, Primeros Pasos','Instal el Unity y comenc a adaptarme al entorno del mismo. Lo bsico, agregar objetos de diferentes formatos y agregarles opciones y configuraciones va cdigo C# en Visual Basic. Se logro crear una esfera la cual al tocar distintas teclas cambiaba de color, se intento tambin, sin xito, agregar una luz que alumbrase la esfera.','2019-10-03'),(2165,75,'Etapas finales III','En esta clase se termino de unificar todo el condigo. Solo faltan algunos detalles. ','2019-10-03'),(2166,51,'completo','en la clase de hoy coloqu todos los &quot;trigger&quot; q pienso que se pueden poner en la base de datos, complement la documentacin del proyecto y complement mi carpeta de campo','2019-10-03'),(2167,53,'Pasar codigo','Al encontrar un archivo se lo pasamos a nuestro compaero para verificar que sirva en el cdigo que estamos realizando','2019-10-03'),(2168,80,'Documentacion general','El da de hoy termine con la documentacin general del rea de Diseo, ped las partes de la pagina que funcionan y sacando imgenes y usando flechas logre juntar todo en un documento de World.','2019-10-03'),(2169,48,'Hoy finalizamos con la vista','Hoy empezamos teniendo problemas ya que nos dimos cuenta de que perdimos todo progreso de la clase anterior por no guardar asi que tuvimos que volver a rehacer las cosas pero fue mas rpido ya que sabiamos como hacerlo, yo volv a buscar los codigos de transparencia que habia realizado y los encontre rapido, lo unico que se me dificulto fue el implementar el trabajo en los cdigos actuales del trabajo pero luego de un tiempo y de prueba y error pude hacerlo el lider nos dio el ok y terminamos','2019-10-03'),(2170,85,'Trabajando con Unity','Estuve viendo un toque de unity para practicar paralas practicas externas\n','2019-10-03'),(2171,79,'Fritzing y DEA','Ya termine la lista de componentes y presupuesto as que me puse a trabajar en el esquema electrnico, iba a desarrollarlo en Eagle pero en mi bsqueda por otro programa encontr fritzing que ademas de ser gratuito como Eagle, es mucho mas intuitivo, tiene una comunidad mucho mas activa, tiene muchos mas componentes para Arduino por default y los que faltan (como en mi caso) la comunidad los hace. Entonces me puse a trabajar en este programa (que tambin me permite hacer el PCB y el cdigo). En el desarrollo de esta actividad me surgi una duda con respecto a al modulo de carga del tp4056. Entonces decid hablarlo con el profe Damian y segn lo que me dijo me pareci bien usar un multimetro para revisar la continuidad de los puertos. Entonces vi que el OUT- esta conectado al -  pero no a B- y que B+ esta conectado a +. Por ende voy a tener que cambiar unas cosas del esquema, voy a tener que agregar unos diodos y cambiar de rumbo unas pistas. Esto lo confirme al revisar el datasheet de el modulo del tp4056 (o mejor dicho del HW-107) ','2019-10-03'),(2172,41,'Registro civil control de actas','En el da de hoy estuvimos realizando los controles de calidad de nacimiento verificando los nombres y apellidos y tambin los sellos si coinciden.','2019-10-03'),(2173,40,'Actas comunes','En el dia de la fecha realizamos alrededor de 300 solicitudes de nacimiento, matrimonio y defuncin.\nAdems las solicitudes que tuvieron error las derivamos a bsqueda digital.','2019-10-03'),(2174,37,'App solidaria','En el da de hoy encontr una nueva alternativa para la funcin de guardado de coordenadas que precisa la aplicacin que estamos desarrollando. Investigu a fondo ste nuevo cdigo para averiguar qu partes del mismo poda utilizar para mi fin, y cmo es que funciona este nuevo mtodo.','2019-10-03'),(2175,46,'Lo mismo de siempre','Hoy hice lo mismo que rodos los jueves y viernes solo que tube un pequeo &quot;problema&quot;, apague la compu sin querer y perdi algunos recortes q saque para la carpeta de campo, ademas de eso no paso nada importante','2019-10-03'),(2176,40,'Control de actas comunes','En el dia de hoy continuamos haciendo control de calidad en actas comunes verificando los datos de partidas de nacimiento.','2019-10-04'),(2177,41,'Registro civil control de actas','En el dia de hoy estuvimos realizando los controles de actas de nacimiento matrimonio y defuncin Y verificando si los sellos y los parentesco coinciden','2019-10-04'),(2178,46,'Lo de todos los viernes','Todo como siempre nada nuevo, solo que use otro usuario :v','2019-10-04'),(2179,54,'Control de actas','Continuacin de la tarea de control de actas comunes ','2019-10-21'),(2180,49,'Actas ','En el da de hoy seguimos controlando las actas de nacimiento, matrimonio y defuncin','2019-10-21'),(2181,49,'Actas ','En el da de la fecha seguimos aprobando y rechazando actas ','2019-10-22'),(2182,54,'Control de actas','En el da de la fecha continu con el control de actas realizando unas aproximadas 80 actas','2019-10-22'),(2183,72,'Clase 31, terminacin','La clase de hoy hice los retoques finales a la carpeta de campo.\n','2019-10-22'),(2184,43,'Vistas','Hoy estuve viendo un par de vistas de mis compaeros para saber cmo lo hacan. Tambin estuve probando Materialize para comprobar qu haca y sus beneficios. Siendo sincero, estuvo interesante hacerlo, formando una experiencia nueva de una aplicacin que ni conoca, es ms, es medio difcil acostumbrarse an.','2019-10-22'),(2185,64,'Verificacin de Datos.','En el da de la fecha se retom del receso escolar que se nos dio por el viaje de egresados, a las tareas designadas de cada uno, para el grupo de infrae