dores que encontr de 5v son un poco caros y no sabia si debera usar transformadores de 9v, ya que con estos es mas usual tener el amperaje que necesito. Me dijo que busque transformadores switches, y buscando si encontre fuentes de alimentacion a precio aceptable y con un amperaje bueno, quiza no justo el que necesito pero mucho mas aceptable','2019-10-24'),(2233,46,'Lo de todos los jueves','Hoy use la cuenta de santino (hubo problemas con las cuentas porque no estaban disponibles) y trabaje como normalmente lo ago','2019-10-24'),(2234,55,'6to da de practicas externas','En el da de hoy tuve que ponerme al corriente ya que las ultimas dos clases antes del receso tuve que faltar por temas de salud, afortunadamente no tuve ningn inconveniente durante todo el da ya que continu realizando la misma actividad que venia haciendo antes buscar datos topogrficos de defunciones para posteriormente buscarlo en el libro fsico.  ','2019-10-24'),(2235,56,'Control de actas comunes - nacimientos','Hoy hicimos el mismo trabajo que vemimos haciendo, controlando los regiatros de las actas de nacimiento. Empezamos con 400 registros masomenos y pudimos llegar a 0 registros pendientes al finalizar nuestra jornada.','2019-10-24'),(2236,76,'Aprendizaje en Unity','Se sigui estudiando C# en Unity, integrndose y adaptndose en la interfaz del mismo, viendo los tutoriales que la misma pagina otorga e intentando imitarlos en mi propio trabajo.\nRefirindose al rea de base de datos, no se realizo ningn cambio, faltando revisar la documentacin,','2019-10-25'),(2237,80,'','El da de hoy fue mi primer da despus de el receso del dos semanas para los egresados, termine de hacer la documentacin general despus de recopilar la informacin que me dieron mis compaeros de equipo.','2019-10-25'),(2238,48,'El dia de hoy cooregimos la vista de agregar alumno','Hoy comenzamos a corregir dichas cosas que nos mando el lder en foto de los errores que haban en nuestra pagina, con mi compaera nos dedicamos a corregir la 