o como mostrar los datos de la base de datos en un pdf. Encontr distintas formas, pero no logro hacer que funcionen.','2019-10-29'),(2266,63,'Cuadragsima clase','Hoy estuvimos haciendo los controladores, el modelo y la vista para mostrar la informacin de los tutores de los alumnos.','2019-10-29'),(2267,65,'Botones','En el da de la fecha estuve viendo cmo mejorar la pgina en el aspecto visual y funcional, lo que hice hoy fue ver si poda agregar botones en la vista de Inscripciones alumnos, pero no llegue a completar la tarea, por ende la continuare la clase que sigue.','2019-10-29'),(2268,39,'INSCRIPCION DE ALUMNOS(TABLA)','Modifique la tabla de inscripcion de alumnos.','2019-10-29'),(2269,52,'Diseo','el dia de la fecha asigne a los chicos del area de diseo a que empiecen a realizar las actividades de las vistas con materialize ','2019-10-29'),(2270,57,'Investigacin ','Segu investigando como mostrar los datos de la base de datos en un pdf. Encontr distintas formas, pero no logro hacer que funcionen.','2019-10-29'),(2271,68,'Continuacin y finalizacin de la parte grfica de la vista de detalles','Aad unos pocos elementos ms de HTML y cree todo el CSS necesario para que la vista sea lo ms parecida posible a las que se nos mostraron.\nAn no tiene funcionalidad, pero ya tiene creados los estilos que correspondern a cada estado de tarea. sto, en un futuro, se mostrar dinmicamente dependiendo de los detalles de la tarea que se abra.','2019-10-29'),(2272,87,'Arreglando css','En el da de hoy estuve continuando con la vista de mi-perfil. Al hacerlo me di cuenta de un error que tena con los colores, estaba usando el cdigo hexadecimal directamente en vez de el nombre de las variables declaradas en otro archivo. Al cambiarlo, tuve que hacerlo tambin con vistas anteriores y haba mal un stylesheet, y el diseo de esa vista dejo de andar y tuve que hacerlo todo de vuelta. Finalic mi-perfil luego de arreglar todo.','2019-10-29'),(2273,49,'Actas','En el da de hoy seguimos aprobando y rechazando actas','2019-10-30'),(2274,54,'Control de actas','Hoy continuamos con el control de actas comunes principalmente partidas de nacimiento','2019-10-30'),(2275,66,'Clase cuarenta y dos','Hoy completamos todas las funciones que tenamos por hacer, registro de alumnos, editar, eliminar, mostrar informacin de los padres del alumno, Inscripcin IB y los permisos an se deben completar pero para ello debemos terminar las funciones de Becas y Previas. ','2019-10-30'),(2276,71,'backup','Hoy pudimos corregir el codigo y que todo ande correctamente , se descarga una copia  de archivo php con las tablas que selecciones en la pagina','2019-10-30'),(2277,47,'Avanzando con las actas digitales','El da de hoy encontr la forma de mostrar los datos de la base de datos en un pdf. As que avance con la vista de actas digitales. Hice agregar, editar, borrar y mostrar.','2019-10-30'),(2278,63,'Cuadragsima primer clase	','Hoy terminamos la parte de inscripcin de alumnos con todas las partes que le faltaban: ao, divisin, turno, especialidad, ib.','2019-10-30'),(2279,39,'Inscripcion de alumnos/ Alta, Baja y Modificacion','La tabla que muestra el listado de alumnos inscriptos funciona con normalidad, ahora solo queda poder agregar, quitar y modificar los datos de dicho alumno.','2019-10-30'),(2280,69,'backup','Logramos que funcione el backup, descarga las copias por tablas y si seleccionas todas las tablas descarga la copia con todas las tablas juntas. pero estamos buscando la forma que se descargue la base de datos completa o sin tener que seleccionar todas las tablas. ','2019-10-30'),(2281,70,'Autobackup completo, prox clase ','El autobackup en el que estuvimos trabajando las ultimas clases est terminado, funciona lo suficientemente bien y ya (supuestamente) para la proxima clase deberamos pasar a otra seccion','2019-10-30'),(2282,64,'Verificacin de Actividades y otras cosas...','En el da de la fecha termine el Manual de Usuario con la ayuda de uno de mis compaero de grupo, tambin se trat de agregarles algunos detalles al gant pero no fue posible porque el compaero que se dedica a eso no estuve presente en el da de la fecha, por eso la clase que viene sin falta, le comento que hay que agregarle algunas cosas al gant, y hoy puede que si se haga efectivo el cambio de seccin ya que no tenemos ms tareas para realizar en el rea de Infraestructura. Tambin a ltimo momento como de costumbre se nos comunic que hay que agregarle al manual de usuario la herramienta de Webmin que configura sistemas accesibles va web para sistemas Unix, como GNU/Linux y OpenSolaris.\nPor temas de horarios no pude empezar a realizar la tarea que se me asigno, asi que la empezare a hacer la prxima clase. \n','2019-10-30'),(2283,65,'Mejora de la vista','En el da de hoy contine con el proceso de mejora de la vista Inscripciones alumnos, logre agregar unos botones expandibles que muestran las tablas de alumnos. ','2019-10-30'),(2284,52,'Diseo','hoy realizamos las vistas de inscripcin de alumnos, de registro de materias por alumnos para el ciclo bsico y el ingreso de datos para el diseo ','2019-10-30'),(2285,57,'Avance: actas digitales','En el da de la fecha se cumpli el objetivo de encontrar la manera de mostrar los datos de la base de datos en un pdf. Se pudo avanzar con la lista de actas digitales. Hicimos agregar, editar, borrar y mostrar. Adems se modific la tabla de actasdigitales que funcione con normalidad.','2019-10-30'),(2286,86,'Trabajos','Carpeta de campo, Gantt, charlas de auditorias, notas','2019-10-30'),(2287,38,'30/10/2019','En el da de hoy aprend formas para insertar imagen en un pdf con php y fpdf. Mediante varios tutoriales o posts consegu una lnea de cdigo la cual me permite insertar diferente tipos de imgenes, ya sean guardadas en el equipo como links inteligentes.','2019-10-30'),(2288,40,'Actas comunes','En el dia de la fecha continuamos realizando solicitudes de partidas de nacimiento, matrimonio y defuncin en el apartado de control de actas comunes, realizamos alrededor de 300 solicitudes y nos encontramos con un numero inusual de solicitudes con error de datos.','2019-10-31'),(2289,46,'pasantias externas','hoy hice lo de siempre, no tuve ninguna dificultad tcnica y record q el viernes pasado no sub mi bitcora.\ntodo en orden, use la cuenta de claudia ','2019-10-31'),(2290,56,'Control de actas comunes','realizamos las mismas actividades sin cambios. ','2019-10-31'),(2291,41,'practicas externas registros civil','En el da de hoy llegamos nos registramos firmando despus nos dieron la cuenta para seguir con los controles de acta comunes verificando si coinciden los nombres y apellidos y si se encuentran los correspondientes sellos en el caso de que concuerden se lo aprobar  en el caso de que estn mal los datos se lo rechazara y si los datos no estn muy claros o no se logran entender se los pondr en pendiente y los tutores se encargaran del archivo.','2019-10-31'),(2292,55,'8 da de Practicas Externas','Hoy si bien realice una actividad diferente, no fue otra que imprimir vouchers, como e echo en otras ocasiones como por ejemplo en mi primer da. La diferencia fue que esta vez logre realizar la impresin de todos los vouchers que me asignaron aunque e de decir que eran menos a comparacin de las anteriores ocasiones.','2019-10-31'),(2293,45,'Encuestas del gobierno y debate en clase','Hoy nos presentaron una encuesta del gobierno de la ciudad el cual nos dice cual fue nuestra experiencia en prcticas profesionalizantes mas tarde realizamos un debate general de las observaciones pros y contras del proyecto realizado.','2019-10-31'),(2294,53,'Testeando la pagina','Entramos a la pagina que hizo el otro grupo para probarla  y opinar de la misma','2019-10-31'),(2295,75,'Verificacin de funcionamiento','En esta clase al comenzar contestamos algunas preguntas acerca de PP.\nDespus se comparti el proyecto para que los dems grupos lo probasen para verificar su funcionamiento. Por consecuencia surgieron algunos items a corregir. Adems tambin pudimos recopilar informacin con Miguel Balmaceda para que nos de algunas pautas para corregir y/o mejorar.\n\nGracias a esta entrevista pudimos corregir algunas cosas a nuestro proyecto. ','2019-10-31'),(2296,48,'Analisis de trabajo','Hoy al empezar la clase realizamos un formulario sobre las practicas profesionalizantes, nos llevo poco tiempo asi que despues de eso nos dijeron que hicieramos una revision general del software de la pagina del trabajo terminado,habia que encontrar errores asi que luego de eso nos reunimos en el medio de la mesa a hablar sobre los errores de la pagina,nuevas mejoras etc','2019-10-31'),(2297,51,'Testeo','En el dia de hoy, apenas llegamos al curso el profesor nos dijo que hagamos una encuesta del gobierno, pasado eso testeamos la pagina del colegio y sus vistas. Primero de manera individual buscamos cosas buenas, cosas malas y alguna observacin y luego nos juntamos todo el curso y expusimos nuestros puntos con respecto a la pagina y hablamos de alternativas para modificar para bien la pagina','2019-10-31'),(2298,58,'Debatimos el proyecto en clase y realizamos una encuesta ','Hoy el profesor olaso nos dijo que realicemos una encuesta del gobierno sobre la experiencia que tuvimos en practicas profesionalizantes, despus el lder me dio un pequeo trabajo que trataba de corregir una vista , luego el profesor nos paso un prototipo del proyecto y tuvimos que buscar ventajas y desventajas y que errores corregir mas tarde nos reunimos en la mesa del medio y debatimos sobre el proyecto en general e hicimos una lista que de mejorar','2019-10-31'),(2299,80,'Arreglos ','el dia de hoy lo ayude a mi jefe de diseo con la mejora de los botones de la pagina principal, con ideas en cuanto a la esttica y funcionamiento.\nEl problema principal que aun no pudimos solucionar es que la lista de los botones de las especialidades (1 ao - 2 y 3) tapan el botn de la especialidad.\nCambiamos parte de los estilos de esta vista, agregamos efectos de materialize.\ntambin tuvimos una reunin para enumerar los defectos de la pagina, y encontramos muchos. \n\n','2019-10-31'),(2300,74,'mostrando diseo al usuario ','en este da segu mordicando los estilos para que sea ms claro, tambin le presentamos la pagina oficial al usuario, le gusto aunque hay q cambiar un par de cosas ciclo bsico contiene primer y segundo ao y de ah en adelante es la especialidad.\nel docente nos dio un pequeo formulario para poner nuestra opinin sobre la materia de PP, que nos pareca, que aprendimos, y q aplicamos de lo que vimos en los anteriores viajes al CMD. \ncada da vamos avanzando lo que tengo planeado es que maana en el primer recreo entregarle un diseo totalmente definitivo, sin tener ningun cambio en el objetivo mas adelante vamos a utilizar el formato de desarrollo para poner los cambios porque desarrollo tomo una versin antigua del diseo.  ','2019-10-31'),(2301,82,'debate sobre el proyecto ','El da de hoy el profe nos envos un formulario para llenar el cual trataba de reflexionar sobre las prcticas profesionalizaste despus nos dio un proyecto el cual hicimos segn yo fue hecho en diseo. Nos dijo que lo revisaremos y documentemos los errores que tienen y lo bueno. En la vista de asistencia la presencia deca capo y non queda bien deba decir tarde  y tambin los nombre y apellidos decan cual adquiere cosa. Los cambies hechos en la vista agregar no quedaron bien pues las palabras no se vea bien. En la vista dicha de alumnos estaba bien pero le faltaba ms diseo era muy simple , vista agregar no se poda escribir el nombre del alumno \nAl termina  de analizar , empezamos a debatir en el cual todos dijeron todos los defectos que tena el proyecto  por lo que tendremos que modificar muchas cosas.\n','2019-10-31'),(2302,60,'Servidor VoIP','Se continuo con la creacin del servidor VoIP, el cual tuvo algunos retrasos por problemas en algunas PC, Luego de eso prosegui en otra PC con la cual realice la configuracin del Administrador en la plataforma que te provee FreePBX (Donde configuramos y activamos la cuenta del administrador), por problemas con el servidor (Lo apagaron) tuve que posponer la continuidad de la configuracion para maana.','2019-10-31'),(2303,37,'Formulario, checkbox, testeo de la pgina.','Al llegar a la clase nos facilitaron un Google form, el cul deba ser completado en mayor parte con nuestra experiencia con las Prcticas Profesionalizantes.\nLuego solucion un problema con los checkbox, que se podan seleccionar los 2 juntos, es decir, al seleccionar uno no se des-seleccionaba el otro, y esa no era la idea. Investigu cmo hacer para corregir esto y termin cambiando los checkbox por radio, con la diferencia de que stos no generaban una &quot;tlde&quot; al seleccionar la opcin deseada.\nTesteamos el proyecto grupal que venimos desarrollando todo el ao con el fin de detectar posibles errores y/o beneficios en el mismo, para luego compartirlos con el resto de nosotros, y llegar a alguna conclusin.\nEn lo que qued de hora investigu sobre cmo guardar las coordenadas de los marker en la base de datos.','2019-10-31'),(2304,42,'Testing, revision del proyecto','Al principio del dia, estuve probando la pagina y luego hicimos una revision den grupo, para tener tanto las cosas buenas como las malas y asi poder llegar a una conclusion y terminar de armar la pagina, para poder llegar a la version final','2019-10-31'),(2305,76,'Devolucin del Usuario y Autocritica','Comenc intentando continuar con Unity pero me vi interrumpido por razones del proyecto. Vimos la pagina terminada y las testeamos escribiendo todos los errores que encontrbamos para luego hacer una puesta en debate y mejorarlos. Luego fueron dos alumnos para presentar el proyecto y hubo una devolucin positiva de parte del usuario. Habra que realizar cambios para mejorar y acomodar la pagina al usuario, y mejorar la comunicacin entre grupos de trabajo.','2019-10-31'),(2306,77,'Correccin de errores y charla sobre el proyecto en el que estuvieron trabajando','El da de la fecha se lograron arreglar errores de la vista desarrollada la anterior vez. Tambin se evalu el proyecto de preceptora de en una charla grupal, anotando puntos positivos y puntos a mejorar.','2019-10-31'),(2307,79,'Diagrama DEA ','Hoy estuve trabajando con el diagrama PCB del DEA principalmente, estuve entendiendo como funciona el programa. Le pregunte al profesor Olaso cual era el significado de determinadas lineas en programa, el me explico. Tambin me dijo que ponga el programa en capa simple, ya que puedo hacer que el PCB sea de doble capa, pero no va ser nuestro caso. Despus le consulte a profesor Consorti sobre el diagrama por una duda que tenia, resulta que, al momento de que las celdas de litio alimentan el circuito, se pude llegar a pasar un poco el voltaje de las bateras a el modulo TP4056. Por ende es probable que haya que agregar unos transistores a los B- de las bateras. Ademas de agregar otro al GND de el TP4056. Tambien investigue un poco del modulo, para ver si habia problemas.','2019-10-31'),(2308,68,'Arreglo de la vista detalles, creacin de la vista registrar, comienzo del footer','Repar un error de centrado en la vista de detalles, comenc y finalic la parte grfica de la vista de registrar, y comenc el footer. Para finalizarlo, solo falta arreglar un problema con el css.','2019-10-31'),(2309,85,'Analisis pagina proyecto 2','segui analizando la pagina y haciendo comentarios con todo el grupo\n','2019-10-31'),(2310,87,'Login, header y menu','En el da de hoy estuve haciendo la parte grfica del login, el header y comenc el men, pero por unos inconvenientes con unos botones en la hoja de estilo no pude terminarlo. A mitad hecho el men, me d cuenta que el men tiene que estar en el mismo archivo que el header asi que cuando termino la parte grfica lo tengo que pasar. ','2019-10-31'),(2311,60,'Servidor VoIP 2','Se comenz con la creacin de exenciones y su respectiva configuracin para lograr hacer llamadas entre telfonos IP, por problemas con los telfonos, 