e toda la informacin y segu adaptndome a la interfaz de Unity y al lenguaje C#, a su vez vi pequeos ejemplos de lo que deber hacer, como deca el mismo documento, asi no encuentro sorpresas al momento de estar en la practica.','2019-11-01'),(2326,36,'consultando la base de datos','consultamos con el grupo de base de datos para las faltas y reincorporaciones para que hagan un trigger contando las faltas. y nos dieron consejos para mejorar la pagina\n','2019-11-01'),(2327,41,'Prcticas externas registro civil','En el da de hoy nos dieron la cuenta para acceder a los  controles de acta comunes verificando los sellos y si coinciden los nombres y apellidos,  en el caso de que concuerden y los sellos estn correctente se lo aprobar,  en  el caso de que estn mal los datos se lo rechazara y se seleccionar el botn de error de datos y si los datos no estn muy claros o no se logran entender se los pondr en pendiente y los tutores se encargaran del archivo.','2019-11-01'),(2328,79,'Complicaciones con el sistema de alimentacion de celdas al circuito','Traje al colegio unos datasheet y diagramas para revisarlos con los profes porque estuve empezando a encontrar unos problemas. Con el profesor Olaso encontr varios problemas, para empezar (el de ayer) habra que encontrado un problema con los GND de las celdas hacia los mdulos, por lo tanto ah habra que agregar transistores, despus encontramos un problema con los capacitores, estos dejaran energa residual y pueden molestar. El principal problema que encontramos hoy es que, de la manera en que lo conectamos las bateras a los mdulos y los usamos uno de los componentes quedan inutilizado o lo quema, el DW01A y probablemente otra mas. La cuestin es que este componente es el que hace que la celda deje de enviar suministrar carga cuando llege a 2.7v o un valor cercano. Esto para que preservar la vida til de la batera. Es algo importante que debera funcionar, los dems problemas lo solucionamos (por lo menos en parte y en teora), pero el tema de hacer que paren de suministrar carga solo se me ocurrio solucionarlo con un zener que corte el suministro con un npn o pnp cuando el voltaje llegue a 2.x. El profesor Olaso me recomendo, hablar con Eduardo (un profesor del colegio que sabe mucho de electronica). Estos temas se los informe a Puma y le dije que le daria una nueva lista de componente, tengo que re disear el circuito tambien.','2019-11-01'),(2329,55,'9 da de Practicas Externas','Hoy al haber completado la tarea de ayer volv a buscar datos topogrficos de defunciones. Entre al programa ENGAGE 5 sin ningn inconveniente, ademas aprend a como iniciar los programas de bsqueda ya que hasta este momento siempre me lo daban preparado para usar. Tambin logre utilizar perfectamente el segundo programa de bsqueda, el programa que contiene las actas de defuncin desde 1978 hasta la actualidad, ya que el primero solo contiene desde 1896 hasta 1978.     ','2019-11-01'),(2330,40,'Control de actas comunes','En el da de hoy continuamos con el control de actas comunes, controlando que las partidas de nacimiento concuerden los datos con los mostrados digitalmente en pantalla, que estas tengan sello, firma y se encuentren en estado legible. Hoy realizamos al menos 250 solicitudes del mes de octubre al da de hoy','2019-11-01'),(2331,56,'Capacitacion de procesamiento de datos','Hoy tuvimos a la maana una capacitacion sobre data science y data analytics que nos dio un licenciado en estadisticas.\nprimero nos dieron una presentacion de arquitectura e infraestructura de datos  y despues una explicacion de data warehouse y data lakes.\ntuvimos un asesoramineto de SAS Visual analytics  Explorador y visualizador de datos para analiar tablas y relevamiento de reportes. Hicimos ejercicios de estadisticas con operadores numericos y alfabeticos, objetos: tablas, de lista y cruadas, y graficos. Tambien exploramos las distintas herramientas del sistema para probarlas.','2019-11-02'),(2332,49,'Actas ','En el da de la fecha seguimos con 