ec el ajax y el php para poder manejar los datos de la base de datos.','2019-11-05'),(2348,68,'Formulacin de la base de datos de la aplicacin, investigacin de uso de Ajax','Formul la base de datos que se utilizar en la aplicacin. sta consiste de tres tablas, referentes a usuarios, tareas, y estados de tarea. La informacin de qu campos utilizar fue tomada de las vistas de &quot;detalle de tarea&quot; y &quot;registro&quot;.\nHabiendo finalizado esto, comenc a investigar un poco el uso de Ajax para poder aplicarlo.','2019-11-05'),(2349,49,'Actas','En el da de hoy seguimos con el control de actas de nacimiento, defuncin y matrimonio','2019-11-06'),(2350,54,'Control de actas','En el da de la fecha continuamos con el control de actas comunes. Tuve algunas dudas con actas de matrimonio que fueron despejadas por empleados del registro civil ','2019-11-06'),(2351,64,'Testeo Vol.2','En el da de la fecha con mi compaero seguimos verificando la pgina que llevaron a cabo mis compaeros de Desarrollo, la diferencia con la de ayer que esta perteneca a otro grupo de trabajo de la rea ya mencionada, se pudieron observar los mismos errores o cosas peores a los que vimos la clase pasada, ya sea por cosas mal planteadas, por la mala conexin de ciertas vistas, problemas en los formularios, botn que no funcionan, y cosas que pueden llegar a afectar para mal el funcionamiento de la pgina y todos su complementos. Igual vale la pena resaltar que la versin que testeamos con mi compaero no es la final, sea que puede tener errores pero no de la magnitud que vimos. Se nos comunic mientras revisbamos la pgina que exista una versin ms avanzada de lo que estbamos revisando, y que estaba ms desarrollada en sentido del diseo, funcionamiento y contenido. ','2019-11-06'),(2352,71,'gantt y debate','Actualizamos el diagrama de gantt con lo ultimo que hicimos que fue el backup y debatimos toda la areas las pro y contras que tenia la pagina q nos paso desarrollo ya empezada','2019-11-06'),(2353,38,'06/11/19','En el dia de hoy realic diferentes tipos de archivos php para poder guardar el pdf creado en clases anteriores a una base de datos, para ello tambin hice una base de datos en mysql y por supuesto haciendo la conexin en php para que los archivos estn relacionados y no tenga ningn inconveniente al realizar el envio de datos. Esto es mas que nada para tener un control de los archivos guardados.','2019-11-06'),(2354,43,'Arreglar las vistas y el mejorar lo de desarrollo','Le pregunt a un compaero qu le pareca lo que haba hecho con la vista de &quot;Previas&quot;, a lo que l me respondi que le faltaba estar parejas. Entonces, yo luego lo correg, pero me faltaba algo ms, y era lo del DNI, as que sin ms le agregu un texto abajo que deca que ponga el nmero de su documentacin. Luego de ello, Nahuel nos cit a todos en el medio para hablar de qu podramos mejorar y sus errores de lo que haban hecho la gente de desarrollo, as que todos dieron su idea y algunos tardaron hasta bastante tiempo diciendo lo que vieron.','2019-11-06'),(2355,39,'discutimos sobre el desarrollo ','Quedamos en correguir varios de los errores que presentaba la aplicacion, quedan unas vistas por terminar y juntariamos todo para finalizar.\nContamos con dos clases mas para hacerlo.','2019-11-06'),(2356,70,'Encuesta, Aplicacin, Autobackup','En el da de hoy se me di como tarea hacer una encuesta sobre la experiencia general de PP, tanto la experiencia, como las actividades y dar algunas opiniones sobre que mejorar. La seccin de Desarrollo nos di una versin temprana de la aplicacin para probar y dar nuestras opiniones sobre ella, tanto sobre el diseo como sobre el funcionamiento, la aplicacin me pareci bastante funcional. El auto backup necesita un par de cosas para estar a la perfeccin, pero avanzamos bastante, solo falta que este guarde toda la base en vez de solo las tablas.','2019-11-06'),(2357,67,'Backup Automatico terminado y Debate sobre la pagina de desarrollo ','El dia de hoy se finalizo el backup 