erior proyecto no se podan ver por lo que el lder nos dio que modifiquemos  y agreguemos las imgenes y el mismo estilo. Estuvimos tratando de agregar las imgenes pero no se poda por lo que buscamos informacin  pero no podamos as que pedimos ayuda al profesor, estuvo intentado hacerlo pero al final nos dijo que tendramos que estudiar Codeigniter para poder diseccionar las imgenes por lo que tuvimos que ver vdeos pero an as no nos sali. Despus de mil intentos hablamos con el lder y nos dijo que continuaremos con lo estilos densas vistas ya que si no perdemos tiempo. Nos pusimos manos a la obra, lo hicimos y terminamos con todas las vistas. En cuanto a lo otro lo veremos','2019-11-07'),(2376,50,'Documentacin 4','Se continu con la labor de elaborar la documentacin correspondiente al departamento de desarrollo. ','2019-11-07'),(2377,68,'Arreglo de la base de datos y comienzo del backend de la vista main','Modifiqu la tabla \'usuario\', aadindo un campo \'id_usuario\' que es ahora el primary key (en lugar de \'documento\'). Modifiqu la tabla \'tarea\' de forma correspondiente.\nComenc la formulacin del backend, formulando una base con XMLHttp sobre la que avanzar ms en una fecha prxima.\nAyud a resolver algunos errores relacionados al funcionamiento del login.','2019-11-07'),(2378,75,'Carpeta de campo','En esta clase complete mi carpeta de campo. Y estoy a la espera de las nuevas vistas que me proporcionara el sector de diseo.','2019-11-07'),(2379,60,'Problemas con telefono IP','El da de hoy, se quedo estancado la continuidad del proyecto en cuestin por el echo de que hay que pagar una licencia para una interfaz de configuracin mas simple para el telfono, por falta de dinero no se puede comprar dicha licencia, o sea que hay que proceder con la configuracin manual del telfono. por problemas de modelo y transformador(El telfono que es de un modelo viejo el manual de usuario solo se encuentra en un idioma que no es ingles ni espaol y con el otro telfono cisco, hoy no pude verificar el modelo por el echo que no tenemos la llave para abrir el mueble donde esta guardado)por este problema no pude continuar.\n\nTambin hubo problemas con el apk y la aplicacin para hacer llamada desde un telfono y pc(Era necesario para el registro agregar un proveedor de servidor VoIP y como no contamos con uno se tuvo que descontinuar ese proceso).\n','2019-11-07'),(2380,80,'Doc','El da de hoy comenc a actualizar la documentacin de las vistas, como muchas de ellas aun no estn terminadas, no logre actualizarlo completamente, pero de todas formas logre hacer una parte.\n','2019-11-07'),(2381,51,'Modificaciones','en la clase de hoy lo que hice fue entrar en la base de datos y separar el registro &quot;reincorporaciones&quot; y hacerlo una tabla con su propio ID y luego  hice una trigger en la tabla &quot;asistencias_inasistencias&quot; para que vaya sumando a medida que pasa los dias las inasistencias','2019-11-07'),(2382,74,'Codeigniter','En el dia de hoy, empece a trabajar con la documentacion de desarrollo actualizando todos los archivos dandoles estilos. \nayude a mis comperos dos hacian , el diseo y los otros dos actualizaban el disao pasandolo a codeigniter. de esta manera vamos a avanzar mas rapido. estuve mejorando visualmente las vistas. LLA CONh@#&quot; DE sU MADRE EL TECLADO DE MIER$#&quot;DA ESTE ANDA PARA EL ORTO Y POR ESO PUSE POCO EN LA MALDITA BITACORA ATTE. LOS QUIERO MNUCHO HASTA LA PROXIMAAAAAAa','2019-11-07'),(2383,42,'Poco Mantenimiento','Me desplace por el aula en busca de ayudar a mis pares, debido a que mis tareas estan finalizadas. Estuve ayudando en otras areas y dando consejos ','2019-11-07'),(2384,76,'Poco Mantenimiento','En el da de la fecha, ya que mi rea termino con todo lo que deba hacer, se hizo una pequea revisin de lo que la misma abarca y se espero con predisposicin a cualquier duda de las dems reas. Aparte volvi a C# en Unity para terminar de ver las bsicas.','2019-11-07'),(2385,77,'Vistas y Avances en Android Studio','El da de hoy se enfoco el trabajo en realizar vistas del proyecto y ver vdeos sobre herramientas de Android Studio. Se realizaron 2 modificaciones a las vistas ya creadas y se comenz a trabajar en el menu de la aplicacin.','2019-11-07'),(2386,85,'Pequeos cambios en el codigo','estuve cambiando un poco el codigo acorde a los cambios medianamente definitivos que hicimos en la estructura del DEA ','2019-11-07'),(2387,85,'Pequeos cambios en el codigo','estuve cambiando un poco el codigo acorde a los cambios medianamente definitivos que hicimos en la estructura del DEA ','2019-11-07'),(2388,83,'07nov','Hoy se trabajo con las actas de nacimiento como diseador hace habitualmente. En mi caso no hubo errores todo fue muy tranquilo.\nHace mucho que no haca estas cosas pero ahora que volv no tuve problemas de adaptacin y eso es bueno. Adems tambin fui actualizando la carpeta ','2019-11-07'),(2389,87,'Ajax','En el da de hoy estuve tratando de seguir con el ajax para el login, pero como no me sali le pregunte a un compaero que trabaja ac, lo hice con l  y luego me explic bien como funciona.','2019-11-07'),(2390,79,'Investigando sobre BMS, ecualizadores y componentes','Hoy estuve investigando sobre BMS, ecualizadores, transistores, reguladores, etc. Mas que nada porque tuve problemas con los componente. Resulta que hable con el Prof. Puma y no pudo conseguir determinados componentes. Por eso me puse a investigar. Hable mucho con los profesores sobre ecualizadores, BMS y transistores con la idea de hacer uno propio con el arduino, cosa muy complicada y engorroza. As que dejamos de lado esa opcin. Encontr un ecualizador, pero no encontramos la manera de usarlo.','2019-11-07'),(2391,41,'Practicas externas registros civil','En el da de hoy accedimos a las cuentas del registro civil para seguir con los controles de actas comunes de los nacimientos, matrimonios y defunciones en el cual se acepta s coinciden los parentescos y si estn los sellos correctamente en el caso de que estn mal se los rechazara seleccionando el botn de error de datos y si no estamos seguro lo ponemos como pendiente.','2019-11-07'),(2392,40,'Control de actas comunes','En el dia de la fecha realizamos alrededor de 300 solicitudes de partidas de nacimiento, matrimonio y defuncin en el control de actas comunes','2019-11-07'),(2393,55,'10 da de Practicas Externas','En el da de hoy estuve haciendo, por peticin de mi tutor lucas, fotocopias de vouchers. No tuve ninguna complicacin al entrar al programa, ni en ningn momento del resto del da.','2019-11-07'),(2394,83,'08 de nov.','Empeze a trabajar a penas llegue, me dispuse a pedir la llave para abrir el lugar ya que no estaba la seora Claudia por eso me deriji al seor Pablo quien me podia ayudar. Comenze con la fecha del 10 de octubre en adelante porque habian ingresado mas actas de nacimiento que se debian ver, ahi me encontre con varias actas que eran correctas de las cuales solo debia ver un archivo por acta. Pero tambien habia casos en donde habia que revisar mas de un archivo por acta de las cuales una de esas era la correcta y correspondia con el titular y las otras no tenian nada que ver.\nMuy aparte tambien tuve unos leves problemas porque el usuario que usaba en este dia en un momento me dejo de funcionar porque alguien habia tomado el usuario que usaba asi que tuve que usar otro, luego de eso pude volver a retomar mi trabajo, que constaba de lo mismo.\nHubo tambien actas que tube que rechazar porque los datos no coincidian lo cual era una lastima pero los que estaban correctos eran archivados','2019-11-08'),(2395,40,'Control de actas comunes','En el da de hoy continuamos con el control de calidad de actas comunes verificando que las solicitudes de nacimiento, matrimonio y defuncin no contengan error de datos, marginales doblados o algn otro motivo para que deban ser rechazadas y ser enviadas a bsqueda digital.','2019-11-08'),(2396,46,'viernes','hoy empece con las partidas urgentes que en total eran 14, de entre esas 3 vinieron con mas de una imagen adjunta, una la deje pendiente porque tenia en el borde derecho cosas que confirmar de las que yo no se, en si  aprob 13 partidas urgentes. De las dems partidas extraamente tambin tuve varias que tenan mas de una imagen o como los casos raros que ninguna imagen concordaba con los datos del solicitante(que pasan muy poco o casi ni sucede), luego todo fue como siempre salvo que una ves la cuenta se cerro y la cargue de nuevo. \nvolv a usar la cuenta de Enrique ','2019-11-08'),(2397,56,'Control de actas comunes - Nacimientos','Hicimos control de 300 registros de partidas de nacimiento, aproximadamente. Revisamos todas las solicitudes urgentes y las completamos. Hoy, particularmente, hubo bastantes partidas que tuve que rechazar, ya que, tenan rectificados que no se encontraban adjuntos con la partida de nacimineto solicitada. ','2019-11-08'),(2398,41,'Prcticas externas registro civil','En el da de hoy estuve realizando los controles de actas comunes viendo si los datos de los archivos y los sellos estaban en correcto estado aceptando los si estn bien y rechazandolo si hay algn error de datos o falta de sellos y si no entendemos o estamos con duda sobre algn archivo lo seleccionamos cmo pendiente.','2019-11-08'),(2399,55,'11 da de Practicas Externas','Hoy realice como casi siempre la bsqueda de defunciones pero en determinado momento lucas tuvo que utilizar el perfil que me para trabajar (el cual es el suyo), pero por suerte se acercaba la hora de salida. \nAdemas saque las capturas correspondientes al da de hoy para la carpeta de campo con su respectiva actualizacin de la carpeta de campo.','2019-11-08'),(2400,49,'Actas','En el da de la fecha seguimos con el control de actas comunes.','2019-11-11'),(2401,54,'Control de actas','En el da de la fecha continuamos con el control de actas comunes normalmente','2019-11-11'),(2402,49,'Actas ','En el da de hoy seguimos controlando las actas de nacimiento','2019-11-12'),(2403,54,'Control de actas','En el da de la fecha seguimos con la tarea de control de actas con enfoque a partidas de nacimiento ','2019-11-12'),(2404,54,'Control de actas','En el da de la fecha seguimos con la tarea de control de actas con enfoque a partidas de nacimiento ','2019-11-12'),(2405,87,'Login','En el da de hoy termin el funcionamiento del login, se lo mostr a Pablo y encontr un error as que me ayud a arreglarlo. Luego agregu unos ltimos detalles para que se vean los errores.','2019-11-12'),(2406,66,'Clase cuarenta y cinco','Hoy tuvimos una charla con gente del banco Ita, por el tema de prcticas externas, y hablamos sobre que rea trabajaremos. Est decisin ser tomada en estos das. El proyecto al cual entramos es un juego mvil.','2019-11-12'),(2407,68,'Arreglo del funcionamiento del Login y parcial funcionamiento de Main','Ayud a optimizar el funcionamiento del Login, de forma que el usuario se guarde en localStorage, y comenc el funcionamiento de Main de forma que, a partir del usuario y contrasea guardados, muestre el nombre y documento del usuario.','2019-11-12'),(2408,85,'Charla con el equipo del ITAU','Estuvimos hablando con los chicos del ITAU sobre el proyecto a trabajar, tambien firmamos todas las legalidades. Concerdamos en que nos darian unos dias para decidir que parte del proyecto trabajar entre todos debido a la falta de tiempo. (esto una vez visto el juego y haber hablado un poco de las cosas a mejorar)','2019-11-12'),(2409,60,'Itau','El da de hoy algunos alumnos fuimos a nuestra primera practica externa en las oficinas del Banco Itau, ubicadas en puerto madero.\nEl da transcurri bien, hablamos bastante con los coordinadores que estaban ah, probamos el videojuego y hablamos sobre como sera el modo de pago y dems cosas.\nAcordamos que el da jueves 14/11 Le mandara un e-mail con el objetivo de la PP(Practica) que vamos a realizar para el banco, cuanto tiempo nos tomara y el da de la presentacin.','2019-11-13'),(2410,38,'13/11/2019','En el dia de hoy me pidieron que haga la carpeta de campo del sector en general, para ello descargue todas las carpetas de campo de mis compaeros para tener una vista completa de todos los temas vistos y ejercicios realizados ya que yo no estuve en el sector desde un principio.','2019-11-13'),(2411,69,'Carpeta de rea ','hoy tuvimos que hacer la carpeta del rea de base de datos que el profesor pidi, consta en poner todo lo que hicimos en nuestra rea en todo el ao, todas la tareas que hicimos, algo parecido que la carpeta de campo que nosotros hacemos todos los das.','2019-11-13'),(2412,70,'Carpeta de campo general de seccion.','En el da de hoy empezamos a hacer la carpeta de campo de seccin, esta ser basicamente una recopilacin y un resumen de todas las cosas que pasaron y hicimos en el ao, alumnos que se fueron y entraron, tareas completadas, etc. Mi PC se reinici despus  de 2 horas y perd parte del trabajo, pude recuperar la mayora, por ahora tengo 6 hojas pero estoy lejos de terminar y en total debemos tener alrededor de 20 hojas, lo que necesitamos como minimo para considerarla completa son 25-30 hojas, deberamos llegar sin problemas. Cabe destacar que hoy llegu tarde (14:50) por problemas de transporte.','2019-11-13'),(2413,64,'Manual General de Infraestructura','En el da de la fecha al grupo se nos asign hace un Manual General del rea de Infraestructura que contenga todo lo que hicimos a lo largo de todo el ao, con los chicos nos dividimos para que cada uno haga un trimestre as lo hacamos ms organizado, nos pedimos las carpetas mutuamente y nos pusimos en marchar para hacer esto y poder terminarlo hoy, a m me toc el Ultimo Trimestre, que no es tanto a comparacin a los trimestres anteriores, pero algo hicimos as que cuenta igual. \n\nPor ultimo en esta ocasin me toco a m ser el que hace las auditorias para los alumnos de martes y mircoles en secreto, sin que nadie lo sepa. En esta imagen esta todo lo que vi.','2019-11-13'),(2414,63,'Cuadragsima cuarta clase','Hoy trabaje en conjunto con Mareco y Albornoz, con Mareco finalizamos el diagrama de gantt mientras que guiaba a Albornoz con la realizacin de la primera mitad de la carpeta general del rea.','2019-11-13'),(2415,52,'Diseo','termine todas las vistas de diseo y me puse a ayudar a desarrollo para el la terminacin del proyecto','2019-11-13'),(2416,86,'Carpeta de campo, segundo trimestre.','Hoy hice la carpeta de campo, ayudar a leandro con index.html, firezilla ','2019-11-13'),(2417,65,'Diagrama de Gantt','En el da de la fecha se me dio la tarea de actualizar, mejorar y finalizar el diagrama de Gantt del rea de diseo, para esto tuve que juntar algunas de las mejores carpetas de campos del rea para as tener una idea clara de lo que se haba hecho durante el ao. ','2019-11-13'),(2418,47,'Empezando a unir el diseo con el funcionamiento.','En el da de la fecha, el sector de diseo, nos pas las vistas finales, as que pudimos empezar a unir los archivos. En el trayecto de este trabajo hubieron muchos errores, algunos los pudimos solucionar, pero otros no. ','2019-11-13'),(2419,72,'Clase 44, da de soluciones.','La clase de hoy fue la mas productiva del ao ya que todo los problemas que nos venan persiguiendo durante el mismo fueron solucionados hoy, el servidor esta funcional y solo hay que espera que terminen las dems secciones. Ademas realizamos la carpeta de campo.','2019-11-13'),(2420,66,'Clase cuarenta y seis','Hoy realice las actividades correspondientes de auditor. Tambin estuve viendo junto a Leandro de infraestructura el tema de poder subir los archivos a los servidores. Pudimos hacer que funcione el logn recin. Y ahora estaremos tratando de hacer funcionar los dems controladores.','2019-11-13'),(2421,43,'Diseo Carpeta de Campo','Hoy primero le mostr al vista al supervisor de mi grupo, me coment que estaba bien y me dijo otra cosa que me faltaba. Aunque me otorg otro trabajo, y era hacer la carpeta de campo de nuestra rea, yo acept y me dijo cmo era la cosa, qu tena que agregar y eso. Yo luego de un rato, comenc un nuevo World y puse toda la informacin posible junto con imgenes de muestra, para que se entienda mucho mejor. Al final, lo termin bastante cansado porque literalmente hice nueve pginas, as que le mostr y me dijo que estaba bien, procediendo a poner el Pendrive y guardando el World all.','2019-11-13'),(2422,71,'carpeta del area','Arrancamos viendo el tema del backup para que descargara la base de datos completa, despues empezamos hacer la carpeta de nuestra area, con tooodo lo hecho este ao','2019-11-13'),(2423,57,'Concatenar el diseo con el funcionamiento y realizacin de carpeta de campo y diagrama de gantt','Hoy se uni el diseo con todo el funcionamiento y tambin se realiz la carpeta de campo general del sector y el diagrama de gantt','2019-11-13'),(2424,54,'Control de actas','Hoy continuamos con el control de actas comunes sin dificultades ni dudas','2019-11-13'),(2425,49,'Actas ','En el da de hoy continuamos con el control de actas comunes ','2019-11-13'),(2426,55,'Da N12 de Practicas Externas','Hoy ademas de encomendarme buscar defunciones me dieron una fecha especifica de solicitud, siendo estas del 3/11/19 deba realizar la bsqueda de las defunciones que me aparecieran en adelante.\nAdemas de mi tarea principal realice las capturas correspondientes al da de hoy.','2019-11-14'),(2427,36,'agregando faltas ','esperando a que me den completo el trigger de faltas y le doy consejo','2019-11-14'),(2428,82,'codeigniter y baner','El da de hoy estuve investigando codeigniter para poder mostrar las vistas de proyecto en el nuevo trabajo mejora ya que  cuando se modific algunas cosas no se pudieron modificar las cuales son imgenes y logos pe las vistas por lo que segu  investigando codeigniter para poder hacer el vnculo con las imgenes pero no se pudo por lo que haremos otra cosa. Tambin ayude a un compaero en quitar el baner de todas las vistas que tenemos y se pudo hacer y terminamos con eso.','2019-11-14'),(2429,44,'Agregamos las faltas al codigo.','Esperando el trigger de faltas para complementar el codigo y hacer que funcione una vez que este junto. Tambien recomendamos algunas cosas de la base de datos','2019-11-14'),(2430,74,'mejoras y responsive','este da ayude a mis compaeros en las vistas les dije como se habr el archivo codeigniter, tambin hable con mi docente para q me de un par de consejo para q las vistas sean responsive, para el da siguiente dia voy a investigar de eso. \n','2019-11-14'),(2431,58,'Eliminacion del banner y codeigniter','Hoy tuve que eliminar el banner de todas las vistas por lo cual tuve que buscar en la parte del cdigo de todas las vistas del proyecto en la cual se encontraba el banner(header) ,se me dificulto porque no encontraba ese cdigo pero al final lo puedo hacer buscando informacin, luego ayude a una compaera con una investigacin del codeigniter para poder hacer la vinculacin de las imgenes que tenia pendiente.','2019-11-14'),(2432,75,'Modificaciones','En esta clase realice las modificaciones correspondiente a las correcciones hechas y vistas por Miguel Balmaceda. \nUna de ella era el cambio del PDF para el ciclo bsico comn. Es decir se agregaron 4 secciones denominadas informe, para que los preceptores puedan llenarlo, teniendo en cuenta que son dos informes semestralmente. ','2019-11-14'),(2433,80,'accesibilidad ','la clase de hoy miramos un video de Materialize Tutorial #9 - Responsive Grid para mejorar las vistas, y que se adapte a cualquier dispositivo, tales como celulares, netbooks, I-pod touch, tablets, entre otros. \nOtorgando mayor accesibilidad a cualquier usuario preseptor/a, a la hora de manejar el sistema. \n','2019-11-14'),(2434,42,'Carpeta de campo','Dedique mi tiempo en actualizar mi carpeta de campo y una mejora de aspecto en cuanto a la presentacin. ','2019-11-14'),(2435,79,'Charlo con los chicos de mecanica y finalizacion del esquematico del DEA','Hoy lo primero que hice fui ir a hablar con los chicos de mecnica sobre la disposicin de los diferentes componentes dentro del DEA. Tuvimos un poco de problemas porque el circuito y las pilas ocupan mas de lo previsto, sin embargo con los clculos que hicimos parece que todo entra. Tuvimos un tema con el parlante, el profe nos proporciono una parlante con proporciones mas grandes de las esperadas (y valores, especficamente la resistencia que tiene, pero no es muy importante). Yo me esperaba esto entonces traje un parlante mas chico que entra perfectamente. Viendo el poco espacio que haba empezamos a considerar poner una plaqueta arduino mas chica. Pero esperemos que no sea necesario. Despus de eso me dedique exclusivamente a  el esquemtico del DEA y prcticamente esta terminado, no esta hecho el diseo PCB, pero ya con esto formalmente ya tenemos un diseo de circuito hecho. Revisndolo me percate que no hacia falta (o eso parece) de poner uno de los transistores PNP, as que lo quite. Tuve unas dudas acerca capacitores que le consulte al profesor Damian. En el diseo de esquemtico tuve un problema, no encontr un componente pero ya ver.','2019-11-14'),(2436,51,'actualizacion','en la clase de hoy habl con mi compaero del sector de Desarrollo y tuvo que hacerle varias modificaciones, depaso me puse a complementar la documentacion y mi carpeta de campo','2019-11-14'),(2437,48,'Codeigniter','Empece buscando informacion el dia de hoy desde el dia anterior,pero el lider me dijo que no me preocupara de eso ya que el maana le iban a ensear asi que despues de pasar los estilos intente redireccionar las vistas pero como trabajan con funciones no entiendo como hacerlo, eso tambien lo hable con el lider y dijo que habia que verlo el dia siguiente, y me dio trabajo para el dia siguiente en el que debo cambiar el dropdown de la vista de ciclo basico va de primero a segundo y las especialidades de tercero a sexto','2019-11-14'),(2438,53,'Modificando la Tabla','Se termino parte de la tabla, buscando informacin, intentando varios cdigos, entrando en varias paginas falta colocar unos estilos para la tabla y un botn de borrar.','2019-11-14'),(2439,37,'Checkboxes, modificacin de tabla, botones, conexin a bdd.','En el da de hoy logramos redirigir los valores obtenidos de los checkboxes hacia la base de datos, para luego mostrarlos en la tabla fsica de la pgina, luego de investigar cmo hacer sto. Tambin investigu cmo colocar botones dentro de los popups generados por los markers. Busqu como eliminar datos de la base de datos desde el cdigo php.','2019-11-14'),(2440,78,'Login terminado','Por cosas que pasaron no le dedique lo necesario al proyecto y termine haciendo el login tarde. Bsicamente copie un poco el login de prueba que hice y lo pegue todo en el mtodo index del controlador, as directamente cuando se entra al sitio nos manda a entrar a una cuenta., tambin en el mismo index si se detecta que ya hay una sesin iniciada, lo que se muestra es la pgina principal. De no estar iniciada se muestra el login con los formularios.\n\nTambin agregue una etiqueta &lt;a&gt; que va a un mtodo del controlador para poder cerrar la sesin. \n\nPor ltimo, a todos los mtodos le agregu una condicional que dice que si hay una sesin iniciada, se ejecuta lo que tenga el mtodo. De no ser as, se reedirecciona la pgina al index para que muestre la pgina de logueo','2019-11-14'),(2441,83,'14 de nov','se trabajo mucho hoy en caso la mayoria de las actas estaban para ser aprobadas y luego entregadas para otros, tuve uno que otras actas que no pertenecian a dicha acta de nacimiento por lo que tenia que rechazarla para que luego sea deribada hacia otro lado asi verificarian cual es el error y como lo solucionarian. \nAparte de eso no paso muchas cosas, eran las cosas tipicas.\ncomo entrar y ver el acta comprobar si esta vien los archivos o si tienen mas de uno etc,','2019-11-14'),(2442,40,'Control de calidad, actas comnes','En el da de la fecha realizamos control de calidad en actas comnes realizamos alrededor de 450 solicitudes de nacimiento, matrimonio y defuncin, aceptando y rechazando segn corresponda.','2019-11-14'),(2443,41,'prcticas externas control de actas','En el da de hoy nos dieron la cuenta con la contrasea para que podamos acceder a los controles de acta comunes y seguir con los archivos de nacimiento aceptando si estn correctos los datos de los nombres, apellidos y los sellos correspondientes en el caso de que estn mal los datos, falta de algn sello o la hoja le falta un pedazo se lo rechazara colocando como error de datos y si el archivos est confuso o estamos en duda lo dejamos cmo pendiente ','2019-11-14'),(2444,83,'15 de nov','hoy la maquina estaba muy lenta pero de igual manera se pudo trabajar  hice las actas de nacimiento como normalmente se hace, esto se vuelve cansador pero luego sigues.\nen este dia tuve uno que otros errores pero la mayoria estaba correcto y habia algunas que preferi dejarlas pendientes por que no sabia como manejarlo','2019-11-15'),(2445,53,'Eliminar ','Buscando informacin sobre como eliminar los datos de la base de datos, probar el cdigo encontrado pero al final no funciono ','2019-11-15'),(2446,51,'modificacion','en la clase de hoy me puse a modificar el trigger para que las inasistencias se vayan a la tabla &quot;inasistencias&quot; y luego las sume','2019-11-15'),(2447,75,'Finales','En esta clase ayude al equipo de diseo a poner las ulr_base en los css para que las imgenes carguen. Ademas tambin los pusimos en algunos href para direccionarlos a las debidas pginas.  ','2019-11-15'),(2448,42,'Continue la carpeta de campo','Termine de completar la carpeta de campo con items faltantes para su mayor comprension','2019-11-15'),(2449,74,'Responsive','este da me centre en practicar un poco de responsive,sin aplicarlo a las vistas, cuando ya tenga la habilidad necesaria voy a pasarlo a las vistas \ntambin el jefe de desarrollo nos dijo como direccionar las cosas en codeigniter con eso ya podemos avanzar un montn, el problema mas importante seria responsive para todos los dispositivos disponibles. \n\n//relleno de carpeta de campo \n\ncomplejo de salud, al tener dolor de diente tome dos tramidol, pastilla derivada de la formina solo tomar cada 6 horas, vine al colegio tomando 2 en el momento, estoy padeciendo los efectos secundarios, mareo, dolor de cabeza, nervios, impulsivo, sudor de mas , mareo, dolor, picazon, sensacin de cansancio y constante hormigueo en la mano derecha y dolor de estomago. \n','2019-11-15'),(2450,50,'Entrega de Documentacin','Se finaliz la documentacin del rea de Desarrollo, la cual se entreg al profesor a cargo.','2019-11-15'),(2451,45,'jugando con los fondos y mas','hoy intercalamos los fondos en la pagina de registro de alumnos viendo como quedaban tambin vi el tema de codeigniter de de como importarla a la base de datos y de ah como modificarla','2019-11-15'),(2452,78,'Carpeta de campo','Quera trabajar con la carpeta de campo ya que hace mucho que no la actualizaba con lo actual de login. Empec tarde porque use una computadora lenta y tuve que cambiar a otra y empezar a escribir de nuevo. No llegu a escribir mucho, solo que CodeIngiter usa su propia librera para manejo de sesiones.\nTambin expliqu los tres mtodos usados para esto, los cuales son: \n$this-&gt;session-&gt;set_userdata($data); \n$this-&gt;session-&gt;userdata(&quot;var&quot;); \n$this-&gt;session-&gt;destroy(); \n\nEn casa tengo tiempo de completarla con lo que falta. Adems de esto, en algunos momentos me acerco al equipo de diseo para ayudarlos con algunas cosas que mi piden.','2019-11-15'),(2453,60,'Practicas Externas','El da de hoy comenzaramos las Practicas Externas del ITAU, pero segn Puma tendramos que llevar esas practicas en el colegio, en el horario que tendramos practicas internas.\nHubieron algunos problemas como encontrar que en las pc no esta instalado la aplicacion de Unity para poder llevar a cabo las practicas externas.\nSe termino de decir que instalemos dicha aplicacion en esta clase y probar si puede correr el juego que nos dio el Itau (Cosa que se logro de cierta manera).','2019-11-15'),(2454,48,'Modificando las url y vistas','Kevin me dijo que debia cambiar las vistas ya que tenia que modificar todas porque el index tiene ciclo basico que tenia hasta tercero y las especialidades que llegaban de cuarto hasta sexto entonces le quite un ao a ciclo basico y le agregue un ao mas a las especialidades tambien tuve que cambiar cada vista lo mismo ya que todas tenian el mismo problema, luego de eso kevin me mostro la urls para colocar imagenes con codeigniter y los href asi que la siguiente clase voy a continuar modificando las vistas de las especialidades cambiando los aos de ciclo basico y luego los href e imagenes ','2019-11-15'),(2455,76,'Unity y proyecto NegociOgro','Despus de haber ido al edificio del banco Itau, comenzamos explorando el codigo madre que nos pasaron, no se pudo hacer mucho por la incongruencia de las versiones de unity que se usaron al codificar el script del mismo.\n','2019-11-15'),(2456,79,'Viendo como armar el circuito en la plaqueta pre perforada','Hoy me dedique principalmente a ver como hacer el circuito en la plaqueta. La problemtica es que no es lo ideal con esta placa hacer pistas de conexin por ambos lados. Por lo tanto el diseo del circuito de PCB que se puede hacer en Fritzing no me sirve mucho para esto, aunque intente hacerlo. Salvo que me las ingenie. Por lo tanto estuve viendo en papel como era el armado del circuito. Tambin correg algunas cosas del esquemtico y lo simplifique un poco, osea lo hice mas entendible a la vista. ','2019-11-15'),(2457,85,'Estuvimos intentando ver el codigo del itau','abrimos el codigo del iatu con unity y nos encontramos con un monbton de problemas, por ejemplo no compila, tenemos que investigar el porque','2019-11-15'),(2458,58,'Cambiando imagenes de fondo y siguiendo con codeigniter','El da de hoy estuve viendo qu imagen de fondo poner a la vista de perfil del alumno ya que no tena un background, despus abrimos el archivo por codeigniter creando una base de datos y cambiamos el diseo de algunas vistas, pero nos faltan pasar las imgenes de fondo de todas las vistas ','2019-11-15'),(2459,46,'Viernes','Hoy trabaje con las fechas 17-10 y 14-10, con la cuenta de Santoro. Entre las partodas que aprobe algunas fueron azules(son las que se tienen que hacer unos pasos extra para aprobarlas), otras fueron con mas de una imagen y en estecaso hucieron 7 imagenes mal cargadas  e imagenes con los marcos escritos.\nEn un caso particular hubo una que venia con una imagen adjunta que no era la correcta porque los datos no coincidian con los del solicitante y la otra imagen estaba escrita con numeros rojos que:&quot;la imagen no comtenia el sello&quot; en este caso las que tiene la letra roja se aprueba porque la jefa dijo que se aprueba','2019-11-15'),(2460,56,'Control de actas comunes - Nacimientos','Hoy hicimos un control, de aproximadamente trescientos registros, de partidas de nacimiento solicitadas al sistema nico de atencin ciudadana y al colegio de abogados. Hoy hubo una mayoria de partidas que se pudieron dar la aprobacin directa, ya que generalmente tienen que ser rechazadas, porque tienen que venir acompaadas de rectificados que no son encontrados por el sistema.','2019-11-15'),(2461,41,'Prcticas externas registro civil','En el da de hoy accedimos a los controles de actas comunes y seguimos con los archivos de nacimiento y matrimonio en el caso de que este todo correcto se lo aprobar si, llega a ver algn error como por ejemplo algn error de datos o falta de sello se lo rechazara y si tenemos alguna duda se lo dejara en pendiente ','2019-11-15'),(2462,40,'Control de actas comunes','En el dia de hoy continuamos con el control de actas comunes aprobando y rechazando solicitudes de partidas de nacimiento, matrimonio y defuncin','2019-11-15'),(2463,49,'Actas','En el da de la fecha continuamos con el control de actas, aprobando y rechazando ','2019-11-19'),(2464,69,'carpeta de area','hoy nos dedicamos a terminar la carpeta de rea  para poder  entregarlo y para que nos puedan cerrar las notas.','2019-11-19'),(2465,64,'ULTIMA CLASE DE PP!!!!!!!!!!!!!!!!!!','En el da de la fecha estuve retocando la carpeta general de Infraestructura y esperando a que uno de mis compaeros me pase una parte que falta y por mi parte voy a agregar a la carpeta de capo el servidor Webmin, pero cabe destacar que por la falta de tiempo que tenemos no se va a poder agregar al servidor madre lego de eso ya estaramos para concluir todo. Tambin estuve agregando algunas cositas a mi carpeta de campo para dejarla lo ms completa posible. Cabe destacar que hoy 19 de noviembre de 2019 es la ltima clase de PP del ao, as que es hacer todo hoy si o si, paso sper rpido el ao, ms en esta materia ya que pasaron un montn de cosas ya sean malas y buenas, pero se llevan buenos recuerdos o eso creo.','2019-11-19'),(2466,70,'Carpeta de seccin','Hemos utilizado esta clase para terminar con la carpeta de seccin, falta juntar las 3 partes y hacerla un solo documento, pero con eso ya terminariamos y dariamos por finalizado Practicas Profesionalizantes.','2019-11-19'),(2467,47,'Terminando mi parte del proyecto','En el da de hoy termin de unir las vistas que yo haba hecho con los diseos dados por el sector de diseo.','2019-11-19'),(2468,71,'carpeta de BD','Dimos por terminado el dia de hoy la carpeta de nuestra area de base de datos y se lo entregamos al profesor para el cierre de nota','2019-11-19'),(2469,57,'Finiquitando el proyecto','El da de hoy se  termin de unir las vistas dadas por el sector de diseo. Quedaron algunos errores, como por ejemplo hay un script que no funciona dando errores, como por ejemplo una imagen, pero es irrelevante para el funcionamiento del proyecto.','2019-11-19'),(2470,66,'clase cuarenta y siete','Hoy estuve combinando las funciones de login, etc.. que hice con las vistas que los de diseo nos dieron. Por ahora va bien aunque hay pequeos errores que ir resolviendo.','2019-11-19'),(2471,38,'19/11/2019','En la clase de hoy, debido a que finaliza