ra trabajar(nacimiento) entonces fue todo muy tranquilo tambien hoy fue el ultimo dia de nuestra supervisora claudia porque ella se iba de vacaciones.','2019-11-21'),(2479,48,'Redireccionando botones','Kevin nos habia encargado la tarea de implementar las imagenes y estilos de las vistas pero luego nos dijo que debiamos redireccionar los botones que nos llevaran a dichas vistas, en la clase anterior habian redireccionado un boton y nos guiamos de ese ejemplo para hacerlo en cada una de las vistas, fue un trabajo largo pero sencillo, una vez que terminamos con todas las direcciones de los botones y funcionaran, kevin nos dijo que ahora si debiamos hacer la implementacion de las imagenes en cada una de las vistas ','2019-11-21'),(2480,55,'Da N13 de Practicas Externas','Hoy realice fotocopias de vouchers, nada fuera de lo comn, aunque eh de decir que eran mucha mas cantidad de lo normal. \nRealice las capturas correspondientes al da de hoy y me retire a el horario habitual 13:00.','2019-11-21'),(2481,45,'hrefs para redireccionar con botones','hoy importe la base de datos oficina_de_alumnos una vez hecho en el proyecto agregue 2 hrefs para que con sus respectivos botones redireccione a determinada tabla, hoy tambin actualice la carpeta de campo','2019-11-21'),(2482,56,'Control de actas comunes - Nacimientos|','En el dia de  hoy tuvimos para  controlar mas  o menos 280 partidas de nacimiento de las cuales nos quedaron  aproximadamente 75 partidas  sin  \ncontrolar, ya que  las tuvimos que dejar pendientes,  porque algunos de los registros faltaban indexar en el sistema y no se podia completar la operacion y o algunas partidas que son muy viejas, como del ao 1900, que estan muy viejas y los papeles digitaliados no son legibles.','2019-11-21'),(2483,60,'Paso 1','Se inicio el paso 1 del proyecto de Practicas externas, por el echo de que hay demaciado errores en el codigo fuente, por este caso se reinicio el proyecto y nos dividimos el trabajo para asi poder terminar al menos algo a tiempo y que les vaya a gustar a los directivos del Banco.','2019-11-21'),(2484,53,'Informacion','Buscando como encontrar latitud y tongitud y guardarlo en la base de datos.','2019-11-21'),(2485,41,'Practicas externas control de actas comunes','En el da de hoy nos dieron la cuenta con su contrasea para entrar a la pagina y seguir con los controles de actas comunes verificando si coinciden los parentescos entre 2 o mas archivos y si esta todo correcto con sus correspondientes sellos se lo aprobara y si hay algn error de datos o falta de sello se lo rechazara y si el sello no se llega a ver o tenemos alguna duda con el archivo se lo dejara como pendiente.','2019-11-21'),(2486,36,'esperando a rojas','estuvimos esperando a rojas que esta haciendo el trigger de falta','2019-11-21'),(2487,44,'Esperamos el trigger de la seccin de base de datos.','Estuvimos esperando el trigger y mientras tanto debatimos como deberia ser la parte de faltas de la pagina.','2019-11-21'),(2488,82,'funciones de Codeigniter',' Hoy continuamos  con  Codeigniter  en las clases pasadas necesitbamos entender esto para poder direccional de una vista a otra con funciones, por lo cual estuvimos investigando por lo que ya sabemos  ms sobre el tema, as que hoy el lder nos dijo que siguiramos con implementar las imgenes pero tuvimos algunos problemas y pedimos ayuda la lider  y el lder nos ayud con brindar el cdigo de como hacer las cosas por el grupo de WhatsApp, con ese cdigo de Codeigniter intentamos hacer las redirecciones que el lder tambin dijo que hiciramos al principio no pudimos pero se pudo resolver los errores que tenamos  y logramos hacer  redireccionar las vistas con las funciones con el nombre de las  respectivas vistas y luego mi compaero se fue y el lder dijo que insertara las imanes en todas las vista y lo pude hacer y tambin que diseccione algunas vistas y se pude y se lo entregue. ','2019-11-21'),(2489,78,'Carpeta de campo actualizada','Hoy trabaje mucho con la carpeta de campo y complete todo lo que tengo trabajado del login. Agregu un diagrama de flujo para asimilar el algoritmo del login, puse imgenes del cdigo de los 4 mtodos para el login (index, ingresar, ingreso, logout) explicando las lneas relevantes y adems puse cdigo del modelo que busca los datos del usuario en la base de datos. Por ltimo agregue dos pruebas del login: una en donde se ingresa con los datos incorrectos (para que se muestre la vista &quot;login sin exito&quot;) y otra donde se ingresa con los datos correctos de una vez. Actualmente la carpeta de campo tiene 4522 palabras y 58 pginas.','2019-11-21'),(2490,51,'modificaciones','hoy habl con mi compaero del sector de Desarrollo y luego de hacer las nuevas tablas, me puse a hacer los trigger ','2019-11-21'),(2491,58,'implementando y arreglando el responsive ','Bueno hoy el lder me dijo que realice y que trate de arreglar el &quot;responsive&quot; de la pagina principal y agregarlo a las dems vistas, ya que no servan las que tenamos, tuve que buscar informacin y ver vdeos porque que se supona que el materialize ya tendra que tener el responsive, pero no, as que con la informacin obtenida pude arreglarlo pero me falto una cosa que era el navbar, que tuve la idea de que cuando la pagina se abra por un mvil se pueda ver con un &quot;men de hamburguesa&quot; pero no quedaba bien as que lo descartamos.','2019-11-21'),(2492,42,'Responsive','Colabore junto con mi lider de seccion a mejorar la funcionalidad de los responsive del proyecto','2019-11-21'),(2493,79,'Ya con todos los componentes, empezando a hacer el circuito','Consegu en la tienda microelectrnica y por Internet los  componentes que me faltaban. Entonces empece hoy a intentar arma en protoboard todo el circuito. Primero consulte en datasheet de los componentes para darme cuenta que los componentes no tenan el pataje que esperaba. Ningn problema, pero no saberlo puede ser muy problemtico. Despus de eso prosegu a soldare patas a algunos componentes para poder ponerlos en la protoboard. Pero hubo un problema. Mi soldador estaba quemado. Lo revisamos, la cuestin es que termine yndome al aula de al lado a trabajar. Ah me dedique a soldar las patas de los componentes, no me alcanzo a mucho mas. Tuve un problema con uno de los componentes, puse primero el estao y despus las patas, se me complico arreglarlo. ','2019-11-21'),(2494,74,'Responsive','en este dia me rompi el orto en la silla para hacer responsive, avance un poco, para faltan todas las vistas para hacer, por suerte mientras tenia q ver este tema importante mi compaeros avanzaron un monton direccionando las cosas ya falta poco solo faltaria responsive y poner un par de vistas que ya casi estan. tambien estabms cambiando un poco el diseo para q sea mas comodo a la hora de navegar por nuestra FUTURA PAGINA web //active el mayu sin querer SJSJSJj. fin de la transmisin.  ','2019-11-21'),(2495,85,'Errores, division de tareas y empezando a trabajar','No podemos tocar nada del juego debido a la cantidad de errores por lo tanto decidimos simplemente tocar la parte grfica para que el juego se vea mas lindo, luego de decidir esto empezamos a dividir las tareas Uno va a hacer un informe de errores para justificar el hecho de que no podemos tocar nada del funcionamiento del juego, otros dos mejoraran todas las estructuras del menu principal juntos con las fuentes y algunos iconos (ademas de agregar iconos nuevos), y otro se encargara de hacer el fondo. El dia de hoy empezamos a planificar el fondo y algunas estructuras soy tonto','2019-11-21'),(2496,37,'Avance en la aplicacin','En el da de hoy avanzamos con la aplicacin. Logramos hacer que el &quot;responsive&quot; funcione adecuadamente, los botones Agregar Persona y Eliminar funcionan correctamente, y encontramos la forma de acceder a las coordenadas de los marker mediante la funcin &quot;getLatLng()&quot;, tras horas de investigacin para cada uno de estos casos.','2019-11-21'),(2497,75,'Finales','En esta clase termine de realizar las modificaciones del pdf para elciclo basico y complete carpeta de campo\n','2019-11-21'),(2498,76,'Proyecto Itau','Comenzamos instalando Unity y nos pusimos a ver el proyecto y explorarlo. Se pudo notar una cantidad exagerada de errores en el mismo los cuales no tenan una fcil solucin y que no permitian compilar el proyecto en su totalidad. Nos adentramos en los grficos y decidimos de que manera mejorar los mismos. Hicimos la divisin de quien va a hacer cada cosa y nos pusimos brevemente a trabajar en ello.','2019-11-21'),(2499,40,'Control de actas comunes','En el da de la fecha continamos con el control de actas comunes, hoy solo realizamos solicitudes de partidas de nacimiento y matrimonio, alrededor de 200 solicitudes.','2019-11-21'),(2500,46,'Jueves','Hoy las partidas fueron feas, casi todas estaban en azules con mas de una imagen imagen adjunta(sobretodo las mas viejas que la letra casi ni se puede leer), hubo una que otra normal pero nuevamente tenian mas de una imagen.No rechaze ningun acta de nacimiento, pero si deje como tres pendientes porque no entendia la letra o porque tenian escrito el margen.\nAdemas tube dos casos especiales, uno fue un acta escrito con letras rojas la cual aprobe porque es lo que me indicaron y la otra es una que tiene varias imagenes todas en azul.\nUse la cuenta de Santoro con las fechas 23-10 y 20-11 de las 278 partidas solo faltaron verificar 73','2019-11-21'),(2501,46,'Jueves','Las actas de nacimiento de hoy fueron casi normales, algunas estaban en azules(las aprobe luego de verificar correctamente los datos) en los que solo figura el nombre y una que otra que tiene mas de una imagen adjunta(las mas viejas son complicadas porque la letra es apenas entendible).\r\nUse nuevamente la cuenta de santoro','2019-11-14'),(2502,82,'reponsive','Hoy continuamos con la direccin de los vistas y con poner las imgenes a las vista tambin los estilos para lo cual se utiliz codeigniter, lo cual pens que estaba terminado pero no, tuvimos algunos problemas pero como siempre se pudieron arreglar por el momento nos sigue faltando redireccionar las vitas e imgenes. Pero lo ms importante que nos falta es el reponsive.','2019-11-22'),(2503,74,'carpeta de campo ','en este da hice toda la carpeta de campo hasta hoy y se lo entregue.','2019-11-22'),(2504,53,'Carpeta de campo','Subiendo la carpeta de campo en encuentrotecnologico.com/pp ','2019-11-22'),(2505,51,'ultimos detalles','en el da de la fecha me encargu de terminar de completar la carpeta de campo y con eso mismo me puse a terminar la documentacin del proyecto ','2019-11-22'),(2506,48,'Continuamos con las redirecciones','Hoy seguimos trabajando con las redirecciones y las imagenes, tambien esta el problema del responsive, hoy lo que hicimos fue avanzar un poco mas con las direcciones de las vistas al apretar los botones y colocarle los estilos e imagenes a un par de vistas la siguiente clase continuaremos con las redirecciones e imagenes e intentaremos avanzar tambien con el responsive','2019-11-22'),(2507,50,'Entrega Final','En la clase de hoy, se entreg todo lo que se vino haciendo a lo largo del ao, referente a la aplicacin de gestin de preceptoria. Ademas de las carpetas de campo, con los avances del tercer trimestre incluidos.','2019-11-22'),(2508,58,'Continuamos con el responsive','Hoy el profesor dijo que completemos la carpeta de campo porque nos evaluara eso, hoy contine con lo de ayer que era arreglar el responsive de las vistas del proyecto, y cambiar el diseo de algunas cosas, ya que ayer tuvimos que modificar algunas cosas de la pagina de inicio para poder arreglar el responsive de esa vista ','2019-11-22'),(2509,55,'Da N14 de Practicas Externas','Hoy volv a buscar defunciones como de costumbre. \nTambin como siempre saque las capturas del da de hoy para realizar la actualizacin correspondiente de la carpeta de campo.','2019-11-22'),(2510,60,'documetacion','el dia de hoy se llevo a cabo la completacion de dicha documentacion sobre errores que se dieron en el transcurso de la actividad en cuestion.','2019-11-22'),(2511,83,'22 de nov','Muy tranquilo el di de hoy, trabaje como normalmente hago y le tome capturas  a lo que. A haciendo pero por alguna razon las imgenes me salan daadas entonces ya no servan.\nEso fue lo peor de hoy','2019-11-22'),(2512,79,'Trabajando en el circuito en el aula de sistemas de control','Hoy lo primero que hice fue hablar con el profesor Gonzalo y Damian sobre unas dudas que tenia. Resulta que no sabia que resistencia ponerle a la base de un transistor. Resulta que le tengo que poner una de 2-3 ohms, pero de como 3w. Son resistencia cermicas, grandes, caras y que no me puede permitir en mi circuito. Por lo tanto por un momento consideramos usar un regulador de tensin. Sin embargo el profesor Damian se percato de que no era necesario (aunque ahora tengo mis dudas). Por lo tanto saque el regulador y se me simplifico el circuito. Luego de eso me puse a soldar en el aula de sistemas de control. Tuve un problema de que no consegua tuercas para los disipadores de tensin. Por lo tanto lo que tuve que hacer es buscar tuercas por el colegio. En el aula de sistemas de control consegu. Pero solo una. Luego de eso prosegu soldando. Despus fui a preguntarle al profesor Olaso algo sobre el circuito, aunque de momento, decidimos dejarlo asi','2019-11-22'),(2513,40,'Actas comunes','En el dia de hoy continuamos con el control de calidad de actas comunes aprobando y rechazando solicitudes de partidas de nacimiento matrimonio y defuncion, hoy realizamos alrededor de 300 solicitudes.','2019-11-22'),(2514,56,'Control de actas comunes - Naciminetos','En el dia de hoy no hubo muchos registros para controlar y verificar los datos de las partidas de nacimiento, aproximadamente controlamos entre 200 y 300 partidas. \n Hubo gran cantidad de partidas de las que no se les hallaba imagen, por lo cual fue bastante rapido terminar con el control de todos los registros que habia para trabajar.','2019-11-22'),(251