rror de sobrescribir los archivos lo perd, paro ahora le agregue estilos y tambin los hice responsive y css. \nmaana es el ultimo dia de pp lo unico que queda es que mis compaeros pasen los estilos que hice a los demas aos y tambien direccionar las nuevas vistas.','2019-11-28'),(2530,58,'Terminando el responsive','El lder hoy me dio una tarea la cual se trataba agregar el responsive las vistas del index en la parte de ciclo bsico, computacin, mecnica y automotriz me quedan por completar algunas vistas que la seguir maana','2019-11-28'),(2531,85,'Empezamos a trabajr con la aprte grafica del proyecto del itau','Ayude a un compaero a trabajar con el fondo(mapa) en el que luego se aplicaran los objetos(casas tiendas etc). Esto nos tomo un buen tiempo para que quedara bien. Luego entre los dos empezamos a trabajar en las estructuras(casas tiendas etc) y los posicionamos brevemente en el fondo para dar una idea de como quedara todo. Ya tenemos todos los archivos en una carpeta y tenemos que preparar un google drive para tener en comun todos los archivos\n','2019-11-28'),(2532,76,'Diseo del proyecto Itau','Comenzamos creando una base para el proyecto en Photoshop, y la modificamos a gusto segn las especificaciones y ideas que se nos ocurran. Sacando ideas de internet y de diversas fuentes llegamos a hacer un pequeo boceto o maqueta de lo que seria el proyecto final, faltando pequeas mejoras y modificaciones para un futuro.','2019-11-28'),(2533,37,'Investigacin Ajax jQuery','En el da de hoy investigu cmo utilizar Ajax y jQuery para almacenar las coordenadas de las funciones de Leaflet en la base de datos. Gracias a mi compaero logramos almacenar las coordenadas dentro de la base de datos, mas los marker no se mantienen visibles en la app, por lo que debemos investigar sobre sto.','2019-11-28'),(2534,79,'Trabajando en la pcb','Hoy estuve trabajando enteramente en la PCB, soldando las conexiones de las baterias de litio y la BMS. Sin embargo cometi un error, solde la baterias