a primera versin de la vista principal con sus caractersticas principales sin funcionar. Debido a una celebracin familiar no pude avanzar mucho en el proyecto. Se espera que para maana comience a agregar las funcionalidades bsicas a la vista provisional.','2019-12-10'),(2542,77,'Diseo BD','','2019-12-11'),(2543,80,'Diciembre','Hoy comenc con la realizacin del diagrama de gantt para el proyecto, especificando las tareas que realizar y el tiempo de duracin de cada una de ellas. Investigue sobre la los diagramas de entidad relacin y comenc uno, al mismo tiempo inicie con una pequea investigacin sobre los sanatorios, crono gramas de estudios, historias clnicas, entre otros. ','2019-12-12'),(2544,77,'Diseo &amp; Login','El da de la fecha se trabaj en finalizar el diagrama entidad relacin y en avanzar en el funcionamiento de la pagina. En esta ocasin en el Login para el admin del gimnasio. Tambin se logr conseguir iconos con algunos de los ejercicios ms importantes y comunes, para poder proyectar mejor en la pagina web las rutinas que se efectan semanalmente.','2019-12-12'),(2545,67,'Base de Datos - Invernadero (10/12)','El dia de hoy le consulte a un profesor y me ayudo un poco con el diseo de la base de datos. ','2019-12-12'),(2546,80,'dia2','Hoy intente realizar el diagrama de entidad relacion, sin exito, y con muchos fallos.','2019-12-13'),(2547,77,'Arreglo de la DB y el Login','El da de hoy se corrigieron errores en la Base de Datos y el Login que impedan que este funcione correctamente. Se comenzo a probar con distintos estilos para mejorar el apartado visual de la pagina.','2019-12-13'),(2548,78,'Problemas con agregar alumno','Estuve teniendo muchos problemas con agregar un alumno a la tabla de alumnos ya que, las filas afectadas muestra 1, osea que se agreg el alumno, pero no se muestra en base de datos. Otra cosa con la que empec a trabajar es con lo de mostrar alumnos, ya que la vista no mostraba a los alumnos de la base de datos. Ya tengo hecho el poder obtener