altaria la foda que lo realizaremos para la prox clase','2021-05-14'),(3061,161,'Clase N11 18/05/2021','en la clase de hoy resolvimos dudas con nuestros proyectos antes de la revisin general de la clase siguiente','2021-05-18'),(3062,167,'Meet','','2021-05-18'),(3063,166,'Primeros prototipos','Hoy ya empec a testear las aplicaciones de vuforia donde utilizo un cdigo qr como marcador para mostrar un objeto en 3D sobre el mismo.','2021-05-18'),(3064,163,'Proyecto','La clase pasada terminamos un par de vistas, ahora hay que pasarlas a cdigo, la base de datos est prcticamente terminada, ya esta creado el documento de presentacin de proyecto y vamos avanzando con la carpeta de campo.','2021-05-18'),(3065,184,'Inicializacin de la aplicacin de React','Trabaj pasando el contenido que tenemos desarrollado por el momento a una aplicacin de react.','2021-05-18'),(3066,161,'Clase N12 19/05/2021','En la clase de hoy tuvimos la pre revicion final antes del 26/05/21 ademas de completar mas la carpeta del campo del proyecto y corregir algunos codigos','2021-05-19'),(3067,182,'Practicas Profesionalizantes - Dia 7','Presentamos el proyecto hasta el momento para tener en cuenta los cambios y avances que debemos realizar para hacer la presentacin del mismo el mircoles 26. Adems realizamos una divisin de tareas para que cada uno de nosotros se centre en un apartado especifico','2021-05-19'),(3068,170,'base de login y regis','En el da de hoy avance con una posible base de datos de el login y registrar de la pagina. Posible porque seguramente sea modificada. Tambin compare la pagina de mi flete con otra pagina que hice para poder hacer la codificacin de una de las vistas(login y regis). Establecimos algunas fechas para la realizacin del proyecto.','2021-05-20'),(3069,179,'Creacion de gantt del proyecto','En el da de la fecha estuve investigando sobre el manual de usuario y como hacerlo, Aunque principalmente estuve haciendo el diagrama de Gantt, al comienzo utilice el programa &quot;ProjectLibre&quot; pero me daba muchos problemas al usarlo, entonces cambie a &quot;Ganttproject&quot; que es mucho mas sencillo de usar. Tiene una interfaz minimalista y bastante intuitiva comparado al ProjectLibre que puede ser muy confuso cuando no se sabe mucho del tema.\r\nEn mi archivo pude poner cada tarea que debe hacerse, ademas de ponerle un comienzo y un fin, agregue colores para poder diferenciarlos mejor.','2021-05-20'),(3070,177,'Trabajo Grupal','el da de hoy empece a trabajar con mi grupo, al verme perdido tras mis falta en mi asistencia, pregunte el trabajo que me tocaba, se me asigno por el momento en el desarrollo del logo de la pagina, a la que alegremente acced.','2021-05-20'),(3071,171,'Definicin de Vistas','En el da de hoy avance con mi proyecto de los prototipos de vista con Paint (Modificacin de datos, algunos cambios en las sesiones, organice mis horarios para las entrega de vistas, gracias al gant que organizamos con mi equipo) para empezar con la codificacin desde Bootstrap Studio, realice algunas investigaciones para poder plantearlas en las vistas de mi paginas, y planeo crear como &quot;una mascota&quot; en las paginas, para que se vea mas interactiva o animada.','2021-05-20'),(3072,170,'presentacion','Hoy con el poco tiempo terminamos de definir la base de datos del registro y del inicio de sesin. Tambin establecimos la presentacin de la pagina con su respectiva introduccin de que somos, la funcin y que hacen los alumnos y profesores en la pagina. Retocamos la conclusin del FODA.','2021-05-21'),(3073,177,'trabajo de logo','hoy segu trabajando con el logo. ya esta terminado, pero are mas para tener mas variedad para elegir con mis compaeros de grupo','2021-05-21'),(3074,179,'Creacion del manual de usuario','En el da de la fecha estuve investigando y realizando un poco el manual de usuario de mi proyecto, para poder realizarlo tome de referencias de otros manuales de paginas web muy populares como Facebook y Google. Ademas de otras paginas de ayuda en manuales.\r\nPrincipalmente me base en su estructura y armado de cada cosa. En mi manual escribi una seccion de Usuarios, clases, funcion de mi proyecto, para que sirve mi proyecto, etc.\r\nEn conclusin un manual bien hecho puede ayudar a quitarte muchas dudas de como funciona una pagina web y ayudarte en tus necesidades!','2021-05-21'),(3075,201,'GRUPO PARQUMETRO','Siguiendo solo con el grupo, viendo que le falta por agregar a esto que recin empezamos, y por ahora vamos bien, terminamos el Gans y el Foro, faltara el ultimo, donde nos repartimos cada uno cada parte en especial para tenerlo hecho y poder seguir avanzando','2021-05-21'),(3076,171,'Creacin de Vistas','En el da de hoy, termine de crear las vistas desde Paint e inicie con la creacin de vistas con la aplicacin de bootstrap studio, pude disear los mens horizontales de cada materias y empezare a disear los mens side-var donde mostrara los accesos a otros directorios.','2021-05-21'),(3077,203,'RASN-Reunin para consultas','Durante la semana pasada estuve armando la carpeta de campo de nuestro proyecto. Hoy estuvimos en una clase de consultas en preparacin para la presentacin de maana.','2021-06-01'),(3078,180,'1 de junio 2021 - Aubone Juan Pablo','En el da de la fecha, estuvimos hablando sobre los requisitos de entrega y avance del proyecto. El da de maana 2 de junio realizaremos la primera muestra de la documentacin y estructura preliminar del proyecto. Para nuestro proyecto, \r\n RASN, estuvimos trabajando en las vistas, recopilacin de informacin y determinacin de las tecnologas  a utilizar, tanto en el frontend como en el backend.','2021-06-01'),(3079,164,'Resolucin de Dudas ',' El da de hoy fue bastante simple, pregunte sobre lo que mi grupo y deberamos presentar el da de maana en la presentacin de como va avanzando y que planeamos hacer a lo largo del ao.','2021-06-01'),(3080,182,'Practicas Profesionalizantes - Dia 8','El da de hoy nos juntamos en una reunin para acordar los puntos claves que d