n a base de datos y aadir ms vistas','2021-06-09'),(3095,161,'Clase N16 09/06/2021','en la clase de hoy tuvimos realizando una charla donde resolvimos dudas puntuales sobre mongo(base de datos) la conexion de base de datos de esta y respecto a las vistas a realizar','2021-06-09'),(3096,182,'Practicas Profesionalizantes - Dia 10','Este da nos enfocamos en la conexin del proyecto realizado en React con la base de datos en Mongo DB, ademas nos reunimos con el profesor para actualizar los avances que realizamos.','2021-06-09'),(3097,184,'Cambio de grficos','Integr otro tipos de grficos con ms funciones interactivas que indiquen los datos que los componen. En lugar del modulo &quot;chart.js&quot; utilic &quot;apexcharts.js&quot;. Por otro lado, modifiqu el diseo responsive para que no se rompa al redimensionar la pestaa.','2021-06-09'),(3098,200,'Primeros pasos del proyecto','El da de la fecha presentamos los primeros avances del proyecto','2021-06-10'),(3099,170,'investigacion ','Investigue sobre como hacer una base de datos como para comentarios para la pagina web y empec a hacer la base de la programacin de la pagina web','2021-06-10'),(3100,194,'Proyecto','Hoy presentamos parte del proyecto y resolvimos las dudas que teniamos.','2021-06-10'),(3101,199,'Avanze del tp integrador','avanze con la investigacion poniendo una conclusion','2021-06-10'),(3102,173,'Carpeta de campo, busqueda de informacion','Empece a hacer la carpeta de campo y agregue la conclusion de las debilidades, amenazas y oportunidades.Buscamos informacion para poder facilitar el tema del bot en la forma de poder contestar a todo lo que le envian.\r\n','2021-06-10'),(3103,171,'Diseo','En el da de hoy empec a realizar las vistas de inicio de Sesin y Registro, luego empec con el diseo de las paginas de Inicio, y la creacin de los mens y barra de men desplegables de las clases de nuestro proyecto con la librera de Bootstrap. Maana empezare a crear los comentarios y los chats','2021-06-10'),(3104,190,'','','2021-06-10'),(3105,179,'Seguimos avanzando manual de usuario','En el da de la fecha segu trabajando en el manual de usuario de el proyecto &quot;Aprende Conmigo!&quot;\r\nEn el manual de usuario estuve agregando imgenes, capturas de pantalla explicando, agregue el logo del proyecto, explique varias secciones de la pagina web del proyecto. El manual de usuario esta destino para aquellas personas nuevas que no sepan como funciona o no sepan usar la pagina web, el manual ser de gran ayuda para quitarse cual duda que tengan respecto al proyecto.\r\nIncluso hoy actualice el diagrama de Gantt, en el aad fechas, las modifique.\r\nAdems hoy contine con mi carpeta de campo aadiendo cosas muy parecidas al manual de usuario de Aprende conmigo!\r\n\r\n','2021-06-10'),(3106,192,'Punto de control','Revisamos lo que ya teniamos preparado para presentar y ver que tanto teniamos avanzado, revisamos todo, hasta presentamos un prototipo, tambien diagrama de gantt y revisamos algun error que tenia el codigo para el prototipo','2021-06-10'),(3107,174,'10/6','El dia de hoy hicimos un repaso breve de como estaba cada grupo y avanzamos un poco con el proyecto','2021-06-10'),(3108,170,'Investigacin y seguimiento ','Segu investigando sobre la base de datos para el comentario para la pgina y hicimos un seguimiento con el grupo para ver el estado en el que estamos ','2021-06-11'),(3109,179,'Investigaciones','En el da de la fecha estuve principalmente investigando sobre el manual de usuario y el diagrama de Gantt en sus estructuras.\r\nMas que todo vi videos en YouTube, el canal &quot;Videotutoriales Educacin ? Formacin en Software Libre&quot; me fue de ayuda porque tiene una gua de diagrama de Gantt y muy completa.\r\nEn general ese fue mi trabajo de hoy.\r\n','2021-06-11'),(3110,204,'Investigacion sobre para la creacion de Ubit','Investigu sobre softwares para crear el Gantt de nuestro projecto, estoy descargando el software GanttProject (https://www.ganttproject.biz/), pero no tengo buen internet y vaa a tardar mucho en descargarse. Tambien investigu un poco mas sobre las API para el mapa de la pgina, finalmente creo que nos quedaremos con la que nos paso el profesor en el primer checkpoint (leafletjs.com).\r\n','2021-06-11'),(3111,171,'Investigacin','En el da de hoy investigue y mire videos para entender y empezar a prototipar, disear la creacin de los chat y la creacin de los comentarios con php, por el momento solo cree parte del diseo de los comentarios, y unir las vistas.','2021-06-11'),(3112,199,'continuacion con la investigacion','continu haciendo la investigacion sobre el proyecto','2021-06-11'),(3113,194,'Proyecto','Hoy seguimos trabajando en el proyecto grupal sin resolver dudas.','2021-06-11'),(3114,195,'finalizar el gant entre otras cosas','estuvimos viendo como podemos finalizar el gant, y lo que nos falto de la primera entregar, tabien en planear quie va a hacer cada cosa para seguir con el proyecto','2021-06-11'),(3115,166,'Unity WEBGL','Hoy fue un da de investigacin sobre los problemas al correr programas de unity en una mquina local','2021-06-15'),(3116,161,'Clase N18 15/06/2021','realize una consulta al profesor sobre la tecnologia de node.js la cual me respondio y por las dudas me envio un link para ser una explicacion mas visual','2021-06-15'),(3117,184,'Desarrollo de interfaces para el ingreso de registros','Incorpor una seccin para que los administradores puedan registrar nuevas colecciones en la base de datos de manera sencilla. La interfaz muestra los campos correspondientes al tipo de registro que el usuario quiere ingresar, siendo estos: animales, preguntas y respuestas, miembros de la organizacin y blogs.','2021-06-15'),(3118,161,'Clase N19 16/06/2021','El dia de hoy realizamos un meet grupal con mi grupo de proyecto en el cual mostramos nuestros avances y resolvimos dudas con respecto a como seguir avanzando','2021-06-16'),(3119,180,'16 de junio 2021 - Aubone Juan Pablo','En el da de la fecha, nos reunimos y continuamos mostrando los avances del proyecto. Hablamos especficamente de la incorporacin de apis de grficos y la necesidad de finalizacin del frontend esttico (no funcional) para el 30 de junio. Esperamos poder realizar las vistas restantes y pulir algunos aspectos detalladamente. ','2021-06-16'),(3120,184,'Dinamismo de registros','Agregu funciones que seleccionen dinmicamente los registros de la base de datos y sean mostrados de manera ordenada en la interfaz de administrador, teniendo cada tarjeta (registro) sus propios valores inmutables.','2021-06-16'),(3121,179,'Investigaciones y Manual de usuario','En el da de hoy contine con el manual de usuario.\r\nEn el manual de usuario tambin conocida como la gua de usuario contine escribindole cosas como, la creacin de un usuario segn tus necesidades, cmo funcionan los usuarios. Existen dos tipos de usuarios: alumno y profesor, el profesor es el que crea las clases y ensea conocimientos, el alumno solo se inscribe en ellas y manda las actividades correspondientes de la clase. El trabajo es evaluado por el profesor y se califica con estrellas amarillas brillantes, mientras ms estrellas amarillas brillantes son mejor, ms calificacin. Cuando termina el curso se ver cuanto es el mnimo que el alumno debe tener para aprobar la materia.\r\nEn la creacin de la cuenta especifique los campos que se deben completar, como: Nombre, Apellido, Direccin de correo electrnico, gnero, fecha de nacimiento, contrasea.\r\nIncluso segu investigando la estructura del manual, en Internet encontr un pdf con el manual de google classroom, realmente es de mucha ayuda. Anteriormente tambin encontr el de Facebook. Desconozco si son 100% oficiales o si son hechos por otras personas fanticas de esas plataformas webs pero son muy tiles y prcticos de entender. Dejo el link ac abajo\r\nFacebook: http://www.aeped.es/sites/default/files/manual-facebook.pdf\r\nGoogle classroom: https://cuaieed.unam.mx/descargas/Manual-Google-Classroom.pdf\r\nEl diagrama de Gantt solo agregue fechas de finalizacin de actividades.\r\n\r\n','2021-06-17'),(3122,177,'trabajo de proyecto','El da de hoy trabaje en la investigacin de como crear una base de datos para luego proceder en la creacin de la misma para mi grupo  ','2021-06-17'),(3123,169,'Parqumetro - Insercin de un mapa en la pgina','Hoy estuvimos investigando sobre cmo agregar un mapa (de Google Maps) con la ubicacin del estacionamiento.\r\nLo que se tuvo que hacer fue buscar la API de Google Maps, en Google Cloud Platforms. Dentro de Cloud Platforms creamos un proyecto, y agregamos las API necesarias para el funcionamiento del mapa. Luego de agregarlas, buscamos las claves de las API para poder insertarlas en la pgina web, y por ltimo se pudo hacer funcionar el mapa dentro de la web.','2021-06-17'),(3124,175,'COMPLETAR TRABAJO','realizamos un meet todos los integrantes del grupo para poder realizar la tarea de sacar los puntos de inters del mapa de nuestro trabajo.','2021-06-17'),(3125,174,'el dia 17/06','el dia de hoy estuvimos viendo tecnologias para nuestro bot. \r\nVimos una api de google, pero nos resulto bastante tedioso para poder utilizarla. Luego encontramos un framework para nuestra pagina, pero no cumplia nuestros requisitos.\r\nDecidimos hacer las preguntas y respuestas por nuestra cuenta.\r\nEl dia de hoy nos encargamos de las preguntas de saludo, despedida, contactos de la escuela, inscripcion de la escuela, becas y especialidades del colegio.','2021-06-17'),(3126,172,'Clase 17-06-2021','El da de hoy, estuvimos viendo tecnologas para nuestro BOT.\r\nVimos una API de Google, pero nos resulto bastante tedioso para poder utilizarla. Luego encontramos frameworks para nuestra pagina, pero no cumplan con nuestros requisitos.\r\nDecidimos hacer las preguntas y respuestas por nuestra cuenta\r\nEl da de hoy nos encargamos de las preguntas de saludo, despedida, contacto de la escuela, inscripciones, becas y especialidades del colegio.','2021-06-17'),(3127,178,'Investigacin sobre base de datos ','Bueno el da de hoy estuve investigando y leyendo artculos sobre la creacin de las bases de datos y su mantenimiento. Por lo que pude ir deduciendo fue la parte la creacin de una copia de respaldo para la base de datos,','2021-06-17'),(3128,201,'PROYECTO PARKING','Continuamos con el proyecto grupal en donde nos centramos en el cdigo para que busque la ubicacin exacta en el mapa que se nos aparece para que nos pueda buscar desde el celu con ayuda del boostrap que cuando buscamos un lugar nos de la ubicacin en donde queda y cuanto queda para llegar al destino que proclamamos','2021-06-17'),(3129,171,'Creacin del Menuside','En el da de hoy empec a crear el menuside con ayuda de algunas informacin de google para la elaboracin de la misma, para poder implementarla a todas las vista de nuestra pagina web.','2021-06-17'),(3130,204,'Realic mi FODA','Basicamente realic mi FODA y termine de instalar el GanttProject','2021-06-17'),(3131,192,'Proyecto','Realizamos aadidos minimos en la parte de diseo y corregimos pequeos errores que desordenaban ciertas partes de la pagina principal.','2021-06-17'),(3132,177,'trabajo grupal','','2021-06-18'),(3133,169,'Parqumetro - Insercin de un mapa en la pgina 2','Finalmente no pudimos utilizar la API de Google Maps ya que por alguna razn no cargaba la pgina, ni siquiera poniendo el API Key, segua mandando errores. As que nos decimos por usar alternativas como Leaflet / OpenStreetMaps que son ms flexibles por lo visto para las pginas web. Hoy no hubo mucho tiempo para trabajar pero se hizo lo que se pudo. Seguiremos intentando hacer funcionar el mapa en la pgina para as seguir con lo dems.','2021-06-18'),(3134,175,'Fallo','Hoy no pudimos solucionar el problema de los puntos de interes del mapa si no que vamos a tener que rehacer devuelta el codigo ya que de la manera que lo estabamos haciendo hay una api que es la que permite mostrar el mapa con la geolocalizacion es de paga y optamos hacerlo con leaflets.','2021-06-18'),(3135,201,'Grupo parking','Para poder seguir con el trabajo grupal seguimos armando el cdigo basndonos en que nos pueda cargar el mapa con ayuda del destinatario que nos brinda google, que necesitamos un dominante para poder meterlo publico en dentro del grupo pero como no se puede cabamos la forma de boostrap para que solo nos brinde a nosotros en privado como creadores del programa','2021-06-18'),(3136,171,'Creacin de la vista de Ajuste','En el da de hoy termine de hacer el menuside desplegable y un las vistas con los links del men y cree la vista de Ajuste de mi pagina con el formulario de editar datos e insertar una foto de perfil. ','2021-06-18'),(3137,199,'continue con el tp integrador','continue con la investigacion','2021-06-18'),(3138,195,'informacion de como hacer los ejercicos para los cursos','estuvimos buscando informacion sobre como mover un objeto a un lugar especifico al hacer clic a traves de java, esto seria unos de los modos de ejercicios ','2021-06-24'),(3139,198,'','Hoy busque informacin y imgenes para armar la pgina de inicio y lo escrib en un Word simulando como es que va a quedar','2021-06-24'),(3140,191,'Buscar informacin para el proyecto','Estuvimos googleando codigo util para disear nuestra pagina web, la idea es  jugar con las imagenes dentro de la pagina.','2021-06-24'),(3141,172,'24/6 Clase','En el da de hoy los integrantes del grupo seguimos buscando tecnologas para nuestra aplicacin. No nos convenci la de Google as que al parecer haremos todo por nuestra cuenta.','2021-06-24'),(3142,192,'Proyecto en clase','En la clase de hoy, 25/06/21, una semana antes del proximo punto de revision de proyecto y carpeta de campo, nos falta agregarle un par de cosas para poder tener algo mas completo, pero por el momento tenemos lo suficiente, igualmente esta semana se avanzo poco y de a poco se va a completar el proyecto, sea en clase o no. Estas dos clases arreglamos y completamos principalmente el index y el login, que eran quizas los mas incompletos o pocos echos.','2021-06-24'),(3143,171,'Finalizando las vista (24/06/2021)','En el de hoy termine de realizar las vistas y empec a decorarlas con algunos componentes de Bootstrap, pero investigando un poco, encontr con Materialize un framework muy bueno, as que estoy pensando remplazar Bootstrap por Materialize, en algunas vistas.','2021-06-24'),(3144,171,'Cambio de Framework ','En el da de hoy, cambie una de las vista por Materialize y en mi opinin me pareci mejor que el anterior ( Bootstrap ), as que decid optar por este framework en cada vista ya terminada, aunque signifique empezar de nuevo, pero al menos tendr una base hecha para la semana del prximo punto de control.','2021-06-25'),(3145,161,'Clase random 29/06/2021','realize una investigacion de como hacer un cambio de &quot;vista&quot; con moongo react y nodejs y termine encontrando como realizar el diaframa de moongo','2021-06-29'),(3146,166,'Cambio de planes xd','Vuforia no es compatible con WEBGL as que toca usar unreal engine u otros mtodos como javascript, o C# con JSARToolKit.','2021-06-29'),(3147,184,'Pgina login','Trabaj en la vista para iniciar sesin, haciendo su respectivo formulario y una animacin css de iconos.','2021-06-29'),(3148,170,'Presentacin','Hoy corregimos algunas vistas y las modificas, algunas no se modificaran ms adelante. Tambin vimos un cdigo de php para la condicin de iniciar sesin. Tambin hicimos la portada o presentacin del proyecto en un word.','2021-07-01'),(3149,169,'Maps','Sigue sin funcionar, seguimos probando con el api key de Google pero lamentablemente no funciona. Sumado a que tenemos problemas con la red escolar ya que no nos deja entrar a la pgina web (la cual la hosteamos en un servidor gratis)','2021-07-01'),(3150,177,'trabajo proyecto','el da de hoy se plantearon dudas a cerca de la esttica de la pagina, por lo que se cambio los colores de la misma.\r\ntrabaje en la adaptacin del logo en el nuevo tema del proyecto.\r\n','2021-07-01'),(3151,176,'Maps','Sigue sin funcionar, seguimos probando con el api key de Google pero lamentablemente no funciona. Sumado a que tenemos problemas con la red escolar ya que no nos deja entrar a la pgina web (la cual la hosteamos en un servidor gratis:)','2021-07-01'),(3152,173,'Foda y gantt','Complete el foda con la conclusion ya que me faltaba eso y segui el gantt','2021-07-01'),(3153,175,'MAPA','Sigue sin funcionar, seguimos probando con el api key de Google pero lamentablemente no funciona. Sumado a que tenemos problemas con la red escolar ya que no nos deja entrar a la pgina web (la cual la hosteamos en un servidor gratis):','2021-07-01'),(3154,179,'Presentacion y preparacion de el proyecto y continuacion del manual de usuario','En el dia de la fecha continue con el manual de usuario prosiguiendo con lo mismo que hice en las bitacoras anteriores, es decir continue insertando varias capturas ya que la persona encargada de las vistas de proyecto las hizo y finalmente puedo continuar con el proyecto mucho mejor.\r\nAdemas hoy arregle imperfeciones de los Html.\r\nCon mis compaeros de proyecto nos pusimos de acuerdo en como sera el dia de maana ya que tenemos que presentar varias cosas!\r\n','2021-07-01'),(3155,171,'Presentacin del Proyecto','En el dia de hoy presente el proyecto, y tuve que realizar cambios en el ultimo momento, ya que maana vendran lo de la DEP, alistar mi carpeta de campo y la word de la presentacin del Proyecto con ayuda de mis compaeros','2021-07-01'),(3156,173,'Terminado del ganttt yrevision ','Terminamos de poner el tiempo que tomara cada tarea con su receptivas fechas y dems,  se reviso el cdigo del bot donde se agregaron mas preguntas para que pueda reconocer y ampliar su vocabulario. ','2021-07-02'),(3157,172,'Clase 2/6','En el da de la fecha vamos a recibir a un supervisor de la DET que va a estar comprobando nuestro trabajo en el proyecto grupal hasta ahora. Tuvimos tiempo suficiente de terminar nuestro diagrama de Gantt y el Foda','2021-07-02'),(3158,169,'Maps','Sigue sin funcionar.','2021-07-02'),(3159,179,'Realizacin en grupo','En el da de la fecha pude resolver mis conflictos que tenia con el diagrama de Gantt, tenia un problema con la tarea sucesiva que me des configuraba todas las fechas de las tareas que hice, es un programa un poco complejo de usar el GanttProject pero le agarras la mano y ya te la sabes toda.\r\nAdemas hoy con mis compaeros terminamos de hacer la presentacin inicial del proyecto de &quot;Aprende Conmigo&quot; en el que nos pusimos de acuerdo en las prximas tareas que quedan del proyecto. Cada vez queda menos, supones que ya estar para agosto. El mes que viene tendramos el proyecto finalizado. Ahora estamos arreglando varias imperfecciones que quedan.\r\nEn mi parte de la presentacin tuve que escribir acerca de la plantiamento del problema del proyecto, la problemtica seria que los alumnos no entren a las clases.','2021-07-02'),(3160,177,'trabajo de redaccin ','el da de hoy e estado trabajando el la redaccin del una justificativo para el proyecto grupal, ademas de continuar con la modificatorio del logo para adecuarlo a la nueva paleta de colores en el pagina ','2021-07-02'),(3161,171,'Presentacin del proyecto','En el da de hoy armamos en equipo la presentacin y empece a crear la tapa y parte de lo que me tocaba escribir, lego aliste las vista y vi que eran un poco colorido, entonces pens en cambiar los temas de colores un poco mas colores pasteles o oscuros','2021-07-02'),(3162,174,'Dia 02 del 7 de julio','el dia de hoy nos preparamos para para presentar el proyecto al inspector de curso para ver como vamos con el proyecto.\r\nA dia de hoy tenemos el codigo como si fuese un chat de whatsapp ','2021-07-02'),(3163,201,'grupo de parkinson','Continuamos con el grupo de la escuela para poder encargarnos del codigo en plano de nuestra tarea que esta media avanzada para poder publicarlo en google y poder acceder y nos muestre el mapa','2021-07-02'),(3164,202,'02/07/2022','Estuvimos preparando el proyecto en grupo para el checkpoint del bot','2021-07-02'),(3165,189,'8-07','Hoy continuamos con el proyecto, fue un dia bastante productivo, aunque difcil ya que con mi grupo nos cost mucho hacer la pgina medianamente funcional, y nos tuvo que ayudar el profesor, pero a fin de cuenta logramos nuestro cometido del da de la fecha','2021-07-08'),(3166,190,'8-07','hoy lo que hicimos fue continuar con el proyecto grupal de la pagina para nuestro colegio, logramos avanzar bastante sobre el mismo.','2021-07-08'),(3167,191,'Buscando mas informacion','En el dia de hoy nos acercamos mucho mas en el objetivo, que es especificamente el que al tocar una imagen o un objeto se mueva hacia un lugar en especifico, encontre algunos links, pero ninguno te decia especificamente como hacerlo.','2021-07-08'),(3168,194,'Proyecto','Hoy seguimos trabajando con el proyecto.','2021-07-08'),(3169,198,'','Investigue como se arrastra y suelta un objeto y tambin investigue como mover un div haciendo clic con el mouse todo con JavaScript','2021-07-08'),(3170,192,'Proyecto en clase','Hoy dia 08/07 seguimos presencialmente con el proyecto de la red social, investigamos mas sobre otras caracteristicas para agregarle y como solucionar problemas en el index, login y iniciar sesion, ','2021-07-08'),(3171,195,'funcionalidad de los ejercicios de la pag','estuvimos trabajando todo el equipo en poner a funcionar ejercicios para la pag, ejemplo: el codigo correcto se dividira en 4 partes desordenadas y al hacer clic se va a un lugar, si te das cuenta que esta mal podes sacarlo, al hacer de nuevo clic y volvera esa parte abajo donde comenzo. ','2021-07-08'),(3172,163,'Checkpoint Julio','Checkpoint julio ms grfico de casos de uso','2021-07-13'),(3173,161,'Clase N21 13/07/2021','El dia de hoy el profesor nos explico brebemente que es un diagrama de de entidad relacion ademas de decirnos los proximos objetivos para el siguiente chetpoint','2021-07-13'),(3174,166,'Testeos','Hoy ya empec a testear hosteando la vista con el cdigo javascript en glitch.com y al principio la pgina se quedaba en &quot;Loading, please Walt...&quot; pero se solucion actualizando algunos links.','2021-07-13'),(3175,161,'clase 21 14/07/2021','en la clase de hoy actualize la carpeta de campo ademas de buscar algo mas de informacion sobre nodejss y la conexion a moongo','2021-07-14'),(3176,177,'dia de escuela','el dia de hoy trabaje mucho','2021-07-16'),(3177,170,'Vistas','Finalizamos las vistas, mejoramos la presentacin del foda y empezamos la programcin para la unin entre las base de datos con el programa.','2021-07-16'),(3178,174,'dia 16 de julio','el dia de hoy agregamos mas preguntas al chatbot','2021-07-16'),(3179,179,'Trabajos pendientes y propuestas durante y despues del receso invernal 2021','En el dia de la fecha estuve con mis compaeros de escuela poniendonos de acuerdo con lo que queda y lo que tenemos que seguir haciendo durante el receso invernal 2021 de nuestro proyecto de &quot;Aprende conmigo&quot;.\r\nMi trabajo sera terminar el manual de usuario ya que por fin tengo todas las vistas de la aplicacion web y entonces podre terminar mi manual de usuario para que las persones con poca experiencia en las computadoras y el mundo tecnologico en general puedan acceder sin nungun tipo de problema, el manual o guia de usuario sera muy util para aquellos que tengan dudas del funcionamiento de este. \r\nEl manual estara ya disponible aproximadamente el 2 de agosto, cuando termine el receso invernal.','2021-07-16'),(3180,176,'Cambio de Trabajo Practico a Bolsa de Trabajo','El dia de hoy junto con mis compaeros realizamos el FODA y el prototipado rapido del Nuevo Trabajo Practico Bolsa de Trabajo para el colegio el cual consiste en crear perfiles de usuarios para que las empresas puedan contactarnos al finalizar 6to.','2021-07-16'),(3181,173,'16 de julio','hoy agregamos mas preguntas al chat','2021-07-16'),(3182,171,'Receso Invernal','En el dia de hoy, ayude a mis compaeros a realizar sus trabajos y empezamos a instalar