investigar como estamos en nuestro proyecto de pagina y empezar a codificar con CodeIgniter, ayudando a mi grupo a poder seguir avanzando en nuestro trabajo. ','2021-08-05'),(3191,172,'Clase 5/8','En el da de la fecha nos juntamos con nuestro grupo para seguir aadiendo lineas a nuestro cdigo. Para asi tener mas respuestas a las consultas que ingrese el usuario.','2021-08-05'),(3192,192,'Proyecto en clase presencial','El dia de hoy 05/8/2021 avanzamos con todo el proyecto, por sobretodo con la pagina principal, aadiendo y cambiando cosas, utilizando bootstrap y tambien usando codigo de texto normal para cosas como los tamaos y resoluciones de imagenes principales. Tuvimos complicaciones con el tema de la resolucion y el tamao de la pagina principal, dado que bootstrap no nos dejaba, por lo que lo modificamos con atom y pudimos solucionarlo.','2021-08-05'),(3193,189,'5/8','El dia de la fecha continuamos con el proyecto haciendo la vista principal en bootstrap, haciendola mas vistosa y funcional, tuvimos complicaciones pero el profesor nos ayud y pudimos avanzar','2021-08-05'),(3194,170,'Conexiones de la pagina','Seguimos conectando cada vistas de la pagina, y tuvimos un inconveniente para poder cambiar parte del diseo de la vista de curso. ','2021-08-06'),(3195,179,'Segundo dia vuelta a clases','En el dia de la fecha, continue con mi trabajo de el manual de usuario o tambien conocida como la guia de usuario para que todas aquellas personas con dudas acerca de una pagina web o aplicacion web puedan resolver y solventar todas aquellas dudas de cualquier indole sobre la pagina web, es decir la pagina Aprende conmigo.\r\nContinue con mi trabajo reiteradas veces, es decir continue con el manual aadiendo capturas de pantalla y especificando cada parte de la aplicacion web de mi proyecto y de mis compaeros de escuela de la tecnica 32 de 14. \r\nPor suerte cada vez queda menos que hacer y estoy agradecido con todos y todas por este ao lectivo del 2021','2021-08-06'),(3196,177,'trabajo de imagen','el da de hoy reanude mi trabajo del proyecto de la pagina web','2021-08-06'),(3197,174,'dia 6 del 8','El dia de hoy creamos nuevas vistas para la paigna del chatbot del colegio asi se hace mas didactico y mas lindo para la gente que lo pueda ver.\r\ncon bootstrap creamos la vista de inicio y maquetamos las paginas de contactos, chatbot e inicio ','2021-08-06'),(3198,172,'Clase 06/08','El dia de hoy creamos nuevas vistas para la paigna del chatbot del colegio asi se hace mas didactico y mas lindo para la gente que lo pueda ver.\r\ncon bootstrap creamos la vista de inicio y maquetamos las paginas de contactos, chatbot e inicio ','2021-08-06'),(3199,171,'Carpeta de Campo','En el dia de hoy realice mi seguimiento de la carpeta de campo y ayude a mi compaeros en algunas configuraciones, luego empezare a realizar algunos detalles que faltan en nuestro proyecto, y realizamos el logo de nuestro proyecto.','2021-08-06'),(3200,197,'INSTALACION UBUNTU EN VSPHERE ','Descarga de ubuntu en un usb, abrimos el vsphere client configuramos la virtual machine, cuando ya la tenemos lista nos dirigimos a getting started y despues a options, boot options y le hacemos click en force BIOS Setup. Luego iniciamos la maquina virtual y ponemos usuario y contrasea y idioma. Le damos en siguiente y esperamos a la instalacion.','2021-08-06'),(3201,173,'6 de agosto','El dia de hoy creamos nuevas vistas para la paigna del chatbot del colegio asi se hace mas didactico y mas lindo para la gente que lo pueda ver.\r\ncon bootstrap creamos la vista de inicio y maquetamos las paginas de contactos, chatbot e inicio ','2021-08-06'),(3202,204,'Comienzo proyecto','Ide mi proyecto y comenc a realizar el cdigo del mismo.','2021-08-06'),(3203,182,'Practicas Profesionalizantes - 11/8','El da de la fecha se realiz un anlisis e investigacin acerca de &quot;formik&quot; implementndolo en el formulario correspondiente para darle una apariencia mucho mas simple y esttica, este formulario realizado con formik, reemplazo el anterior formulario realizado en React','2021-08-11'),(3204,187,'dia ??','Este dia avanzamos con la pagina planeando mejor como realizar el projecto y seguimos investigando como usar una raspberry en el projecto de acuaponia. ','2021-08-11'),(3205,164,'Empezamos la base datos','El da de hoy realizamos un diagrama sobre nuestra base de datos la cual se encuentra ya casi completada y le faltan algunos retoques.','2021-08-11'),(3206,188,'proyecto acuaponia','El da de hoy nos dedicamos a investigar sobre la placa raspberry pi y sobre los sensores que utilizaremos en el proyecto, aparte de corregir el cdigo y modificar algunas funciones.','2021-08-11'),(3207,161,'Clase N2 11/08/2021','El dia de hoy los profesores revisaron mi avance en la carpeta de campo del proyecto ademas de charlar con mis compaeros de grupo sobre el css de la pagina','2021-08-11'),(3208,181,'Acuaponia','El da de hoy nos dedicamos a investigar sobre la placa raspberry pi y sobre los sensores que utilizaremos en el proyecto, aparte de corregir el cdigo y modificar algunas funciones.','2021-08-11'),(3209,168,'Diagrama de la base de datos','Comenzamos la creacin del diagrama de la base de datos con draw.io, dentro de ella pusimos las categoras que necesitaremos para llevar adelante el proyecto.','2021-08-11'),(3210,166,'Desarrollo y pruebas','Hoy trabajamos en la parte del marcador y el objeto 3d del proyecto, empez como un dinosaurio chiquito, pero se pudo mejorar haciendo pruebas de escala, rotacin y posicin.','2021-08-11'),(3211,170,'Armado de nuevas vistas','Hicimos nuevas vistas y mejoramos otras ya realizadas. Enlazamos las vistas nuevas y hicimos la realizacion de la base de datos','2021-08-12'),(3212,179,'Variedad','En el dia de la fecha hoy he hecho varias cosas respecto al proyecto de aprende conmigo de la materia de practicas profesionalizantes. Con mi compaera de proyecto la seorita Daiana Elizabeth Alvarez Ayllon hicimos la base de datos de el proyecto, creando diversas tablas como register, inicio, contactanos, usuarios, etc. En esas tablas cargamos diversos datos como nombres, apellido, ao de nacimiento, edad, materia que sea necesaria inscribirse, email, contrasea, entre otras.\r\nAdemas continue con mi carpeta de campo personal y el manual de usuario del proyecto, principalmente aadi capturas de pantalla de la base de datos, tablas, y de los insert.\r\nIncluso estamos pensando modificar un poco el logo de nuestro proyecto informatico que se llama &quot;Aprend conmigo&quot; y quisimos aadirle una nueva bombilla, es decir una lampara o tambien conocida popularmente por la poblacion Argentina y de muchos paises de latinoamerica, me refiero al nombre de &quot;FOCO&quot;\r\n','2021-08-12'),(3213,171,'Creando base de dato','En el da de hoy termine de arreglar algunos cambios en las vista, y cree la pagina de comentarios de nuestro proyecto para cada materia y con mi compaero creamos la base de datos e investigamos un poco sobre las conexiones entre tablas (materias, registrarse, materias con los datos del usuario, sistemas de comentarios de preguntas y respuestas) luego insertamos algunos datos en cada tablas. Despus acordaremos en crear un nuevo logo.','2021-08-12'),(3214,177,'trabajo de miradassssss','hoy e mirado para poder evaluar mi funcin en el proyecto trabajado actualmente, sin resultados. \r\nFFFFF ','2021-08-12'),(3215,173,'12 de agosto','en el dia de la fecha hicimos la vista de inicio y corregimos el inicio, colocamos todos los links en sus respectivo botones, agregamos preguntas ','2021-08-12'),(3216,175,'BOLSA DE TRABAJO','El dia de hoy estuvimos trabajando con el cierre del proyecto, aunque tuvimos unos problemas con errores de codigo y errores en bootstrap studio\r\nnos falta completar el login, register y el log out. y vincular la base de datos con el proyecto','2021-08-12'),(3217,174,'dia 12 8','en el dia de la fecha hicimos la vista de inicio y corregimos el inicio, colocamos todos los links en sus respectivo botones, agregamos preguntas ','2021-08-12'),(3218,195,'scala y onlick de nuevo ','investigamos este nuevo lenguage que podria ser util, y otra ves volvimos con el tema del onclick(). aparte completamos la carpeta de campo personal','2021-08-12'),(3219,172,'12 del 8','en el dia de la fecha hicimos la vista de inicio y corregimos el inicio, colocamos todos los links en sus respectivo botones, agregamos preguntas ','2021-08-12'),(3220,202,'12 8','en el dia de la fecha hicimos la vista de inicio y corregimos el inicio, colocamos todos los links en sus respectivo botones, agregamos preguntas ','2021-08-12'),(3221,176,'BOLSA DE TRABAJO','El dia de hoy pulimos la pagina principal de los estudiantes , redimencionando las fotos y el texto. Al terminar la clase empezamos a vincular y crear la respectiva Base de Datos','2021-08-12'),(3222,190,'12/08','El da de hoy, lo que hicimos fue realizar la carpeta de campo grupal. \r\n','2021-08-12'),(3223,192,'Proyecto PP','Hoy seguimos en grupo agregando contenido a la pagina de bienvenido, inicio y registrarse, y tambien nos centramos mas en la carpeta de campo porque muy pronto se va a realizar uin checkpoint y ya tenemos todo listo para poder presentar.+\r\n\r\n','2021-08-12'),(3224,192,'Proyecto PP','Hoy seguimos en grupo agregando contenido a la pagina de bienvenido, inicio y registrarse, y tambien nos centramos mas en la carpeta de campo porque muy pronto se va a realizar uin checkpoint y ya tenemos todo listo para poder presentar.+\r\n\r\n','2021-08-12'),(3225,190,'12/08','El da de hoy, lo que hicimos fue realizar la carpeta de campo grupal. \r\n','2021-08-12'),(3226,190,'12/08','El da de hoy, lo que hicimos fue realizar la carpeta de campo grupal. \r\n','2021-08-12'),(3227,192,'Proyecto PP','Hoy seguimos en grupo agregando contenido a la pagina de bienvenido, inicio y registrarse, y tambien nos centramos mas en la carpeta de campo porque muy pronto se va a realizar uin checkpoint y ya tenemos todo listo para poder presentar.+\r\n\r\n','2021-08-12'),(3228,171,'Carpeta de Campo','En el da de hoy realice la carpeta de campo, ordenando los das cronolgicamente, algunos cambios y detalles ortogrficos, escribiendo los links de fuente de informacin e investigacin, luego tome capturas de las vistas y describiendo cada una de ellas mostrando as como fue cambiando cada momento hasta la fecha.  ','2021-08-13'),(3229,179,'Carpeta de campo','En el da de la fecha estuve toda la tarde del viernes con mi carpeta de campo personal, estuve agregando capturas de pantalla de las vistas del proyecto &quot;Aprende conmigo&quot; y describindolas y agregando algn que otro comentario. Fui explicando los cambios que hice en mi carpeta de campo, lo errores que tuve y que actualice.\r\nCambien puse una captura de pantalla de el cdigo de la vista, era de una etiqueta &lt;p&gt; que deca &quot;lorem ipsus..&quot; en latin me parece, entonces la cambie a una descripcin correcta y como debe ser de las materias asignadas que eran matemticas, historia y la posibilidad de aadir una nueva materia si as lo deseas o lo quieres. Las descripciones las tome de paginas webs como\r\n&quot;https://definicion.de/historia/&quot; donde es una enciclopedia, como una wikipedia hasta una biblia para algunos internautas informaticos, geeks apasionados por la tecnologa y las computadoras, casi no hace falta buscar definiciones en un tipico y normal diccionario, Internet lo tiene todo!!','2021-08-13'),(3230,177,'nada nada','nada nada nada','2021-08-13'),(3231,176,'BOLSA DE TRABAJO','El dia de hoy casi ni pudimos trabajar porque la pc andaba para atras y apenas pudimos modificar el login','2021-08-13'),(3232,189,'13-08','El da de la fecha continuamos con la carpeta de campo','2021-08-13'),(3233,173,'13 de agosto','En el dia de la fecha, al entrar al drive donde guardamos nuestro progreso en el proyecto nos encontramos con que no guardamos los archivos actualizados y estan en un pendrive en manos de un compaero el cual no vino y no vendra hasta el viernes de la semana que viene. De igual manera estuvimos pensando ideas para implementar al bot.','2021-08-13'),(3234,172,'Clase 13/08','En el dia de la fecha, al entrar al drive donde guardamos nuestro progreso en el proyecto nos encontramos con que no guardamos los archivos actualizados y estan en un pendrive en manos de un compaero el cual no vino y no vendra hasta el viernes de la semana que viene. De igual manera estuvimos pensando ideas para implementar al bot.','2021-08-13'),(3235,175,'DUDAS','hoy estuvimos aclarando dudas, y hablando sobre como podemos terminar el login y la base de datos','2021-08-13'),(3236,201,'GRUPO','Estuvimos continuando con el proyecto, nos dificulto en la parte de la base de datos poder ingresar, pero aadimos nuevas tablas para poder terminar con lo que estuvimos ayer, para podercargar la pagina y los botones cuando se aplican para poder trabajar','2021-08-13'),(3237,204,'Arregle errores y agregu unos SVGs','Correg unos errores que hacan que independientemente de la cuenta con la que te loguees, mostraba la misma base de datos. tambin agregu SVGs al men para cerrar sesin, aadir registros y filtrar.','2021-08-13'),(3238,192,'Proyecto PP','En el da de la fecha terminamos de hacer unos cambios en lo que sera el &quot;bienvenido&quot; que da la pgina una vez se accede con el login, y sobretodo nos centramos en terminar la carpeta de campo, aadiendo contenido de lo realizado entre ayer y hoy para as completarla.','2021-08-13'),(3239,203,'Creacin de diagrama de la DB','Creamos el diagrama de la base de datos pblica en Lucidchart. Incluye las 4 colecciones.','2021-08-17'),(3240,188,'organizacin de la carpeta','Hoy estuvimos organizando y codificando las modificaciones necesarias para que nuestra pagina sea responsive ,y de paso estuvimos escribiendo la carpeta de campo.\r\n\r\n\r\npd:Lautaro Arroyo hizo un buen trabajo','2021-08-17'),(3241,182,'	Practicas Profesionalizantes - 17/8','El dia de la fecha realizamos el diagrama de la base de datos con tablas no relacionales, indicando los campos y los valores que reciben cada uno en dicho caso','2021-08-17'),(3242,168,'Avance en la carpeta de campo','Junto a mis compaeros de proyecto retomamos la carpeta de campo, llenando con la nueva informacion e imagenes el archivo de word.','2021-08-17'),(3243,187,'dia ???','Hoy investigamos con respecto a la base de datos y realizamos una investigacion con respecto a la codificacion con respeco a raspberry.','2021-08-17'),(3244,164,'Actualizacion de la carpeta de campo','el dia de hoy nos pusimos al dia con la carpeta de campo modificando en la carpeta asi quedaba bien','2021-08-17'),(3245,184,'&gt;&gt; Bitcoras en conjunto','Bitcora 17/08\r\nTtulo: Ingreso de nuevos registros\r\nDescripcin: Adapt los formularios Formik para que el administrador pueda agregar nuevos registros. Implement validaciones de datos, preview de imgenes y envo de informacin en formato json.\r\n\r\nLas siguientes bitcoras no han podido cargarse en su momento puesto que esos das no se habilit su subida:\r\n\r\nBitcora 22/06\r\nTtulo: Rediseo de las pginas de contacto y preguntas frecuentes\r\nDescripcin: Hice un rediseo de estas pginas puesto que los anteriores no coincidan con el estilo de la pgina y rompan con la esttica del branding. Al igual que la semana pasada, agregu la lectura de objetos json para su exhibicin.\r\n\r\nBitcora 23/06\r\nTtulo: Continuacin del trabajo de ayer\r\nDescripcin: Contine el trabajo de ayer terminando con un diseo de la pgina ms sutil, flexible y cmoda a la lectura del usuario. Cambi el formato de la exhibicin de las preguntas y respuestas donde muestre las preguntas y al hacer clic en ellas despliegue la respuesta.\r\n\r\nBitcora 30/06\r\nTtulo: Animacin de iconos para la tarjeta del formulario de login\r\nDescripcin: Trabaj en una animacin sencilla de keyframes para la carta de inicio de sesin y registro de usuarios. Simplemente es una animacin decorativa que aada de manera resumida lo que puede esperar el administrador en el dashboard.\r\n\r\nBitcora 06/07\r\nTtulo: Formato y presentacin de las cartas de noticias\r\nDescripcin: Incorpor funciones para que puedan crearse estas cartas de una manera ms flexible con componentes y contenido flexible. De mismo modo, este contenido es ordenado y limitado al tamao ms ptimo.\r\n\r\nBitcora 03/08\r\nTtulo: Categoras de la pgina de contacto\r\nDescripcin: En lugar de disear una pgina para contactar a los administradores decid implementar formularios con las casillas correspondientes a la categora que decida ver el usuario. El mismo botn que enviaba al usuario a la antigua vista ahora lo redirecciona a esta categora en la pgina de contacto. Las opciones para mostrar son: Legal, Colaboracin Voluntaria, Patrocinio o Relacin Empresarial, Problema Tcnico y Consulta General.\r\n\r\nBitcora 04/08\r\nTtulo: Resize del header\r\nDescripcin: Debido a que la navegacin es continua el usuario deber ver la informacin que solicite. Por eso, ahora al cargar una nueva vista el header que contena la ilustracin y el encabezado ahora se ver reducido en tamao y nicamente muestra el fondo y las partculas.\r\n\r\nBitcora 07/08\r\nTtulo: Correccin de estilos y breakpoints del carrusel\r\nDescripcin: Modifiqu la estructura y el funcionamiento del carrusel que exhibe al equipo de trabajo.\r\n\r\nBitcora 11/08\r\nTtulo: Envo de formulario en formato json\r\nDescripcin: Utilic el mdulo Formik, un mdulo que integra formularios y su respectivo funcionamiento en javascript, implementndolo en la interfaz de administrador para que los valores y los datos escritos puedan guardarse o exponerse como un objeto.\r\n','2021-08-17'),(3246,161,'Clase N23 18/08/2021','el da de hoy realizamos varias pruebas con la conexin a la base de datos adems de buscar como hacer que el usuario pueda agregar valores a los campos de moongo\r\n','2021-08-18'),(3247,166,'Objeto animado','Hoy conseguimos hacer que el objeto 3D, en este caso el personaje WallE haga sus animaciones.','2021-08-18'),(3248,182,'Practicas Profesionalizantes - 18/8','El dia de la fecha fue destinado a la realizacin y coneccion de la base de datos a travs de mongo DB','2021-08-18'),(3249,167,'Carpeta de campo','lo del titulo','2021-08-18'),(3250,203,'Trabajo con node.js','En el da de hoy instalamos la base de datos en el localhost de una computadora de la escuela, y probamos a realizar algunas consultas con Node.','2021-08-18'),(3251,164,'La fuente de datos de nuestra base de datos','El dia de hoy buscamos servidores de anime los cuales nos proporcionen los datos que necesitamos para poder llenar nuestras bases de datos, obteniendo asi una pagina la cual adeas de tener los datos que buscamos tenia mas de lo que queriamos.','2021-08-18'),(3252,168,'Recuento de informacion db','Hoy estuvimos junto a nuestro grupo buscando informacin acerca de servidores que contengan los captulos de respectivos animes. Encontramos muchas paginas e informacin que ser subida a la carpeta de campo prximamente.','2021-08-18'),(3253,200,'Avance del proyecto grupal','Hicimos funcional toda la nueva vista principial(welcome), tanto como los botones de logout y cambio de contrasea, como tambin el pie de pgina que contiene la pgina oficial del colegio, las respectivas carreras con sus planes de estudio y las redes de la escurla','2021-08-19'),(3254,170,'Enlace de base de datos','En el dia de hoy estuve tratando de conectar la base con el programa tambin usando un cdigo para registrarse y que quede guardado en la base y poder iniciar sesin','2021-08-19'),(3255,189,'Avance del proyecto','El da de la fecha hicimos funcional la vista principal (welcome), donde tambin retocamos todo el proyecto para tenerlo casi listo, agregando funciones como el pie de la pgina y el poder agregar un avatar.','2021-08-19'),(3256,176,'Bolsa de Trabajo','El dia de hoy estuvimos realizando la configuracion del login , creando las tablas para el login y para subir un perfil al home de la pagina. Al finalizar el dia solo llegamos a terminar el login funcional pero la subida de archivos no quedo totalmente funcional.','2021-08-19'),(3257,171,'Presentimiento del Proyecto ','En el da de hoy comenc a editar La presentacin del proyecto, escribiendo las partes que hicieron cada miembro del equipo, sobre nuestro objetivo, el anlisis del FODA, el diagrama de Gantt para la administracin de las actividades, y los ltimos cambios de las vistas finales.','2021-08-20'),(3258,177,'repaso ','tras terminar el logo, me dedique el da de hoy a investigar/repasar los tipos de diagrama que debo hacer para el proyecto grupal, los cuales son: Diagrama de casos de uso, Diagrama de flujo, Diagrama de colaboracin.\r\n\r\n','2021-08-20'),(3259,177,'repaso ','tras terminar el logo, me dedique el da de hoy a investigar/repasar los tipos de diagrama que debo hacer para el proyecto grupal, los cuales son: Diagrama de casos de uso, Diagrama de flujo, Diagrama de colaboracin.\r\n\r\n','2021-08-20'),(3260,177,'repaso ','tras terminar el logo, me dedique el da de hoy a investigar/repasar los tipos de diagrama que debo hacer para el proyecto grupal, los cuales son: Diagrama de casos de uso, Diagrama de flujo, Diagrama de colaboracin.\r\n\r\n','2021-08-20'),(3261,179,'Diagrama de Gantt y carpeta de campo','En el da de la fecha estuve modificando fechas en el diagrama de Gantt, porque muchas tareas individuales del proyecto ya estn finalizadas/terminadas o en un rumbo favorable de una realizacin cercana, es decir que les falta poco.\r\nAdemas continu con mi carpeta de campo, entregue al profesor mi carpeta de campo que ya tiene 22 hojas completas, le voy a seguir aadiendo cosas nuevas respecto a mi desarrollo de la materia de practicas profesionalizantes. Puse cosas de el diagrama de Gantt, base  de datos, logotipo del proyecto, manual de usuario, complicaciones, cambios, conclusiones, pensamientos y sensaciones individuales. La clase siguiente pondr acerca de la presentacin del proyecto. En la presentacin del proyecto