9,'Carpeta de Campo','Hoy estuve realizando la carpeta de campo, completando lo que falta y corrigiendo algunas cosas junto a mis compaeros, para poder entregarla lo ms completa posible explicando todo el proceso del proyecto actual de la bolsa de trabajo y del anterior proyecto de parquimetro - estacionamiento','2021-08-20'),(3267,175,'Carpeta de campo','Hoy complete la carpeta de campo y ayude a mi compaero con el prototipado rapido y el foda','2021-08-20'),(3268,200,'Carpeta de campo','El dia de la fecha termine y entregue la carpeta de campo','2021-08-20'),(3269,187,'24-08','Hoy realizamos actualizaciones a la carpeta de campo y estuvimos viendo como realizar una base de datos con Json, y msql para que reacciones con la rasphberry.','2021-08-24'),(3270,203,'RASN-Avance en la carpeta','En el da de hoy no fue posible avanzar con el cdigo, as que decid actualizar la carpeta.','2021-08-24'),(3271,168,'Clase de repaso','Al no poder tener acceso a node en las computadoras decidi empezar a ver videos tutoriales que tenia guardados de mongodb con node.','2021-08-24'),(3272,184,'Presentismo','Asist a la clase sin embargo no tuve las herramientas para trabajar en el proyecto.','2021-08-24'),(3273,188,'24-08 organizacin de la carpeta','El da de hoy estuvimos corrigiendo y modificando la carpeta de campo,aparte de aadir las ultimas funciones y detallar algunas partes del cdigo. ','2021-08-24'),(3274,166,'Finalidad del proyecto','Hoy nos pusimos a pensar cual sera la finalidad del proyecto ya que hasta ahora no nos lo habamos puesto a pensar y ya tocaba.\r\nLo que se decidi fue que el objetivo sera hacer que cuando se enfoque la entrada del colegio desde la pgina muestre un objeto con informacin del colegio y si se clickea el objeto te redirecciona a la pgina del colegio.','2021-08-24'),(3275,167,'responsive','descripcion','2021-08-25'),(3276,187,'25-08','realizamos una bsqueda del funcionamiento de los distinto sensores a usar como sensor de luz o servomotores. Y realizamos actualizaciones con respecto a los distintos fallos de la pagina web.','2021-08-25'),(3277,182,'Practicas Profesionalizantes - 25/8	','El da de hoy, realizamos el desfrezo de las computadoras para poder guardar el repositorio correspondiente al proyecto en las computadoras del laboratorio, esto nos permitir avanzar mas rpido mientras pasen las clases debido a que no perderemos tiempo descargando y clonando el repositorio directamente desde GitHub','2021-08-25'),(3278,161,'Clase N|24 y 25    dias: 24/08/2021   y 25/08/2021','el dia 24/08 estuve probrando node 10.14.0 en windows 7 durante toda la clase intentando hacer que funcionara sin lograr esto.\r\n\r\nel dia 25/08 realizamos un avance en la parte de diseo en dos de las vistas ademas de actualizar el diagrama de gann y la carpeta de campo del proyecto','2021-08-25'),(3279,168,'Guardado de archivos y distribucion de tareas','En la clase del da de hoy, desfrezamos las computadoras y guardamos nuestro proyecto para as facilitar el acceso a los mismos en las clases siguientes. Adems de ello nos distribuimos las futuras tareas en el grupo, voy a comenzar a avanzar en la api que nos permite tener en la base de datos los animes.','2021-08-25'),(3280,166,'vistas','Hoy cambiamos los estilos de las vistas en las pginas con colaboracin de launick9.','2021-08-25'),(3281,188,'25-08 codificacin de los sensores ','El da de hoy estuvimos codificando las funciones que cumplirn los sensores que irn conectada a la placa raspberry , de tal forma tambin estuvimos viendo como conectarlos a la pagina web.','2021-08-25'),(3282,184,'Seleccin y display de datos con node y react','Logramos relacionar la conexin con la base de datos con node y obtener registros de ella para luego ser mostrados con react. Trabajamos con la coleccin de animales mostrando los registros conseguidos en formato JSON logrando que conserven la misma estructura que las colecciones de  muestra.','2021-08-25'),(3283,202,'dia 26 del 8','el dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3284,189,'Retoques','hoy hicimos retoques en la vista principal','2021-08-26'),(3285,189,'Retoques','hoy hicimos retoques en la vista principal','2021-08-26'),(3286,202,'dia 26 del 8','el dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3287,174,'26 del 8','el dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3288,190,'26-08','Hoy finalizamos el proyecto, solo nos queda la entrega de la carpeta de campo grupal.','2021-08-26'),(3289,200,'Index','El dia de la fecha optimizamos la vista principal','2021-08-26'),(3290,175,'LOGIN ','En la clase de hoy terminamos lo que es la parte del login falta modificar un par de cosas pero estamos bien, hicimos la parte del log out y tuvimos un problema con la version del xampp, tambien ayude a mi compaero a completar la presentacion del proyecto\r\n','2021-08-26'),(3291,173,'26 del 8','el dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3292,192,'Index','En el dia de la fecha terminamos de retocar todo sobre el index principal, corrigiendo los botones, el fondo y el tamao de un par de cosas.','2021-08-26'),(3293,172,'Dia 26/8','El dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3294,179,'Cerca del final','En el da de la fecha estuve continuando con el manual de usuario aadiendo capturas y comentarios, describ como funcionaria la vista de usuarios, miembros y clase.\r\nAdems contine con mi carpeta de campo escribiendo mi progreso del da, de alguna manera es como si hiciera dos carpetas de campo o dos manuales de usuario. Hoy fue un da bastante calmado, me falta una sola vista que es el progreso del usuario general donde se muestran las estadsticas del ya mencionado. Es una vista bastante sencilla que espero ya maana tenerla hecha!.','2021-08-26'),(3295,189,'Arreglar errores','Hoy arreglamos errores de cdigo y continuamos con la carpeta de campo','2021-08-27'),(3296,177,'.','.','2021-08-27'),(3297,200,'ARREGLOS','El dia de la fecha hicimos arreglos de codigo y continuamos con la carpeta de campo','2021-08-27'),(3298,171,'Agregando detalles del proyecto','En el da de hoy empec a arreglar algunos detalles de la carpeta del proyecto Aprende Conmigo, hablando con nuestro profesor, nos di algunos concejos de como hacer la presentacin, y con mi equipo planeamos acordar a realizar los diagramas que hacen falta y a ayudar a un compaero con la conexin de la base de datos.','2021-08-27'),(3299,169,'Revisin del cdigo de la pgina','hoy estuvimos revisando el cdigo de la pgina ya que tena varios errores, como que no se suban las imagenes ni las descripciones a los perfiles de la pagina, tambin que cuando queras ir al home, mandaba un error php','2021-08-27'),(3300,179,'Ultimos dias','En el da de la fecha hemos estado compartiendo una velada entre los participantes del proyecto, cada vez queda menos que hacer pero quedan cosas pequeas repartidas que aun no han sido resueltas o estn a medio camino de su nacionalizacin total.\r\nMi trabajo para la prxima clase es investigar acerca de diversos y varios diagramas o cuadros. Entre ellos estn el diagrama de flujo de datos, diagrama entidad relacin, diagrama de clase, diagrama de caso de uso y otro mas que ahora mismo no recuerdo con exactitud y total precisin en mi perpepcion visual de internauta. Mi compaero Brandon Basaldua deber encargarse del diagrama de caso de uso y yo tendr que  hacer el diagrama de entidad relacin. Estamos en esto juntos los dos.\r\nPara la prxima clase ya tendremos algunos diagramas si es posible y poder compartirlo en clase junto al resto del equipo del proyecto Aprende conmigo de la materia de practi