'Tabla de materias ','En el dia de hoy pudimos asignar las materias en la vista de cursos donde nos faltara asignar segn el usuario correspondiente. ','2021-11-18'),(3654,169,'mostrar ofertas de trabajo','hoy estuvimos desarrollando la vista donde se muestran todas las ofertas de trabajo, a su vez, tambien hicimos que las empresas puedan generar ofertas y esas ofertas aparezcan en la vista de las ofertas de trabajo','2021-11-18'),(3655,176,'mostrar ofertas de trabajo','El dia de hoy estuvimos trabajando con las vistas que nos faltaba terminar que son las de generar ofertas y ver ofertas de trabajo , y quedaron casi terminadas.','2021-11-18'),(3656,190,'18/11','Hoy termin de realizar la carpeta de campo individual para entregarla. ','2021-11-18'),(3657,201,'GRUPO','Terminamos con la parte de perfil del usuario y la configuracion del codigo','2021-11-18'),(3658,194,'Carpeta de campo','Hoy entregamos la carpeta de campo\r\n','2021-11-18'),(3659,172,'19/11','.','2021-11-19'),(3660,174,'19/11','.','2021-11-19'),(3661,189,'Inyection SQL','El da de la fecha hicimos inmune al proyecto de un inyection SQL, ya que modificamos para eliminar los caracteres especiales en el login, cosa que no se pueda atravesar la red de seguridad ','2021-11-19'),(3662,189,'Inyection SQL','El da de la fecha hicimos inmune al proyecto de un inyection SQL, ya que modificamos para eliminar los caracteres especiales en el login, cosa que no se pueda atravesar la red de seguridad ','2021-11-19'),(3663,201,'Carpeta de campo','Seguimos codificando el codigo pero en si ya lo tenemos finalizado, solo falta un par de cosillas con el empresas y login','2021-11-19'),(3664,190,'19/11','Hoy hicimos el inyection sql, para evitar posibles hackeos en nuestra pgina web.','2021-11-19'),(3665,173,'19/11','.\r\n','2021-11-19'),(3666,194,'Inject SQL','El da de la fecha hicimos inmune al proyecto de un inyection SQL, ya que modificamos para eliminar los caracteres especiales en el login, cosa que no se pueda atravesar la red de seguridad','2021-11-19'),(3667,179,'Carpeta de campo grupal','En el dia de la fecha he estado completando la carpeta de campo grupal, en ella escrib mi progreso de meses anteriores, como hice el diagrama de Gantt y partes del manual de usuario','2021-11-19'),(3668,181,'Test','En el dia de la fecha se hizo un testing en la pagina web\r\n','2021-11-23'),(3669,168,'Presentacion final','Mostre al profe los avances finales, y los resultados del producto.','2021-11-23'),(3670,217,'Tarea N1','Realizada y entregada, en proceso la tarea 2','2022-03-03'),(3671,220,'Introduccin a la materia y Tarea 1 y 2','En el da de la fecha, vimos la introduccin a P.P, y comenzamos con la realizacin del tp 1 y 2','2022-03-03'),(3672,208,'03/03 Conceptos bsicos de las Practicas Profesionalizantes',' Se realiz el formulario sobre prcticas profesionalizantes y adems se cre un mapa conceptual de los conceptos bsicos de las P.P. ,es decir, se la da fin al primer mdulo presentado en el classroom\r\n','2022-03-03'),(3673,219,'03/03/2022 - Presentacion de la materia','En el da de la fecha, vimos la introduccin a Practicas Profesionalizantes y comenzamos con la realizacin de las 2 primeras tareas. La tarea n1 (usando el contenido del pdf) ya esta completa, pero a la segunda aun le falta un poco de trabajo.','2022-03-03'),(3674,218,'Introduccin, Pautas y Primeras Actividades (Clase 1)','En la primera clase, se nos explico las condiciones para poder aprobar la materia adecuadamente. Entre ellas, estn:\r\n\r\n1. 200 Horas de ex cathedra.\r\n2. Justificar esas 200 horas.\r\n3. Realizar los trabajos prcticas asignados (evidentemente).\r\n\r\nDespus de esta explicacin, se nos dio acceso a los materiales de la materia para poder desarrollar el primer trabajo de todos, el cual se trato de un cuestionario donde tenamos que responder con la gua &quot;Introduccin a las Prcticas Profesionalizantes&quot;.\r\nLuego, tuvimos que realizar un mapa conceptual el cual deba contener los primeros conceptos abordados relacionados a las Prcticas profesionalizantes.','2022-03-03'),(3675,213,'Conceptos basicos de P.P (Tarea 1 y Tarea 2)',' Se realiz el formulario sobre prcticas profesionalizantes y adems se cre un mapa conceptual de los conceptos bsicos de las P.P. ,es decir, se la da fin al primer mdulo presentado en el classroom.','2022-03-03'),(3676,210,'Introduccion ,Tarea 1 y 2','Nos explicaron de que va la materia y luego nos juntamos en grupo para realizar un cuestionario sobre Practicas Profesionalizantes y un mapa conceptual.','2022-03-03'),(3677,211,'03/03/22 - modulo 1: tarea 1 y 2','En el da de hoy empezamos con Ciclo Inicial Modalidad Virtual Secuencia Didctica, empezando por un formulario sobre la introduccin a las Practicas Profesionalizantes y despus un mapa conceptual relacionado a los primeros conceptos abordados sobre las Practicas Profesionalizantes.','2022-03-03'),(3678,209,'TP 1-2 03/03/2022','En el dia de la fecha nos presentaron la materia e iniciamos leyendo unos pdf, para despus realizar el TP1 y avanzar el TP2, el cual esta casi finalizado.\r\n\r\n- Lectura de material\r\n- TP 1: Finalizado\r\n- TP 2: Casi finalizado\r\n','2022-03-03'),(3679,216,'Introduccin a la materia - Modulo 1','Hoy, como primer da con la materia de Prcticas Profesionalizantes, los profesores procedieron a comentarnos de qu se tratar la misma, las actividades que realizaremos y cmo debemos cumplir para su aprobacin.\r\nMe un al Classroom, all le lo adjuntado bajo el nombre de &quot;Modulo 0&quot; y luego comenc a trabajar con el material del &quot;Modulo 1&quot;, leyendo y viendo los vdeos adjuntados en este. Realic ya el primer cuestionario (Tarea N 1) de nombre &quot;Introduccin a las Practicas Profesionalizantes&quot; y comenc a bocetar en papel el mapa conceptual solicitado dentro de la Tarea N 2.','2022-03-03'),(3680,215,'03/03/2022 Prcticas Profesionalizantes','Le y vi los  2 videos del Modlo 1, termine la tarea N1 y tambien casi completo la tarea N2 del DET - Modlo 1.\r\nLa tarea N1 estaba relacionada con los 2 videos y la lectura que eran unas preguntas para responder.\r\n','2022-03-03'),(3681,212,'03/03/2022  -  Tarea numero 1 y 2.','En el da de hoy lemos la introduccin a las practicas profesionalizantes, lemos un PDF y vimos 4 vdeos referidos al tema. Luego realizamos 2 tareas. La primera es un cuestionario llamado &quot;Introduccin a las Prcticas Profesionalizantes &quot; el cual consista en 10 preguntas sobre lo aprendido el da de hoy. Para la segunda hay que realizar un mapa conceptual que contenga todos los conceptos abordados el da de hoy.','2022-03-03'),(3682,214,'Practicas Profesionalizantes- DET Modulo 1','Empece leyendo todo el material del modulo 1 junto a unos vdeos subtitulados sobre estudiantes que trabajan con las practicas profesionalizantes\r\nLa tarea 1 un cuestionario sobre el documento del modulo 1 me costo la ultima pregunta y le pregunte a un compaero despus empece la tarea 2 hacer mapa conceptual','2022-03-03'),(3683,218,'Habilidades Blandas y Competencias Profesionales (Clase 2)','Hoy realizamos el Tercer Modulo del Classroom, el cual estaba relacionado con el Curriculum Vitae. \r\nDespus de leer el PDF &quot;Gua de Habilidades&quot; y &quot;Gua de Armado de un Currculum Vitae&quot;, y con la informacin obtenida, responder el cuestionario, procedimos a realizar el test de habilidades blandas de Computrabajo.\r\nPara finalizar, se nos invito a hacer nuestro propio Currculum Vitae de forma personalizada, siguiendo los conejos dados en el PDF.','2022-03-04'),(3684,208,'Habilidades blandas y el acercamiento a un nuevo proyecto','Realizamos un test de habilidades blandas, nos explicaron como vamos a trabajar en el proyecto y ademas nos dieron una idea de como sacar la idea de un proyecto','2022-03-04'),(3685,210,'Bitacora 2 ','Estuvimos hablando de los proyectos que teniamos pensado hacer en esta materia mas adelante ','2022-03-04'),(3686,217,'Registro de Compu trabajo','hicimos el registro de y curriculum en la pagina web de compu trabajo, tambien se ustuvo debatiendo acerca de como se realizara el siguiente trabajo del ao','2022-03-04'),(3687,217,'Registro de Compu trabajo','hicimos el registro de y curriculum en la pagina web de compu trabajo, tambien se ustuvo debatiendo acerca de como se realizara el siguiente trabajo del ao','2022-03-04'),(3688,220,'Registro de Compu trabajo ','se realizo el registro de compu trabajo y se realizo dos test uno de competencias y de compu trabajo\r\n','2022-03-04'),(3689,222,'Scrap','vimos lo que es un proyecto con ejemplos,sobre cubrir las necesidades del cliente entre otras cosas','2022-03-04'),(3690,211,'04/03/2022 ','hoy hablamos de proyectos que bamos a hacer para el futuro','2022-03-04'),(3691,213,'Habilidades blandas , creacin de perfil profesional y orientacin para los proyectos','Hoy hicimos 2 cuestionarios para ver nuestro perfil profesional y terminamos la clase con los profesores orientndonos para la creacin de los futuros proyectos ','2022-03-04'),(3692,209,'TP2 - Habilidades Blandas - CompuTrabajo - Propuesta de proyectos','Hoy termine el TP 2 del DET, empece a leer el material de Habilidades Blandas, hice el formulario de competencia e hice el test de habilidades blandas de CompuTrabajo.\r\n\r\n-Lectura de material Habilidades Blandas\r\n-TP2: Finalizado\r\n- Test de CompuTrabajo\r\n- Repaso de Scrum\r\n- Propuesta de proyectos','2022-03-04'),(3693,212,'04/03/2022','El da de hoy hicimos 2 cuestionarios acerca de habilidades blandas en Computrabajo y una encuesta de habilidades sobre la materia.','2022-03-04'),(3694,214,'Scrum','realizamos un repaso corto sobre la metodologia de trabajo scrum y realizamos un conjunto de ideas para ejemplos de programas','2022-03-04'),(3695,221,'04/03/22 Encustas y Formularios','Estuvimos realizando encustas y formularios sobre como es o seria nuestro desempeo en el ambito laboral. \r\nTambien estuvimos discutiendo sobre como realizar un proyecto y como llevarlo a cabo.\r\nRepasamos scrum y planteamos como llevaremos a cabo las actividades grupales a lo largo del ao.','2022-03-04'),(3696,216,'Encuesta de habilidades','Al ingresar se nos dej como tarea la realizacin de un formulario del Classroom para conocer nuestras habilidades dentro de diferentes mbitos grupales de trabajo, luego se nos hizo registrarnos en Computrabajo para realizar otra encuesta la cual descargamos como PDF y subimos a una tarea dejada en el Classroom.\r\nAl final de la clase repasamos la modalidad de Scrum.','2022-03-04'),(3697,215,'DIA 203/04/2022','Realize la encuesta de habilidades y HABILIDADES BLANDAS - COMPUTRABAJO y complete el test de habilidades y lo subi al classroom\r\n','2022-03-04'),(3698,223,'Formularios y propuestas de proyectos','Creamos una cuenta en computrabajo y rellenamos en formulario con el cual obtendremos nuestras capacidades de trabajo, del cual descargamos un PDF y lo subimos al classroom, tambin hicimos otro formulario sobre nuestra forma de realizar trabajos, el cual se subi al clasroom y por ultimo hicimos un ejemplo de como pensar un proyecto en el cual nos enfocaremos en el transcurso del ao.','2022-03-04'),(3699,226,'Clase 1','','2022-03-09'),(3700,238,'Clase 1','Empezamos a hacer las tareas del classroom.\r\nLemos los PDFs y vimos los videos introductorios a Practicas Profesisonalizantes y enviamos los formularios de google correspondientes.\r\n','2022-03-09'),(3701,225,'Clase 1 ','Se revisaron y completaron los puntos pertinentes a los mdulos 0 y 1 del classroom, incluyendo en estos el mapa conceptual y el test de competencias','2022-03-09'),(3702,233,'Clase 1','Fechas:\r\nSemana 1\r\n 8/3/2022\r\nEl da de hoy los docentes Acosta Nahuel y Consorti Gonzalo nos dieron una introduccin de la materia, como vamos a organizarnos y como se dar la evaluacin de la misma.\r\n9/3/2022\r\nLos docentes a cargo de la materia (mencionados anteriormente) nos dieron a realizar una encuesta sobre nuestras habilidades junto un cuestionario de CompuTrabajo.\r\nTrabajos realizados el da de la fecha:\r\nTarea nmero 1 -Formulario de prcticas profesionalizantes: Realizada.\r\nTarea numero 2- mapa conceptual sobre el primer trabajo: En proceso.\r\n','2022-03-09'),(3703,237,'Clase 1','Comenzamos a hacer las tareas y trabajos en clase.\r\nEstos fueron una lectura del PDF a la introduccin a las practicas profesionalizantes y trabajo en grupo.','2022-03-09'),(3704,239,'clase 1','el dia de hoy 9/3 le dedicamos el tiempo a completar PDFs y trabajos los cuales podan ser grupales o individuales. Estos PDFs son sobre la materia &quot;Practicas profesionalizantes&quot;','2022-03-09'),(3705,229,'Clase 1','Concretarse las primeras dos encuestas - Realizacin de los mdulos 0 (Lectura de material), mdulo 1 - (Efectuar de forma correcta las tareas 1 y 2) - Iniciacin del mdulo 2 - (Iniciacin de la lectura de Material)\r\nIngreso a las paginas - encuentrotecnologico.com.ar - https://www.computrabajo.com.ar/','2022-03-09'),(3706,230,'Clase 1','Hice un currculum en Computrabajo (https://candidato.computrabajo.com.ar/Candidate/Home) para luego hacer un test de competencias laborales en la misma pgina. Este evala la responsabilidad, autogestin, liderazgo, motivacin, inteligencia social, autonoma, arbitraje y cooperacin. \r\nPor ltimo hice la primer tarea, un cuestionario sobre la introduccin a las prcticas profesionalizantes. ','2022-03-09'),(3707,228,'Clase 1 ','Le el material del modulo 1 (introduccin a las practicas profesionalizantes), realice 3 tareas (Tarea 1: cuestionario sobre los conceptos bsicos de practicas profesionalizantes, tarea 2: mapa conceptual sobre los conceptos bsicos de practicas profesionalizantes, tarea 3: armar un curriculum) y complet 1 encuesta (test de competencias laborales) ','2022-03-09'),(3708,231,'Clase 1','Esta fue nuestra segunda clase de PP en la que empezamos con algunos trabajitos para entregar dentro de 2 semanas, hoy avanzamos demasiado, creamos una cuenta en candidato computrabajo para saber en que nos desarrollamos mas y nuestras debilidades(y pensar que caresco de inteligencia social :v) respondimos dos cuestionarios y me quede en la segunda tarea que es armar un mapa conceptual del PDF de PP','2022-03-09'),(3709,235,'clase 1','el da hoy hice lemos las practicas profesionalizante, completamos el test de competencias laborales y empezamos con los trabajos prcticos .','2022-03-09'),(3710,227,'Clase 1','El da de la fecha comenzamos a leer acerca de las prcticas profesionalizantes. Posteriormente, completamos algunos formularios y realizamos el test de competencias laborales. Adems, hicimos un mapa conceptual con los contenidos aprendidos.','2022-03-09'),(3711,224,'Clase 1','Le el \'Modulo 1\' (Introduccin a practicas profesionalizantes), luego contest dos formularios sobre el tema (que abarcaban la tarea 1 y 2) , realic una encuesta sobre \'Competencias laborales\' (tarea 1), y luego realic un CV con la ayuda del \'Modulo 2\' que abarcaba la tarea 3.','2022-03-09'),(3712,232,'CLASE 1','Hoy junto a mi compaero Ivn Gonzlez Harms completamos el primer trabajo de los nueve que haba hasta el momento en el classroom, este trabajo consista en completar un formulario, respondiendo a todos los conceptos aprendidos previamente. Por mi parte, junto a la mayora de la clase, termin el test de competencia laboral desde la pagina &quot;computrabajo.com.ar&quot; en este test se toma rasgos tales como la autonoma, el liderazgo, la responsabilidad, la cooperacin y la motivacin (https://candidato.computrabajo.com.ar/Candidate/Competences/). Durante esta clase comenc a hacer los primeros bocetos para as empezar correctamente el mapa conceptual de la segunda tarea, donde tendremos que recopilar los conocimientos que adquirimos con anterioridad.','2022-03-09'),(3713,240,'Clase 1','El da de hoy dimos inicio con las actividades y el material , realice la tarea 1 y 2 de la materia, complete los cuestionarios de habilidades blandas Computrabajo y encuestas de habilidades, tambin vi los vdeos del modulo 1.','2022-03-09'),(3714,234,'Clase N1','Realizamos la tarea N2,  los formularios, un test de competencias laborales y un mapa conceptual de la materia.\r\nTambin terminamos con el Modulo N1','2022-03-09'),(3715,226,'Clase 1','El da de hoy completamos el cuestionario de Habilidades Blandas - Computrabajo, Encuesta de Habilidades\r\nY realizamos la tarea 1 y 2 revisando el contenido del modulo 1.\r\n','2022-03-09'),(3716,241,'Bitacora Clase N1 - Toms Ortellado 61 C',' En la clase de hoy tuve que realizar una serie de formularios, uno en un perfil de trabajo que haca preguntas en torno a distintas aptitudes relevantes para el ambiente laboral, y luego otro que realizo una serie de preguntas sobre Practicas Profecionalizantes usando un pdf como fuente de informacin, proporcionados desde el aula virtual. \r\n \r\nEntre medias con los dos profesores de la materia tuve una charla sobre exploracin gastronmica.','2022-03-09'),(3717,236,'Clase 1','Al principio de la clase hicimos una encuesta en la cual completamos datos segn nuestras personalidades, habilidades, destrezas y dems complementos, al finalizarlo llevamos a cabo la realizacin de la lectura del material del &quot;Modulo 0&quot;, luego realizamos la encuesta de la &quot;tarea 1&quot; y el mapa conceptual de la &quot;tarea 2&quot; ubicadas en el modulo 1 y para terminar realizamos el primer registro de la bitacora y carpeta de campo.','2022-03-09'),(3718,220,'10/03','Se designo los grupos para los proyectos, una vez que los profesores nos designaron los grupos y determinamos los proyectos que llevariamos a cabo, hicimos la designacion de roles del metodo scrum. yo teniendo la idea de un proyecto sobre una app web para restaurantes y se unifico con otro grupo. y los diagramas de gantts referentes al tiempo que nos tomara el proyecto\r\n','2022-03-10'),(3719,217,'proceso de organizacion','Se realizaron las tares 2, 3 y 4 de las 9 en total, tambin se estuvo informando acerca del nuevo proyecto a realizar durante el ao, comenzamos a armar la carpeta de campo y la carpeta de proyecto, ademas a ultimo momento se hicieron busquedas de softwares para el uso en proyecto final.','2022-03-10'),(3720,223,'Asignacin de grupos y proyectos','El da 10/03 continuamos con los trabajos del classroom mientras que los profesores designaban los grupos para los proyectos, una vez que los profesores nos dijeron los grupos y determinamos los proyectos que llevaramos a cabo, hicimos escribimos las virtudes y roles de cada miembro del grupo, junto con los lenguajes de programacin y programas que usaremos para el proyecto. Y por ultimo hicimos el diagrama de gantt del proyecto.\r\n','2022-03-10'),(3721,213,'Creacion de Grupos e Ideas','Concretamos el grupo de 7 integrantes para la realizacin de 2 proyectos que se van a llevar a cabo de manera simultanea \r\nEl proyecto ROJAS conformado por  :\r\n -Danilo Emanuel Soler Salazar\r\n -Brayan Farfan\r\n -Sosa Lucas \r\n -Alejandro Tolosa\r\nY el proyecto STONKS conformado por :\r\n -Dominic Guzman \r\n -Agustin Fiasche\r\n -Delio Matias','2022-03-10'),(3722,221,'Inicio de proyecto','El dia de hoy empezamos a desarrollar los distintos proyectos de cada grupo y ver que se requiere tener para la inicio y continuacion del proyecto tanto en formato papel como practico. Nuestro proyecto se basara en un sitio web para aprender a programar distintos leguajes dados del punto de vista de un alumno, deberemos estudiar programar y ensear a programar durante el proyecto.','2022-03-10'),(3723,215,'10/03/2022 Tarea','Termine el mapa conceptual del DET - Modulo 1 tarea n2 y le el DET - Modulo 2,  hice un curriculum y despus nos mandaron a investigar ','2022-03-10'),(3724,208,'10/3 Curriculum y Comienzo del proyecto','Al principio de la clase empeze con algunas tareas de la det, como armar un cv y completar un formulario luego se pensaron diferentes ideas para un proyecto en grupo, decidimos armar un grupo de 7 personas y trabajar con 2 proyectos en paralelo los trabajos son la pagina web para un consultorio odontologico y una pagina web interactiva para la administracion de pedidos en persona en un restaurante','2022-03-10'),(3725,211,'10/03 proyecto hospital','empezamos con un proyecto sistema de internacin domiciliaria\r\ntarea 3 y 5','2022-03-10'),(3726,209,'10-03-22 Propuesta de proyecto sistema de hospital','-Formacin del equipo de trabajo\r\n-Diagrama de Gantt\r\n-Avance en TP5\r\n-Finalizacion de TP3-4\r\n-Inicio de investigacion CodeIgniter y Materialize\r\nPor ultimo definimos una serie de pautas a seguir en el proyecto:\r\n-Va a estar programado en HTML, CSS, JS, PHP, SQL\r\n','2022-03-10'),(3727,216,'Inicio del primer Proyecto - Sistema de internacin domiciliaria','Ayer, dediqu parte de la clase a la realizacin de una de las tareas del Modulo 3. \r\nCerca del final de la clase se nos dividi en grupos y uno de los integrantes del mio plate un proyecto en el que nos encontraremos trabajando a partir de hoy. Realizamos el diagrama de GANTT.','2022-03-10'),(3728,212,'10-03-22','El dia de hoy hice la tarea Numero 3 que era un cuestionario y la tarea numero 4 que era hacer mi CVU, ademas nos agrupamos para hacer un proyecto en grupos, en el cual me toc con Pereyra, Velarde y Gantus, empezamos haciendo el diagrama de Gantt en Project y maana lo vamos a empezar.','2022-03-10'),(3729,210,'bitacora 3 10/3/2022','Hoy comence con el modulo 5 del classroom al terminar las 2 primaras actividades me llamaron para proponer mis 3 proyectos de los cuales me quede solo con uno ya que los otros 2 ultimos eran demasiado complejos. me uni al grupo de Sosa lucas y les propuse mi proyecto a los de su grupo y les gusto la idea. me mostraron el suyo y decidimos en hacer 2 proyectos al mismo tiempo pero para hacerlos decimos meter a 3 integrantes mas.\r\n','2022-03-10'),(3730,219,'10/03 Asignacion grupos de proyecto - Inicio del proyecto','Ya tenemos los grupos asignados para los proyectos, en mi caso me toco con Matias Delio y Domini Guzman, decidimos hacer una aplicacion web para restaurantes y cafeterias con la cual segun el codigo qr de la mesa se podra acceder al menu y pedir desde la misma aplicacion, esta viene acompaada de la opcion para llamar al mesero, pedir la cuenta e incluso el pagar con mercado pago.\r\n','2022-03-10'),(3731,222,'Modulo 1 y Inicio de proyecto internacion domiciliaria','Hoy 10/03/2022 arranque con el modulo 1, que consta de material y tarea que dejaron mis profesores, aprendi que son las practicas profesionalizantes, hice un cuestionario sobre introduccion a las practicas profesionalizantes, luego lei una guia sobre como hacer apropiadamente un curriculum vitae, hice el segundo cuestionario sobre las habilidades blandas y curriculum vitae, y luego los profesores me asignaron un grupo para iniciar el proyecto, Sistema de internacion domiciliaria, hicimos un project para organizar bien todas las tareas y luego concluimos el dia','2022-03-10'),(3732,242,'10-3-2022','El dia de hoy estuve dando toda atencin como poda, con eso me estuve ordenando tanto mentalmente y muy lentamente las tareas que, con mis compaeros, estaba preparando para mi, siendo el propio proyecto lo ultimo que haba hecho en el da. Hoy mismo haba hecho un par de tareas del classroom, me cost aunque no fue demasiado.','2022-03-10'),(3733,220,'11/03','se inicio el maquetado del programa web se prioriso todas las tareas que se son nesesarias para la realizacion del proyecto','2022-03-11'),(3734,208,'Bocetos y Vistas','En esta clase nos dedicamos a hacer un bosquejo o boceto a mano alzada, teniendo en cuenta las diferentes necesidades de los posibles clientes que van a utilizar la pagina web. Entre las vistas hechas esta el home, tratamientos, contacto y turnos','2022-03-11'),(3735,243,'11-03-22','Hoy hice las 2 encuestas que se encontraban en el classroom y nos asignamos cada tarea para cada uno','2022-03-11'),(3736,219,'Comienzo del proyecto &quot;Stone&quot;','En el dia de la fecha comenzamos con el proyecto en cuestion, estamos haciendo con Domini el maquetado del sitio de administracion y Matias comenzo con la Base de Datos, la verdad es que la experiencia que ya tenemos con el diseo web y PRUFEX se nos facilito absolutamente todo.','2022-03-11'),(3737,223,'Comienzo del proyecto ','El da de hoy dimos inicio al proyecto, planeando como iniciaramos y dando prioridad a los distintos posesos del proyecto, por mi parte comenc a averiguar sobre la base de datos MongoDB y averiguar como descargarla, ya que sufrimos ciertas dificultades en el proceso.','2022-03-11'),(3738,210,'bitacora 4 11/03/2022','hoy apenas llegamos nos pusimos a ver que habia que hacer primero en el proyect y comenzamos a planificar nuestras vistas de la pagina web del proyecto Rojas que consiste en una pagina de un consultorio odontologico. Dibujamos las vistas de home, tratamientos, turnos y contactos\r\nal realizar estas vistas planificamos que mejorarles mas adelante','2022-03-11'),(3739,213,'Realizando los bocetos de las vistas ','Despus de realizar el Daily correspondiente decidimos que debamos de empezar con las vistas de la pagina .\r\nY nos encontramos debatiendo como dar mas informacin al cliente sin ser molesto a la vista ','2022-03-11'),(3740,221,'Planificacion del proyecto','Hoy estubimos discuendo el como irganizar y repartinos las distintas tareas y cuales haremos primero y cuento tiempo nos llevara. Debido a que hoy tenemos solo 2H no puedimos realizar nada mas mas alla de la organizacion y empezar un poco.','2022-03-11'),(3741,216,'Investigacin - Proyecto &quot;Sistema de internacin domiciliaria&quot;','En el da de la fecha, tuvimos la primera daily, revisamos el diagrama de GANTT realizado ayer y en base a ello dividimos las tareas de investigacin que colocamos en el. Yo por mi cuenta estuve navegando por la pgina web del framework Materialize el cual utilizaremos para el frontend de nuestro sistema, a su vez, estuve viendo tambin unos vdeos que explicaban dicha pgina.','2022-03-11'),(3742,222,'Segundo dia de Proyecto Sistema de Internacion Domiciliaria','Hoy llegue a clases con parte de la informacion que necesitabamos para arrancar el proyecto, luego tuvimos una charla de 15 minutos con mi grupo para determinar que hariamos cada uno, yo por mi parte me encargue de hacer las vistas a mano alzada y luego vimos un poco de materialize y concluimos con el dia.','2022-03-11'),(3743,211,'11/03 investigacion','hoy empezamos a investigar sobre codeignite, materialize, mvc y la base de datos relacional y la no relacional. por mi parte investigue sobre la base de datos relacional y la no relacional y vi un vdeo sobre de introduccin a codeigniter 3','2022-03-11'),(3744,214,'Boceto Pagina ','Trabajamos en el proyecto rojas discutiendo sobre como debera ser la pagina web y realizamos un boceto a mano alzada sobre las vistas que debera tener la misma buscando referencia en otras paginas, en total hicimos 4 vistas y eleg la de tratamientos','2022-03-11'),(3745,209,'11-03-22 Investigacion y planteo de vistas','-Planteamos las vistas del login y el listado de pacientes\r\n-Investigacion de CodeIgniter\r\n-Investigacion de MVC\r\n-Prototipo de login en HTML y CSS\r\n','2022-03-11'),(3746,215,'11/03/2022','Hoy revisamos 11 laptops y verificamos algunos problemas','2022-03-11'),(3747,217,'proceso de organizacion','','2022-03-11'),(3748,241,'Bitacora Clase N2 - Toms Ortellado 61 C','Hoy no hice avances en clase con los trabajos del classroom, pero ayude a un compaero a dar los primeros pasos rpido, siendo que falt las dos primeras clases.','2022-03-15'),(3749,227,'Bitacora 15/03/22','El da de la fecha continu con los formularios (tarea 3) y le acerca de las habilidades blandas. Posteriormente, comenc a realizar mi curriculum vitae informndome acerca de cmo realizarlo correctamente','2022-03-15'),(3750,237,'Clase 2','Hoy continuamos con los trabajos de la anterior clase, \r\nEmpec con la lectura de la gua de empresa simulada, para completar los trabajos correspondientes.','2022-03-15'),(3751,238,'Clase 2 15/03/2022','Termin mi CV.\r\nY comenc a realizar la tarea 5, en la que debemos contestar preguntas relacionadas con la Gua de Empresa Simulada.\r\n','2022-03-15'),(3752,226,'Clase 2','Revis los contenidos de la &quot;Gua de Habilidades Blandas&quot; y &quot;Gua de Armado de un Curriculum Vitae&quot; y posteriormente realice el cuestionario. tambin hice mi primer curriculum vitae ','2022-03-15'),(3753,239,'Clase 2','El dia de hoy 15/3 le dedicamos el tiempo a completar PDFs y trabajos de la clase pasada los cuales decidi hacerlos de forma grupal con otros dos compaeros. Estos PDFs son sobre la materia &quot;Practicas profesionalizantes&quot;','2022-03-15'),(3754,230,'Clase 15/03','Hoy hice un cuadro conceptual sobre las prcticas profesionalizantes, consigna del segundo trabajo, en base a un croquis del mismo que desarrollamos con un compaero en la clase pasada. tambin empec el cuestionario del trabajo nmero 3. ','2022-03-15'),(3755,228,'Clase 2','Correg la entrega de la tarea 4 (haba entregado la tarea en la seccin de la tarea 3) y comenc a realizar la tarea 5 (Cuestionario sobre la &quot;Gua de Empresa Simulada&quot;)','2022-03-15'),(3756,232,'CLASE 2 - 15/03/2022','El da de hoy empec a leer, resumir y asignar los tiempos y trabajos de cada integrante del grupo para completar todo a tiempo. Le sobre las habilidades blandas, el desarrollo de formato de practicas profesionalizantes y el armado correcto de un curriculum vitae para posteriormente empezar a hacer los formularios, para empezar el formulario sobre las habilidades blandas. Seguidamente, mi compaero Ivan Gonzalez Harms completo el mapa conceptual de la &quot;Tarea 2&quot; el cual previamente yo hice el croquis propio.','2022-03-15'),(3757,231,'Clase 2 (15/3/22)','Tcnicamente es la tercera clase que tenemos, el da de la fecha continuamos/ continu con los Trabajos prcticos asignados yo voy por el cuarto modulo con el TP N5 que es el cuestionario de 38 preguntas con un PDF de 101 paginas, ya entregue mi CV y mi mapa conceptual de los mdulos anteriores','2022-03-15'),(3758,229,'15-03-2022','En el da de hoy se avanzo con los Mdulos 2(Lectura del Material - Perfiles Profesionales - ), Mdulo 3(Lectura de las Guas sobre Habilidades Blandas y Realizacin correcta del CV - Curriculum), ejecucin de actividades de dichos Mdulos(Tarea n3 y n4), un CV de practica y se le dio inicio al Mdulo 4 con su respectivo material de lectura y actividades \r\n','2022-03-15'),(3759,234,'Clase N2','En el da de hoy empezamos a ver el mdulo N3 el cual trataba de que son las habilidades blandas y para que sirven, tambin vimos que es un curriculum vitae y como armar un cv de calidad.','2022-03-15'),(3760,240,'Clase 2','Realice el cuestionario de la tarea 3 sobre  Habilidades Blandas y Curriculum Vitae revise y le el contenido para poder completar el mismo. tambin hice mi primer curriculum vitae ','2022-03-15'),(3761,225,'Bitacora 15-03-22','Se completaron los contenidos pertinentes al modulo 3','2022-03-15'),(3762,236,'clase 2 (15/03/2022)','En la clase de hoy realizamos la lectura de los PDF dejados en el classroom, una vez finalizados de leer iniciamos con la realizacin de un simulacro de Curriculum vitae, por siguiente hicimos el cuestionario que se basaba lo ledo anteriormente, y para finalizar, realizamos la bitcora correspondiente del da','2022-03-15'),(3763,245,'inicio de todo','en el dia de la fecha 13/3/2022 \r\ncreado mi sesin en encuentrotecnologico.com.ar,para poder hacer bitcoras,\r\nen el transcurso de la clase he desarrollado el CV para entrega en el dia de hoy\r\nluego he entregado los trabajo 1 y 2 de practicas profesionantes.','2022-03-15'),(3764,237,'Clase 3','Esta clase pensamos Proyectos para desarrollar en el ao,\r\nmientras tanto terminbamos unos trabajos pendientes de la materia.','2022-03-16'),(3765,226,'Clase 3','el da de hoy se trat en idear un proyecto tecnolgico basado en un problema escolar','2022-03-16'),(3766,239,'clase 3','hoy 16/3/22 me dedique a terminar trabajo de los pdf encomendados en la primera clase. Ademas estuvimos viendo, yo y mi grupo, ideas para el proyecto del ao en el cual solo llegamos a pensar en 2 ideas seguramente para la prxima clase ya tenemos una idea elegida.','2022-03-16'),(3767,231,'Clase 3 ','El da de hoy estuvimos pensando y organizando los grupos para el proyecto para PP, se ocurrieron un par de ideas, entre ellas estaba involucrarme con la radio del colegio ya que nunca la encuentro activa y la otra es armar o disear un sistema de asistencia para los alumnos y docentes de la escuela, no avanza demasiado','2022-03-16'),(3768,240,'Clase 3','El da de hoy planteamos que proyecto realizar, el armado de grupos y las herramientas que utilizaremos ','2022-03-16'),(3769,227,'Planteo del Proyecto 16/03/22','El dia de hoy comenzamos la planeacin del proyecto. Comenzamos con una lluvia de ideas entre varios compaeros y poco a poco nos fuimos explayando en una de ellas, algunos coincidimos y formamos un grupo menor y otros decidieron irse por su lado. Posteriormente nos subdividimos asignando distintas tareas y elegimos las tecnologas a utilizar durante el proyecto.','2022-03-16'),(3770,228,'Clase 3','defin el proyecto que realizare y escrib un borrador con funcionalidades y tecnologas que podra usar ','2022-03-16'),(3771,229,'16-03-2022','Se avanzo poco en el Mdulo 4(Cuestionario)\r\nEl da de hoy se hablo sobre la formacin de los equipos para la realizacin del futuro proyecto final donde se dio como idea la creacin de una web con formato stack overflow para el cuestionamiento sobre especialidades y cuestionarios de pedagoga(Ayuda para el DOE) para alumnos ','2022-03-16'),(3772,232,'CLASE 3 - 16/03/2022','El da de hoy empezamos a desarrollar nuestro trabajo/proyecto principal a lo largo del ao. Los integrantes de este grupo son Ignacio Girn (yo), Mendez Agustn, Gonzalez Esteban, Ortellado Toms, Geist Mateo y Abdias Pea. En este trabajo nos enfocamos a hacer las ideas generales de