remos.','2022-03-16'),(3778,242,'17-03-22','En el da de hoy empezamos el cdigo para la pgina cual va a ser dedicada al proyecto que tendremos que hacer, usando Atom como programa. Precisamente yo no lo hice, pero estuve ayudando en lo posible a mi compaero, aunque por mi parte hice lo que pude, ya que necesitbamos repasar un poco en el tema de HTML. Hoy mismo tambin comenc la carpeta de campo, aadiendo los das en el que me faltaban armar, excepto el primer da (03-03-22) debido a que no estaba inscrito.','2022-03-17'),(3779,212,'17/03/2022','El dia de hoy mis compaeros y yo empezamos a hacer la pagina para el proyecto mediante html, no logramos terminarla pero hicimos un progreso. Luego empece con la carpeta de campo y la actividad numero 6 del modulo numero 4.','2022-03-17'),(3780,222,'Proyecto Sistema de internacion domiciliaria','Hoy hicimos la reunion de 15 minutos del dia para charlar que es lo que teniamos que hacer cada uno, nos pusimos de acuerdo para entender bien que es lo que necesita nuestro sistema para cubrir las necesidades de internacion de pacientes, yo por mi parte me encargue de perfeccionar el login. lei informacion sobre el foda y la presentacion de nuestro proyecto, y me puse a analizar bien un sistema parecido al que necesitamos hacer, una informacion que me pasaron para guiarme un poco sobre todo lo que tiene que tener la parte de prestaciones de la pagina, y en base a eso vamos a continuar haciendo la base de datos y varias vistas de la pagina.','2022-03-17'),(3781,208,'Vista contacto','Con las vistas ya definidas para cada uno de nosotros empezamos a programarlo en html, yo me encargue de la vista de contacto. La estrategia fue dividir la pagina en un grid de 3 columnas la primera para que el usuario agregue un formulario la segunda para ver los datos de la clnica y la tercera para que se vea la ubicacin del consultorio en google maps. En esta clase solo se termino con la primera de las 3 columnas','2022-03-17'),(3782,216,'Anlisis 01 - Proyecto &quot;Sistema de internacin domiciliaria&quot;','Hoy, estuve leyendo el material dentro de &quot;Guas para documentacin&quot; que se encuentra dentro del Classroom, con el avanzamos con la &quot;Presentacin del proyecto&quot; y me dediqu a realizar a su vez parte del &quot;FODA&quot; con dicho material.\r\nTambin hice en colaboracin con mis compaeros de proyecto el Diagrama de Caso de Uso.','2022-03-17'),(3783,211,'documentacion','En el da de la fecha estuvimos haciendo la documentacin, empezamos leyendo la gua para hacer el Foda, luego lemos la gua para presentacin de proyecto para despus empezar a hacerlo, mas tarde tambin terminamos el diagrama de caso de uso.','2022-03-17'),(3784,219,'Desarrollo aplicacion web &quot;Stone&quot;','En el da de hoy seguimos con la programacin y con el desarrollo del proyecto, ya tenemos avanzadas varias vistas adems de tener diagramada la estructura del sistema, aun as tenemos unas cuantas dudas acerca del sistema de qr, ya que queremos que el programa funcione a base de escanear un cdigo qr y ya ingresar y pedir. Empezamos la base de datos y seguimos viendo si es que el programa usado para programarla nos sirve para lo que necesitamos en este proyecto.\r\nAn seguimos discutiendo algunas cosas del proyecto, como por ejemplo la pestaa de rdenes, debido a que estamos intentando de que sea lo ms intuitiva posible y fcil de entender.\r\n','2022-03-17'),(3785,217,'busqueda de archivos','para el dia de hoy se hicieron un recuento general de las computadoras y por saber que la mayoria se encuentran bloqueadas y no se pudieron desbloquear por medio del soporte tecnico de conectar igualdad por lo que mi camarada y yo propusimos el desbloque manual por medio de un booteo de la bios y cargar un bios nuevo sin el bloqueo, se estuvo investigando acerca de los archvos y se continuara el dia de maana','2022-03-17'),(3786,221,'Jueves 17/3','El da hoy estuve planteando el cmo sera la construccin de la pgina. Debido a que nuestro proyecto debe contar con un progreso  obligatorio para el usuario se nos complic el diseo de la pgina. Al final optamos por poner un ejercicio debajo de cada explicacin y un recuadro donde el usuario pueda completar tal ejercicio y la pagina corrija sus errores. Tambin comenc con la presentacin del proyecto. ','2022-03-17'),(3787,223,'Diseo y programacin de la base de datos y la pagina administrativa','El da de hoy disee el diagrama de la base de datos del proyecto, luego de que lo modificaran y approbaran mis compaeros cree la base de datos en MongoDB. Tambien disee y programe parte de la pagina administrativa del proyecto la cual quedo inconclusa ya que me quede sin tiempo para corregir los errores','2022-03-17'),(3788,215,'17/03/2022','Hoy volvi a revisar las netbooks que nos faltaban la otra vez y encontre 1 netbook que prendia, le instale el google chorme, ya estaba reparada pero habia un problema en la pantalla procedimos a abrir la pantalla y le faltaba 2 tornillos, pasamos a desarmar una netbook que estaba rota y le sacamos los 2 tornillos faltantes para la otra netbook.','2022-03-17'),(3789,210,'bitacora 5 17/03/2022','Hoy les presente las vistas a mis compaeros y comenzamos hacerlas en html, lo cual algunas cosas se complicaron por los diferentes bugs que habia en los codigos y en el responsive. termine de hacer el navbar junto al body entero de la pagina y el footer de la misma. solo quedaria mejorarla con CSS y JS o cambiando algunas cosas en HTML','2022-03-17'),(3790,214,'Vista Contacto-Pagina','Con las vistas definidas nos dividimos en 3 compus para avanzar la pgina web, estuve trabajando junto a un compaero en la vista de contactos le buscamos un fondo acorde a la temtica la dividimos en 3 partes e hicimos un formulario','2022-03-17'),(3791,220,'17/03 ','Se realiz el esqueleto de la  pgina de administracin y se realiz ya la base de datos en mongo bd . Realize una investigacin de como usar php en mongo bd para conectar la base de datos a la pagina','2022-03-17'),(3792,213,'Inicio de las vistas','El de hoy se baso en su totalidad en el empezar a codear las vistas conforme tenamos en el bosquejo realizado . Al inicio del da el Scrum master vino con el navbar ya hecho para que todas las paginas tengan el mismo navbar y mantener un orden entre las vistas. La que me toco a mi fue la de Turnos que se va a basar en el hecho de pedir turnos tanto por Whatsapp como por la pagina ','2022-03-17'),(3793,216,'Anlisis 02 - Proyecto &quot;Sistema de internacin domiciliaria&quot;','Al llegar abr el Drive que tenemos en comn del proyect, revis el diagrama de GANTT para ver por donde comenzar, estuve revisando la &quot;Presentacin del proyecto&quot; en la cual estuvimos trabajando ayer, junto con mi compaero presente realizamos algunos aportes a dicho documento.\r\nCreamos un repositorio en GitHub donde iremos subiendo nuestros avances en el cdigo del mismo cuando comencemos con el.','2022-03-18'),(3794,211,'Documentacin y Github','En el da de hoy seguimos avanzando en la documentacin de proyecto y tambin sobre el foda, ademas tuvimos que entrar a Github para crear un grupo para empezar a subir toda la documentacin que hagamos hecho para que los profesores lo puedan ver ','2022-03-18'),(3795,242,'18-03-2022','En el da de hoy realmente no hice mucho junto a mi nico compaero que estuvo presente esta fecha, pero si lo que el profe me mand a hacer, como crear una cuenta para GitHub, invitar tanto a mis dems compaeros hasta ambos profesores. De ltima intente hacer algo, repasar algo de Python (mi tema tocado en este proyecto) pero poca idea tengo en cmo iniciar, sea la pgina y por donde comenzar. ','2022-03-18'),(3796,210,'bitacora 6 18/03/2022','Hoy continue tratando de mejorar la pagina agregando efectos de WAVE a los margenes de las imagenes para darle un toque mas moderno a la pagina tambien agregue un boton al inicio de la pagina pero un tengo que codearlo para que sea responsive ya que cuando esta en modo celular el boton sale del margen por unos pixeles y es molesto. tambien le di tareas nuevas a mis compaeros para que continuen el trabajo','2022-03-18'),(3797,212,'18/03/2022','El da de la fecha hice cree el GitHub junto a mis compaeros y lo configuramos un poco como pudimos, luego seguimos trabajando en el formado de la pagina desde Atom, no hicimos mucho progreso pero algo es algo, tambin vi bastante acerca de como crearla as que creo que ya voy teniendo una idea de como hacerla y como queremos que quede.','2022-03-18'),(3798,220,'18/03 ','Hoy se hiso la investigacion de como implementar el php en mongo bd . se creo el github del Projecto donde agregaremos lo que se valla realizando respecto al projecto\r\n','2022-03-18'),(3799,217,'1er Desbloqueo de computadora','en el dia de hoy se buscaron los archivos en videos de youtube,(drivers) y archivos bin para el desbloqueo de las computadoras por lo que fue mas complejo de lo esperado pero finalmente se encontraron y al ponerse a preuba se logro realizar el booteo del tpm sustituyendo los archivos que bloqueaban el acceso, se continuaran con las labores de desbloqueo la proxima semana','2022-03-18'),(3800,213,'Continuando las vistas ','Apenas entramos realizamos el dialy designamos los trabajos para cada uno que fueron bsicamente los mismo que los del dia anterior con esto nos asegurbamos de que cada uno trabajara con lo que empez. Quedamos en que las vistas deban tener un forma similar a la pestaa home para que sea cmodo al usuario promedio','2022-03-18'),(3801,208,'Diagrama entidad relacin y vista contacto','Se profundizo un poco mas en el formulario de la vista contacto, con la idea de que pueda mandarse un mail al terminar de rellenar el formulario, sin embargo tuve algunos problemas con eso asi que preferi seguir con el diagrama entidad relacion. Voy a informarme mas sobre como mandar un mail desde hmtl','2022-03-18'),(3802,214,'Vista tratamientos-odontologia','avance con la vista sobre los tratamientos en la web de odontologia rojas empece con el navbar predefinido que tenemos y le agregue un fondo a la pagina despues aad 6 cards que rotan cuando se le pasa el mouse encima, para que no sea solo texto les cambie el color y busque imagenes sin copyright para cada card','2022-03-18'),(3803,215,'18/03/2022','Hoy desarme una netbook (el teclado y la tapa posterior), arregle una netbook que le faltaba algunas teclas, y le reemplaze el teclado por completo ya que no se puede cambiar tecla por tecla.','2022-03-18'),(3804,232,'CLASE 04 - 22/03/2022','El da de hoy con mis compaeros de grupo proseguimos con nuestro proyecto web llamado &quot;Conquizt&quot;, hoy empezamos a proponer los componentes y las distintas tablas que bamos a utilizar en la base de datos para la misma pagina, los diseos, interfaces e imgenes que bamos a utilizar, cada integrante propuso distintas ideas para el diseo de esta. Por el momento aprovechamos ideas propias como de algunos juegos de vdeo.','2022-03-22'),(3805,230,'Clase 22/03','Hoy me puse a completar la carpeta de campo con los progresos que hice en mi casa con respecto a los trabajos 3, 4, 5, 6, 7, 8 y 9 de los distintos mdulos. ','2022-03-22'),(3806,224,'Clase 4','Realic el proyecto pensando en las funcionalidades y las reas del trabajo en las que se va a especializar cada uno de mis compaeros, tambin se comenzo la deliberacin para el diagrama de gantt ','2022-03-22'),(3807,238,'Clase 4 22/3','Definimos las reas de Trabajo, comenzamos el desarrollo del Diagrama de Gantt junto con la definicin de las primeras tareas que sern necesarias en el desarrollo del proyecto. ','2022-03-22'),(3808,229,'22/03/2022','Se charlo de manera civilizada sobre los diseos que se realizaron para tener una mejor distribucin equitativa de trabajos para que no hubieran disconformidades en el grupo de trabajo, como tambin la creacin de un diagrama de Gantt y Kanban, se aceptaron tres diseos de las vistas para el proyecto','2022-03-22'),(3809,228,'Clase 4','Continu realizando el proyecto pensando en funcionalidade