iendo esquemas de los mens y diseo. Tambin, se plante una base de datos bsica con datos sujetos a modificacion ','2022-03-22'),(3817,240,'Clase 4','Estuvimos hablando acerca del diseo del proyecto y la distribucin de tareas, tambin simulamos una pequea prueba del primer diseo de la pagina y discutimos sobre los tiempos del proyecto.','2022-03-22'),(3818,226,'Clase 4','Estuvimos hablando acerca del diseo del proyecto y la distribucin de tareas, tambin simulamos una pequea prueba del primer diseo de la pagina y discutimos sobre los tiempos del proyecto.','2022-03-22'),(3819,245,'22/3/2022','Hoy el da de la fecha se discuti con mi grupo, el boceto del proyecto y temas a futuro como una barra de bsqueda y uso de etiquetas\r\ntambin creamos un cuenta en trelo para usar organizaciones y hacer la carta gantt\r\n','2022-03-22'),(3820,246,'bitcora 23/03/2022--- Arenas Gonzalo Nicolas','En el da de la fecha realice y entregue el trabajo practico numero 8, trabajo practico numero 6 y trabajo practico nmero 7. Organizamos grupal mente las divisiones de los temas que le corresponde a cada uno, investigue sobre las bases de datos no relacionales (NoSQL)','2022-03-23'),(3821,245,'23/3/2022','El dia de la fecha arme la base de datos y programe codigo de php para asegurar una conexion base con la pagina y la base de datos\r\ncon mi grupo tambien discutimos sobre rl titulo y los logos y termino siendo mi titulo que dije que es all shops in one ','2022-03-23'),(3822,235,'clases 23/3','en el da de hoy estaba terminando los trabajos practico y empezamos con mi grupo con el trabajo','2022-03-23'),(3823,232,'CLASE 05 - 23/03/2022','El da de hoy con mi grupo empezamos finalmente con el desarrollo de nuestro proyecto &quot;Conquizt&quot; por el momento est recin empezado, mis compaeros Mendez, Gonzalez y Geist empezaron a desarrollar todo el apartado visual y el men de la pagina, mientras que yo, Girn, junto a Ortellado, empezamos a aprender, desarrollar y hacer los primeros procedimientos 