royecto y desarrollamos los diagramas de Gantt y el diagrama de Kanban. Creamos un repositorio en GitHub y Tambin diseamos el prototipo del primer boceto y lo documentamos en la carpeta de campo.','2022-03-23'),(3830,225,'23-03-22','En el da de la fecha se avanzamos con el armado de la pgina principal y mens del juego. Tambin se hicieron los diagramas de Grantt y Kanban','2022-03-23'),(3831,228,'Clase 5','Colabor en la realizacin del diagrama de Gantt del proyecto y el armado del prototipo de las vistas de la pagina web y comenc a pensar en los datos que sern necesarios incluir en la base de datos','2022-03-23'),(3832,239,'clase 5','hoy me puse tirar ideas sobre el diseo, nombre, logo, animaciones de la pagina. uno de los miembros del grupo planteo una idea que nos gusto a todos y en base a esa pudimos hacer lo dems, logo, diseo, animaciones, y hasta llegamos a plantearnos una animacin de carga.\r\nTambin empezamos a usar github para subir y compartir con el grupo todas las ideas archivos que tengamos y/o terminemos.','2022-03-23'),(3833,240,'Clase 5','El da de hoy: \r\n-Diseamos los bocetos de la pagina\r\n-Organizamos los tiempo con el diagrama de Gantt\r\n-Con el Kanban puse a la vista todas las futuras tareas del proyecto  \r\n','2022-03-23'),(3834,241,'Bitacora Clase N5 - Toms Ortellado 61 C','Empece junto a un compaero la base de datos, comenzando con el aprendizaje del lenguaje que usaremos, MongoDB y algunos conceptos bsicos sobre las bases de datos relacionales y no relacionales.\r\nHasta ahora lo que vi fue lo bsico, siendo que vi como crear un objeto y sus atributos, como modificarlos y eliminarlos, ademas de agregar nuevos atributos a estos objetos. No estoy seguro si vi arrays.','2022-03-23'),(3835,236,'clase 5 (23/03/22)','En la clase de hoy realice el diagrama Gantt, tambin lo implemente en Project que seria lo mismo que el diagrama Gantt pero mas detallado, ademas termine con las tareas n6 y 8 que me haban faltado terminar por falta de tiempo, y por ultimo ayude un poco con la continuacin del boceto de la pagina ','2022-03-23'),(3836,227,'Gantt, kanban y Comienzo de desarrollo','El dia de hoy nos dividimos en 2 grupos. Mi grupo se encarg de realizar el kanban, con algunas de las tareas. Ademas, el diagrama gantt con algunas tareas mas generales. Finalmente, y la mayor parte del dia, comenzamos el desarrollo HTML y CSS, haciendl una pantalla inicial bsica y un menu un poco mas desarrollado, con fondo y colores provisorios, pero con una estructura similar a la final','2022-03-23'),(3837,234,'Clase N5','Nos dividimos en dos grupos para realizar las tareas.\r\nCon mi grupo realizamos bocetos de la pgina, el diagrama de Gantt en el cual colocamos las actividades que vamos a llevar a cabo en el proyecto, tambin empezamos con el html y css en el visual studio.','2022-03-23'),(3838,238,'Clase 5 23/3/2022','Realizamos (con mi grupo) una lista de tareas a seguir, comenzamos a analizar los datos que vamos a necesitar para la elaboracin de la BDD.\r\nTraslade el diagrama de Gantt del Excel al Project Profesional. Cre el proyecto en GitHub (Kanban). Y comenc a realizar un Prototipo del formulario en base a lo diseado en canva.\r\n','2022-03-23'),(3839,210,'bitacoria 7 25/03/2022','Hoy estuve ayudando a mis compaeros con las vistas del proyecto rojas, luego estuve mas tiempo con mi compaero Tolosa arreglando un bug que tenia con 6 cards que aadi a su vista de Tratamientos, estuve comentndoles a mis compaeros que el lunes tenemos permiso para ir al consultorio odotologico para hacer algunas preguntas a los doctores y hacer algunas tomas para la paginas ademas de mostrarles como venimos trabajando con la pagina hasta ahora y que es lo que podramos llegar hacer','2022-03-25'),(3840,216,'Carpeta de campo personal - Proyecto &quot;Sistema de internacin domiciliaria&quot;','El da de hoy me encontr completando y puliendo algunos detalles de mi carpeta de campo para la entrega de la misma.\r\nDiscut con mis compaeros el estado del proyecto.','2022-03-25'),(3841,213,'Completando la carpeta de campo','El da de hoy lo base en recordar las cosas que hice en casa para ponerlas en la carpeta de campo, ya sea poniendo que tareas realice que problemas tuve con la mismas el tiempo de duracin entre que empece y termine en algunas .Y recordando el paso a paso que tuve para la finalizacin de las mismas','2022-03-25'),(3842,209,'Lectura de material y avance en presentacion de proyecto','-Mayormente me dedique a leer material, ya que estuve ausente 2 dias\r\n-Avanzamos en la presentacion\r\n-Avanzamos en la documentacion\r\n-No hubo avances sustanciales en el producto ','2022-03-25'),(3843,242,'25-03-2022','prcticamente no he hecho nada o mucho, debido a un par de cosas que nos falt para nuestro grupo. Tengo la oportunidad de repasar para Python (Mi lenguaje de programacin elegido por mi) pero no tengo ni la ms mnima idea de como comenzar a dar el tutorial que se me encarg de tal proyecto. Revis un poco de la pgina anteriormente hecha para saber en qu puedo avanzar, pero tampoco soy el encargado de hacer la misma. Sin saber que poda hacer, era mejor hacer la tarea pendiente de la materia, cuando estaba haciendo una tarea de forma directa y literal, se cerr sola, as que en parte debo de comenzar desde cero.','2022-03-25'),(3844,214,'Vista tratamientos','edite la pagina y deje 2 columnas de 3 filas agrupndolas usando este cdigo row-cols-1 row-cols-md-2 g-4 que busque en boostrap despus las centre en css cambie las imgenes de cada carta y les agregue una descripcin.','2022-03-25'),(3845,217,'problemas','el dia de hoy no hubo problemas con los drivers y no se reconocia el dispositivo por lo que se seguira intentando desde casa fue un dia de desaprovecho ya que mi compaero tambien tuvo problemas al descargar el ISO de windows 8.','2022-03-25'),(3846,219,'Desarrollo proyecto Stone','Continuamos con la realizacin del proyecto Stone y a pesar de la falta de tiempo pudimos avanzar un poco con las vistas de rdenes y 