n poco tambien se me ocurri usar adobe illustator tardo un poco la instalacaion pero al final no fue de mucha ayuda porque termine haciendo el logo por photoshop los demas integrantes siguieron con la consttruccion de la pagina y tengo un trabajo extra para casa','2022-03-30'),(3869,235,'clases 30/03','en el dia hoy, empezamos con el trabajo en grupo. voy a trabajar con el lenguaje HTML','2022-03-30'),(3870,224,'Clase 7','Colabor con mi grupo en la parte de la organizacin de la base de datos, en el diseo del index de la pagina web, en la estructura de la misma. Tambin, perfeccionamos en conjunto las tablas de la base de datos para luego, poder llenarlas con la informacin.','2022-03-30'),(3871,230,'Clase 30/03','Hoy cre mi primer programa con programacin orientada a objetos con la ayuda de un video del canal yacklion. En este programa cre una clase llamada Perro con un par de mtodos y de ah cre varios objetos.\r\nVideo: https://www.youtube.com/watch?v=vdRf_sApv2c&amp;list=PLg9145ptuAiiA1S27X8QeFsloBvad5Cy9&amp;index=4','2022-03-30'),(3872,234,'Clase N7','Empec a buscar informacin sobre Java Script para posteriormente poder desarrollarlo en el proyecto.\r\nTambin debatimos sobre distintos temas con mi grupo, cambiamos cosas del men, la temtica de las preguntas, pensamos como podra ser el mapa (papel o fsico), entre otras cosas.','2022-03-30'),(3873,232,'CLASE 07 - 30/03/2022','Hoy segu desarrollando y completando las bases de datos y empec a profundizar y seguir conociendo herramientas y atajos en el lenguaje JavaScript. Mis compaeros con el apartado grafico descartaron la mayora de los diseos previamente diseados retomando nuevas ideas y conceptos, cosa que me har reformular vertiginosamente los programas que vaya desarrollando.','2022-03-30'),(3874,228,'Clase 7','Continu estudiando PHP y comenc a idear las tablas de la base de datos junto con mi equipo.','2022-03-30'),(3875,246,'bitcora 30-03-2022 Arenas Gonzalo Nicolas','Avanzamos con el trabajo final de la materia