de tambin se puede usar como primary key ','2022-05-05'),(4133,208,'Conexion e Insert, Base Rojas en php','Este dia se hicieron 2 cosas por separado la primera fue dar un panorama general de como conectar la vista de gestion de turnos, realizar los diferentes tipos de tablas de la base de datos y el codigo a la hora de ingresar un nuevo turno en la base de datos\r\nYo me encargue de dar a entender el panorama general y organizar un poco la situacion, Soler modifico la base de datos con los cambios que requiriesen y Brian sigue finalizando la vista\r\nLuego me auto asigne la tarea de realizar el codigo de php para que a partir de ese codigo se puedan agregar turnos con su respectivo tratamiento, doctor, paciente, fecha y horario','2022-05-05'),(4134,209,'05-05-2022 Backend de login y vista principal','-Termine los inserts de la seccion medica de la vista principal\r\n-Terminamos la validacion del login ','2022-05-05'),(4135,210,'bitacoria 11 28/04/2022	','Estuve continuando con la pagina de turnos de dental rojas creandole una ventana nueva que ocupara el 100% de la vista haciendo que parezca que sea otra vista nueva pero sigue siendo la misma esta tiene el formulario del cual se tomaran los turnos del boton &quot;Turnos Online&quot; con un formulario progresivo que tendra el tipo de tratamientos, dentistas, fechas y hora y el paciente\r\n','2022-05-05'),(4136,222,'insert de datos','hoy basicamente con un compaero nos pusimos a perfeccionar el login para que el mismo pueda hacer la validacion de datos, iniciar sesion, y pasara la siguiente vista donde ya podes cargar pacientes, luego de eso yo me encargue de hacer la insercion de datos del paciente, aun no lo termine pero avance bastante','2022-05-05'),(4137,211,'documentacion y login','en el dia de hoy tuvimos algunos problemas para conectar el login con la vista de los pacientes pero despues lo arreglamos, despues estuvimos intentado ingresar datos de los pacientes de la pagina a la base de datos, y por ultimos seguimos completando la documentacion del proyecto.','2022-05-05'),(4138,217,'05/05 desbloqueo de los ultimos proyectos','el dia de hoy se estuvo intentando reparar el error que se cometio con algunas maquinas del profesor de mecanica el cual solo se logro reapara 1 y por lo que parece que las otras 2 quedaron sin funcionar asi que tambien hicimos un recoteo de todas las maquinas que quedaron reparadas y las que no con el fin de reorganizarnos tambien aparecio de la nada mi amigo felix que parece que continuara con el proyeto los dias que yo vengo.','2022-05-05'),(4139,217,'05/05 desbloqueo de los ultimos proyectos','el dia de hoy se estuvo intentando reparar el error que se cometio con algunas maquinas del profesor de mecanica el cual solo se logro reapara 1 y por lo que parece que las otras 2 quedaron sin funcionar asi que tambien hicimos un recoteo de todas las maquinas que quedaron reparadas y las que no con el fin de reorganizarnos tambien aparecio de la nada mi amigo felix que parece que continuara con el proyeto los dias que yo vengo.','2022-05-05'),(4140,223,'Comienzo de la pagina administrativa','El da de hoy iniciamos con la pagina administrativa eliminando lo no necesitado de la tienda virtual y modificando las cosas necesarias, tambin tenamos planeado continuar con la aplicacin mocil ya que, a pesar de las clases que tuvimos, solo hemos avanzado con la vista de login y nada ms, aparte no tuvimos oportunidad de continuarla debido a que mis compaeros Agustin Fiasche y Dominick Guzman no vinieron a clases, este ultimo porque se encontraba enfermo','2022-05-05'),(4141,216,'Documentacin - Proyecto N 1 #11','Daily. Retome la presentacin del proyecto, le el PDF gua en el Classroom y busqu algn que otro vdeo para ello.','2022-05-05'),(4142,242,'6-05-22','Inicio cansado pero a su vez algo acelerado debido a que el da de hoy deb de rehacer todo, ya que no pude guardar todo el proceso de antes y eso fue bastante molesto, eso que apenas y si me di cuenta ayer a la hora