vestigacin tuve que enfocarme en continuar la carpeta de campo y no me qued tiempo restante para investigar demacrado, pero con el tiempo que tenia me puse a buscar videotutoriales en youtube sobre la coneccin con la base de datos entre lo que busque encontr un video que parece explicar de forma detallada cmo realizar dicha coneccin\r\n','2022-05-06'),(4147,210,'bitacora 15','hoy solo hice unos pequeos cambios de posicionamientos en la vista de turnos ya que estuve dando vueltas buscando una pc DECENTE como para poder minimo ABRIR el google chrome ya que las 2 primeras computadoras que agarre eran pesimas. La primera no abria el visual studio code, la segunda con 2gb de ram la pobre no podia abrir el google chrome y abrir eso con el visual hizo que la computadora se apague sola y en esta que encontre porfin pude entrar a mi drive :D','2022-05-06'),(4148,217,'06/05 Continuidad con el desbloqueo','el dia de hoy se pudo realizar el desbloqueo de 2 computadoras incluida la reparacion de 1 que yo habia hecho el cambio de pantalla el cual al principio no encendia y que tenia el teclado en mal estado, como sea tambien se intento el ultimo intento del desbloqueo de una netbook coradir el cual resulto mal y continuamos buscando un nuevo programa.','2022-05-06'),(4149,234,'Clase N17','En la clase de hoy me dediqu a realizar correcciones en la carpeta de campo para que esta pueda quedar ms completa y avanc con uno de los bocetos del js de animaciones','2022-05-10'),(4150,228,'Clase 17','Corregi la validacion PHP','2022-05-10'),(4151,224,'Clase 17','Convers con mis compaeros para continuar con la eleccin de la paleta de colores para la pgina web.','2022-05-10'),(4152,226,'Clase 17','Le agregu una encriptacin MD5 cuando el usuario inicia sesin o se registra','2022-05-10'),(4153,247,'Investigacin de JavaScript II (10/5)','El da de hoy visite el canal &quot;FalconMasters&quot; para estudiar el lenguaje JavaScript ms all de las mltiples &quot;limitaciones&quot; que puede tener la pgina w3school. Vi varios elementos bsicos los cuales reforc con esta serie de videos explicativos, adems de claro, crear mis propias variaciones con los temas vistos en esta clase.','2022-05-10'),(4154,233,'10/5/22','El dia de hoy investigue sobre el funcionamiento de la sintaxis, las variables y los datos en php.','2022-05-10'),(4155,230,'10/05/2022','Hoy organic los directorios de la carpeta donde se encuentra el diseo del login y register. Tambin empec a investigar sobre bases de datos y php, creando en la cual se almacenarn los usuarios del login. \r\nUs este video como gua: https://www.youtube.com/watch?v=veoZts7H-ZI ','2022-05-10'),(4156,236,'clase 17 (10/05/22)','En la clase de hoy estuve haciendo un boceto del index en el cual se vea con un men desplegable y sealando que significaba cada cosa, tambin estuve viendo vdeos de como hacer el men desplegable con HTML, CSS y JS.','2022-05-10'),(4157,238,'Clase 17 10/05/2022','Modifique el responsive de la seccin principal del Index.\r\nCambiamos la paleta de colores de las vistas.\r\n','2022-05-10'),(4158,241,'Bitacora Clase N17 - Toms Ortellado 61 C','Segu viendo MongoDB, como crear bases de datos y usar la consola','2022-05-10'),(4159,227,'Pequeos cambios en configuracion / turnos de partida','Se agrega configuracion de color a &quot;configuracionPartida.html&quot; y un botn de jugar que lleva a &quot;partida.html&quot;. A esta ltima se le agreg una funcionalidad bsica de turnos para iniciar la funcionalidad de la partida.','2022-05-10'),(4160,231,'clase 17','este clase es martes falto Tobias termine con las poses de la animacion de Nahuel y ahora del gif se encarga Ivan(Britez) para que luego lo implementen en el modelo de pagina que tenemos hasta el momento, probablemnte haga otro fondo para la pagina o un nuevo logo ','2022-05-10'),(4161,249,'Clase 5','Hoy modifique la informacin general de la pagina','2022-05-10'),(4162,237,'Clase 17','En el da de hoy continu con las Apis, ya tengo una idea de como es el sistema, aun que no logre ningn logro importante en el avance del cdigo','2022-05-10'),(4163,248,'10-05-2022','Hoy use el programador ch341a para desbloquear la netbook numero 37, la cual estaba bloqueada y al intentar resetearla no funcionaba la batera, tampoco prenda la pantalla.','2022-05-10'),(4164,239,'Dia-16 10/5','Re disee el index de la pagina y empece con la creacin de las dems vistas de la pagina.','2022-05-10'),(4165,247,'Intento de Desarrollo con el Sidebar (11/5)','El da de hoy me dedique a investigar constantemente distintos tipos de sidebar y cuales podran ser aplicables a la pgina web, aunque lamentablemente no encontr ninguno que pudiera ajustar perfectamente a la pgina. Tambin repase algunos conceptos de JavaScript (para no perder la tradicin).','2022-05-11'),(4166,249,'Clase 6','Desarroll el cdigo para agregar la fecha de nacimiento al registro','2022-05-11'),(4167,231,'clase 18','fue una clase traquila(Falto Tobias), como en la bitacora anterior lo comente ya termine con el diseo de poses para la animacion de Nahuelito y como no tengo mucho que hacer me puse a diear una idea de logo que me surgio luego de que estara viendo tutoriales de photoshop en Intagram, la verdad nose si quedo bien, siento que esta algo vacioo y que es algo simple pero tenia que hacerlo por si les agradaba a los chicos para la pagina :b','2022-05-11'),(4168,228,'Clase 18','Sub archivos a github, correg el repositorio y ayude a realizar correcciones en la normalizacion de la base de datos','2022-05-11'),(4169,226,'Clase 18','Colabor a desarrollar el men desplegable del usuario','2022-05-11'),(4170,235,'clase 11/05','en el da hoy seguimos trabando en grupo','2022-05-11'),(4171,246,'Clase 18','En el dia de la fecha realice la normalizacion de la base de datos y me puse al dia con los cambios que hicieron mis compaeros de grupo al proyecto, ya que debido a mis faltas no estuve con ellos.','2022-05-11'),(4172,230,'11/05/2022','Hoy continu desarrollando el login y el register, ms especficamente el register. Logr que al ingresar los datos para el registro (nombre completo, correo electrnico, nombre de usuario y contrasea) se guarden en una base de datos. Al ingresar los datos muestra un mensaje de usuario creado si se cre y de error si no lo hace y devuelve al usuario a la pgina de login y registro. ','2022-05-11'),(4173,232,'CLASE 17 - 27/04/2022','Hoy estuvimos desarrollando conexiones a la base de datos, hacer logos tipo PNG de cada faccion del juego, en especial la de los romanos y egipcios, interfaces graficas del mismo','2022-05-11'),(4174,233,'Clase 11/5/22','El dia de hoy busque videos de como crear una base de datos utilizando php y xampp. Luego me dedique a buscar como agreagarle una sidebar a nuestra pgina , tambien como agregarle , si es posible, animaciones extras a la misma.','2022-05-11'),(4175,238,'Clase 18 11/05/2022','Investigamos plantillas de galeras estilo pinterest.\r\nCree la vista Servicios.\r\nComenzamos a disear cada tarjeta del index.\r\n','2022-05-11'),(4176,234,'Clase N18','En el da de hoy empec a realizar el modelo final del js de animaciones, investigu y tambin ayud a mi compaero de grupo Abdias con el photoshop para hacer el mapa.','2022-05-11'),(4177,241,'Bitacora Clase N18 - Toms Ortellado 61 C','En esta clase continue viendo cosas bsicas sobre MongoDB, pero luego de no mucho tiempo pase a ver node.js, as que comenc a ver los bsicos de node.js, pero tampoco duro mucho tiempo, ya que otro miembro de mi equipo se estaba encargando de lo que yo apuntaba hacer.\r\n\r\nLuego de consultar de a un compaero de equipo sobre lo que el proyecto necesita, faltaba mano de obra (por llamarlo de alguna manera) en diseo, as que pase a disear. Tengo disear los estandartes de las facciones, y me propuse empezar con el estandarte egipcio. Ahora estoy viendo ilustracin en Photoshop.\r\n\r\nComo los videos en youtube no estan siendo muy utiles, o no son lo que busco...  tengo pensado consultar con un amigo que se dedica a dibujar.\r\n','2022-05-11'),(4178,237,'Clase 18','En esta clase se logro la conexin con la Api de Ebay, falta agregarle retoques.','2022-05-11'),(4179,239,'Dia-18 11/5','termine de enlazar la cada vista incluyendo el login y register faltara poner css a las vistas de los productos','2022-05-11'),(4180,236,'clase 18 (12/05/22)','En la clase del da de la fecha realice el men desplegable en el index y hice ciertas investigaciones para mejorar el mismo.','2022-05-11'),(4181,225,'Bitcora ','Termin el casco romano y comenc con el casco francs','2022-05-11'),(4182,227,'Funcionalidad preguntas y modales','Se agregaron modales para la defensa y ataque de territorios. Para acceder a ellos de forma provisoria se colocaron botones en la parte inferior de la pantalla. Tambin se desarroll otro modal para las preguntas y dems funcionalidades.','2022-05-11'),(4183,248,'','','2022-05-11'),(4184,242,'12-5-22','empezamos tomandolo con bastante calma a las primeras horas de la clase y la realizacin del proyecto, por mi parte, no hice demasiado ya que un compaero mio estaba dando explicaciones de que puedo mejorar en el proyecto aunque fueron de bastante ayuda. ','2022-05-12'),(4185,219,'Progreso con la aplicacion Android | Apoyo a grupo de Gantus','En el da de la fecha, con mi grupo estuvimos completando la aplicacin android, especficamente la pestaa de cupones y de inicio. Me toco trabajar con Domini y Delio a distancia, debido a que Matias tiene Covid + y Domini se senta mal, fuera de eso pude hacer algo por mi cuenta, como arreglar de una vez por todas el login de la pagina administrativa.\r\nTambin ayude a Gantus y a su grupo con la pagina que estos tienen que hacer. Se trata de una pagina donde uno pueda registrarse y acceder a distintos cursos de Python, Java, C++ y PHP. Les ayude a terminar el diseo de la pagina y con el como tendran que hacer la estructura de cursos,\r\ndebido a que hasta el momento no tenan una estructura definida y no saban como hacer los ejercicios.','2022-05-12'),(4186,221,'12/05','El da de hoy estuve realizando la pagina de phyton y modificando el men. Todava nos faltan los otros 3 lenguajes. Como no vinieron la mitad de mi grupo no pudimos hacer mucho. ','2022-05-12'),(4187,208,'Base Rojas y Insert.php','Tuve un pequeo percance al abrir el insert.php que tenia guardado en el pendrive, ya que se haba perdido parte del cdigo por lo que tuve que volver a escribirlo. \r\nLuego de eso me puse a modificar ciertos errores que tenia la base de datos como cambiar el tipo de dato de uno de los campos de la tabla fechas_horario ya que le faltaba una clave primaria, ademas modifique parte del diagrama entidad relacin.\r\nMe quedo un error y es el de la clave fornea ya que la clave fornea de turnos se comunicaba con la antigua clave primaria de la tabla fechas_horario pero ahora la clave primaria cambio.','2022-05-12'),(4188,209,'12-05-2022 Backend de ingreso de datos basicos','-Corregimos bastantes desprolijidades del cdigo\r\n-Nos cost bastante encontrar los errores que no nos permitan hacer el insert de los datos bsicos\r\n-Desechamos el botn agregar(medico)\r\n-Agregamos los botones en cada registro para editar, eliminar, agregar datos mdicos\r\n-Le explique a mi compaera una nocin bsica de CodeIgniter\r\n-Finalmente logramos que haga el insert','2022-05-12'),(4189,210,'bitacora 16','estuve haciendo el formulario de turnos utilizando checks y dandole forma luego ayude a mi compaero lucas sosa en un problema que tuvo con la base de datos despues de terminar de hacer el primer punto de los formulario comence hacer el segundo punto de esta que es &quot;dentistas&quot; que hare cards con botones para seleccionar el dentista','2022-05-12'),(4190,217,'encontre los archivos','el da de hoy comenc intentando reparar las computadoras g4, cosa que no se pudo por errores de que no se borran bien los TPM y asi no se puede avanzar, en fin al desarmarla y volver a armarla entend que por ahora no se como repararlas entonces me empee a buscar los archivos correctos de las netbook coradir que bloquee por error y al final logrando su desbloqueo con los archivos correctos, para terminar se lograron desbloquear 2 computadoras mas.','2022-05-12'),(4191,216,'PHP - Proyecto N 1 #12','Un compaero de proyecto me explico el funcionamiento y sentencias utilizadas en PHP (CodeIgniter). Modificamos varias inconsistencias dentro del cdigo, ya que haban nombres de datos que no coincidan entre si e incluso un elemento sin cerrar. Descartamos el botn &quot;Agregar(Medico)&quot; y en su lugar colocamos un botn &quot;+&quot; el cual se podr encontrar luego de los datos ya ingresados de los pacientes ya que solo ser visible luego de ingresar un registro.','2022-05-12'),(4192,217,'Coradir','de las marcas mas problemticas que hay por ahora logre hacer el desbloqueo de la segunda netbook coradir y estuve revisndolas otras que tienen un problema, o no encienden cosa que me parece raro porque no son de esa marca sino de noblex, en fin pienso seguir investigando la causa del porque no dan imagen pero las luces si se encienden y todava me quedan la netbook g4 que no tengo muchas ideas de como desbloquearlas si, con una estacin de soldadura pero eso es otra historia','2022-05-13'),(4193,242,'13-5-22','Empezamos con la tranquilidad dedicando una gran parte del tiempo en hacer una de las cuatro pginas de los lenguajes de programacin, en este caso hablo de hacer poco a poco la de Python, teniendo un resultado que de un inicio no nos agrada demasiado pero posiblemente conformandonos con ese pequeo inici a tomar de referencia para las otras tres pginas restantes.','2022-05-13'),(4194,210,'bitacora 17','Hoy estaba avanzando con el segundo punto del formulario de turnos creando una card nueva para colocar el boton que selecione al profesional que atendera al paciente pero antes de terminar, mi compaero Yonar, tuvo la grandisima y extupenda idea de hacer semejante barbaridad para hacer un corto que haga apagar las computadoras y perdi el progreso de hoy junto a 4 compaeros mas :D\r\nun capo total :D','2022-05-13'),(4195,208,'Comunicacion de modificaciones y Agregando registros','En el da anterior me dedique a hacer algunas tareas que eran del trabajo de un amigo ya que el habia faltado hoy esos mismos cambios y modificaciones que realice se los pase y comunique para que pudiera trabajar con ellos.\r\nLe comunique el cambio al cdigo de la base_rojas.sql y los pequeos rediseos del diagrama entidad relacin, ademas juntos resolvimos el error que daba la clave fornea de la tabla turnos.\r\nPor ultimo se agrego un registro a la tabla doctores, falta agregar algunos para probar la vista mostrar.php\r\n','2022-05-13'),(4196,213,'Base de datos 2.1 ','El da que nos acontece me centre en seguir con la base de datos el da anterior haba faltado por lo que deba ponerme el da un compaero haba modificado la base de datos agregando un campo mas a la tabla de fechas mas especficamente el campo de id que servira para diferenciar los diferentes doctores que puedan tener turnos solapados ya que anteriormente la visin que tenamos de la esa tabla por lo visto era como mnimo errada , este campo el de id nos obligo a modificar la tabla de turnos tambin ya que el campo de fecha estaba con tipo date y el nuevo id es era un int por lo que no podramos hacer la conexin a la tabla de fechas ','2022-05-13'),(4197,209,'13-05-22 Backend datos principales','-Hicimos el boton de delete de cada regisro\r\n-Los inserts reinician la pagina, por lo que se actualiza sola\r\n-Empezamos a remodelar el modal de estado clinico, ya que lo vamos a reemplazar por una nueva vista con todos los analisis y datos medicos\r\n','2022-05-13'),(4198,222,'botones abm','la clase de hoy nos dedicamos a hacer funcionar los botones de la abm, por mi parte, hice el delete, parte el editar y estuvimos resolviendo el como hacer bien el boton de agregar datos medicos/estado clinico, logramos tambien hacer el print de todos los datos del paciente en la pagina, y que se actualice cada vez que estos se modifican.','2022-05-13'),(4199,216,'Diagrama UML - Proyecto N 1 #13','Planteamos entre mis compaeros quien se iba a dedicar a trabajar en cada cosa. Al final la situacin se di distinto y no seguimos lo que planteamos en un principio. Estuve revisando el diagrama de Caso de Uso que realizamos anteriormente ya que el proyecto fu tomando un rumbo distinto y ya no es del todo correcto aquel diagrama','2022-05-13'),(4200,247,'Investigacin de JavaScript III (17/05)','El da de hoy continu con la investigacin sobre los elementos principales de JavaScript.','2022-05-17'),(4201,249,'Clase 7','Agregue la informacin de la escuela a la pgina ','2022-05-17'),(4202,228,'Clase 19','Vi un vdeo sobre esquemas de color para mejorar la parte visual del proyecto ','2022-05-17'),(4203,226,'Clase 19','Verifiqu la funcionalidad del register e inicio de sesin y el sistema de borrado de usuario','2022-05-17'),(4204,237,'Clase 19','El dia de hoy continuamos con la pagina y revise los trabajos de mis compaeros.','2022-05-17'),(4205,230,'17/05/2022','Hoy intentamos solucionar un error que ocurra al importar la base de datos. La misma se importaba pero la tabla usuarios que  tena en ella, si bien apareca, mencionaba que no exista. Aunque probamos varias cosas an no podemos importar la bdd correctamente.Luego en la pgina principal modifiqu un poco los botones y les di hipervnculos.','2022-05-17'),(4206,232,'CLASE 18 17/05/2022','Hoy modifique los valores en los archivos para crear la base de datos en los archivos Javascript, aad valores de Mongodb haciendo un &quot;connect(mongodb://localhost:27017.conquizt.conquiztCOLUMNA);&quot; Esto me permiti avanzar y que errores que me daban antes a la hora de ejecutar la pagina principal','2022-05-17'),(4207,241,'Bitacora Clase N19 - Toms Ortellado 61 C','Tuve un problema con el display de mi computadora del gobierno, as que le solicite ayuda a un compaero que se estuvo dedicando a proporcionar mantenimiento a equipos como el mo.\r\n\r\nNo sabemos bien como, pero resolvimos el problema.','2022-05-17'),(4208,224,'Clase 19','Vi un vdeo sobre esquemas de color para mejorar la parte visual del proyecto.','2022-05-17'),(4209,245,'17/5/2022','el dia de la fecha  he empezado a investigar sobre encriptacin php para contraseas\r\n','2022-05-17'),(4210,234,'Clase N19','En la clase de hoy estuvimos ayudando con los diseos de los cascos','2022-05-17'),(4211,229,'17-05-2022','En la clase de hoy, me encargue de hacer la primera prueba en las animaciones para Nahuelito y actualizar la animacin del logo agregndole movimiento de ruedas para que la imagen no se viera tan esttica','2022-05-17'),(4212,227,'Diseo de logo','Dado que debo esperar a que mis compaeros desarrollen la conexion con la base de datos, proced a dar una mano con el diseo comenzando el logo del men. Para ello investigu algunas herramientas del photoshop y realic algunas pruebas.','2022-05-17'),(4213,236,'clase 19 (17/05/2022)','En la clase del da de hoy estuve agregando las vistas del perfil viejo al nuevo que es un PHP y haciendo pruebas tcnicas de la pagina para ver como era su funcionamiento, tambin estuve acomodando la carpeta de campo que estaba dejada un poco de lado ','2022-05-17'),(4214,233,'17/5/22','el da de hoy comenc con el diseo de la sidebar. Utilice un vdeos y guas de referencias para  agregarle animaciones al men hamburguesa y a la barra en s.','2022-05-17'),(4215,225,'Bitcora 17/5/22','Cerca de terminar el casco Francs','2022-05-17'),(4216,239,'Dia-19 17/5','termine con la conexin de la base de datos y el login','2022-05-17'),(4217,240,'Clase 17','Estuve desarrollando el registre en PHP ','2022-05-17'),(4218,231,'Clase 19','Malana no hay clases por el cenco y hiy tevimos problemas allan y yo con las maquinas ya que estas se apagaban a cada momento,tuve q hacer un trabajo dos veces porque se me apago antes de guardarlo','2022-05-17'),(4219,248,'17-05-2022','Hoy arregle la netbook de un amigo que tenia en su pantalla, la pantalla le parpadeaba y despues de que la apago no prendio, la desarme y parece que habia un cable suelto y lo arregle y ahora funciona redi.','2022-05-17'),(4220,242,'19-05-22','En el da de hoy no fue mucho lo que hicimos ms que el vago intento de mantener y seguir diseando la pginas restantes en los lenguajes de programacin y gracias a un compaero nos ayud lo suficiente, al menos un poco para hacer ese poco hoy mismo.','2022-05-19'),(4221,216,'Revisin de diagramas - Proyecto N 1 #14','Junto a un compaero nos encargamos de revisar los diagramas existentes y realizar los faltantes. \r\nSaque una captura al diagrama de &quot;Entidad-Relacin&quot; que se cre a partir de la base de datos. Hice algunos cambios y aad un par de cosas al diagrama de &quot;Caso de Uso&quot;. Modifique y organice la parte esttica del &quot;GANTT&quot;, junto a otro compaero aadimos un par de cosas a este. Finalmente realic el nivel 0 del diagrama de &quot;Flujo de Datos&quot; y revis tambin el nivel 1 de este diagrama, modificando un par de detalles.','2022-05-19'),(4222,208,'Modificaciones vista tratamiento','En la clase de hoy se fue modificando la vista tratamientos las tres cosas que habian que modificar fueron:\r\n\r\nLas imagenes de las tarjetas 3D (Se pusieron imagenes mas bonitas y con el mismo tamao de la card),\r\nLos textos para las tarjetas 3D (Se hizo mas ameno el texto que informaba en las cards 3D para que sea mucho mas facil de leer)\r\nLos botones de las tarjetas 3D (Los botones anteriormente tenian un diseo que no pegaba con la estitca de la computadora, ahora se uso unos botones con sombreado que eran iguales a los de la vista home de la pagina web)','2022-05-19'),(4223,213,'Base de datos + input ','El da viernes de la semana pasada hubo un microcorte de luz en toda nuestra zona de computadoras con esto perd todo lo que haba realizado ese da por lo que hoy me centre en rehacer eso y tambin agregar dentro de la vista de turnos al input los values que correspondan a cada uno de los datos dentro del form que estaba hecho','2022-05-19'),(4224,210,'Bitacora 18','ahora lo que hice fue retocar el input de calendario y luego me puse hacer la pagina de admin desde cero, tome algunos ejemplos de algunas paginas y pens en hacer un todo en uno de la misma pagina de admin pero todava es un prototipo de como lo hara por que aun estoy viendo que puedo poner dentro de esa sola pagina o puedo dividirla en varias secciones pero eso lo ver mas adelante','2022-05-19'),(4225,211,'diagrama','en el dia de hoy nos organizamos y decidimos que iba a hacer cada uno, por mi parte hice el diagrama de secuencia y agregue algunas cosas en el diagrama de flujo de datos','2022-05-19'),(4226,219,'Apoyo grupo de Gantus','En el dia de la fecha, no tuve mucho progreso con el proyecto de mi grupo &quot;Stone&quot;, pero estuve ayudando al equipo de Gantus con su pagina.\r\nRediseamos algunas cosas de la misma como la pestaa de los lenguajes y las pestaas de los ejercicios. Tambien comenzamos a estructurar el como funcionaria la pagina y todo su funcionamiento.','2022-05-19'),(4227,222,'vista nueva','hoy nos encargamos de mejorar el funcionamiento de los botones del abm, decidimos hacer una vista aparte para los estados clinicos\r\nporque en el modal no entraba todo y era mucho mas complejo llevar a cabo su funcionamiento, aadimos una tabla nueva de estados\r\nclinico.','2022-05-19'),(4228,221,'19/05','El dia de hoy estuve realizando la pagina de phyton. Tuve bastante inconvenientes en cuanto al dise;o de la pagina debido a que queriamos meter un carrosuel como fondo de pantalla pero dejar blanco en el medio. Lo que termino por descartarse debido a su dificultad y lo dejamos en una imgen sola. Estuve redise;ando el menu para que no este tan basio. Utilizando paginas como W3 como modelo para los ejercisios.','2022-05-19'),(4229,217,'Un nuevo pedido','El dia de hoy estuve intentando reparar la computadora de un compaero cosa que solo me pedia desbloquearla y al final si se logro, despues al revisar algunas netbook me di cuenta que los errores de las netbook coradir no son iguales en todas sino que tambien podria deberse a un error en la pantalla como sea hice el mantenimiento de su netbook, asi que por ahora me siento satisfecho. tengo que seguir estudiando y averiguando como reparar las g4','2022-05-19'),(4230,242,'20-05-22','Una vez obtuvimos las vistas de las paginas de los lenguajes, esperamos a que una idea que se nos venga a la cabeza, primero comenzando con el lenguaje Python para tener mejores ideas para el resto. Incluira que arreglamos un par de vistas en el inicio.','2022-05-20'),(4231,208,'Card Cirgia o Card ortodoncia ortognatica','En el dia de hoy se sigui modificando las cards de la vista tratamientos, ayer termine con la de ortodoncia, ahora toco la de ciruga ortogrfica se modifico el texto del end de la card, ademas del boton, y el lugar del boton queda pendiente modificar la imagen de la card, ademas fui charlando posibles ideas para la vista administrador con mi compaero brian farfan','2022-05-20'),(4232,221,'20/05','El dia de hoy no avanzamos mucho, cambiamos algunas imagenes y corregimos algunos errores de diseo. Todavia no sabemos a exacta como haremos el diseo de las paginas siguientes. Pero hoy por tiempo y al no estar todo el grupo no pudimos avanzar tanto ','2022-05-20'),(4233,217,'Revision de la carpeta de campo','El da de hoy para poder despejarme de lo que paso ayer de tanto armar y desarmar notebooks, me tome un respiro y me puse a revisar y continuar mi carpeta de capo con el fin de no estarme atrasando, tambin llegan las preocupaciones del nuevo prefecto de la DET que por lo que dicen es bastante exigente y me pregunto como andar feliz ya que segn lo que se se le rompi su programador y no sabe como continuar','2022-05-20'),(4234,210,'bitacora 19','hoy estuve creando el boceto de la vista de administracin del cual tendr muchas cosas. en el interfaz estara un menu lateral encabezado con la foto de la persona acargo de la administracion debajajo su nombre y apellido, mas abajo estara 5 botones Resumen (mostrata pequeos datelles de cada vista de los siguientes botones mas 4 botones con distintas funciones) Calendario (mostrara turnos en ese mes o en ese dia a realizar) Pacientes ( Mostrara todos los pacientes sin importar su turno ademas de algunos botones que podra eliminar, agregar, modificar y ver) Dentistas (mostrara informacion de los dentistas) ajustes(esto esta proximo a ver)','2022-05-20'),(4235,209,'19-05+20-05 Backend Estado clinico','-Como descartamos la idea de que sea un update, desarrollamos una nueva vista, en la que hicimos un nuevo formulario, el cual la primera vez, le permite al usuario realizar un insert en una nueva tabla llamada &quot;estado clnico&quot;. Si se vuelve a tocar el botn, ya con datos insertados, muestra los mismos, y permite realizar un update de esta tabla(La cual esta relacionada con la tabla &quot;paciente&quot; a travs del atributo dni ).\r\n-Revisamos los diagramas, y los corregimos, de acuerdo a los cambios que surgieron a lo largo del proyecto','2022-05-20'),(4236,216,'Revisin - Proyecto N 1 #15','Revis los diagramas realizados ayer con uno de mis compaeros. Nos queda pendiente rehacer uno que otro de mis compaeros hizo y con ello ya tendramos ms o menos todos completos.','2022-05-20'),(4237,234,'Clase N20','En la clase de hoy segu avanzando con el js de animaciones','2022-05-24'),(4238,246,'24-05-2022','En el da de la fecha junto a mi compaero de trabajo, intentamos re de organizar el github y nos queda por terminar el traslado de archivos, tambin me dedique a corregir cosas de mi carpeta de campo.','2022-05-24'),(4239,247,'Desarrollo de los Contenidos (24/5)','El da de hoy proced a hacer un Word con los indicadores principales de los temas y contenidos que habrpa en la pgina. Por ahora, se redact la introduccin y varias variables de JavaScript.','2022-05-24'),(4240,237,'Clase 20','El da de hoy me puse a editar los buscadores y aadirle estilos','2022-05-24'),(4241,228,'Clase 20','Ayude a mi compaero a reorganizar el github del proyecto e intente avanzar con la pagina web pero la computadora no cargaba el css','2022-05-24'),(4242,230,'24/05/2022','Pude solucionar el error de importacin de la base de datos por lo que pude continuar trabajando en el registro. Hice que se evite la repeticin de datos como el correo electrnico y el nombre de usuario a la hora de registrar un usuario nuevo con uno ya existente.','2022-05-24'),(4243,229,'24-05-2022','En la clase de hoy me encargue de simular el logo de carga para la web cada vez que la BDD necesita recopilar varios datos de una compra que se considere grande','2022-05-24'),(4244,233,'clase 24/5/22','el dia de hoy estuve realizando la sidebar para toda la pagina Hubo complicaciones con las animaciones de la misma pero lo pude solucionar viendo un video y leyendo guias.\r\n','2022-05-24'),(4245,245,'24/5/2022','el dia de la fecha seguimos investigando sobre md5 para poder incriptar contraseas y vimos si tenemos que hacer cambios de css de la pagina web ','2022-05-24'),(4246,236,'clase 20 (24/05/22)','En la clase del da de hoy estuve completando la carpeta de campo, ya que la haba dejado de lado por un tiempo y a la pagina no le falta mucho para terminarse, por eso me puse a hacer la documentacin que falta','2022-05-24'),(4247,231,'Clase 20','es es nuestra segunda decima clase de PP, hasta la fecha continuamos con la elaboracin de los proyectos en grupo, el nuestro va trabajando constantemente aunque el da de hoy falto Dariel y creo que tendremos que hacer un rediseo con la pagina web ya que a algunos de los compaleros de grupo no les gusto el nuevo diseo y probablemnte tenga para la siguiente clase un par de diseos','2022-05-24'),(4248,232,'CLASE 19 24/05/2022','Hoy investigue y segu avanzando en mis cdigos de la base de datos de Mongo, hoy entend varios de los problemas que tenia a la hora de realizar el cdigo y tratar de resolverlos. Entre ellos con un error que me tiraba con el mtodo &quot;require&quot; que tuve en las clases pasadas.','2022-05-24'),(4249,240,'Clase 18','Segu trabajando en el register y empece el login','2022-05-24'),(4250,227,'Continuacion logo','Continuo el logo agregando algunos detalles.','2022-05-24'),(4251,226,'Clase 20','Complet la carpeta de campo con lo que hice anteriormente','2022-05-24'),(4252,249,'Clase 8','Hoy no hice mucho, ya que me senta mal','2022-05-24'),(4253,241,'Bitacora Clase N20 - Toms Ortellado 61 C','Casi no tuve clase al entrar tarde porque hubo acto, y por dar una charla a los chicos de 3ro computacin sobre lo que van a ir viendo en los prximos aos.\r\n\r\nAparte de eso, me quedo pendiente ayudar a un compaero con un problema en la base de datos, que quedar para la prxima  clase.','2022-05-24'),(4254,216,'Diagrama de Secuencia - Proyecto N 1 #16','Estuve rehaciendo el diagrama de secuencia previamente realizado la semana pasada por uno de mis compaeros. V un vdeo al respecto de su realizacin ya que no recordaba su estructura, avanc bastante con el mismo pero an me falta una pequea parte. ','2022-05-26'),(4255,213,'Llenar base de datos','El da de hoy intente llenar la base de datos conforme el formulario dictaba pero mientras mas me acercaba al cdigo en php mas me daba cuenta que no entenda sobre el tema y  esto me llevo a una frustracin por consecuencia de que no poda hacer algo que yo consideraba como fcil que era el hecho de pasar los datos del formulario a la base de datos que tenamos ','2022-05-26'),(4256,208,'Tarjetas 3D','El da de hoy lo utilice para ya por fin terminar con el diseo de cada una de las cards de la vista tratamiento:\r\nCirugia\r\nImplantes\r\nProtesis\r\nEstetica\r\nEndodoncia\r\nSe modifico la descripcin de cada una de las cards anteriormente mencionadas, ademas de cambiar cada una de las descripciones por una mas breve y por ultimo se le agrego un botn que pegue mucho mas con el diseo de la pagina\r\nEsta clase se uso para terminar por completo cada una de las cards','2022-05-26');
INSERT INTO `bitacora` VALUES (4257,217,'Carpeta de campo','El dia de hoy el profesor consorti se encuentra de licencia por covid y el posee la unica llave para abrir el almacen donde se encuentran las notebook, ya que no se pudo continuar con ello me dedique a completar un poco mas la carpeta de campo cosa que avance con 5 paginas mas y me dedique revisar y buscar anteriores bin de netbooks de conectar igualdad, solo espero que los bins no varien dependiendo la marca de cada netbook ','2022-05-26'),(4258,242,'26-5-22','El da se fue para hacer varias cosas, con un poco de la ayuda del profe intentamos mejorar la vista de la pagina principal pero al final no resulto funcionar, fue mejor quedarlo como est. Nos arreglamos con otros metodos.','2022-05-26'),(4259,211,'codigo','en el da de hoy revisamos la pagina y vimos que algunos botones no funcionaban y daban error por lo cual tuvimos que ver el cdigo pero no supimos como solucionarlo asi que seguimos con otras cosas, ademas pensamos en agregar otras opciones a la pagina','2022-05-26'),(4260,222,'diagramas y codigo','hoy nos fijamos en terminar y modificar adecuadamente los diagramas en general, revisamos el codigo de la pagina para resolver pequeos errores con los botones y nos planteamos el empezar a agregar nuevas tablas a la base de datos para determinar donde se esta alojando los pacientes','2022-05-26'),(4261,221,'26/05','El dia de hoy estuve corrigiendo algunos problemas que tuvimos con el carrusel del men y cambiando algunas imgenes para una mejor ambientacin de los lenguajes. Todava tenemos que corregir algunas cosas del men crear las pginas de los lenguajes y la base de datos. De momento estamos creando cada uno por su parte los tutoriales de los lenguajes. Parece que tendremos que dejarlo en 3 lenguajes por falta de un integrante del grupo. Al final si se puede intentaremos terminarlo por el a pesar de no tener el crdito, porque quedara feo una pgina de 4 lenguajes con solo 3.','2022-05-26'),(4262,210,'bitacora 20','estuve continuando con lo que hice en mi casa que fue la pagina de inicio del modo administrador , lo que hice fue cambiar el color de cards ya que estuve un rato viendo el como es que podia solucionar un error de js que no me dejaba incorporar algunas acciones de bootstrap y luego de ello le puse iconos a los botones de inicio para que luego me de cuenta que tengo un error con el bootstrap o tengo algo raro en el codigo','2022-05-26'),(4263,247,'Desarrollo del ndice y de la Introduccin (31/5)','Finalmente, llegue a la conclusin de cuales sern los temas principales relacionados a mi pgina de JavaScript, as como tambin los ejercicios, adems de escribir el guin para video introductorio a JavaScript. Aparte de esto, tambin escrib la Introduccin y una pequea parte del primer tema de los nueve que pienso desarrollar para explicar JavaScript.','2022-05-31'),(4264,246,'bitacora 31-05-2022','En el dia de la fecha trabaje en la base de datos y ayude  ami compaero en la modificacion del php y listou','2022-05-31'),(4265,230,'31/05/2022','Hoy llev a cabo el cifrado de contraseas en la bdd a la hora de registrarse, despus la validacin de un mail y contrasea para el logeo. Este ltimo no funcion con las contraseas cifradas, as que saqu eso temporalmente para que funcione.  ','2022-05-31'),(4266,227,'Continuacion logo y svg','Continue el logo. Ademas, comenzamos a coordinar un trabajo en equipo con el integrante encargado de diseo para incluir el svg del mapa de forma funcional.','2022-05-31'),(4267,238,'Clase 21 31/05/2022','Modifique la cuadrilla de la vista servicios para que todas las tarjetas sean cuadrados iguales.\r\nDecidimos de qu forma importar la informacin de los servicios de la base de datos.\r\n','2022-05-31'),(4268,233,'31/5/22','El dia de hoy ya finalice con la animacion del men hamburguesa de la side bar. Luego continue con el armado de la base de datos de la pgina.\r\n','2022-05-31'),(4269,224,'Clase 21','Decidimos de que forma importar la informacin de los servicios a la base de datos ','2022-05-31'),(4270,234,'Clase N21','En la clase de hoy empec a investigar para trabajar con svg en js','2022-05-31'),(4271,228,'Clase 21','Comence a realizar la conexion php entre la base de datos y la pagina web','2022-05-31'),(4272,231,'Clase 21','Hoy no hubo mucho avanze x mi parte ya que no tuve computadora para trabajar y la q traje se quedo sin bateria y no pude guardar lo q tenia hecho, por otra parte los chicos continuaron con su parte aAllan con las apis y Dariel con el nuevo diseo de la pagima web que disee el fin de semana','2022-05-31'),(4273,241,'Bitacora Clase N21 - Toms Ortellado 61 C','Contine aprendiendo a manejar una base de datos, aunque considero que debera ir mas a como crearla que a como administrarla, y de ah ver como aplicar JavaScript para base de datos.\r\n\r\nO en este caso, MongoDB.\r\n','2022-05-31'),(4274,226,'Clase 21','Discutimos sobre el date picker y continu con la carpeta de campo','2022-05-31'),(4275,229,'31-05-2022','En la clase de hoy me encargue de las pruebas de animaciones, probar y dar una animacin final al logo de carga, dndole fin al mismo y empezar con las animaciones que correspondan a cada botn que el encargado del frontend pida','2022-05-31'),(4276,245,'31/5/2022','el dia de la fecha estuve completando la carpete y puede completar el codigo php para encriptar las contraseas','2022-05-31'),(4277,249,'clase 9','se me ocurri la idea de hacer una linea del tiempo para la pgina y empec a hacerla','2022-05-31'),(4278,237,'Clase 21','El dia de hoy ordene los archivos php con el html para poder tener un mejor entendimiento de la pagina y, de esta manera mis compaeros puedan aplicarle estilos a la pagina, ademas aadi una barra de max y min de plata para poder fijar un precio de busqueda','2022-05-31'),(4279,236,'clase 21 (31/05/22)','En el da de la fecha nicamente me centre en la documentacin de mi carpeta de campo y revisar varias vistas de la pagina ','2022-05-31'),(4280,239,'Dia 20 31/5/22','termine las vistas de la pagina y conectar todo para porfin unir todo y tener la pagina lista','2022-05-31'),(4281,240,'Clase 19','Continu con el sistema de usuarios','2022-05-31'),(4282,227,'Pruebas con el svg','Me reun con mi compaero encargado de disear el mapa y empezamos a unir ambos trabajos. Insertamos el svg en el archivo html de la partida y comenzamos a realizar algunos cambios, poniendonos de acuerdo en cmo continuar.','2022-06-01'),(4283,237,'Clase 22','El dia de hoy arregle la configuracion de precio maximo del ebay api, me puse a investigar ademas de como hacerlo pero para mercadolibre','2022-06-01'),(4284,228,'Clase 22','Modifique la base de datos y realice la conexion entre la base de datos, index.php y servicios.php','2022-06-01'),(4285,239,'Dia 21 1/6','Cambie el estilo de la pagina elegido por el grupo  ahora tengo que hacer lo mismo con todas las paginas','2022-06-01'),(4286,233,'1/6/22','El dia de hoy busque informacin de como realizar una base de datos. Tanto como para la administracion de los usuarios como para el almacenamiento de los videos,informacion sobre los lenguajes, etc. ','2022-06-01'),(4287,241,'Bitacora Clase N22 - Toms Ortellado 61 C','Segui viendo consultan en mongoDB','2022-06-01'),(4288,231,'Clase 22','hoy fue miercoles aunque no hubo mucho por hacer de mi parte ya que entregue todo lo que me pidieron y no tengo ninguna idea para algun nuevo diseo ademas los chicos estuvieron entretenidos viendo el partido de Argentina vs Italia','2022-06-01'),(4289,236,'clase 22 (01/06/22)','En la clase del da de la fecha realice lo que seria la documentacin del proyecto y puse los botones que faltaban en las vistas del perfil (los botones de &quot;volver a inicio&quot;)','2022-06-01'),(4290,245,'01/06/2022','el dia de la fecha continue con mi compaero la pagina web que falta bastante ','2022-06-01'),(4291,238,'Clase 22 01/06/2022','Realizamos los archivos .php de manera de que todos los registros de la tabla servicios se muestren como tarjetas en la pgina de forma dinmica. Lo mismo con los datos de contacto.','2022-06-01'),(4292,229,'01-06-2022','En la clase de hoy se realizo un gran avance con la pantalla de carga\r\nPero por problemas tcnicos(Falso contacto de la zapatilla) hizo que mi sitio de trabajo se apagara y perdiera todo lo avanzado en la clase','2022-06-01'),(4293,232,'CLASE 21 01/06/2022','Hoy vi como ayudar y completar en varios archivos de JavaScript, tanto para interfaces, con los de la base de datos y resolvi varias dudas con el profesor, llegando al punto de que algunos de los problemas que tenia con la base de datos era debido a la computadora con la que trabajaba','2022-06-01'),(4294,230,'01/06/2022','Hoy empec a escribir los contenidos tericos que tendr la pgina, tanto una explicacin corta introductoria de lo que es Java, cmo instalar este y cmo crear el primer programa. Tambin empec a pensar en los primeros videos tutoriales a hacer.','2022-06-01'),(4295,226,'Clase 22','Modifiqu los errores del register y complet la carpeta de campo','2022-06-01'),(4296,240,'Clase 20','Evita que se repitan datos en una base de datos MySQL con PHP, busque un icono para los errores, y cree una hoja de estilos para el register','2022-06-01'),(4297,234,'Clase N22','En la clase de hoy estuve viendo vdeos de svg en js','2022-06-01'),(4298,247,'Contenido de la Pgina (1/6)','El da de hoy empece a desarrollar el contenido de los primeros temas de la pgina de JavaScript, adems de repasar conceptos que tena medio flojos respecto a este lenguaje.','2022-06-01'),(4299,249,'clase 10','segu avanzando con la linea de tiempo','2022-06-01'),(4300,221,'02/06','El da de hoy estuvimos avanzando con la pgina de Python todava nos falta empezar las otras pero una vez terminada esta solo ser copi pega el resto.\r\nEstamos teniendo dificultades para el diseo de la pgina todava porque no logramos hacer el centro de la pgina blanco para que se pueda ver y codear mejor.\r\n','2022-06-02'),(4301,210,'bitacora 21','hoy estaba corrigiendo el error de bootstrap de la clase pasada del card y los botones, ademas de que no funcionaban los botones del Collapse la clase pasada y ya lo arregle eliminando los Link y Script anteriores y poniendo nuevos. Pero tambien estuvo ayudando a mi compaero soler y sosa lucas con un problema del formulario que es el poner una imagen, elegir tratamientos y que dependiendo cual elegis te aparezcan distintos doctores que te van atender y estuvimos casi toda la clase viendo como arreglar eso','2022-06-02'),(4302,208,'Calendario y Formulario','La primera mitad de la clase la utilice para informarme sobre como hacer un calendario de eventos o gestionador de turnos busque en distintos vdeos de youtube e imgenes de google para tener un ejemplo claro y conciso de lo que necesito y quiero realzar\r\nTuvimos un pequeo coloquio sobre la eficiencia de nuestro formulario ya que no se podan completar los datos y que se inserten en la base de datos. Charlamos nuestro inconveniente con el profesor y nos dio variadas soluciones como por ejemplo utilizar una funcin de php llamada ajax','2022-06-02'),(4303,217,'Nueva PC','El dia de ayer me encontre con felix, por sorpresa para me comento que un ex compaero que se cambio de turno a la maana tenia una computadora de conectar igualdad G9 bloqueada cosa que el tenia aquella pc y me la entrego a mi para que pudiera realizar su desbloqueo, este dia lo hice y no fue muy complicado, lo que si a veces siento desconfianza al querer montar los tornillos de vuelta ya que me ocurrio un error del cual es dificil de olvidar','2022-06-02'),(4304,219,'Problemas con Stone','Ultimamente tuvimos problemas con el proyecto Stone, ya que como este esta ciertamente basado en el cdigo de una tienda que hice, tiene el problema de que los cdigos no estn preparados para un proyecto tipo maxirest. Por lo que no parbamos de tener problemas con la programacin de las vistas y de los controladores. \r\nConsultndole a un profesor, nos dijeron que debamos usar el JQuery Ajax, por lo que decidimos por 4ta vez reiniciar la pagina web y su programacion. Mantendremos la estructura que ya venamos planeando pero vamos a volver a programar la pagina porque sinceramente ya no podemos seguir con estos problemas.','2022-06-02'),(4305,220,'02/06/2022','el dia de hoy se arreglaron unos temas de la pag administrativa y se creo una nueva vista de la app android ','2022-06-02'),(4306,213,'Debate serio sobre el form de turnos ','Al da que nos acontece intente seguir con el form que tenia de tarea mi compaero de trabajo llego con un archivo .php que contena un insert para que al momento de rellenar el form este complete la base de datos con lo rellenado en el form para que podamos mostrar esto mismo en la pagina de admin \r\nTras esto intentamos hacer cambios visuales a la vista de turnos al momento de pedir uno lo que deba de hacer esta vista es la de al momento de ir avanzando en la barra de progresin los datos deberan ocultase o mostrarse dependiendo lo antes rellenado','2022-06-02'),(4307,242,'02-06-22','Hoy hicimos lo que pudimos, como ya tener una idea de pies a cabeza en la pgina inicial para cada lenguaje que tenemos planeado hacer. Tomamos el inicio para Python para hacer que aquella idea este completa y luego hacerlo con los dems.','2022-06-02'),(4308,223,'Reincorporacin a las clases despus de tener COVID','Debido a mi ausencia en las ltimas semanas debido a que me enferme de covid mis compaeros de grupo se retrasaron mucho en el proyecto, por eso hoy decid enfocarme por completo en el avance de la pagina administrativa junto con las modificaciones apropiadas a la base de datos\r\nEstas modificaciones en la base de datos consisten en eliminar las filas que no sirven en la tabla de ventas.\r\nPor otro lado, en el cdigo de las vistas de la pagina tambin modifique algunas cosas\r\n','2022-06-02'),(4309,242,'3-6-22','acticamente hicimos lo que no pudimos terminar ayer, aunque hoy tampoco logramos dar un mejor avance ya que tuvimos varios problemas cuales no logramos resolver, nos quedamos haciendo casi nada. ','2022-06-03'),(4310,219,'a?','En el dia de la fecha, no hicimos nada. Fue mas que nada un dia para tocar la guitarra con Brian.','2022-06-03'),(4311,223,'Investigacin sobre conexiones php y ajax','El da de hoy nos concentramos en investigar las cosas que nos generaban dudad sobre conexiones del los cdigos del proyecto, conexiones como kotlin y php para conectar con la base de datos, tambin investigamos breve mente sobre Java Stript Ajax para poder cargar la informacin de la pagina por bloques y no tener problemas a la hora de mostrar nueva informacin. Por otro lado, complete algunas cosas que estaban inconclusas en mi carpeta de campo con respecto a ayer y hoy.','2022-06-03'),(4312,210,'bitacora 22','Hoy en el dia de la fecha no hice nada pero aprendi a tocar 4 temitas de la guitarra que mi compaero fiasche me enseo :D','2022-06-03'),(4313,213,'Ajax ','El dia que nos acontece me centre en buscar el funcionamiento del ajax encontre una pagina llamada MDN Plus dentro de este espacio digital me informe e investigue sobre el funcionamiento del ajax por su necesitad dentro del proyecto que tenemos asignado este sera necesario para la actualizar la pagina cada ves que avance la barra de progresion que pusimos al momento de rellenar la base de datos \r\nY despues al momento profundizar mas en el tema me abrumo justamente unos compaero trajeron guitarras y me prend a la banda','2022-06-03'),(4314,217,'Primer Desbloqueo G4','El dia de hoy el profesor que vino ayer con su computadora g4 de conectar igualdad, la trajo hoy y me pidio si podia desbloquearla, cosa que al principio tenia mis dudas porque era nueva y no sabia mucho como hacerlo pero al final si se dio el caso depues de eastra tanto luchando con un miserable tonillo y tendre que conseguir nuevos destornilladores chiquitos, luego de eso estuve tambien luchando por saber cual era la pata 8 del chip y al final de prueba y error pude leer el chip y realizar el desbloqueo, un dia de trabajo.','2022-06-03'),(4315,245,'7/6/2022','el dia de la fecha fuimos a una capacitacin de dmd de seguridad informtica \r\ny luego ingresamos devuelta a la escuela y en mi caso empec a investigar sobre sistema de encriptacin SHA','2022-06-07'),(4316,229,'07-06-2022','En la clase de hoy, empece con las pruebas de fuentes externas, para tener ideas para la fuente personalizada que se utilizara para nuestro proyecto\r\n','2022-06-07'),(4317,231,'Clase 23','Se podria decir que nuestra clase comenzo desde las 10 de la maana ya que tuvimos que ir a un eventro del asac y estuvimos alli dos horas para luego tener un largo viaje ya de regreso al aula no hubo mucho que podria hacer ya que no tengo nada oara aportar ','2022-06-07'),(4318,246,'bitacora 7/06/2022','hoy comenc a ver unos cursos de sql, la diferencia en las nosql y las sql y revise todos los sectores en los cuales nos dividimos los integrantes del grupo','2022-06-07'),(4319,234,'Clase N23','Seguimos trabajando en grupo, aparte por la maana tuvimos un encuentro en el cmd','2022-06-07'),(4320,233,'7/6/22','El da de hoy asistimos a una capacitacin en el Centro Metropolitano de Diseo sobre Ciberseguridad. Luego volvimos a la escuela y continuamos con nuestros proyectos. ','2022-06-07'),(4321,240,'Clase 21','Comenc el re diseo de la pagina','2022-06-07'),(4322,241,'Bitacora Clase N23 - Toms Ortellado 61 C','Esta maana fuimos a una charla en Barracas  en el Centro Metropolitano de Diseo sobre seguridad.\r\n\r\nAparte de eso, a la tarde continu un poco con las consultas en MongoDB \r\n\r\n','2022-06-07'),(4323,247,'Charla de Seguridad Informtica (7/6)','El da de hoy, viajamos hacia Barracas para tener una charla sobre seguridad informtica en el Centro Cultural Metropolitano, charla que se dividi en dos secciones: la primera, muy tcnica, que trata sobre los protocoles sobre la seguridad y la segunda relacionada a los hackers. Ya en Proyecto Informtico, investigue y desarrolle un poco ms la Introduccin de JavaScript.','2022-06-07'),(4324,249,'clase 11','tuvimos una charla de ciberseguridad y empec a redisear las vistas de la pgina.','2022-06-07'),(4325,230,'07/06/2022','Hoy tuvimos una charla de capacitacin sobre ISACA, ciberseguridad y hacking tico en barracas, al final completamos un cuestionario sobre dichos temas y relacionados. Tambin hoy hice el guin para el tutorial de instalacin de Java.','2022-06-07'),(4326,226,'Clase 23','Complet la carpeta de campo y realic algunos cambios en la rama main','2022-06-07'),(4327,236,'clase 23 (07/06/22)','En la clase del da de la fecha estuve realizando el diagrama de Gantt de nuevo, ya que lo haba perdido en el drive, tambin estuve haciendo documentacin en la carpeta de campo ya que estaba incompleta.','2022-06-07'),(4328,227,'Avance JS','El dia de hoy logramos implementar el cdigo JS correspondiente a la apertura de modales al clickear sobre un territorio. Adems, incluimos otras funciones de JS sobre los territorios como, por ejemplo, que cambie de color de fondo segun de qu jugador sea el territorio.','2022-06-07'),(4329,232,'CLASE 22 07-06-2022 / CLASE 23 08-06-2022','CLASE 22 07-06-2022\r\n\r\nHoy asistimos a una charla sobre ciberseguridad, en esta nos contaron sobre dos empresas complemente distintas destinadas a lo mismo, una siendo ISACA y otra ROOT-SECURE. En esa charla nos explicaron conceptos y las maneras en las que se arman sistemas de seguridad apropiados\r\n\r\nCLASE 23 08-06-2022\r\n\r\nHoy desarrolle la base de datos utilizando el lenguaje MySQL y tambin utilizando PHP haciendo uso de jQuery. Logr hacer varias tablas de las que se tena que hacer','2022-06-08'),(4330,226,'Clase 24','Continu con la carpeta de campo, Charlamos los nuevos diseos de las paginas y restaur un navbar que haba sido borrado por error','2022-06-08'),(4331,231,'clase 24','el dia de hoy es miercoles, falto Tobias hize un nuevo diseo para le buscador de la pagina y no se cuanto avanzo el resto, por mi parte no hi