rogramacin.','2022-06-08'),(4342,233,'Clase 8/6/22','El dia de hoy me enfoque en el estructuramiendo de la pgina. Estableciendo las distintas secciones con los temas correspondientes al lenguaje y solucion un problema con la sidebar en el cual no se mostraba las animaciones de desplazamiento. ','2022-06-08'),(4343,241,'Bitacora Clase N24 - Toms Ortellado 61 C','Hoy decidimos cambiar la base de datos.\r\n\r\nDebido a eso, pase a trabajar a diseo, de vuelta, pero esta vez ser de un plazo mayor al anterior.\r\n\r\nMi meta ser disear los estandartes de las facciones.\r\n','2022-06-08'),(4344,236,'clase 24 (08/06/22)','En la clase del da de la fecha realice una campanita de notificacin en el navbar, que lo que hace es mostrar un mensaje y mostrar la cantidad de mensajes recibidos o no ledos por el usuario, ademas, estuve haciendo la carpeta de campo ya que la tenia media incompleta','2022-06-08'),(4345,230,'08/06/2022','Hoy estuve modificando el diseo de las pginas en donde ir la informacin explicativa de Java, adems de estar agregando material a las mismas, ms especficamente a la pgina introductoria al lenguaje y con la de fijarse la versin y la instalacin del lenguaje. ','2022-06-08'),(4346,242,'09-06-22','Hoy hemos hecho una variedad de cosas, aprender de una I.A. bastante curiosa, dimos nuestro mejor intento de mejorar como es la base de Python, aunque esta costandonos bastante de nuestra imaginacin. El resultado no fue lo que esperamos pero fue al menos un buen avance.','2022-06-09'),(4347,221,'09/06','El dia de hoy estuve completando la carpeta de campo llenando con la experiencia que tuvimos en la expocision de ciberseguridad. Y avanzando con nuestro proyecto.\r\n','2022-06-09'),(4348,210,'bitacora 23','cree la vista de dentistas con la misma tabla del primer pagina de administracion la vez que estaba probando y tambien cree con la misma estructura pero le cambie algunos colores asi se puede diferenciar mejor todo esto tambien cambie una funcion que iba a tener el