gada.','2022-06-23'),(4438,211,'actualizacion del diagrama de gantt','en el da de hoy nos pusimos a conversar y decidimos que tareas nos quedaban pendientes y actualizar otras y no las repartimos entre los participante del grupo, por mi parte tuve que agregar nuevas cosas al diagrama de gantt como los predecesores de las tareas y configurarle bien las fechas, y despus nos llamaron y nos hablaron sobre como iban a ser las notas de la materia.','2022-06-23'),(4439,216,'Trello - Proyecto N 1 #18','Realic el Trello del proyecto, agregu las columnas de &quot;Lista de tareas&quot;, &quot;En proceso&quot;, &quot;Testing&quot; y &quot;Finalizados&quot;,  agregu las tareas que estuvimos realizando a lo largo del proyecto y las coloqu en las columnas correspondientes.','2022-06-23'),(4440,221,'23/06','El dia de hoy, como estamos ya a fines de mes tenemos que terminar  varias cosas, como actualizar el diagrama de Gantt que ya tenemos, subir los archivos al Github y terminar el trello. Hoy tambin tuvimos una reunin con los profes donde nos explicaron y aconsejaron sobre coordinacin que tenemos que utilizar durante las horas de clase.','2022-06-23'),(4441,210,'bitacora 25','estuve con mis compaeros haciendo la daylist con el profesor olaso, luego nos pusimos hacer distintas tareas, mi compaero Sosa lucas estaba haciendo el Gantt, mi compaero Soler estaba haciendo y mi compaero Tolosa que aparecio de la nada le dije que haga el calendario que habia quedado pendiente ya que era complicado. y yo estuve armando toda la pagina con las piezas que estuvimos trabajando todo este tiempo en las distintas vistas de todo esto para luego subirlo a github','2022-06-23'),(4442,213,'PHP','El dia de hoy en este momento me situo en un estado de estudio en referencia lenguaje de programacion llamado php debido a que requerimos de este lenguaje de programacion para entablar una relacion con la base de datos y mover archivos y pedir datos entre la vista admin y la base de datos con esto en mente est