ASE 28 - 29/06/2022','Hoy tuvimos una exposicin de todo el curso donde cada grupo expuso el proyecto que desarroll en los pasados cuatro meses, en total eran seis grupos y nosotros fuimos el cuarto, A mi me toc exponer la parte de la base de datos y cmo la bamos implementando en la pgina ','2022-06-29'),(4459,249,'Clase 17','Hoy se realizaron las presentaciones de los proyectos ','2022-06-29'),(4460,237,'Clase 29','El da de hoy expusimos en grupo nuestro proyecto en clase a los profesores de practicas profesionales.','2022-06-29'),(4461,245,'29/6/2022','el dia de la fecha hemos presentado con mi grupo el trabajo de la pagina web que tenemos hasta el momento','2022-06-29'),(4462,229,'29-06-2022','En la fecha de hoy, se realizo una presentacin del producto que estamos haciendo en conjunto con mi grupo, simulando la venta de un producto','2022-06-29'),(4463,233,'29/6/22','El da de hoy tuvimos una presentacin sobre nuestros proyectos para ver que tan avanzados y que tan bien encaminados vamos. En el caso de mi grupo , presentamos la pgina que estamos desarrollando y les contamos a los docentes como se compone la misma.\r\n','2022-06-29'),(4464,228,'Clase 29','Realizamos la exposicin del proyecto','2022-06-29'),(4465,247,'La Presentacin II (29/6)','El da de hoy los 5 grupos realizamos una presentacin respecto a lo que estaban siendo nuestros proyectos. En nuestro caso, explicamos la funcin de ProgramaFcil y el contenido que contiene esta pgina. Al final del da, tuvimos que entregar la carpeta de campo con las 100 pginas hechas.','2022-06-29'),(4466,231,'clase 29','el da d hoy es mircoles y la clase del martes se paso por alto debido a que era feriado, hoy estuvimos presentando la venta y progreso del proyecto de cada grupo y como va el desarrollo de su proyecto, a todo esto nosotros fuimos los ltimos en exponer pero fue bastante bien hasta que la computadora se frizo y tuvimos que reiniciar la computadora','2022-06-29'),(4467,226,'Clase 29','Tuvimos la presentacin del proyecto','2022-06-29'),(4468,234,'Clase N29','En la clase de hoy expusimos frente al curso el proyecto, explicamos las caractersticas del mismo y sus funcionalidades.','2022-06-29'),(4469,241,'Bitacora Clase N28 - Toms Ortellado 61 C','El da de hoy los distintos grupos de proyecto estuvimos expusimos sobre nuestro proyectos, lo que hemos logrado, para donde apunta, etc.\r\n\r\nTambin realizamos la entrega de la carpeta de campo, con la meta de llegar a 100 pginas a la fecha de hoy.','2022-06-29'),(4470,240,'Clase 27','Presentacin de proyectos','2022-06-29'),(4471,239,'Dia 27','El dia de hoy termine la base de la pagina llegue a 91 paginas en la carpeta de campo y tuvimos la presentacin del producto (la pagina web)','2022-06-29'),(4472,227,'Exposicin de proyectos','El dia de hoy expusimos cada grupo su proyecto. Nos pusimos de acuerdo en qu iba a decir cada uno y realizamos nuestra exposicin comentando las bases del proyecto, el progreso y la situacin actual, entre otros.','2022-06-29'),(4473,230,'29/06/2022','Hoy tuvimos que hacer una presentacin sobre nuestro proyecto, nuestros avances en el mismo y tratar de venderlo. Tambin observamos las presentaciones de otros grupos y realizamos preguntas, tal como nos preguntaron a nuestro grupo. ','2022-06-29'),(4474,236,'clase 29 (29/06/22)','En la clase del da de la fecha dimos una presentacin del proyecto, en la cual dimos explicacin del origen del mismo, que fue lo que usamos, mostramos como estaba quedando hasta el momento y mostramos ideas para el futuro.\r\n','2022-06-29'),(4475,221,'30/06','El da de hoy tuvimos que exponer nuestro proyecto frente a nuestros compaeros. Debamos tener un power point pero no se nos fue posible debido a que no tenemos mucho que explicar ya que vamos muy atrasados.','2022-06-30'),(4476,220,'30/06','En el dia que acontece el dia de hoy realize una vista controlador en android kotlin con una conexion pequea en php la cual cambia de un login a una pequea pestaa la cual muestra al usuario que a