n y actualizacion','El dia de hoy mi compaero felix me haba informado hace unos das que haba ocurrido con las PCs que use como piezas y pude recuperar algunas otras, para ello me decidi por revisar algunas pcs que quedaron inservibles y depaso hacer un recuento y una actualizacin en el Excel que tenamos como registro de todas las pcs adems de eso me puse a averiguar si haba algo malo con los discos duros de las otras pc y me dia a la tarea de revisar eso por lo que durante este tiempo use mi antigua computadora que normalmente uso de prueba para examinar,','2022-08-04'),(4611,223,'Regreso a clases y avance en la pagina','El da de hoy volvimos a clases despus de las  vacaciones de invierno, hoy tena planeado continuar con las pginas y tratar de terminarlas para hoy pero sufr de muchas dificultades y contratiempos que me impidieron llegar a mi objetivo de terminar la pgina, tras algunos problemas lo gue llegar a una solucin y es trabajar en una nueva pagina con lo mejor entre mi pagina y la pagina de mis compaeros, en la cual tendr que trabajar en mi casa ','2022-08-04'),(4612,242,'5-8-22','Pude hacer lo que me quedaba de tiempo, es decir, agregar un poco de lo que aun tengo pendiente del toturial de Python, Variables','2022-08-05'),(4613,221,'05/08','El ida de hoy como es de costumbre no hubo mucho progreso mas alla de la falta de la mayor parte de mi grupo. Asique simplemente me puse a terminar mi tutorial de C++ asi ya podriamos empezar a realizar las vistas en la pagina.','2022-08-05'),(4614,217,'Continuando la carpeta','El dia de hoy estuve haciendo una complementacion a la carpeta de campo ya que ayer estuve trabajando con las pcs en revisar cuales estaban defectuosas y cuales necesitaban un pequeo ajuste en cuanto a los datos del SO como a algunas PCs que directamente no arrancaban ni por que reconocia las particiones o que no tuviera SO alguno, por ello me propuse a hacer puebas acerca de que discos funcionaban correctamente y cuales no.','2022-08-05'),(4615,2