a 2022. Llegue a la decision de hacer un Instant Search con ajax y JsQuery, los proximos pasos van a hacer realizando el instant search','2022-08-11'),(4648,213,'Audits y Login ','El da de hoy  empece con el intento de realizar el login el cual despus de que el profe nos mostrara las Audits de la pagina termine volcando mi trabajo del dia a realizar que estas audits tengan el numero mas alto por que esto sera requerido para aprobar la materia tras esto me puse en camino a buscar lo requerido en cada uno de los puntos por suerte la Audits medio que te dicen que esta mal y en base a eso me gui para la mejora de la app  ','2022-08-11'),(4649,242,'11-8-22','Se pudo hacer un poco bastante de mi tutorial, como pequeos temas pero que los considero importante al tomarlas como referencias con tareas previas','2022-08-11'),(4650,221,'11/08','El da de hoy estuve buscando como realizar los ejercicios de la pgina. Ya que se nos dificultaba por el hecho de que ninguno de nosotros saba cmo hacer para que almacenaran el progreso.\r\nTerminamos optando luego de consultarle al profe que usaramos quiz de hitgub para poder hacer un formulario. Pero luego se nos ocurri mejor el usar un google form.\r\nCon ese se nos facilitaba mucho el hacer el formulario donde iran los ejercicios prcticos.\r\nTambin cambiamos el cmo seran los ejercicios. Ahora en vez de ser una serie de ejercicios prcticos con un video extra al final. Termino siendo in video central de tutorial y un formulario de google con 10 ejercicios tericos y luego implementaremos 5 ejercicios prcticos sencillos los cuales contaran para el progreso del usuario pero no tendrn una barra de progreso.\r\n','2022-08-11'),(4651,219,'Proyecto Stone - Avances con la aplicacion','Por fin despues de tanto tiempo ya tenemos avances con la aplicacion del proyecto Stone, Domini encontr una pagina la cual nos va a permitir desarrollar la aplicacion con la misma flexibilidad y con aun mas facilidad que Kotlin (Que porcierto ya nos estaba poniendo demasiado nerviosos, debido a que su lenguaj, aunque parecido a Java funcionaba de manera distinta y se nos era demasiado complejo. Ademas que el emulador no funcionaba correctamente). Tambien conseguimos avances con la pagina como por ejemplo el aadir los iconos y opciones restantes al menu de admin y tambien comenzamos a investigar el como migrar la base de datos a Firebase, la cual nos va a ayudar para integrarla tambien a la aplicacion Android.','2022-08-11'),(4652,220,'11/8','El dia de hoy avanze un monton con la aplicacion android usando varios programas como flutter y figma el cual pre generar plantillas que puedo usar para modificarlo a mi gusto y realizar mi trabajo mas rapido . lo cual nos ahorrara tiempo para finalizar el proyecto y usarlo en nuevos ','2022-08-11'),(4653,210,'bitacora 33','Hoy estuve haciendo la nueva daylist ya que una compaera se integro en nuestro grupo asi que le asigne la tarea de poner animaciones con un front de JS, mis compaeros Sosas, Soler y Tolosa siguen con los trabajos anteriores mientras que yo me dedique a rehacer un nuevo @Media de CSS para la parte del latinpage','2022-08-11'),(4654,223,'Perdida de la pagina e continuacin de la otra','El da de hoy los planes eran iniciar con las vistas de los tutoriales de la pgina, para mi desgracia a la hora de descargar las carpetas de la pgina me di cuenta que todo el progreso que hice la clase anterior se haba perdido, desconozco la razn de tal echo desafortunado. Tras eso me puse a trabajar en la pagina de mis compaeros y avance respecto a ella ','2022-08-11'),(4655,214,'Edicion Agenda','estuve viendo en la pagina de full calendar maneras de editar los colores botones etc del calendario, luego en la vista de la agenda me puse a editar el form en el que se aaden las citas para que sea un modal flotante y salga cuando se clickea un dia en el calendario, prepare el modal pero no pude hacerlo funcionar cuando se clickea el dia','2022-08-11'),(4656,217,'un nuevo pedido y revisiones','e