s mas cumplan la funcion de responsive agregando el @media este trabajo del footer y hacer que los contenidos sean responsive lo hare con Mariel para que me ayude haciendo el footer y yo corrigiendo otros errores mas de la pagina web','2022-08-12'),(4660,208,'Search (Codigo no implementado)','Use la clase para recaudar informacion sobre el boton de search e hice el codigo para que funcione, ayer el profe me dijo que todo tenia que ser realizado en la misma vista cosa que hice. Por culpa de lo lenta que andaban las computadoras no pude usar VisualStudioCode. Use el Notepad++ e ahi hice el codigo pero todavia no esta implementado en la vista','2022-08-12'),(4661,214,'Vista agenda','hoy estuve probando combinaciones de colores para el fondo de la pagina manteniendo el degradado de colores de las vistas principales intentando que el degradado empiece de un lado y no este dividido en partes','2022-08-12'),(4662,213,'Poco avanse','El dia de hoy no tuve acceso a una computadora cerca de mis compaeros de grupo por lo que estuve ayudando a sosa con su buscador que tiene que hacer encontramos un video que fue facil de entender e intentara aplicarlo por su cuenta por mi parte inte subir los puntajes de los analisis eso de ayer y pero por lo visto las pc de el aula en el que estbamos no podian llegar a realizar estas analiticas ','2022-08-12'),(4663,217,'Se reparo la pc del &quot;MONO&quot;','El da de hoy contine revisando los discos duros de las \r\nPc que haba desarmado anteriormente , como consecuencia de eso termine bastante agotado cosa que una vez terminado el proceso de desarme y reubicacin de los discos los cuales prob si estaban en ptimas condiciones y resulto que de los 5 discos que haba recuperado solo 2 se encontraban en un estado dudoso el cual era que no tenan ningn sistema operativo descargado en aquellos discos cosa que lo primero que hice fue verque contenian, y ese mismo dia me propuse a desbloquearla y finalmente despues de 3 intentos se pudo','2022-08-12'),(