vento.\r\nPor el otro lado, los modales eran hasta ahora uno de defensa y uno de ataque, se modificaron para que sea un unico modal para ambos fines. De esta forma se ahorra mucho cdigo y ademas se permite acceder a un numero de soldados.','2022-08-17'),(4684,230,'17/08','Hoy actualic mi cv con informacin actual y poniendo el nivel de ingls conseguido en el test hecho anteriormente. Tambin desarroll un inicio de sesin y un cierre de la misma. ','2022-08-17'),(4685,249,'Clase 26','Segu haciendo el responsive.','2022-08-17'),(4686,234,'Clase N38','En la clase de hoy le agregu sombras a los escudos de los imperios','2022-08-17'),(4687,236,'clase 38 (17/08/22)','En la clase del da de la fecha segu ayudando a mi compaero Ivan con las vistas del perfil, una vez que finalizamos con esa parte de la pagina, comenze a hacer el boceto de mi CV para la pasante (aunque no me voy a presentar como postulante)','2022-08-17'),(4688,237,'Clase 36','El dia de hoy continue con el Fpdf armando un formato basico de como quedarian los productos en listados.','2022-08-17'),(4689,231,'clase 38','la clase hoy se nos pidi el curriculum vitae o CV para que los profesores los entreguen a ????, por mi parte yo tenia el mio pero nos acepte a postularme ya que no estaba interesado, luego continue con el nuevo rediseo del logo y creo que ya estoy por terminarlo aunque creo q falta un par de detalles y creo que terminaria, El profe Consorti me dijo que en mi caso podria hacer otro CV ya que al saber disear pordia hacer un CV personalizado usando lo que se de Adobe','2022-08-17'),(4690,245,'17/8/2022','el da la fecha re  hice mi CV y seguimos con el tiket de compra de la pagina web','2022-08-17'),(4691,228,'Clase 38','Realice un CV para aplicar a una pasantia','2022-08-17'),(4692,240,'Clase 36','Empece a desarollar el backend de la vista de seguridad','2022-08-17'),(4693,241,'Bitacora Clase N37 - Toms Ortellado 61 C','En la clase de hoy recopile distintas images que les dare uso en el diseo del estan