a de finalizar)\r\n-Inicio de vista de perfil de empresa\r\n-Planteo de formularios, para asi a futuro realizar el backend\r\n-Implementacion de animaciones con AOS','2022-08-18'),(4703,210,'bitacora 35','Hoy estuve haciendo la correcion de los card de los profecionales lo cual fue demaciado facil ya que solo cambie los 300 px que tenia antes por un 100% para que este sea responsive sin necesidad de hacer tantos @medias, luego con mi compaero soler estuve ayudadndo a hacer las auditorias de google de nuestra pagina diciendole donde esta cada codigo y que podria hacer, luego estuve ayudando a mi compaero lucas hacer un voton en la vista de dentistas que este boton eliminaria la busqueda de que realizaria el usuario y asi mostrar por completo la tabla de dentistas','2022-08-18'),(4704,221,'18/08','El da de hoy estuve con un compaero resolviendo el cmo hacer la respectiva vista del lenguaje C++.\r\nNos cost bastante a pesar de no haber terminado por el tema de que el fondo se nos complicaba para ajustarlo a lo que buscbamos. Primero tuvimos la idea de un fondo de color blanco pero quedaba muy vaco todo y lo cancelamos. \r\nLuego quisimos poner una imagen y nos cost buscar una imagen de programacin con buena resolucin y luego ponerla como fondo sin que se agrande o se repita.\r\nComo esta idea se acercaba ms pero todava quedaba vaco debido a que el contenido de la pgina pareca flotar por encima del fondo y no era un efecto muy agradable a la vista.\r\n','2022-08-18'),(4705,220,'18/08/2022','En el dia de la fecha terminamos las vistas principales de la aplicacion android, solo toca integrar la base de datos de firebase con flutter. Sinceramente el proceso es bastante complejo, xq pide una cantidad de paso los cuales hay que hacer antes de crear el proyecto.','2022-08-18'),(4706,213,'Debuggin','El dia de hoy me dispuse a subir las estadistas de cada una de las vistas correspientes al apartado de landing page de nuestro proyecto , las estadisticas a subir se muestren en el