a estar mas encaminado','2022-10-13'),(5043,216,'22/09, 23/09, 29/09 y 13/10 Organizacin del cdigo, funcionamiento de login Admin','Durante los das 22, 23 y 29 de Septiembre me encontr junto a uno de mis compaeros intentando organizar un poco el cdigo del proyecto ya que haba muchas carpetas dems dentro del mismo que complicaban saber qu era cada cosa; nos pusimos a borrar, crear y renombrar varios archivos y carpetas. \r\nEl da de hoy nos dimos cuenta que estbamos modificando una versin antigua del cdigo, por lo que decidimos continuar lo faltante y volver a reorganizar de cero una vez terminemos el proyecto; se me asigno la tarea de hacer que funcione el login de administrador ya que actualmente no hace nada.','2022-10-13'),(5044,234,'Da N12 PE','Hice dos remitos y dos facturas, escane una factura de una compra y arm un presupuesto.','2022-10-13'),(5045,242,'14-10-2022','El da se baso completamente en intentar rellenar la carpeta de campo e intentar completar el formulario y su error que aun no logre encontrar despus de tanto tiempo','2022-10-14'),(5046,211,'carpeta de campo','en el dia de la fecha agregue un par de cosas a la carpeta de campo pero no segui el proyecto de php','2022-10-14'),(5047,222,'Java','Hoy segu avanzando con el vdeo de 12 horas para agregar ms ejercicios al vdeo explicativo que ronda masomenos los 30 minutos, luego agregue un par de cosas a la carpeta de campo','2022-10-14'),(5048,217,'Instalando drivers y carpeta de campo','El da de hoy al ponernos a buscar informacin de cmo buscar los drivers de distintas manera encontr un programa el cual te descarga los drivers de las redes wifi y de manera automtica te busca los que o estn actualizados las nica discrepancia que le encuentro es que solo es de redes de internet si ya queremos buscar controladores de video necesitara otra herramienta, pero en cualquiera de los casos la otra manera de encontrar drivers.','2022-10-14'),(5049,210,'bitacora 41','lo que hice hoy fue completar el codigo de ayer 