arlo mas espacios para llenar tuvo un par de errores y no pude conseguir que mostrara el dia pero lo demas funciona , tambien entre al github para subir y compartir los archivos','2022-11-03'),(5168,208,'Laburito con Workbench y replanteamiento de la base de datos','Nuestro gua Damian Olaso nos enseo breves cosas sobre como usar una Workbench (nos dio el ejemplo que es como la especie de Idle de Phpmy admin, a mi en particular esa definicin me ayudo un montn) luego nos dio una idea de como hacer el backup de la base de datos, esa idea la anote toda en la carpeta de campo\r\nPor otro lado nos fuimos cuestionando como esta diseada y hecha la base de datos ya que cuando la empezamos a hacer no tenamos el conocimiento que tenemos ahora, le estamos poniendo mas nfasis en el cdigo de Mysql y no tratar de hacer todo con php, agregue una funcion agregarTurnos\r\nPor ultimo empezamos con el planteamiento del modelo MVC','2022-11-03'),(5169,217,'Pedido de desbloqueo coradir','El da de hoy tena pensado con seguir con la carpeta de campo al buscar un poco de cmo se crearon las computadoras y como se ensamblaron en tierra del fuego y por qu varias empresas son las que estn implicadas, pero dejando eso de lado el profesor consorti me vino a hablar acerca de lo que sera unas PC de taller que se encuentran bloqueadas el nico dilema es que me comento que hay posibilidad de que esas mquinas fueran de la marca coradir y si es el caso me aterra el solo hecho de pensar que se  podra llegar a bloquear y nunca ms volver a prender son cosas que me temo puedan ocurrir, as que comenzamos:','2022-11-03'),(5170,228,'Practica externa Da 24','Continue realizando test unitarios y tuve una reunion en la que me ayudaron con cosas que no me salian','2022-11-03'),(5171,228,'Practica externa Da 24','Continue realizando test unitarios y tuve una reunion en la que me ayudaron con cosas que no me salian','2022-11-03'),(5172,234,'Da N27 PE','Orden el escritorio de la pc, escane una retencin, un plano y un