in o lo que yo creo que es buena','2022-11-11'),(5224,219,'11-11','En el dia de la fecha estuve terminando algunos detalles de la pestaa de administracion del peoyecto School, tambien organizamos el como se va a presentar el proyecto ya que los integrantes: FRANCO, EZEQUIEL, VELARDE Y FACUNDO no cumplieron asistencia los dias de practicas profesionalizantes, por lo que solamente quedamos FEDE, DELIO, GANTUS Y YO.','2022-11-11'),(5225,221,'11/11','El dia de hoy vinimos antes al colegio por una cuestio de que tenamos yo y otros mas tenamos POO previa y tuvimos que venir a unas clases por parciales que en realidad son para preparar la previa para diciembre en las que nos explicaron muy rpida mente que es POO y para que sirve.\r\nLuego tuvimos una hora y media hasta que sea la hora de PP y nos fuimos a pasear por ah.\r\nAhora en PP estamos tratando de subir las cosas a github para asi tener todo mas organizado y poder compartirlo con todos mas fcilmente y sin necesidad de ir pasndonos los archivos con cada cambio que hacemos.\r\n','2022-11-11'),(5226,223,'Carpeta de campo y cdigo con fiasche y gantus','El da de hoy trabaje completando algunas paginas de mi capeta de campo revisando el texto de das anteriores y agregando contenido, en total llegue a completar diez paginas de la carpeta. Tambin trabaje junto con fiasche y gantus en la pagina comenzando a realizar los cambios que fiasche quera realizar para poder aprobar la materia.','2022-11-11'),(5227,208,'Funciones agregarDoctor y verificarCorreo','Me encargue de terminar las funciones de agregarDoctor, dentro de la fucion agregar doctor se pasa por los verificar vacio y especiales que hice ayer, se pasa por estos verificar para que no se agregue algun registro que pueda afectar a la base de datos, en caso de que este todo ok se efectua el insert y se agrega el doctor, faltaria termianr con el agregarPaciente; por otro apartado tengo que terminar con los verificar se me ocurrio agregar un verificarCorreo verificar dni y verificar tamao (verificar tamao utilizado en telefonos)','2022-11-11'),(5228,213,'Login e prevencion de inyecciones y hackeos','Al momento de llegar mi scrum master no estaba por lo que empezamos a realizar las tareas adeudadas tras esto y hablar con Brian sobre el login me dispuse a aquello de forma de poder terminar el login tras realizar modificaciones a la vista de index.php y de login.php con el tema de los require pude completar el login y era funcional pero al momento de querer cerrar sesion esto era imposible debido a que el codigo correspondiente a session destroy no estaba por lo que me dispuse a hacer esto para que se pueda cerrar la sesion. Tras completar esto pedi a los profesores si podian intentar hackear el login y resulto ser complicado de hackear por lo que estoy feliz de que funcionara bien','2022-11-11'),(5229,234,'Da N32 PE y Da N33 PE','No concurr.\r\n-----------------------------------------------------\r\nCalcul un presupuesto para un rodillo.','2022-11-11'),(5230,210,'bitacora 46','Esta vez trabajando en el aula de al lado tuve un problema en el windows con una de las computadoras pero lo resolvi rapido, Entre al github desktop pero me salia como si ya tuviera un usario ahi dentro, lo cual me sirvio para descargar el proyecto y poder editar la vista de turnos como lo estaba planeando de hace tiempo pero luego estuve ayudando a mi compaero soler con el php del login hasta que vino el profesor Nahuel que habia venido para intendar &quot; Hackear&quot; el login y tratar de ingresar pero no pudo xd','2022-11-11'),(5231,234,'Da N34 PE','Escane una factura y un remito e hice una factura.','2022-11-14'),(5232,238,'Practica Externa','Vi un tutorial de como subir un sitio web utilizando docker.\r\nRealic el curso de Schub de introduccin a docker y luego empec con la segunda parte que empezaba a trabajar con Bases de Datos.\r\n','2022-11-14'),(5233,228,'Practica externa Da 28','Estudie la documentacion sobre docker proporcionada por Schub','2022-11-