greDB.\r\nTuvimos una segunda parte de Docker con uno de nuestros tutores en la que  revisamos los ejercicios que habamos hecho e hicimos los que nos faltaban.\r\n','2022-11-16'),(5257,228,'Practica externa Dia 29','Tuve una llamada para hablar del proyecto y otra llamada que fue una clase de dockers','2022-11-16'),(5258,221,'17/11','El dia de hoy actualizamos la informacin que buscamos de la historia de los lenguajes ya que quisimos poner una informacin mas  histrica de los lenguajes ya que la informacin explicativa estara en los tutoriales. Ahora que me acuerdo me falta poner la actualizacin de la presentacin del proyecto ya que cambiamos el grupo las imgenes que mostraba, lo peor encima es que ya lo haba hecho pero un compaero espacialito me cerro el archivo.','2022-11-17'),(5259,216,'Diagrama de caso de uso, carpeta de campo','Me asignaron la tara hoy de hacer el diagrama de caso de uso del proyecto (haremos 2, este primero es especficamente de la pagina admin) ya que no tenemos ninguno; luego de abrir la pagina admin para guiarme, buscar informacin en artculos, vdeos y en imgenes de ejemplo pude realizar parte del mismo, aun esta incompleto y procurare continuarlo maana. \r\nComplete un poquito mas mi carpeta de campo con lo realizado hoy.','2022-11-17'),(5260,242,'17-11-2022','Me propuse a llegar a la carpeta de campo, intentar buscar ms o intentarlo sobretodo en  seguir con la gua del tutorial','2022-11-17'),(5261,217,'Reparando un error propio y sorpresa','El dia de hoy tenemos que hacer entrega de las carpetas de campo las cuales yo ya tengo las hojas listas, lo nico de lo que quera asegurarme es que todas las netbooks que eh desbloqueado siguen igual, y por lo que se asi es, pero yo tadavia segua con la pc la cual no iniciaba Windows y cuando la desarme para ver que contenia, me di cuenta que le faltaba el disco duro, y era normal que saltara el error de BOOT/BCD, porque no encuentra el lugar donde esta alojada la particin ni el sistema operativo, asi que era lgico lo que tenia que ocurrir y es que una vez terminado el proceso de testear todo tipo de formas para encontrar una solucin a ese error, era muy fcil pero lo que me ocurri despus fue por pura negligencia ma y es que no se en que estaba pensando pero accidentalmente le coloque una contrasea al inicio del BIOS y cuando se reinicio me pidi la contrasea, la cual yo use para pruebas es avenida123, pero cuando la ingreso ocurre que no me deja acceder. ya dejando de lado eso los directivos de taller me dieron una caja de febrero rocher por haberles desbloqueado la PC de conectar igualdad.','2022-11-17'),(5262,219,'17/11','El dia de hoy me dedique a hacer la carpeta de campo, ya que me faltaban 4 paginas, aunque  mi gran amigo FEDERICO PEREYRA me dio 9 paginas regaladas, mas algunas cosas extra, ya llegue a las 200 paginas de la carpeta, maana entregare todo porque quiero editar algunas cosas, porque en gran parte de la carpeta insulte a mis compaeros que me dejaron abandonado :) . ','2022-11-17'),(5263,213,'Mas cuestiones de login','El dia de hoy teniamos pensado avanzar con la vista de calendario pero resulto en otra cosas totalmente diferente en relacion con el login y como  hicimos junto con olaso todo el tema de $_session [\'campo\'] tras esto movimos todas las carpetas y cambiamos las url o los href tanto del body como del header','2022-11-17'),(5264,208,'Trabajo en equipo y Puliendo detalles','Al principio dela clase pusimos en claro que es lo qeu nos falta para terminar el proyecto, tenemos que atacar con toda la vista de agregarTurnos. Estuvimos fixeando ciertos problemas en la vista de ajuste para que funcione la session y tome variables correspondientes, ademas tuve la ayuda de mi mentor/guia que me enseo como hacer un view y como funciona','2022-11-17'),(5265,238,'Practica Externa','Revisamos una seccin de cdigo hecha por nuestro tutor.\r\nInvestigamos sobre ORMs descartando las opciones que no nos servan y comparando las que si, elegimos GORM y comenzamos a estudiarla.\r\nTuvimos una call con nuestro tutor en la que repasamos su cdigo y nos indico en que debamos trabajar ahora. Realizamos un PR en el que empezamos a trabajar en lo indicado.\r\n','2022-11-17'),(5266,228,'Practica externa Da 30','Investigue sobre GORM y tuve una llamada para hablar del proyecto','2022-11-17'),(5267,223,'Entrega carpetas de campo','El da de hoy era el ultimo en el que podamos trabajar en la carpeta de campo siendo este mismo da el ultimo en el que podremos entregarlo, as que dadas las circunstancias me puse a trabajar en la carpeta de campo logrando llegar a las 201 paginas las suficientes para aprobar, logrado ese objetivo me puse a charlar con mis compaeros de como haremos para terminar la pagina, la cual nos falta trabajar en los formularios y hacerlos funcionales para la entrega final, con ello tambin nos queda pasar con Nahuel y asegurarnos de que nuestra pagina sea resistente a sus ataques','2022-11-18'),(5268,242,'18-11-2022','me la pase un poco distraido pero aun as haciendo poco a poco lo que era la carpeta de campo que me restaba','2022-11-18'),(5269,219,'18/11','El dia de hoy estuve trabajando en los formularios del proyecto School, sinceramente aun tenemos dudas sobre el funcionamiento de todo esto, ya que aun no tenemos el diseo ni el php armado.','2022-11-18'),(5270,217,'Terminando la carpeta y preparando la presentacion','El dia de hoy al estar buscando mtodos para borrar datos de bios me encontr con un video el cual lo nico que requiere es tener que un USB flasheable y tener que descargar un archivo el cual una vez conectado al iniciar la PC iniciara con unos comandos los cuales podrn borrar los datos del bios, pero eso ya lo explicare luego, ahora sigo buscando ideas de como continuar para desbloquear.','2022-11-18'),(5271,221,'18/11','El da de hoy entregamos la capeta de campo con las 200 hojas. Gracias a dios yo llegue a las 208 paginas y eso que ayer a mi me faltaban 79 pero con la gua para los tutoriales pude avanzar bastante para hoy.\r\n','2022-11-18'),(5272,210,'bitacora 47 y 48 ','Bitacora 47\r\nayer lo que paso es que me fui apurado y no comi nada y tenia 10minutos para comer. Ayer pude hacer que la vista de turnos sea responsive y ademas pude subirlo al git donde esta la pagina web subida, luego estuve ayudando a Sosa y Soler en el tema de la session de php en las vistas de administradores ya que teniamos un problema con la session que no recopilaba todos los datos del usario ingresado y unicamente podiamos mostrar los datos que se ingreso en el login como el Email y contrasea\r\n\r\nBitacora 48\r\nHoy estuve ayudando a soler un poco con la unificacion de la vista de calendario que hizo mi compaero tolosa en el proyecto que hicimos ayer pero luego me dedique hacer la carpeta de campo de ayer y hoy para luego guardarlo y entregarlo','2022-11-18'),(5273,213,'Entrega de la carpeta de campo ','El dia de hoy ya es la entrega del trabajo practico como de la carpeta de campo por lo que hasta aca llega la carpeta de campo y este es mi ultimo dia  esto seria todo por ahora no vino nahuel por lo que el testing no se hizo esto nos dejo medio desubicados en que se va a hacer pero bueno esto es lo poco que se hizo en el dia ','2022-11-18'),(5274,216,'Finalizacin diagrama de caso de uso ','Termine con lo que me quedo pendiente del diagrama de caso de uso el da de ayer; con ayuda del scrum master agregue algunos detalles faltantes y coloque las relaciones entre la base de datos y el resto de cosas. Segu con la carpeta de campo.','2022-11-18'),(5275,208,'Implementando Calendario y retoques finales','Tolosa nos paso la vista calendario que anteriormente haba hecho y ahora la tuvimos que agregar a nuestro cdigo, el problema con su vista calendario es que el estaba trabajando por fuera del GitHub entonces tenia su propia conexin a la base de datos sus propios archivos css, js y PHP\r\nPor otra parte estuve ayudando con la finalizacin de la documentacin nos faltara exportar el DER, actualizar el Gannt pero el Diagrama de Caso de uso ya esta terminado','2022-11-18'),(5276,249,'Clase 48','Penltima clase, termin la presentacin.','2022-11-22'),(5277,229,'22-11-2022','Prepare la presentacin','2022-11-22'),(5278,236,'clase 61 (22/11/22) ','En la clase del dia de hoy me puse a completar la carpeta de campo y me puse a hacer la parte de sub respuestas de la vista de especialidades','2022-11-22'),(5279,238,'Practica Externa','Investigamos sobre como realizar una conexin a una base de datos Postgres utilizando GORM. Tuvimos una reunin con el desarrollador principal para orientarnos.\r\nRealizamos un Pull de la imagen de Docker y creamos una tabla, luego comenzamos a investigar y experimentar para llenar la BDD con registros.\r\n','2022-11-22'),(5280,228,'Practica externa Da 31','Comence a trabajar con una base de datos postrgreSQL en un docker, tuve una reunion con Joao para preguntar sobre dudas del proyecto y nos dijo que poblemos la base de datos','2022-11-22'),(5281,249,'Clase 49','ltima clase, presentamos el proyecto.','2022-11-23'),(5282,229,'23-11-2022','En esta fecha, se realizo la presentacin sobre el proyecto','2022-11-23'),(5283,229,'23-11-2022','En esta fecha, se realizo la presentacin sobre el proyecto','2022-11-23'),(5284,239,'dia 43','hoy me enfoque en terminar la carpeta de campo','2022-11-23'),(5285,247,'Presentacin Final (23/11)','El da de hoy presente, junto a mi compaero Lucas Moreno, lo que vendra a ser la versin final de la pgina de programacin, explicando para que sirve, sus funciones y los diagramas.','2022-11-23'),(5286,240,'clase 58','presentacin del proyecto final :) ','2022-11-23'),(5287,227,'Presentacion final','El dia de hoy presentamos nuestros proyectos terminados','2022-11-23'),(5288,233,'23/11/22','El da de hoy realizamos la presentacin de nuestro proyecto, a pesar de las complicaciones pudimos cumplir los objetivos para la presentacin.\r\n','2022-11-23'),(5289,234,'Da N37, 38, 39, 40 PE','No concurr.\r\n---------------------