a que dimos con el formato correcto. Luego tuvimos un error porque los cambios no se vean reflejados en el DBeaver. Los resolvimos junto a Joao nuevamente (haba un error en el nombre de la base de datos).\r\nFinalmente pudimos ver los inserts en el DBeaver.\r\n','2022-11-24'),(5302,251,'Comienzo PP - 07-03-2023','El da de hoy me logue en el Classroom de la materia, as como en la pgina de encuentrotecnologico.com.ar.\r\nLe el mdulo 1 del DET.','2023-03-07'),(5303,250,'Comienzo Practicas Profesionalizantes MARTES 07 03 2023','Comenzamos a leer el pdf que nos envi el det para responder el cuestionario','2023-03-07'),(5304,266,'7/3/2023 - Introduccin a la asignatura','Ingresamos al classroom y creamos nuestra cuenta en Encuentro Tecnolgico. Conformamos el equipo y empezamos a ver la documentacin y la gua de trabajo. Empezamos con las primeras paginas del modulo 1.','2023-03-07'),(5305,260,'Introduccion a DET y registro en encuentrotecnologico ','Nos unimos al classroom, y empezamos a trabajar con las actividades y ver los mdulos.','2023-03-07'),(5306,252,'Clase 0 - Introduccion a la asignatura','Hoy tuvimos una introduccin a lo que sera la planificacin de la asignatura y nos creamos un perfil en la pgina de Encuentro Tecnolgico. Por otro lado, ingresamos al classroom y con mi equipo de trabajo comenzamos a ver la primer gua de la materia junto con sus videos y pdfs','2023-03-07'),(5307,267,'7/3/2023','Ingresar al classroom, al encuentro tecnolgico y empezar con el modulo 1','2023-03-07'),(5308,259,'Inicio 7/3 Practicas Profesionalizantes','El da de hoy, Nahuel Acosta nos dio la introduccin a la materia, dicindonos todo acerca de ella, cosas y proyectos de futuro, y mas tarde nos dio y dejo un total de 9 trabajos para hacer para introducirnos en el mundo de P.P\r\nDndonos hasta 2 semanas de estima y aproximacin en que el cree que haremos estos trabajos.','2023-03-07'),(5309,255,'Comienzo Practicas Profesionalizantes MARTES 07 03 2023','En el da de la fecha, nos unimos al