o realizamos el numero 1 y tambien se realizo el envio del mismo.','2023-03-07'),(5317,253,'Introduccin a las Prcticas Profesionalizantes','Hoy dimos inicio a la asignatura de PP y con el profesor charlamos sobre qu se trata, los temas que vamos a ver, qu posibles caminos tenemos durante el transcurso del ao, cules seran nuestras obligaciones y requisitos para aprobar y ms cosas.\r\nNos dej 9 cuestionarios para completar en todo el ao y hoy debimos hacer el primero.','2023-03-07'),(5318,263,'Primera bitacora','La primera bitacora habra mas y serviran para hacer el proyecto','2023-03-07'),(5319,260,'8/3/2023 ','realizando las actividades de los modulos y creando CV','2023-03-08'),(5320,254,'8/03/2028 tarea 1 y tarea 2','Termine la tarea q1 y 2, y revise los siguientes mdulos para la tarea 3','2023-03-08'),(5321,256,'08-03-23 Tareas','El dia de hoy realice las tareas 1,2 y casi termino la tarea 3.','2023-03-08'),(5322,250,'Dia 2 de Practicas Profesionalizantes Miercoles 08-03-2023 ','En este da concluimos con el modulo 1 y empezamos el modulo 2','2023-03-08'),(5323,266,'08-03-2023 - Avance importante en la gua de trabajos ','Hoy avance con la guia de la materia, termine con exito los contenidos y actividades del modulo 1,2,3 y 4. Quedo pendiente terminar el trabajo de 38 preguntas del modulo 4, la proxima clase la termino y sigo con las evaluaciones de diagnostico y la carga de mi CV y Linkedin. El trabajo lo hice en colaboracion y conjunto con Gonzalo Gimenez y Diego Sanchez trabajando a la par en diferentes compus para perfeccionar el trabajo.','2023-03-08'),(5324,257,'08/03/2023','Hice el formulario de habilidades, el examen de ingls e iniciamos el mapa conceptual, tenemos una idea clara de como vamos a hacer el proyecto y ya repartimos las ideas','2023-03-08'),(5325,268,'08-03-2023','Hoy comense con la tarea 2 del classroom que se basaba en hacer un mapa conseptual del lo que se trata la materia de Practricas Profesionalizantes despues de 3 hora termine y comense con la tarea 3 del modulo 2 donde respondi las preguntas sobre habilidades blandas y en donde hice y termine el CV (Curriculum vitae).','2023-03-08'),(5326,259,'Continuacion trabajos','El dia de hoy 8/3 continue los trabajops y llegue a hacer el 1 y 2 y estoy a punto de empezar el 3\r\n','2023-03-08'),(5327,264,'08/03 Tarea n2 y 3','Desarrollo del mapa conceptual y el cuestionario de habilidades blandas','2023-03-08'),(5328,258,'08/3/2023','hoy hice el tp num 1 ademas del examen de ingles ,el formulario de habilidades ,aparte de repartir las tareas junto fenoglio y giupponi y hacer el mapa conceptual del proyecto en si','2023-03-08'),(5329,267,'8/3/2023','Termin la tarea 1 y 2, en la 3 me falta el CV','2023-03-08'),(5330,270,'8/3/23','El da de hoy continuamos haciendo las tareas del classroom, esta vez comenc con la tarea 2 en donde realic el mapa conceptual sobre practicas profesionalizantes  a base del apunte dado en el mismo. termine el mismo al finalizar la clase y lo entregu en su respectiva tarea.','2023-03-08'),(5331,252,'Clase 1 - Modulo 1, 2, 3 y 4','Hoy dimos comienzo a leer el material de cada mdulo y completar las tareas que cada uno de los mdulos tenia asignadas.\r\nLlegu a completar las primeras 4 tareas. Modulo 1, 2, y 3. Tambin hice la mitad de la tarea 5, del mdulo 4, que son 38 puntos a responder. Adems hoy creamos nuestro CV y nuestro LinkedIn.','2023-03-08'),(5332,265,'08-03-2023','El da hoy empece a con la tarea N2, que consiste en crear un mapa conceptual sobre las Practicas Profesionalizares, junto a Javier Rojas, y consecutivamente, luego de terminarlo, hice la tarea sobre el n3, sobre &quot;Habilidades blandas&quot;, que constaba de responder una serie de preguntas a base de leer un cuetionario,','2023-03-08'),(5333,255,'Dia 2 de Practicas Profesionalizantes Miercoles 08-03-2023 ','Hoy da continuamos trabajando en las tareas que nos mandaron por classroom, yo avanc con el primer mdulo.','2023-03-08'),(5334,271,'08-03-2023','En el da de la fecha comenc con la tarea 2, mapa conceptual, pero no lo finalice. Tambin voy agregar que ayer, hice la tarea 1 pero no me pude hacer la cuenta, por eso no lo escrib en el da de ayer','2023-03-08'),(5335,263,'','','2023-03-08'),(5336,253,'Mircoles 08/03/2023 - Tarea N 2 Mapa Conceptual','Hoy hicimos lo que es el mapa conceptual de los conceptos y caractersticas principales de Prcticas Profesionalizantes.','2023-03-08'),(5337,262,'08/03/2023','En el dia de hoy continuamos con los trabajos introductorios con Practicas Profesionalizantes y realizamos un mapa conceptual de informacion respecto a lo solicitado al trabajo numero 2, el cual fue publicado en el classroom y fue entrego por la misma plataforma. ','2023-03-08'),(5338,273,'Tarea 1','En el da de la fecha me dispuse a realizar distintas tareas que se encontraban en el sitio web de Classroom Google. Entre ellas, hice los distintos modulos del DET (del modulo 0 al 4), donde se peda realizar 2 formularios distintos, un mapa conceptual, un Curriculum Vitae y crear un perfil de LinkedIn.\r\n\r\nCon respecto a los formularios, uno se trataba de responder informacin acerca de Practicas Profesionalizantes, y el otro se trataba de las Habilidades Blandas.\r\nEl mapa conceptual se trataba tambin acerca de las Practicas Profesionalizantes y su informacin, por lo que decid organizar todo lo que puse en el formulario anterior y trat de hacerlo ms resumido y poner lo vital nada ms.\r\nEl Curriculum Vitae ya tena uno pre-armado y solamente se los ense a los profesores para que me lo corrijan.\r\nMi perfil de LinkedIn ya est creado, por lo que me falta hacer los certificados que se encuentran a disposicin.','2023-03-09'),(5339,272,'Registro en Habilidades Blandas - Computrabajos ','Registro de cuenta personal e ingreso y realizacin de exmenes laborales con informacin personal adicional.','2023-03-09'),(5340,279,'Modulo 1 DET y CompuTrabajo','Este dia lo hice fue poder entrar a classroom y poder registrarnos en encuentro tecnologico ademas de que nos explicaron de como iria esta materia y las tareas designadas de esta ademas de comenzar una carpeta de campo que hice hoy comentando lo que hice y que fue mayormente ver como iba tarea asignada y con cual mejor ir y las que pude completar el dia de hoy son los de Modelo 1 DET y el de la matricula de CompuTrabajo.','2023-03-09'),(5341,276,'Introduccion, Test de Competencias Laborales (Habilidades Blandas), curso linkedin, carpeta de campo','Hoy empezamos con la introduccin a las Practicas Profesionalizantes. Estuve haciendo un anlisis de los mdulos empezando por los mdulos 0 y 1, tambin estuve viendo los videos explicando sobre los temas de las practicas profesionales y sus concepto y su finalidad para aquellos alumnos que quieran realizar estos tipos de practicas. Tambin hice el test de competencias laborales en CompuTrabajo, ingrese al curso de desarrollo de software que trata de los lenguajes, estructuras y dems relacionados con la computacin, y a su vez empec a implementar la Carpeta de Campo la cual ir completando en funcin a las tareas diarias que realizare mas adelante. ','2023-03-09'),(5342,275,'Primera clase ','Hoy lo que hice durante la clase fue unirme al classroom, unirme a encuentro tecnolgico, hacer varios cuestionarios, el de ingles que me hicieron varias preguntas escritas en ingles para despus hacer preguntar con diversos audios, no me fue muy bien pero al menos me saque algo de encima, luego hice un curso de LinkedIn de softwares fue medio largo pero interesante, supuestamente un solo curso basta pero quiero hacer mas y por ultimo un cuestionario en CompuTrabajo aparte de empezar la carpeta de campo y el primer cuestionario. ','2023-03-09'),(5343,274,'Modulo 1, registro en Linkedin y test de Competencias Laborales','El da de hoy realice las actividades del modulo 1, que era leer el archivo pdf y mirar los videos explicativos. Tambien me registr en Linkedin para anotarme en un curso y el test de Competencias Laborales.','2023-03-09'),(5344,278,'Clase N 1   9/3/2023','En este da realice el formulario del modulo 1 de la tarea subida a Classroom. Adems realice la tarea del modulo 2 , la cual consista en armar un mapa conceptual. Por ultimo cree mi cuenta en LinkedIn.','2023-03-09'),(5345,280,'Bitacora','Entrega del primer cuestionario pautado en el classroom. \r\nEfectuada la inscripcin a distintos cursos con certificados presentados a travs de distintas pginas, los cuales son los siguientes:\r\n\r\nScram: clase pautada para el sbado 11 de marzo.\r\nAnlisis de proyectos: Horario libre\r\nAdministracin de sistemas: Horario libre\r\nDesarrollo de software: Horario libre\r\n\r\nRealizacin de test de habilidades blandas en la pgina de CompuTrabajo\r\n\r\n','2023-03-09'),(5346,283,'Habilidades Blandas (computrabajo), carpeta de campo, curso de linkedin, modulo 1 ','El da de hoy comenc a ver los videos del modulo 1 para terminarlos despus en casa. \r\ntermine las cuentas de Habilidades Blandas (CompuTrabajo), y luego me cree una cuenta en LinkedIn y comenc un curso.','2023-03-09'),(5347,284,'Tarea 1','Empec leyendo &quot;Reglamentacin de Practicas Profesionalizantes para informarme sobre todo , luego lei el material del mdulo 1 &quot;Introduccin a las Prcticas Profesionalizantes&quot; , y Luego realic el Google form del mismo mdulo.\r\nDespues comenze el modulo 2 , comenze leyendo el material , y luego de eso empec el Google form pero no llegue a terminarlo.','2023-03-09'),(5348,293,'Carpeta de Campo y Tarea modulo 1','Inicie con la carpeta de campo de lo que se hiso en clase y lo que realice. Tambin vi los 2 videos despus inicie el modulo 1 y esta casi completo. Estuve en clase. ','2023-03-09'),(5349,286,'Modulo 1, Habilidades Blandas y Tarea N1','Hoy tuvimos una charla de iniciacion con los profesores y empece a trabajar, comence leyendo el DET - Modulo 0 con los videos, luego el material, segui con el Modulo 1 y con eso puede responder el cuestianario de la Tarea 1, realizando el grafico de Habilidades Blandas, destacando en responsabilidad, autogestion y motivacion.','2023-03-09'),(5350,290,'Primera','Empece haciendo el test de ingls pero prefer arrancar con el mdulo 1, previo a eso le la Introduccin a las prcticas profesionalizantes y vi los 2 videos que estaban en el archivo, luego comence el mdulo 2 que todava no termine y por ultimo revise las certificaciones que deje para maana','2023-03-09'),(5351,291,'Explicacin del profesor, Habilidades Blandas y Tarea 1','Al comienzo de la clase los profesores explicaron de que trataba la materia y lo que realizaremos en el transcurso del ao, luego ingrese en la pagina de habilidades blandas &quot;candidato.ar.computrabajo.com&quot; y me registre en esta, luego realice el test de competencias laborales, realizarlo fue fcil pero no entend algunas preguntas y le pregunte al profesor y a mi compaero a mi costado y despus por ultimo realice la tarea 1 con ayuda del PDF y el profesor respecto a algunas preguntas.','2023-03-09'),(5352,282,'Analisis de tareas, Test de competencias laborales','Al principio de la jornada escuchamos atentamente al profesor explicar las bases de Practicas profesionalizantes, adems nos relato brevemente sobre la posibilidad de conseguir practicas en empresas externas a la escuela. Posterior a la explicacin del profesor, ingres al classroom de las practicas y me registre en las paginas encuentrotecnologico.com.ar y en computrabajo.com.ar, dado que esto fue pedido como un requerimiento.\r\nAl entrar a la pagina computrabajo.com.ar, el profesor nos solicito realizar un test de competencias laborales, al completarlo analic mis resultados, los descargue como un archivo PDF y lo envi por clasroom.','2023-03-09'),(5353,277,'Primera clase','Complete la parte escrita del test de ingls, no pude terminar la parte a audio porque las computadoras de la escuela no tienen auriculares o parlantes. Tambin hice la cuenta de Computrabajo.\r\nLuego hice el mdulo uno y dos, el primero eran unas preguntas las cuales no fueron muy complicadas, el segundo trataba de hacer un mapa conceptual de las Prcticas Profesionalizantes, fue algo ms complicado ya que nunca antes haba hecho uno, pero pude terminarlo al finalizar la clase.','2023-03-09'),(5354,281,'Dia 1','Hoy empec a cursar practicas profesionalizantes, lo primero que hice fue realizar el test de ingles, luego de leer el modulo 0 procedi a hacer el forms del modulo 1. \r\nDespues de hacer todo esto empece el modulo 2 el cual se trataba de realizar un cuadro conceptual sobre PP.\r\n','2023-03-09'),(5355,288,'Clase n1','Las primeras horas de clase las dedique a leer los PDF adjuntados en el mdulo nmero 0 y los respectivos videos en los cuales muestra como van a ser los primeros pasos a seguir y chicos que formaron aparte de prcticas profesionalizantes y su experiencia en misma.\r\nLuego le el PDF del mdulo 1 en el mismo estn las respuestas para poder responder con nuestras palabras el formulario de Google que est en el mismo mdulo.\r\nFinalizado el mdulo 1 empec a hacer el mdulo 2 en el cual pide un mapa conceptual, el cual hice en diagrams net y adjunt finalizado el mismo al classroom mdulo 2.','2023-03-09'),(5356,292,'','','2023-03-09'),(5357,287,'Carpeta De Campo, La Introduccin, El curso en Linkedin y el Test de Analisis Financiero','09/03 = Comenze haciendo la carpeta de campo tambien con la introduccin sobre las Practicas Profesionalizantes, estuve viendo los videos dando explicacion sobre los temas de las practicas profesionales y sus concepto con la finalidad para aquellos alumnos que quieran comenzar estos tipos de practicas, arranque haciendo el curso a travez de Linkedin sobre &quot;ANALISIS FINANCIERO&quot; , Ingrese al curso de Analisis Financiero  que explica los conceptos mas basicos sobre todo lo que tenga que ver de empresarial tambien practicas con herramiento de software entre otros muchos temas mas y por ultimo realize el Test de Competencias Laborales (%82 Responsabilidad, %75 Inteligencia Social y %71 De Liderazgo)\r\n\r\n','2023-03-09'),(5358,289,'Dia 1 Fecha 09/03','Lo primero que hice fue leer el mdulo 0.\r\nDespus segu con el primer mdulo, le el Introduccin a las PP. Para luego seguir con la 1era tarea, la cual consiste en responder un formulario. \r\nEntre que hacia eso, complete el computrabajo (el perfil y trabajo). Terminando el formulario 1 y envindolo, me fije en los cursos que ofrece Microsoft en conjunto de Linked In, leyendo las propuestas de todos, termine eligiendo el de Administracin de sistemas ( ese que fue el que ms me llam la atencin y mas me gusto) \r\nTambin me anote a lo de Scrum, tuve que pedir ayuda a Maxi, porque no sabia como anotarme, terminando anotando para el Viernes 17.\r\nEmpec con el mdulo 2, al principio no entend como hara el cuadro conceptual, pero gracias a un compaero me explico como hacerlo y pude encontrarle la vuelta. An hoy no lo termino, pero ya tengo una idea mas clara para seguir maana.\r\nMucha gracias por leer!!! Nos vemos maana. \r\n\r\n','2023-03-09'),(5359,280,'Tareas: 3/4-Cursos','Se realizaron las siguientes tareas:\r\n\r\n\r\nCuestionario de Habilidades Blandas(Tarea N3)\r\nCurriculum Vitae\r\nPerfil de linkedin (Adjuntado al curriculum)\r\nInicio de certificacin para administracin de software.\r\nInicio de capacitacin para para git y docker.\r\n','2023-03-10'),(5360,274,'Test de Ingls, Cuestionario N1, Cuestionario N2, Curriculum Vitae','En el da de hoy, lo que hice fue realizar el test de ingls, el cual consista de una seccin de Grammar, Reading y Listening,\r\ncon una duracin total de 50 minutos. El resultado fue C2 Proficiency. Luego, lo que hice fue realizar el cuestionario N1 que me haba quedado\r\npendiente de la ltima clase. Me quedaban 4 preguntas que termin en clase. Despus, realic el cuestionario N2, el cual era sobre habilidades\r\nblandas. Lo termin en alrededor de 20 minutos. Por ltimo hice el Curriculum Vitae utilizando Canva. Dentro del mismo puse mis datos\r\npersonales, informacin acerca de quien soy, habilidades, experiencia laboral y trayectoria escolar.','2023-03-10'),(5361,273,'Bitacora 2','En el da de la fecha me dispuse a hacer el formulario nmero 5 del Mdulo 5. Este otorgaba informacin sobre proyectos institucionales, cmo se deben realizar, ejemplos de estos y las distintas cosas que se debe tener en cuenta. Haba preguntas tales como, qu es un perfil profesional, qu son las metas, los indicadores, qu cosas se deben tener en cuenta (higiene, la actividad ambiental, los costos de un proyecto, etc) y los objetivos de un proyecto. ','2023-03-10'),(5362,276,'Cuestionario Modulo 1 &quot;Introduccin a las Prcticas  Profesionalizantes - Curso LinkedIn - Test Ingles','Hoy segu realizando las tareas pendientes. Para empezar, empec a analizar los contenidos dentro del modulo 1 y a su vez logre realizar el cuestionario 1 de &quot;Introduccin a las Practicas Profesionalizantes&quot;. Por otro lado, segu realizando el curso de LinkedIn, viendo dichos contenidos de los captulos 1, 2 y 3, y habiendo realizado los test de los mismos, aun me queda por terminar los dems captulos. Des para finalizar empec a realizar el test de ingles determinado en el classroom, no pudiendo terminar el mismo debido a que no dispuse de tanto tiempo, por lo tanto lo terminare a continuacion.\r\n','2023-03-10'),(5363,279,'Modelo 2 Det aun incompleto','El da de hoy se intento trabajar y avanzar intentando de comenzar con la tarea 2 de Modelo Det 2 pero por temas de que el calor era insufrible y que cada cierto tiempo se me congelaba la computadora haciendo que tuviera reiniciar la computadora siendo que me paso como 4 veces y el trabajo trataba de hacer un mapa conceptual de la gua de inicio de practicas profesionalizantes.','2023-03-10'),(5364,278,'Clase N 2 10/03/2023','En el da de la fecha realice el cuestionario del modulo numero 3 que hablaba sobre las habilidades de un tcnico fuera del mbito formal , sino, como era como persona , si era sociable , creativo , si poda trabajar en equipo , entre otras cosas. Adems cree mi Curriculum Vitae con la ayuda de la gua de Armado de CV. Al final del da comenc  con el cuestionario del Modulo 5 sobre la Introduccin a los Proyectos  Institucionales de Prcticas  Profesionalizantes.\r\n','2023-03-10'),(5365,289,'Clase 2 10/03','Hola.\r\nHoy hice lo siguiente:\r\n-Termine la tarea 2 (el cuadro conceptual)\r\n-Le los pdfs del modulo 3.\r\n-Hice la carpeta de campo (del da de hoy)\r\nEso es todo por hoy, muchas gracias por leer. Hasta la semana siguiente!','2023-03-10'),(5366,286,'','Hoy, al llegar al aula, me sent en una computadora que estaba vaca para empezar a trabajar solo y sin distracciones. Empec terminando el cuestionario de la Tarea N1 que haba dejado a medias el da anterior, completndolo con el archivo &quot;Introduccin a las Practicas Profesionalizantes&quot;. Luego segu con la Tarea N2, que propona hacer un cuadro conceptual que contenga los primeros conceptos de las Prcticas Profesionalizantes. Luego de completar esto, agregu a la carpeta de campo lo que hice hoy e inmediatamente cre una carpeta en Google Drive llamada &quot;Prcticas Profesionalizantes&quot; para insertar all todos los archivos que tengan que ver con esta materia.','2023-03-10'),(5367,275,'Dia 2 tarea 2,3 y problemas tcnicos ','Durante el  da de hoy 10/3/2023 quise hacer mas trabajos prcticos y dems cosas, aparte que esta maana termine el cuestionario n1 que empec ayer antes de ingresar en el colegio, cuando prend la computadora y me dispuse a hacer los cuestionarios 2 y 3 empezaron los problemas, el 2 me peda hacer un mapa conceptual que deba hacerlo con el programa draw.io pero la se me tildaba mucho la compu cuando lo usaba asi que si bien lo empec hoy lo terminare en casa en algun otro momento pero lo peor fue que cuando intente hacer el 3 se me congelo la compu y tuve que reiniciarla, mas tarde paso de nuevo y no puede terminarlo por este inconveniente sacando eso los puede avanzar bastante y cuando pueda los voy a terminar. ','2023-03-10'),(5368,296,'Bitcora 1','Hoy empeze analizar todos los mdulos y realice la tarea n1 ,la cul deje casi por terminar del mdulo 1 junto con toda la lectura del mismo y los vdeos','2023-03-10'),(5369,282,'Mapa conceptual (Tarea 2) y carpeta de campo','Al ingresar al saln de clases, como primeria medida, me encargue de confirmar que la bitcora del da 09/10/2023 se haya subido y estuviera correcta. Tras esto, como el da anterior, utilic alrededor de 15 minutos de mi tiempo para analizar que tarea era mas convincente de hacer en este da, siendo que eleg realizar la tarea numero 2, la cual trata de realizar un mapa conceptual sobre el apunte &quot;Introduccin a practicas profesionalizantes&quot;. Cuando finalic dicho mapa conceptual, lo descargu a modo de JPG y lo sub a la tarea correspondiente en classroom.\r\nTras esto me encontr en un espacio de 1 hora en la cual decid completar y perfeccionar la carpeta de campo de Practicas Profesionalizantes.','2023-03-10'),(5370,295,'DET Modulo 1 - Habilidades Blandas, Computrabajo','La tarea n 1 la hice leyendo el PDF de Introduccin a las Practicas Profesionalizantes y complete Google Form respondiendo las preguntas en base a ese PDF.\r\nPara lo de habilidades blandas, realice el test de competencias laborales, que fueron una serie de preguntas y me dio un resultado de distintos aspectos de mi personalidad.\r\n','2023-03-10'),(5371,294,'DET - Modulo 1 - Tarea n1 / Habilidades Blandas - Computrabajo','Hoy realice la tare n1 que era un cuestionario y me bas en la gua de Introduccin a las PP, con eso pude completar todo el cuestionario. \r\nDespus complete el Test de Competencias Laborales en la pgina de CompuTrabajo.\r\nTambin comenc a realizar la carpeta de campo plasmando lo que hice en el da de hoy.\r\n','2023-03-10'),(5372,290,'Segunda','Hoy contine con los mdulos que deje ayer, el 2 todavia no lo termine, hice el test obligatorio de compu trabajo y tambin empec el mdulo 3, junto a ello comence a hacer el cv que pide en este mdulo con la aplicacin canva y me faltan cosas que agregar en el, quise ingresar a las certificaciones de Microsoft y LinkedIn pero no me dej, maana intentar ingresar de vuelta ','2023-03-10'),(5373,285,'Tarea N2','Hoy me dedique a hacer el Mapa Conceptual de la Segunda Tarea. \r\nTuve dificultades con la computadora que me agarre, ya que esta se trababa y se quedaba congelada.\r\nAdems de eso, hoy pude hacer la cuenta de Computrabajo, todava me falta hacer la evaluacin que se pide con esta, pero muy probablemente la haga cuando llegue a mi casa.\r\nTodavia me falta ponerle algunas cosas al Mapa Conceptual, pero va bien, por as decirlo.','2023-03-10'),(5374,287,'Curso Linkedin - Cuestionario N1 - Curriculum','En la fecha de hoy, Comenze con el tema del curso sobre analisis empresarial y lo doy por finalizado dicho curso. Despues de haberlo terminado, arranque con el cuestionario numero 1 de &quot;Practicas Profesionalizantes&quot; y tambien lo doy por finalizado dicho cuestionario. Y por ultimo tambien arranque con el tema del curriculum, y lo doy por finalizado el curriculum','2023-03-10'),(5375,288,'Clase N2','La primera hora del dia de hoy, realic el test obligatorio de computrabajo, donde mide tus aptitudes a la hora de trabajar en grupo e individuales, el cual consta de varias preguntas que hay que responderlas sinceramente y mediante nuestra experiencia en el colegio o exterior a ste. Luego empec el mdulo 3, le los respectivos pdf que lo componan, y comenc el formulario de Google, el cual consta de 5 actividades a realizar, de las cuales 4 las hice, me qued solo 1, la del CV. Empec a realizar el CV correspondiente a mi persona, para la ultima actividad, no llegu a finalizarlo y planeo terminarlo en mi hogar.','2023-03-10'),(5376,277,'Segunda clase','Hoy termin el test de computrabajo, el da anterior no me haba dado cuenta pero adems de registrarse haba que hacer un cuestionario para saber tus fortalezas y aptitudes. Tambin me hice una cuenta de Linkedin