a el proyecto.','2023-03-21'),(5458,269,'21/03','Realice tps enviados por classroom ','2023-03-21'),(5459,253,'21/03/2023 - T.P. N 5 Gua de Empresa Simulada','Hoy nos toc terminar el T.P. N 5 y como nos sobr tiempo, comenzamos a pensar ms en profundidad el proyecto que vamos a estar desarrollando durante el ao.','2023-03-21'),(5460,270,'21/03/23','El da de hoy avanc en la tarea 5 del classroom y termine casi todos los puntos, solo me falt el 24 ya que debamos pensar con nuestro grupo el proyecto que queremos realizar, el resto del tiempo lo dedicamos a esto y ya tenemos una idea principal sobre un posible videojuego.','2023-03-21'),(5461,264,'22/03','','2023-03-22'),(5462,250,'DIa 5 Miercoles 22/3/2023','Hoy presentamos el proyecto','2023-03-22'),(5463,256,'22/03/23','Elegimos junto a mis compaeras Kiara Chunga y Kiara Romero el proyecto que vamos a realizar','2023-03-22'),(5464,263,'22/3/23','Hoy estuvimos haciendo las tareas restantes que nos faltaba para iniciar el proyecto, tambien cambiamos varias vece las ideas de como va a ser el proyecto en si desde escape rooms hasta una tematica mas de terror. Al final nos pusimos de acuerdo en combinar parte de esas ideas para el juego final ya que la idea original no iba a ser aceptada. Y termine la tarea 7, falta la 9 y 4\r\n\r\n','2023-03-22'),(5465,258,'22/03/2023','hoy entrege la tarea num 6 y estubimos hablando entre nosotros ya que tubiemos que reacher las bases del juego ya que no aceptaron la idea y despues de un tiempo de estar pensando se nos ocurrio otra idea hacer un especie de helloneightbord ','2023-03-22'),(5466,255,'DIa 5 Miercoles 22/3/2023','Hoy presentamos el proyeto','2023-03-22'),(5467,268,'22-03-2023','Hoy comense y termine la tarea n6 que tretaba de hacer un Diagrama de alguna empresa yo la que hice fue la de Bimbo despues termine la tarea N7 que tretaba sobre los prosesos para hacer un proyecto y al final me hice una cuenta en Comutrabajo y termine el Test.En el final con Ezequiel Baqueiro vimos los detalles y reglamentos sobre La Liga Nacional de Robotica. atte Javier Rojas Liambo ','2023-03-22'),(5468,297,'22/03/23','Definimos nuestro proyecto junto a mis compaeras y realice hasta la pregunta 20 del tp 5','2023-03-22'),(5469,252,'Clase 4 - 22/03/2023','Hoy con el equipo seguimos con la documentacin la cual completamos el FODA, el Diagrama de Caso de Uso (DCU) y comenzamos a planificar las tareas del proyecto con el GANTT','2023-03-22'),(5470,267,'22/3/2023','Finalizadas las tareas 6 y 7. Investigacin sobre las reglas de la Liga Nacional de Robotica en el sector de robots Sumos.','2023-03-22'),(5471,271,'22/03/23','En el da de la fecha, realice las tareas 3 y 4. Adems de empezar a pensar ideas sobre nuestro proyecto de un juego junto a mis compaeros de grupo: Emilio Pereira, Enzo Romanniello y Luis Meza','2023-03-22'),(5472,254,'22/03/2023','Me faltan 3 puntos de la tarea 5 y elegimos sobre que va a ser nuestro proyecto','2023-03-22'),(5473,251,'Finalizacin de la Tarea 5 y Propuesta de Proyecto - 22/3/2023','El da de hoy termin el cuestionario de la tarea n5.\r\nCon mis compaeros de grupo: Nahuel Moreno, Sofa Mrmol y Lucio Micheli; presentamos nuestro proyecto a los profesores.\r\nEl proyecto es un recetario que se encuentra en la web y cmo aplicacin mvil, llamada Recetonomicn.\r\nLa semana que viene empezaremos con el desarrollo del proyecto.','2023-03-22'),(5474,261,'22/03/2023','Termine la tarea N6 modulo 4 y N7 modulo 5','2023-03-22'),(5475,257,'22/3/2023','Hoy entregu la tarea 4, la tarea 7 y complete 3 preguntas de la 8, hicimos un poco del video y nos pusimos de acuerdo para la idea del proyecto que vamos a realizar a lo largo del ao, m grupo va a ser con Sebastin giupponi, Luciano budman y agustin Barcia ','2023-03-22'),(5476,259,'Miercoles 22/3 ','El da de hoy, con mi grupo hemos presentado nuestro proyecto de una App y pagina Web de recetas de cocina de todo tipo, sea pastas, postres, bebidas, etc. El cual tuvo la aprobacin de los profes, y nos pusimos luego de acuerdo quien hara cada cosa.\r\nPor mi parte individual, e hecho los trabajos 3 y 4 e hice el test de Ingles pero decid rehacerlo al no estar de acuerdo con la nota en cuestin.','2023-03-22'),(5477,265,'22/03/2023','Hoy hice la tarea n6 del mdulo 4, que consista en hacer un organigrama, y la tarea n7 del mdulo 5, en el que se deba responder una serie de preguntas de un cuestionario.\r\nTambin nos llamaron, a los 4 integrantes del grupo, para  que les expliquemos que fue lo que pensamos para hacer de proyecto.','2023-03-22'),(5478,270,'22/03/23','El da de hoy con mi grupo terminamos de idear nuestro proyecto sobre un juego tipo trivia en donde el jugador deber ir atravesando puertas para finalizarlo, todo esto descrito en la tarea 5 del classroom la cual termin y entregu hoy.    ','2023-03-22'),(5479,266,'22/3/2023 - Avance en la documentacion y en el DCU','Hoy junto con el equipo estuvimos realizando lo que quedaba de la documentacin como el FODA y algunas funcionalidades. Tambin dedicamos gran parte del da a la realizacin del DCU (Diagrama de Casos de Uso). Tuvimos varias trabas con esto pero pudimos terminar la primera versin de este. Por ultimo empece a escribir las primeras tareas del GANTT, en la aplicacion de Project libre.','2023-03-22'),(5480,260,'22/03/23','Terminamos la creacion del GANTT, El AnteProyecto  y el FODA, integramos a un compaero mas al grupo y aclaramos mas dudas en cuanto a tecnologas para desarrollar la aplicacion.','2023-03-22'),(5481,274,'Tarea  N7 y Proyecto Integrador','En el dia de hoy, lo que hice fue seguir respondiendo las preguntas de la tarea N7, el cual trataba sobre la introduccin a los proyectos institucionales de prcticas profesionales. Respond entre cinco y diez preguntas, aunque todava me quedan un par por responder. \r\nLuego, lo que hicimos junto al grupo fue pensar en distintos proyectos para finalmente elegir uno. Pensamos en cinco proyectos distintos y terminamos optando por un mapa de seguridad de la ciudad de CABA.\r\n','2023-03-23'),(5482,277,'Quinta clase','Hoy me centr en la bsqueda de informacin para la creacin de nuestro proyecto en grupo, originalmente tenamos planeado crear un robot mediante arduino, pero esto no cuenta con una problemtica clara y tuvimos que cambiarlo. Estuvimos preguntando a distintas personas del saln si tenan alguna idea pero fue en vano, buscamos por internet problemticas tpicas del da a da pero tampoco funcion.\r\n	Eventualmente simplemente se nos vino a la mente las IA, se nos ocurri hacer una Inteligencia Artificial que cree msica completamente original, aunque an no sabemos si seremos capaces de hacerlo. Ya que estbamos con las IA, fuimos a hablar con una para que nos de ideas, la IA en cuestin era ChatGPT. Nos guardamos tres ideas, un contabilizador de tus finanzas, como deudas y sueldos, un robot controlado mediante comandos de voz y la IA que genera msica original.\r\nAn no sabemos cual vamos a elegir y tenemos que hablarlo con mayor profundidad, pero por ahora tenemos un par de ideas. ','2023-03-23'),(5483,273,'Bitacora N4','En el da de la fecha me dispuse a realizar los trabajos que me faltan. Empec a hacer la Tarea N6 y con mi grupo, que se terminaron de confirmar los miembros de este hoy (Luca Patio, Geronimo Estigarribia, Tobias Alegre, Amir Gomez y yo) empezamos a pensar posibles proyectos a realizar. Entre estos, estbamos pensando en realizar un sistema que sirva para cancelar el ruido alrededor, algo como una especie de cortina de goma eva que se active al escuchar sonidos fuertes alrededor del rea de una habitacin. Tambin pensamos en pginas con informacin de distintas cosas, como por ejemplo colectivos, o informacin sobre donde podran encontrarse distintas cosas tiles. Por ltimo, tambin pensamos en modificar y mejorar la pgina del profesor Olaso, &quot;encuentrotecnologico&quot;, que necesita una actualizacin urgente.','2023-03-23'),(5484,281,'Dia 5','Hoy dediqu todo mi tiempo en la busqueda de informacin para nuestro proyecto en grupo, originalmente iba a ser un robot sirviente que calentase el agua hecho con arduino, pero no cuenta como una necesidad asi que tuvimos que cambiar el rumbo de este. Buscamos por internet problematicas cotidianas pero no fue una buena idea ya que no salian mas que problemas globales tales como el racismo y desigualdas. Despues charlamos sobre IAS, y el resultado de esta charla fue tener una conversacin con la ia chatGPT  que nos di varias ideas y pero terminamos filtrando  dos:  Un robot controlado por voz y una pagina que te ayuda a controlar tus finanzas.','2023-03-23'),(5485,286,'Trabajo N7, Proyecto de la materia','Hoy abr el trabajo n7 que ya tena parte de este hecho, y casi lo termino. Luego de haber completado la gran mayora del formulario. Con el equipo de la materia terminamos eligiendo como proyecto por una aplicacin de seguridad que pueda descargar la gente e informar sobre robos y todo tipo de incidentes.','2023-03-23'),(5486,276,'Curso LinkedIn + Certificado - Modulo 4 Guia Empresa Simulada Cuestionario - Cuestionario Modulo 5 Tarea 7 Introduccin a los Proyectos  Institucionales de Prcticas  Profesionalizantes - Modulo 2 Tarea 2 Mapa Conceptual','Desde la ultima bitcora, estuve realizando diversas tareas. Para empezar termine con el curso de LinkedIn, habiendo finalizado tambin con el\r\nexamen final del curso y habiendo obtenido mi certificado de LinkedIn. Por otro lado, empec a realizar el cuestionario de &quot;Empresa Simulada&quot; del Modulo 4, analizando el material dado pude realizarlo y darlo por terminado. Por otro lado, en base al modulo 5 realice la tarea 7, el &quot;Introduccin a los Proyectos  Institucionales de Prcticas  Profesionalizantes&quot;, habiendo analizado el material pude completar el cuestionario. Y para finalizar, empec a analizar los contenidos del Modulo 2 y realice la tarea 2 &quot;Mapa Conceptual de las PP&quot;. ','2023-03-23'),(5487,278,'Clase N 5 23/03/023','En el dia de hoy finalice con el formulario de la tarea n7 , ademas continue con el cuestionario de la tarea N 5. Por ultimo conformamos el equipo para realizar el proyect este ao , los integrantes somos :\r\nAlegre Tobias\r\nEstigarribia Geronimo\r\nGomez Amir\r\nPatio Luca \r\nLescano Pedro\r\n\r\nEl scrum master es pedro.\r\n\r\nEl proyecto que tenemos en mente realiar es reversionar la pagina &quot;encuentrotecnogolico.com.ar&quot; para que los proximos sextos aos puedan tener una mejor experiencia en ella y en las PP.\r\n','2023-03-23'),(5488,292,'eleccion de proyecto- trabajo practico 5, 6,7 y8','En el da de hoy 23 de marzo al llegar a la clase de prcticas profesionalizantes comience a realizar 1 de las 3 actividades restantes de el trabajo prctico empresa simulada con mi compaero como ya lo habiamos organizado el da anterior, luego de hacerla seguimos con el trabajo 6 que consista en hacer el organigrama de una empresa, esto nos llev desde que terminamos el primer punto hasta el receso.\r\nContinuamos con los 2 puntos que nos faltaban de la actividad 5. Luego con el grupo que se form la clase anterior se decidi cul iba a ser el proyecto que vamos a realizar y termin el ltimo punto del trabajo nmero 5. \r\npor ultimo entregu el trabajo practico 8 anteriormente hecho con mi compaero pero no lo haba entregado','2023-03-23'),(5489,288,'Clase n5','Hoy realizamos la bsqueda y creacin de ideas para nuestro proyecto grupal que disearemos a lo largo del ao, tenamos planeado un robot Arduino el cual tena como funcin, despertador, parlante, calculadora, entre otras ms cosas. Pero luego de una charla nos pusimos de acuerdo en 3 ideas un robot controlado a voz, un contador virtual, una pgina que te soluciona problemas sean de informtica o motrices acerca de la mecnica de los vehculos. Tambin hicimos el cuadro del mdulo nmero 5 tarea 8.','2023-03-23'),(5490,293,'Grupo 5','hoy disidimos hacer un a proyecto que tenga que ver con el GPS con adruino.','2023-03-23'),(5491,283,'modulo 5 tp 7','\r\nEl dia de hoy termine el pdf que contenia las respuestas para responder el formulario del Trabajo Practico 7.\r\nTambien charlamos sobre algunas preguntas y dudas que teniamos acerca del formulario. \r\nDecimos que integrantes iban a formar nuestro grupo de Practicas Profesionalizantes, los cuales esta conformado por Alan Gonzalez, \r\nNicolas Ezequiel Mangialavore, Thiago Hernan Arroyo, Lucan Bulacio Novick y por mi (Ciro Andre Lobotrico). Tambien se me eligio como Scrum Master que\r\ntiene como trabajo ayudar y guiar en todos los problemas que pueda llegar a tener el grupo.','2023-03-23'),(5492,285,'Da 4 PP','Que logre hacer hoy?\r\n\r\nEl da de hoy logr terminar el Modulo N2 y el N3.\r\nLogre hacer el CV, los 2 cuestionarios hechos en Form y entregarlos.\r\nSiento que se me complico un poco hacer el Modulo N2, porque no tena idea de como hacer un Mapa, hice lo mejor que pude guindome y lo entregu.\r\n\r\nEn que se me complico?\r\n\r\nTuve algunas dificultades trabajando con este, la computadora se congelaba de a ratos, me costaba un poco entender el texto y no sabia como hacer un mapa.\r\nAl estar algunas semanas trabajando en este, el dia de hoy pude terminarlo y entregarlo sin problemas\r\n\r\n\r\nQu estuve investigando?\r\n\r\nSegu investigando como hacer el mapa y en que guiarme para hacerlo, pero ya termin.\r\nInvestigue el cmo sacar algunas certificaciones que me falta, como el SCRUM, va a ser medio complicado, por lo que o es una conferencia de 7 horas.\r\nAhora mismo tengo que investigar cmo empezar con el siguiente mdulo O tal vez saltarmelo y empezar a investigar para algn otro, Estoy pensando en adelantarme un poco y hacer el 7, ya para tener terminado los cuestionarios hechos en form.\r\n','2023-03-23'),(5493,279,'Tarea 5 (an incompleto pero avanzado)','El da de hoy lo que hice mayormente fue avanzar en el tema de la tarea 5 donde tuve ayuda de un compaero donde estuvimos resolviendo y buscando las respuestas adems de poder avanzar mas en el cuestionario de 38 preguntas aunque algunas no sabemos que poner o era muy complicado hacerlo.','2023-03-23'),(5494,280,'Organizacion de grupos y proyecto','En el dia de hoy se formo el grupo 1 de practicas compuesto por 5 personas\r\n\r\nEl proyecto estara enfocado mayormente al hogar permitiendo que cualquier persona que necesite una receta pueda buscarla segunlos ingredientes q tenga. Agilizando el proceso de busqueda y este podra ser utilizado por voz con una forma o varias ya que sera representado como un asistente fisico portable','2023-03-23'),(5495,298,'Clase 3','Termin con la tarea 2 y comenzamos a pensar el proyecto que vamos a hacer, pensamos en un robot pero ahora estamos teniendo en cuenta la idea que nos propuso el profe :)','2023-03-23'),(5496,275,'Dia 5','este da se baso nicamente en hacer la tarea mas larga esta ahora la cual era del modulo 5, es un cuestionario con 38 preguntas las cuales tengo que hacer usando una gua, hasta ahora hice hasta la pregunta n18 y la seguir haciendo por el resto de das y tambin forme un grupo para el proyecto que tendremos que hacer. ','2023-03-23'),(5497,284,'Bitacora 23/3/23','Hoy finalic el mdulo 4 &quot;Guia de empresa simulada&quot; , y pude arrancar el modulo 5  ','2023-03-23'),(5498,287,'Certificado - Modulo 4 Guia Empresa Simulada Cuestionario - Cuestionario Modulo 5 &quot;tarea 7 Introduccin a los Proyectos  Institucionales de Prcticas Profesionalizantes&quot; - Modulo 2 &quot;Tarea 2 Mapa Conceptual&quot;','Desde la ultima bitcora, entregue el certificado del curso linkedin. Por otro lado, empece a realizar el cuestionario de &quot;Empresa Simulada&quot; del Modulo 4, analizando el material dado pude realizarlo y darlo por termianado.Por otro lado, en base al modulo 5 realice la tarea 7, el &quot;Introduccin a los Proyectos  Institucionales de Prcticas  Profesionalizantes&quot;, \r\nhabiendo analizado el material pude completar el cuestionario. Y para finalizar, empece a analizar losm contenidos del Modulo 2 y realice la tarea 2 &quot;Mapa Conceptual de las PP&quot;. \r\n','2023-03-23'),(5503,290,'Cuarta','Hoy contine con el mdulo 4 y 5 que haba dejado la clase anterior, termine el cuestionario, pero deje para despus el el formulario, revise el mdulo 6 para ver si poda adelantarlo pero no tuve tiempo y lo deje para cuando llegue a mi casa','2023-03-23'),(5499,272,'Mdulo 4 y formacin de grupo del proyecto','El da de hoy empec el mdulo 4 completando un poco del cuestionario sacando la informacin del PDF proporcionado por el profesor y formamos el grupo de proyecto, el cul est conformado por Alan Gonzlez, Nicols Mangialavore, Lucan Bulacio, Ciro Lobotrico y yo. El proyecto hay que elegirlo todava.','2023-03-23'),(5500,289,'Clase 5','Hoy adems de seguir con el cuestionario 7, con mi grupo discutimos sobre que proyecto haramos. Al principio decidimos hacer un baymax, pero no era viable, entonces decidimos hacer una lluvia de ideas pero no serva nada. Entonces tomamos la idea del profesor de hacer una app de recetas de cocina segn los ingredientes y la poca que tenga y decir los pasos en voz alta. \r\nEso es todo por hoy..\r\nMuchas gracias!','2023-03-23'),(5501,282,'Tareas 5 y 6 + Eleccion de proyecto','Durante la tarde de esta jornada, junto a mi compaero de banco finalizamos la tarea numero 5, en la cual nos quedaban pendientes 3 preguntas de largo contenido, las cual como dije anteriormente terminamos.\r\nAdemas de esto utilizamos parte del tiempo para realizar la tarea numero 6 en su totalidad.\r\nComo ultima actividad presentamos distintos proyectos para que los profesores de practicas profesionalizantes, de los 6 proyectos prensentados, se nos fue aprobado el proyecto que consistia en un mapa intercativo acerca de delitos e incidentes en la Ciudad Autonoma de Buenos Aires','2023-03-23'),(5502,294,'Tarea n5 - Cuestionario Guia de Empresa Simulada  - Eleccin de proyecto en grupo','En el da de hoy realice la tarea n5, en la que fui avanzando con el tema de las preguntas; no lo llegue a terminar por falta de