ia de la fecha, arranque con un par de las preguntas de deportes para el proyecto tecnologico que tengo con mis compaeros Luis Meza, Emilio Pereira y Enzo Romaniello. Tambien los ayude con la historia del juego en la documentacion. Y pensar el nombre del juego de nuestro proyecto tecnologico, denominado &quot;The Fourth Lost&quot;.','2023-03-28'),(5514,269,'Clase 5 inicio de carpeta de campo ','Hoy martes 28/03/2023 realic los tos que me faltaban del classroom, hice una revisin de mis conocimientos de HTML y css, comenc mi carpeta de campo individual.\r\nCon el grupo empezamos el DER y realizamos el vdeo de presentacin del grupo ','2023-03-28'),(5515,261,'28/03/2023','Hoy hice la portada del proyecto &quot;Proyecto Robot-Sumo&quot;','2023-03-28'),(5516,267,'28/03/2023','Hoy hice la portada del proyecto','2023-03-28'),(5517,267,'28/03/2023','Hoy hice la portada del proyecto','2023-03-28'),(5518,267,'28/03/2023','Hoy hice la portada del proyecto!','2023-03-28'),(5519,251,'Finalizacin de los TPs - 28/3/2023','El da de hoy terminamos junto a mi equipo los Trabajos Prcticos restantes (6, 8 y 9) para poder empezar con el proyecto maana.','2023-03-28'),(5520,267,'28/03/2023','Hoy hice la portada del proyecto!\r\netet','2023-03-28'),(5521,263,'28/03/23','Hoy hicimos los guiones del video para luego hacer el video y editarlo. Fin de informe','2023-03-28'),(5522,301,'28/03/23','Hoy realizamos el guion del video de la tarea 9 junto con su edicion y yo personalmente realize las tareas 2 y 3 ','2023-03-28'),(5523,259,'Martes 28/3 Nahuel Moreno','Durante el fin de semana hasta hoy hice el certificado en Scrum y rehice la evaluacion de Ingles y tambien la entregue, todo por Classroom.','2023-03-28'),(5524,265,'28-03-2023','Hoy hice la tarea n8 y organizamos, en base al proyecto, que es lo que le tocaba a hacer cada uno.\r\nYo tuve que hacer el FODA junto a otra compaero.','2023-03-28'),(5525,253,'Martes 28/03/2023 - Planteamiento final del videojuego','Hoy lo que hicimos fue terminar de dejar en claro cuales sern las funcionalidades del videojuego y los caminos que este tendr. Adems, comenzamos lo que es la documentacin y los diagramas del mismo.','2023-03-28'),(5526,260,'28/03/23','Empezamos a completar la carpeta de caampo, y empezamos el DER y creamos el video de presentacin del proyecto.','2023-03-28'),(5527,269,'Clase 5 inicio de carpeta de campo ','Hoy martes 28/03/2023 realic los tos que me faltaban del classroom, hice una revisin de mis conocimientos de HTML y css, comenc mi carpeta de campo individual.\r\nCon el grupo empezamos el DER y realizamos el vdeo de presentacin del grupo ','2023-03-28'),(5528,268,'28/03/2023','Hoy con mi grupo nos organizamos sobre que hariamos el dia de hoy y el de maana y hise un repositorio Git para asi tener un Canva donde marcaremos las actividades que estan en proseso y finalizadas. Con Bolla terminamos el foda.','2023-03-28'),(5529,266,'28/03/2023 - finalizacion de documentacion e inicio del DER','Hoy finalizamos la documentacin, avanzamos con la carpeta de campo, hicimos el vdeo de los tps previos al proyecto y empezamos el Diagrama de entidad Relacin. Incluimos al grupo al nuevo integrante ciro y lo pusimos al dia con todo ','2023-03-28'),(5530,270,'28/3/23','El da de hoy comenzamos con la documentacin del proyecto, terminando de discutir el funcionamiento del videojuego en el &quot;daily&quot; con el grupo y, explicndolo en la propia documentacin, el resto de tareas del classroom las termin de entregar hace unos das.','2023-03-28'),(5531,262,'28/03/2023','Hoy comenzamos con el planteamiento de como comenzar el camino del proyecto y la documentacin del mismo. Tambin realizamos nuestro primer dayli del grupo, donde creamos el nombre del videojuegoque vamos a realizar y cerrando detalles que vamos a realizar el dia de hoy y maana. ','2023-03-28'),(5532,254,'29/03/23','Termine el boceto de la pagina y ayer termine todos los tp','2023-03-29'),(5533,251,'Inicio del Proyecto - 29/3/2023','El da de hoy em