grupo con Bolla comenzamos con el Gantt despues de que no pudieramos guardalo en el Project de windows lo pasamos todo al ProjectLibre tambien el el repositorio de Git hagrege las actividades que tendremos que hacer y altermina con todo tubimos la charpara para ya tener una idea de que haremos el martes.','2023-03-29'),(5545,252,'Clase 6 - DER y Prctica de JS','El da de hoy terminamos el DER del proyecto de PP y yo estuve practicando cdigo de javascript','2023-03-29'),(5546,271,'29/03/23','En el da de hoy junto a mis compaeros Enzo Romanniello, Emilio Pereira, Valentn Bentos y Luis Meza, cambiamos el nombre de juego a &quot;The Five Lost&quot;. Adems hicimos los diagramas y colabore en los diagramas Gantt y DER.','2023-03-29'),(5547,265,'29-03-2023','Hoy comenc con la carpeta de campo e hice el diagrama de GANTT junto a mi compaero ','2023-03-29'),(5548,265,'29-03-2023','Hoy comenc con la carpeta de campo e hice el diagrama de GANTT junto a mi compaero ','2023-03-29'),(5549,261,'29/03/2023','Hoy Hicimos el diagrama de Caso de Uso y el boceto del Proyecto, midiendo sus medidas y sus pesos de los componentes  ','2023-03-29'),(5550,270,'29/03/23','El da de hoy nos organizamos en el daily para hacer los diagramas del proyecto, pudimos finalizar los diagramas:caso de uso, DER, Foda y gantt.\r\nYo en especifico realice el Gantt y DER. Ademas ahora el juego se modifico ya que tenemos un nuevo integrante.','2023-03-29'),(5551,259,'Iniciacion de Proyecto 29/03','Hoy arrancamos con la organizacion del proyecto, haciendo el FODA, Gantt y dividiendonos las tareas y realizacion de cada una de ellas, por mi parte yo hare la parte de la base de datos en sql, y ayude en el Foda y Gantt mismo','2023-03-29'),(5552,302,'29/03/2023','Hoy ingres a un nuevo grupo en el cual se va a realizar un videojuego y me inteoriz dentro del mismo,tambin participe de mi primer dayli en el grupo y realice los detalles acordados(anlisis foda y diagrama de caso de uso).','2023-03-29'),(5553,262,'29/03/2023','El dia de hoy se nos incorporo un nuevo compaero (Valentin) al grupo y le explicamos en que se basa nuestro proyecto/videojuego y tambien lo interiozamos con lo aprendido y PP. Luego realizamos otro dayli diario y planteamos las cosas que se realizarian el dia de hoy y fueron realizar el Diagrama GANTT, DER, Caso de Uso y analisis FODA. Valen y yo realizamos el FODA y Diagrama Caso de Uso. Emilio, Diego, Enzo realizaron el DER y GANTT','2023-03-29'),(5554,286,'Inicio de Proyecto','Empezamos teniendo una reunin del grupo y una charla sobre los objetivos del proyecto, al terminar, pensamos en el diseo de la pgina, encontramos un color amarillo como el de la pgina de Buenos Aires y ms tarde buscamos cmo hacer un mapa interactivo, encontramos un cdigo abierto de un mapa de CABA y empezamos a ver que era cada cosa desde el apartado de inspeccionar de google. Luego buscamos las lneas de cdigo anteriormente mencionadas y empezamos a borrar lo que no nos serva. Ms tarde, con la ayuda del profesor, pudimos conseguir lo que queramos, tener el mapa solo, sin ninguna funcin.','2023-03-30'),(5555,299,'Proyecto','Hoy decidimos el proyecto con el grupo y finalizamos los formularios ','2023-03-30'),(5556,283,'modulo 4 y 5, finalizacin ','El dia de hoy cambie alguinas respuestas y termine el Formulario del trabajo practico 7\r\nCreamos un grupo por Whatsapp donde podremos charlar, discutir y sobre lo que hicimos y \r\nnos falta hacer en clase. El mismo grupo esta conformado por Nicolas Ezequiel Mangialavore,\r\nThiago Hernan Arroyo, Alan Gonzalez, Lucan Bulacio Novick y por mi (Ciro Andre Lobotrico). \r\nAhora con el grupo esperaremos que nos llamen para charlar sobre nuestro proyecto. \r\nEmpece a leer el pdf del modulo 4 para poder concluir con los trabajo practico 5 y el 6 \r\nSegui el trabajo practico n6 donde tenia que hacer organigrama de una empresa simulada.\r\nEmpec el trabajo practico numero 5 y luego termine el trabajo practico numero 6. ','2023-03-30'),(5557,272,'Modulos y seleccin de proyecto anual','El da de la fecha continue con la finalizacin de mis modulos pendientes y, junto a mi grupo, determinamos el proyecto a seguir hasta final de ao, una tienda digital de juguetes infantiles, hecha para la tia de Ciro Lobotrico, uno de los integrantes del grupo, sta ser nuestra clienta en este ao.','2023-03-30'),(5558,285,'Dia 5 en PP','Que logre hacer hoy?\r\n\r\n\r\nHoy logr terminar La tarea 7, Me un al grupo que me corresponde y ando haciendo la tarea 5\r\n\r\n\r\nEn que se me complico?\r\n\r\nMe cost un poco la parte de la investigacin que se necesitaba hacer para el cuestionario, no entenda del todo el documento que me mandaron as que decid buscar algunas cosas por internet.\r\nY no hay tantos problemas, pude completar el cuestionario y ando enfocados en los que debo por el momento.\r\n\r\n\r\nQu estuve investigando?\r\n\r\nInvestigue en Google y por el Classroom para ver como hacer estos cuestionarios\r\nNecesito algo de ayuda adicional de mis compaeros, ya que se me medio dificulto hacer esto solo.\r\nY me llev unas 2 semanas completar el TP5, el 7 me llevo masomenos una semana y media, pero ya estn los 2.\r\n','2023-03-30'),(5559,293,'Comienzo de Proyecto','Hoy da decidimos el proyecto y avanzamos con los diagramas y la propuesta del cliente tambin hablamos del diseo de la pgina web que ser de compra de ropa','2023-03-30'),(5560,274,'Prototipado, API de mapa, edicin del cdigo del mapa','El da de hoy ya iniciamos con el proyecto. Lo primero que hicimos fue hacer una reunin con los integrantes del grupo. Luego decidimos que utilizaramos un fondo blanco con detalles amarillos como pgina principal. \r\nDespus buscamos alternativas a Google Maps, para de esta manera tener una API para utilizar en el proyecto.\r\nUna vez que la tenamos, decidimos borrar todos los conos de los lugares que aparecan en el mapa, como estaciones de servicio, bicicletas, estacionamientos, etc.\r\nA pesar de haber borrado todos los archivos, no pudimos borrar estas funciones de manera definitiva. Con ayuda del profesor, pudimos borrar los botones de estas funciones y el mapa qued limpio.','2023-03-30'),(5561,280,'Proyecto chicken assistant','Investigacion de del ahrdware y software necesario para la realizacion del proyecto\r\n\r\nInicio de la documentacion necesaria\r\n-Analisis Foda\r\n-Programacion en c++\r\n-Trello\r\n-Git\r\n','2023-03-30'),(5562,276,'Certificado Scrum - Diseo Empresa Simulada - Propuesta de Proyecto - Video - Inicializacion de Proyecto PP','Desde la ultima bitcora, pude realizar las siguientes tareas: \r\n- Para empezar me inscrib en un curso de Scrum, en el cual me asignaron material en PDF, una clase de 5 horas y luego de realizar el examen final, pude obtener mi Certificado Scrum.\r\n- Por otro lado, Segu analizando los mdulos, esta vez el modulo 4, en el cual realice la tarea 6, Diseo de Empresa Simulada, el cual consista en realizar una clase de organigrama pensando en su funcin, estructura, actores y roles.\r\n- Por otro lado, analice el Modulo 5, Tarea 8, y realice la Propuesta de Proyecto Tecnolgico, analizando la situacin de la escuela, eleg la inseguridad como tema, ya que el establecimiento habra recibido bastantes inconvenientes al respecto.\r\n- Por otro lado, analice el modulo 6, Tarea 9, y analizando los materiales, se me asigno realizar un video personal sobre mi, mis inters, que conocimientos pondra en practica, etc. el cual realice sin problemas\r\n- Y para finalizar la bitcora, este mismo da empezamos a armar el grupo de trabajo para poder empezar los dichos Proyectos de las PP, habiendo terminado por decidir en tomar el emprendimiento de venta de ropa de mi compaera de grupo, y realizar una pagina web funcional de la misma, la cual tenga funcionalidades similares a la de una pagina web de una marca oficial. Estando en proceso al respecto, por el momento se realizaron ciertos diagramas y los Requerimientos del cliente.\r\n','2023-03-30'),(5563,295,'Investigacion sobre el proyecto - Analisis FODA','En el dia de hoy realizamos una investigacin profunda sobre nuestro proyecto planteado e investigamos los componentes y los precios que cuestan cada uno. Hicimos la daily y el analisis FODA con sus amenazas, fortalezas, debilidades, oportunidades(que no terminamos).','2023-03-30'),(5564,275,'30-30-23 Comienzo del Proyecto ','En el da de hoy empezamos con el proyecto que haremos a lo largo del ao, el tema que decidimos realizar fue hacer una pagina de compra/venta de ropa, empezamos haciendo las pautas para el trabajo, viendo que lenguaje de programacin usaremos y por mi parte empec a hacer los diagramas FODA, GANT y camino critico ','2023-03-30'),(5565,278,'Clase N 6 30/03/2023','En el da de la fecha finalice el cuestionario de la tarea N 5. Adems finalmente decidimos qu proyecto vamos a realizar a lo largo de este ao . Este consiste en una pagina web y una aplicacin para controlar el inventario de una inmobilaria. La aplicacin servir para agregar un nuevo producto al inventario  y generar un cdigo QR para pegarlo en el mueble y as poder escanearlo mas fcil .','2023-03-30'),(5566,291,'Seleccin de proyecto y tareas','El da de hoy relize algunos de los mdulos que tenia pendiente y algunos cuestionarios, tambin charlamos con el profesor hacerca del proyecto que realizaremos el da de hoy, despus de eso investigamos hacerca de nuestro proyecto que sera una pgina web de juguetes.','2023-03-30'),(5567,273,'Clase 6','En el da de la fecha me dispuse el diagrama que me faltaba acerca de una empresa simulada, que deba constar de distintas cosas, tales como su estructura, su funcin, sus actores, etc. Tambin me puse a pensar acerca de un proyecto tecnolgico y resolvimos con los dems integrantes de nuestro equipo a realizar una aplicacin movil y una pgina web que sirva para tener total control del inventario de muebles de una pequea o mediana empresa. El mismo deber contar con una funcin de escaneo QR y de esta forma se podr subir toda la informacin a la pgina.','2023-03-30'),(5568,287,'Certificado Scrum - Diseo Empresa Simulada - Propuesta de Proyecto - Inicializacion de Proyecto PP','Desde la ultima bitcora, pude realizar las siguientes tareas: \r\n- Para empezar me inscrib en un curso de Scrum, en el cual me asignaron material en PDF y luego de realizar el examen final, pude obtener mi Certificado Scrum.\r\n- Por otro lado, Segu analizando los mdulos, esta vez el modulo 4, en el cual realice la tarea 6, Diseo de Empresa Simulada, el cual consista en realizar una clase de organigrama pensando en su funcin, estructura, actores y roles.\r\n- Por otro lado, analice el Modulo 5, Tarea 8, y realice la Propuesta de Proyecto Tecnolgico, analizando la situacin de la escuela, eleg la inseguridad como tema, ya que el establecimiento habra recibido bastantes inconvenientes al respecto.\r\nDe este modo doy por finalizados los Modulos de las PP. \r\n\r\n- Y para terminar la bitcora, este mismo da empezamos a armar el grupo de trabajo para poder empezar los dichos Proyectos de las PP, habiendo terminado por decidir en tomar mi emprendimiento personal de venta de ropa, y realizar una pagina web funcional de la misma, la cual tenga funcionalidades similares a la de una pagina web de una marca oficial. Estando en proceso al respecto, por el momento se realizaron ciertos diagramas y los Requerimientos del cliente.','2023-03-30'),(5569,279,'El comienzo del Proyecto','En el dia de hoy empeze a trabajar con mi grupo con nuestro proyecto para practicas profesionalizantes en el cual comenzamos a buscar el color amarrillo del logo de buenos aires osea la pagina web para despues buscar como hacer un mapa interactivo en el cual encontramos un codigo abierto para analizar como funcionaba con el modo inspeccionar de google y despues buscando el mismo codigo dentro de el codigo abierto con visual studio y empezamos a borrar lo que no nos servia pero en un momento nos quedamos sin saber que hacer asi que pedimos ayuda al profesor y gracias al profesor pudimos conseguir solamente el mapa pero sin ninguna funcion.','2023-03-30'),(5570,294,'Analisis FODA - Investigacion del proyecto','En el dia de la fecha realizamos la investigacion sobre nuestro proyecto, a mi me toco investigar los materiales que vamos a necesitar para complementarlo. Adems hicimos el anlisis FODA que cuenta con las oportunidades, fortalezas, debilidades y amenazas que cuentan en nuestro proyecto, no lo terminamos.','2023-03-30'),(5571,282,'Charla acerca de las bases del proyecto e inicio de investigacion.','Como primera medida, en conjunto a mis compaeros Forte, Filippa y Caceres tuvimos una Reunin interna en la cual representamos las bases del proyecto y sus funcionalidades esperadas. Tras esto realizamos unos intentos de prototipados los cuales no resultaron satisfactorios debido a no conocer las medidas del mapa. Tras esto, empezamos con una bsqueda acerca de como realizar mapas interactivos. Encontramos un mapa de cdigo libre y sus correspondientes APIs, el cual tratamos de separar por partes y analizar sus funciones, lo cual resulto en tener un mapa base interactivo y totalmente funcional.','2023-03-30'),(5572,289,'Clase 30-3','Hoy hicimos lo siguiente\r\nPrimera Daily Grupal\r\nInvestigar sobre los componentes\r\nInvestigar que app usaremos\r\nDocumento de Carpeta de campo grupal para anotar que hicimos e investigacin\r\nEmpezamos e foda\r\nEso es todo por hoy...\r\nMuchas Gracias!','2023-03-30'),(5573,277,'Sexta clase','Hoy buscamos informacin para llevar a cabo nuestro proyecto, pensamos distintas ideas y al final llegamos a la conclusin de hacer una pgina de msica que lea canciones y las transforme en partituras para distintos instrumentos.','2023-03-30'),(5574,290,'Quinta ','En el da de la fecha termine casi todos los mdulos, faltandome solo 2, hice el organigrama sobre tecnologa, tambin hice el ltimo formulario del mdulo 5 y tambin termine el mapa conceptual del mdulo 2.','2023-03-30'),(5575,288,'sexta clase','Durante el da de hoy hemos estado recopilando informacin para poner en marcha nuestro proyecto. Despus de analizar diversas ideas, finalmente hemos decidido crear una pgina web de msica que sea capaz de interpretar canciones y transformarlas en partituras para diferentes instrumentos.','2023-03-30'),(5576,281,'Dia 6',' Hoy estuvimos pensando arduamente en grupo sobre que proyecto podriamos hacer, al principio estuvimos pensando en hacer una pagina web de finanzas pero realmente no iba a tener mucho impacto y no valia la pena, entonces pensamos en una pagina web que te permita introducir canciones y puedas ver: Melodia, partitura, y como poder tocarla en piano, guitarra y otros instrumentos. Ademas estuvimos investigando como podriamos hacerlo, usando una API','2023-03-30'),(5577,278,'Clase N 7 30/03/2023','En el dia de la fecha finalice el cuestionario N 5 .Realizamos la daily en la cual nos dividimos que diagramas deberia hacer cada inegrante del equipo, a mi me toco realizar la presentacion del proyecto  y los requerimientos del usuario.Hoy empece y termine los requerimientos del usuario.Ademas creamos un github para subir todas las tareas realziadas por el equipo.','2023-03-31'),(5578,286,'Mapa y HTML','Hoy empezamos haciendo una daily con el grupo. Al terminar esta, con mi compaero Christian tuvimos que volver a buscar la pgina de donde sacamos el cdigo y la api de ayer para el mapa porque habamos perdido el archivo y no lo encontrbamos en el drive, ni en el historial ni en el apartado de &quot;Marcadores&quot; de Google. Una vez descargados todos los archivos necesarios para el trabajo empezamos a ver cmo funciona la opcin de marcar coordenadas en el mapa.','2023-03-31'),(5579,279,'Dia 2 Del Proyecto','Este da estuvimos empezando a avanzar con el trabajo mientras mis compaeros se encargaban de recuperar el trabajo perdido de ayer en mi caso lo que hice fue mayormente hacer varias diagramas como peda el profesor como el de Gantt, el de Foda y el Trello compartiendo este para que los dems de mis compaeros de grupo lo puedan actualizar cuando avancemos nuestras tareas y tambin empezaron a hacer el diseo de app Mobile en Figma.','2023-03-31'),(5580,293,'Proyecto en proceso ','Hoy da avanzamos con los diagramas con el gantt y flujo de datos tambin hicimos la deily.','2023-03-31'),(5581,274,'Daily, restauracin de archivos','En el da de hoy lo primero que hicimos fue una daily. Luego, buscamos la pgina del cdigo y la api del mapa ya que habamos perdido el archivo y no lo encontrbamos en ningn lado. Descargamos todos los archivos de nuevo y vimos cmo funciona la opcin de marcar coordenadas en el mapa.','2023-03-31'),(5582,285,'Dia 6 en PP','Qu logre hacer hoy?\r\n\r\nEmpezamos la realizacin del proyecto haciendo el Kanban en Trello y Termine la tarea n5\r\n\r\nEn que se me complico?\r\n\r\nPor parte el inicio del proyecto no fue tan complicado.\r\nSe me complic un poco haciendo la tarea n5 al ser un cuestionario demasiado largo.\r\n\r\nQu estuve investigando?\r\n\r\nInvestigamos cmo hacer un Kanban despus de tanto tiempo sin hacer uno.\r\nInvestigue los apuntes que haba en el classroom para hacer la tarea y terminarlo.\r\n','2023-03-31'),(5583,275,'31-03-2023','Hoy hicimos la dailys para ver en que continuar, decid terminar el diagrama GANTT y tambin el camino critico, pudimos terminarlos y para as poder comenzar con algo mas como por ejemplo el diseo de la pagina.','2023-03-31'),(5584,273,'Clase 7','En este da estuvimos platicando con mis compaeros acerca de la documentacin que habra que realizar para el proyecto. Estuvimos dividindonos las determinadas tareas sobre los diagramas a realizar y en mi caso me toca realizar el Diagrama de Gantt y el Camino Crtico del proyecto. Finalic el diagrama de Gantt creado en ProjectLibre y tambin hice un tablero Kanban en Trello, a su vez que hice un repositorio en GitHub para guardar toda la documentacin. ','2023-03-31'),(5585,280,'Proyecto dia 3','Realizacion de la investigacion del desarrollo de la app mobile (Lenguaje)\r\nRealizacion del diagrama de gantt \r\nProgramacion base de la app mobile','2023-03-31'),(5586,272,'Organizacin inicial del grupo y proyecto','El da de hoy iniciamos con la organizacin del proyecto y sus respectivas etapas y tareas. Determinamos que integrante realiza cada tarea y los tiempos de las mismas. Una vez todos los integrantes esten presentes se empezara a relizar el proyecto en cuestin.','2023-03-31'),(5587,299,'Organizacin ','Hoy realizamos el kanban y distribuimos las tareas entre nuestros compaeros para facilitar y acelerar el proyecto aparte de empezar con algunos diagramas','2023-03-31'),(5588,290,'Sexta','En el dia de la fecha arranque a hacer la tarea 8 que deje para despus y tambin empezamos con mi grupo a realizar las tareas de los diagramas de caso de uso y de entidad-relacion','2023-03-31'),(5589,276,'Proyecto PP - Analisis FODA - Requerimientos del Cliente','El da de hoy seguimos trabajando en base al proyecto de las PP. Mencionado anteriormente, conformamos nuestro grupo de 4 integrantes y nos decidimos por hacer una pagina en formato de tienda virtual relacionada con el emprendimiento que lleva a cabo mi compaera Alison Gargate. Esta consiste en realizar una clase de pagina web para dicho emprendimiento y asi hacerla funcional y dems.\r\nPor el momento las actividades que realizamos hasta el momento son el Analisis FODA. En este volcamos nuestras Fortalezas, Debilidades, Oportunidades y Amenazas. \r\nTambin realizamos los requerimientos del cliente y volcamos todos las necesidades y requerimientos de nuestro cliente, lo cuales implementaremos dentro de nuestro proyecto.\r\nPor el momento eso es todo. ','2023-03-31'),(5590,289,'Clase 7 ','Hoy luego de la Daily hice lo siguiente:\r\n-Segu con el Foda\r\n-Empezamos con carito a anotar las ideas de como ser la app\r\n-Buscamos paginas para buscar cosas que nos gustaran \r\n-Investigamos la competencia\r\nEso es todo por hoy..\r\nMuchas Gracias!\r\n','2023-03-31'),(5591,298,'Clase 5','Hoy empezamos a anotar las ideas que tenemos para la app y para la pgina \r\n','2023-03-31'),(5592,294,'Investigacion de conexin y codeo - Trello','Hoy realizamos una investigacin profunda sobre las conexiones que vamos a hacer con los componentes que tenemos en cuenta en base al proyecto. Tambin creamos un trello entre todo el grupo para exhibir todas las tareas que vamos realizando en el proyecto.','2023-03-31'),(5593,287,'Proyecto PP - Analisis FODA - Requerimientos del Cliente','El da de hoy seguimos trabajando en base al proyecto de las PP. Mencionado anteriormente, conformamos nuestro grupo de 4 integrantes y nos decidimos por hacer una pagina en formato de tienda virtual relacionada con el emprendimiento que llevo a cabo personalmente. Esta consiste en realizar una clase de pagina web para dicho emprendimiento y as hacerla funcional y dems.\r\nPor el momento las actividades que realizamos hasta el momento son el Anlisis FODA. En este volcamos nuestras Fortalezas, Debilidades, Oportunidades y Amenazas. \r\nTambin realizamos los requerimientos del cliente y volcamos todos las necesidades y requerimientos de nuestro cliente, lo cuales implementaremos dentro de nuestro proyecto.\r\nPor el momento eso es todo. ','2023-03-31'),(5594,281,'Dia 7',' El da de hoy estuvimos buscando en internet distintas API de msica, al principio no encontrabamos mucha informacin, despus encontramos Deezer API pero no pudimos comprender del todo el cdigo hasta que vimos una API llamada shazam la cual sirve para detectar canciones, la cual seria perfecta para nuestro proyecto. Aunque no sabemos del todo como usarla yo creo que es un buen paso. Adems con un compaero hicimos una pgina web bastante sencilla para empezar','2023-03-31'),(5595,277,'Sptima Clase','El da de hoy estuvimos buscando por internet cmo utilizar una API, mis compaeros se encargaron de hacer una pgina web algo sencilla para comenzar, tan solo dos inputs donde poner el nombre de la cancin y el artista. Mientras que yo me puse a investigar distintas APIs para buscar msica, al principio intentamos usar Deezer API, vimos un poco el cdigo pero no pudimos entenderlo completamente. Debido a esto decidimos movernos a Shazam API, una aplicacin que sirve para detectar canciones, la cual sera perfecta para nuestro proyecto. Aunque no es exactamente lo que buscamos, es un buen primer paso.','2023-03-31'),(5596,291,'Organizacin de proyecto','El da de hoy iniciamos la organizacin de nuestro proyecto con los integrantes presentes el da de hoy que son Alan Gonzalez, Thiago Arroyo y Lucan Bulacio, tambin realizamos la daily que consiste en responder tres preguntas.','2023-03-31'),(5597,295,'Investigacin sobre la conexin y cdigo de componentes - Creacin de Trello','Hoy realizamos la investigacin sobre las conexiones que se realizaran en base a los componentes que necesitaremos para nuestro proyecto. Adems hicimos un Trello donde vamos poniendo todas las actividades que realizamos en todo el proyecto.','2023-03-31'),(5598,288,'Septima clase','Hoy realic la interfaz principal de la pgina, el boceto, claramente no va a ser la pgina definitiva pero para empezar nos sirve de primer paso, estuve informndome sobre las API musicales gratuitas y como integrarlas al cdigo de html. Realice la pgina con bootstrap y la personalice un poco, intentamos integrar el API de deezer a nuestra pagina pero an seguimos intentandolo ya que sali fallido el mismo.','2023-03-31'),(5599,282,'Prototipado de App Mobile en Figma, recuperar archivos perdidos dia anterior, charla para alcanzar logros del proyecto','Como primera mencin acerca de lo realizado a lo largo del da, al ingresar, en conjunto a mi compaero Ledesma, dialogamos y discutimos distintas opciones acerca de lo que queramos para nuestra app Mobile, llegando a realizar una gran parte del diseo inicial, pero no finalizndolo. Siendo que quedo como punto pendiente la eleccin de colores para el men relacionado con los incidentes.\r\nAdems, ayud a mis compaeros Forte y Filippa a recuperar y rearmar varios archivos perdidos con respecto al mapa realizado ayer.\r\nComo ultimo punto y tras esto, tuvimos una pequea charla acerca de las metodologas de trabajo y cual era la forma mas factible de conseguir cumplir con los plazos y objetivos solicitados','2023-03-31'),(5600,292,'Prototipado de App Mobile en Figma, charla para alcanzar logros del proyecto','En el da de hoy me explicaron las cosas que se hicieron el da 30/3 ya que no pude asistir por motivos personales. por desgracia las cosas de eldia anterior no se pudieron guardar y se perdieron, a su vez empezamos con el diseo para la app Mobile en Figma, lo cual se hizo la mayor parte en lapiz para luego hacerlo en figma. no nos dio el tiempo para terminarlo pero si hacer la mayor parte. tambin se intento  recuperar el trabajo perdido el da anterior y charlamos acerca de como lograr los objetivos pautados hoy y que dems cosas debamos hacer','2023-03-31'),(5601,264,'04/04','Realizacin del FODA','2023-04-04'),(5602,256,'04/04/23','Junto a Kiara Chunga, Kiara Romero y Kevin mondaca hicimos el Gantt y el Foda','2023-04-04'),(5603,250,'Dia 8 Martes 4/4/2023 ','Hoy avance en la investigacin sobre HTML y el equipo avanz con el DER (Nahuel Moreno y Nieto Nicolas) y el mockup (Marmol Sofia)','2023-04-04'),(5604,259,'Martes 4 Proyecto Recetario - Nahuel Moreno','Hoy como grupo hemos avanzado respecto al Recetario, yo por mi parte hice el DER, o al menos avance en el, aadindole sus tablas y conexiones, las cuales seguirn maana Mircoles mis compaeros ya que yo no podre estar.','2023-04-04'),(5605,297,'04/04/23','Realizamos el gantt del proyecto en conjunto con mis compaeros. ','2023-04-04'),(5606,269,'04/04/2023 ','Hoy segu aprendiendo css mediante cursos en Youtube y puse en prctica los conocimientos adquiridos creando una pgina de ejemplo','2023-04-04'),(5607,257,'4/4/2022','Hoy en la daily quedamos de hacer con seba los diagramas que pudiramos, empezamos con los diagramas DER y UML, adems de averiguar que van a ser muuuuy largos a comparacin de los anteriores, vimos algunos avances en cuanto a codificacin y modelaje 3d','2023-04-04'),(5608,263,'4/4/23','Hoy estuve haciendo el diagrama der mientras que Axel Fenoglio estuvo haciendo el diagrama de clases lamentablemente Luciano falto por covid y Agustin no sabemos','2023-04-04'),(5609,255,'Dia 8 Martes 4/4/2023 ','Hoy avance en el mockup del proyecto, y mis compaeros avanzaron con el DER (Moreno Nahuel y Nieto Nicolas)','2023-04-04'),(5610,271,'4/4/2023','Tuvimos la charla del Daily, junto a mis compaeros Valentn Bentos, Enzo Romaniello, Emilio Pereira y Luis Meza. Adems de que mejoramos el DER( Diagrama Entidad Relacin)','2023-04-04'),(5611,260,'4/4/23','Estuve viendo videos sobre React y cambiamos el proyecto en vez de hacerlo con Next lo haremos con Vite ','2023-04-04'),(5612,261,'04/04/2023','Hoy estaba trabajando el diseo 3D del proyecto.','2023-04-04'),(5613,266,'04/04/2023 - Migracion del proyecto ','Esta clase nos estuvimos encargando con Diego de migrar el proyecto desde Next.js a Vite. Cambien estuve intentando crear las rutas dinmicas, no pude as que lo voy a seguir en mi casa. ','2023-04-04'),(5614,268,'04-04-2023','Hoy despues del la Daily comenzamos con el diseo 3D en Blender del Robot Sumo que tenemos planeado termina para el final de la clase de maana. Atte Javier Rojas Liambo de 61C','2023-04-04'),(5615,254,'04/04/23','Hoy realizamos el GANTT junto a mis compaeras y vimos como realizar el foda junto a mi compaero mondaca','2023-04-04'),(5616,267,'04/04/2023','Hoy estuve haciendo el diseo 3D','2023-04-04'),(5617,265,'04-04-2023','Hoy, luego de la Daily, buscamos modelos sumos para poder inspirarnos y tomarlos como ejemplo. Luego empezamos a ver videos de YouTube para saber usar Blender.','2023-04-04'),(5618,252,'Clase 7 - Prctica de JS y DOM','Hoy practiqu cdigo de javascript, aprend y practiqu cdigo sobre DOM','2023-04-04'),(5619,270,'4/04/2023','El da de hoy comenzamos con el grupo haciendo el daily y terminando de acordar detalles sobre el videojuego final. Luego nos dimos cuenta de un error en el diagrama de Base de Datos y tuvimos que crear una nueva tabla. Con esto terminamos el ultimo diagrama del proyecto para ya comenzar a investigar sobre unity y poder empezar a programar.','2023-04-04'),(5620,262,'04/04/2023','El dia de hoy comenzamos con un curso gratuito en youtube de Unity para adentrarnos en ese mundo y el manejo del mismo, ya que es algo nuevo para nosotros que deseamos experimentar, tambien al principio realizamos el Dayli como siempre, por otra parte comenzamos con las preguntas y BDD.','2023-04-04'),(5621,253,'Martes 04/04/2023 - Correccin de diagramas','Hoy corregimos algunos diagramas que tenamos incompletos y, comenzamos a pensar en las preguntas qie tendr nuestro videojuego. Adems, vimos algo muy por encima de lo que es Unity.','2023-04-04'),(5622,301,'Bitacora Agustin Barcia 05/04','este dia empezamos a investigar y crear el diagrama de unity para empezar nuestro juego, tambien buscamos mapas y herramientas para la creacion del mapa, tambien definimos exactamente de que va a tratar nuestro juego','2023-04-05'),(5623,268,'05/04/2023','Hoy despus de descargar Blender contine con el diseo de ayer pero al ver que haba cosas que ya estaban mal comenc otra vez con un poco de conocimiento de videos de youtube y al final comenc con la carpeta de campo con la ayuda de las Bitcoras.','2023-04-05'),(5624,253,'Mercoles 05/04/2023 - Creacin de preguntas','Hoy creamos las preguntas de las diferentes categoras que tenemos en el videojuego para ya comenzar con el desarrollo de la base de datos.','2023-04-05'),(5625,264,'05/04','Pert y CPM (camino critico)','2023-04-05'),(5626,257,'5/4/2023','Hoy hicimos los diagramas DER, empezamos el de caso de uso, el diagrama de clases, un poco el camba y el foda, adems de elegir los assets de unity para el mapa, y repasamos algunos codigos','2023-04-05'),(5627,260,'05/04/23','Estuve viendo videos