racticando cdigo de html, css, js y tambin jsx','2023-04-11'),(5640,261,'11/04/2023','Hoy empece con el circuito del sensor de ultrasonido en Tinkercad todavia no lo termine.','2023-04-11'),(5641,268,'11-04-2023','Hoy despus de hablar con mis compaeros comense con la programacin y el armado del motor en Tinkercad donde logre que funcionara maana continuare en el y le agregare los movimientos y los tiempo.','2023-04-11'),(5642,269,'11/04/2023','Hoy cre el DER en MySQL workbench con sus primaryKeys, y foreingnKeys, y luego realic el cdigo de la estructura de la base de datos.','2023-04-11'),(5643,255,'Da Martes 11/4/2023','Hoy busque cositas sobre Figma y entend mi lugar en el proyecto. Ahora puedo empezar con el diseo meow meow meow meow :3','2023-04-11'),(5644,265,'11-04-2023','Estuve repasando los temas de arduino y los practique en tinkerkat ','2023-04-11'),(5645,260,'11/04/23','Empec el desarrollo del Header del about','2023-04-11'),(5646,266,'11/4 - Rest API ','Hoy me estuve dedicando a las rest api, investigue y documente bastante para poder la prxima clase empezar con el desarrollo de la rest api. ','2023-04-11'),(5647,250,'Dia 10 Miercoles 11/4/2023','Hoy avanzamos el mockup a high fidelity convirtiendolo en codigo css','2023-04-11'),(5648,257,'11/4/2023','Hoy en la daily hablamos de repartir 3 diagramas entre los chicos y yo hice el de caso de uso, lo empec pero falta agregar varias funcionalidades ','2023-04-11'),(5649,253,'Martes 11/04/2023 - Personajes','Hoy solamente vimos una manera de disear nuestros personajes en 3D con Unity.','2023-04-11'),(5650,256,'12/04/23','Corregimos el diagrama de clases (uml)','2023-04-12'),(5651,271,'12/4/23','En el da de hoy, termine mi parte de las preguntas y las respuestas de deportes de la base de datos de nuestro videojuego ','2023-04-12'),(5652,258,'12/04/2023','seguimos trabajando en los diagramas','2023-04-12'),(5653,297,'12/04/23','terminamos toda la documentacin, para luego empezar a programar. ','2023-04-12'),(5654,264,'12/04','Diagrama entidad relacion (Base de Datos)','2023-04-12'),(5655,263,'12/4/23','Sin mucha novedad solo que el kanbat lo termine, hasta que se necesite mas tareas en el proyecto ','2023-04-12'),(5656,255,'Da Mircoles 12 / 4 / 2023','Hoy avanc con Figma y el primer prototipo de la pgina web. :))))','2023-04-12'),(5657,269,'12/04/2023','Hoy solucione todos los problemas del cdigo SQL para que funcione perfectamente y lo puse a prueba. Adems realice varios inserts en cada tabla de la BD.\r\nLuego con el tiempo que me sobr comenc un curso de JavaScript y fui practicando lo que aprenda','2023-04-12'),(5658,268,'12/04/2023','Hoy despues de la charla nos juntamos con el Profe Nahuel para hablar sobre los materiales para el proyecto el informomamos los materiales como los precios y en el resto del dia buscamos informacion y seguimos con la programacion yo con la del motor haciendo que se muevan en adelante y atras.','2023-04-12'),(5659,254,'12/04/2023','Hoy terminamos toda la documentacion y los diagramas para empezar a programar','2023-04-12'),(5660,251,'Investigacin y Pruebas - 12/4/2023','El da de hoy correg el DER de Recetonomicn. Luego, cree un repositorio privado en GitHub, invit a mis compaeros y cre ramas para cada rea del desarrollo de la APP.\r\nLuego, me puse a investigar APIs en PhP, y experiment con el Framework Leaf 3.0.  ','2023-04-12'),(5661,260,'12/04/23','Estuve terminando el header del about y la parte de about, hice 3 secciones y los estilos\r\n','2023-04-12'),(5662,301,'12/04/2023','Hoy seguimos investigando unity y charle con mis compaeros acerca de la utilizacion de blender para crear los personajes y modelar algunas cosas, tambien corregimos un poco el DER\r\n','2023-04-12'),(5663,261,'12/04/2004','Hoy hicimos una lista de los materiales para el proyecto e investigue el cdigo del sensor ultrasnico.','2023-04-12'),(5664,265,'12-04-2023','Hoy estuvimos haciendo una lista de materiales en la que mediamos el presupuesto y estuve viendo videos de como usar el sensor ultrasonico.','2023-04-12'),(5665,266,'12/4 - inicializacion rest api','Durante toda la clase de hoy me dedique a realizar las configuraciones de la res api. cree las ramas correspondiientes y cree algunas funcionalidades de crud. Tambien hice una actualizacion en el BDD que estaba mal. ','2023-04-12'),(5666,267,'12/04/2023','Hoy hicimos una lista de los materiales con su presupuesto y seguimos con el codigo en tinkercad.','2023-04-12'),(5667,252,'Clase 9 - Creacin de pgina','Hoy hice una pgina con React donde mostraba la informacin de diferentes trabajadores (Nombre y apellido, especialidad y la informacin de su trabajo) utilizando Java Script y CSS','2023-04-12'),(5668,273,'Da 13/04/23','Hoy hicimos una daily con el equipo entero y decidimos u tareas realizaramos en el da de la fecha. A cada uno se le asignaron dos tareas, de las cuales se elegira una para hacer hoy. En mi caso, me toc hacer el camino crtico del proyecto, que para eso necesitara revisar el diagrama de Gantt que realic en la clase anterior. Tras hacer el camino crtico, pude deducir cules son las tareas con prioridad y cules se pueden atrasar un tiempo. Al final de todo, se pudo saber la duracin total del proyecto, la cual es de 109 das.','2023-04-13'),(5669,274,'Prototipado de la pgina web','El da de hoy lo que hice fue, como todos los das, hacer una reunin daily, en la cual hablamos acerca de lo que habamos hecho la ltima clase. Una vez que la finalizamos, el project mnager nos encarg a m y a mi compaero hacer el prototipado de la pgina web. Hicimos el prototipado de la pgina que van a ver los administradores. \r\nLo primero que hicimos fue hacer una base y posteriormente, hicimos varios prototipados con distintos colores. Finalmente, optamos por un diseo basado en los colores de la polica de Buenos Aires. Luego buscamos una fuente similar a la de la polica de Buenos Aires.\r\nDespus elegimos un nombre para el proyecto entre todos los integrantes del grupo. \r\nPor ltimo, iniciamos a escribir el cdigo html, basndonos en el prototipado.\r\n','2023-04-13'),(5670,286,'Prototipado de Pgina','Hoy llegamos al aula y empezamos teniendo una daily de 15 minutos contando lo que hicimos, qu haremos y cmo lo haremos. Ms tarde, con mi compaero Christian, empezamos  a buscar los colores de la Polica de la Ciudad de Buenos Aires para hacer el prototipado de la pgina para que la polica pueda ingresar usuario y contrasea y poder entrar. Luego buscamos la pgina web oficial de la Polica de la Ciudad, sacamos una screenshot y la pegamos en Paint, una vez hecho esto, obtuvimos el RGB de los colores bord, celeste y turquesa. Con los colores obtenidos, empezamos a hacer un par de prototipados. Con el grupo nos decidimos por el primero. Despus, nos pusimos a buscar la tipografa de la polica, luego de una ardua bsqueda, encontramos lo que necesitbamos. Al final empezamos a hacer la pgina con css.','2023-04-13'),(5671,293,'Diagrama caso de uso extends y maqueta de pgina web ','continuamos con los diagramas y la maqueta para la pgina de web de tienda de ropa. Terminamos el diagrama de caso de uso extends donde mostramos en funcionamiento del cliente hacia el dueo y tambin la administracin cada uno con distintos funciones y opciones &lt;Extends&gt; y eso es todo lo que hicimos.\r\n\r\n\r\n','2023-04-13'),(5672,279,'Dia 3 de Proyecto','En el da de hoy se avanzo en el proyecto al habernos faltado los daily fui el encargado de hacerlos cada uno con ayuda de los chicos se pudo completar todos siendo por ahora 4 dailys y avanzar un poco con el Foda agregando mas fortalezas como oportunidades y debilidades y como claro amenazas.','2023-04-13'),(5673,272,'Anlisis FODA, Diagrama entidad-relacion y caso de uso','Hoy empezamos con el trabajo sobre el proyecto final, repartiendo las tareas con un Kanban ya creado anteriormente y realizamos el daily, en lo personal pude terminar el anlisis FODA, el diagrama entidad-relacin y el diagrama caso de uso. Por otro lado, mi equipo termin la investigacin de competencia y los requisitos del cliente.','2023-04-13'),(5674,276,'Proyecto PP &quot;Lu\'s shop&quot;: KANBAN - DFD - DER - GANTT','El dia de hoy continuamos trabajando en base le proyecto de las PP, el cual hemos llamado &quot;Lu\'s Shop&quot;, siendo de manera provisoria por el momento. \r\nEmpezamos a realizar aun mas tareas dentro del proyecto, y esas fueron las siguientes:\r\n- Realizamos un KANBAN en Trello, donde volcamos todas las tareas a realizar a lo largo del proyecto, separando las tareas en diferentes secciones tales como los Diagramas, Dailys, Pagina Web, las tareas en Proceso y las Terminadas. Diariamente se ira actualizando mediante se determinen nuevas tareas y se terminen de realizar ciertas tareas.\r\n- Realizamos el Diagrama de Flujo de Datos el ucal consiste en tomar dos actores principales, en este caso Cliente y Vendedor, declarando las acciones de nuestra tienda virtual entre si con el Vendedor que controla la pagina y el cliente que compra dentro de ella, y habiendo dividido el diagrama en 3 niveles (0, 1 y 2), donde mientras mas alto sea el nivel, se explotan las burbujas y se explica de manera mas especifica la accion de cada una. \r\n- Tambien realizamos el Diagrama de Entidad de Relacion, mostrando como interactan las entidades, que en nuestro caso serian vendedor, cliente, producto, venta y comprobante. De este modo, usaremos tal diagrama en forma de base para la base de datos a realizar proximamente. \r\n- Por ultimo empezamos a realizar el diagrama de GANTT, en el cual ingresamos las tareas a realizar y la duracion aproximada (por le momento) que tomaria realizar cada una de ellas a lo largo del proyecto. Este debera ser actualizado diariamente pero ya tenemos una base de las tareas que iremos realizando. \r\nTambien hemos realizado la Daily. ','2023-04-13'),(5675,275,'13/04/23','13/04/23:Pues hoy seguimos el trabajo maso menos por donde lo dejamos  desde el 31/3 la semana pasada no hicimos nada porque no tenamos clase esos das sin embargo algunos de nosotros seguimos trabajando desde casa, lo que hoy hicimos yo fue el diagrama de caso de uso extendido aunque todava me falta terminar su descripcin.\r\nFue algo complicado pero se pudo, no sabra decir tambin segu actualizado los diagramas , GANTT y camino critico','2023-04-13'),(5676,282,'Descarga de cursos y prototipados','Durante el dia de hoy, en conjunto a mi compaero Ledesma, utilizamos la totalidad del dia de clase para realizar la descarga de 5 cursos, los cuales abarcan PHP, Node, Java Spring, React y React Native, lo cual nos llevo practicamente la totalidad de la clase.\r\nEn el tiempo que no estuvimos con esta tarea, analizamos prototipados para administradores en conjunto e incentivamos a mis compaeros a realizar las dailys','2023-04-13'),(5677,278,'Clase N 8 13/04/23','En el da de la fecha realice la correccin de los requerimientos del cliente. Tambin empec a disear la presentacin del proyecto en Canva, nuestra empresa se llama &quot;EcceSoft&quot; y se encarga del desarrollo de software de aplicaciones mviles y paginas webs.','2023-04-13'),(5678,292,'descargas de cursos para desarollar el trabajo','\r\nDurante el dia de hoy, en conjunto a mi compaero Enzo Bartoletti, utilizamos la totalidad del dia de clase para realizar la descarga de 5 cursos, los cuales abarcan PHP, Node, Java Spring, React y React Native, lo cual nos llevo practicamente la totalidad de la clase.\r\nEn el tiempo que no estuvimos con esta tarea, analizamos prototipados para administradores en conjunto e incentivamos a mis compaeros a realizar las dailys, luego de una amplia charla se decidi el nombre del proyecto y se perdieron los datos de las descargas debido a que se apago la computadora\r\n','2023-04-13'),(5679,289,'13/04 Clase 8','Holis, hoy hice lo siguiente:\r\n-El trello colocando las tareas.\r\n-Empezamos a hacer el prototipo de la pagina web. \r\nEso es todo por hoy, muchas gracias!','2023-04-13'),(5680,283,'avance del proyecto','El dia de hoy comenzamos con la daily rutinaria y hablamos sobre lo que hicimos la clase anterior, que haremos esta clase y que vamos a hacer la siguiente. \r\nEn esta misma hablamos sobre como tenemos que dirigir la pagina de juguetes que competencia tenemos como vamos a enfrentarla, buscamos precios sobre los juguetes, etc\r\ntambien hicimos el uso del kanban para dividirnos las tareas entre nosotros 5, Alan teniendo como tarea el prototipado de la pagina. Lucan en cambio hizo la investigacion de la competencia\r\nthiago realizo el Diagrama de entidad relacion, El foda y el Diagrama de caso de uso. nicolas mangialavore hizo el diagrama de camino critico y termino los requisitos del cliente.\r\nYo (Ciro Lobotrico) empece el gantt, los requisitos del cliente, un codigo pre eliminar de la pagina que vamos a usar. al final de dia actualizamos cosas sobre el kanban.\r\n','2023-04-13'),(5681,284,'Bitacora 3','Hoy realic el  analisis Foda , ayude a mis compaeros con sus diagramas , ayude para realizar el.diagarama de caso de uso , y ayude a realizar el diagrama de secuencia.','2023-04-13'),(5682,298,'Clase 6','Investigue acerca de los test unitarios y con mi grupo empezamos con el prototipo de la pgina web.','2023-04-13'),(5683,288,'Octava Clase','Hoy nuestro respectivo compaero de equipo nos ha dado la orden de cambiar nuevamente nuestra idea de trabajo para poder facilitar el proyecto, ya que en la idea anterior no sabemos exactamente cmo codificarlo. De esta manera estuvimos buscando varias ideas de proyectos para realizar, y logramos encontrar en el transcurso del dia varias, de las que mencionar a continuacin; Sistema de seguridad domstica, Aplicacin para el seguimiento de gastos, Plataforma de intercambio de libros,Sistema de riego inteligente, entre otras varias. Entre hoy y maana intentaremos ponernos de acuerdo para decidir por una de las mismas.','2023-04-13'),(5684,290,'Septima','En el da de la fecha lo que hice fue, realizar el diagrama de caso de uso para el proyecto que vamos a hacer sobre una aplicacin movil','2023-04-13'),(5685,294,'Investigacion - Conexion','En el dia de hoy lo primero que hicimos fue realizar la daily de todos los dias, charlando que hacer cada uno en el dia. Luego hice la conexion de fritzing con los componentes e investigue que base de datos tendremos en cuenta en base al proyecto.','2023-04-13'),(5686,296,'Bitcora 3','Hoy nos asignamos los trabajos que bamos a realizar cada integrantante yo empeze con el diagrama de secuencia y tambin ayude un poco a un compaero a hacer el FODA','2023-04-13'),(5687,281,'Dia 8','Hoy realmente nos dimos cuenta de que es muy complicado codificar el proyecto que teniamos pensado hacer ya que es complejo y no nos conviene para nada, ademas de que posiblemente se nos dificulte cada vez mas asi que decidimos juntos que deberiamos cambiar el proyecto aunque todavia no tenemos una idea concreta de que podriamos hacer.','2023-04-13'),(5688,287,'Proyecto PP &quot;Lu\'s shop&quot;: KANBAN - DFD - DER - GANTT','Continuamos trabajando en la base le proyecto de las PP, el cual se llama &quot;Lu\'s Shop&quot;, siendo un ejemplo x ahora\r\nEmpezamos a realizar aun mas tareas para el proyecto, y esas fueron las siguientes:\r\n- Realizamos el Diagrama de Flujo de Datos el ucal consiste en tomar dos actores principales, en este caso Cliente y Vendedor, declarando las acciones de nuestra tienda virtual entre si con el Vendedor que controla la pagina y el cliente que compra dentro de ella, y habiendo dividido el diagrama en 3 niveles (0, 1 y 2), donde mientras mas alto sea el nivel, se explotan las burbujas y se explica de manera mas especifica la accion de cada una. \r\n- Realizamos un KANBAN en Trello, donde volcamos todas las tareas a realizar a lo largo del proyecto, separando las tareas en diferentes secciones tales como los Diagramas, Dailys, Pagina Web, las tareas en Proceso y las Terminadas. Diariamente se ira actualizando mediante se determinen nuevas tareas y se terminen de realizar ciertas tareas.\r\n- Tambien realizamos el Diagrama de Entidad de Relacion, mostrando como interactuan las entidades, que en nuestro caso serian vendedor, cliente, producto, venta y comprobante. De este modo, usaremos tal diagrama en forma de base para la base de datos a realizar proximamente. \r\n- Por ultimo empezamos a realizar el diagrama de GANTT, en el cual ingresamos las tareas a realizar y la duracion aproximada (por le momento) que tomaria realizar cada una de ellas a lo largo del proyecto. Este debera ser actualizado diariamente pero ya tenemos una base de las tareas que iremos realizando. \r\nTambien hemos realizado la Daily. ','2023-04-13'),(5689,295,'Boceto - Avance de Trello - Avance de carpeta de campo','Hoy realizamos la daily de todos los dias. Luego realize el boceto junto a mi compaera victoria (scrum) que respecta con la pagina que utilizaremos en el proyecto con el programa FIGMA. Adems continuamos con el TRELLO completando la trayectoria de las tareas realizadas. Continue completando la carpeta de campo.\r\n','2023-04-13'),(5690,280,'Guia de node','Investigacion de los conceptos de node y como aplicarlos en el trabajo actual teniendo en cuenta los conocimientos manejables\r\nCreacion de base de datos, sus tablas, consultas, conexion con node, conexion a un prototipo de arduino\r\nCreacion de voceto en figma para luego llevarlo a cabo en html css y js (prototipado )\r\n','2023-04-13'),(5691,291,'Avance del proyecto','El dia de hoy comenzamos con la daily rutinaria y hablamos sobre lo que hicimos la clase anterior, que haremos esta clase y que vamos a hacer la siguiente. \r\nEn esta misma hablamos sobre como tenemos que dirigir la pagina de juguetes que competencia tenemos como vamos a enfrentarla, buscamos precios sobre los juguetes, etc. Tambien hicimos el uso del kanban para dividirnos las tareas entre nosotros 5, Alan teniendo como tarea el prototipado de la pagina. Lucan en cambio hizo la investigacion de la competencia Thiago realizo el Diagrama de entidad relacion, El foda y el Diagrama de caso de uso. Ciro empez los requisitos del cliente, el gantt y un prototipo de cdigo de la pgina que usaremos. Yo termino los requisitos del cliente que mi compaero ciro empez y tambin empec el camino crtico.\r\n','2023-04-13'),(5692,285,'Dia 7 en PP','Que logre hacer hoy?\r\n\r\n\r\nEl da de hoy me dediqu a trabajar en mi respectivo grupo haciendo el prototipado rpido en hoja.\r\n\r\nEn que se me complico?\r\n\r\nSe me complico teniendo la idea de que hacer, el diseo de la pgina, el cmo distribuir sus secciones respectivas y que meterle.\r\nTodo esta solucionado, prototipe 3 pgina.\r\nLa de inicio, compra y bsqueda.\r\n\r\nQu estuve investigando?\r\n\r\nInvestigue que es el prototipado rpido, como hacerlo y cmo dividir todo.\r\nInvestigue algunas pginas de compra y venta para tener de base algo para hacer el prototipado de la pgina, ya tengo unas 3 pginas prototipadas y supongo que es todo.','2023-04-14'),(5693,274,'HTML y curso de react','En la presente fecha me agrada informar que hemos continuado con la realizacin del sistio web en conjunto con mi compaero de equipo. Agregamos una imagen en el header y luego agregamos un login para que los administradores puedan iniciar sesion. Al mismo, tiempo pasamos al pendrive los videos del curso de React.','2023-04-14'),(5694,283,'gantt terminado e investigacion de servidor ','El dia de hoy emepzamos haciendo una daily y definiendo lo que hizo cada uno el dia de ayer, que haremos el dia de hoy, etc\r\nComo por ejemplo:El integrante Alan Gonzalez no asisti el da de ayer por intensos dolores estomacales, Lucan hizo la investigacin de competencia, Ciro hizo la prueba de una pgina que al final no se us, empez el gantt, empez los requisitos del cliente y cre la inicializacin el servidor usando MySQL, Thiago hizo el foda, el caso de uso y el DER (Diagrama Entidad Relacin), Nicolas hizo termin los requisitos del cliente, el camino crtico y el diagrama de secuencia.\r\nEl da de hoy se realizo el daily con el equipo hablamos entre nosotros y nos hicimos las Ciro realizar el Gantt y seguir el servidor de MySQL, Alan est boceteando el prototipado rpido de la pgina principal en una hoja de papel cuadriculada, para luego llevarlo al figma. Lucan ayud al compaero Alan a realizar el prototipado rpido.\r\ntermine el diagrama de gantt y luego investigare para elegir un buen servidor para la pagina. ','2023-04-14'),(5708,280,'Node sql y wsl','uso de los modulos de node para hacer conexion a una base de datos en mysql para agregarlo en el proyecto\r\nInvestigacion de Wsl y Wsl2 para el uso de scripts mkweb que permite agilizacion en la creacion y dominio de los proyectos\r\nUso de wsl en debian ','2023-04-14'),(5695,273,'14-04-2023','Hoy 14 de abril empec a aprender ReactJS para hacer la pgina web y la aplicacin de este trabajo. Ya empec a comprender la funcin de este, y con suerte para las proximas dos clases ya podr usarlo a nivel intermedio.','2023-04-14'),(5696,279,'Dia 4 del Proyecto','En el da de hoy estuve haciendo la daily del da de hoy y el del da anterior y despus en el resto del da me ocupe mayormente en la parte de hacer el diagrama de caso de uso de forma detallada completando todo lo posible con todo lo que podra hacer un cliente y el administrador de la pagina por ahora aunque despus en el futuro posiblemente habra cambios en temas de algunas funciones o cambios grandes de como seria todo el proyecto al final.','2023-04-14'),(5697,278,'Clase N 9 12/04/2023','En el da de hoy realice el prototipado rpido en papel de la pagina web. Luego comenc a disear la pagina web , hasta que me di cuenta que necesitaba un logo, entonces, con mi compaero Tobias empezamos a disear uno, lo terminamos y finalmente los colocamos en la pagina web.','2023-04-14'),(5698,292,'continuacion del dia de ayer, descarga de cursos para el trabajo','En el da de la fecha junto a mi compaero Enzo bartoletti reunimos los pendrives para poder descargar los cursos react,php, etc y cuando estbamos por descargarlos el profesor nos pas una pgina donde ver algunos de los cursos gratis y sin la necesidad de descargarlos. Luego con otro profesor nos dijo que podamos hacer el trabajo solo con react y redirigimos el camino del trabajo con unas ideas nuevas que no se nos haban ocurrido como un botn de pnico \r\n','2023-04-14'),(5699,275,'14/04/23','14/04/23: Hoy segu con lo del caso de uso solo que con la descripcin de este, de nuevo actualice los dems diagramas, \r\naparte de eso tambin tuve que cambiar el diagrama de caso de uso  para que este concordara mas con lo que queramos hacer, en la descripcin del caso de uso intente buscar/ hacer una plantilla para esta pero no encontr nada bueno, as que solo use el Word usando tablas.  ','2023-04-14'),(5700,286,'Continuacin de Pgina Web','En el da de la fecha, empec a trabajar con mi compaero de grupo Christian y continuamos con el trabajo de la pgina web que empezamos ayer. Estuvimos averiguando cmo centrar un texto que hay arriba de todo de la pgina. Para continuar, tuvimos que descargar de nuevo el logo de la Polica de la Ciudad ya que ayer no guardamos, seguimos haciendo un div, un rectngulo negro en el medio de la pgina para poner all los input de texto para el nombre de usuario y un input de password para que la persona que quiera ingresar ponga su contrasea.','2023-04-14'),(5701,299,'Hoy','Ayer no pude hacer bitcora porque me tuve que ir por lesin de mueca y hoy solo pude ayudar a mis compaeros al no poder usar un mouse o typear','2023-04-14'),(5702,293,'Diagrama de secuencia y especificacion de caso de uso','Hoy da hicimos el diagrama de secuencia y especificacion de caso de uso.','2023-04-14'),(5703,284,'Bitacora 4','Hoy arranque el prototipado figma de la pagina , estuvimos adelantando los diagramas con mis compaeros , yo finalic los mios ya','2023-04-14'),(5704,298,'Clase 7','Hoy continuamos con el prototipo de la pgina web con Victoria','2023-04-14'),(5705,290,'Octava','