ro proyecto actual se ha vuelto extremadamente complejo y hemos estado reflexionando sobre la posibilidad de iniciar un nuevo proyecto. Con el fin de mejorar nuestras habilidades y conocimientos en programacin, he estado buscando cursos en lnea que me permitan adquirir ms habilidades en cdigo. Sin embargo, me he encontrado con que muchos de estos cursos son costosos o no estn disponibles en este momento.\r\n\r\nDespus de mucho buscar, finalmente encontr un curso llamado &quot;Generacin T&quot;, que ensea HTML, CSS y otros conceptos relacionados. Aunque no estoy seguro de que este curso me sea til para el trabajo que estamos intentando llevar a cabo, me inscrib en l con la esperanza de adquirir nuevas habilidades que puedan ayudar en futuros proyectos.\r\n\r\nA pesar de esto, todava estamos enfrentando un bloqueo creativo y no tenemos muchas ideas sobre qu hacer a continuacin. Me preocupa que no podamos encontrar una solucin pronto y nos quedemos estancados en este punto. Espero que podamos encontrar alguna inspiracin pronto para continuar avanzando en nuestros objetivos.','2023-04-14'),(5714,297,'18-04-23','mire videos relacionados a la creacin del frontend ','2023-04-18'),(5715,264,'18/04','','2023-04-18'),(5716,256,'18/04/23','Hoy comenc con el cdigo de clases en java','2023-04-18'),(5717,260,'18/4/23','Hice condicional el renderizado del header, y empec a hacer responsivle el diseo del about','2023-04-18'),(5718,251,'18/4/2023 - Investigacin de las APIs 2','El da de hoy continu investigando acerca de cmo desarrollar APIs en PhP. Me dediqu a comprender los modelos (basados en la BDD) y los controladores, que servirn ms tarde.','2023-04-18'),(5719,268,'18/04/2023','Hoy despues de charlar con mis compaeros de grupo y con el profesor Nahuel me puse a ponerme al dia con la Carpeta de Campo.','2023-04-18'),(5720,261,'18/04/2023','Hoy hice el codigo del Sensor infrarojo y una parte los motores.','2023-04-18'),(5721,271,'18/4/23','Debatimos junto a mis compaeros Enzo Romanniello, Luis Meza, Emilio Pereira y Valentn Bentos sobre cul podra ser el contexto y el lugar del videojuego.','2023-04-18'),(5722,267,'18/04/2023','Hoy seguimos con el codigo en tinkercad (infrarrojo y motores)','2023-04-18'),(5723,250,'dia 12 Martes 18 14 2023 ','empece el curso de javascript :3','2023-04-18'),(5724,257,'18/4/2023','Hoy nos terminamos de hacer el diagrama de caso de uso, capaz si hay cambios lo actualizamos pero en principio esta','2023-04-18'),(5725,252,'Clase 10 - Creacin de logo del proyecto','Hoy aprovech el da para crear el diseo del logo de DateTy. Cree varias opciones pero de todas esas consult con mi equipo y pudimos elegir la indicada para nuestro proyecto. El logo lleva un simbolo de calendario en color violeta y a su lado lleva escrito DATETY en una buena tipografa que va con el diseo del calendario; de fondo el color negro para hacer combinacin con el violeta del logo.','2023-04-18'),(5726,255,'dia 12 Martes 18 14 2023 ','trabaj arduamente en el mockup high fidelity y termin la home-page ','2023-04-18'),(5727,266,'18/4 documentacin api','Hoy me estuve dedicando a empezar la documentacin de la rest API. Tambin estuve viendo un poco de validaciones y de como autenticar la api, pero luego de mucho debate, voy a retomar ms adelante el tema ','2023-04-18'),(5728,265,'18-04-2023','Estuve viendo tutoriales de como usar el sensor de ultrasonido y a la vez lo testeaba','2023-04-18'),(5729,253,'Martes 18/04/2023 - Personajes','Hoy pensamos en el contexto del videojuego, o sea, como iba a comenzar y terminar. Adems pensamos el diseo del escenario principal y como seran los ambientes.','2023-04-18'),(5730,270,'18/04/2023','El da de hoy nos juntamos con el grupo para discutir sobre el contexto del juego al iniciar el mismo adems y comenzamos a disear el escenario principal con sus plataformas y skylines.','2023-04-18'),(5731,283,'gs1, daily y gantt','Comenzamos el da visitando GS1 para conocer oportunidades de pasanta y la empresa. Esta exp. fue valiosa, ya que nos permiti conocer de cerca el funcionamiento de una empresa y las oportunidades que podramos tener. Por otro lado, hemos concluido nuestra reunin diaria, aunque lamentablemente la mayora del equipo no pudo asistir. Sin embargo, contamos con la presencia de un integrante valioso del equipo, Mangialavore N. Ezequiel. A pesar de la falta de miembros del equipo presentes, logramos avanzar significativamente en nuestras tareas, lo cual fue una gran victoria. &quot;Concluimos diagrama de Gantt para planificar y cumplir objetivos&quot;. &quot;Es importante la colaboracin y comunicacin en equipo para el xito del proyecto. A pesar de las dificultades, seguimos avanzando hacia nuestros objetivos.&quot; En resumen, hemos tenido un da emocionante y productivo aprendiendo sobre la empresa GS1 y avanzando en la planificacin de nuestro proyecto con la finalizacin del diagrama de Gantt. Con nuestro equipo unido y enfocado en nuestros objetivos, seguiremos trabajando juntos para alcanzar el xito en nuestro proyecto.','2023-04-20'),(5732,286,'CSS, HTML de Usuario Web y Pgina Administrador e Interconexin de computadoras mediante servidor','El da de hoy fui a las 2 de la tarde a la empresa GS1 a tener una charla sobre de qu trata la empresa y como se desarrolla, luego de casi una hora volvimos a la escuela a retomar nuestras clases de Prcticas Profesionalizantes y seguir con la pgina web del proyecto. Empec haciendo de 0 la pgina web para los usuarios, codeando en html y css. Ms tarde, mi compaero Enzo Bartoletti, me pas un par de extensiones para el Visual Studio Code para facilitarnos el codeo. Al rato, sub mi progreso de la pgina web de usuario al drive. Luego, con la ayuda de los profesores de la materia, logramos hacer una interconexin entre la computadora de mi compaero Christian y la ma para poder ver en tiempo real los cambios que va haciendo cada uno en los cdigos de html y css. Para finalizar, fui haciendo modificaciones en el css de la pgina de usuario para ver si los cambios los poda ver mi compaero, nos dimos cuenta que todo funcionaba bien y nos pusimos contentos.','2023-04-20'),(5733,292,'Investigacin de las api a utilizar ','Bitacora: \r\nDurante el dia de hoy, en conjunto a mi compaero Ledesma, utilizamos la totalidad del dia de clase para realizar la descarga de 5 cursos, los cuales abarcan PHP, Node, Java Spring, React y React Native, lo cual nos llevo practicamente la totalidad de la clase.\r\nEn el tiempo que no estuvimos con esta tarea, analizamos prototipados para administradores en conjunto e incentivamos a mis compaeros a realizar las dailys','2023-04-20'),(5734,293,'Investigacin de Competencia','hoy inicie la investigacin de Competencia comparando las ventajas y desventajas de nuestra pagina web con las otras\r\n ','2023-04-20'),(5735,274,'Pgina web de administradores','El da de hoy fuimos a una charla que brindaba la empresa &quot;GSI&quot; para conocer las actividades que realizan. Dur aproximadamente 1 hora. Al terminar, volvimos a la escuela a  seguir con nuestras actividades. Lo que hice fue continuar con el login de la pagina de administradores. Tambin comparti los archivos a la pc que utilizaba un compaero, as podamos editar ambos el archivo.','2023-04-20'),(5736,289,'Dia 20/4','Hoy hicimos lo siguiente:\r\nFuimos a la empresa GS1, en la cual nos brindaron una charla sobre las pasantas de la cual haban 2 puestos. Sobre que trataba la empresa y como funcionaba (y un rico te)  Luego de eso volvimos a la escuela e hicimos lo siguiente:  \r\n-Diagrama de Caso de uso\r\nEso es todo por hoy, muchas gracias!\r\n','2023-04-20'),(5737,282,'Charla GS1 / Tareas como Scrum Master y relacionados','Durante la jornada de hoy, hasta las 16:20 estuvimos fuera de la escuela, debido a una charla en la empresa GS1. Al volver, continu con mis labores de scrum master, ayudando y dandole una mano a mi compaero Andres Caceres a realizar los diagramas necesarios para el proyecto. Ademas de esto, colabore activamente con mis compaeros Filippa y Forte a encontrar extensiones utiles para la realizacion del codigo de HTML/CSS/PHP mientras a su vez conectamos remotamente las pc CS-01 y CS-03 para optimizar los tiempos y modos de trabajo, al trabajar el mismo archivo en dos computadoras a la vez, lo cual se logro realizar. Como ultimo punto de la jornada, conseguimos otra API relacionada con los mapas, la cual es de MapBox','2023-04-20'),(5738,278,'Clase N10 20/04/23 ','En el da de hoy concurr a una charla a las 14:00hs a la Empresa GS1 , en dicha charla hablamos sobre las pasantas que se hacen en la empresa, este ao va a haber 2 vacantes , una para la Gestin de proyectos y otra para Trazabilidad. Yo eleg postularme para la Gestin de Proyectos , ya que ,  durante estos aos practicamos mucho sobre la documentacin y los diagramas. Luego de la charla volvimos al colegio y segu con el diseo de la pagina web para nuestro proyecto de control de stock de la empresa de muebles.','2023-04-20'),(5739,277,'Dcima Clase','Hoy empezamos el trabajo tarde ya que salimos de excursin, finalmente nos decidimos por un proyecto, vamos a llevar a cabo una pgina web para la venta de impresiones 3D. Hoy estuvimos haciendo la pgina principal y buscando modelos 3D para imprimir, adems de aprender a hacer nuestros propios modelos en el programa de Blender.\r\n	Tambin estamos buscando maneras de hacer nuestra pgina ms llamativa que las dems.','2023-04-20'),(5740,279,'Dia 5 del proyecto','En este da estuve trabajando mayormente en los diagramas y adems de hacer el daily del da de hoy aunque al final estuve haciendo mayormente la parte del diagrama del caso de uso extendido donde tuve que hacer varias tablas de Word y empezar a llenar estas con las informaciones necesarios del caso de uso usando el caso de uso que yo haba hecho.','2023-04-20'),(5741,284,'Bitacora 5','Hoy tuvimos la visita a la empresa GS1 , nos hablaron sobre la trazabilidad  y la gestion de proyectos , eramos 2 cursos , nos explicaron sobre los 2 temas y nos dijeron que van a realizar 2 pasantias , es decir que hay 2 bacantes , para cualquiera,  yo me postule para gestin de proyectos,  luego volvimos al colegio , y seguimos con los diagramas , y con la pagina web','2023-04-20'),(5742,288,'Decima Clase','Hoy finalmente logramos ponernos de acuerdo en un proyecto emocionante y novedoso: una pgina web para la venta de productos creados con impresora 3D. Yo fui el responsable de crear la pgina web y trabaj con mis compaeros para seleccionar las imgenes y fijar los precios de los productos. Estamos muy entusiasmados de tener este proyecto en marcha y estamos considerando agregar descripciones detalladas de los productos para mejorar las ventas y seguir avanzando. Me siento orgulloso de haber contribuido a este proyecto y seguir trabajando con mi equipo para hacer que nuestra pgina web sea la mejor.','2023-04-20'),(5743,290,'Novena','En el da de la fecha fuimos a una empresa y nos hablaron sobre lo que se haca dentro de ella en modo de presentacin, luego en el colegio hice el diagrama que me corresponda en mi grupo','2023-04-20'),(5744,298,'Clase 8','Hoy empezamos a hacer los diagramas, con Vicky estuvimos haciendo el de caso de uso. La clase que viene empezamos con el de secuencia.','2023-04-20'),(5745,275,'20-04-2023 ','ok para empezar lo que queria hacer hoy era terminar el camino critico, lo cual no pude porque primero se tiene que tener el Diagrama GANTT hecho, me dispuse a terminar dicho diagrma, al final pude terminarlo para empezar con el otro, no llegue al terminar el diagrama critico aunque bueno de igual modo tendre que actualizar estos dos diagramas constantemente (Cabe recalcar que hoy tuvimos poco tiempo como 2 horas de clase nomas porque tuvimos una charla empresarial).','2023-04-20'),(5746,281,'Dia 9','Hoy empezamos a trabajar un poco tarde ya que tuvimos que entrar a las 3:40 porque los profes se habian ido de excursin. Tuvimos la gran idea de empezar a encaminar nuestro proyecto a que sea una pagina que venda cosas hechas por una impresora 3d ya que un integrante del grupo posee una y podriamos recrear las cosas que pongamos en la pgina. Los objetos van desde llaveros hasta esculturas de series, pelculas, animes etc. Ya avanzamos bastante con la pgina falta disearla un poco mas pero creo que estamos en buen camino','2023-04-20'),(5747,280,'tareas','Desarrollamos la aplicacion de agilizacion para el proyecto asi extraer todos los archivos en la mayor brevedad posible\r\nDesarrollo del diagrama de gantt y el diagrama de secuencia tomando de base el orquestado en mysql\r\nDesarrollo de los primeros comando en la app del proyecto\r\nAsistencia a la empresa Gs1 para una charla de orientacion profesional y posibles pasantias las cuales se decidiran a traves de examenes en la cual tenemos las opciones de trazabilidad(linea de tiempo sobre objetos) y gestion de proyectos(Todo lo referente a la documentacion)','2023-04-20'),(5748,295,'Visita a empresa GS1 - Diagrama de flujo de datos','El da de hoy fuimos a la empresa de GS1 en la cual nos hablaron sobre dos puestos de pasantas y de que sea trataba cada uno, y las tareas que se tendran que realizar, adems de la explicacin de lo que se trata la empresa. Al volver a la escuela junto a mi compaero empezamos a realizar el diagrama de flujo de datos.','2023-04-20'),(5749,276,'Proyecto &quot;Lus Shop&quot;: Diagrama Secuencia - Diagrama de Colaboracion - Investigacion de Competencia - Boceto Pagina Web a mano y Maqueta Software','El dia de hoy seguimos trabajando en base al nuestro proyecto en las PP, y esas son las siguientes:\r\n- Para empezar terminamos de realizar los Diagramas de Secuencia y de Colaboracion. Asi mismo aun quedan pendientes ciertos diagramas que por lo tanto seguirn en proceso.\r\n- Empezamos con la investigacion de la competencia, de modo que podamos ver las diferencias entre nuestra pagina web y las demas paginas que ofrecen los mismos servicios que la nuestra, esto para poder ver factores con los que cuenta nuestra pagina en especial, y demas factores con los que no contamos\r\n- Por ultimo, seguimos realizando el boceto a mano de la pagina web, y a su vez, seguimos realizando la Maqueta Software de modo de dar un ejemplo del diseo de nuestra pagina web.\r\nEso fue todo por hoy. ','2023-04-20'),(5750,291,'Avance de proyecto','El da de hoy empezamos las Prcticas Profesionalisantes tarde por que algunos alumnos tuvieron una excursin a la empresa GS1, entramos 15:45 porque ellos se fueron a las 14:00 y volvieron a las 15:45, tambin terminamos el Diagrama de Gantt, el Diagrama de secuencia, el Test de unitarios, y el desarroll. Fue un da muy productivo para el poco tiempo que tuvimos.','2023-04-20'),(5751,287,'Proyecto &quot;Lus Shop&quot;: Diagrama Secuencia - Diagrama de Colaboracion - Investigacion de Competencia - Boceto Pagina Web a mano y Maqueta Software','El dia de hoy seguimos trabajando en base al nuestro proyecto en las PP, y esas son las siguientes:\r\n- Para empezar terminamos de realizar los Diagramas de Secuencia y de Colaboracion. Asi mismo aun quedan pendientes ciertos diagramas que por lo tanto seguirn en proceso.\r\n- Empezamos con la investigacion de la competencia, de modo que podamos ver las diferencias entre nuestra pagina web y las demas paginas que ofrecen los mismos servicios que la nuestra, esto para poder ver factores con los que cuenta nuestra pagina en especial, y demas factores con los que no contamos\r\n- Por ultimo, seguimos realizando el boceto a mano de la pagina web, y a su vez, seguimos realizando la Maqueta Software de modo de dar un ejemplo del diseo de nuestra pagina web.\r\nEso fue todo por hoy. ','2023-04-20'),(5752,294,'Visita a empresa GS1 argentina - Creacion diagrama flujo de datos','En el dia de hoy con la mitad del curso que se anoto fuimos a la empresa GS1 y tuvimos una charla en base a 2 puestos de trabajo como pasante con todos los requisitos y propuestas. \r\nCuando volvimos a la escuela realize con mi compaera un diagrama de flujo de datos que respecta al proyecto planteado con sus niveles respectivos.','2023-04-20'),(5753,273,'Clase 20-04-2023','En el da de la fecha realizamos una daily y hablamos sobre las tareas a realizar. En mi caso, yo segu viendo el tutorial sobre cmo usar ReactJS.','2023-04-20'),(5754,299,'Hoy','En la reunin de hoy, concluimos el diagrama de Gantt y avanzamos en el\r\nprototipado rpido de la pgina, prxima fase del proyecto. El equipo ha trabajado\r\narduamente para finalizar el prototipado y pasarlo a Figma, una herramienta til para\r\nel diseo de interfaces. Mangialavore ha completado los ltimos diagramas,\r\npermitiendo una perspectiva detallada del proceso de desarrollo. Por otro lado,\r\nLobotrico ha comenzado el desarrollo del servidor de la pgina, tarea crucial para su\r\ncorrecto funcionamiento. A pesar de obstculos, el equipo avanz','2023-04-21'),(5755,283,'figma, diagramas y base de datos','Iniciamos etapa importante en proyecto: identificacin de camino crtico y creacin de diagrama flujo, esencial para planificacin efectiva y cumplimiento de tiempo y forma. Hemos tomado decisiones importantes sobre recursos y herramientas para la creacin de la pgina. Se eligi un servidor adecuado para el proyecto. Hemos optado por utilizar Java, CSS y HTML para crear una pgina web atractiva, funcional y eficiente. Es importante destacar que la eleccin de recursos y herramientas es crucial para el xito del proyecto. Por ello, hemos analizado cuidadosamente y elegido las ms adecuadas para cumplir con nuestros objetivos. En la prxima fase del proyecto, seguiremos trabajando en el diagrama de flujo y la implementacin de las herramientas seleccionadas. \r\nMejoramos el diagrama de entidad - relacion para posterior poder continuar con la base de datos. tambien luego seguiremos con el prototipado de la pagina de figma. \r\n','2023-04-21'),(5756,272,'Figma de la pgina web','El da de hoy comenc a realizar el diseo de la pgina web en Figma, para su posterior realizacin en HTML. Importando libreras de la misma pgina para utilizar iconos y as complementar la misma.','2023-04-21'),(5757,278,'Clase N 11 21/04/23','En el da de hoy me dedique a seguir con la pagina web , primero prob colocando un offcanvas a modo de men pero finalmente no me convenci, por lo que inserte 2 cards en los cuales se va a encontrar el inventario de la empresa. Tambin cambiamos el color de la pagina, antes era de color bordo y crema pero ahora decidimos hacerla de color gris con negro.','2023-04-21'),(5758,286,'Charla sobre GitHub, Intento de interconexin de computadoras y HTML y CSS de Usuario Web','El da de hoy empez con una charla de scrum master (Enzo) sobre github, nos enseaba una forma para que cada uno pueda subir las tareas que realizamos en el da de una forma ms organizada. Al terminar esta charla intentamos, con mi compaero Christian y uno de los profesores, hacer la interconexion entre dos computadoras para que podamos trabajar conjuntamente y de una manera ms rpida, al no poder realizar esto, segu haciendo la pgina web del usuario, cambiando colores, ajustando tamaos, cambiando la fuentes de las letras, agregando checkboxs, etc.','2023-04-21'),(5759,292,'Investigacin de apis, que result fallido','En el da de hoy me dedique a pleno a la investigacin de las apis restantes para el mapa del proyecto con la supervisin de mi compaero Enzo bartoletti, luego de separar las ms relevantes y que nos eran tiles nos dimos cuenta de que no eran gratis ya que mapbox solicitaba una tarjeta de crdito y por eso todo lo investigado fue sin sentido y volvimos desde 0. La prxima clase probaremos con otras opciones como openlayers y leaflet.','2023-04-21'),(5760,282,'Investigacion de APIs','En el da de hoy prosegu con la investigacin de la API para el mapa relacionado con el proyecto, el cual investigamos y separamos lo mas relevante para nuestro proyecto.  Pero al querer descargar dichos mdulos, la pagina MapBox solicitaba una tarjeta de crdito, lo cual no tenemos ni queremos poner. Por lo cual en la prxima semana probaremos otras dos alternativas de APIs, Openlayers y Leaflet. Adems intentamos realizar como el da anterior la conexin entre las pcs de Forte y Filippa, ademas de darle una mano a Caceres con los diagramas','2023-04-21'),(5761,284,'Bitacora 6','Hoy continue y finalice con los diagramas , ayude a mi compaero a finalizar el figma de la pagina web , y ayude a otro compaero con la pagina web , estuvimos haciendo rotoques ','2023-04-21'),(5762,296,'Bitcora 5','Hoy termine de hacer el prototipado de la pgina web en mviles y ayude a mis compaeros con un tema de diagramas y con la pgina web en si','2023-04-21'),(5763,291,'Avance de proyecto','El dia de hoy realice y termine el Camino crtico, el cual pude realizar ya que tena a mi disposicin el  Diagrama de Gantt para poder guiarme con la duracin de cada tarea y el orden de estas, tambin realice el Diagrama de secuencia el cual no saba hacer pero gracias a mi compaero Ciro al cual pregunt como se tena que realizar y despus de una breve explicacin pude realizarlo y completarlo.','2023-04-21'),(5764,273,'Clase 21-04-2023','En el da de la fecha segu viendo el tutorial de ReactJS.','2023-04-21'),(5765,293,'Correccin de diagrama entidad de relacion avance investigacin de competencia ','hoy da correg el diagrama entidad de relacion pero no logre terminarlo y sobre la investigacin ya esta completa','2023-04-21'),(5766,293,'Correccin de diagrama entidad de relacion avance investigacin de competencia ','hoy da correg el diagrama entidad de relacion pero no logre terminarlo y sobre la investigacin ya esta completa','2023-04-21'),(5767,293,'Correccin de diagrama entidad de relacion avance investigacin de competencia ','hoy da correg el diagrama entidad de relacion pero no logre terminarlo y sobre la investigacin ya esta completa','2023-04-21'),(5768,279,'Dia 6 del Proyecto','En este da estuve mayormente siguiendo con completar el caso de uso extendido agregando mas tipos de casos de 