para as poder trabajar con distintas partes del cdigo al mismo tiempo.','2023-04-21'),(5776,253,'Martes 25/04/2023 - Carpeta de Campo','Hoy el profe nos dijo que le metiramos a la carpeta de campo porque ya se acercaba la entrega del 1er bimestre. As que hoy yo me puse en el da con la carpeta de campo.','2023-04-25'),(5777,254,'25/04','Sigo con la carpeta de campo y termino a bdd','2023-04-25'),(5778,271,'25/4/23','En el da de la fecha. Comenc mi carpeta de campo en la cual el objetivo es llegar a 50 paginas aproximadamente, e informar sobre nuestro trabajo en la carpeta de campo de como va nuestro proyecto, ademas de contar un poco de que se trata nuestro proyecto','2023-04-25'),(5779,257,'25/04/2023','Hoy nos pusimos de acuerdo con nuestro grupo a hacer las carpetas en llamada, en aprender a hacer blueprints y hacer en lan el proyecto ','2023-04-25'),(5780,262,'25/05/23','EL da de hoy realizamos un dayli para charlar como encaminar el proyecto ya que un compaero se lesiono y no podr asistir al colegio unas clases, despus por otra parte tuvimos una charla con el profesor con el tema de la carpeta de campo y cerramos algunas dudas y tips que nos dio para poder completar de manera correcta la carpeta de campo y a continuacin con esa informacin pusimos como prioridad la carpeta de campo el da de hoy','2023-04-25'),(5781,258,'25/4','hoy teste aver si nos deja importar el proyecto que tengo echo (osea la planta baja) del juego','2023-04-25'),(5782,301,'Agustin Barcia','Hoy empece a estudiar  unity blueprint para hacer el diagrama de comportamiento de  nuesstro juego','2023-04-25'),(5783,268,'25/04/2023','En la fecha de hoy agrege y mejore la carpeta de campo ademas de ayudar y aconsejar a mi grupo como a mis compaeros de curso.','2023-04-25'),(5784,259,'Martes 11/4 ','Hoy ya termine el DER, aadiendole ya las conexiones y de ultima algunas Foreign Key en otras tablas restantes. Para ya la clase siguiente empezar con todo la Base de Datos','2023-04-25'),(5785,297,'25/04/23','Actualice mi carpeta de campo y segu viendo videos relacionados a lo que me corresponde del proyecto ','2023-04-25'),(5786,265,'25-04-2023','Hoy estuve haciendo la carpeta de campo y revisando las bitcoras anteriores para recordar que fue lo que hice.','2023-04-25'),(5787,256,'25/04/23','Ayer 24/04 busque referencias para el cdigo de Java.\r\nHoy comenc la carpeta de campo ','2023-04-25'),(5788,251,'Investigacin de las APIs 3 - 25/4/2023','El da de hoy continu trabajando con la API de prueba de PhP. Cre mtodos para conectarse con la BDD y tomar todos los registros por una tabla y acceder a un registro especfico por su ID, pero sin limpiar los datos an.','2023-04-25'),(5789,252,'Clase 11 - Creacin del Login','Hoy cree el Login para nuestro proyecto DateTy, para eso necesite crear 3 inputs, uno para el nombre, otro para la contrasea y un checkbox por si queres mostrar la contrasea. Pero crear 3 inputs diferentes, y teniendo que asignarle un estilo a cada uno, cree un componente Input el cual abarca a todos los inputs que hayan en el cdigo. Esto permite que todos tengan los mismos atributos asignados, pero tambin te permite modificar cada uno a tu gusto en el Login o cualquier otra clase que necesites de un Input','2023-04-25'),(5790,263,'25/4','Hoy el profe nos pregunto sobre como iba nuestro proyecto, estuvimos hablando mas que nada de los diagramas y de la inteligencia artificial que tendr nuestro juego y arreglamos de que tendremos que hacer estos diferentes diagramas que representaran diferentes partes de nuestro juego estos diagramas luego tendrn que ser interpretados y pasados a codigo que utilizara el juego para ejecutar las diferentes partes.\r\n\r\n','2023-04-25'),(5791,250,'25 4 2023 martes dia 12','hoy no hice nada :33','2023-04-25'),(5792,267,'25/04/2023','Hoy me dediqu a hacer la carpeta de campo.','2023-04-25'),(5793,260,'25/04/23','Hicimos un pull del about y tuve unos errores por descuidos mios, ya estan solucionados y creamos un componente input',