ion de el metodo login y de todos los de usuarios. Durante toda la clase termine todo y pude hacer el pull request y el merge a la rama de apiRest. Tambien estuve ayudando a todo el equipo de frontEnd con diferentes Funcionaldiades.','2023-04-26'),(5815,267,'26/04/2023','Termin el sensor de ultrasonido y corregimos el modelo 3D aadiendo el protoboard.','2023-04-26'),(5816,303,'26/04/2023','Hoy vimos cursos sobre blueprint, para poder usarlo en unity.Adems charlamos sobre la posibilidad de utilizar realidad virtual en el proyecto. ','2023-04-26'),(5817,270,'26/04/23','El dia de hoy finalizamos mas o menos el escenario principal del juego ya colocando el terreno, skybox y las plataformas para lo que seria el hospital donde comenzar el juego.','2023-04-26'),(5818,261,'26/04/2023','hoy hice el codigo completo del sensor infrarojo, comense a unir todos los codigos de los materiales del proyecto y tambien cambie el diseo 3D agregando el protoboard.','2023-04-26'),(5819,283,'Diagrama entidad-relacion, figma, base de datos.','\r\nno pudimos avanzar en algunas cosas como el prototipado para ya empezar a hacer la pagina o avanzar con la base de datos. todo esto se debe a la falte de un ontegrante que tenia \r\nel prototipado para hacer la pagina. Pero igualmente pudimos avnzar con el diagrama de entidad relacion para poder terminar de una vez con la base de datos. \r\nEl dia de maana seguiremos con la pagina y el armado de la base de datos para ya ternibar el armado del proyecto. luego conectarla pagina cpon php y mmysql. ','2023-04-27'),(5820,292,'Carpeta de campo y api','Bitcora:\r\n En el da de hoy junto a mi compaero Enzo bartoletti comenzamos la clase buscando y descargando mapas apis para nuestro proyecto pero no llegamos a probarlos debido a que no haba wifi. Luego proced a ayudar a mi compaero Enzo con su bitcora y contine haciendo la ma con ayuda de la carpeta de campo de mo compaero y debido a que el profesor nos inform que deba ser formato norma apa tuve que cambiar la mayora','2023-04-27'),(5821,285,'Dia 9 en PP','Que logre hacer hoy?\r\n\r\nHoy se logro completar el diagrama entidad relacin y avanzar en la base de datos del proyecto en conjunto con mi grupo durante la sesin de trabajo.\r\n\r\nEn que se me complico?\r\n\r\nNo pudimos avanzar en algunas cosas como el prototipado para hacer la pgina o avanzar la base de datos debido a la falta de un integrante del grupo que tiene el prototipo hecho en figma.\r\n\r\nQu estuve investigando?\r\nNo estuve investigando nada en particular ya que me dediqu a avanzar en la parte del proyecto que me corresponda.\r\n','2023-04-27'),(5822,285,'Dia 9 en PP','Que logre hacer hoy?\r\n\r\nHoy se logro completar el diagrama entidad relacin y avanzar en la base de datos del proyecto en conjunto con mi grupo durante la sesin de trabajo.\r\n\r\nEn que se me complico?\r\n\r\nNo pudimos avanzar en algunas cosas como el prototipado para hacer la pgina o avanzar la base de datos debido a la falta de un integrante del grupo que tiene el prototipo hecho en figma.\r\n\r\nQu estuve investigando?\r\nNo estuve investigando nada en particular ya que me dediqu a avanzar en la parte del proyecto que me corresponda.\r\n','2023-04-27'),(5823,276,'Lus Shop: &quot;VicSon&quot; - Boceto Pagina Web a mano -  Maqueta Web - Codificacion Pagina Web','El dia de hoy seguimos trabajando en base a nuestro proyecto de las PP, las tareas que realizamos fueron las siguientes:\r\n- Habiendo finalizado el Boceto de Pagina Web a Mano, y habiendo diseado distintas pestaa en papel, hemos podido terminar de realizar la Maqueta Software, habiendo hecho un diseo mucho mas definido sobre las pestaas en si, ademas de las pestaas de inicio y de la seccion ya realizadas, diseamos mas sobre la pestaa de login, tambien agregando un diseo de una pagina de registro de cuenta, una pestaa donde se muestran los detalles de los productos, la pestaa del carrito de compras y ciertas pestaas a la hora de realizar la compra y abonar, junto con un 