n&quot; - Boceto Pagina Web a mano -  Maqueta Web - Codificacion Pagina Web','El dia de hoy seguimos trabajando en base a nuestro proyecto de las PP, las tareas que realizamos fueron las siguientes:\r\n- Habiendo finalizado el Boceto de Pagina Web a Mano, y habiendo diseado distintas pestaa en papel, hemos podido terminar de realizar la Maqueta Software, habiendo hecho un diseo mucho mas definido sobre las pestaas en si, ademas de las pestaas de inicio y de la seccion ya realizadas, diseamos mas sobre la pestaa de login, tambien agregando un diseo de una pagina de registro de cuenta, una pestaa donde se muestran los detalles de los productos, la pestaa del carrito de compras y ciertas pestaas a la hora de realizar la compra y abonar, junto con un diseo de factura.\r\n- Por otro lado, aun seguimos trabajando en base a la codificacion de la pagina de Inicio, la cual por el momento esta quedando bastante similar a la de la Maqueta Software. \r\n\r\nPor otro lado, seguimos realizando y actualizando ciertos diagramas.\r\n','2023-04-27'),(5829,275,'Examen GS1 y documentacin de caso de uso ','Pues bueno, hoy lo que yo hice fue aparte de tener un examen de la empresa GS1 fue hacer la documentacin del diagrama de uso, lo del examen fue una gestin de proyecto pues lo que me peda era ordenar un grupo de tareas en el orden que me pareciera y documentar porque lo haca de esta manera.','2023-04-27'),(5830,284,'Bitacora 7','Hoy realice la prueba de la empresa gs1 , la verdad fue sencillo , nada complicado , y luego realic algunos diagramas para adelantar el proyecto','2023-04-27'),(5831,299,'Hoy','Hoy hicimos el prototipado de pgina y corregimos diagramas a pesar de la falta de Internet en las maquinas','2023-04-27'),(5832,295,'Diagrama de flujo de datos - Prototipado app movil','En el dia de hoy termine el diagrama de flujo de datos junto a mi compaero y empezamos con el prototipado de la aplicacion mvil, mientras vea la capacitacin de cansat \r\n\r\n','2023-04-27'),(5833,282,'Tareas de scrum master y diseo de la pagina web','Durante la jornada de Practicas Profesionalizantes realic varias actividades relacionadas con el proyecto; mi primera medida del da fue charlar con Caceres acerca de la realizacion de los diagramas correspondientes y los avances en relacion a la semana anterior.\r\nAdemas se le solicit a todos los alumnos la adaptacion de la carpera de campo a las normas APA, lo cual ya realic.\r\nEn materia de las visuales del proyecto, prosegu con los prototipados post login para los administradores en conjunto a mi compaero Christian Forte y adems de lo anteriormente mencionado realic avances en el html del login en conjunto con mi compaero Manuel filippa','2023-04-27'),(5834,280,'Capacitacion ','Se realizo paralelo al proyecto una capacitacion de cansat q incluye aprendizaje de arduino\r\nSe hizo un prototipo funcional del sql y node\r\n','2023-04-27'),(5835,279,'Da 7 del proyecto ','En el da de hoy al final pude terminar el diagrama de caso de uso extendido y la verdad qued la mayora de diagramas hechos o algunos en proceso ya que me falta informacin o parecido as que estn en proceso y despus tambin le coment a Enzo de que si quera seguir con un trabajo me faltaba como sera la forma de que se mostrara para el administrador de la pgina al logearse a lo que empezaron a hacer eso y despus no hice mucho ms al tener todo al da solo la daily','2023-04-27'),(5836,290,'Decima','En el da de la fecha realice la evaluacin de la pasanta gs1 sobre gestin de proyecto ','2023-04-27'),(5837,294,'Finalizacion Diagrama de flujo - Prototipado Rapido App Movil','En el da de hice la retocada final al diagrama de flujo de datos que habia hecho la semana pasada y empezamos junto a mi compaera el prototipado rapido de la apicacin mvil. Ademas mientras haciamos esto, estuvimos viendo el vivo en youtube sobre la capacitacin de CANSAT Argentina que es un proyecto aparte que tenemos en la escuela.','2023-04-27'),(5838,274,'Carpeta de campo, Prototipado post login de administradores','En el da de la fecha lo que hice fue aadir ms informacin a mi carpeta de campo, ya que me faltaban algunas fechas. Despes el Project Manager de mi grupo me encarg hacer un prototipado de la pgina que se mostrar una vez que los administradores inicien sesin en la pgina que previamente habamos realizado. En Figma, realic un prototipado el cual contaba con el mismo header y footer de la pgina de login, solo que en lugar del formulario que hay que completar para iniciar sesin, se encuentra una tabla la cual va a contener todos los incidentes que reporten los usuarios. Se podrn agregar y eliminar las consultas.\r\n','2023-04-27'),(5839,286,'CSS y HTML de la pgina de Administrador 2','El da de hoy llegu y descargu todos los archivos HTML y CSS que haba modificado el da de ayer para volver a abrirlos con la aplicacin de Visual Studio Code. Una vez abierto todos los archivos y teniendo todo listo,  me puse a descargar las extensiones de la aplicacin para que me ayuden a codear ms rpido y que el proceso sea ms llevadero. Empec corrigiendo los tamaos del div del centro de la pgina, agrandando los input de tipo text y password, el tamao de la letra de P.D.L.C., saqu los textos de usuario y contrasea y los puse dentro de los input respectivamente haciendo uso del &quot;placeholder&quot;, tambin cambi los bordes del div y del botn que ahora dice &quot;Iniciar Sesin&quot;. Ms tarde ajuste el tamao del footer. Para finalizar el da de trabajo pude encontrar la forma de ingresar y usar la fuente de texto que haba descargado semanas antes, ayudndome con un trabajo prctico que haba hecho hace 2 aos.','2023-04-28'),(5840,283,'base de datos y prototipado de la pagina web en figma','El dia de hoy ayude al prototipado de la pagina web en figma, aadimos un footer, un header, favoritos para que los compradores puedan guardar los items que mas les gusten, logos para la pagina. Luego realice la base de dato dentro de mysql, lo cual primero la quise hacer en la interfaz pero decid hacerlo en cdigo donde cree las 4 tablas con sus respectivas primary key y foreign. La semana que viene voy a terminar de delegar el trabajo para los demas y luego seguir con la base de datos para hacer los respectivos inserts para luego ya en la pgina web poder conectarla con la base de datos con php. ','2023-04-28'),(5841,272,'28/04 Prototipado de pgina principal','Hoy junto a Nicolas Mangialavore terminamos el diseo principal de la pgina, con sus respectivos botones, secciones y funciones. Faltan partes de la pgina tales como el carrito, los tem favoritos de la pgina, una barra de bsqueda funcional y la funcin de registrarse e iniciar sesin en la pgina.\r\nDe momento lo realizado es una tarjeta de tem disponibles o novedosos, seccin de ofertas y destacados, sin olvidar el header y footer de la pgina principal. ','2023-04-28'),(5842,291,'Avance del proyecto','El da de hoy empezamos realizando la daily la cual fue corta porque faltaron la mayora de integrantes de nuestro grupo pero afortunada mente un compaero ms se nos uni a la clase tarde. Este da empezamos a progresar con el ptrototipado figma la cual no pudimos avanzar la clase anterior debido a que el compaero que lo cre falto por algunos problemas, empeze investigando como funcionaba el figma porque es la primera vez que lo uso, pero afortunadamente el compaero que se nos uni tarde sabia como usarlo y me ayud a entender como usar figma, agregamos iconos de redes sociales de la pagina, tambien agregamos una seccin de ofertas y creamos otra parte de la pgina con su header y footer correspondiente y a esa nueva parte de la pgina pusimos una seccin de destacados, el da de hoy avanzamos un montn a comparacin del dia anterior.','2023-04-28'),(5843,279,'Dia 8 del Proyecto','En el da de hoy estuve ahora maso menos haciendo el trello via en GitHub as para tener una idea de como se organiza eso si lo tuve que hacer en la cuenta de GitHub de Enzo al ser quien lo creo y despus estuve haciendo los requerimi