890,265,'03-05-2023','hoy estuve haciendo el logo y nombre del equipo utilizando una pagina y el programa After Effects','2023-05-03'),(5891,262,'03-05-2023','El da de hoy instale nuevamente el Unity HUB y  el Blender en las computadores nuevas, ya que ayer nos cambiamos de laboratorio y no estas computadores no tenan los programas que necesitamos para el proyecto. Luego de terminar instalar los programas me puse  a realizar bocetos del juego ya que quedaba poco tiempo de trabajo.','2023-05-03'),(5892,280,'No salida a la uba','El dia de hoy se realizo un curso sobre javas script y node donde se plasmaron conceptos basicos tales como:\r\nCreacion de clase\r\nCreacion de objetos\r\nAtajos dentro de javascript\r\nInstalacion y manejo de paquetes en node\r\n\r\nJunto con eso se actualizo el diagrama de gantt colocando la sultimas tareas realizadas y a realizar junto con la creacion de otro diagrama de gantt el cual evalua el desarrollo semanal y no el del todo el proyecto\r\nSe realizo una daily individual ya que los compaeros de trabajo acudieron a una charla en la Facultad de Ciencias Exactas','2023-05-04'),(5893,279,'Dia 9 del Proyecto','En este dia estuve no haciendo mucho si no mas bien haciendo algunas modificaciones al caso de uso extendido y los requerimientos ademas de hacer la daily de hoy y despues en toda la clase estuve viendo de aprender a usar HTML','2023-05-04'),(5894,293,'Uba ciencias exactas','Hoy da fuimos a la universidad uba de ciencias exactas dnde nos explicaron toda la info','2023-05-04'),(5895,285,'Dia 10 PP - Salida a la UBA ','Qu logr hacer hoy?\r\nHoy asist a una charla sobre ciencias de la computacin en la Universidad de Buenos Aires. Me registr temprano y tuve la oportunidad de conocer a otros asistentes. Durante la charla, aprend mucho sobre la historia y evolucin de la informtica, as como tambin sobre los desafos actuales en la industria de la tecnologa.\r\n\r\nEn qu se me complic? \r\nNo experiment ninguna complicacin durante la charla. Fue una experiencia muy agradable y bien organizada.\r\n\r\nQu estuve investigando? \r\nEstuve investigando sobre la ciencia de la computacin y su impacto en diferentes reas de la vida, as como tambin sobre los desafos actuales en la industria de la tecnologa. Tambin aprend sobre la inteligencia artificial y el aprendizaje automtico. Adems, investigu sobre cmo los cientficos de la computacin estn trabajando para superar estos desafos y mejorar la tecnologa en el futuro.\r\n','2023-05-04'),(5896,274,'Salida a la U.B.A.','En el da de la fecha tuvimos una salida a la Facultad de Ciencias Exactas y Naturales de la Universidad de Buenos Aires. Ah nos dieron una charla acerca de las carreras que se dictan en esa facultad. La misma tuvo una duracin aproximada de 2 horas.','2023-05-04'),(5897,283,'Salida a la Ciudad Universitaria de Buenos Aires','Hoy asist a una charla sobre ciencia de la computacin en la UBA en el saln de conferencias de la facultad de ciencias exactas y naturales. Los organizadores dieron la bienvenida y presentaron al orador principal, un reconocido profesor de ciencias de la computacin, quien habl sobre la historia y evolucin de la informtica. Luego, explic cmo la computacin ha impactado en diferentes reas de la vida. Como drones, autos autnomos o agilizacin de procesos. La charla fue interesante y educativa. Despus de la charla, hubo una sesin de preguntas y respuestas donde pudimos hacerle preguntas al orador principal.','2023-05-04'),(5898,282,'Charla en UBA - Licenciatura en ciencias de la computacion','En la tarde de hoy, en conjunto a 6 1 asistimos a un encuentro en el pabelln cero mas infinito de la UBA, ubicado en ciudad universitaria. Este encuentro duro dos horas y media y relato los aspectos mas importantes de la carrera de Licenciado en ciencias de la computacin, dictada en este espacio. Esta charla explico acerca de las materias presentes en el plan de estudios, nos invito a pensar si en distintas problemticas se podra aplicar la computacin y los campos de trabajo donde esto se puede aplicar.','2023-05-04'),(5899,292,'charla en la uba','en el da de la fecha no asistimos a la jornada de practicas profesionalizantes debido a que asistimos en conjunto con los dems compaeros de 6 segunda a una charla sobre la carrera de licenciatura en ciencias de la computacin en  la facultad de ciencias exactas en la ciudad universitaria pabelln 1, la charla duro aproximadamente 2 horas y media en la cual se nos comentaba las problemticas, una visin sobre que trataba la materia junto con los objetivos a alcanzar, la cantidad de materias que debamos rendir y de que manera, donde tenamos que asistir, se nos dijo que para asistir a la facultad primero debamos realizar el correspondiente cbc.','2023-05-04'),(5900,286,'Charla sobre la carrera de Ciencias de la Computacin','Hoy luego de terminar la materia de Educacin Fsica me fui con mis compaeros de clase directamente a Ciudad Universitaria, donde entramos al pabelln o + ? donde recib una charla sobre qu es la Ciencia de la Computacin y qu veremos en esa carrera si es que la elegimos. Luego de una introduccin y una explicacin de toda la carrera, hablando sobre las materias, las cantidad de aos que dura la carrera, los lenguajes de programacin que veremos y un montn de cosas mas, con una duracin de 2 horas y media, concluy la charla y realic un cuestionario sobre la charla que recibimos. Al terminar esto, volv a la escuela.','2023-05-04'),(5901,289,'4/5','El da de hoy, el curso concurrimos a la universidad de ciencias exactas y naturales. Fuimos para una charla informativa de licenciatura de ciencias de la computacin. Fue una carrera interesante, pero no creo seguirla.\r\nEso fue todo por hoy, muchas gracias!!! ','2023-05-04'),(5902,295,'Charla en la UBA de Ciencias de la Computacin ','En el da de hoy fuimos a la facultad de UBA exactas en donde nos hablaron sobre la carrera de Licenciatura en Computacin, que se trata de como resolver gracias a la computacin  problemas cotidianos de la vida, tambin nos mostraron la comparacin con otras carreras y porque elegir esa, adems nos explicaron cmo sera la inscripcin y que hay que hacer el cbc antes de poder ingresar a la facultad. Me gust mucho la charla ya que podra llegar a ser la carrera que elija a futuro.','2023-05-04'),(5903,275,'UBA','Hoy fuimos a la ciudad universitaria (UBA) para iniciar el ciclos de charlas de la facultad de ciencias Exactas y naturales de la UBA, la charla fue hecha sobre temas de computacin, mas que nada orientados a lo que queremos/deberamos estudiar o hacer en el futuro de nuestras carreras,. ','2023-05-04'),(5904,284,'Bitacora 9','Hoy fuimos a la facultad de ciencias exactas y naturales , tuvimos una charla sobre la informtica dentro de esa facultad , hablamos sobre las materias y sobre el CBC de esa facultad.\r\nFue muy interesante y me sirvi para informarme mas sobre mis futuros estudios ','2023-05-04'),(5905,287,'Salida Didctica UBA','El da de hoy participamos de una salida didctica en la Facultad de Ciencias Exactas y Naturales en la cual tuvimos una charla sobre las carreras que se llevan a cabo dentro de esta. \r\nLa charla fue conllevada por un profesor de ciencias el cual nos dio una introduccin a al carrera de computacin, mostrndonos sus utilidades, sus contenidos, los aos que conlleva obtener una licenciatura, profesorado y bachillerato dentro de la carrera y dems informacin sobre los temas dentro del mismo. \r\nDebido a dicha charla, eso fue lo nico realizado el di de hoy. ','2023-05-04'),(5906,276,'Salida Didctica UBA Facultad Ciencias Exactas y Naturales','El da de hoy participamos de una salida didctica en la Facultad de Ciencias Exactas y Naturales en la cual tuvimos una charla sobre las carreras que se llevan a cabo dentro de esta. \r\nLa charla fue conllevada por un profesor de ciencias el cual nos dio una introduccin a al carrera de computacin, mostrndonos sus utilidades, sus contenidos, los aos que conlleva obtener una licenciatura, profesorado y bachillerato dentro de la carrera y dems informacin sobre los temas dentro del mismo. \r\nDebido a dicha charla, eso fue lo nico realizado el di de hoy. ','2023-05-04'),(5907,273,'Bitacora 05/05/2023','En el da de la fecha llegu y me di cuenta que haba una nueva problemtica para el proyecto: no saba qu tipo de base de datos iba a usar (relacional o no relacional) por lo que empec a ver distintas formas de hacerlo. Por los distintos vdeos y recomendaciones que vi, me di cuenta que debera usar una base de datos no relacional, y para esto usara MongoDB. El ao pasado tuvimos un poco de clases acerca de este tipo de programa, pero no lo vimos en conjunto con ReactJS o NodeJS. As que, empezar a ver tutoriales acerca de cmo usarlos en conjunto y, a su vez, cmo debera hacer el inventario de muebles: Gestin de stock con React, Next JS, Node JS y Mongo DB\r\nAntes de hacer esto, tengo que averiguar el cmo usar ExpressJS para hacer el backend de la aplicacin. Para esto, empec a ver cmo usar Express desde 0, y estuve viendo que hay que utilizar distintos mdulos de Node y tambin distintas extensiones de archivos que nunca manej antes.\r\n','2023-05-05'),(5908,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacion y demas diagramas','El da de hoy realizamos las siguientes tareas:\r\n\r\n- En primer lugar, seguimos trabajando en base a la codificacion de la pagina web general. Esta misma se retraso un poco debido a que hubieron ciertos problemas con los archivos a la hora de guardarse, por lo que tuvimos que realizar la codificacion otra vez desde cero en vez de seguirlo desde lo ultimo hecho. Aun asi, se le dio cierto avance a la codificacion de la pagina de inicio de nuestra pagina web, y el resultado ya fue guardado correctamente, de modo que podremos continuar con el trabajo desde lo ultimo realizado. \r\n- Por otro lado, aun seguimos con la realizacin de ciertos diagramas faltantes dentro de los proyectos, tales como el camino critico y el caso de uso extendido, au