y.','2023-05-05'),(5918,272,'05/05 Realizacin de Daily y continuaciones del FIGMA','El da de hoy junto a mangialavore y bulacio realizamos el daily y continuamos con la realizacin del prototipado FIGMA. Prximamente realizaremos el diseo y funcionamiento en HTML.','2023-05-05'),(5919,299,'Hoy','Hoy avanzamos con el Figma y la daily','2023-05-05'),(5920,290,'Undcima ','En el da de la fecha lo que hice fue seguir con la pgina del da anterior y llegamos a crear el inventario, lo probamos ingresando productos y luego cambiamos el diseo de la pgina para que quede ms estetico ','2023-05-05'),(5921,278,'Clase N 13 05/05/2023','En el dia de hoy continue con la pagina web , en la cual seguimos con mi compaero tobias haciendo la parte del inventario , hicimos pruebas agregando productos al inventario y funciono, tambien cambiamos el tema de la pagina  y ahora es bordo con dorado.','2023-05-05'),(5922,291,'Avance del proyecto','Hoy entre en el horario establecido por la institucin, espere a que mi compaero Lucan llegara para poder realizar la daily, ms tarde en ese mismo momento llego mi compaero Thiago, realizamos la daily despus del recreo establecido por el establecimiento escolar, en la daily escribimos sobre la salida didctica que tuvimos a la facultad de ciencias econmicas UBA.','2023-05-05'),(5923,294,'prototipado app movil','En el dia de la fecha estuve mayormente distraido hablando con mis compaeros, pero aun asi logre realizar con mi compaera Geraldinde Abregu 4 paginas de el prototipado usando la aplicacin canva. las paginas tratan primero de una que te pide que inicies sesion o te registres, despues viene la pagina de inicio de sesion y registro y como ultima del dia de hoy una pagina que tengas que ingresar los ingredientes para que te busque una receta.','2023-05-05'),(5924,298,'Clase 10','Hoy estuvimos haciendo la pgina web para el proyecto junto a Vicky, terminamos con la pgina de registro y ahora estamos trabajando con la de inicio de sesin. ','2023-05-05'),(59