ne muy bien encaminado y as facilitar la creacin de futuros modales','2023-05-09'),(5935,261,'09/05/2023','Hoy nombramos a nuestro equipo &quot;SCRAP BOYS&quot; chicos de chatarra y hice le el beceto del logo del equipo.','2023-05-09'),(5936,271,'9/5/23','En el da de la fecha, investigamos junto a mis compaeros un poco de Unity y adems, hicimos un par de bocetos del juego, ya que en las computadoras de esta nueva aula no est instalado unity y no pudimos seguir con eso ','2023-05-09'),(5937,268,'09-05-2023','Hoy con mi grupo hablamos con el profesor Nahuel sobre los materiales que usaremos probablemente el martes de la siguiente semana:\r\nDespus de discutir con m grupo al fin tenemos un nombre y una temtica para el grupo nos llamaremos los scrap boys y el nombre del robot ser Servbot.','2023-05-09'),(5938,251,'Re-estructuracin de la API - 09/5/2023','El da de hoy me percat de un gran error. El archivo .gitignore del framework Leaf, hizo que no se guarden los datos de las funciones con las que deba trabajar, por lo que decid crear dos ramas:\r\nArregloAPI, donde cre un nuevo proyecto con el Framework Leaf pero modificando el gitignore.\r\nInvestigacin Lavarel Api, donde investigar Lavarel, otro Framework de PhP, teniendo en cuenta la recomendacin del profesor Consorti.\r\nTambin, sub una copia del proyecto de ArregloApi a mi Drive personal, en caso de otro inconveniente. nya &gt;.&lt;','2023-05-09'),(5939,263,'9/5/23','En el dia de hoy, junto con Luciano Budman seguimos con el proyecto, lamentablemente Axel Fenoglio falto en el dia de hoy por un tema medico pero hoy estuve mirando un tutorial de blender para asi poder hacer los modelos de los personajes','2023-05-09'),(5940,260,'','Cre un modal de alerta y le agregu un par de funcionalidades, aun quedan varias','2023-05-09'),(5941,303,'09-05-2023','Hoy continuamos haciendo los bocetos de los diseos (men, pantalla principal, etc) del juego y a la vez investigamos mas sobre unity.','2023-05-09'),(5942,266,'Avance en front end','Estuve dedicandome a hacer los services de user en front end, y tambin la parte de env para variables globales. ','2023-05-09'),(5943,253,'Martes 09/05/2023 - Unity','Hoy dimos un par de ideas de cmo afrontar el modelado en Unity.','2023-05-09'),(5944,270,'09/05/23','el da de hoy, al no funcionar la computadora con unity, empezamos con los bocetos del men del juego y corregimos algunas cosas de la carpeta de campo.','2023-05-09'),(5945,297,'10/05/23','visita a la feria del libro ','2023-05-10'),(5946,257,'10/5/2023','Hoy fuimos a la feria del libro ','2023-05-10'),(5947,258,'10-05-2023','hoy fuimos a la feria del libro\r\n','2023-05-10'),(5948,271,'10/5/23','En el da de la fecha tuvimos una excursin a la rural sobre la feria del libro ','2023-05-10'),(5949,251,'Excursin a la Feria del libro - 10/05/2023','El da de hoy fuimos de excursin a la Feria del Libro con la profesora Jimena Balado y los profesores Gonzalo Consorti y Juan McLoughlin. Me compr un libro de Ghost in the Shell.','2023-05-10'),(5950,261,'10/05/2023','Hoy fui a la feria del libro','2023-05-10'),(5951,268,'10/05/2023','Hoy con mis compaeros de clase fuimos a la 47 feria de libro en la Rural a las 14:00 hasta las 16:30.','2023-05-10'),(5952,253,'Mircoles 10/05/2023 - Feria del Libro','Hoy tuvimos una excursin a la Feria Internacional del Libro de Buenos Aires.\r\nGracias a esta visita, pude sacar varias ideas de posibles preguntas para mi categora en el videojuego.','2023-05-10'),(5953,270,'10/05/23','El dia de hoy tuvimos una excursin a la feria del libro, por lo tanto no pudimos avanzar con el proyecto','2023-05-10'),(5954,303,'10-05-2023','Hoy no hubo prcticas profesionalizantes, ya que tuvimos una salida didctica a la feria del libro.En la cual pudimos ver la gran cantidad de variedad de gneros, escritores, tipos de culturas , libros, etc.','2023-05-10'),(5955,262,'10-05-2023','El da de hoy no trabajamos en los laboratorios ni el proyecto ya que surgio una salida didactica a la &quot;Feria del Libro&quot;.','2023-05-10'),(5956,256,'10/05 salida','Hoy fuimos con los profes y los de 5to a la feria del libro ','2023-05-10'),(5957,259,'Salida Didactica Feria del Libro','Salimos a la Feria del Libro y paseamos epicamente por toda la feria, con Balado, Mcloguin y Consorti. Estuvo re piola :D\r\n ','2023-05-10'),(5958,298,'Clase 11','Hoy seguimos con la pgina web, ya terminamos la pgina de inicio de sesin y la del registro de cuenta, prximamente haremos la pgina principal.','2023-05-11'),(5959,298,'Clase 11','Hoy seguimos con la pgina web, ya terminamos la pgina de inicio de sesin y la del registro de cuenta, prximamente haremos la pgina principal.','2023-05-11'),(5960,272,'Empiezo el desarrollo de la pgina web','Hoy, comenc el desarrollo web con el uso de FIGMA como herramienta de prototipado visual. El prototipado est en la etapa final y aprovechando empec con el desarrollo. En la reunin de equipo, todos los integrantes se presentaron y nos pusimos manos a la obra sin dificultades.','2023-05-11'),(5961,296,'Bitcora 8','Hoy terminamos el diseo de la pgina web y estuvimos viendo cmo era el tema de hacer que la pgina sea responsive','2023-05-11'),(5962,292,'Nuevas funciones a la api','En el da de hoy durante la jornada de prcticas profesionalizantes me encargue de expandir la api descargada anteriormente ya que con la ayuda del profesor el mapa o ucupaba menos de la mitad de la pantalla. Por lonque la expandimos y agregue la funcin de que en la localizacin donde apareceran los formularios por incidentes tambin aparezcan las mltiples opciones que se tienen que completar como la cantidad de asaltantes/robado y el obtengo sustrado, trate de agregarle css pero como no pudd busque pginas para poder hacerlo pero no hubo caso','2023-05-11'),(5963,299,'Hoy','Hoy adelante el Figma y el HTML ','2023-05-11'),(5964,291,'Avance del proyecto','El da de hoy realizamos la Daily como de cotumbre sobre lo que hicimos el da anterior, que vamos a hacer el da de hoy y que inconvenientes tenemos, despus de realizar la Daily ayude a mi compaero Thiago a realizar la pagina web con HTML y PHP, pero despus de unos momentos cambi de lugar con mi compaero Lucan que estaba ayudando a mi compaero Ciro con el servidor MySQL porque se ms de base de datos que de HTML, junto a Ciro logramos realizar el servidor MySQL, el cual tenia varies errores pero pudimos arreglarlos y con eso terminarla.','2023-05-11'),(5965,294,'Pagina Web del proyecto','En el dia de hoy estuve mayormente en la creacion de la pagina web del proyecto. ayude a mi compaera victoria a fabricar los formularios respectivos para iniciar sesion en la pagina. Usamos visual studio code para la misma y nuestros conocimientos basicos.','2023-05-11'),(5966,285,'Dia 11 en PP','Que logre hacer hoy? \r\n\r\nHoy me dediqu a trabajar en el prototipado de un proyecto importante utilizando el software de diseo Figma. Despus de haber creado el prototipo en papel, traslad todo a la pantalla y asegur que estuviera todo en su lugar y con la funcionalidad deseada. Trabajar con Figma me permiti mover y ajustar fcilmente los elementos en la pantalla, lo que result muy conveniente y me ahorr tiempo y esfuerzo. Adems, logr terminar el mdulo 8 de mi proyecto, lo cual fue un gran logro para m. Aunque ha sido un proceso desafiante, estoy muy satisfecho con lo que he logrado hasta ahora y estoy ansioso por seguir avanzando en mi proyecto. \r\n\r\nEn que se me complico? \r\n\r\nPor suerte, hoy no experiment ninguna complicacin en mi proyecto. Todo se desarroll sin contratiempos y pude avanzar de manera fluida en cada una de las etapas del proceso. \r\n\r\nQu estuve investigando? \r\n\r\nDurante el da, no estuve investigando sobre ningn tema en particular. Me dediqu por completo a trabajar en mi proyecto y asegurarse de que todo estuviera en su lugar y funcionando correctamente. En resumen, ha sido un da muy productivo y estoy satisfecho con los resultados que he obtenido.\r\n','2023-05-11'),(5967,283,'base de datos, html y css y finalizacion de figma','El dia de hoy hicimos la daily, dividimos que cosa haria cada uno y luego estuve modificando la base de datos donde tuvimos problemas con la misma con mi compaero mangialavore. La misma tenia problemas de syntax o con las foreign key pero logramos resolverlos. Luego nuestros otros compaeros terminaron el figma y ya empezaron con el html y css. La clase que viene seguiremos con php para conectarla con la base de datos','2023-05-11'),(5968,282,'Avances en el mapa / Mejoras en el login','En el da de hoy trabaj en conjunto con mis compaeros de grupo Christian Forte, Manuel Filippa y Ezequiel Ledesma. Avanzamos en el proyecto siendo que el mapa result de manera exitosa al lograr amplificar la pantalla y que se vea de manera tal como tenamos esperado tambin estuvimos intentando aadirle funcionalidades nuevas tales como el que se pueda ver alertas en un modo resumido clickeando en un punto.\r\nBien colaborando con Forte y Filippa logramos mejorar el login en comparacin a lo que estaba actualmente','2023-05-11'),(5969,286,'Carpeta de Campo, HTML y CSS','Hoy al llegar al aula empec, intentando abrir la carpeta de campo de la materia, ya que haba un error el cul no me permite a da de hoy editar mi archivo original de carpeta de campo. Ms tarde me puse a trabajar en el HTML y CSS de la pgina de administrador. Al abrir esta me di cuenta que necesitaba un cambio de diseo inmediatamente. Saqu el borde que tenia el login, achiqu el tamao del border radius, reubiqu la imagen de la policia del &lt;header&gt; al login por lo que quit el texto de P.D.L.C, aad sombras al login y a los &lt;input&gt; y al botn de ingresar, pul un par de detalles de gramtica, edit en Photopea las letras del logo de la polica e intent agregar una imagen dentro del login.','2023-05-11'),(5970,276,'Proyecto PP Lu\'s Shop: &quot;VicSon&quot; - codificacin - CDD - Correcciones ','El da de hoy realizamos las siguientes tareas: \r\n- Seguimos en base a la codificacin de nuestra pgina web, aunque debidos a ciertos problemas se vio retrasada, por lo que an seguimos trabajando en la pestaa de inicio, dentro de la cual seguimos trabajando en darle el diseo similar al de la Maqueta Software, y as poder empezar a codificar las dems pestaas. \r\n- Por otro lado, se estuvo realizando el Diagrama de Caso de Uso Extendido, el cual hasta el momento se tiene la base general de lo que sera el Diagrama, aunque an queda pendiente la documentacin del mismo para completarlo.\r\n- Por otro lado, se realizo ciertas correcciones en base a ciertos aspectos del proyecto, tales como el Camino Crtico, el Diagrama de Entidad de Relacin, la BDD y dems\r\nEso fue todo por hoy. ','2023-05-11'),(5971,280,'Dia sin supervisores','Dia de hoy solo trabajamos enfocados en los diseos de las paginas web lo cual es lo ultimo para poder hacer funcionar la pagina donde se mostraran las recetas. Se dio diseo al login y se probo ciertas funcionalidades para llevar a cabo, ademas que se planteo el uso de node ya que aun cuando es el motor que ya hemos deicidido presentamos dudas en la aplicacion','2023-05-11'),(5972,293,'Base de Datos Avance','Hoy dia me dedique a hacer el base de datos.','2023-05-11'),(5973,287,'Proyecto PP Lu\'s Shop: &quot;VicSon&quot; - codificacin - CDD - Correcciones ','El da de hoy realizamos las siguientes tareas en base al proyecto: \r\n- Seguimos codificando nuestra pgina web, aunque hubo algunas complicaciones , por lo que an seguimos trabajando en la pestaa de inicio, dentro de la cual seguimos trabajando en darle el diseo similar al de la Maqueta Software, y as poder empezar a codificar las dems pestaas e intentar darle los dems diseos y funcionalidades a las dems pestaas. \r\n- Por otro lado, se estuvo realizando el Diagrama de Caso de Uso Extendido y aunque an se encuentra en proceso, ya se tiene la base general de lo que sera el Diagrama. \r\n- Por otro lado, se realizo ciertas correcciones en base a ciertos aspectos del proyecto, tales como el Camino Crtico, el Diagrama de Entidad de Relacin, la BDD y dems\r\nEso fue todo por hoy.','2023-05-11'),(5974,274,'Login de administradores, base de datos','En el da de la fecha tuve una entrevista con la empresa GS1, junto a dos compaeros. Una vez finalizada la misma, junto con un compaero del equipo estuvimos realizando algunas modificaciones en el CSS del inicio de sesin de los administradores. Yo por mi parte lo ayud con el diseo. Luego intent trabajar con el PHP de la pgina donde son reportados los incidentes, pero no pude debido a que haba un error con la contrasea del servidor SQL en todos los ordenadores del aula. Por ltimo, coloqu una imagen a la derecha del login, donde los administradores ingresan su usuario y contrasea.','2023-05-11'),(5975,285,'Dia 12 PP','Qu logr hacer hoy?\r\n\r\nHoy he estado trabajando en el prototipado de una pgina web utilizando la herramienta de diseo Figma. Me han solicitado la creacin de dos secciones en la pgina, una de Favoritos y otra del Carrito de compras. He logrado avanzar en la creacin de ambos prototipos y en este momento, me encuentro perfeccionando los detalles finales para garantizar una experiencia de usuario ptima.\r\n\r\nEn qu se me complic?\r\n\r\nAunque he avanzado en la creacin de ambos prototipos, he encontrado algunas dificultades para encontrar un diseo adecuado que diferenciara claramente ambas secciones. Pensar en un diseo completamente nuevo para la seccin de Favoritos me ha costado un poco ms de esfuerzo, pero he logrado superar esta dificultad y he conseguido un resultado satisfactorio.\r\n\r\nQu estuve investigando?\r\n\r\nHoy he estado investigando sobre las mejores prcticas de diseo web para crear una experiencia de usuario ptima. Me he enfocado en la estructura utilizada por Mercado Libre para la seccin del Carrito de compras, y he buscado inspiracin para la seccin de Favoritos en otras pginas web. He estudiado diferentes opciones de diseo y he trabajado en crear un diseo atractivo y diferenciado que sea fcilmente reconocible por los usuarios. Tambin he buscado informacin sobre cmo mejorar la navegabilidad de la pgina web y cmo garantizar una experiencia de usuario satisfactoria.\r\n','2023-05-12'),(5976,299,'Hoy','Hoy seguimos con el Figma y el HTML, lo estamos mejorando para que quede lo mejor posible','2023-05-12'),(5977,274,'CSS, Login','En el dia de hoy, lo que hice fue volver a editar el css de la pgina de inicio de sesin de los administradores, debido a que no estaba convencido de las propiedades que haba utilizado el da anterior. Mir algunos tutoriales y diseos web para ver que partes poda modificar, pero no pude editar mucho. Luego, edit la foto que se encuentra en el lado derecho del login con la ayuda de photoshop, ya que era muy ancha, y al colocarla ah se deformaba el ancho. Por ltimo, cre un nuevo html para realizar un nuevo login, en el que iba a ir probando distintos diseos hasta que me convenciera alguno, y de esta manera no arriesgarme a modificar el login original.','2023-05-12'),(5978,278,'Clase N 14 12/05/2023','En el da de hoy me dispuse a continuar con la pagina web. Estuve trabajando en el inventario , agregando las imgenes de cada producto y sus caractersticas. Adems modifique el navbar , colocndole un fondo con una imagen de madera. Tambin le agregue un icono a la pagina para que quede mas esttica.','2023-05-12'),(5979,286,'HTML Y CSS de Pgina Usuarios','El da laboral de hoy comenz con la misma dificultad que la semana pasada. Al llegar al aula, intent prender la computadora y esta no responda, al cabo de un rato esta reaccion, prendi y pude iniciar sesin en mi cuenta de Google como siempre.\r\nUna vez abierta mi cuenta, me dirig hacia Google Drive, entr a la pestaa &quot;Destacados&quot; y abr la carpeta que contiene todos los archivos relacionados a nuestro trabajo de la materia. Una vez dentro, busqu la carpeta de &quot;Usuario Web&quot; y la descargu para poder modificarla.\r\nLuego abr el Visual Studio Code e ingres la carpeta descargada all para poder modificar la pgina. Empec buscando en YouTube tutoriales para saber cmo hacer un sidebar desplegable, al cabo de unos minutos, uno de los profesores me recomend que use la herramienta Bootstrap donde pude encontrar lo que buscaba. Copi el cdigo que me proporcionaba y lo pegu en el Visual Studio.\r\nUna vez teniendo todo listo para empezar a modificar lo proporcionado, abr el prototipado que anteriormente haban hecho mis compaeros de grupo Enzo Bartoletti y Ezequiel Ledesma y fui agregando al sidebar todo lo que dicho prototipado contena.\r\n','2023-05-12'),(5980,284,'Bitacora 12','Hoy estuve ayudando a mi compaero amir gomez con el figma de la pgina web , y continuando con mi carpeta de campo','2023-05-12'),(5981,272,'Desarrollo de pgina WEB','El da de hoy me focalic en el desarrollo de la pgina web y sus funciones principales del inicio, tales como un slider para mostrar las novedades de la pgina, y tarjetas de ofertas, con un boton para mostrar ms ofertas, esto utilizando CSS y JS, falta mucho pero se va por buen camino.','2023-05-12'),(5982,290,'Duodcima ','En el da de la fecha lo que realice fue ayudar a un compaero a continuar con el avance de la pgina para el inventario','2023-05-12'),(5983,293,'Base de Datos Proceso','hoy da correg los problemas de la base de datos que anteriormente quedo y aun sigue en proceso.','2023-05-12'),(5984,287,'Proyecto PP Lu\'s Shop: &quot;Vicson&quot; - Codificacion - CDD - Base Datos','El dia de hoy seguimos realizando las mismas tareas que la bitacora anterior:\r\n- Por un lado, seguimos en avance a la codificacion de la pagina web, a la cual terminamos de codificar y disear la barra de navegacion y el footer. Y ademas, se le agrego ciertos botones para acceder a las demas secciones de ropas. Hasta el momemento el resultado de la pagina web estaa gustando bastante.\r\n- Por otro lado, se sigue realizando el Caso de Uso Extendido, el cual por el moememnto se han realizado ciertas documentaciones sobre el mismo, se espera poder terminar con dicho diagrama hasta la proxima daily.\r\n- Por ultimo, se estuvo realizando cierto arreglo dentro de la base de datos, tratando de hacerla mas acorde a los objetos dentro de nuestra tienda virtual.\r\nEso fue todo por hoy. ','2023-05-12'),(5985,276,'Proyecto PP Lu\'s Shop: &quot;Vicson&quot; - Codificacion - CDD - Base Datos','\r\nEl dia de hoy seguimos realizando las mismas tareas que la bitcora anterior:\r\n- Por un lado, seguimos en avance a la codificacion de la pagina web, a la cual terminamos de codificar y disear la barra de navegacion y el footer. Y ademas, se le agrego ciertos botones para acceder a las dems secciones de ropas. Hasta el momento el resultado de la pagina web esta gustando bastante.\r\n- Por otro lado, se sigue realizando el Caso de Uso Extendido, el cual por el momento se han realizado ciertas documentaciones sobre el mismo, se espera poder terminar con dicho diagrama hasta la proxima daily.\r\n- Por ultimo, se estuvo realizando cierto arreglo dentro de la base de datos, tratando de hacerla mas acorde a los objetos dentro de nuestra tienda virtual.\r\nEso fue todo por hoy. ','2023-05-12'),(5986,296,'Bitcora 9','Hoy empezamos a realizar la pgina web pero viste desde la PC y estuvimos seleccionando los colores definitivos','2023-05-12'),(5987,275,'Finalizacin del diagrama de caso de uso y su documentacin ','El da de ayer me dedique a ayudar un poco en la pagina web y tambin en la base de datos(Digo esto porque no pude hacer la bitcora de ayer ) y hoy pude terminar todo lo que seria lo de caso de uso as se podra decir que me saque una cosa mas, lo nico que quedaba por terminar era el tema de la documentacin porque el grafico ya lo tenia terminado desde hace das, anote  las condiciones, precondiciones, un resumen de lo que seria la pagina de venta y las acciones de actores y sistemas. ','2023-05-12'),(5988,280,'Actualizar software','El dia de hoy solo se realizaron tareas pensadas para la actualizacion del software y optimizar algunas partes del software. \r\nEl codigo principal en el sql y node presenta fallos al tratar de pasar algunas consultas.','2023-05-12'),(5989,282,'Trabajo con el Login HTML','En el dia de hoy, nos presentamos tanto Forte, Filippa y yo a Practicas Profesionalizantes y trabajamos unicamente en el area de HTML, debido a que pensaba continuar con la carpeta de campo pero la computadora que pensaba utilizar se tild y no me dejo progresar en esta.\r\nPor lo cual, como en el dia de ayer, progresamos con el login, cambiando parcialmente el diseo y agregando una imagen al Login','2023-05-12'),(5990,294,'comienzo de app movil','En el dia de la fecha me desvie un toque del tema de la pagina web y fui comenzando con los formularios que corresponde a la parte movil del programa. Empece la parte de inicio de sesion para registrar al usuario y que se registre en la base de datos correspondida.','2023-05-12'),(5991,295,'Diseo de pagina web','En el da de hoy empec con la primera pagina del sitio web del proyecto en la cual se deben ingresar los ingredientes, tambin le puse el nav que va en todas las interfaces de la pgina. Adems empezamos junto a mi compaero a hacer la app mobile que ya habamos hecho el prototipado la clase anterior.','2023-05-12'),(5992,289,'','','2023-05-12'),(5993,298,'Clase 12','Hoy seguimos con la pgina, le dimos un retoque a las pginas de ingreso e inicio de sesin, adems de hablar sobre el diseo del robot.','2023-05-12'),(5994,263,'16/5','Hoy teniamos planeado hacer ahora el mapa en Unity pero lamentablemente no pudimos hacer mucho en el dia de hoy debido que las compus que estamos utilizando en el colegio no tienen descargado y instalado Unity','2023-05-16'),(5995,263,'16/5','Hoy teniamos planeado hacer ahora el mapa en Unity pero lamentablemente no pudimos hacer mucho en el dia de hoy debido que las compus que estamos utilizando en el colegio no tienen descargado y instalado Unity','2023-05-16'),(5996,268,'16/05/2023','Hoy despues