6'),(6007,271,'16/5/2023','En el da de la fecha realizamos la Daily y nos pusimos de acuerdo en dividir las tareas el da de hoy en dos partes. Por una parte seguimos diseando la base del hospital y la otra averiguo ms sobre el Lenguaje de C sharp','2023-05-16'),(6008,301,'Agustin Barcia','Hoy probamos y elegimos mapas en unity  para el juego, vamos a seguir en pruebas o vamos a decidir si crear uno (Basico) desde cero ','2023-05-16'),(6009,303,'16-05-2023','Hoy nos dividimos en dos mini grupos, uno sigui diseando la base del juego y el otro empez a ver en profundidad el  lenguaje C Sharp.','2023-05-16'),(6010,260,'','Implemente la funcion que hizo dylan para crear un usuario en la BD y la implement en el front para darle la funcionalidad al register','2023-05-16'),(6011,266,'registro funcional y servicios ','estuvimos avnasxando con los servicios en el frontend. Principalmente los servicios de usuario, la parte para registrar un nuevo usuario ya se encuentra funcionando y en perfectas condiciones. tambien estuvimos corrigiendo bugs. resolvi un par de bugs de la api y mergeamos a las ramas','2023-05-16'),(6012,251,'Arreglo_API pt1 - 16/5/2023','El da de hoy verifiqu si mi trabajo realizado en Arreglo_API haba surgido efecto. Efectivamente, ya no tena errores. Me dediqu a reemplazar el cdigo y a agregar el que ya haba realizado.','2023-05-16'),(6013,269,'16/05/2023','Hoy empec con el proyecto React\r\nAprend como ejecutar un proyecto en la consola y como ponerlo en marcha, luego empec con las primeras modificaciones en el cdigo ','2023-05-16'),(6014,251,'Jornada Recreativa - 17/5/2023','El da de hoy organic los torneos de ajedrez de la jornada recreativa en las horas de Prcticas Profesionalizantes, con el permiso de los profesores Nahuel Acosta y Gonzalo Consorti.','2023-05-17'),(6015,291,'Avance del proyecto','El da de hoy empeze abriendo el canvan y ver las tareas que faltaban los cuales son pocas y se pueden completar con tiempo, junto a mi compaero Alan revisamos el prototipado Figam para verificar que todo este bien y listo para finalizar, corregimos algunas cosas de este y lo terminamos, luego del recreo realizamos la daily, tambin voy a ayudar a mi compaero Thiago a realizar la pagina la cual esta costando en realizar, pero podremos terminarla a tiempo.','2023-05-18'),(6016,286,'HTML y CSS de Pgina Usuarios 2','El da de hoy no comenz con ninguna dificultad, a diferencia de las clases pasadas. Al entrar al aula inicie sesin en mi cuenta de la escuela en Google y me diriji a Goolge Drive a descargar la carpeta &quot;Usuario Web&quot;. Una vez hecha la descarga, abr la aplicacin para programar de confianza, Visual Studio Code, all met la carpeta anteriormente descargada y segu con el codeo. Continu lo que haba dejado la clase pasada, resumidamente hice: cambi el color el &lt;navbar&gt; a blanco, mov el formulario desplegable hacia la izquierda y lo agrand a un poco ms del doble de tamao del que tena anteriormente, orden todo lo que contiene este formulario, cambi el color de fondo, el color de los textos, el color de los &lt;h5&gt; y &lt;h6&gt;, borr cdigo innecesario como tambin lo modifiqu, correg un par de errores de diseo, agruegue botones e hice la pgina un poco ms esttica.','2023-05-18'),(6017,272,'Desarrollo WEB','El da de hoy, como la clase anterior, segu el desarrollo web, creando y arreglando funciones y partes estticas de la pgina principal.','2023-05-18'),(6018,285,'Dia 13 PP','Qu logr hacer hoy? \r\n\r\nHoy ha sido un da muy productivo para m. En la ltima clase, finalizamos el prototipado en Figma, lo cual nos permiti tener una gua clara para el desarrollo de la pgina. Durante el da de hoy, continu progresando con el desarrollo de la pgina utilizando HTML y PHP. Me enfoqu en completar las secciones restantes y asegurarme de que todos los elementos estuvieran correctamente estructurados y funcionales. Trabaj en la implementacin de diferentes funcionalidades, como formularios de contacto y elementos interactivos, para hacer la pgina ms dinmica y atractiva. \r\n\r\nEn qu se me complic? \r\n\r\nAfortunadamente, no encontr ningn obstculo importante durante la sesin de hoy. Sin embargo, hubo algunos compaeros que llegaron tarde a la clase, lo cual afect un poco la dinmica del grupo. Aunque no mencionar especficamente a los compaeros, fue importante mantener un ambiente colaborativo y asegurarnos de que todos estuvieran al tanto de los avances y las tareas asignadas. \r\n\r\nQu estuve investigando? \r\n\r\nDurante el da, estuve investigando sobre algunas tcnicas avanzadas de HTML y PHP para mejorar la funcionalidad y la apariencia de la pgina web. Investigu sobre cmo utilizar diferentes etiquetas y atributos de HTML de manera efectiva, as como cmo implementar scripts en PHP para procesar formularios y manipular datos del servidor. Adems, investigu sobre buenas prcticas en el diseo web y explor diferentes recursos en lnea para obtener ideas y soluciones creativas.\r\n','2023-05-18'),(6019,283,'php, pagina y base de datos','Hoy da productivo en proyecto. Completamos base de datos, paso importante para finalizacin desarrollo. Una vez finalizada tarea, nos concentramos en mejorar pgina web ofreciendo experiencia ptima a usuarios. Dedicamos tiempo a pulir detalles visuales, optimizar navegacin y garantizar usabilidad en diferentes dispositivos. &quot;Nos enfocamos en mejorar la velocidad y seguridad de la pgina implementando prcticas en desarrollo web y en programacin en PHP.&quot; Se inicia creacin del cdigo para funcionalidad dinmica de pgina, permitiendo interaccin de usuario con base de datos. Etapa fundamental para cumplir objetivos establecidos. Hoy fue clave para avanzar en el proyecto. Completamos la base de datos y mejoramos la pgina web, iniciando la codificacin en PHP. Continuaremos trabajando para completar funcionalidades y pulir detalles restantes.','2023-05-18'),(6020,282,'Tareas de Scrum','Durante la jornada del dia de hoy en Practicas Profesionalizantes me encargue de la distribucin de tareas al grupo, delegando a Forte la implementacion de nuevas funcionalidades al login, mientras que Filippa continu con la interfaz de usuario, realizando el form. Como ultima tarea, caceres visualiz una parte de un curso de React.','2023-05-18'),(6021,279,'Dia 11 Del Proyecto','En el da de hoy estuve haciendo las dailys que no pude hacer de la semana pasada por lo que se lo pregunte a Enzo que estuvieron haciendo y aunque quede corto el daily 13 es mayormente porque solo vinieron 3 del grupo y as por eso pero tambin tuve que hacer la 11 ya que lo haba dejado a los chicos completarlos pero al final no lo hicieron y despus de terminarlo me pidi Enzo empezar a ver y entender el lenguaje react.','2023-05-18'),(6022,293,'Base de Datos terminado','hoy da termine la base de datos y corrigi algunas diagramas','2023-05-18'),(6023,280,'Guia react','\r\nEl dia de hoy me dispuse a crear una guia para orientacion sobre react para mi grupo y para mi. Enfocandome principalmente en en concepto basico , instalacion, condicionales y visualizacion de datos. Tomando de inicio la pagina oficial de react y utilizando otras herramientas propias del react js como los snippets que son aplicables en distintas ramas utilizadas  tales como js typescript html etc. \r\n','2023-05-18'),(6024,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacion - CDD - Camino Critico - Base de Datos','El da de hoy realizamos las siguientes tareas: \r\n- Consideramos en realizar la pestaa de login, de modo que podamos realizar una pequea conexin inicial sobre la pagina web y con la base de datos, por lo que en el da de hoy empezamos a realizar la pestaa del login, la cual consiste en pedir usuario y contrasea, y da un botn para ingresar. Por el momento el diseo dado a la pestaa convenci bastante y es bastante similar a la que diseamos dentro de la maqueta software. Esperamos el poder realizar la pestaa de registro y de algn modo realizar cierta conexin con la base de datos\r\n- Por otro lado, seguimos haciendo ciertos arreglos dentro de la base de datos y dems arreglos en los inserts y dems, aunque por el momento no se esta del todo seguro de su funcionalidad para poder conectarla, se esta llevando a cabo cierta actualizacin de la misma. \r\n- Por ultimo, se termino de realizar el camino critico y el Caso de Uso Extendido. \r\n\r\nEso fue todo por hoy.','2023-05-18'),(6025,288,'Undcima Clase','Durante el transcurso de la jornada actual, he logrado avances significativos en diversas reas del proyecto en curso. Especficamente, me he enfocado en el desarrollo y mejora de dos aspectos clave: la parte grfica de nuestra pgina web y la estructura de la base de datos. En primer lugar, he dedicado tiempo y esfuerzo a perfeccionar la apariencia visual de nuestra pgina web. He trabajado en la seleccin cuidadosa de elementos grficos, colores y disposicin de elementos para crear una interfaz atractiva y agradable a la vista. Asimismo, he aplicado tcnicas de diseo web modernas para garantizar la usabilidad y la experiencia del usuario. Adems, he dedicado atencin a la construccin y organizacin de la base de datos necesaria para respaldar el funcionamiento de nuestra tienda virtual. He redactado y estructurado meticulosamente la base de datos, teniendo en cuenta los diferentes tipos de informacin requeridos y las relaciones entre los distintos elementos. Esta base de datos servir como el soporte fundamental para el correcto almacenamiento y gestin de los datos relacionados con los productos, los clientes y otros aspectos relevantes de nuestra tienda en lnea. \r\nPara lograr una integracin fluida entre la parte grfica y la base de datos, he llevado a cabo la implementacin del cdigo correspondiente en el entorno de desarrollo web. \r\nHe creado la interfaz HTML necesaria, asegurndome de que est correctamente estructurada y optimizada para una navegacin intuitiva. \r\nAdems, he aplicado hojas de estilo CSS para definir el aspecto visual de la interfaz y garantizar una presentacin coherente y atractiva en todos los dispositivos. \r\nPara la interaccin entre la interfaz de usuario y la base de datos, he utilizado PHP, un lenguaje de programacin ampliamente utilizado en el desarrollo web. \r\nMediante la codificacin adecuada, he establecido la conexin entre la interfaz y la base de datos, permitiendo la recuperacin y actualizacin de datos de manera eficiente y segura. Para brindarte una mejor comprensin de los avances logrados en este da, adjunto imgenes dentro de mi carpeta de campo, que reflejan el trabajo realizado hasta el momento. \r\nEstas imgenes destacan los aspectos visuales y funcionales implementados en la pgina web, brindndote una visin ms completa del progreso alcanzado en el proyecto.\r\n','2023-05-18'),(6026,292,'kanban','en el da de hoy me puse a anotar las tareas que haba hecho hasta el omento en el espacio de camba predeterminado hecho anteriormente por mi compaero enzo bartoletti, luego de haber puesto las tareas en sus respectivos lugares proced a realizar unas tareas de otra materia ya que se entrega en el dia y luego de un tiempo y despus de finalizar sus tareas mi compaero Christian forte se sumo. tambin mientras hacia la otra tarea iba observando los cambios que haba mi otro compaero manuel fillipa mientras aplicaba los cambios que se deban hacer en la versi0n de computadora de la app web y le iba indicando algunos cambios a hacer ','2023-05-18'),(6027,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacion - CDD - Camino Critico - Base de Datos','El da de hoy realizamos las siguientes tareas: \r\n- Consideramos en realizar la pestaa de login, de modo que podamos realizar una pequea conexin inicial sobre la pagina web y con la base de datos, por lo que en el dia de hoy empezamos a realizar la psetaa del login, la cual consiste en pedir usuario y contrasea, y da un boton para ingresar. Por el momento el diseo dado a la pestaa convenci bastante y es bastatnte similar a la que diseamos dentro de la maqueta software. Esperamos el poder realizar la pestaa de registro y de algun modo realizar cierta conexion con la base de datos\r\n- Por otro lado, seguimos haciendo ciertos arreglos dentro de la base de datos y demas arrelgos en los inserts y demas, aunque por el moemento no se esta del todo seguro de su funcionalidad para poder conectarla, se esta llevando a cabo cierta actualizacion de la misma. \r\n- Por ultimo, se termino de realizar el camino critico y el Caso de Uso Extendido. \r\n\r\nEso fue todo por hoy.','2023-05-18'),(6028,274,'Login administradores','En el da de la fecha, lo que hice fue modificar el header del inicio de sesin de los administradores. Centr los cuatro links que se encontraban ah, ya que haba mucho espacio innecesario. Luego, hice algunas pruebas en la base de datos, utilizando PHP. Insert un usuario en una tabla y posteriormente lo ingres en el login, que luego me redireccion a la pgina de incidentes. Si pona una contrasea o usuario errneo, me apareca un texto que deca &quot;Usuario o contrasea incorrectos&quot;. Luego, ayud a uno de mis compaeros con el css de la pgina de inicio que ven los usuarios, ya que haba detalles en la barra desplegable que tena inconvenientes en la modificacin de algunos elementos.','2023-05-18'),(6029,290,'Decimotercera','En el da de la fecha lo que realice fue continuar con el inventario, pudimos crear las casillas necesarias para ya ingresar los distintos productos que teniamos que poner dentro de ellas, nos faltan varios detalles todavia pero no creo que nos falte mucho.','2023-05-18'),(6030,289,'18/5','El dia de hoy, trabajamos en seguir completando la pagina web (La parte de formulario), ademas de hacer el logo para la pagina. Eso es todo por hoy,muchas gracias!','2023-05-18'),(6031,275,'Ayuda con la base de datos entre otras cosas ','Lo principal de hoy fue ayudar un poco a Senz en la base de datos, mas que nada porque no tenia ninguna otra tarea asignada, sin embargo lo primero que hice fue mostrarle a Kev