era de proyecto estuvimos principalmente trabajando con la pagina del proyecto referida a las recetas. Esta se trata de que ingresemos ingredientes que tengamos en casa y posteriormente te sugiera una receta con los ingredientes ingresados. No esta terminada por ahora pero estamos en eso.','2023-05-18'),(6036,296,'Bitcora 10','Realice el diagrama de entidad relacin y contine con la pgina web, tuve varios problemas al momento de disear el formulario pero al final lo pude hacer','2023-05-18'),(6037,298,'Clase 13','Hoy cambiamos algunos detalles de la pgina, bamos a comenzar con el diseo 3d de nuestro robot pero nos enfocamos ms en eso.','2023-05-18'),(6038,285,'Da 14 PP','Qu logr hacer hoy?\r\n\r\nAyer hicimos un buen progreso en el desarrollo de la pgina web utilizando HTML. Trabajamos arduamente y logramos avanzar significativamente en el proyecto. Pudimos resolver varios problemas relacionados con la pgina, lo que nos permiti continuar avanzando sin contratiempos.\r\n\r\nEn qu se me complic?\r\n\r\nAunque logramos resolver varios problemas, ahora nos enfrentamos a un nuevo desafo al crear la seccin de &quot;Destacados&quot;. Nos dimos cuenta de que los &quot;cards&quot; que creamos no muestran correctamente el ttulo y la seccin de &quot;Destacados&quot; parece flotar sin conexin con el resto de la pgina. Esto nos ha presentado dificultades para lograr el diseo visualmente coherente que buscamos.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, me dediqu a investigar diferentes enfoques para solucionar el problema que estamos experimentando con la seccin de &quot;Destacados&quot;. Busqu recursos en lnea y le documentacin relacionada con el diseo de &quot;cards&quot; en HTML y CSS. Tambin busque algunos ejemplos de cdigo.\r\n\r\nAdems, investigu sobre las mejores prcticas en diseo web para lograr una integracin adecuada de diferentes secciones en una pgina. Busque el cmo asegurar que cada elemento visual encaje con el resto de la pgina y cmo corregir problemas de alineacin y posicionamiento.\r\n','2023-05-19'),(6039,286,'HTML y CSS de Pgina Usuarios 3','En el da de la fecha, al llegar al aula intent prender el computador pero apareci el mismo error de la semana pasada aunque eso no caus un gran problema ya que al poco tiempo prendi y comenz mi jornada laboral como siempre. Abr Google e inici sesin en mi cuenta, descarge la carpeta &quot;Usuario Web&quot; con la que estuve trabajando ayer, abr el Visual Studio Code y empec a trabajar. Fui buscando partes de cdgo innecesarias y las empec a borrar, correg partes de diseo del formulario desplegable, elimin el &lt;navbar&gt; ya que era innecesario o no era til para nuestro diseo, agregu nuevas opciones y texos, y reubiqu el boton para cerrar el formulario desplegable. Intent reubicar el botn para abrir el formulario desplegable pero no hubo caso. Ms tarde, busqu en Google como hacer el famoso pop-up, el cual es una ventana emergente que aparece al presionar algo de una pgina web, en mi caso la quera aadir para usarlo como una ventana que le pida al usuario si quiere confirmar y enviar el formulario, editarlo o cancelarlo. Econtr un tutorial de cmo hacerlo en una pgina que muchas veces uso para ayudarme a la hora de programar en cualquier tipo de lenguaje, al encontrarla, lo primero que hice fue guardar el link en un bloc de notas que tenemos con el grupo de trabajo . De esta manera, finaliz mi sesin de trabajo de la fecha.','2023-05-19'),(6040,274,'Diseo de login administradores','En el da de hoy, lo que hice fue modificar el diseo de la pgina de los administradores, ya que la paleta de colores no nos convenca y haba algunas funcionalidades que no iban a tener utilidad alguna en la pgina. Por eso elimin el header que contena cuatro links y cambi la paleta de colores a una orientada a la pgina del Gobierno de la Ciudad de Buenos Aires.','2023-05-19'),(6041,292,'Cursos de js y react','En el da de la fecha durante la jornada lo primero que hice fue corroborar en el Github destinado