ambiarla completamente por JavaScript para despues ser traducida al React y MongoDB (base de datos). Usamos informacin de videos de youtube y busquedas en google de paginas de prueba ya finalizadas.','2023-05-19'),(6050,293,'Base de Datos php','hoy da investigue la conexin de base de datos con la pagina web ','2023-05-19'),(6051,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacion - Base de Datos','El dia de hoy estuvimos trabajando en las siguientes tareas relacionadas al proyecto:\r\n- Habiendo terminado con las tareas relacionadas a los diagramas, empezamos a enfocarno aun mas dentro del lado de la codificacion y la base de datos de la pagina web. Habiendo terminado la pestaa de Login, empezamos a disear la pestaa de Registro, de modo que primeramente se pueda registrar a un usuario dentro de nuestra pagina web. Hasta el momento se realizo una pequea base respecto a la pestaa y los datos que pide, pero aun se espera poder disearlo aun mas y darle las funcionalidades que se necesitan para el mismo.\r\n- Por otro lado, se sigue trabajando en la base de datos, habiendole dado un gran avance, se le dio ciertos inserts de modo que esta pueda almacenar algunos datos y demas. Proximamente se estaria probando ciertas consultas para corroborar que esta funcione correctamente. \r\n\r\nEso fue todo por hoy. ','2023-05-19'),(6052,289,'19/5','Hola, el da de hoy, termine de darle unos  ultimo detalles al formulario y registro... personalmente an no me gusta, as que intentare cambiarlo en mi casa. Eso es todo por hoy, muchas gracias! \r\nHasta dentro de 2 semanas :D','2023-05-19'),(6053,273,'Bitacora 19/05/2023','Hoy quise empezar a usar el framework de Spring para realizar el proyecto y el mismo trataba de la misma tecnologa que ReactJS pero en Java. Estuve intentando durante mucho tiempo el cmo intentar compilar un proyecto pero no pude.','2023-05-19'),(6054,275,'Base de datos ','De nuevo ayude un poco a Saenz con la base de datos, comprobando que funcionara correctamente,realizando varios inserts y comprobando si la podiamos conectar a una pagina web de prueba(Porque la de lushop todava no esta terminada),','2023-05-19'),(6055,277,'Onceava Clase','Durante la jornada de hoy, nos enfocamos en el desarrollo de nuestra pgina web para el proyecto en curso. Nuestra principal tarea fue realizar modificaciones en el cdigo CSS con el objetivo de mejorar la esttica y presentacin de la pgina. No obstante, nos encontramos con desafos inesperados que demostraron ser ms complejos de lo que habamos previsto en un principio. Conscientes de la importancia de avanzar en el proyecto de manera eficiente, decidimos posponer temporalmente esta tarea especfica para no estancarnos y dirigimos nuestros esfuerzos a otras reas igualmente relevantes.\r\n\r\nA continuacin, nos centramos en la implementacin de la funcionalidad de PHP en nuestro proyecto. Un logro significativo fue establecer la conexin exitosa entre la pgina web y la base de datos, lo cual nos permitir almacenar las cuentas de usuario que se registren en nuestra plataforma. Para este propsito, utilizamos SQL, un lenguaje de programacin especfico para la gestin de bases de datos. Aunque an nos resta completar la verificacin del Log In, estamos satisfechos con los avances realizados hasta el momento.','2023-05-19'),(6056,288,'Duodcima Clase','Hoy hemos tenido un da productivo en nuestro proyecto, ya que logramos realizar un avance significativo en el cdigo. \r\nEn particular, nos enfocamos en modificar la base de datos y establecer una conexin fluida con el registro de nuestro sistema. Esta actualizacin nos permitir gestionar y almacenar los datos de manera ms eficiente y garantizar un funcionamiento ptimo. Adems de trabajar en la base de datos, tambin nos propusimos mejorar la apariencia visual de nuestro proyecto ajustando el cdigo CSS. \r\nSin embargo, nos encontramos con algunos desafos inesperados que dificultaron este proceso de mejora. Decidimos tomar la sabia decisin de posponer la tarea de optimizar el diseo para un momento ms oportuno. Reconocemos la importancia de una interfaz atractiva y amigable para los usuarios, pero en este momento consideramos que es ms crucial garantizar un funcionamiento estable y una conectividad slida entre la base de datos y el registro. Al posponer la modificacin del cdigo CSS, podemos concentrarnos en resolver cualquier obstculo tcnico pendiente y asegurarnos de que nuestro proyecto funcione de manera eficiente. \r\nValoramos la paciencia y comprensin de nuestro equipo mientras trabajamos en estas mejoras fundamentales. Estamos comprometidos en ofrecer un proyecto slido y confiable, y estamos seguros de que, a medida que superemos estos desafos, alcanzaremos resultados an ms satisfactorios. Seguiremos trabajando arduamente para cumplir con nuestras metas y mantener a nuestro equipo informado sobre los avances en futuras actualizaciones.','2023-05-19'),(6057,253,'Martes 23/05/2023 - Unity','Hoy tuvimos que volver a descargar Unity y Blender.','2023-05-23'),(6058,255,'martes 23 05 2023','hoy avanc con la pgina web del recetonomicon :3','2023-05-23'),(6059,265,'23-05-2023','Hoy tras el daily, mis compaeros y yo acordamos que, como tendriamos que redisear el robot varias veces, cada uno hara un modelo propio para poder as optar por el mejor. \r\nAs que como manejo con ms facilidad Tinkercad, eleg hacerlo ah\r\n','2023-05-23'),(6060,254,'23/05/23','escribi en la carpeta de campo de mis anotaciones sobre java web y empece con el diseo de la pagina\r\n','2023-05-23'),(6061,251,'Curso Laravel pt1 - 23/5/23','El da de hoy empec el curso de Backend de Victor Robles Web de PhP con Laravel para hacer APIs RestFul.','2023-05-23'),(6062,268,'23-05-2023','El dia de hoy despues de la charla con el profesor Nahuel instale el blender mientras la computadora estava desfrisada para asi tenerno para las futuras clases.','2023-05-23'),(6063,267,'23-05-2023','no hice nada','2023-05-23'),(6064,263,'23/5','Hoy no hicimos mucho estuvimos 