de productos y el registro de forma eficiente y cmoda.\r\n	El da de maana buscamos mejorar la pgina visualmente utilizando Bootstrap adems de comenzar el uso de un carrito donde se guarden todos los productos que el usuario decida comprar.','2023-06-01'),(6131,285,'Da 15','Qu logr hacer hoy?\r\n\r\nHoy me dediqu a trabajar en la pgina web del proyecto. Decid reiniciarla desde cero, ya que haba algunos problemas en la versin anterior que necesitaban ser solucionados. Durante el da, me enfoqu en reconstruir la pgina web utilizando las tecnologas de programacin Java, CSS y HTML. Me asegur de aplicar las mejores prcticas en el diseo web para lograr una interfaz atractiva y funcional.\r\n\r\nEn qu se me complic?\r\n\r\nDurante el proceso de reconstruccin de la pgina web, me encontr con algunos problemas al ubicar los inserts. Hubo dificultades para integrar correctamente los elementos de insercin de datos en el flujo de la pgina. Esto requiri un anlisis minucioso y algunas pruebas para identificar y solucionar los problemas de ubicacin. Aunque fue un obstculo, pude superarlo con paciencia y perseverancia.\r\n\r\nQu estuve investigando?\r\n\r\nA lo largo del da, estuve investigando sobre la implementacin de formularios dentro de un modal en una pgina web. Me interesaba aprender cmo crear formularios que se desplegarn en una ventana modal, lo cual proporciona una experiencia de usuario ms fluida y elegante. Investigu diferentes enfoques y tcnicas para lograr este objetivo, y finalmente encontr una solucin adecuada que se ajustaba a las necesidades del proyecto.\r\n','2023-06-01'),(6132,272,'Desarrollo WEB','El da de hoy, junto a mi grupo decidimos volver a empezar la pgina, utilizando de base bootstrap y funciones nuevas en vez de cdigo manual. Header completado y un carrusel puesto para su posterior uso para novedades de productos. Tambin creamos un botn para iniciar sesin utilizando un model (un tipo de notificacin popup) en el cual te salta ah el form y podes iniciar sesin desde ah y registrarse, esto con un botn que te redirecciona a otro model de registro.','2023-06-01'),(6133,298,'Clase 14','Hoy hicimos la base de datos de ingredientes, agregando las categoras de frutas y verduras. Tambin conversamos acerca del diseo del robot e investigamos los posibles componentes a usar.','2023-06-01'),(6134,278,'Clase N15 01/06/2023','En el da de hoy como primer tarea nos juntamos con el equipo a hacer la daily, charlamos de como seguir encarando el trabajo.Yo con tobas continuamos con la pgina web ,  modificamos nuevamente la paleta de colores , tambin editamos es buscador , eliminando algunas lneas de cdigo que no servan y tratando de dejar la pgina  minalista. Tambin agregamos un footer , con el contacto de la empresa y el copyright.Por ltimo empezamos a editar celda por celda donde van a encontrarse cada producto de la muebleria.','2023-06-01'),(6135,279,'Dia 13 del Proyecto','En el dia de hoy estuve mayormente en todo mi tiempo estando aun mirando los videos de como usar react aunque aun asi no lo sigo de comprender en como poder usarlo, si entiendo de como funciona pero no saber como poder usarlo en nuestro proyecto o como usarlo fuera del ejemplo que usa midudev.','2023-06-01'),(6136,286,'HTML y CSS de Pgina Usuarios 4','El da de hoy retom con la materia debido a los paros de la semana pasada. Al llegar al aula, me sent en una de las computadoras que ya estaban prendidas, abr mi navegador de confianza e inici sesin para poder descargar la carpeta de &quot;Usuario Web&quot; y poder seguir, continu abriendo el Visual Studio Code para programar, descargu la extensin &quot;Live Server&quot; para que se me haga mas cmoda la programacin y empec a trabajar. A falta Enzo Bartoletti (nuestro Scrum Master) tuve que recurrir a las opiniones de mis otros compaeros de trabajo sobre qu ms debera agregarle a la pgina, ellos inmediatamente me recomendaron que averigu la forma de meter el mapa de la api dentro de la pgina, para que se vea similar al prototipado. Empec buscando en Google cmo meter un cdigo HTML dentro de otro HTML y la primera pgina que vi me daba la solucin que buscaba, pero esta era muy compleja, por lo que me decant a abandonar este mtodo y buscar otro. Abr otra pgina que me daba una solucin muchsimo ms simple y al mismo tiempo efectiva. Segu los pasos que me indicaba la pgina y funcion. Segu intentando ajustar el ancho y largo del mapa pero me top con un problema, el botn para abrir el formulario segua molestando. A medida que intentaba arreglarlo, aparecan ms problemas hasta que pude dar con la solucin. Lo ubiqu en el centro de la pantalla a la izquierda, esta vez pegado completamente a la izquierda, sin ningn tipo de separacin entre el borde del monitor y el botn.\r\nAdems, ayud un poco a mi compaero Christian Forte con el diseo del login de la pgina de Administrador, buscando fuentes para los textos que se mostraran en pantalla. Tambin le proporcion un poco de ayuda a mi compaero Ezequiel Ledesma para hacer que el usuario pueda interactuar con el mapa. Al final no encontramos la solucin pero hubo un pequeo avance el cual nos ayudar ms tarde.','2023-06-01'),(6137,284,'bitacora 13','hoy estuve realizando un login para la pagina web de nuestro proyecto , me investigue mucho en internet para poder realizar un login bastante bueno estticamente , la proxima clase lo continuar y ya lo finalizo y comenzamos con las conexiones con las bases de datos','2023-06-01'),(6138,292,'pop up en la api e investigacin  ','En el da de la fecha mi tarea era continuar con la api que habamos dejado de hacer debido a que no asistamos a clases. al descargar y abrir el archivo note que una de las funciones que tiene que es tener texto encima de un pop up haba desaparecido junto con el pop up, estuve bastante tiempo hasta despus del receso donde pude averiguar el error y continuar donde se habia dejado la ultima vez, me haban dicho de hacer js pero decid agregar la funcin de que se agregue un pop up al hacer clic y luego de visitar muchas pginas y videos pude lograr que al hacer un click salta las coordenadas de el lugar que cliqueo, aunque no es lo que quera hacer, ya era bastante yy con la ayuda de mi compaero manuel logramos dar con la soluciones de problemas de cdigo que iba teniendo. luego de lograr que mostrara la coordenada estuve mas de media hora visitando pginas y viendo videos en youtube buscando la posibilidad de completar la tarea pero no lo consegu \r\n','2023-06-01'),(6139,293,'Base de Datos login','hoy dia hice el login y registrar en base de datos','2023-06-01'),(6140,280,'Node','El dia de hoy se realizo la union de la pagina a mysql utilizando node. Se trato de minimizar la cantidad de codigo necesario para la creacion y automatizacion de los procesos asi poder agilizar las operaciones a futuro. Se utilizaron paginas de hosting gratuito para probar y asi no tener que ingresar cada sesion la bd. Esto no se pudo lograr ya que el mismo node no permite la utilizacion de estos hosting por lo que se hizo individualmente cada uno de los procesos.','2023-06-01'),(6141,288,'decimotercera clase','Hoy realizamos la pagina web y la base de datos de nuestra pagina web, le pusimos el nombre LiliFy, realizamos lo que seria la navegacin por la pagina, de una pagina a la otra y el registro y login de la misma. Todo sali como esperamos y logramos realizarlo de perfecta forma, aun nos falta pulir varias de las cosas de la pagina, pero ya se guardan en la base de datos y tenemos insertados algunos de los productos que teniamos en mente, y se pueden ver grficamente en nuestra pagina web','2023-06-01'),(6142,295,'Modelo 3d - Investigacion pagina','En el dia de hoy junto a mi compaero hicimos el diseo de lo que sera la parte fsica de nuestro proyecto que es un robot, lo primero que realizamos fue buscar ideas de diseos en la pagina de Thingiverse para poder fabricar la nuestra. Encontramos una que era un Baymax, luego lo pasamos a Tinkercad para ver bien el diseo y como quedaba en la escala real, cuando lo vimos ahi llegamos a la decisin con mi grupo de que no nos gustaba del todo, entonces buscamos mas ideas y nos gusto un diseo ya creado y decidimos usarlo  de ejemplo para poder llevar a cabo uno de nosotros mismos. El diseo quedo con una base circular, una rueda abajo de la misma y arriba con una pantalla lcd. Finalmente buscamos en el navegador tipos de ingredientes de todo el mundo para nuestra pagina web del proyecto. Para esto usamos chat GPT y paginas relacionadas.','2023-06-01'),(6143,289,'01/06','Ya en junio!!\r\nEl da de hoy, luego de hacer la Daily, con mi compaera Carito, hemos decidido comenzar el robot. Les asigne a mis compaeros empezar sus tareas. Mientras que con mi compaera, comenzamos a buscar los componentes de los cuales utilizaremos para comer hacer el robot. Al principio nuestra idea seria utilizar arduino, ya que era mas economico. \r\nLuego, el profesor Consorti nos comento que podamos usar Blaspberry ya que tienen una placa que nos prestaran, as que terminamos optando por eso. Luego buscamos un simulador (lo encontramos), y luego comenzamos a trabajar en la db de los ingredientes de lo que ser la pagina. Eso es todo por hoy, muchas gracias!','2023-06-01'),(6144,274,'Diseo de login, cyberseguridad','En el da de la fecha, lo que hice fue finalizar de una vez por todas el inicio de sesin de los administradores. Inici cambiando el diseo, ya que no me convenca que el diseo anterior se asemejaba demasiado al de la pgina oficial de la Ciudad de Buenos Aires. Lo reemplaz por un diseo ms minimalista, con una paleta de colores en blanco y negro. Luego, junto a un compaero, buscamos una fuente para el botn de ingresar en google fonts y en dafont, ya que la fuente que tenamos no coincida demasiado con el diseo. Cuando finalizamos esto, me dediqu a aadirle el cdigo necesario al login para que no sea vulnerable a inyecciones sql. Hice esto ya que estamos viendo este tema en una materia y nos dimos cuenta de que sera necesario implementar esto en un futuro.','2023-06-01'),(6145,281,'Dia 10','Hoy realizamos la pgina web y la base de datos de la misma, le pusimos el nombre LiliFy, hicimos lo que sera la interfaz visual de la pgina, el login y el registro. Estamos pensando en hacer un logo para la pgina, adems de que faltan un par de cosas como el sistema de carrito de compra, el registro de la compra y un par de cosas ms. \r\nYo creo que con el tiempo vamos a ir perfeccionando la pgina poco a poco, pero por ahora est quedando bien. Ya tenemos una base de datos con los clientes y productos. \r\n\r\nTambin est conectada la base de datos con el form mediante php, esta nos permite ingresar clientes y productos. Lo que s, tendramos que averiguar cmo editar y borrar estos as lo incluimos en el proyecto.\r\n','2023-06-01'),(6146,275,'Base de daos y pagina web conectada ','Hoy lo que se decidio hacer es crear una bases de datos para el login de la pagina, Saenz y yo hicimos eso para despues conectar esta base de datos con la pagina web, ya podemos logear usuarion en la pagina de lushop, tambin vimos algunos errores en cuanto al css de la pagina.','2023-06-01'),(6147,296,'Bitcora 11','Durante la daily nos replanteamos cambiar el formato.Al final decimos cambiar todo el diseo de la pgina y nos dividimos cada parte, yo empeze a. Hacer la parte de retirar y ingresar productos','2023-06-01'),(6148,273,'Bitacora 01/06/23','Hoy llegamos y realizamos la pertinente daily, donde hablamos sobre lo que realizara cada uno para poder crear la pgina y la aplicacin mvil.\r\nPor mi parte, empec a probar a usar Spring (por fin pude instalarlo correctamente) e hice un Hello World para demostrar que este funcionaba.\r\nSegn estuve averiguando, Spring es una tecnologa muy avanzada y no voy a poder dominarla en menos de 6 meses, por lo que creo que har el proyecto en pginas JSP y Servlets. Posteriormente, empec a realizar las clases que usaran las pginas JSP y los servlets. Realic una clase Mueble que tendra toda la informacin de los muebles a ingresar. Luego, hice las funciones que ayudaran a realizar el cdigo de forma ms ordenada (los getters y setters) y luego el toString, para mostrar la informacin del mueble de una forma ordenada. A su vez, tambin realic la clase de Usuario, que servir para poder identificar a nuestros clientes. Los mismos debern proporcionar un nombre de usuario, su nombre, su apellido, DNI y una contrasea para registrarse, y para iniciar sesin tendrn que colocar el nombre de usuario y la contrasea. Despus de todo esto, empec a programar la interaccin de java con la base de datos SQL. Luego, hice las funciones que serviran para hacer inserts y selects desde java. Estos serviran para agarrar informacin de la base de datos, a la vez que desde los servlets podra hacer inserts con informacin mediante requests de html. Luego de hacer la fase preliminar de cmo seran los distintos objetos del proyecto, empec a programar los servlets. Eleg hacer todos los requests en forma de Post, por lo que tuve que hacer una funcin en los servlets que sirva para registrar a los usuarios.','2023-06-01'),(6149,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexion','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Por un lado, seguimos realizando las pestaas de Login y de Registrarse para nuestra pagina web, las cuales ya fueron codificadas y diseadas muy similares a las que se determinaron en la Maqueta Software. \r\n- Ademas de eso, empezamos a configurar en la base de atos, una tabla que guarde datos relacionados al usuario a la hora de ingresar o registrarse en nuestra pagina, y de modo de ejemplo hicimos un unico insert para que a la hora de probar el login de nuestra pagina, podamos corroborar su funcionalidad. \r\n- Habiendo realizado esto, decidimos hacer una peuqea conexion de la pagina web con la base de datos, habiendo utilizado el lenguaje PHP y el XAMPP para poder una conexion entre ambas. Creamos un archivo que crea la conexion con la base de datos, la cual usamos luego en otros archivos. Configuramos las pestaas de Login (al ingresar con el Email y la Contrasea, se crea otro archivo en el cual se genera el proceso de inicio de sesion, en el cual se genera una consulta que busca a un usuario mediante su email y su contrasea, y si estas coinciden con los datos dentro de la base de datos, se lleva al usuario al inicio de nuestra pagina web, en la cual se le configura una forma de cambiar el icono individual, incluyendo el Nombre del usuario que haya ingresado, tambien dando la opcion de ingresar a una pestaa de perfil en la que puede ver sus datos y cerrar sesion en caso de que quiera ingresar con otra cuenta, aunque la pestaa de perfil no esta totalmente diseada por el momento) y Registro (en esta se completan los campos con la informacion solicitada, se confirma la contrasea, y se genera un proceso en el cual se genera una consulta que agrega los datos dentro de la tabla de usuario, de modo que al querer iniciar sesion, su usuario este disponible poder ingresar sin problemas).\r\n\r\nEso fue todo por hoy.','2023-06-01'),(6150,290,'Decimoquinta','En el da de hoy como primer tarea nos juntamos con el equipo a hacer la daily, Yo con mi compaero gero comenzamos a trabajar con la pagina para que se vuelva funcional y cambiar algunos diseos que no nos gustaron, aadimos un footer, modificamos el boton de buscar y dentro de la tabla borramos algunas funcionalidades','2023-06-01'),(6151,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexion','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Por un lado, seguimos realizando las pestaas de Login y de Registrarse para nuestra pagina web, las cuales ya fueron codificadas y diseadas muy similares a las que se determinaron en la Maqueta Software. \r\n- Ademas de eso, empezamos a configurar en la base de atos, una tabla que guarde datos relacionados al usuario a la hora de ingresar o registrarse en nuestra pagina, y de modo de ejemplo hicimos un unico insert para que a la hora de probar el login de nuestra pagina, podamos corroborar su funcionalidad. \r\n- Habiendo realizado esto, decidimos hacer una peuqea conexion de la pagina web con la base de datos, habiendo utilizado el lenguaje PHP y el XAMPP para poder una conexion entre ambas. Creamos un archivo que crea la conexion con la base de datos, la cual usamos luego en otros archivos. Configuramos las pestaas de Login (al ingresar con el Email y la Contrasea, se crea otro archivo en el cual se genera el proceso de inicio de sesion, en el cual se genera una consulta que busca a un usuario mediante su email y su contrasea, y si estas coinciden con los datos dentro de la base de datos, se lleva al usuario al inicio de nuestra pagina web, en la cual se le configura una forma de cambiar el icono individual, incluyendo el Nombre del usuario que haya ingresado, tambien dando la opcion de ingresar a una pestaa de perfil en la que puede ver sus datos y cerrar sesion en caso de que quiera ingresar con otra cuenta, aunque la pestaa de perfil no esta totalmente diseada por el momento) y Registro (en esta se completan los campos con la informacion solicitada, se confirma la contrasea, y se genera un proceso en el cual se genera una consulta que agrega los datos dentro de la tabla de usuario, de modo que al querer iniciar sesion, su usuario este disponible poder ingresar sin problemas).\r\n\r\nEso fue todo por hoy.','2023-06-01'),(6152,283,'php, pagina y base de datos 2 ','El dia hoy comenzamos haciendo la daily para luego empezar a decidir el rumbo q va a tomar la pagina y/o el proyecto, entonces entre los integrantes del grupo empezamos a arreglar casi tdo el proyecto para ser mas concretos solo el diagrama de entidad relacion, el figma, la base de datos, empezamos de 0 la pagina.\r\nEn el figma agregamos un iniciar sesion.\r\nLuego en la base de datos cambiamos algunas cosas de la tabla cliente y otras de la misma base de datos.\r\ndentro de la pagina cambiamos algunas cosas del css y el php para agregar un login para el usuario y register. De los mismo falta crear una otras partes mas con php asi podemos conectar la misma pagina con la base de datos anteriormente creada.','2023-06-01'),(6153,291,'Avance del proyecto','El da de hoy realizamos la daily como de costumbre, realizamos las tres preguntas correspondientes y la terminamos, un miembro del grupo falto y no pudimos estar completos pero no importo mucho ya que comenzamos a trabajar en la pgina y el PHP, yo realize el cdigo PHP para la pgina con el cual avanze pero me trabe y busque un video que pudiera ayudarme, encontr un video que explicaba como armar un carrito el cual fue de mucha utilidad ya que tenamos que hacer uno y ahora tenemos una gua para este, a mis compaeros se les ocurri actualizar la pgina a un modelo ms moderno, es una buena idea pero tomar un poco de tiempo ya que tenemos gran parte de la pgina hecha lo que significa que actualizarla no va a hacer mucho problema.','2023-06-01'),(6154,295,'Modelo 3d - Investigacion pagina','En el dia de hoy junto a mi compaero hicimos el diseo de lo que sera la parte fsica de nuestro proyecto que es un robot, lo primero que realizamos fue buscar ideas de diseos en la pagina de Thingiverse para poder fabricar la nuestra. Encontramos una que era un Baymax, luego lo pasamos a Tinkercad para ver bien el diseo y como quedaba en la escala real, cuando lo vimos ahi llegamos a la decisin con mi grupo de que no nos gustaba del todo, entonces buscamos mas ideas y nos gusto un diseo ya creado y decidimos usarlo  de ejemplo para poder llevar a cabo uno de nosotros mismos. El diseo quedo con una base circular, una rueda abajo de la misma y arriba con una pantalla lcd. Finalmente buscamos en el navegador tipos de ingredientes de todo el mundo para nuestra pagina web del proyecto. Para esto usamos chat GPT y paginas relacionadas.','2023-06-01'),(6155,294,'Diseo 3d / Investigacin para pagina web ingrediente','\r\nEl da de hoy hice junto a mi compaera el diseo 3d para el robot de nuestro proyecto, buscamos ideas y lo fuimos debatiendo en grupo para llegar a un acuerdo de que tipo o modelo de robot queramos, hasta que llegamos a la conclusin de que iba a ser con la base redonda, la cual tendra una rueda debajo para el desplazamiento del robot y en la parte de arriba una pantalla. Adems de eso luego hicimos una investigacin de lo que seran los ingredientes para poder agregar a la base de datos de nuestra pagina web.','2023-06-01'),(6156,286,'HTML, Base de Datos y PHP de Pgina Usuarios','El da de la fecha comenz normal y tranquilamente, sin ninguna complicacin, mi computadora encendi normalmente por lo que me permiti empezar a trabajar antes. Abr Google Chrome, inici sesin en mi cuenta y descargu la carpeta de &quot;Usuarios Web&quot; para continuar con lo de ayer. Abr el Visual Studio Code y met ah todo lo que iba a necesitar para trabajar. Una vez todo listo, no saba por donde empezar, por lo que consult con mi compaero Enzo Bartoletti (Scrum Master del equipo de trabajo) el cual no me supo dar una respuesta concisa, por lo tanto, decid empezar a hacer la base de datos, dentro de esta base de datos se debera guardar la informacin que se ingresa en el formulario de la pgina, entonces tuve que modificar muy poco del cdigo HTML agregndoles la propiedad &quot;name&quot; a cada elemento para que este pueda tener una relacin directa con el PHP y la Base de Datos, hice una tabla pero no la complet toda, con mi compaero Christian Forte necesitamos buscar ms informacin para que concluya. Una vez &quot;terminada&quot; la tabla, comenc con el PHP. Para esto, us un trabajo del ao pasado que me sirvi para hacer la de esta pgina, no fue muy complicado ya que solamente tuve que cambiar los valores y agregar nuevos. Ya hecho todo esto, consult de nuevo con mi compaero Christian Forte si todo lo que haba hecho estaba bien, ya que a l se le da mucho mejor la programacin y es ms experimentado. De esta forma, concluy el da de hoy.','2023-06-02'),(6157,281,'Dia 11','El da de hoy incorporamos un nuevo mtodo para agilizar algunas tareas y que en s todo quede ms ordenado. La herramienta que utilizamos se llama Bootstrap.\r\nBuscamos una barra de navegacin y la estuvimos editando segn nuestras preferencias. Le cambiamos el color a la letra y le pusimos Lilify, intentamos poner una imagen como boton pero pudimos, seguramente mas adelante lo volvamos a intentar.\r\n','2023-06-02'),(6158,277,'Dcimo Tercera Clase','El da de hoy, hemos llevado a cabo una importante reestructuracin de nuestra pgina web utilizando Bootstrap, la reconocida biblioteca de cdigo abierto. Durante este proceso, hemos realizado diversos cambios significativos para mejorar tanto la funcionalidad como el aspecto visual de nuestro sitio.\r\n\r\nUno de los cambios ms destacados ha sido la renovacin de nuestra barra de navegacin. Hemos reemplazado el navbar anterior por uno ms elegante y estilizado, que ofrece una experiencia de usuario ms intuitiva y atractiva. Adems, hemos decidido incorporar una imagen que servir como el nuevo logo oficial de nuestra empresa, brindando as una identidad visual slida y reconocible.\r\n\r\nAdicionalmente, hemos decidido oficialmente cambiar el nombre de nuestra pgina a &quot;Lilify&quot;, un nombre que representa nuestra visin y misin como empresa. Este cambio refuerza nuestra marca y nos ayuda a destacar en el competitivo mundo digital.\r\n\r\nEn trminos de diseo, nos hemos enfocado en mejorar los aspectos visuales tanto de la pgina principal como de la pgina de registro. Hemos realizado ajustes en la disposicin de elementos, seleccionado colores ms atractivos y utilizado tipografas modernas para brindar una experiencia visualmente agradable a nuestros usuarios.\r\n\r\nAunque hemos logrado un progreso significativo hoy, an nos queda trabajo por hacer. Para maana, nos hemos propuesto completar la pgina de inicio de sesin y la seccin de productos. Estamos comprometidos en ofrecer a nuestros usuarios una experiencia fluida y satisfactoria, por lo que nos esforzaremos en garantizar que estas secciones estn completamente funcionales y en sintona con el nuevo diseo de Lilify.\r\n\r\nEstamos emocionados por los cambios realizados hasta ahora y confiamos en que nuestra pgina web renovada ser un xito. Seguiremos trabajando arduamente para cumplir con los objetivos establecidos y proporcionar a nuestros usuarios una plataforma de calidad excepcional.','2023-06-02'),(6159,282,'Implementacion del mapa con el form','En el dia de hoy trabajamos al 100% en el diseo web de la plataforma BaVigila, siendo que logramos implementar el mapa de LeaFlet en conjunto al form de ingreso de denuncias y que este funcione, quedando como faltante el PHP.\r\nTambien finalizamos el marcado de datos, usando el elemento marker de la API','2023-06-02'),(6160,273,'Bitacora 02-06-2023','En el da de la fecha tuve un problema con la versin de apache netbeans que no reconoca los comandos para usar Java EE, por lo que estuve todo el da tratando de solucionarlos hasta que al final del da por fin pude ver qu era. Luego, empec a realizar el servlet de Login que servira para poder identificar a los distintos usuarios que usen la respectiva pgina. El mismo servlet necesita de parmetros dos atributos que vendrn del POST: nombre de usuario y contrasea. Posteriormente a esto, sern redireccionados a la pgina donde podrn administrar la base de datos.','2023-06-02'),(6161,274,'PHP del login','En el dia de la fecha, finalic la parte de php de la pgina, ya que haba un error en el cdigo el cual pude solucionar. Utilic un cdigo que nos haba dejado el profesor de otra materia y le cambi el nombre a las variables. Una vez que solucion esto, el administrador podr ver una tabla con los incidentes reportados. Esta tabla la dise antes de editar el php, aunque no me llev mucho tiempo. Posteriormente, le aad una funcionalidad para que el administrador pueda cerrar sesin.','2023-06-02'),(6162,292,'Pop up en la api','En el da de la fecha con la vuelta de mi compaero Enzo bartoletti continuamos con la opcin de pop up que no haba logrado agregar al cdigo, probamos con varios cambios en el cdigo pero todos resultaban en error o en que la pgina se rompiera, debido a eso letras Enzo ayudaba a otros compaeros, entre a una pgina de una ia para ver si poda solucionar este problema y lo logro, no solo se agregaban Pops up con un click, sino que tambin se borraban. Trate tambin de agregar otra funcin pero estaba en otro lenguaje que no sabamos y lo dejamos para otro momento ','2023-06-02'),(6163,285,'Da 16','Que logre hacer hoy?\r\n\r\nEl da de hoy continu desarrollando la pgina web desde donde lo habamos dejado. Me enfoqu en resolver algunos problemas especficos que surgieron. Uno de los inconvenientes que encontr fue que las cards en la pgina cubran toda la pantalla cuando se haca zoom, lo cual afectaba la usabilidad del sitio. Sin embargo, estoy tranquilo porque mi compaero de trabajo, Thiago Arroyo, se encargar de solucionar este problema.\r\n\r\nAdems, aprovech el da para crear algunos banners que sern utilizados en los carruseles de la pgina. Me dediqu a disearlos cuidadosamente para que fueran atractivos visualmente y se ajustaran al estilo general del sitio web. Estoy satisfecho con los resultados y creo que los banners lucen bien.\r\n\r\nEn qu se me complic?\r\n\r\nAfortunadamente, no experiment mayores complicaciones durante el da. Sin embargo, el problema con las cards y el zoom en la pgina fue un obstculo que encontr. Por suerte, s que puedo contar con la ayuda de Thiago Arroyo, quien se encargar de resolver este problema tcnicamente.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, invert tiempo en investigar diferentes aspectos relacionados con el proyecto. Me enfoqu principalmente en aprender ms sobre el diseo web y cmo mejorar la experiencia del usuario en la pgina. Investigar sobre el comportamiento de las cards y cmo adaptarlas a diferentes resoluciones y tamaos de pantalla fue uno de mis principales objetivos.\r\n\r\nAdems, aprovech para investigar sobre cmo crear banners atractivos y efectivos para los carruseles de la pgina. Busqu inspiracin en diseo grfico y explor diferentes tcnicas para asegurarme de que los banners cumplieran con los estndares de calidad y atrajeran la atencin de los visitantes del sitio web.\r\n\r\nPor ltimo, aunque no estuvo directamente relacionado con mi trabajo, tambin estuve al tanto de los avances de mis dos compaeros de trabajo, quienes se centraron en arreglar problemas relacionados con PHP y la base de datos. Me alegra saber que les fue bien en sus tareas y que estn contribuyendo positivamente al proyecto en general.','2023-06-02'),(6164,293,'Tabla de producto','hoy da contine con la base de datos haciendo la tabla producto y me faltan 2 tablas mas.','2023-06-02'),(6165,280,'Retrasos','El dia de hoy se tuvo q rehacer todo el contenido de ayer ya que nos e guardo en als carpetas correspondientes. \r\nCulminado esto se siguio donde se dejo el dia de ayer ahora ingresando datos y haciendo select','2023-06-02'),(6166,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos trabajando en base a la conexion entre la base de datos y la pagina web. Habiendo terminado de configurara las pestaas de Login y Registro, empezamos a configurar la pestaa de recuperacin de contraseas, de modo que al olvidar la contrasea, el usuario pueda solicitar una forma de recuperarla, la cual por le momento consistira en generar una contrasea que se le envi por correo, la use una vez y luego la cambie directamente desde su perfil, por lo que se tiene en mente crear una pestaa mediante la cual se pueda cambiar los datos del usuario si asi el mismo l