fectar el trabajo hecho por mis compaeros. Igualmente he encontrado un video de un chabon donde explica mas a fondo que puede tener una tienda online, seguir viendo sus videos para poder agarrar ideas e implementarlas en nuestro proyecto. \r\n','2023-06-08'),(6204,279,'Dia 14 del Proyecto','En el dia de hoy estuve reviendo los videos de midudev porque al final de mirarlo todos no pude entender como funcionaba asi que empeze a mirar el primer video y seguir lo que hacia para saber como funcionaba poco a poco con un ejemplo de una foto de usuario y parecido.','2023-06-08'),(6205,293,'Base de Datos Tabla compra','hoy da me dedique hacer la tabla de compra donde esta las tarjetas, cdigo de seguridad y cdigo QR.','2023-06-08'),(6206,274,'Diseo de tabla de incidentes, ayuda con css del mapa','En el da de la fecha lo que hice fue aadirle nuevamente un cdigo anti inyecciones SQL, ya que la clase pasada se lo haba eliminado por error. Luego, cambi el diseo de la tabla, ya que los datos ingresados en la base de datos quedaban descentrados en las filas. En paralelo, iba ayudando a un compaero de grupo con su trabajo que tena la tarea agregarle css al mensaje emergente de la API del mapa, aunque ambos no tenamos mucho conocimiento acerca de eso, logramos un avance. Cambiamos el color de fondo del formulario que contiene los datos del incidente y tambin la fuente. Adems, lo ayud a aadirle una funcionalidad de agregar los pop ups en una zona, aunque no pudimos llegar a nada. ','2023-06-08'),(6207,292,'aspecto de la api y fallo al implementar una funcin nueva ','En el dia de hoy 8 de junio me dedique por ordenes de mi scrum master enzo bartoletti que no asisti a la jornada, deba agregar js al pop up que emerge al hacer clic en el mapa de la api ya que consideraba que estaba vaco y no ayudaba con la vista de la app, por lo que me puse a buscar tutoriales de js y con ayuda de mi compaero Christian forte puse mejorar el aspecto del mensaje del popup, despus le cambie la fuente tambin con ayuda de mi compaero ya que no sabia donde colocar el cdigo. Ya con  eso terminado me puse a buscar otra funcin que no pude implementar hasta ahora y despus de muchos intentos y de cambiar mucho cdigo no pude lograr e resultado ya que la pagina falla. Maana tratare de implementar esta funcin ','2023-06-08'),(6208,273,'Bitacora 08-06-2023','En el da de la fecha realizamos una daily hablando sobre cmo ibamos con el proyecto. Por parte del diseo de la pgina, ya est realizada en su mayora. Con respecto a lo dems, se sugiri hacer un cambio a la base de datos, cambiando Mueble por distintos tipos de muebles guardados en tablas especficas, tales como Cama, Armario, Mesa, Silla, etc.\r\nLuego de realizarlas, empec a realizar las procedures dentro de sql que ayudaran a realizar los inserts dentro de la base de datos cuando vaya a programar en Java. Los mismos eran, realizar las funciones de InsertarCama, InsertarMueble, InsertarArmario e insertarMesa, y de esta forma daran una seguridad extra a la hora de usar la pgina. Posteriormente, empec a realizar las funciones en java para realizar las conexiones, y a su vez tambin hice una funcin que busque todos los muebles que contengan cierta caracterstica y cierto argumento que el usuario mismo puede pedir. ','2023-06-08'),(6209,275,'Base de datos ','Hoy lo que hice fue continuar junto con mi compaero Senz todo lo que seria la base de datos, ya tenamos el cdigo hecho de las \r\npartes de datos personales en donde pedan el Email, Nombre, DNI, telfono entre otras cosas, hoy hicimos la de domicilio y entrega que peda\r\ncalle, provincia, altura, ciudad, fecha de entrega y cdigo postal.\r\nDespus hicimos la de paso de compra que peda tarjeta de crdito, debito, mercado pago, numero de la tarjeta, elegir cuantas cuotas quera,\r\ncdigo de seguridad fecha de vencimiento, si era MasterCard o visa, todo eso lo tenamos que pasar a php y probarlo tambin hay que ver como hacer un QR\r\npero en general bastante bien hoy, la base de datos ya casi esta completa, solo falta la factura que todava no la terminamos en la maqueta y hay que ver bien como ponerla en la base de datos.','2023-06-08'),(6210,280,'','El dia de hoy se nos presento distintos hardware para ser utilizados en nuestro proyecto los cuales era el raspberry arduino y un notbook convencional. Se nos informo de las ventajas y desventajas de los mismo y terminamos decidiendo el uso de la notebook convencional ya que a la hora de trabjar es mucho mas practico y podriamos enfocarnos mas en toda la electronica y para el software de la pagina solo hariamos una especie de interfaz general la cual permita visualizar directamente las recetas en el robot mismo y en un celular','2023-06-08'),(6211,277,'Dcimo cuarta clase','El da de hoy estuvimos continuamos trabajando con la pgina web, LiliFy, mis compaeros estuvieron haciendo el logo de la pgina, el cual al final qued como un cuadrado celeste con la palabra Lify en cursiva dentro y una estrella amarilla al costado, crearon un modelo 3D para vender, un llavero de nirvana, y encontraron muchos otros.\r\n	Por mi parte estuve haciendo recreando la pgina desde cero, usando Bootstrap para mejoras visuales y optimizacin de cdigo, cambiamos el color de la pgina de un verde con amarillo a un rosa con celeste y ya termine la pgina principal, donde se muestran descuentos y productos destacados, la de productos, donde hay una larga lista de productos para comprar adems de una pendiente barra de bsqueda y separacin por categoras, la de registro y la de inicio de sesin.\r\n	Todava nos faltan muchas cosas de todas formas, el logo no est del todo terminado, adems de que hay que ponerlo en la pgina, y hay que mejorar toda la pagina en si, todava nos falta el sistema de carrito, los productos, imprimir una muestra 3D de estos y subir las fotos para su venta.','2023-06-08'),(6212,278,'Clase N 17 08/06/2023','Hoy comenzamos el da realizando la daily , nos dividimos los trabajos , yo me puse a continuar con la realizacin