prueba para poderla implementarla y mejorarla mas adelante. \r\n\r\nEso fue todo por hoy.','2023-06-08'),(6214,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos realizando ciertos arreglos dentro de la base de datos, esta vez habiendo configurado la misma con una tabla para los productos, de modo que podamos exhibirlos en la pagina de inicios donde se encontrarian algunos de los productos que se encuentran en promocin, tanto lencera, medias, pijamas y demas. Y de este modo podamos mostrar la imagen almacenada dentro de la base de datos, y tambien demas datos como el nombre del producto, su descripcion, precio, etc (Aunque tambien cuenta con otros datos los cuales en este caso no seran necesarios por el momento).  \r\n- Habiendo realizado lo anterior, configuramos el codigo de la pagina web para que por cada insert que haya dentro de la tabla de productos, muestre los datos mencionados anteriormente, y el resultado fue muy bueno, y a su vez configuramos todo para que por cada producto se genere una card y una fila por cada 4 cards, haciendo una fila debajo de una y asi sucesivamente entre los productos que se encuentren dentro de la tabla de productos. Quedaria hacer los inserts dentro de la base de datos para que muestre demas productos.\r\nPor otro lado, aclaramos que por el momento esto seria una prueba, por lo que no estaria del todo terminada esta parte, pues tambien debemos repartir los productos por las diferentes secciones que se encuentran dentro de la pagina Web, por lo que por el momento lo realizado queda como prueba para poderla implementarla y mejorarla mas adelante. \r\n\r\nEso fue todo por hoy.','2023-06-08'),(6215,289,'8/06','El da de hoy, luego de ir de ac para all con el modelo 3d, que la pantalla, que esto que lo otro, hemos decidido cambiar de proyecto. Volveremos a hacer todo de 0, sea no pero s.Haremos algo tipo computadora. Luego tendrn ms detalles, eso es todo por hoy..... Muchas Gracias!!!\r\nPD: Pongan un gato de fondo de la pagina. ','2023-06-08'),(6216,295,'Diseo 3d - Cambio de idea de proyecto ','En el da de hoy lo primero que hice fue el diseo que anteriormente hice con mi compaero la clase pasada, lo volv a dibujar en una hoja para despus poder llevrselo al profesor (encargado de la impresin 3D) para que nos ayude a pasar ese diseo al programa de AutoCAD, nos di alguna de sus opiniones para poder cambiar algunas cosas, tambin vimos el tema de las ruedas, de lo que ira adentro del cuerpo del robot y lo que sera el cuello para poder unirlo con la parte de arriba.\r\nDespus de hacer eso, volvimos al aula y tuvimos que debatir algo en grupo, ya que la pantalla como del tamao que queramos no estaban dentro de nuestro presupuesto. Los profes nos dieron la idea de usar una mini computadora llamada Pi Top, la cual podamos usar al desarmarla, para lo que seria la parte de arriba del robot. Y por ltimo tomamos la segunda decisin del da la cual es reformular la forma en la que vamos a llevar a cabo el proyecto.','2023-06-08'),(6217,281,'Dia 12','El da de hoy estuvimos buscando modelos 3d para incluir en la pgina web. Ya tenemos 18 artculos que podramos vender en esta. Ademas al final de la clase empezamos a disear el logo de LiliFy, estuvimos discutiendo sobre como seria, pero al final nos decantamos por uno que diseo mi compaero Matias Ruiz.','2023-06-08'),(6218,288,'Clase 15','Hoy mi equipo y yo trabajamos en poder buscar modelos 3d para nuestra respectiva pgina, la prxima clase los insertaremos dentro de la pagina, adems logramos hacer un boceto de el logo de nuestra pagina LILFY, por el programa Paint.net, la proxima clase tambien intentaremos insertarlo dentro de nuestra pagina.','2023-06-08'),(6219,296,'Bitcora 12','Continuamos con el diseo de la pgina,cada uno hizo pagina y fuimos juntando los diseos para ver cul era el que ms nos gustaba y fuimos juntando las partes que ms gustaban ','2023-06-08'),(6220,285,'Da 17','Qu logr hacer hoy?\r\n\r\nEl da de hoy me enfoqu en el armado de una de las pginas web pendientes. Mientras Thiago se encarga de la pgina principal, asum la tarea de desarrollar la pgina de compra. Inicialmente, tena la intencin de hacer la pgina del carrito, pero descubr que requera demasiados elementos adicionales, como componentes de JavaScript. Me result bastante complicado avanzar con esa pgina, as que decid cambiar y concentrarme en la pgina de compra.\r\n\r\nDurante el da, me dediqu principalmente a trabajar en la estructura HTML de la pgina de compra. Estoy muy cerca de completarla y creo que para el viernes podr tenerla lista. Planeo mostrarle el progreso a Thiago para obtener su opinin y recibir sugerencias sobre posibles cambios. Estoy siguiendo de cerca el diseo que tenemos establecido, por lo que creo que estoy avanzando en la direccin correcta.\r\n\r\nEn qu se me complic?\r\n\r\nExperiment dificultades al intentar desarrollar la pgina del carrito de compras. Esta se volvi bastante compleja debido a los diversos elementos y funcionalidades que requera, especialmente en relacin con el uso de JavaScript. No me sent cmodo con el progreso que estaba haciendo y decid cambiar de enfoque hacia la pgina de compra, que era ms manejable. Al realizar este cambio, logr superar las complicaciones y continuar avanzando en el proyecto.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, dediqu tiempo a investigar diversas reas relacionadas con el desarrollo web. Me enfoqu en aprender sobre las mejores prcticas para el diseo y la estructura de pginas de compra en HTML. Tambin investigu sobre cmo implementar de manera efectiva la funcionalidad de carrito de compras utilizando JavaScript y cmo integrarla adecuadamente con el diseo existente.\r\n\r\nAdems, investigu sobre cmo optimizar la experiencia del usuario en la pgina de compra, centrndome en la usabilidad, la navegacin y la presentacin visual. Busqu recursos y ejemplos de pginas de compra exitosas para obtener inspiracin y aprender de sus estrategias.','2023-06-08'),(6221,291,'Avance del proyecto','El da empezamos haciendo la daily como todas las clases anteriores para saber que tanto avanzamos y cuanto vamos a avanzar y las dificultades que tuvimos a la hora de hacer el trabajo, este da avanzamos con la pagina y estamos pensando cambiar la base de datos por una completamente diferente porque sentimos que le faltan cosas.','2023-06-08'),(6222,299,'Hoy','','2023-06-08'),(6223,298,'Clase 16','Hoy despus de conversar sobre los componentes a usar en el robot, terminamos acordando en que rediseariamos todo de cero. Tanto el robot, cmo la pgina. Tambin estuvimos averiguando sobre la impresin del robot.','2023-06-08'),(6224,281,'Dia 13','Hoy hemos finalizado los ltimos detalles de la barra de navegacin y, al realizar algunos cambios de colores, hemos logrado que se vea ms como desebamos. Hicimos un intento de ubicar la imagen de nuestro logotipo en la parte superior derecha, pero lamentablemente no tuvimos xito. Adems, el tiempo del que disponamos fue bastante limitado. Sin embargo, seguramente en la prxima clase podremos corregir este problema y comenzar a trabajar en el sistema de compras. Tambin nos aseguraremos de que el icono sea funcional y cumpla con su propsito. Estamos ansiosos por llevar a cabo estas mejoras y brindar a nuestros usuarios una experiencia de navegacin an mejor.','2023-06-09'),(6225,285,'Da 18','Qu logr hacer hoy?\r\n\r\nHoy he logrado completar la pgina de compra en mi proyecto. Me enfoqu en implementar un sistema de calificacin con estrellas que, aunque todava deseo pulir un poco ms, cumple su funcin y est funcionando correctamente. Me asegur de que todo est correctamente acomodado y que funcione perfectamente antes de realizar la ltima modificacin. Ahora la pgina web est estructurada y, por el momento, cumple su funcin bsica, aunque seguir agregando ms elementos al proyecto en el futuro.\r\n\r\nEn qu se me complic?\r\n\r\nAfortunadamente, no encontr grandes complicaciones durante el da de hoy. Pude avanzar sin problemas en la implementacin de la pgina de compra y el sistema de calificacin con estrellas. Aunque hubo algunos pequeos desafos tcnicos, pude resolverlos rpidamente y seguir adelante con mi trabajo.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, estuve investigando sobre cmo implementar un sistema de calificacin con estrellas en una pgina web. Busqu diferentes enfoques y tcnicas para lograrlo y eleg la que mejor se adaptaba a las necesidades de mi proyecto. Adems, estuve investigando sobre las mejores prcticas de diseo y usabilidad para asegurarme de que el sistema de calificacin sea intuitivo y fcil de usar para los usuarios.\r\n\r\nTambin estuve investigando sobre cmo estructurar adecuadamente una pgina web de compra. Aprend sobre las secciones clave que deben estar presentes, como el carrito de compras, los detalles del producto, la informacin de envo y pago, entre otros. Me asegur de obtener inspiracin de diseos exitosos y estudiar cmo se organizan y presentan los elementos en las pginas de compra de otros sitios web.','2023-06-09'),(6226,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Hicimos ciertos arreglos dentro de la base de datos. Ya que los productos mostrados dentro de la pagina web ya habiendo hecho la conexin, se mostraban por cada insert que tenia la base de datos generando una card automticamente, se arreglo la base de datos para que los productos no se repitan, declarando la ID como primary key y a su vez dandole a cada producto una seccion, lo cual nos ayudara a la hora de codificar las demas secciones de la pagina web, y asi pudiendo separar los productos por sus respectivas secciones. \r\n- Por otro lado , empezamos a configurar el inicio y las cards, de modo que podamos codificar la pestaa en donde se mostrarian los datos del producto seleccionado, y a su vez daria ciertos detalles sobre el producto en si. Tambien daria la opcion de seleccionar el talle y el color del conjunto y el de poder agregar el producto a su carrito de compras. Esta aun esta en proceso, pues por el momento solo se hizo una pequea prueba. \r\n\r\nEso fue todo por hoy.','2023-06-09'),(6227,288,'Clase 16','Durante la jornada de hoy, nos dedicamos con ahnco a la elaboracin y diseo de la interfaz de nuestra pgina. Nos propusimos crear una experiencia visual atractiva y funcional para los usuarios. Nos sumergimos en la eleccin cuidadosa de los colores, buscando una combinacin armoniosa que transmitiera la identidad y personalidad del proyecto. Sin embargo, a pesar de nuestros esfuerzos, encontramos algunos obstculos en el camino. En particular, nos enfrentamos a dificultades al intentar incorporar el icono deseado. A pesar de nuestros mltiples intentos, no logramos alcanzar los resultados deseados. Pero, lejos de desanimarnos, nos tomamos esto como una valiosa leccin y una oportunidad para aprender y mejorar. Enfocndonos en el futuro, nos comprometemos a resolver este inconveniente antes de la prxima clase. Pondremos todo nuestro empeo y conocimientos para solucionar los problemas tcnicos y lograr una integracin perfecta del icono en la interfaz. Estamos seguros de que, con dedicacin y esfuerzo, conseguiremos un resultado satisfactorio y coherente con la visin que tenemos para el proyecto. Adems de esta situacin, tambin nos percatamos de que nos falt completar la seccin correspondiente al apartado de contacto. Reconocemos la importancia de esta parte fundamental de la pgina y comprendemos que es esencial para brindar una experiencia completa a los usuarios. Para remediar esta situacin, nos hemos embarcado en una investigacin exhaustiva sobre las mejores prcticas y tcnicas para implementar esta seccin de manera eficiente y atractiva. En nuestro afn por mejorar la interfaz, nos planteamos el desafo de mover nuestro icono png hacia la parte superior del navbar. Esto requiri un anlisis minucioso de las diferentes opciones disponibles y una exploracin de las herramientas y mtodos ms adecuados para lograrlo. Estamos satisfechos con los avances obtenidos hasta el momento y confiamos en que, con los ajustes necesarios, lograremos el resultado deseado. Adems, como parte de nuestra dedicacin a la esttica y la coherencia visual, hemos decidido realizar cambios en los colores de los bordes en los formularios de registro y login. Nuestro objetivo es brindar una experiencia estticamente agradable y coherente en toda la pgina, asegurndonos de que cada elemento visual est en armona con el conjunto. En resumen, aunque nos enfrentamos a desafos y obstculos en la creacin de la interfaz de nuestra pgina, estamos comprometidos a superarlos y alcanzar un resultado exitoso. Nos hemos dado cuenta de la importancia de la paciencia, la perseverancia y la bsqueda constante de conocimientos para lograr nuestros objetivos. Estamos entusiasmados por seguir trabajando en este proyecto y estamos seguros de que los ajustes y mejoras que realizaremos darn como resultado una pgina atractiva y funcional que cumpla con nuestras expectativas y las de nuestros usuarios.','2023-06-09'),(6228,274,'CSS del PHP de la tabla, ayuda','En el da de la fecha lo que hice fue modificar la posicin tanto del logo de la pgina como del icono de cerrar sesin, los cuales se encontraban en la pgina que contiene la tabla con los incidentes. Al mismo tiempo, lo que hice fue ayudar a un compaero del equipo ya que tena problemas con el php de la pgina de los usuarios. Le dije como cargar los datos ingresados en una base de datos y que se muestren en la pantalla. Luego, intentamos solucionar un error que se produca al marcar los checkbox, aunque no pudimos solucionarlo. Tambin discutimos algunas ideas con el Project Mnager del equipo.','2023-06-09'),(6229,283,'maldito seas estado de 