tes en la api','En el dia de la fecha ya con la reintegracin de mi compaero enzo bartoletti, le mostr todo lo que haba avanzado en el dia anterior y debatimos sobre que deba hacer en la clase de hoy. Estuve bastante tiempo sin poder hacer algo debido a que la maqu9ina en la que estaba se tildo varias veces y tuve que reiniciarla. Despus de que la computadopra anduviera bien, me puse a investigar para establecer limites dentro del mapa. Lo logre pero trajo consigo un prpblema y es que los limites se establecieron en todo el mapa y no me puedo desplazar dentro de caba','2023-06-09'),(6239,290,'Decimosptima','En el da de la fecha lo que hice fue continuar con la pgina en prcticas profesionalizantes, creamos un apartado para que sepan que es la empresa y quines somos','2023-06-09'),(6240,282,'Tareas de scrum master ','En del da de la fecha colabore con Ledesma en la busqueda de funciones para agrupar datos y restringir el alcance del mapa tan solo a la ciudad autonoma de buenos aires.\r\nA su vez ayud a Christian Forte con el analisis del sector de administradores de BaVigila y controle las tareas de Caceres, descubriendo que esta dando sus primeros pasos en React.','2023-06-09'),(6241,289,'9-06','El da de hoy, solo fuimos 3. \r\nHemos visto algo ms de cerca el proyecto, quedando as (por ahora).\r\nLa idea sera que, el robot estara conectado al servidor (que sera nuestro), el cual tendr dentro todas las recetas. El usuario podra conectarse por telfono, o computadora. El cliente al elegir una receta, mandara un 1 al robot/computadora, y este comenzar a ejecutar la receta. \r\nUsaremos Python para programar, voy a practicar el fin de semana. \r\nEso es todo por hoy, muchas gracias!!!\r\n','2023-06-09'),(6242,275,'Factura ','Hoy fue un da en donde no hicimos mucho, entre que quera adelantar un trabajo y que ya habamos completado todo lo que seria la base de datos ayer con Senz no tenia mucho que hacer, solo nos faltaba hacer el tema de la facturacin, pues para esto hice en el canva una hoja en la que se pondran los datos de la compra y los datos de la persona que realiza dicha compra, terminado solo queda hacer su base de datos correspondiente. ','2023-06-09'),(6243,298,'Clase 17','Creeeeeo que ya decidimos cual sera el diseo final. Despus de probar la netbook que nos prest el profe, acordamos que la usaramos para el trabajo. No pudimos hacer mucho, pero es bastante en comparacin a otros viernes.','2023-06-09'),(6244,291,'Avance del proyecto','El da de hoy empezamos la clase realizando la daily, hoy empese a cambiar a base de datos y agregando cdigo php a la pgina.','2023-06-09'),(6245,282,'Cuarto dia de trabajo GS1','En el dia de hoy trabaje de manera virtual, a pesar que en el dia de la fecha me tocaba trabajar desde la presencialidad, debido a un supuesto paro de transporte el cual se termin cancelando.\r\nRecien arrancada la jornada dialogu con Tobis respecto a las tareas a realizar durante la jornada y posterior a esto Toms se comunic conmigo para consultarme acerca de mis avances y para solicitarme que le envie el archivo en el que estoy trabajando.\r\nEn esta jornada realic grandes avances respecto a jornadas anteriores, siendo que realic el analisis de mas de 400 filas de empresas, logrando llegar a 1/2 del trabajo solicitado.','2023-06-13'),(6246,262,'13-06-2023','El da de hoy seguimos trabajando en blender con los personajes e investigamos sobre las dimensiones de los personajes','2023-06-13'),(6247,260,'13/06/23','Estuve leyendo la documentacion de Fullcalendar para entenderlo y ayudar con su implementacion','2023-06-13'),(6248,269,'13/06','Llegu a las 2:30 del curso de react, y termin mi primer pgina completa de la presentacin de los programadores. Usando props.','2023-06-13'),(6249,271,'13-6-23','En el da de la fecha comienze a hacer mi personaje en blender','2023-06-13'),(6250,267,'13/06/2023','Hoy empec mi propio modelo 3D del robot. Hice la parte de motores, arduino, puente h, sensor ultrasonido y la rampa.','2023-06-