rganic todo lo que iba a necesitar para crearlo, la cantidad de inputs que iba a necesitar y sus tipos. Hice la creacin del hook personalizado para el modal y un componente llamado ModalCreacin. Lo import en una pgina de prueba para ir visualizandolo a medida que voy haciendo cambios. Todava no est terminado, va a llevar seguramente 2 clases ms para estar al 100% funcionando','2023-06-13'),(6263,282,'Quinto dia de trabajo GS1','En el da de hoy trabaje de manera presencial, prosiguiendo con la tabla Relacion_VTA-MARCAS, especializndome en corregir errores pasados y consultar dudas pendientes. Para esta tarea me junt con Toms y Lucas para analizar caso por caso cada defecto encontrado, como las empresas inexistentes, las que no figuran en el INPI, las que figuran con un / LA, etc.','2023-06-14'),(6264,290,'Decimoctava','6/06: En el da de la fecha entre por primera vez a la empresa GS1, nos hicieron un pequeo recorrido por toda la oficina, nos entregaron los materiales con los cuales vamos a trabajar, nos explicaron que tenamos que hacer dentro de la empresa y comenc haciendo un Listado de oportunidades de mejora, que termine ese mismo da.\r\n7/06: En el da de la fecha tuve una reunin que duro aproximadamente 2 horas y media en la cual se dividieron 3 grupos de 6 personas, en esta reunin hablamos de que se tenia que hacer un nuevo diseo de la pagina web, ya que el viejo diseo traa problemas de confusin al usuario, por lo que mi grupo se debati temas como la ubicacin de la nav-bar en modo horizontal, tambin se debati sobre si las principales funciones de la pagina web deberan estar dentro de un apartado llamado codificacin junto con las otras opciones, para que el usuario pueda ver que la empresa tiene mas soluciones y no solo se dedica al cdigo de barra, luego se expuso cada uno de los diseos de los 3 grupos, y al finalizar se hizo una lista con las principales ideas o caractersticas que tenan que estar en el rediseo final de la pagina.\r\n8/06: En el da de la fecha co