06-14'),(6273,251,'Curso Laravel pt6 - 14/6/2023','El da de hoy logr registrar un usuario pero al momento de logearse el mismo no se encontraba. Decid buscar en internet pero no encontr una solucin a mi problema (user = null). La clase prxima pedir ayuda al profesor Consorti.\r\nhttps://laravel.com/docs/10.x/queries\r\nhttps://stackoverflow.com/questions/29548073/laravel-advanced-wheres-how-to-pass-variable-into-function\r\n','2023-06-14'),(6274,260,'','Correcion momentanea de bug al mover un evento y segu investgando sobre fulllCalendar ','2023-06-14'),(6275,267,'14/06/2023','Hoy segu con mi diseo 3D, aadi los sensores infrarrojos y modifiqu el tamao y forma del robot junto a otras mejoras.','2023-06-14'),(6276,261,'14/06/2023','hoy segui con el diseo 3D','2023-06-14'),(6277,266,'Correccion y pensamiento de logica de creacion de eventos ','estuve pensando la logica del repeat, es muuy complejo, por eso estuve tanto tiempo haciendolo, pero ya tengo algo avanzado, falta correguirlo y debugear','2023-06-14'),(6278,269,'14/06','Hoy termin el primer proyecto de presentacin de los programadores. Y comenc el segundo, el cual es un contador de clicks ','2023-06-14'),(6279,252,'Clase 25 - Modal Creacion','El da de hoy lo aprovech para terminar todo el estilo principal del modal. Visualmente se ve bien pero an se puede mejorar mucho ms. La prxima clase aprovechar para terminar con las funcionalidades faltantes del modal, por ejemplo que pueda invitar a otros participantes para ser parte del evento, tambin poder elegir la opcin de repetir ese evento las veces que uno quiera, ya sea por semana, por da en especfico (como todos los viernes o todos los 16 de un mes), o incluso por mes. Tamben otra funcin por agregar es que puedas elegir cuando mostrar una notificacin como recordatorio. Por ltimo aprovechar el tiempo que sobre para mejorar an ms lo visual en el modal.','2023-06-14'),(6280,265,'14-06-2023','Hoy segui con el diseo del robot, agregandole soporte para los sensores y p