opups haban dejado de funcionar, por lo que me dispuse a solucionarlo. Despus de solucionarlo, los sub al drivey le ped a mi compaero Manuel Filippa que lo probara en la interfaz de usuario web, llevndonosla sorpresa de que no funcionabacon el resto de la interfaz. con mi compaero Christian corroboramos que anduvierade por s cosa que si haca, pero al unirlo con la interfaz los lmites y el zoom dejaba de funcionar. tratamos de encontrar la solucinpero no hubo caso por lo que lo dejaremos para la clase de maana. tambin fui documentando mis avances en la carpeta de campo, tambin pens en otra funcin para agregar adems de la unin de los popups y el formulario que marque la ubicacin al instante y es que fuera del territorio de provincia, cosa que debera estar de por s','2023-06-15'),(6287,273,'Clase 15-06-2023','Durante este da me dediqu a revisar las pginas que hicieron mis compaeros, sugiriendo cosas para ponerles y ayudando con la correspondiente codificacion en CSS. Posteriormente, empec a pedir que me envien las pginas para poder unir el back-end con el front-end, empezando desde la pgina de inicio. La primera pgina contiene la informacin acerca de nosotros, con un botn para dirigirse al login y otro para dirigirse al register. ','2023-06-15'),(6288,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin ','\r\nEl da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos en base a la codificacin de la pagina web, en la cual por el momento empezamos a codificar la pestaa en la que se muestran los datos del producto que se seleccionara en el inicio, y en base a eso se recuperaran los datos hasta la pestaa de producto, en la cual se mostraran la imagen del producto seleccionado, ciertos de sus datos como la ID y su nombre, la imagen, dos campos en los que se le dara al usuario la opcion de seleccionar el talle y el color de la prenda seleccionada y la descripcin del producto. Por el momento fue todo lo realizado, aun sigue en proceso el poder agregar dicho producto al carrito y configurarla para que los valores de seleccin cambien en caso de que se trate de otro tipo de prenda en especifico. \r\n- Y por otro lado, se realizo cierto arreglo dentro de la base de datos dada para configurar el carrito de compras, pero por el momento no pudimos probarla, por lo que queda en proceso por el momento. \r\n\r\nEso fue todo por hoy. \r\n','2023-06-15'),(6289,284,'Bitacora 15','Hoy estuve finalizando con el login de la pagina y estuvimos trabajando con mis compaeros de equipo para poder hacer la parte de cada uno lo mejor posible.\r\npudimos finalizar todo y ahora solo queda juntar todo y conectar la base de datos con la pagina web','2023-06-15'),(6290,274,'Ayuda con PHP Y API del mapa','En el da de la fecha, lo que hice fue intentar solucionar un problema que tena un compaero de mi equipo con el php de su pgina, la cual era donde los usuarios reportan los incidentes. Ya habamos tenido este problema la clase anterior, ya que mostraba un error al marcar los checkbox de la seccin de modalidad del incidente. Busqu algunos tutoriales pero no pude encontrar nada. Al final de la clase record que tena un trabajo antiguo en el cual haba utilizado los checkbox y posteriormente ingresar los valores a la base de datos, pero ya no tena mucho tiempo. Al mismo tiempo iba ayudando a otro compaero de mi equipo, quien se encargaba del mapa de la aplicacin. El problema que tenamos era que los limites del mapa se marcaban unicamente cuando ste estaba como un archivo solitario. Una vez que lo unamos al html que contena el formlario, no haba un lmite de navegacin. Tampoco pudimos soluconar este problema.','2023-06-15'),(6291,277,'Dcimo quinta clase','El da de hoy estuvimos avanzando bastante, comenzamos por hacer la parte del registro, primero hice la base de datos que cuenta con seis columnas, correo, donde se guarda el email del usuario, usuario, donde se guarda el nombre de usuario, contra, donde se guarda la contrasea del usuario, celular, donde se guarda el telfono mvil del usuario, gnero, donde se guarda el gnero con las siguientes opciones: hombre, mujer y otros, y por ltimo edad, donde se guarda la edad del usuario.\r\nLa idea es utilizar estos campos para distintas funciones, el correo y la contrasea sirven para iniciar sesin de forma segura, el nombre de usuario es una forma rpida y sencilla de comunicarse con la persona sin necesidad de utilizar su nombre personal, el celular est para mantener una comunicacin cmoda y rpida, aunque planeamos abrir nuestro propio chat donde comunicarnos con nuestros clientes, el gnero y la edad se utilizarn para las recomendaciones de productos y para prohibir ciertas categoras no aptas para todo pblico.\r\nEventualmente aadiremos una pgina para agregar un mtodo de pago virtual si el cliente no quiere pagar de manera fsica.\r\nLuego de la base de datos me dispuse a trabajar en el registro, ya tenamos la pgina hecha as que solo tuve que hacer un archivo PHP que se comunique con la base de datos y guarde la informacin que el usuario ingres, fue muy sencillo gracias al formulario de tipo POST, que me permite comunicarme entre un archivo HTML a uno PHP de manera eficaz. Tuve que crear una variable para cada columna adems de una que no se encuentra en la base de datos que es la contrasea repetida, para que el usuario no se equivoque a la hora de escribir su contrasea.\r\nLo primero que hace el cdigo es, mediante un IF, comprobar que ambas contraseas son iguales, si es as crea una consulta SQL de tipo INSERT que permite guardar todos los datos en la tabla REGISTRO. Si todo sale bien el usuario ser enviado a la pgina principal con un texto que dice CUENTA CREADA CON XITO. En el caso que no pueda comunicarse con la base de datos o la contrasea este mal, se le avisar mediante un ALERT de JS al igual que cuando si acepta la cuenta.\r\nLuego del registro me dispuse a trabajar en el login, que funciona con el mismo principio que el registro, mediante una pgina que afortunadamente ya habamos terminado la semana pasada se guardan los datos que el usuario ingresa, en este caso tan solo se pide el correo electrnico y la contrasea, en un principio era necesario introducir el nombre de usuario en lugar del correo, pero en nuestra base de datos decidimos hacer el correo la primary key, un espacio que nunca puede repetirse, en cambio el usuario si puede ser repetido por una cuenta, lo cual crea errores si dos cuentas tienen el mismo nombre de usuario y la misma contrasea.\r\nComo iba diciendo, en este caso el archivo PHP tan solo recibe dos datos, el correo y la contrasea, luego hace una consulta SQL del tipo SELECT de la tabla REGISTRO donde el correo y la contrasea coincidan con las que el usuario especific. Si se encuentra la cuenta en cuestin se enva un ALERT dndole la bienvenida al usuario junto a su nombre, si este no es el caso se le enviar, junto a otro ALERT, a la pgina de login una vez ms.','2023-06-15'),(6292,286,'HTML, Base de Datos y PHP de Pgina Usuarios 3','El da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. Para empezar el da laboral intent solucionar los problemas que aparecen cuando intento hacer un envo de formulario, para solucionarlos tuve que revisar las lneas de cdigo del PHP para dar con el problema, para solucionar estos problemas fui al index.html y tuve que cambiar un par de etiquetas &lt;name&gt; para ms tardes cambiar y agregar variables en PHP que corresponden a dichas etiquetas, al cambiar y agregar variables al PHP tambin tuve que modificar la base de datos, lo cul fue una tarea rpida y fcil. Tambin tuve que modificar parte de la variable &quot;instruccion&quot; de PHP para que los datos ingresados en el formulario puedan enviarse a la base de datos. A todo esto, los problemas seguan apareciendo por lo que tuve que recurrir a mi compaero Christian Forte el cul me di una mano y pudo solucionar los problemas y hacer ms prctico el cdigo de PHP. Mientras mi compaero me ayudaba, yo intentaba ayudarlo a l con una parte de su trabajo, buscando en YouTube y Google tutoriales o informacin que sirva para poder con un botn ampliar una casilla de una tabla en HTML. Lastimosamente no pude encontrar esa informacin. Ms tarde mi compaero Ezequiel Ledesma solicit mi ayuda para poder hacer que un botn del formulario, al presionarlo, agregue las coordenadas de donde estoy en un &lt;input&gt; de texto. Pude encontrar dos videos que probablemente sirvan de ayuda, estos videos los guard en un documento que tenemos con el grupo en el Google Drive para guardar links de utilidad. Para terminar el da de hoy, avanc un poco en la carpeta de campo.','2023-06-15'),(6293,275,'Verificacin de diagramas ','Bsicamente hoy me limite a solamente revisar todo los que habamos hecho referente a los diagramas, como el diagrama de flujo de datos, camino critico, caso de uso, colaboracin, secuencia, entidad relacin y el diagrama GANTT, actualizando los que necesitaba y asegurndome de que todos estuvieran terminados y en condicin.','2023-06-15'),(6294,299,'Hoy','Hoy hicimos el daily','2023-06-15'),(6295,293,'base da datos','correg la consultas del base de datos y lo verifique ','2023-06-15'),(6296,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin ','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos en base a la codificacin de la pagina web, en la cual por el momento empezamos a codificar la pestaa en la que se muestran los datos del producto que se seleccionara en el inicio, y en base a eso se recuperaran los datos hasta la pestaa de producto, en la cual se mostraran la imagen del producto seleccionado, ciertos de sus datos como la ID y su nombre, la imagen, dos campos en los que se le dar al usuario la opcin de seleccionar el talle y el color de la prenda seleccionada y la descripcin del producto. Por el momento fue todo lo realizado, aun sigue en proceso el poder agregar dicho producto al carrito y configurarla para que los valores de seleccin cambien en caso de que se trate de otro tipo de prenda en especifico. \r\n- Y por otro lado, se realizo cierto arreglo dentro de la base de datos dada para configurar el carrito de compras, pero por el momento no pudimos probarla, por lo que queda en proceso por el momento. \r\n\r\nEso fue todo por hoy. \r\n','2023-06-15'),(6297,296,'Bitacora 14','Hoy segu con mi parte de la pgina web y ya est casi todo terminado para as unirlo y de ah hacer la parte de la base de datos','2023-06-15'),(6298,289,'15-06','El da de hoy, empezamos de nuevo a hacer todo. Geral y Lucho comenzaron a cambiar la pagina y hacer el php. Mientras yo, comence con la app de python, el inicio de sesion. Hay ms, pero por hoy eso es todo por hoy, muchas gracias!! ','2023-06-15'),(6299,282,'Sexto da laboral GS1','Durante el da de hoy, con la previa aprobacin de Toms, decid trabajar desde la virtualidad. En este da aminore la marcha de mis progresos pero utilizando un mtodo ms eficiente, siendo que en 2 horas realic el anlisis de 300 filas, usando como principal mtodo de comprobacin el packaging.\r\nTambin hoy me focalice en eliminar registros bajo las normas aprendidas el da de ayer, siendo que el recuento de filas a revisar pas de 140 a tan solo 90.\r\n','2023-06-15'),(6300,295,'Modificacion del proyecto y pagina web','En el da de hoy charlamos en grupo y nuestra scrum nos coment de las modificaciones que se le iba a hacer al proyecto y como se llevara a cabo, que eran bastante distintas a lo que era el proyecto en un principio, entonces despus de hablar de eso la tarea que me asign fue hacer junto a mi compaero la modificacin de la pgina web ya hecha anteriormente y la empezamos a adaptar a lo que era el nuevo proyecto. Adems nos dividimos las tareas prximas a hacer cada uno en el grupo con los nuevos trabajos que haba que hacer de acuerdo a esta nueva forma de llevar a cabo nuestro proyecto, y fuimos anotando esas tareas en un Trello.','2023-06-15'),(6301,294,'Investigacin sobre python - Reforma del proyecto','En el dia de hoy como principal tarea tuvimos que organizarnos un poco e hicimos todos un trello para ordenar las tareas que tenia pendiente cada uno, ya que habiamos cambiado severamente el proyecto. Luego investige un poco de el lenguaje de programacin python, yo tenia unos conocimientos previos de algunos aos anterior pero necesito lustrar conceptos que no recuerdo, este lenguaje va a ser de gran ayuda para manejar nuestro robot. Como ultimo realice con mi compaera un cambio en la parte de la pagina web que en este caso estaban hechas con html y decidimos cambiarlo al lenguaje php para conectar todo a la base de datos.','2023-06-15'),(6302,280,'Python opencv','El dia de hoy procedi a trabajar en una portatil otorgada por el instituto para trabajr con opencv ya que al ser una computadora que no esta freezada no corremos el riesgo constante de perder los datos o tener q volver a instalarlos.\r\nSolo se realizo la instalcion de los componentes necesarios y crear las variables de entorno e instalacion de microsoft visual studio.\r\nTodo esto debido a que cambiamos por 2da vez consecutiva el como hacer el proyecto.','2023-06-16'),(6303,273,'Bitacora 16-06-2023','En este da empec a realizar testeos con lo que sera el cdigo de barras y la base de datos. Primero hice el cdigo que servira para interactuar y crear un pdf que contenga el codigo de barras y que despus sera ledo por una aplicacin mvil. Posteriormente, hice un archivo ejecutable en Java que servira para testear todo esto. Luego, convers con el profesor para ver qu hara el cdigo de barras, y lo que har este ser redirigir al usuario a una pgina donde interactuar con la base de datos y marcar el mueble correspondiente como verificado. Para hacer todo esto, tuve que aadir una nueva columna a la base de datos de cada mueble, que sera VERIFICADO. A su vez, tambin le sum esta caracterstica a las funciones de SQL (las de Java se quedaron exactamente igual).\r\n','2023-06-16'),(6304,278,'Clase N20 16/06/2023','En el da de hoy tuvimos problemas con todas las paginas webs que realizamos , ya que , ninguna tenia responsive , por lo tanto nos toca empezar de cero.Yo empece con la pagina de inicio , debido a que es la que me pareci mas sencilla.Vi tutoriales en YouTube sobre como conseguir que la pagina sea responsive, tambin realice un tutorial en W3Schools que me sirvi mucho.Una vez aprendido responsive , comenc a realizar el header de la pagina.','2023-06-16'),(6305,274,'Solucin a errores PHP','En el da de la fecha, lo que hice fue buscar posibles soluciones al problema que saltaba en el PHP de la pgina de usuarios, donde son reportados los incidentes. Tras haber buscado varios videos, pude encontrar uno el cual lo explicaba. Tras haber hecho esto, pude modificar los valores que eran mostrados tras seleccionar si se requera ambulancia o bomberos. Ahora solo me quedaba un error relacionado a los checkbox, pero no llegu a encontrar una solucin.','2023-06-16'),(6306,285,'Da 19','Qu logr hacer hoy?\r\n\r\nEl da de hoy me enfoqu en arreglar algunos problemas en la pgina de Compra. Uno de los principales desafos fue convertir todas las unidades de medida de &quot;%&quot; y &quot;px&quot; a &quot;rem&quot; para lograr una mayor consistencia y flexibilidad en el diseo. Aunque todava siento que hay algunos ajustes por hacer, logr avanzar significativamente en esta tarea y la pgina se ve mucho mejor ahora.\r\n\r\nAdems, estoy trabajando en el desarrollo de la pgina de Compra, lo cual es un paso importante en el proyecto. Estoy implementando las funcionalidades necesarias para permitir a los usuarios realizar compras de manera eficiente y segura. Me alegra decir que voy avanzando en esta etapa y estoy seguro de que el resultado final ser satisfactorio.\r\n\r\nEn qu se me complic?\r\n\r\nDurante el da, me enfrent a un problema con el script de las estrellas en la pgina de Compra. Por alguna razn, dejaron de mostrarse correctamente y tuve que dedicar tiempo a revisar y corregir el cdigo responsable de esta funcionalidad. Afortunadamente, pude identificar y solucionar el error, asegurndome de que las estrellas volvieran a funcionar correctamente en la pgina.\r\n\r\nAdems, mi compaero realiz un cambio en el encabezado (header) de la pgina, lo cual caus algunos problemas en el diseo general. Como resultado, tuve que arreglar y ajustar varias secciones de la pgina para que se adaptarn correctamente al nuevo encabezado. Si bien esto me tom un poco de tiempo extra, estoy comprometido a resolverlo y espero que pronto mi compaero pueda proporcionar un nuevo footer, ya que el actual causa desajustes en la estructura de la pgina.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, estuve investigando diversos temas relacionados con el desarrollo web y el diseo. Me enfoqu en aprender ms sobre las mejores prcticas de diseo responsive y la implementacin de unidades de medida relativas, como &quot;rem&quot;, para lograr una mayor adaptabilidad en la pgina. Tambin investigu sobre las formas ms efectivas de corregir problemas en scripts y componentes especficos, como el caso de las estrellas que mencion anteriormente.\r\n\r\nAdems, me mantuve informado sobre las ltimas tendencias y tcnicas en diseo de encabezados y footers para pginas web. Investigu diferentes enfoques y estilos que podran mejorar la apariencia y la funcionalidad de estos elementos en mi proyecto.\r\n','2023-06-16'),(6307,286,'HTML, CSS y JS de Pgina Usuarios','En el da de la fecha ingres al aula donde trabajamos todos los viernes y me sent en mi sitio de preferencia acompaado de Christian Forte, el cul encendi mi computadora antes de que llegue para que pueda empezar a trabajar ms rpido. Como siempre inici sesin en mis cuentas, abr todas las aplicaciones y descargu todos los archivos necesarios. Una vez terminada la rutina de siempre, comenc con mi trabajo. Al principio no saba que hacer ya que mi compaero Christian estaba trabajando en la pgina de usuarios ya que necesitaba su ayuda. Consult a mis compaeros que podra hacerle a la pgina, refirindome al diseo de esta, ya que no me convenca como estaba, por lo que llegamos a la conclusin de cambiar el diseo del formulario desplegable. Para empezar con esta labor lo primero que hice fue buscar en Google &quot;form design&quot; para ir a la seccin de &quot;Imgenes&quot; y de esta forma poder ver diseos e inspirarme u obtener ideas, no encontr muchas imgenes que me ayuden pero de una logr obtener algo, eran unos iconos que enumeraban las partes del formulario que haba que completar, entonces busqu la pgina &quot;Font Awesome&quot; la cul me proporciona una muy amplia variadedad de logos y smbolos para agregar al cdigo HTML. A pesar de toda esta bsqueda e investigacin, no avanc en este tema. Ms tarde consult con el Scrum Master, Enzo Bartoletti, para proponerle la idea de hacer un Pop-Up que aparezca al enviar el formulario, el estuvo de acuerdo con mi idea por lo que me puse manos a la obra. Primero consult a Christian para que pueda proporcionarme informacin, aunque ms tarde decid buscarla por mi cuenta haciendo uso de YouTube, encontr un video que me mostraba cmo hacerlo en JavaScript pero no dio resultado. El tiempo se acab y conclu el da de hoy sin poder hacer un avance pero con toda la informacin para continuar.','2023-06-16'),(6308,279,'Dia 17 del Proyecto','En el da de hoy segu continuando viendo el video de explicacin de como usar react siendo este mas actualizado aunque tambin Enzo me pidi que empiece de nuevo a hacer los dailys ya que estos quedaron en standby un rato siendo que deba ver los videos aunque ahora los volv a hacer estos haciendo de los das que no hice avanzando hasta el daily numero 18.','2023-06-16'),(6309,282,'ayuda a compaeros en el aula de PP','Durante la jornada de hoy colabor con mis compaeros en la asignacion de tareas, el analisis de las tareas en proceso y tambien ayudando con las tareas en las cuales mis compaeros habian quedado trabados y no encontraban posibles soluciones.','2023-06-16'),(6310,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','\r\nEl da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Debido a que aun no terminamos la pestaa del producto en si, por el momento solamente nos dedicamos a disear la misma, a la cual por el momento tenemos el diseo en si, aunque solamente faltara buscar una forma de configurar la pagina para que el color y la talla de los productos sean correctos en base al producto seleccionado y tambien una forma de agregar esos productos al carrito de compras y demas.\r\n\r\nEso fue todo por hoy. ','2023-06-16'),(6311,292,'blureo de la api','en la jornada de hoy trate de solucionar el problema de ayer que no funcionaban los lmites, pero cuando trate de mostrrselo a mi compaero enzo bartoletti que se incorpor hoy, funcionaba correctamente, por lo que el error debe ser en las compus de la otra aula. despus de corroborar que funcionara bien, me dijeron que busque otra funcion que seria blurear las zonas que se encontraban fuera de los limites y que no se pudieran colocar popups. busque por muchas pginas y probe con distintos pedazos de cdigo pero no hubo resultado y voy a tratar de seguirlo en otro horario. \r\nunas de las pagijnas que probe fueron \r\n','2023-06-16'),(6312,293,'diagrama base de datos','Hoy hice de nuevo el diagrama ya que hubo demasiado cambios en la base de datos','2023-06-16'),(6313,272,'Desarrollo WEB','Hoy contine con el desarrollo web, utilizando clases de bootstrap e importando iconos de Google icons, utilizando su cdigo css para personalizar y agregar iconos de forma eficiente y visualmente atractiva, que seguir.','2023-06-16'),(6314,298,'clase 19','Olvid hacer la bitcora de ayer...Hoy volv a hacer la base de datos de cero. Me falta terminar con la tabla de ingredientes, pero eso lo resuelvo a la vuelta. Despus le envo las cosas a los chicos y unimos todo :) ','2023-06-16'),(6315,281,'Dia 14','Hola podrias extenderme este texto: El da de hoy terminamos de darle forma a la base de datos aadiendo los productos(Modelos 3D) que encontramos la otra vez. Tambin pudimos ponerle el logo a la pgina, nuestro logo es de un perrito con sombrero.\r\nTodo esto mientras nuestro compaero Federico Tolivia diseaba los modelos en Ultimaker Cura.\r\nAdems creamos un repositorio en GitHub para organizarnos y tener el proyecto mas limpio en general. Agregamos un espacio con las tareas que debemos terminar y realizar.','2023-06-16'),(6316,296,'Bitcora 15','Hoy estuve ayudando a mi compaero para realizar la base de datos y hacer el lector de barra para poder registrar los productos','2023-06-16'),(6317,288,'Clase 17','El da de hoy arreglamos nuestra querida base de datos de nuestra pagina Lilify, junto con mi compaero Joseph Guerrero. Mientras que mi otro compaero Federico Tolivia, pasa los diseos 3d de archivos stl a gcode, de tal manera que quedan listos para poder imprimir por dicha impresora. Mi compaero y yo modificamos precios de la base de datos y arreglamos algunas partes que no funcionaban, luego la insertamos en phpmyadmin y verificamos su funcionamiento correcto, no llegamos por el tiempo a agregar todos los productos pero planeamos hacerlo en la semana, o en la prxima clase.','2023-06-16'),(6318,291,'Avance del proyecto','El da de hoy esperamos un rato para que nuestros compaeros puedan llegar y poder realizar la daily todos juntos, lamentablemente falto una sola persona y no pudimos realizar la todos juntos pero aun as la hicimos y despus seguimos con el proyecto, hoy cambie la base de datos y le agregue varias cosas para completarla y conectarla con la pagina bien.','2023-06-16'),(6319,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin	','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Debido a que aun no terminamos la pestaa del producto en si, por el momento solamente nos dedicamos a disear la misma, a la cual por el momento tenemos el diseo en si, aunque solamente faltara buscar una forma de configurar la pagina para que el color y la talla de los productos sean correctos en base al producto seleccionado y tambin una forma de agregar esos productos al carrito de compras y dems.\r\n\r\nEso fue todo por hoy. ','2023-06-16'),(6320,275,'16-06-2023','Pues por ahora lo que nos falta para avanzar con el trabajo es completar la pestaa del producto, es decir la pestaa en donde se muestra cada producto a disposicin con sus datos como el precio, le tamao y ese tipo de informacin.  ','2023-06-16'),(6321,277,'Decimo Sexta clase','El da de hoy me puse a mejorar visualmente la pgina un poco ms, originalmente la barra de bsqueda contena cinco categoras una al lado de la otra, LiliFy, la pgina principal, productos, donde se ven los productos, contacto, donde pueden consultar al staff de la pgina, registrarse y login.\r\nLo primero que hice fue agregar un sexto botn que dice carrito, para en un futuro agregar esta caracterstica. Adems mov las categoras de registro e inicio hacia la derecha de la pgina junto a un perrito que toma el lugar del logo hasta que tengamos uno oficial. Por ltimo cambi la vista previa de la pgina, el ttulo y el cono que aparecen en las pestaas del navegador, con el nombre LiliFy y la misma foto del perrito.\r\nLuego estuve pasando los modelos 3D al programa Ultimaker Cura, este sirve para modificar los modelos en formato STL y pasarlos a GCODE, un tipo de archivo que usa la impresora 3D, adems sirve para definir los soportes de la figura, el relleno, el tamao y diversas caractersticas que tienen que ver con la calidad y la cantidad de plstico utilizado.\r\nPara la prxima clase no se si empezar a imprimir las impresiones 3D y sacarles una foto para su exposicin y prxima venta o si continuar con el tema de las cuentas, si bien se pueden registrar e iniciar sesin esto no significa nada, no se guarda un inicio de sesin por as decirlo, lo cual se debe solucionar cuanto antes. Tampoco podemos olvidar el famoso carrito que an no hicimos, tenemos que hacer el logo de la pgina, el mtodo de contacto con el staff y siempre hay espacio para la mejora visual de la pgina.\r\n','2023-06-16'),(6322,289,'16-06','HOY TODO A ULTIMA HORA LA HICE, PERO EL DIA DE HOY SEGUI CON LO DE PYTHON, LLEGANDO A HACER UN MINIPROTOTIPO DEL INICO DE SESION, ADEMAS DE INVESTIGAR CON ALGUNOS VIDEOS DE YOUTUBE. ESO ES TODO POR HOY,MUCHAS GRACIAS!!!','2023-06-16'),(6323,295,'Continuacin de la modificacin de la pagina web','El da de hoy continu con la modificacin de la pagina web en la cual tuvimos que pasar todo lo que estaba hecho en html a lenguaje php y definimos cuales iban a ser los campos de la base de datos que seria el inicio de sesin y la parte de registrarse. Lo primero que hicimos en la pagina fue dejar el nav como estaba anteriormente hecho y le agregamos debajo un carousel en el cual se van a mostrar algunas imgenes de comida, en la parte superior lo que seria el nav va a estar los tems que corresponden a recetas, inicio, mi cuenta (desplegable de inicio de sesin y registrarse) y contacto. ','2023-06-16'),(6324,294,'Seguimiento de pagina web','','2023-06-16'),(6325,294,'Seguimiento de pagina web (recambio)','Hoy continu con el cambio de la pagina web en donde ayer habia cambiado algunas cosas de html al lenguaje php, tambien cre archivos php con el respectivo propsito del inicio de sesion y registro de la pagina. Nos mantuvimos con el nav que ya estaba anteriormente en el archivo html creado por mi compaera. Agregamos en nuestra pagina un carousel con imagenes de comidas tpicas que se encuentra en el home, es decir, lo primero que vas a encontrarte al entrar a la pagina.','2023-06-16'),(6326,282,'Septim