ono que restringa la visin al resto de zonas a las cual no tendra acceso nuestra app. Para esto se me ocurri que podra poner nuevos polgonos parea tapas las dems zonas, por lo que edite la funcin de pop up para que me marque las coordenadas y con eso agregarlas a un nuevo polgono\r\nTambin le cambie la opacidad para que no se vean demasiado las dems calles.\r\nTuve problemas con algunas de las coordenadas ya que haciendo que el polgono se comportara extrao y no ocupar el espacio que quera, por lo que cambie todas las coordenadas y logre que funcionara correctamente, despus en mi casa continuare tratando de terminar con todo el contorno\r\n','2023-06-22'),(6336,289,'22-06','En el da de hoy, luego de la daily, he seguido trabajando en el login de la app (python), adems de hacer un boceto de como quiero hacer el inicio de la app. Vi algunos videos para seguir con la parte de la libreria(Tkinter), siendo que hoy toco ver Posicionamiento y algo de Poo. Eso ha sido todo por hoy, muchas gracias!!','2023-06-22'),(6337,274,'Funcionalidades PHP, Reunin con el equipo, Prototipados','El dia de hoy iba a agregar algunas funcionalidades al PHP que contiene la tabla con los incidentes reportados por los usuarios, a pedido del Project Mnager de mi equipo. Lo que l me haba pedido era agregar un filtro en el cual se puedan buscar los incidentes segn las distntas categoras de la tabla. Adems, tambin deba agregarle dos funcionalidades: la de modificar un incidente y la de eliminarlo. Tambin me pidi realizar los prototipados de los anteriores diseos que haba hecho, ya que no los habamos hecho. Tras esto, el Project Mnager nos convoc a todos los integrantes del grupo a una reunin para discutir algunas cuestiones para ver como podramos llegar a vender nuestro proyecto. Luego dediqu un poco del tiempo a buscar alguna manera para aadir las distintas modalidades (las cuales se almacenaban en un array) a la base de datos, ya que me salia un error de que debia ser de tipo string en vez de array. Pero no pude encontrar ninguna solucin. Por ltimo, dise en Figma los prototipados de inicio de sesin y de la pgina que muestra los incidentes reportados.','2023-06-22'),(6338,295,'Pagina web ','En el da de la fecha contine con la modificacin de la pagina web de nuestro proyecto en la cual empec con lo que seria la parte del login, el inicio de sesin y el de registrarse. Creamos un formulario tanto para el inicio como para el registro, los cuales despus vamos a conectar mediante php a lo que sera la base de datos de los registros e inicios.','2023-06-22'),(6339,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Por el momento finalizamos en disear la pestaa del producto y tambien se le agrego una funcionalidad mediante la cual los selectores de talla y colores se diferencien de los demas tipos de prendar, pues no todos son similares tanto en talla como en colores, por lo que eso ya estara resuelto. Dado asi, faltaria configurar la pagina para poder agregar los productos al carrito y asi podamos configurar la pagina del carrito. \r\n- Por otro lado, ya se estaria configurando la tabla del carrito para que asi podamos usarla dentro de la base de datos y demas, por el momento se tendria en mente la Id del producto para no hacer el codigo tan extenso.\r\n\r\nEso fue todo por hoy.','2023-06-22'),(6340,285,'Da 19','Qu logr hacer hoy?\r\n\r\nHoy tuve un gran avance con la pgina de bsqueda. Investigando y probando diferentes tcnicas, logr implementar los switches para filtrar por envo gratis y la llegada de maana. Adems, consegu que la barra de bsqueda funcionara correctamente, permitiendo a los usuarios buscar productos de su inters. Al principio, tuve algunas dificultades para codificar en JavaScript, pero gracias a un tutorial que encontr, pude guiarme y superar los obstculos.\r\n\r\nTambin implement un script que muestra los productos introducidos en la pgina. Fue emocionante ver cmo los productos se mostraban en tiempo real y cmo se actualizaban al realizar una nueva bsqueda o aplicar un filtro. Adems, logr hacer que la funcin &quot;Max Precio:&quot; funcionara correctamente, permitiendo a los usuarios filtrar los productos segn el rango de precios que deseen gastar en su compra.\r\n\r\nEn qu se me complic?\r\n\r\nInicialmente, tuve dificultades al tratar de codificar en JavaScript. No estaba muy familiarizado con el lenguaje y me costaba entender algunos conceptos y sintaxis. Sin embargo, pude superar este obstculo al encontrar un tutorial detallado que me ayud a comprender mejor cmo trabajar con JavaScript y aplicarlo correctamente en mi proyecto.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, estuve investigando principalmente sobre la implementacin de filtros y funciones interactivas en una pgina web utilizando JavaScript. Busqu diferentes mtodos para lograr que los switches funcionaran correctamente y filtraran los productos segn las preferencias de envo gratis y la llegada de maana.\r\n\r\nAdems, investigu cmo hacer que la barra de bsqueda respondiera a las consultas de los usuarios y generara resultados relevantes. Aprend sobre las mejores prcticas para el manejo de eventos de teclado y cmo usar la entrada del usuario para buscar en una lista de productos.\r\n\r\nTambin me enfoqu en aprender cmo utilizar bases de datos para almacenar los productos y permitir una vista previa desde la pgina de bsqueda. Aunque an no he implementado esta funcionalidad, investigu diferentes enfoques y tecnologas para futuras mejoras en el proyecto.','2023-06-22'),(6341,278,'Clase N21 22/06/2023','El da de hoy contine con la pagina web de inicio , segu investigando sobre el responsive y le ped ayuda a mi compaero Luciano sobre el tema. Logre que el titulo y el header no se desformen cuando la pagina se ejecuta en un dispositivo mvil. ','2023-06-22'),(6342,286,'HTML, CSS y JS de Pgina Usuarios 2','El da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. Intent seguir con lo que haba dejado la clase pasada, hacer un cartel popup para el formulario de la pgina de usuarios. Empec a hacer lo viendo el video &quot;How To Make A Popup Using HTML, CSS And JavaScript | Create a Modal Box In HTML Website&quot; de GreatStack, luego de casi 30 minutos de copiar y pegar al pie de la letra cada paso que explica el hombre del video, los resultados terminaron siendo los inesperados, literalmente no andaba nada, por lo que decid buscar otro video. Justo en ese momento, nuestro Scrum Master Enzo Bartoletti, convoca una reunin de grupo para hablar y tratar el tema de hasta donde queramos llegar con este trabajo y los objetivos. Al terminar esta charla tuve un pequeo receso y ms tarde continu con el trabajo. Cmo segu? busqu otro video que me pueda dar una mejor explicacin sobre como poder hacer el popup. Llegu al video &quot;Build a Popup With JavaScript&quot; de Web Dev Simplified y otra vez, luego de casi 30 minutos de hacer lo debido y seguir los pasos al pie de la letra, no sirvi nada, no andaba ni una funcin sola. No logr hacer ningn avance, por lo que siento una gran decepcin y desilusin, aunque creo que pude dar con la base del problema. A mi parecer el problema se encuentra desde el principio, me refiero a que todo empieza desde el botn que abre el popup, ya que este se encuentra dentro de una &lt;ul&gt; (unordened list). Si este no es el problema, tendr que ser algn tipo de incompatibilidad con Bootstrap (creo yo). Para concluir con el da de hoy continu un poco la capeta de campo con lo que haba hecho antes de ayer y ayer.','2023-06-22'),(6343,280,'','El dia de hoy se continuo la investiacion e instalacion de opencv y visual studio en el equipo correspondiente. Debido a fallas en la conexion no hubo oportunidad de probar si el codigo escrito para leer y tomar imagenes desde la interfaz funcionara correctamente. \r\nEn compensacion se rehicieron los diagramas de gantt se actulizo el trello y se ajustaron los diseos de las paginas e interfaces utilizadas.','2023-06-22'),(6344,273,'Bitacora 22/06/23','Hoy llegu al aula y empec a revisar el cdigo que tena. Decid cambiar la base de datos, en la parte de las tablas de los muebles, y les asign un ID auto_increment. Despus, modifiqu tambin el cdigo en java donde servira para controlar la base de datos, y edit los mtodos constructores de las clases.  Luego, cambi el mtodo constructor de los muebles, pero no borrando el atributo ID, que luego servira para hacer los selects de la base de datos y declararlos como objetos (con su respectiva ID).\r\nLuego de todo esto, realic un package en java y una clase diferente donde guardara todo el cdigo para generar los codigos de barra ms fcilmente y de forma ms ordenada. La misma clase se llama CodeBarGenerator, y est compuesta por una funcin que genera el pdf segn el nombre de archivo que se especifique y el String a convertir en codigo de barra. Luego de hacer todo esto, el archivo se guarda en la misma carpeta del proyecto, y luego se deber imprimir ya que al leer el cdigo QR con la aplicacin mvil, se verificar que el objeto est dentro de la base de datos al acceder a un link que se especificar al hacer todo esto.\r\n','2023-06-22'),(6345,283,'El dia de hoy, creamos la dayli para que luego poder ponernos a continuar de manera muy exaustiva la  pagina para darle una finalizacion al proyecto. Luego de tal introoduccion que realmente da a pensar que el texto es de gran magnitud y que por consecuen','El dia de hoy, creamos la dayli para que luego poder ponernos a continuar de manera muy exaustiva la  pagina para darle una finalizacion al proyecto. Luego de tal introoduccion que realmente da a pensar que el texto es de gran magnitud y que por consecuente yo el dia de hoy trabaje arduamente para finzalizar el proyecto. Pasando de todo esto, termine ayudando a mi compaero alan para hacer la pagina de busqueda y le agregamos cosas para su funcionalidad. usamos visual studio y el xampp para el php. ','2023-06-22'),(6346,279,'Dia 18 del Proyecto','En todo el da adems de llegar y abrir las paginas necesarias para poder hacer los dailys que faltaban empez haciendo la daily 19 llendo a preguntar lo que se hizo en el da ya que no me acordaba mucho pero sabiendo que ese da cambie de videos para estudiar los reacts y viendo como Enzo estuvo colaborando con Ledesma todo el da o mayormente en el da adems de ayudar a Forte, en el daily 20 mayormente Manuel estuvo haciendo arreglos con el PHP y ayudando un poco a Forte y Ledesma, en el daily 21 no encontr mucho de lo que hicieron pero mayormente Enzo estuvo ayudando a todos un poco y en el daily 22 es de hoy donde se avanzo bastante siendo que Ledesma estuvo haciendo de maso menos limitar el mapa con polgonos en HTML mientras Manuel estaba buscando como hacer un popups en JavaScript y Forte estuvo haciendo el prototipado del login de la pagina de administrador y Enzo ayudando un poco a todos y contando como poder vender nuestro proyecto.','2023-06-22'),(6347,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Por el momento finalizamos en disear la pestaa del producto y tambien se le agrego una funcionalidad mediante la cual los selectores de talla y colores se diferencien de los demas tipos de prendar, pues no todos son similares tanto en talla como en colores, por lo que eso ya estara resuelto. Dado asi, faltaria configurar la pagina para poder agregar los productos al carrito y asi podamos configurar la pagina del carrito. \r\n- Por otro lado, ya se estaria configurando la tabla del carrito para que asi podamos usarla dentro de la base de datos y demas, por el momento se tendria en mente la Id del producto para no hacer el codigo tan extenso.\r\n\r\nEso fue todo por hoy.\r\n','2023-06-22'),(6348,281,'Dia 15','El dia de hoy estuvimos calculando el precio de cada producto segun su peso, y con regalia de un 45% por la pintura, la energia y la ganancia.\r\nTambien estuvimos sacandole fotos para promocionar el producto y ademas estuvimos viendo tutoriales de youtube para sacar el registro y la cuenta.','2023-06-22'),(6349,284,'bitacora 16','hoy estuve haciendo algunos cambios en mi parte de la pagina que tuvimos que hacer , como aplicar el responsive en la pagina ','2023-06-22'),(6350,288,'Clase 18','Hoy hemos estado evaluando el valor de cada producto en funcin de su peso, y hemos aplicado un descuento del 45% por concepto de pintura, energa y margen de beneficio. Adems, hemos realizado sesiones fotogrficas para promocionar el producto y hemos recurrido a tutoriales en YouTube para obtener instrucciones sobre cmo obtener el registro y configurar la cuenta.','2023-06-22'),(6351,277,'Dcimo Sptima Clase','El da de hoy estuve imprimiendo y pintando las impresiones 3D que hice en mi casa, imprim los cuatro protagonistas de South Park y Totoro de la pelcula El Viaje de Chihiro. Adems estuvimos sacando fotos para su exposicin en la pgina web, con el agregado de calcular el precio dependiendo el peso de la figura con regalas de un 45% extra debido a la pintura, la energa y la ganancia.\r\nTambin estuve buscando tutoriales en Youtube para el registro e inicio de sesin de las cuentas, para brindarle mayor seguridad a los usuarios.\r\n','2023-06-22'),(6352,293,'base de datos correccin ','hoy da correg el select de la base de datos y tambin un poco el diagrama de gantt','2023-06-22'),(6353,275,'Actualizacin ','hoy lo que hice fue bsicamente actualizar todo el diagrama gantt consultando con mis compaeros las fechas de inicio y de finalizacin de su trabajo, tambin verifique si todos estaban terminados correctamente y sin ningn error sacando que faltan cosas por terminar el resto ya estn prcticamente terminadas, con esto me refiero al tema de diagramas. ','2023-06-22'),(6354,294,'Pagina web - continuamos la modificacin','En el dia de hoy lo que hice junto a mi compaera fue seguir con la modificacin de la pagina web de nuestro proyecto, lo primero que hicimos fue la la parte del login, despues el inicio de sesion y registro. Creamos tambien un formulario en el cual servira para inciar sesion a los usuarios, y otro formulario tambien para guardarlos. Todo va a estar conectado mediante php a una base de datos. Como ultimo agregamos un footer a la pagina principal.','2023-06-22'),(6355,274,'Prototipado','En el dia de hoy lo que hice fue terminar de realizar el prototipado de la pgina que contiene los incidentes reportados. Esto me tom alrededor de media hora. Una vez que finalic esto, discutimos con el Project Manager acerca de que otras funcionalidades le aadiramos a esta pgina. Las que teniamos en mente eran un filtro para filtrar los incidentes segn las distintas categoras. Despues intercambiamos tareas con uno de los compaeros de mi equipo, ya que a el se le complicaba bastante su tarea.','2023-06-23'),(6356,278,'Clase N22 23/06/2023','El da de hoy tuvimos que reversionar la pagina web y le pusimos el nombre de MoonDream. Buscamos referencias en otras paginas de muebles, y en la nuestra agregamos un carrusel con 3 imgenes , y realizamos la seccin de &quot;Quienes Somos?&quot;. Ademas de esto verificamos que la pagina se pueda ver en un dispositivo mvil.','2023-06-23'),(6357,292,'tratar de logar que no se puedan colocar popuyps en los nuevos polgonos','En el dia de la fecha trate de conseguir que no se puedan colocar popups en los nuevos polgonos que coloque, trate de varias formas como por ejemplo que no se puedan poner los correspondientes popups en todos los polgonos con un determinado valor de color, pero no hubo caso y los popups se podan colocar igual, a lo ltimo se me ocurri cambiar los lmites con unas coordenadas alrededor de los lmites que yo quera pero esto no resulto porque los limites no se pueden moldear y la nica forma que tiene es de un cuadrado o rectngulo, esto lo termine de confirmas y que al poner todas las coordenadas que quera este no funciono y se achico el rectngulo a una pequea parte del mapa pero la funcin la cumpla que era que no se puedan colocar los popups, aunque no de la mera que buscaba ','2023-06-23'),(6358,286,'HTML, CSS y JS de Pgina Usuarios 3','El da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. Intent seguir con lo que haba dejado la clase pasada, hacer un cartel popup para el formulario de la pgina de usuarios. Para empezar, mi compaero de trabajo Ezequiel Ledesma me proporcion via gmail una pgina de Leaflet que segn el podra ayudarme a crear una ventana pop up, pero la pgina no era un tutorial o una ayuda, esta me daba mtodos y para que servan estos mtodos, al no entenderla, decid buscar en Google Drive una carpeta donde tengo un trabajo de otra materia que incluye una ventana popup. Intent copiar todo. Al hacerlo debera haber un header con un botn que habre dicho popup, result que no haba header, el script no andaba y el css tampoco andaba. Ms tarde intent hacer un popup desde el video de YouTube &quot;Cuadro emergente modal simple usando HTML y CSS&quot; de CodingNepal pero llegando a casi la mitad del video me d cuenta que todo lo que haca no funcionaba, por lo que deshice todo lo hecho. Para concluir, consult con el Scrum Master Enzo Bartoletti para me pueda dar otra tarea para hacer y esta dejrsela a mi compaero Christian. Acordamos en que Christian segua con mi tarea y to con la de Christian, el prototipado.','2023-06-23'),(6359,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin - Diagramas ','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- En primer lugar, empezamos a codificar la pestaa del carrito, pero por el momento solo diseamos el momento en el que el carrito se encuentra vacio, por lo que proximamente se estaria configurando el mismo para que cuando se encuentre algo dentro de la tabla del carrito, la cual tambien se estaria configurando para probarla. Tambien se configuro un poco la pestaa del producto para crearle un modo de form mediante el cual se pudiera agregar el producto al carrito, pero aun no se termino de configurar, por lo que se estara viendo a futuro.\r\n- Por otro lado, estuvimos realizando cierta actualizacion sobre los diagramas del proyecto, pues habian ciertos de ellos que necesitaban ser actualizados. \r\n\r\nEso fue todo por hoy. ','2023-06-23'),(6360,293,'tabla envio','hoy da hice la tabla de envi para el funcionamiento del base de datos a la pagina ','2023-06-23'),(6361,288,'Clase 19','El da de hoy falt mi gran compaero y amigo Federico Tolivia, el cual por temas personales no pudo asistir a la clase del da de hoy. Su ausencia no nos result un gran problema para seguir con nuestro proyecto, nuestro desempeo el dia de hoy fue bastante productivo a la hora de insertar los productos en la base de datos, terminamos la gran mayora de productos, pero an faltan algunos que no tenamos pensado agregar pero vamos a hacer la prxima clase. Tambien el dia de hoy agregamos imgenes al carrousel principal mediante bootstrap para que quede bonito y en un futuro cuando clickees la imagen te lleve al producto listo para comprarlo y ser enviado a tu casa en minutos. Colocamos los precios de cada uno, adems de los nombres de los productos. Logramos solucionar un problema que tenamos con la imagen del producto del carrusel el cual no se vea centrado, pusimos a Mandalorian, El gato con botas y Spiderman en el cual se ve bastante bien cada uno de nuestras caricaturas. ','2023-06-23'),(6362,275,'Cosas que terminar ','para para terminar este trabajo faltan pocas cosas como por ejemplo la tabla de envi la cual estuvimos haciendo hoy y tambi