 y ser enviado a tu casa en minutos. Colocamos los precios de cada uno, adems de los nombres de los productos. Logramos solucionar un problema que tenamos con la imagen del producto del carrusel el cual no se vea centrado, pusimos a Mandalorian, El gato con botas y Spiderman en el cual se ve bastante bien cada uno de nuestras caricaturas. &quot; cambiame las palabras','2023-06-23'),(6367,289,'23-06','El ida de hoy, contine con los videos que vi anteriormente ademas de averiguar algo de los diagramas, ya que como cambiamos algo de la idea del proyecto, tendremos que hacerlo todos de nuevo. Nos comento el profe que tendremos que hacer uno para hacer la pagina web y otro para el robot. Eso es todo por hoy, muchas gracias!','2023-06-23'),(6368,295,'Continuacion pgina web','En el da de hoy continuamos con la pagina web, con lo que serian los formularios, los seguimos haciendo ya que la clase pasada no lo habamos podido terminar, ya que hicimos lo que sera el footer de la pgina y empezamos con los formularios, entonces la clase de hoy pudimos terminar con esas dos cosas.','2023-06-23'),(6369,291,'','','2023-06-23'),(6370,285,'Da 20','Que logre hacer hoy?\r\n\r\nHoy ha sido un da bastante complicado y frustrante para m. Me propuse implementar una funcionalidad en la pgina de bsqueda del index, pero desafortunadamente no logr hacerlo funcionar. Pas mucho tiempo intentando solucionar el problema, pero no tuve xito. Fue realmente decepcionante, ya que esperaba poder completar esa tarea hoy.\r\n\r\nSin embargo, no todo fue negativo. A pesar de los contratiempos con la funcionalidad de bsqueda, logr agregar el nuevo footer al sitio web. Pero aqu tambin surgieron problemas, ya que el footer no est funcionando correctamente. No importa lo que intento, simplemente no anda, y eso ha sido muy frustrante.\r\n\r\nAdems, continu trabajando en la pgina de bsqueda, tratando de resolver ese inconveniente con la funcionalidad que deseaba implementar. An me falta descubrir cmo hacerlo, ya que no tengo claridad si se trata de un problema que requiere un script especfico. Espero poder resolverlo antes de la prxima clase, ya que es una parte crucial del proyecto.\r\n\r\nEn que se me complico?\r\n\r\nEl principal obstculo que encontr hoy fue la implementacin de la funcin de bsqueda en la pgina de inicio. A pesar de mis esfuerzos, no pude hacer que funcionara correctamente. Intent diferentes enfoques, revis el cdigo varias veces, pero no logr encontrar la solucin. Fue realmente frustrante no poder completar esta tarea y me gener una sensacin de decepcin y desnimo.\r\n\r\nAdems, enfrent dificultades con el nuevo footer que agregu al sitio web. A pesar de haberlo integrado segn las instrucciones, simplemente no est funcionando. No puedo determinar la causa del problema y eso me ha generado una gran frustracin.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, estuve investigando diferentes enfoques para implementar la funcin de bsqueda en la pgina de inicio. Busqu en foros y documentacin en lnea, tratando de encontrar un mtodo efectivo para lograrlo. Aunque no obtuve resultados positivos en esta ocasin, aprend sobre diferentes tcnicas y enfoques que podran ser tiles en futuros proyectos.\r\n\r\nTambin dediqu tiempo a investigar cmo solucionar los problemas con el nuevo footer. Le documentacin, revis tutoriales y busqu posibles soluciones en comunidades en lnea. Aunque todava no he encontrado una respuesta definitiva, adquir conocimientos sobre cmo solucionar problemas comunes relacionados con los footers en pginas web.','2023-06-23'),(6371,294,'Pagina Web - Correccin de base de datos ','El da de hoy lo primero que hicimos fue terminar con los formularios que empezamos la clase pasada, tanto el inicio de sesin como el de registrarse. Despus de terminar eso, corregimos algunos errores que nos daba la base de datos, la cual hizo nuestra compaera, porque nos daba error ya que falta crear la base de datos, que la vamos a usar para conectarla con php a los formularios.','2023-06-23'),(6372,290,'Decimonovena','En el dia de la fecha lo que hice fue hacer un Word con aproximadamente 16 preguntas frecuentes que se realizaron en una conversacin, saque las preguntas que mas se repetan y sus respuestas, luego me puse a hacer una correccin de una maqueta de una pagina web pero no tengo muy claro lo que tengo que hacer.','2023-06-27'),(6373,282,'Finalizacin parcial de Excel GS1','Durante la jornada de hoy termin la revisin de las 2311 filas correspondientes al Excel Relacion-VTA-MARCAS, quedando aproximadamente 150 filas para una revisin exhaustiva. Adems me junte con Toms para revisar alguna de estas filas catalogadas como &quot;revisar&quot; y para solicitarle acceso al BackOffice para poder realizar yo estas revisiones.','2023-06-27'),(6374,250,'Martes 27/6/2023','hoy me sent mal no hice mucho, estuve trabajando en la materia &quot;Desarrollo de sistemas&quot;','2023-06-27'),(6375,255,'martes 27/06/23','hoy avance con el diseo de la pgina en figma :3','2023-06-27'),(6376,265,'27-06-2023','El da de hoy comenc a ubicar el puente H en la plataforma en donde ira en conjunto con la placa Arduino. Luego segu moldeando un cilindro, a las medidas de los hoyos, el cual servir para hacer los orificios en donde irn ubicados los tornillos.','2023-06-27'),(6377,253,'Martes 27/06/2023 - Unity','Hoy quise ver algo de Unity y tratar de avanzar algo en esa tarea pero no me abra el archivo de Unity que ya haba creado Enzo Romaniello, me saltaba un error que no conoca y no pude hacer nada.','2023-06-27'),(6378,269,'27/6','Hoy contine con el contador de clicks en React ','2023-06-27'),(6379,268,'27-06-2023','Hoy contine con el diseo 3d del robot sumo donde le agregue la parte trasera donde tendr los motores, el puente h, las ruedas,el Arduino uno y un sensor de linea.','2023-06-27'),(6380,254,'27/06/23','hoy hice la pagina de prueba para la bdd e investigue mas sobre java web','2023-06-27'),(6381,260,'','Modificacion de diseo y parte funcional con