 la hora.','2023-06-28'),(6412,257,'28/6/2023','Hoy creamos una cuenta con los assets en unity, pero tuvimos problemas al ingresar a unity, no nos dej importarlos, vamos a seguir en casa','2023-06-28'),(6413,262,'28-6-2023','El dia de hoy realizamos los cuartos de unity de cada tematica ya con sus puertas y triggers','2023-06-28'),(6414,266,'Firebase + notificaciones push descartadas ','En el dia de la fecha estuve intentnaod mandar las notificaicones, pero me di cuenta que no es rentable ni viable hacer las notificaciones. Debido a que tendria que crear services especialixzados para cada sistema. En definitiva, lleguen a la conclusion que no es viable hacer notificaciones, debido a que se tendrian que crear services tanto para ios, como para android y para cualquier sistema operativo. ya que los services son correspondientes al sisitema y no tienen nada que ver con lo web. ','2023-06-28'),(6415,250,'Miercoles 28/6','hoy estuve estudiando cursos de javascript con apis','2023-06-28'),(6416,303,'28-06-2023','Hoy hicimos escenarios del juego Unity','2023-06-28'),(6417,286,'HTML y CSS de pgina Administrador y Mapa de Pgina Usuarios','El da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. Para empezar el da laboral, mi compaero Ezequiel Ledesma solicit mi ayuda con su parte del trabajo, necesitaba que busque unas coordenadas especficas dentro del mapa de la Capital de Buenos Aires, estas eran para que el pueda hacer un lmite que tenga la funcin de no colocar popups fuera de la Capital. Lamentablemente la idea que mi compaero tena en mente no dio los resultados esperados. Ms tarde me puse a trabajar en la pgina de administradores en la seccin de &quot;incidentes&quot;, lo solicitado por el Scrum Master era agregar tres botones para que tengan las funciones de insertar, modificar y eliminar reportes. Ms tarde, el Scrum Master me encomend la tarea de mover de lugar el logo y el botn para cerrar sesin, los cuales puse centrado y en la esquina superior derecha respectivamente.','2023-06-29'),(6418,292,'tratar de logar limites y agturpar popup','En el dia de la fecha 29/06 comenc con l idea de poder moldear el lmite con la misma tcnica de ver las coordenadas pero ahora creando un nuevo lmite, pero esto no dio resultados, para esto mi compaero manu me haba ayudado dicindome las coordenadas de los limites. Luego de este fallo segu con lo otro que era tratar de que los popups se agrupen, esto ya que mi compaero enzo me paso das anteriores una pgina la cual era hecha con leaflet. Por lo que inspeccionando la pgina trate de buscar la parte del cdigo que agrupe los popups pero no la encontr, aunque no la busque demasiado, lo que si encontr fueron las funciones de geolocate que nos van a servir ms adelante.\r\nencontr otra pgina que me deca como agregar la funcin pero no pude aplicarla a mi trabajo por lo que seguire en otro momento \r\n','2023-06-29'),(6419,277,'Dcimo Octava clase','El da de hoy estuvimos estilizando la pgina, haciendo diseos para la venta de productos destacados y mejorando la experiencia del usuario. Primero hicimos un Banner, una imagen larga horizontalmente, para una de nuestras figuras en venta, del Gato con Botas, el cual al principio no nos termin de convencer, as que tuvimos que cambiarlo devuelta ms adelante. Luego hicimos el banner del Mandalorian, un personaje de Star Wars donde usamos la tipografa de la misma serie. Por ltimo hicimos el banner de Spiderman, mas especficamente Iron Spider, una versin de spiderman que cuenta con cuatro brazos mecnicos en la espalda.\r\nPor ltimo agregamos algunos problemas para resolver al github que intentaremos resolver el da de maana.\r\n','2023-06-29'),(6420,278,'Clase N23 29/06/23','El da de hoy quede muy cerca de finalizar la pagina de inicio.Agregue informacin sobre la fabrica de los muebles , coloque una imagen de la fabrica y realice el footer. Pero lamentablemente la