cargar la imagen. Finalmente, encontr una pgina llamada PicWish la cual me permiti descargar la imagen ya mejorada, y el resultado fue mucho mejor de lo que esperaba. Por ltimo, la aad a la carpeta donde se encuentran todos los archivos y le baj el tamao de 200px a 110px utilizando la propiedad width en el archivo .css.\r\n    Luego lo que hice fue buscar alguna forma de modificar el tamao del icono de cierre de sesin, ya que en clases anteriores haba probado esto pero nada me haba funcionado. Entr en una pgina la cual deca que se poda cambiar el tamao de la clase hasta 10xl, pero al probar esto quedaba un cuadrado grande en color blanco. Luego, le que se poda agrandar utilizando la propiedad font-size, lo cual finalmente me funcion.\r\nLuego, trabaje en solucionar los errores que me salian al marcar los checkbox en el php.','2023-06-29'),(6424,285,'Dia 21','Qu logr hacer hoy?\r\n\r\nHoy me dediqu por completo a trabajar en la base de datos, agregando nuevas tablas y estructuras. Fue un da bastante productivo, ya que logr crear y disear diversas tablas que eran necesarias para el funcionamiento adecuado de nuestro proyecto. Entre las tablas que agregamos se encuentran: &quot;Cliente&quot;, &quot;Pedido&quot;, &quot;Producto&quot;, &quot;Carrito&quot;, &quot;Favoritos&quot;, &quot;Pedido_Producto&quot;, &quot;Destacados&quot;, &quot;Ofertas&quot; y &quot;Envo&quot;.\r\nCada una de estas tablas fue cuidadosamente planificada y diseada para almacenar la informacin relevante de manera organizada y eficiente. Me asegur de definir correctamente las relaciones entre las tablas y establecer las claves primarias y forneas necesarias para mantener la integridad de los datos.\r\n\r\nEn qu se me complic?\r\n\r\nAfortunadamente, no encontr mayores complicaciones durante el proceso de creacin de las nuevas tablas en la base de datos. Aunque hubo algunos desafos menores, como decidir la mejor forma de estructurar ciertos campos o establecer las relaciones adecuadas entre las tablas, pude resolverlos rpidamente mediante la investigacin y la consulta de documentacin relevante. En general, todo transcurri sin mayores dificultades.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, estuve investigando sobre las mejores prcticas para el diseo de bases de datos relacionales y cmo estructurar adecuadamente las tablas y relaciones entre ellas. Tambin me inform sobre cmo definir las claves primarias y forneas, as como cmo establecer restricciones y reglas para mantener la integridad de los datos.\r\nAdems, investigu sobre las diferentes opciones de almacenamiento y optimizacin de bases de datos, considerando factores como el rendimiento, la escalabilidad y la seguridad. Busqu informacin sobre cmo indexar adecuadamente las tablas, cmo optimizar las consultas y cmo asegurar la confidencialidad de los datos almacenados.\r\nTambin investigu sobre las mejores prcticas para el manejo de relaciones muchos a muchos, como en el caso de la tabla &quot;Pedido_Producto&quot;. Aprend cmo utilizar tablas de enlace y cmo establecer las relaciones correctamente para representar adecuadamente esta relacin compleja.\r\n','2023-06-29'),(6425,293,'diagrama de entidad relacional ','actualice el diagrama de entidad relacional porque hubo muchos cambios en la base de datos.','2023-06-29'),(6426,291,'Avance del proyecto','El dia de hoy realizamos la daily del 29/6 donde respondimos las tres preguntas, hoy cambiamos en su totalidad la base de datos por una completamente nueva con ms tablas y ms eficiente con la cual podremos realizar mejor la pagina y conectar la base de datos con esta, gracias a la nueva base de datos son va a resultar ms fcil realizar el php y terminar la pgina.\r\n(La del 23/06 se mando en blanco :( )','2023-06-29'),(6427,273,'29-06-2023','Hoy tuve una reunin con los profesores donde me dijeron que poda dividir mi proyecto en dos. Por mi parte, tendra que hacer la API (los servlets y dems cosas en Java) que posteriormente usaran mis compaeros para la parte del frontend, solamente que la API sera mi proyecto como tal. Despus me dispuse a realizar los servlets, empezando por el de ingresar cama, donde me estanqu porque estuve pensando sobre cmo podra realizar el hecho de que tenga escanear el codigo de barra y posteriormente verificarlo en la base de datos.','2023-06-29'),(6428,284,'bitacora 18','Decidimos realizar toda la pagina de nuevo desde cero , nos habiamos equivocado con el tema del responsive , y arreglarlo se nos hacia muy complicado y tambien no nos termino de convencer el diseo de la pagina , hoy yo estuve realizando la pagina donde ingresas y/o retiras productos todavia me faltan terminar los form y el diseo para que quede agradable a la vista','2023-06-29'),(6429,296,'Bitcora 17','Dado que tuvimos que cambiar la pgina hoy empeze a hacer la parte de login y registrar, tuve varios problemas para que se acomode a la resolucin del celular, y an no puede arreglar uno de un formulario','2023-06-29'),(6430,275,'Dia normal.','Durante el da de hoy lo que estuve haciendo a fatal que nuestro project manager falto fue revisar los que estuvimos haciendo hasta ahora, es decir\r\nestuve viendo los diagramas, las dailys, la carpeta de campo grupal y tambien el codigo SQL,  ','2023-06-29'),(6431,281,'Dia 17','Hoy, junto con los colegas Ruiz Matias y Tolivia Federico Andres, terminamos de disear el carrusel de nuestra pgina de inicio (index.php), arreglando errores como la lnea blanca de nuestro carrusel y  cambiando el tamao de las imgenes en la pgina en detalle y diseamos cada foto de cada producto. Usamos la aplicacin paint.net para el edit de cada foto.\r\n Tambin pusimos los nombres  de cada personaje en el carrusel y todo estuvo muy bien, todava tenemos que decidir muchas partes de la pgina de inicio, por ejemplo, poner el link respectivo de cada producto en el carrusel y que te enve directamente al producto  para comprarlo. Todava tenemos un largo camino por recorrer, pero en la prxima clase haremos todo lo posible para seguir adelante con nuestro proyecto. Tambin agregamos algunas tareas en el github como por ejemplo lo de la lnea blanca en el carrusel de imgenes. Igual como ya los realizamos lo marcaremos como hecho. \r\n','2023-06-29'),(6432,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin - Diagramas','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\nPrimero que nada,Seguimos codificando la pestaa del carrito se encuentra vacio por el momento todavia, Proximamente se estara configurando el mismo para que cuando se encuentre algo dentro de la tabla del carrito, se estara configurando para probarla que tal va quedando si resalta algun error. Fuimos configurando la pestaa del producto para crearle un modo de form mediante el cual se pudiera agregar el producto al carrito, pero aun no se termino de configurar, por lo que se estara viendo a futuro.\r\nPor ultimo, Seguimos realizando cierta actualizacin sobre los diagramas del proyecto, pues haban ciertos de ellos que necesitaban ser actualizados. ','2023-06-29'),(6433,288,'Clase 20','El dia de hoy con mis compaeros Guerrero Joseph Perdomo, y Tolivia Federico Andres, perfeccionamos el carrousel de nuestra pagina principal (index.php), de tal manera que arreglamos errores como la lnea blanca sobre nuestro carrousel y el tamao de las imgenes de cada producto, detallamos y estilizamos cada una de ellas.\r\nTambin colocamos los nombres dentro del carrusel de cada personaje, y todo qued muy bonito, an nos falta terminar muchas partes de la pgina principal como por ejemplo que cada producto del carrousel te mande a el producto directamente para comprarlo, tenemos mucho camino por delante pero la prxima clase dar lo mejor de mi para poder avanzar en nuestro proyecto, intentar realizar lo susodicho anteriormente y realizar por lo menos un personaje con sus imgenes, descripcin y botn de compra.\r\n','2023-06-29'),(6434,290,'Vigesimaprimera','En