ails y viendo el tema de diseo html por email, y pude mandar emails al crear nuevos eventos. ya funciona correctametne y practicamente, no merge por que todavia hay cosas para mejorar','2023-07-05'),(6459,265,'05-07-2023','Segu haciendo la parte en donde ira el sensor de ultrasonido preguntndoles a mis compaeros, que van mas avanzado con sus diseos 3D, de como es que haban hecho ','2023-07-05'),(6460,253,'Mircoles 05/07/2023 - Unity','Hoy trat de hacer el cdigo de cuando el jugador entre por una puerta, se teletransporte a otro escenario.','2023-07-05'),(6461,267,'05-07-2023','Hoy hice gran parte de la carpeta de campo y estuve haciendo la presentacin del proyecto','2023-07-05'),(6462,259,'5/7 Practicas Profesionalizantes Nahuel Moreno','El dia de hoy, igual que ayer, solamente contine y avance(bastante) con la carpeta de campo','2023-07-05'),(6463,268,'05-07-2023','El da de hoy comenc con un pequeo arreglo del diseo 3D especficamente en la parte del sensor de ultrasonido donde mejore con el consejo de mis compaeros.Tambin hoy comenc con una animacin para la presentacin del proyecto a travs de SelfCAD donde en su canal de youtube me gue.','2023-07-05'),(6464,261,'05/07/2023','Hicimos la precentacion canva','2023-07-05'),(6465,251,'Desarrollo Api 2 - 5/7/2023','El da de hoy continu desarrollando la API con Laravel. Logr resolver el problema del registro de usuarios y tambin cre varios controladores. Empezar a trabajar en la segunda entrega de la Carpeta de Campo.','2023-07-05'),(6466,250,'miercoles 5/7/2023','Hoy programe el login y el register de la pagina web','2023-07-05'),(6467,255,'miercoles 5/7/2023','hoy disee las ventanas de login y register en figma','2023-07-05'),(6468,254,'05/07/23','Hoy segui investigando sobre java web y lls pasos a seguir para avanzar con el proyecto','2023-07-05'),(6469,303,'05-07-2023','Hoy empezamos a realizar el codigo de las habitaciones en unity','2023-07-05'),(6470,282,'Word DudasRecortesMarcas','Durante la maana de hoy estuve junto a Alegre de manera presencial en las oficinas de GS1, realizando lo que me qued pendiente del da de ayer lo cual refera a pasar los datos anotados en el Word DudasRecortesMarcas, los cuales se deban trasladar al documento Problemticas surgidas durante Recortes-Marcas Trazabilidad - GS1 V0.1. Esto lo realic en tan solo 15 minutos, finalizando con mis tareas en el da de hoy y quedando pendiente a nuevos objetivos los cuales sern planteados en los das venideros.\r\nDurante la tarde de hoy me presente a practicas profesionalizantes, creando una carpeta de campo propia del proyecto y avanzando sobre este documento.','2023-07-06'),(6471,290,'Vigesimasegunda','En el dia de la fecha termine el requerimiento del portal del socio, corrigiendo la escritura y agregando imagenes actualizadas de la maqueta, tambien revise los mails y busque 6 preguntas nuevas para las preguntas frecuentes de afip','2023-07-06'),(6472,298,'clase 20','Hoy volvimos a hacer el trello de cero, ya que el que tuvimos antes era un desastre. Tambin volvimos a hacer los diagramas, seguimos trabajando en ello.\r\n','2023-07-06'),(6473,292,'mostrar las cosas que hice fuer de la escuela y carpeta de campo ','En el dia de hoy le mostr lo avanzado a mi compaero enzo bartoletti y le mostr los errores del cdigo a la hora de bloquear los polgonos,  la idea de este cdigo es bloquear los diferentes polgonos que fui agregando para tapar las imperfecciones, ese solo funciona pero cuando agrego las coordenadas de otro cdigo este se rompe y los limites se ponen en cualquier lado. Trate de hacer funcionar el botn para que me muestre mi ubicacin actual pero no hubo caso y lo voy a intentar ms tarde en  mi casa, despus del recreo me puse a escribir ms hojas en la carpeta de campo y lo pude extender a 76 hojas, estoy planeando hacer al menos 115 hojas para asegurarme de pasar bien el filtro de calidad','2023-07-06'),(6474,286,'HTML y CSS de pgina Incidentes','\r\nEl da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. El da laboral empez de la siguiente manera, consult con el Scrum Master cierta informacin de la pgina de administradores para concluir en que cada botn de la pgina de &quot;Incidentes&quot; abra un formulario desplegable para que los administradores que trabajes sobre la pgina puedan modificar los incidentes que se almacenan en la base de datos. Para realizar estas tareas hice uso de la pgina &quot;Bootstrap&quot; en la que entr a la seccin de &quot;Components&quot; y luego en &quot;Offcanvas&quot;, baj hasta la parte del &quot;Toggle bottom offcanvas&quot; y copi el cdigo de HTML que me proporcionaba. Me haba olvidado de incluir el CSS y JS de Bootstrap, por lo que me dirig a la seccin de &quot;Getting started&quot; y entr a &quot;Introduction&quot; para bajar hasta el punto 2 y copiar lo necesario. Una vez todo preparado empec con lo que me compete, copi el cdigo del botn desplegable 3 veces dentro del cdigo para reemplazar a los antiguos &quot;Insertar&quot;, &quot;Modificar&quot; y &quot;Eliminar&quot;. Toqueteando un poco el HTML y el CSS logr hacer que los botones tengan la apariencia anterior. Para hacer lo solicitado anteriormente, dentro de la ventana desplegable de Bootstrap, hice un &lt;table&gt; y puse dentro de los &lt;th&gt; &quot;Ubicacin&quot;, &quot;Modalidad&quot;, &quot;Cantidad de Asaltantes&quot;, &quot;Cantidad de Afectados&quot;, &quot;Objetos Sustrados&quot;, si requiere ambulancia o bomberos e &quot;Informacin Adicional&quot; para mas tarde poner dentro del &lt;tbody&gt; y los &lt;td&gt; los cdigos necesarios para que dentro de los casilleros de la tabla aparezcan los &lt;input&gt;. Hay un poco de complicaciones porque el cdigo CSS de la primer tabla interfiere un poco con la segunda tabla. De esta forma concluye el da de hoy. Lo que sigue luego de terminar el diseo, es hacer que la informacin que se inserta dentro de cada botn desplegable, puede aplicarse a la base de datos.','2023-07-06'),(6475,279,'Dia 19 del proyecto','En el da de hoy estuve haciendo los dailys que me faltaron ademas de hacer el da de hoy y despus el Scrum master osea Enzo me pidi mayormente hacer como una carpeta del campo pero sobre exclusivamente del proyecto contando las cosas mas importantes de este tipo cdigo documentacin y parecido y iba a ser en parte siendo lo que tenia que llenar seria la seccin de documentacin de dailys.','2023-07-06'),(6476,274,'Adicin de funcionalidades a la pgina de los usuarios','En el da de la fecha tenamos pensado recorrer las distintas aulas del establecimiento para promocionar nuestro proyecto a las distintas divisiones de ciclo inferior. Pero decidimos cancelar dicha actividad debido a que queramos esperar a tener algunos avances ms en el proyecto, as como una presentacin decente.\r\n     Entonces lo que hice fue hacerle algunas mejoras en la funcionalidad de la pgina de los usuarios web, en la cual se reportan los incidentes. Lo primero que hice fue aadir un required al final de cada uno de los input, para que de esta manera se deba ingresar de manera obligatoria un valor. De lo contrario, no se podr enviar el formulario debido a que saldr una advertencia diciendo que se debe completar dicho campo. Una idea que se me ocurri fue la de mostrar un cartel una vez que se presiona el botn para enviar los datos. Originalmente, el botn se presiona y redirecciona al usuario a la pgina PHP, la cual muestra los datos que el usuario ingres. A su vez, pens que en la parte de abajo del cartel desplegable aparezca una declaracin jurada, la cual el usuario deber aceptar cuando reporte un incidente. Le coment esta idea al Project Mnager de mi grupo y acept, pero tambin me dijo que deba hacer un prototipado en Figma antes de iniciar el cdigo.','2023-07-06'),(6477,285,'Da 22','Qu logr hacer hoy?\r\n\r\nHoy continu trabajando en la pgina de bsqueda y comenc a desarrollar la pgina del carrito. En la pgina de bsqueda, me enfoqu en imprimir los juguetes que estoy insertando desde la base de datos. Al principio, me encontr con varios errores, pero pude solucionarlos. Solo falta organizar la presentacin de los resultados para que se vea ms atractivo visualmente.\r\nMientras solucionaba esos errores, me dediqu a empezar con la pgina del carrito. Para esto, necesito crear una base de datos y probablemente algunos scripts para probar e insertar elementos en ella. Adems, quiero que la pgina de compra (que ya est diseada, pero le faltan elementos de PHP/scripts) permita guardar los artculos seleccionados en el botn del carrito y que estos se muestren correctamente en dicha pgina. Aunque es un proceso complejo, me gustara lograr que funcione de esta manera.\r\n\r\n\r\nEn qu se me complic?\r\n\r\nDurante el da, enfrent dificultades al imprimir los juguetes desde la base de datos en la pgina de bsqueda. Inicialmente, me encontr con varios errores que afectaban la visualizacin de los resultados. Sin embargo, despus de dedicar tiempo a investigar y realizar ajustes, pude solucionar esos problemas y ahora solo necesito ordenar y mejorar la presentacin de los resultados para que se vean ms atractivos.\r\nEn cuanto a la pgina del carrito, an no he experimentado complicaciones significativas, pero s que el proceso de implementar la base de datos y los scripts requerir un esfuerzo adicional y posiblemente me enfrente a desafos en ese proceso.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, estuve investigando diferentes aspectos relacionados con mi proyecto. Me centr en encontrar soluciones para imprimir los juguetes desde la base de datos en la pgina de bsqueda, lo cual implic explorar mtodos eficientes y mejores prcticas en la programacin PHP y en la interaccin con bases de datos.\r\nTambin me dediqu a investigar cmo crear la base de datos necesaria para la pgina del carrito y cmo disear los scripts correspondientes para insertar elementos y realizar pruebas en la base de datos. Investigu sobre las mejores prcticas para la gestin de bases de datos y cmo garantizar la integridad y eficiencia de la informacin almacenada.\r\n','2023-07-06'),(6478,293,'diagrama entidad relacional y camino critico','hoy da modifique los 2 diagramas porque faltaba agregar cosas tambin los modifique.','2023-07-06'),(6479,278,'Clase N24 06/07/23','El da de hoy comenzamos con el diseo de la pagina web que contiene el inventario , utilizamos el header y el footer de la pagina principal.Primero comenzamos con una lista que contiene el nombre de cada producto junto a un checkbox. Ademas continu armando mi carpeta de campo.','2023-07-06'),(6480,277,'Decimo Novena Clase','El da de hoy estuve rellenando la pgina principal con distintas utilidades para que los usuarios tengan una mejor experiencia al momento de navegar. Indiqu los mtodos de pagos, estos siendo por tarjeta de crdito o dbito, cuotas sin tarjeta y efectivo, adems de agregarle descuentos a los mtodos virtuales para promover el uso de estos.\r\nPor otro lado, agregue una lista de items en oferta la cual por ahora se encuentra vaca por la falta de productos, pero el da que tengamos muchos ms para vender podremos mostrar nuestras ofertas de forma rpida y sencilla.\r\nPor ltimo agregue un par de cartas que dividen los objetos por series o pelculas especficas para aligerar la cantidad de productos en el usuario y no abrumarlo con tantas opciones, reduciendo la bsqueda a una franquicia en especfico en vez de entrar en el vasto almacenamiento de LiliFy.\r\nAdems agregue una barra de bsqueda que por ahora se encuentra sin funcionamiento, pero pronto servir para buscar objetos mediante palabras claves sin mucho esfuerzo.\r\n','2023-07-06'),(6481,273,'revision de carpeta de campo','En el da de la fecha empec haciendo el cdigo para ingresar a la base de datos informacin mediante codigos de barras. Para eso, resolv por hacer que se tenga que hacer los inserts mediante la lectura de codigo QR generados por la computadora. De esta forma, sera ms ordenado. Luego de eso, empec a revisar la carpeta de campo para ver qu cosas me faltaban.','2023-07-06'),(6482,291,'06/07/2023','El da de hoy empece organizando la carpeta del grupo la cual estaba desordenada, despus de acomodarla y organizarla abr algunos archivos que estaban sueltos para acomodarlos con otros archivos  o eliminarlos para que no ocupen espacio, despus de todo eso abr la pagina y revise que no funcionaba y como arreglarlo, lo que no funcionaba eran dos modal el de registro y el de login, el error que tenan  era que el botn para registrarse o logearse los cuales estaban mal puestos y programados, al final pude arreglarlos y hacer que funcionen, despus revise los php y las conexiones, del php cambie el registro.php  para que el insert que hace no tire error e ingresara los datos en la base de datos, y al final realizamos la daily con mi compaero Alan (El nico que vino).','2023-07-06'),(6483,296,'Bitcora 18','Hoy estuve terminado de disear la pgina ingresar producto y tambin prob creando una mini base de datos para poder ingresar,modificar y eliminar productos y ver cmo sera andando','2023-07-06'),(6484,288,'Clase 21','El dia de la fecha avanc en unas cuantas cosas de la pagina web.\r\nEmpezando por lo primero que realic, fu crear el Instagram de nuestro proyecto, el mismo ya cuenta con una cantidad de 3 mil seguidores, ya que era una cuenta de uno de los integrantes de nuestro grupo y decidi realizarla, en su cuenta.\r\nY en la parte de contactos de la pgina agregu el link para que puedan acceder a la misma y mantenerse al da de nuevos modelos 3D.\r\nPronto mejoraremos la interfaz para que se vea ms atractiva visualmente.\r\nLuego de eso mismo, he realizado muchas ms cosas como, realizar cada botn de nuestros productos y arreglar cada imagen para que quede perfectamente alineada junto con las dems, tambin agregu lo que sera un Pasa pagina que es para cambiar a la pgina siguiente o para volver a la anterior.\r\nAdems agregu el nombre y descripcin de cada producto, solo queda agregar el precio y los dems productos faltantes, con sus respectivas imgenes y descripciones.\r\nTambin le agregu a cada imagen del carrousel principal un href para que sea directamente dirigida a el producto detalladamente, adjunto imgenes de como queda hasta el momento.\r\nLa misma tiene un efecto de invisibilidad a la hora de pasar a la siguiente imagen, necesitamos acomodarla hacia un lado para hacer que la misma quede pequea y no estorbe tanto en toda la pagina, tambien agregar los botones de precio, descripcin, nombre, medios de pago, entre otras cosas.','2023-07-06'),(6485,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin - Diagramas','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- En primer lugar hoy seguimos configurando la pagina web, centrandonos nuevamente en la pestaa de producto, la cual terminamos de configurar. Habiendo agregado un boton para agregar los productos al carrito mediante una funcion que inserta los datos datos en el formulario de la pestaa del carrito, tambien incluyendo sus datos originales de la tabla producto, donde finalmente se estarian mostrando en la pagina del carrito, y al cumplir esto, se muestra un modal el cual notifica de si la agregacion del producto al carrito fue exitosa o no. Solo faltaira configurar bien la pestaa del carrito. Por lo que damos por finalizado la pestaa del producto.\r\n- Tambien se le dio cierto arreglo a la base de datos, pues se tienen en mente que el usuario en si tenga acceso a su propio carrito de compras, pues en un principio los productos se repetian sin importar que se cambie de cuenta, por lo que estaremos implementando eso mas adelante. \r\n\r\nEso fue todo por hoy.','2023-07-06'),(6486,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin - Diagramas','\r\nEl da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- En primer lugar hoy seguimos configurando la pagina web, centrandonos nuevamente en la pestaa de producto, la cual terminamos de configurar. Habiendo agregado un boton para agregar los productos al carrito mediante una funcion que inserta los datos datos en el formulario de la pestaa del carrito, tambien incluyendo sus datos originales de la tabla producto, donde finalmente se estarian mostrando en la pagina del carrito, y al cumplir esto, se muestra un modal el cual notifica de si la agregacion del producto al carrito fue exitosa o no. Solo faltaira configurar bien la pestaa del carrito. Por lo que damos por finalizado la pestaa del producto.\r\n- Tambien se le dio cierto arreglo a la base de datos, pues se tienen en mente que el usuario en si tenga acceso a su propio carrito de compras, pues en un principio los productos se repetian sin importar que se cambie de cuenta, por lo que estaremos implementando eso mas adelante. \r\n\r\nEso fue todo por hoy.','2023-07-06'),(6487,294,'Creacin de Diagrama de Flujo del robot - Unin de BD con los formularios','En el dia de hoy implementamos con mi compaera un nuevo diagrama de flujo de datos que este se va a relacionar con el robot que tengamos en nuestro proyecto, agregamos todos los niveles correspondientes (0,1 y 2) con la informacin que cumple cada accin en el diagrama. Adems de esto realizamos una conexin de la base de datos con el formulario de la pagina principal. La misma pgina hecha en PHP y con la oportunidad de conectarla sin problemas.','2023-07-06'),(6488,295,'Diagrama de flujo de datos del robot - conexin a bdd','El da de hoy continuamos con la pagina web, en este caso con la conexin de PHP a la base de datos, la cual hizo una compaera de grupo pero la tuvimos que modificar un poco para poder abrirla ya que la haba exportado mal. Y por ultimo hicimos el diagrama  de flujo de datos del robot de nuestro proyecto, ya que solo habamos hecho el de nuestra pagina web.','2023-07-06'),(6489,289,'06.07','El da de hoy, hemos sido 4 integrantes. Luego de la daily, con mi compaera carolina hemos actualizado el diagrama, adems de actualizar el trello. Eso es todo por hoy, muchas gracias.','2023-07-06'),(6490,286,'HTML y CSS de Pgina Incidentes 2','El da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. El da comenz tratando de seguir con lo que haba dejado el da de ayer, hacer una tabla dentro del botn desplegable, consegu hacer un avance, hacer que la tabla se vea volviendo todo a color negro, ms tarde intent hacer que los &lt;td&gt; de la tabla (los input) puedan alinearse con los &lt;th&gt;. Luego de varios intentos y varias bsquedas en internet sobre cmo hacer una tabla con inputs adentro, consult con mi compaero Christian Forte, el cul intent darme una mano mediante Google Meet pero para mayor comodidad, decidimos que el intent solucionar el error a mano. Con su ayuda pudimos ver varios cambios pero nada llevaba a lo que quera, por lo que decid empezar casi de 0 esta parte para poder hacerla de otra manera. Lo que hice fue borrar la tabla y poner todos los elementos de una dentro del botn desplegable para ms tarde, con CSS, escribir el siguiente cdigo: &quot;.offcanvas-body{display: flex; justify-content: space-between; margin-top: 3%; font-size: x-large;}&quot; para que todo quede centrado y las letras se puedan ver ms grandes.','2023-07-07'),(6491,274,'Validacin de checkbox ','En el da de la fecha lo que hice fue continuar con la validacin de los checkbox en el formulario de reporte de incidentes. Ingres a una pgina y prob el cdigo, pero el mismo no funcion. Despus prob otro cdigo, el cual tampoco funcion. Al mismo tiempo ayud a uno de mis compaeros de equipo a ingresar unos input dentro de una tabla en html, aunque no pudimos lograr eso debido a que los input quedaban muy angostos en relacin del tamao de la tabla. Luego de esto, volv a buscar una solucin para la vlaidacin de los checkbox, encontr un nuevo cdigo pero el mismo tampoco funcion.','2023-07-07'),(6492,293,'Base da Datos','hoy da eh eliminado una tabla para que despus agregue otra ya que la tabla esta mal echa.','2023-07-07'),(6493,295,'continuacin de conexin a bdd - correccin de errores en codigo','El da de hoy junto a mi compaero continuamos lo que empezamos ayer, la conexin de la base de datos a la pgina de nuestro proyecto, a parte de eso tambin hicimos algunas correcciones en el cdigo que nos daba error.','2023-07-07'),(6494,294,'Finalizacin de conexion BD - Correccin de errores php','Con mi compaera el da de hoy estuvimos terminando lo que habiamos dejado en el dia de ayer que era la union de la base de datos, modificamos las tablas y eliminamos tambien una. Adems de esto corregimos codigo en lo que sera el php ya que daba muchos errores a la hora de querer agregar usuarios a la tabla de la BD.','2023-07-07'),(6495,289,'Edenor/Reciduca','El da de hoy, adems de hacer un desayuno compartido. Hicimos una actividad de tener que describir una palabra sin decir est palabra, y el otro deba adivinarla.\r\nAdems de hacer una actividad de tirar una pelota, que est contenia preguntas, siendo que quien tiraba la pelota deba decir un nmero y la otra responder la pregunta \r\nEso fue todo por hoy, muchas gracias.','2023-07-11'),(6496,295,'Edenor / Reciduca','En el dia de hoy tuvimos la ltima clase antes de las vacaciones de invierno, en la cual empezamos con una actividad que consista en adivinar una cierta palabra con datos que te decia la\r\notra persona. Despus de eso tuvimos un desayuno entre todas y compartimos lo que cada una haba llevado. Por ultimo tuvimos una actividad que tirabamos una pelota con preguntas y cada una iba contestando alguna.','2023-07-11'),(6497,271,'11/07/2023','En el da de la fecha, contine haciendo mi personaje en blender. Pero no pude seguir porque tuve algunas complejidades con la elaboracin de la parte de la 