tidad de filas superior a 11.000, siendo que esto me llevar un largo tiempo','2023-07-11'),(6509,282,'Out_Carrefour / Automatizacion de procesos','En el da de hoy trabaje desde la virtualidad en la realizacin del archivo iniciado en el da de ayer, avanzando exponencialmente y logrando realizar 3433 filas en poco menos de 4 horas, logrando superar la totalidad de las filas con relacin directa conmigo (E01) y dejando tan solo 400 para revisar maana, quedando pendiente las filas NULL y las realizadas por otros integrantes. Tambin le propuse a Lucas Sosa una opcin para automatizar este largo y tedioso proceso mediante unas lneas de pseudocdigo las cuales se deben adaptar a MySQL de ser posible, el cdigo propuesto es algo similar al siguiente:\r\nIF (&quot;ECO DE LOS ANDES&quot; == &quot;ECO DE LOS ANDES&quot;){\r\n	RECORTES = &quot;OK&quot;;\r\n}ELSEIF (&quot;ECO DE LOS ANDES&quot; != &quot;ECO DE LOS ANDES&quot;{\r\n	RECORTES = &quot;REVISAR&quot;;\r\n}\r\nEn el caso de que esto funcione, ahorrara cantidades exponenciales de tiempo, pasando de 11.000 filas a menos de 1.000.\r\nA su vez, tras proponer esta modificacin, me comunique mediante una llamada de Skype con Toms para explicarle acerca de como funcionaba el nuevo archivo en el cual estoy trabajando y para explicarle la solucin que propongo para automatizar el proceso, quedando en consideracin y pendiente de comprobar a futuro si esto es viable.','2023-07-12'),(6510,270,'12/07/23','Esta jornada realizamos la primera entrega junto con la presentacin del proyecto, planificando un speach y explicando lo realizado','2023-07-12'),(6511,253,'Mercoles 12/07/2023 - Presentacin de proyecto','Hoy tuvimos que presentar todo lo que llevabamos del proyecto.','2023-07-12'),(6512,265,'12-07-2023','Hoy tuvimos la exposicin de proyectos ','2023-07-12'),(6513,271,'12-07-2023','En el da de la fecha con mis compaeros hicimos el speech y la presentacin del proyecto con mis compaeros Enzo Romaniello, Luis Meza, Valentn Bentos y Emilio Pereira ','2023-07-12'),(6514,303,'12-07-2023','Hoy tuvimos la presentacin del proyecto.','2023-07-12'),(6515,285,'Da 23','Qu logr hacer hoy?\r\n\r\nHoy tuve la oportunidad de visitar la empresa Eryx durante nuestra excursin. Aprend sobre el significado de una cooperativa y cmo fomenta la colaboracin. Tambin tuve la oportunidad de ver dos proyectos interesantes de la empresa: Aurora, una caja de telgopor enviada al espacio, y un calculador de golpes de papa, ambos proyectos de cdigo abierto.\r\n\r\nEn qu se me complic?\r\n\r\nAfortunadamente, no enfrent ninguna complicacin durante la excursin. Pude llegar al lugar sin problemas y disfrut de todas las actividades y presentaciones que nos ofrecieron en la empresa.\r\n\r\nQu estuve investigando?\r\n\r\nDurante la visita, aprend sobre el concepto de una cooperativa y cmo funciona en el mbito laboral. Tambin investigu sobre los proyectos Aurora y el calculador de golpes de papa, y comprend la importancia del cdigo abierto y cmo permite a las personas recrear y contribuir a proyectos existentes. Fue una experiencia enriquecedora que me ayud a ampliar mis conocimientos en el campo del desarrollo de software y la cooperacin en equipo.','2023-07-13'),(6516,274,'Salida a la empresa Eryx','En el da de la fecha tuvimos una salida didctica en el horario correspondiente a Prcticas Profesionalizantes. Concurrimos a la empresa Eryx, la cual es una cooperativa que se dedica al desarrollo de software. En Eryx, algunos de sus integrantes nos brindaron una charla acerca de cmo es el sistema de trabajo que realizan: una cooperativa la cual tiene como objetivo realizar distintos proyectos a clientes. Al ser una cooperativa, todos sus integrantes (que son aproximadamente treinta) colaboran en el proyecto, realizando sus respectivas tareas, adems de no depender de nadie. Tras esta explicacin, nos mostraron dos de sus proyectos que haban realizado. El primero era una caja que contena cmaras, cuyo objetivo era volar lo ms alto posible y as poder grabar la tierra a 21 kilmetros de distancia. Nos mostraron un video acerca de como haba sido el resultado final de la grabacin. El otro era un proyecto relacionado a la agricultura. Tras la explicacin, realizamos preguntas acerca de su modalidad de trabajo y de sus distintos proyectos.','2023-07-13'),(6517,286,'Excursin a empresa Eryx','El da de la fecha empez de una manera distinta a la habitual, tuve una excursin a la empresa desarrollo de software Eryx la cul fu en colectivo con dos compaeros del grupo de la materia. Al llegar ya estaban la gran mayora de los compaeros del curso y profesores de la materia por lo que los empleados de la empresa nos abrieron las puertas, Al entrar, una de las chicas que trabaja ah me di un recorrido junto a mis compaeros sobre casi todo el edificio donde se vean casi 10 habitaciones de trabajo con muchas computadoras y gente trabajando para finalizar el recorrido en la sala de &quot;presentaciones&quot; donde recib una charla introductoria de la empresa. Ms tarde, otro de los trabajadores nos present un par de proyectos de la empresa: Aurora y la papatrnica o algo parecido, no lo recuerdo bien. Aurora era una caja con una cmara que mandaron 20km arriba para poder observar la curvatura de la tierra desde Villa la Angostura. La papatrnica era una papa electrnica la cul permita medir la fuerza con la que se recolectan las papas, para poder recolectarlas con cuidado y que no se desperdicien. Para finalizar, los trabajadores nos dieron cosas ricas para comer y unos sticker de la empresa.','2023-07-13'),(6518,279,'Visita a la empresa eryx','En este da fuimos a una empresa llamada eryx donde trabajan de sistemas de software y parecido y al llegar nos hicieron una visita rpida por el lugar mirando a gente trabajando en ese momento para ver cmo tenan su sala de descanso y sala de reuniones y bueno en mi caso me sent en una de esas almohadas gigantes para ver la presentacin contndonos su historia adems de como era su forma de empresa siendo una cooperativa donde no hay jefe y trabajan todos en equipo adems de ensearnos algunos proyectos que hicieron uno siendo aurora que trata de mandar una caja con cmaras a 21km de altura y lo hicieron usando helio y despus de eso comimos y nos fuimos a cada uno a su casa','2023-07-13'),(6519,276,'Salida didctica Eryx Compaa de Software ','El da de hoy hemos realizado una salida didctica con los docentes y hemos visitado la compaa de software Eryx. En esta misma hemos visto una presentacin a ciertos aspectos de esta compaa, tanto como a lo que se dedican, a como se conforman en modo de cooperativa, hemos visitado sus instalaciones, nos han presentado diversos proyectos que han estado haciendo, tales como AURORA, proyecto que se bas en enviar una caja con cmaras y diversos sensores al espacio exterior, y otro prototipo de Papa Tecnolgica. \r\n\r\nDebido a esto, no hemos realizado avances dentro del proyecto de las prcticas profesionalizantes, por lo que ello se estar llevando a cabo prximamente. Eso fue todo por hoy. ','2023-07-13'),(6520,287,'Salida didctica a Eryx ','El da de hoy hemos realizado una salida didctica a Eryx, una compaa de software. En esta misma hemos visto una presentacin a ciertos aspectos de esta compaa, tanto como a lo que se dedican, a como se conforman en modo de cooperativa, hemos visitado sus instalaciones, nos han presentado diversos proyectos que han estado haciendo, tales como AURORA, proyecto que se bas en enviar una caja con cmaras y diversos sensores al espacio exterior, y otro prototipo de Papa Tecnolgica. \r\n\r\nDebido a esto, no hemos realizado avances dentro del proyecto de las prcticas profesionalizantes, por lo que ello se estar llevando a cabo prximamente. Eso fue todo por hoy. ','2023-07-13'),(6521,273,'13-07-2023','En este da realizamos una excursin donde visitamos una empresa llamada &quot;Eryx&quot;. En esta empresa ocupaban una metodologa de trabajo y una jerarqua por igual, donde todos realizaban algo de un trabajo sin