6524,288,'Clase 22','El da de hoy fuimos de visita a una cooperativa llamada Eryx, la cual se destaca por su desarrollo en software. En la misma nos explicaron como es su mtodo de trabajo, hace cuanto trabajan en la cooperativa, como y cuando se cre, su sistema de cobro, cada sector, los rankings de las personas. Luego del PowerPoint nos contaron y mostraron sobre 2 proyectos, uno de una caja, una go pro, un Arduino, un GPS, un globo y un paracadas, que fue al espacio y grabaron la curvatura del planeta tierra, luego cay y fueron a buscarlo. Luego nos mostraron el proyecto de una Papa, para saber cuntos golpes da, luego de su proceso, as de esa manera saber cmo prevenir que la papa no se dae. Luego nos dieron unos alfajorcitos de maicena y conitos con dulce de leche, y termin la charla, y cada uno se fue a su casa.','2023-07-13'),(6525,291,'Charla ERYX','El da de hoy fuimos a una empresa a las dos de la tarde llamada ERYX la cual en realidad es una cooperativa de 31 personas, en esta nos hablaron de lo que era una cooperativa, sus ventajas y desventajas, tambin nos contaron como empezaron siendo solo dos estudiantes de la UBA y terminaron como 31 personas en 12 aos, nos hablaron de algunos proyectos como Aurora que trataba en una caja que tenia que subir hasta grabar a curvatura de la tierra, el ltimo proyecto que mostraron era un prototipo de una papa que con unos sensores medira la velocidad y con la fuerza que se golpea, esta charla fue interesante.','2023-07-13'),(6526,293,'Bonpland 1953 palermo','Hoy da fuimos a visitar a la empresa Erick dnde nos hablaron sobre la historia de la empresa y despus nos mostraron 2 proyectos de la empresa que estaban interesantes y eso.','2023-07-13'),(6527,296,'bitacora 19','Hoy fuimos a la empresa eryx donde nos ensearon su metodologia de trabajo la cual no conocia y la verdad que me gusto mucho,tambien nos ensearon algunos de los proyectos en los que estaban trabajando ','2023-07-13'),(6528,282,'Gs1 y Eryx','En la maana de hoy 