023-07-13'),(6531,289,'13-07','El da de hoy, no hemos asistido a la escuela como hacemos normalmente. Hoy hemos hecho otra actividad, la cual se trato de ir a la empresa Eryx, o bueno, es una cooperativa.\r\nAl llegar al sitio citado, nos han dado tour por el sitio. Luego nos explicaron como trabajaba su cooperativa, adems de mostrarnos algunos de sus proyectos. \r\nEso es todo por hoy, muchas gracias.','2023-07-13'),(6532,294,'Visita a ERYX','En el dia de hoy en este caso tuvimos la oportunidad de conocer la cooperativa llamada ERYX y nos explicaron distintos aspectos referidos a las cooperativas, tambien lo q se necesita y como la armaron ellos. Ademas nos mostraron los dos proyectos que hicieron y uno era grabar el planeta tierra por afuera de la atmosfera gracias a un globo con helio y el otro proyecto era un dispositivo en 3d con forma de papa que se encarga como de disimular una y comprobar a que fuerza se sometian las verduras.','2023-07-13'),(6533,285,'Da 24','Hoy tuve la oportunidad de colaborar con mi compaero, Ciro Lobtrico, en la creacin de un detallado y completo documento en formato de presentacin utilizando Canva. Nuestro objetivo principal fue introducir y explicar las actividades que hemos llevado a cabo en nuestra pgina web, resaltando nuestras metas y los proyectos en los que actualmente estamos trabajando.\r\n\r\nQu logr hacer hoy?\r\n\r\nEn colaboracin con Ciro, logramos crear un documento de presentacin en Canva que abarcaba todos los aspectos importantes de nuestro trabajo en la pgina web. Nos tom un tiempo determinar las preguntas clave que debamos abordar en la presentacin, pero finalmente las identificamos y las incluimos en el documento. Tambin nos aseguramos de que el diseo fuera atractivo y profesional, utilizando las herramientas y recursos disponibles en Canva.\r\n\r\nEn qu se me complic?\r\n\r\nInicialmente, enfrentamos dificultades al tratar de determinar las preguntas clave que debamos abordar en nuestra presentacin. Nos llev tiempo autoevaluarnos y cuestionarnos a nosotros mismos para identificar los aspectos ms relevantes de nuestro trabajo. Sin embargo, con paciencia y dedicacin, superamos este desafo y obtuvimos un resultado satisfactorio.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el proceso, nos enfocamos en investigar cmo utilizar eficazmente la plataforma de diseo Canva para crear una presentacin impactante y profesional. Aprendimos sobre las diferentes herramientas y opciones disponibles en Canva para mejorar la apariencia visual de nuestro documento. Tambin investigamos sobre las mejores prcticas para la elaboracin de presentaciones persuasivas y cmo estructurar la informacin de manera clara y concisa.\r\n\r\nAdems, aprovecharemos el tiempo extra que tenemos debido a la postergacin de la entrega para revisar y perfeccionar nuestra presentacin. Nos aseguraremos de abordar correctamente todos los aspectos importantes y de transmitir la informacin de manera clara y convincente. Tambin afinaremos los detalles y agregaremos cualquier informacin relevante que pueda enriquecer nuestra presentacin.\r\n\r\nAunque la espera puede resultar frustrante, consideramos esta oportunidad como un impulso para mejorar an ms nuestro trabajo y garantizar que nuestra presentacin sea impactante y efectiva. Estamos decididos a aprovechar este tiempo de manera productiva para elevar la calidad de nuestro proyecto.\r\n\r\nUna vez que finalmente entreguemos nuestro documento en Canva, esperamos que sea bien recibido y refleje de manera precisa y convincente el esfuerzo y la dedicacin que hemos invertido en nuestra pgina web. Estamos ansiosos por compartir nuestras ideas y proyectos con los dems, y confiamos en que esta presentacin ser un paso importante en nuestra trayectoria hacia el xito.','2023-07-14'),(6534,273,'14-07-2023','En el da de la fecha me dispuse a realizar la presentacin de mi proyecto en Canva, que debera presentar luego del receso escolar de invierno. Dentro de este explico detalladamente cmo se realiz el proyecto, las tecnologas que use y las funciones y la codificacin que hice.','2023-07-14'),(6535,298,'Clase 22','Hoy tenamos una exposicin para contar cual fue nuestro proyecto y que es lo que hicimos hasta ahora pero no llegamos a darla todava, tambin tuvimos la entrega de la carpeta de campo a la cual lamentablemente no llegu a terminar a tiempo.','2023-07-14'),(6536,283,'receso invernal y tdos mis compaeros son unos vagos, menos ala.','Hoy llegue un poco tarde a clases y me sente a comenzar una presentacion sobre la pagina, mi compaero alan hizo un doc donde contenia todo lo que iba a tener la pagina. asi que solo tuve q crear el diseo de la presentacion y pasar su contenido. Creamos una introduccion al mismo donde contenia el nombre como titulo y luego un subtitulo con una frase sobre la pagina. luego creamos mas paginas sobre lo q contenia la pagina, como que es, como funciona, cuanto tardamos y que le podemos agregar a futuro a la pagina. Luego pusimos nuestros nombres (por que solo nosotros dos hicimos la presentacion) y ya la finalizamos. ','2023-07-14'),(6537,289,'14-07','El da de hoy, he continuado con la carpeta de campo, adems de continuar con la presentacin en canva y por ultimo seguir con los diagramas. Eso ha sido todo por hoy muchas gracias!','2023-07-14'),(6538,282,'entrega carpeta de campo','Durante el da de hoy trabaj muy poco, entregando tan solo la carpeta de campo','2023-07-14'),(6539,275,'&quot;Presentacin&quot;','Hoy lo que hice junto con mi grupo era crear una presentacin en Canvan en donde me hacamos la introduccin, presentamos el equipo, la web que hicimos, sus vulnerabilidades y la conclusin del &quot;proyecto&quot;: en la introduccin decamos que VicSon Web era una tienda virtual en la cual se puede comprar ropa.\r\nEquipo: VicSon Web es microempredimiento esta conformado por los siguientes integrantes; \'Kevin Bernabe\', \'Maximiliano Ortiz\', \'Jose Sanez\' y \'Alison Gargate\'.\r\nPagina web: es una tienda virtual que tiene  Proteccion ante con 2 CiberAtaques las cuales son &quot;Inyeccion SQL&quot; y &quot;XSS&quot; (Cross-Site Scripting)\r\n\'Versiones De VicSon\':Aqui se habla de como Vicson paso de ser un boceto a una maqueta a una pagina web.\r\n\'Conclusion Final\':En esta presentacin queramos ilustrar acerca de la pgina web y cmo ha sido su desarrollo durante el transcurso del proyecto, las mejoras que ha obtenido a partir de cada clase que hemos desarrollado, a pesar de las circunstancias que han sucedido en algunos momentos, pero hemos podido continuar.','2023-07-14'),(6540,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin - Carpeta de Campo','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos corregido cierto error dentro de la pestaa del producto, pues ocurri que hubo un error en el guardado del proyecto anterior a esta bitcora que hizo que cierta parte del cdigo usado para configurar la agregacin de productos dentro de la tabla del carrito funcione incorrectamente, por lo que tuvimos que realizarla de nuevo. En primer lugar configuramos las pestaa del carrito para que genere una consulta en la base de datos donde pregunta se hay objeto dentro de la tabla del carrito. En caso de no haber nada, el carrito mostrara un breve texto que indicara que el carrito se encuentra vaco y que contine navegando por la pagina web y as poder seleccionar algn producto. Por otro lado, si se encuentra algn objeto dentro de la tabla, este en vez de indicar que se encuentra vacio, generara una card con el producto en cuestion que se encuentre dentro de la tabla, teniendo ciertos datos como el nombre, su ID, el color, el talle, la cantidad seleccionada y el precio en cuestion en proporciona la cantidad seleccionada. Tambien hemos configurado una pestaa php de modo de proceso mediante la cual  el usuario pueda eliminar productos de su carrito mediante un modal que pregunta respecto a si desea eliminar el producto en cuestion o no, y si asi lo desea, si indica con otro modal que el mismo fue eliminado del carrito, tambien eliminado al producto de la tabla &quot;carrito&quot; en la base de datos. Tambien hemos arreglado la base de datos para que cada usuario pueda tener su propio carrito de compras, independientemente de si se repiten los datos en una misma tabla, siendo restrictivo para aquellos usuarios que quieran agregar nuevamente un mismo producto en su carrito, mientras que los demas usuarios pueden agregar sus productos con tranquilidad, incluso si dicho producto se encuentra ya en la tabla. \r\n- Luego esta la pestaa del producto, a la cual hemos configurado para que los inserts o agregaciones a un carrito en base a un producto sucedan una sola vez por producto, pues al contar con unidades a seleccionar, es mas conveniente que seleccione las unidades necesarias en vez de seleccionar una y otra vez el mismo producto. Tambien se configuro un proceso mediante el cual se ejecute un modal avisando de si se agrego el producto al carrito o no, por lo que las pestaas del producto y del carrito ya son funcionales, solo debemos configurar las diferencias entre los productos tanto en sus colores disponibles o tallas. \r\n- Por otro lado, he estado realizando cierta actualizacin dentro de la documentacin en mi carpeta de campo personal para poder cumplir con el requisito bimestral de tener mas de 100 paginas, habiendo logrado ello con xito.\r\n\r\nEso fue todo por hoy. ','2023-07-14'),(6541,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin - Carpeta de Campo','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos corregido cierto error dentro de la pestaa del producto, pues ocurri que hubo un error en el guardado del proyecto anterior a esta bitcora que hizo que cierta parte del cdigo usado para configurar la agregacin de productos dentro de la tabla del carrito funcione