to al carrito o no, por lo que las pestaas del producto y del carrito ya son funcionales, solo debemos configurar las diferencias entre los productos tanto en sus colores disponibles o tallas.\r\n- Por otro lado, he estado realizando cierta actualizacin dentro de la documentacin en mi carpeta de campo personal para poder cumplir con el requisito bimestral de tener mas de 100 paginas, habiendo logrado ello con xito.\r\n\r\nEso fue todo por hoy. \r\n','2023-07-14'),(6542,282,'Calidad de datos - VLA Carrefour','En el da de hoy trabaj desde la virtualidad en la realizacin del archivo correspondiente a los VLA de la cadena de supermercados Carrefour, el cual contaba con 333 campos a realizar, siendo que los termin pero no estoy conforme con el resultado ya que la gran parte de estos campos no estn completos correspondientemente debido a los datos presentes en el archivo base. Adems, cerca de las 11:30 AM tuve una llamada con Lucas Sosa, el cual me detallo como ser mi proxima tarea y me dio un breve resumen de lo que me espera en los prximos meses dentro de GS1','2023-08-01'),(6543,282,'OutCencoEnero','en el da de hoy trabaj presencialmente en las oficinas de GS1, empezando el archivo referente a el Output de la herramienta utilizada en la empresa, colaborando con Cencosud en un anlisis sobre las perdidas de alimentos en sus cadenas de supermercados, en este caso referentes a el mes de Enero de 2023, tengo que revisar y comprobar manualmente 5 columnas de 170 campos, aadiendo los datos faltantes y agregando nuevos recortes','2023-08-02'),(6544,251,'Desarrollo Api 3 - 2/8/2023','El da de hoy cre los controladores faltantes, y, con ayuda del profesor Consorti y mucha, mucha paciencia, resolvimos el problema del login de usuario. \r\nDicho problema se deba a que las contraseas se hasheaban 2 veces.','2023-08-02'),(6545,260,'','Con dylan empezamos a pensar y desarrollar la logica para la reacin de eventos dinamicos ','2023-08-02'),(6546,297,'02/08/23','Hoy finalice la idea de la pg de emprendedores y realice los bocetos para las mismas.','2023-08-02'),(6547,250,'miercoles 2/8/2023','hoy estuve aadiendo contenido a la carpeta de campo.','2023-08-02'),(6548,254,'2/8/23','Hoy realice un proyecto de java web de prueba para utilizar el doPost y el getPost pero sin la bdd, la clase del martes realizare un proyecto web de prueba con una base de datos sencilla para realizar el registrar de nuestra pagina el miercoles ','2023-08-02'),(6549,262,'2/8/2023','El dia de hoy comenzamos con la colocacion de preguntas en los escenarios del videojuego','2023-08-02'),(6550,263,'2/8','Hoy me encargue en hacer la historia y anotarla para que asi quede claro asi como tambien ya pasar de pagina de una vez con este tema.','2023-08-02'),(6551,271,'2-8-2023','En el da de la fecha, seguimos con el escenario de Unity','2023-08-02'),(6552,270,'2-8-23','El dia de hoy investigue como colocar las preguntas y respuestas con texto en el escenario de tematica de Unity','2023-08-02'),(6553,253,'Mircoles 02/08/2023 - Cdigo de Unity','Hoy trat de investigar un poco sobre el cdigo de C# para hacer los bucles.','2023-08-02'),(6554,290,'Vigesimaquinta','En el dia de la fecha lo que realice fue modificar las imagenes que habia capturado antes de comenzar las vacaciones, las ordene numerandolas del 1 al 6 y dentro de ellas, enumere sus respectivas burbujas, para luego ir explicandolas 1 a 1','2023-08-03'),(6555,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin ','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Por un lado hemos terminado de configurar la pestaa del carrito de compras, de modo que este pudiese almacenar los productos que se agregan directamente desde la pestaa de producto, pudiendose agregar un producto una unica vez por usuario sin agregarlo mas de lo debido. En este mismo se pueden eliminar los productos del carrito, y junto con los productos que se encuentran dentro de este mismo, se van calculando y sumando los precios y utilizamos un pequeo apartado para mostrar el total de la compra y 2 opciones de seguir comprando y la de finalizar con la compra. De este modo estariamos dando la pestaa del carrito como finalizada. \r\n\r\n- Por otro lado, hemos configurado un poco la base de datos para que el carrito funcione correctamente, aunque seguramente debamos seguir configurandola, pues prximamente estaremos pasando a disear las pestaas relacionadas a los pasos de compra. \r\n\r\nEso fue todo lo realizado por hoy','2023-08-03'),(6556,281,'Dia 18','El da de hoy estuvimos realizando bastante tareas en general, empezamos agregando los mtodos de pago en la pgina principal, y adems pensamos ponerle una seccin de ofertas en la cual varios productos se vean adecuadamente adaptados a los precios de hoy. Tambin hice las faltantes descripciones a los nuevos productos que habamos agregado la otra vez.Adems empezamos a completar la pgina de contacto en la cual agregamos nuestro Instagram y Tik Tok. Y por ltimo, cambiamos el color del botn y el color del borde al registro y login.','2023-08-03'),(6557,299,'Hoy','Hoy adelantamos el trabajo y probamos nuevas funciones','2023-08-03'),(6558,279,'Dia 20 del Proyecto','En todo este da estuve despus de terminar con el daily de hoy ayude un poco a Enzo y a Ledesma en hacer los prototipos de Android ya que habamos pensado cambiar la parte poner el incidente a darle varias opciones de incidentes y al elegir uno se abra su apartado para reportar y bueno en eso hice el prototipo de Estafa y Manifestacin aunque el ultimo creo que le falta algo aunque no se aun.','2023-08-03'),(6559,283,'homerun','Hoy, concretamos el inicio de una nueva etapa en el proyecto donde nos pudimos juntar la mayora del equipo, faltando solo un integrante (que en paz descanse mi querido amigo thiago arroyo). Cuando llegamos a la computadora, logramos hacer que funcione para luego poder llegar a abrir todos las aplicaciones que bamos a usar, como por ejemplo: Xampp, Drive, Visual Studio. Luego de ya abiertos todos los programas pasamos a descargar todos los archivos de la carpeta que tenemos en conjunto con los integrantes del grupo. Prendimos el Xampp donde en el mismo esta el servidor Apache y el MySQL. Luego de hacer todo esto pudimos descomprimir todos los archivos para poder pasarlos dentro del Visual Studio Code y dentro de la carpeta Htdocs. \r\nLo que nosotros no nos percatamos es que descargamos una pagina que no estaba actualizada con las ultimas mejoras que le pusimos a la pagina. Lo cual tuvimos que descargar la otra pagina que haba hecho nuestro compaero que no viene mas (RIP) y terminamos de actualizar y dar algunos detalles a la pagina. Esto nos Conllevo a un problema por que la misma pagina se encuentra con mucho cdigo entrelazado, y sumando nuestra inexperiencia con algunos tipos de lenguaje crea que nosotros no podamos desenvolvernos mejor con la pagina y poder finalizarla de una vez. Seguiremos con este proyecto pero no sabemos si seguirlo o dejarlo por otro que se nos sea mas fcil. \r\nPasando de todo esto pudimos agregar algunas cosas pero igualmente seguiremos intentando resolver este problema. \r\n','2023-08-03'),(6560,278,'Clase N25 03/08/023','En el da de hoy tuve problemas con la pagina web , ya que haba partes que no tenan responsive , entonces me puse a solucionar ese problema arreglando cada objeto uno por uno. Tambin me llamaron mis compaeros que estn comenzando un nuevo proyecto para que documente todo lo que realicen.Por este motivo el proyecto eccefurni queda pausado hasta el 15 de octubre , aunque mis compaeros seguirn trabajando en l.','2023-08-03'),(6561,286,'HTML y CSS de Pgina Usuarios 4','Luego de unas buenas dos semanas de receso escolar, el da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. Para empezar, tuve una reunin con el Scrum Master del proyecto Enzo Bartoletti la cual me comentaba que habra que cambiar el diseo de la pgina de usuarios agregando ms cantidad de delitos para seleccionar y que cada uno despliegue un formulario aparte para especificar ms sobre el suceso. Ms tarde me puse a averiguar cmo difuminar el fondo cuando el popup del formulario se desplega, por lo que hice una pequea bsqueda en YouTube para encontrar el video &quot;Como crear efecto Overlay en CSS&quot; de &quot;Xk Web&quot; el cual me proporcionaba el paso a paso de cmo hacer lo solicitado. Para empezar, en CSS cre una clase &quot;.container::before&quot; para poder hacer uso de dicho pseudo elemento que me proporciona un &quot;acompaamiento&quot; a un selector para poder aadir un aspecto decorativo a un elemento. Dentro de este agregu las siguientes propiedades: &quot;position: absolute;&quot; para que elemento se posicione sobre todo el documento, &quot;content: \'\';&quot; que no s para qu sirve, despus agregu &quot;top: 0; bottom: 0; left: 0; right: 0;&quot; para establecer la distancia del elemento entre los bordes, y para terminar agregu un &quot;backgorund-color: rgba(0, 0, 0, .6);&quot; para que el color sea negro y que tenga una difuminacin de 0.6. Todo esto di resultado pero no el esperado, ya que la difuminacin se aplic al popup y no al fondo de este. Ms tarde me d cuenta de que mi compaero Christian Forte estuvo haciendo lo mismo que yo pero con JS, entonces me mostr su funcionamiento y concluimos en que lo que l haba hecho era ms funcional, por lo que nos pusimos a trabajar juntos. Al principio lo que l haba hecho no funcionaba, por lo que decidimos abrir los archivos de l en la computadora que yo estaba usando, ya que a veces, no sabemos por qu, hay cosas que funcionan en unas computadoras y en otras no, pero nos dimos cuenta que era lo mismo. Despus de esto, me puse a revisar los archivos y me d cuenta que parte de las funciones del mapa no estaban. Ms tarde tuve una reunin con los profesores de la materia y otros compaeros adems de algunos de los de grupo para hacer un proyecto nuevo en dos meses y medio.','2023-08-03'),(6562,280,'03.08.2023','El dia de hoy ayude a uno de mis compaeros de equipo debido a que su aplicacion no estaba ejecutandose en su computador. En paralelo a eso me encargue de reinstalar los paquetes de python y opencv ya que tampoco funcionaban correctamente en la computadora que estoy utilizando. Aun nos e consiguio terminar la instalacion ya que la libreria de numpy manda error a la hora de instalar el opencv','2023-08-03'),(6563,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin ','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Por un lado hemos terminado de configurar la pestaa del carrito de compras, de modo que este pudiese almacenar los productos que se agregan directamente desde la pestaa de producto, pudiendose agregar un producto una unica vez por usuario sin agregarlo mas de lo debido. En este mismo se pueden eliminar los productos del carrito, y junto con los productos que se encuentran dentro de este mismo, se van calculando y sumando los precios y utilizamos un pequeo apartado para mostrar el total de la compra y 2 opciones de seguir comprando y la de finalizar con la compra. De este modo estariamos dando la pestaa del carrito como finalizada. \r\n\r\n- Por otro lado, hemos configurado un poco la base de datos para que el carrito funcione correctamente, aunque seguramente debamos seguir configurandola, pues prximamente estaremos pasando a disear las pestaas relacionadas a los pasos de compra. \r\n\r\nEso fue todo lo realizado por hoy','2023-08-03'),(6564,274,'Cambios en el php','En el dia de la fecha lo primero que hice fue aadir un required (el cual es un atributo para que el input deba ser marcado obligatoriamente) a los input de tipo radio, los cuales pertenecen a la seccin de requerimiento de ambulancia y bomberos. Hice esto ya que junto a un compaero nos dimos cuenta de que al enviar los datos sin marcar estos radios, los datos eran enviados.\r\nUna vez que hice esto, me d cuenta que la pgina de administradores y la de usuarios compartan una base de datos idntica, pero eran dos. Fue por esto que cambi los links en el PHP para capturar los datos de la misma.\r\n','2023-08-03'),(6565,292,'corrreccion de forms de registro de denuncias ','en el dia de hoy enzo me dijo que continuemos con la interfaz de usuario la cual era el form con unos 15 incidentes y mientras bamos haciendo el nuevo form que consiste en las opciones al seleccionar un tipo de incidente,hicimos el siguiente cambo el cual era mover el enviar reporte a la pagina emergente \r\nyo trabaje con el incidente incendio el cual tuve que buscar en internet cuales eran los distintas tipos de accidentes, primero pens en poner uno por uno hasta que vi una pagina la cual me mostraba los distintos grados de incidente, lop habla con enzo y nos pareci lo mejor aadirlo as y no uno por uno como estaba antes\r\ncomo quedaba bastante vaco me fije en el anterior prototipo para agregarle las distintas cosas que faltaban como cantidad de afectados y para agregar una descripcin \r\n','2023-08-03'),(6566,293,'Diagrama de entidad Relacional','hoy da estuve agregando, modificando y borrando parte del diagrama que estaba desactualizado\r\n','2023-08-03'),(6567,288,'clase 23','El da de hoy hicimos bastantes tareas en nuestra pagina web, agregamos los mtodos de pago que aceptaremos, para cobrar nuestras figuras 3d, adems agregamos una seccin de ofertas nicas para poder ahorrarse unos pesos al comprar en nuestra pagina web. Aun nos falta pulir la zona de Ofertas ya que recin hoy tuvimos la idea y no la diseamos completa del todo. Tambin hicimos la descripcin general de las cards de cada producto, poniendo tamaos y precios adecuados y acordes a cada personaje. Ademas diseamos por completo la pagina de contacto, pusimos nuestro Instagram y Facebook, para que puedan ver nuestra queridsima pagina web LiliFy 3D. Y por ltimo, cambiamos el color del botn y el color del borde al registro y login.','2023-08-03'),(6568,282,'Tareas varias','En el da de hoy trabaje durante la maana en GS1 con los archivos Output de Censcosud, mientras que durante la tarde avanzamos con prototipados de nuevos forms para BaVigila, pero fuimos interrumpidos para un cambio abrupto de proyecto, dedicando los proximos dos meses a Generacin T, lo cual consiste en 2 proyectos, una gestion de bitacoras y un gestor de vacaciones.','2023-08-03'),(6569,275,'Vuelta a clase, actualizacin del diagrama GANTT entre otros.','El da de hoy despus del receso invernal nos dedicamos mas que nada a repasar,actualizar y ver que es lo que habamos hecho hasta ahora, yo empec a revisar cada diagrama que logramos hacer y terminar hasta ahora, fijndome que cada uno este terminado,bien hecho o si necesita actualizarse,El camino critico ya esta terminado, al igual que el de  caso de uso, colaboracin, secuencia, entidad de relaciona y flujo de datos, tambin estuvimos viendo el tema de la &quot;factura&quot; o la parte de &quot;transaccin de dinero&quot; como le digo yo, es la parte en donde el cliente compra un producto y paga por este, esta es la ultima parte del trabajo y tenemos que ver bien como hacer, el resto del da me la pase viendo el funcionamiento de la pagina y actualizando del diagrama GANTT.','2023-08-03'),(6570,277,'Vigsima clase','El da de hoy volvimos de las vacaciones y nos pusimos a trabajar con muchas ganas, lo primero que hicimos fue mejorar la pgina principal agregndole un espacio para ofertas especiales, adems de agregar una imagen que destaca los distintos mtodos de pago que aceptamos, estos son Paypal, Visa y Mastercard.\r\nLuego nos pusimos a trabajar en la parte de productos, agregamos una barra al pie de la pgina para moverse por estas, en total tenemos tres, donde hay nueve productos en cada una. Adems estuve acomodando las imgenes de los productos para que todas sean del mismo tamao y queden simtricamente.\r\nTambin estuvimos mejorando el apartado de contactos, agregando un ttulo ms bonito que dice Instragram Oficial junto a un hipervnculo del mismo, an no tenemos ninguna foto subida pero planeamos utilizarlo bastante. Tambin dejamos espacio para un TikTok que an no hicimos pero nos pondremos a ello lo antes posible.\r\nPor ltimo, le pusimos la descripcin a los distintos productos que vendemos en nuestra pgina, ofreciendo algo de humor e informacin sobre la figura para atraer ventas.\r\n','2023-08-03'),(6571,296,'Bitacora 20','Hoy estuve siguiendo con la pgina del iniciar sesin y registrarse que haba empezado semanas anteriores,y pude avanzar bastante en el diseo','2023-08-03'),(6572,273,'Clase 03-08-2023','En el da de la fecha llegu a la escuela y me puse a observar cmo iba el avance de mi proyecto. Por mi parte, empec a realizar la codificacin para hacer que el cdigo de barras se pueda guardar como una imagen que luego podra ser mostrada en la pgina. A su vez, me dieron un proyecto aparte que tengo que realizar.','2023-08-03'),(6573,291,'Fin de vacaciones','El da de hoy fue la primera clase despus de las vacaciones, en este da vinimos cuatro de los cincos integrantes , pero eso no nos detuvo trabajar para avanzar con el proyecto, este da pens usar las siguientes aplicaciones &quot;Visual Studio&quot;, el &quot;Xampp&quot; y el drive de mi cuenta de Google para realizar el trabajo de hoy, usando estas aplicaciones organice, modifique y agregue cosas a la pgina para que esta ms completa, cambie el iniciar sesin y el registrarse para que queden ms agradables para la vista y el cliente que quiera tener su cuenta, y con eso concluye mi trabajo de este da.','2023-08-03'),(6574,291,'Fin de vacaciones','El da de hoy fue la primera clase despus de las vacaciones, en este da vinimos cuatro de los cincos integrantes , pero eso no nos detuvo trabajar para avanzar con el proyecto, este da pens usar las siguientes aplicaciones &quot;Visual Studio&quot;, el &quot;Xampp&quot; y el drive de mi cuenta de Google para realizar el trabajo de hoy, usando estas aplicaciones organice, modifique y agregue cosas a la pgina para que esta ms completa, cambie el iniciar sesin y el registrarse para que queden ms agradables para la vista y el cliente que quiera tener su cuenta, y con eso concluye mi trabajo de este da.','2023-08-03'),(6575,295,'Pagina Web','El dia de hoy, nos pusimos de acuerdo en grupo para ver como ibamos a continuar esta ltima parte del ao, en la cual decidimos que junto mi compaero bamos a seguir con la pagina web, finalizamos la parte de la conexin con php a la base de datos y decidimos que el dia de maana ibamos a empezar con la investigacin de como hacer el buscador de los ingredientes.','2023-08-03'),(6576,298,'Clase 23','Volvimos despus de las vacaciones por lo que estbamos un poco perdidos, tuvimos problemas para trabajar porque nuestra computadora no tena python y terminamos rehaciendo los diagramas (de nuevo). Por otro lado, cambiamos unas cositas de la bdd.','2023-08-03'),(6577,283,'Charla de la Uba','El dia de hoy tuvimos una charla de la Universidad de Buenos Aires donde nos hablaron sobre que expectativas tenemos nosotros para el futuro y ah que podemos llegar a alcanzar. Primero las dos chicas q nos dieron la charla se presentaron para luego darnos el link de una pagina que nos redirige a una formulario de google, en este se encontraban preguntas sobre como nosotros nos veiamos despues de terminar el colegio o que tipo de informacion tenemos en el ambito de universidades o etc. Luego de esto todos nos sentamos en un circulo para charlar sobre este tema. Como nos veiamos, que queriamos hacer a futuro o hasta donde podemos encontrar este tipo de informacion. \r\nLuego tuvimos que hacer un ejercicio donde tuvimos que resolver con nuestro equipo que contradicciones y recursos tenemos para poder hacer lo que queremos hacer el dia de maana como por ejemplo estudiar, irnos del pais o estudiar y trabajar. Luego las expusimos en el pizarron y las chicas de la uba nos dieron su punto de vista en el tipo de recursos o informacion que tenemos nosotros en este tema y a su vez, las contradicciones. Despues ya termino la charla. ','2023-08-04'),(6578,293,'Charla de la UBA','Hoy da vinieron los de la UBA a darnos charlas sobre el tema del estudio que queramos hacer en un futuro eso.','2023-08-04'),(6579,285,'Da 25 (No pude subirla) y 26','Da 25\r\n\r\nQue logre hacer hoy?\r\n\r\nHoy fue un da intenso en el desarrollo de la pgina de bsqueda. Logr implementar todas las funcionalidades necesarias para que el script funcionara correctamente con PHP. Antes, los productos tenan que ingresarse manualmente, pero ahora, gracias a la conexin con la base de datos, se imprimen automticamente y se muestran en la pgina, lo que facilita enormemente la gestin de los productos.\r\n\r\nEn que se me complico?\r\n\r\nDebo admitir que el proceso no fue para nada sencillo y en ocasiones me sent frustrado. Cada vez que avanzaba un paso, pareca retroceder mil. En una ocasin, al corregir un error relacionado con la caja de envo gratis, otra funcionalidad, como la de mostrar el precio mximo, se rompa, y lo mismo ocurra con la bsqueda de productos. Afortunadamente, logr solucionar todos estos problemas con la ayuda de ms scripts y la implementacin de funcionalidades en PHP.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, estuve investigando sobre cmo conectar PHP con una base de datos para poder mostrar automticamente los productos almacenados en ella. Tambin investigu sobre la implementacin de diferentes funcionalidades en PHP, como la vista previa de imgenes en los productos y la creacin de botones para acciones rpidas, como comprar, aadir a favoritos o agregar al carrito de compras. Busqu ejemplos y documentacin en lnea para aprender cmo mejorar la experiencia del usuario en la pgina de bsqueda.\r\n\r\nDa 26\r\n\r\nQue logre hacer hoy?\r\n\r\nHoy, en conjunto con mis compaeros, tuvimos una charla con la Direccin de Orientacin Educativa (DOE) de la Universidad de Buenos Aires (UBA). Durante esta reunin, nos centramos en temas fundamentales para nuestro futuro. Exploramos nuestras aspiraciones profesionales y las perspectivas laborales que se nos presentan. Adems, discutimos los posibles desafos que podramos enfrentar en nuestro camino hacia el xito.\r\n\r\nUna de las actividades destacadas de hoy fue la creacin de un cuadro en el que dividimos los recursos disponibles en dos categoras. Por un lado, identificamos los beneficios actuales, es decir, los recursos y oportunidades que nos favorecen en el presente. Por otro lado, reflexionamos sobre los obstculos o contratiempos que podran representar situaciones o miedos que debemos superar para alcanzar nuestras metas.\r\n\r\nEn que se me complico?\r\n\r\nAfortunadamente, no experimentamos complicaciones durante nuestra charla con la Direccin de Orientacin Educativa. La reunin transcurri de manera fluida y pudimos abordar todos los temas de manera eficiente.\r\n\r\nQu estuve investigando?\r\n\r\nPrevio a la reunin, estuvimos investigando sobre la Direccin de Orientacin Educativa (DOE) de la Universidad de Buenos Aires (UBA) para conocer mejor sus funciones y cmo podran ayudarnos en nuestro desarrollo acadmico y profesional.\r\n\r\nAdems, dedicamos tiempo a investigar sobre las perspectivas laborales en nuestras reas de inters, as como las tendencias y oportunidades laborales en el mercado actual. Tambin buscamos informacin sobre estrategias para superar obstculos y cmo manejar situaciones que pudieran surgir en el camino hacia nuestras metas profesionales.\r\n','2023-08-04'),(6580,290,'Vigesimasexta','En el dia de la fecha tuvimos una charla con gente de la uba y basicamente nos hicieron hacer una encuesta en la cual nos hacian preguntas sobre nuestro futuro, luego se hizo una actividad en la cual nos preguntaban si nosotros nos haciamos esas preguntas o si alguien nos las hacia, y luego hicimos otra actividad en la cual teniamos que poner nuetros recursos y obstaculos.','2023-08-04'),(6581,278,'Clase N26 04/08/23','En el dia de hoy recibimos la visita de la UBA, tuvimos un taller en relacion a que queremos hacer en nuestro futuro , despues de la secundaria, si queremos trabajar , estudiar o ambas.El taller estuvo bueno , fue reflexivo con nosotros mismos para conocer que queremos hacer en nuestro futuro.','2023-08-04'),(6582,276,'Charla UBA','El da de hoy no he trabajado en base al proyecto de las PP &quot;Vicson Web&quot; debido a que hoy hemos participado de una charla de dos psiclogas de la UBA, habiendo realizado un par de actividades y haber compartido algunas ancdotas respecto al futuro, nuestros estudios y lo que queremos realizar una vez que terminemos la escuela secundaria. A su vez hemos realizado otro par de mini actividades relacionadas a el lado laboral, realizamos un formulario que pedia algunos datos sobre nosotros y nuestro conocimiento dentro de los ambitos laborales y universitarios, etc.\r\n\r\nEso fue todo lo realizado por hoy.','2023-08-04'),(6583,287,'Charla UBA','El da de hoy no he trabajado en base al proyecto de las PP &quot;Vicson Web&quot; debido a que hoy hemos participado de una charla de dos psiclogas de la UBA, habiendo realizado un par de actividades y haber compartido algunas ancdotas respecto al futuro, nuestros estudios y lo que queremos realizar una vez que terminemos la escuela secundaria. A su vez hemos realizado otro par de mini actividades relacionadas a el lado laboral, realizamos un formulario que pedia algunos datos sobre nosotros y nuestro conocimiento dentro de los ambitos laborales y universitarios, etc.\r\n\r\nEso fue todo lo realizado por hoy.','2023-08-04'),(6584,294,'DOEUBA charla grupal','En el dia de hoy tuvimos una visita de unas chicas en donde charlamos prufandamente en lo que haremos despues de terminar la escuela futuramente. La charla contenia tambien preguntas profundas y algunas mas externas. Como ultimo realizamos en un papel donde lo dividimos en los recursos y oportunidades que nos representan a la hora de poder decidir nuestro futuro ya sea academicamente o laboral.','2023-08-04'),(6585,275,'Charla UBA','resumiendo mucho lo que paso hoy fue que tuvimos una charla con unas psiclogas de la Uba, en una charla llamada &quot;mi futuro luego de la secundaria&quot; que por su mismo nombre dice que vamos a hablar sobre nuestro futuro luego de la secundaria,toda la conversacin fue acerca de nuestras dudas, miedos y incertidumbres de lo que vamos a hacer en el futuro, algunos decan que iban a trabajar o seguir estudiando, otros ambas. por poner un ejemplo. ','2023-08-04'),(6586,295,'Charla del DOE de la Uba','En el da de la fecha vinieron de visita unas chicas provenientes del DOE de la UBA en donde nos dieron una charla sobre que bamos a elegir para nuestro futuro ya que estamos por terminar la escuela secundaria. Nos hacan preguntas profundas que hacan referencia a los aos anteriores y tambin preguntas mas globales para todos que eran del estilo como quien deba materias. Y como ltimo nos brindaron un papel en donde lo dividimos al medio teniendo los recursos y obstculos que bamos a tener nosotros para lo que decidamos hacer de nuestro futuro.','2023-08-04'),(6587,289,'04/08','El da de hoy, tuvimos una charla informativa sobre vocacin de la UBA. Vinieron dos psiclogas para poder brindarnos el taller.\r\nEso es todo por hoy, muchas gracias!','2023-08-04'),(6588,298,'Clase 24','Hoy tuvimos una charla de vocacin por parte de dos chicas de la UBA','2023-08-04'),(6589,288,'Clase 24','El da de hoy tuvimos un taller presencial con 2 coordinadoras de la UBA, las cuales nos hicieron hacer un formulario de google hablando de nosotros y nuestro futuro, de que vamos a estudiar, y que vamos a trabajar, que vamos a hacer de el ao que viene en adelante y como nos fu en nuestro proceso de aprendizaje de 1er ao a 6to. Luego de eso estuvimos hablando en ronda en general de lo que pensamos del ao que viene y de que pensamos de la carrera computacin, o si vamos a seguir algo distinto. Despus nos dieron un papel y en pequeos grupos escribimos, RECURSOS y OBSTCULOS de lo que nos depara al terminar la secundaria. Luego lo escribieron en el pizarrn y estuvimos hablando y pensando de lo que escribimos como grupo.','2023-08-04'),(6590,279,'Charla con la uba','En este da nos visitaron 2 mujeres de la uba que se especializan a ayudar a poder elegir nuestra decisiones de que hacer despus de la secundaria primero se presentaron para despus darnos un link donde era un formulario donde nos preguntaban cosas que quisiramos hacer o parecido despus de ma secundaria para despus tener una charla sobre algunas cosas del cuestionario que nos dieron y tambin para ver que queramos hacer despus si estudiar o trabajar o parecido para despus hacer en grupo un tipo cuadro de ventaja y desventajas que tendramos al salir de la secundaria y despus vimos sobre cmo era cada punto que puso los grupos','2023-08-04'),(6591,281,'Dia 19','El dia de hoy estuvimos toda la clase realizando una encuesta y charlando con el equipo del DOE de la UBA. Charlamos sobre nuestras preocupaciones sobre el futuro y nos plantearon una actividad que constaba en poner los obstaculos y los recursos que tenemos para lograr lo que tenemos pensado para el futuro','2023-08-04'),(6592,277,'Vigsima primer clase','El da de hoy tuvimos una charla con el DOE de la Universidad de Buenos Aires (UBA). Estuvimos hablando de nuestro futuro y de lo que tenemos planeado hacer el prximo ao. \r\nPrimero estuvimos llenando un cuestionario de Google donde nos hacan preguntas para saber si pensbamos o no en nuestro futuro y si esto se deba a la presin del exterior o no.\r\nLuego, nos sentamos toda la clase en una ronda para hablar un poco de que vamos a hacer el siguiente ao, ya sea estudiar, trabajar, ambas o ninguna, adems de compartir un poco nuestros miedos y problemas a la hora de elegir una carrera o de no elegir.\r\nPor ltimo, llenamos un papel con obstculos y recursos que tenemos disponibles para completar nuestros objetivos del prximo ao.\r\n','2023-08-04'),(6593,274,'Charla con personal de la U.B.A.','El da de hoy tuvimos un encuentro en el establecimiento con dos psiclogas de la Universidad de Buenos Aires. El objetivo de dicho encuentro era poder charlar acerca de cuales son nuestros planes a futuro, adems de poder resolver las dudas que tengamos. Primero hicimos una presentacin en la cual nos preguntaron si lo que bamos a hacer el ao que viene estaba relacionado con el estudio, el trabajo o ambos. Ah hablamos un poco acerca de la situacin de cada uno. Tambin compartimos nuestra experiencia a lo largo del curso de la secundaria, como porque habamos elegido la especializacin, si nos arrepentimos de la decisin, etc. Tambin hablamos acerca de por qu queramos terminar el secundario y cual era el motivo de seguir una carrera universitaria. Luego de esto, nos dividimos en grupos pequeos en el cual debamos escribir cuales eran los recursos y los obstculos con los que contamos a la hora de seguir nuestros estudios o en el mbito laboral.','2023-08-04'),(6594,286,'Charla sobre nuestro futuro del DOE UBA','El da de la fecha empez de una forma distinta a la habitual, llegaron dos seoras psiclogas del DOE de la UBA a darnos una charla a m y a mis compaeros del curso sobre nuestro futuro despus de la escuela secundaria, proponindonos hacer un Google Form para responder una serie de preguntas para ms tarde hacer una reunin entre todo mi curso y yo para hablar sobre las sensaciones que nos generaba el pensar en nuestros futuro.','2023-08-04'),(6595,282,'Out Cencosud Enero - avances','Durante la jornada de hoy trabaje de una manera tranquila mediante la virtualidad en el archivo de los outs de la herramienta, avanzando en finalizar recortes y despejando dudas referentes a envases que me parecan estar mal catalogados. Para estas tareas me reun mediante Skype con Tomas Sainato para 