trabajo de continuar con mi carpeta de campo, colocando principalmente informacin restante que me quedaba','2023-08-09'),(6618,268,'09-08-2023','El da de hoy despus de unos ltimos detalles de la documentacin con Baqueiro comenzamos con el Gantt donde podrn ver el proceso que tenemos ideados para la creacin del proyecto.\r\nDespus con el tiempo que me quedaba contine con el proyecto del robot sumo donde arregle un detalle del robot que es que compramos un modelo diferente del lector de lnea y de estar de forma horizontal ahora estar en forma vertical.\r\n','2023-08-09'),(6619,254,'9/9/23','Hoy realize la vista del iniciar sesion y lo conecte con la bdd, me falto probarlo ','2023-08-09'),(6620,255,'miercoles 9 8 2023','hoy estuve diseando la pagina de recetas y ayude a programar el index','2023-08-09'),(6621,261,'09/08/2023','hoy trabaje con el cdigo del sensor infrarrojo','2023-08-09'),(6622,267,'09-08-2023','El da de hoy despus de unos ltimos detalles de la documentacin con Javier comenzamos con el Gantt donde podrn ver el proceso que tenemos ideados para la creacin del proyecto.','2023-08-09'),(6623,258,'09/08/2023','Hoy termine lo que vendria siendo la casa ademas de ayudar a fenoglio y sebastian en su modelado 3d','2023-08-09'),(6624,251,'BeCation - Generacin T pt2 - 09/08/2023','El da de hoy termin el DAO de la tabla Vacation y tras mergear la rama donde trabaj, empec a trabajar en el controller de Vacation.\r\nEst terminado, puede que tengamos que corregir el mtodo editVacation.','2023-08-09'),(6625,282,'Finalizacion de OutCencoEnero','En el da de hoy mi tarea consisti en finalizar los detalles faltantes del archivo OutCencoEnero correspondientes, evidentemente, a el Out que proporciona la herramienta para los registros de la administradora de cadenas de supermercados Cencosud referentes al mes de Enero del ao 2023. Ademas, aproximadamente cerca de las 11:30/12:00 Lucas Sosa me invit a opinar en una reunion junto a una integrante del sector Identificacion, quienes son los encargados de revisar el correcto armado de mis recortes en los archivos. Esta reunion result ser muy prolifera, logrando poner en comn los dos modelos de trabajo de ambas reas, mientras nosotros realizamos el trabajo mediante un Excel diseado en base a la salida de la herramienta, Idenficacion trabaja los recortes mediante un Excel con una gran cantidad de formulas para automatizar varios de los procesos. Tras esta puesta en comn expusimos varios puntos donde surgieron dudas y problematicas, siendo que aport con el caso de un tipo en evase &quot;Horma&quot; el cual no figura en la tabla de envases de GS1, mismo caso con el tipo de envase &quot;Maple&quot; o el tipo de envase &quot;Tableta&quot;, entre varios ms. Esto quedo a pronta revisin por parte del jefe del rea de Identificacion.\r\nPosiblemente en el da de maana ya deba arrancar con el archivo Out de la Herramienta de Cencosud referente al mes de febrero de 2023, realizando las mismas tareas en un nuevo mes.','2023-08-09'),(6626,253,'Mircoles 09/08/2023 - Login','Hoy practiqu un poco de React y comenc con el desarrollo del login.','2023-08-09'),(6627,252,'Clase 35 - 09/08/2023','El da de ayer ayud a mis compaeros con la documentacion de BeCation. Los ayud a escribir el ante proyecto y hoy terminar de corregir ciertos errores en la documentacin. Mientras ellos se encargaron del GANTT y los gui para poner los tiempos de cada tarea a realizar y a poner ciertas tareas en diferente orden.\r\nPor otro lado, yo continu viendo sobre las API REST con Node js y Express. Despus me encargu de comenzar con la documentacin de la API. Vi un video sobre documentar APIs con Swagger y comprend el tipo de ecritura.\r\nhttps://www.youtube.com/watch?v=rIWGcxnVIA8\r\nhttps://www.youtube.com/watch?v=RayDPBYou4I&amp;pp=ygUXc3dhZ2dlciBleHByZXNzIG5vZGUganM%3D','2023-08-09'),(6628,266,'trabajo con becation','En el dia de hoy termine las rutas del nuevo proyecto de becation y estuve armando todos los controller, tambien pude avanzar bastante y estuve viendo el tema del encriptado y de la creacion de usuarios y gets de usuarios varios ','2023-08-09'),(6629,282,'GS1 presencial','Durante el da de hoy en GS1 (presencialmente) realmente no hice nada referente a la empresa debido a causas externas a m, por lo cual pas la totalidad del da realizando aportes a la carpeta de campo de la materia, aadiendo aproximadamente entre 8 y 12 hojas, 3 imgenes y varias explicaciones referentes a tareas realizadas durante las vacaciones de invierno y todas las posteriores a estas vacaciones, por lo cual mis avances en la carpeta abarcan como fechas desde el dia 17/07/2023 al dia 10/08/2023.\r\nTambin olvide mencionar que en el da de hoy me dediqu a dialogar con mis compaeros de BaVigila acerca del form de denuncias, planteando replantear gran parte del proyecto (si, nuevamente) pero manteniendo las tecnologas actuales, negndole al usuario la posibilidad de visualizar el mapa y hacindolo una funcionalidad exclusiva para los administradores, mientras que al usuario le ofeceriamos una interfaz plenamente para realizar sus denuncias, manteniendo una app mobile exactamente idntica al form creado y fabricando una versin web desde cero planteando como principal objetivo, tal como al principio del proyecto, la realizacin de denuncias priorizando la calidad de dichas denuncias por sobre la velocidad de envo de las dichas.\r\nAdems plantee en el grupo la necesidad de que el form cuente con un botn para casos de emergencia, donde se enve un mvil a comprobar la situacin que est pasando, igualmente est en una fase temprana y, a pesar de que ya fue aprobado, en prueba e incluso previo a ser desarrollado.\r\nDurante la tarde me present a Practicas Profesionalizantes y avanzamos con el proyecto de Generacin T, dandoles ya la posibilidad de estudiar React en FreeCodeCamp, creando las Bases de Datos del proyecto e investigando acerca de la fabricacin de API\'s','2023-08-10'),(6630,298,'Clase 25','Hoy cambiamos gran parte de lo que tenamos planeado, como Lucho y Geral empezaron con otro proyecto quedaron (hasta que terminen con eso) fuera de este trabajo. Adems de que Alan y Ciro se sumaron a nuestro proyecto. Ahora la idea sigue siendo la misma pero vamos a hacer unos cambios como rehacer la pgina y agregar recetas dulces a la base de datos. Tambin descartamos la idea del robot.','2023-08-10'),(6631,285,'Da 27','Qu logr hacer hoy?\r\n\r\nHoy ha sido un da bastante complicado para nuestro equipo. Desafortunadamente, nuestro grupo anterior enfrent serias dificultades y se disolvi, lo que signific perder todo el progreso que habamos logrado en la pgina web anterior. Tuvimos que comenzar desde cero con un nuevo grupo, pero a pesar de esta adversidad, logramos organizarnos.\r\n\r\nMi responsabilidad en este nuevo equipo es realizar modificaciones en la pgina que estamos desarrollando ahora. Estoy trabajando junto a Victoria Laura, Maximo Escobar y Carolina Cavalitto, quienes tambin estn enfrentando el desafo de reiniciar el proyecto. Es un momento complicado, pero estamos comprometidos a sacar adelante este nuevo enfoque.\r\n\r\nEn qu se me complic?\r\n\r\nLa complicacin principal que enfrentamos hoy fue la prdida de todo el progreso que habamos hecho en la pgina anterior. Fue realmente frustrante ver que el trabajo arduo que habamos realizado se desvaneci debido a las circunstancias inesperadas. Empezar desde cero siempre es un desafo y puede ser desmoralizador. Adems, adaptarnos al nuevo grupo y asegurarnos de que todos estemos en la misma pgina tambin requiere tiempo y esfuerzo.\r\n\r\nQu estuve investigando?\r\n\r\nDada la situacin, gran parte de mi tiempo lo dediqu a investigar cmo hacer la transicin lo ms suave posible hacia este nuevo proyecto. Busqu formas de aprovechar lo aprendido en el proyecto anterior y aplicarlo a esta nueva versin, a pesar de tener que comenzar de nuevo.\r\n\r\nTambin investigu cmo colaborar de manera efectiva con mi nuevo compaero, Ciro Lobotrico, quien es el nico sobreviviente del desafortunado suceso de la disolucin de nuestro grupo anterior. Es importante establecer una comunicacin slida y asegurarnos de que ambos estemos al tanto de las tareas y objetivos.','2023-08-10'),(6632,292,'como hacer una api- generacion t','En el dia de hoy comenzamos con el proyecto principal de generacin t el cual consiste en hacer una pgina en la que se ingresaron bitcoras, para este proyecto tenemos que dejar pausado e nuestro de bavigila cosa que no me gusta demasiado la idea.\r\n     esperamos unos minutos hasta que arrancamos a hacer algo ya que todos los integrantes no estaban en el aula, cuando llegaron enzo nos dijo que buscaramos como hacer una api desde 0 ya que la idea del proyecto es hacerlo solo con apis. despus de un rato pedro que es otro compaero nos llam a todos para que hagamos la base de datos de la bitcora \r\nel video que mas me sirvio por lo que me explico fue el de develoteca donde en el video estaba separado por secciones que hacia mas facil mi entendimiento\r\n','2023-08-10'),(6633,274,'Inicio del nuevo proyecto','En el da de la fecha, comenzamos con la investigacin necesaria para realizar el proyecto. Lo primero que hicimos fue buscar tutoriales que expliquen que es una API, y que tambin expliquen como crear una con PHP. En paralelo, junto con el resto de mis compaeros del equipo, pensamos la base de datos que utilizaramos para la pgina de la creacin de bitcoras. Luego, continuamos con la creacin de la API. Utilizando xampp, cre una carpeta dentro de htdocs y dentro de sta descargu un framework llamado Flight, el cual es un framework que permite simplificar la codificacin. Luego hice una base de datos sencilla, la cual puede insertar los alumnos. ','2023-08-10'),(6634,281,'Dia 20','Hoy solo vinimos 2 integrantes del grupo pero igual pienso que avanzamos bastante, realizamos la pgina de producto colocando las imgenes de cada uno y la descripcin.\r\nTambin terminamos la pgina de contacto, ya que solo faltaba colocar la imagen png de tik tok, ahora solo nos falta crear una cuenta de este de nuestro emprendimiento.\r\nY por ltimo hicimos una maqueta de  cmo seran los productos en oferta, ya que nos pareci una gran idea incorporar este tipo de descuentos en la pgina.\r\n','2023-08-10'),(6635,277,'Vigsima segunda clase','Hoy continu la pgina web de LiliFy rehaciendo lo que hice la ltima clase ya que se me freezeo la PC y perd todo mi progreso, lo nico que hice fue agregar dos pginas extras para el apartado de productos, donde se visualizan nueve elementos por pgina, adems logramos imprimir nuestra primera figura y la expusimos como objeto destacado de LiliFy.\r\nLuego de esto, y a partir de hoy, me metieron a un proyecto el cual todava no se ni el nombre ni lo que tengo que hacer, pero es algo de Generacin T, el cul voy a estar dndole prioridad por encima de LiliFy, aunque planeo seguir su desarrollo. Por otro lado, estuve estudiando React para este nuevo proyecto, al principio iba a ver unos videos preparados por un profesor, pero como pesaban mucho decidimos que iba a utilizar los cursos gratuitos de FreeCodeCamp.\r\nHice los primeros cuatro ejercicios ya que empec bastante tarde, pero detalle en otro documento todo lo que me ensearon con mucho cuidado, adems de que planeo seguirlo incluso fuera de horario de clase, ya que parece que no tenemos mucho tiempo para terminar este proyecto y creo que me van a explotar.','2023-08-10'),(6636,283,'Espero aprobar o me mato','El dia de hoy llegamos al aula y contemple que mis compaeros estaban sin hacer nada en el aula por lo cual decidi cambiarme con otro compaero de grupo. Comenzamos a pensar que le podamos decir a nuestro profesor para poder cambiarnos de grupo. tomamos coraje y decidimos decirle nuestra situacion, el profesor entendio nuestra situacion por lo cual nos dejo ver que grupo nos podremos cambiarnos. Luego de ver que grupos se adecuaban a nuestros requisitos, elegimos estar en el grupo que esta conformado por victoria, carolina, lucho, geraldine y maximo. ellos nos contaron q estaban un poco apretados con el tiempo y que no encontraban satisfaccion al seguir con el proyecto este. asi que con nosotros dos recien incorporados pasamos a dar ideas y pensar en que podamos ayudar en el grupo. lo q hicimos es seguir con la misma idea de la pagina de recetas y cambiar el diseo u otras cosas mas. Seguiremos con el grupo este, esperamos mejorar y ayudar.','2023-08-10'),(6637,293,'diagrama de entidad relacin','hoy da avance con el diagrama de entidad relacin que anteriormente estaba haciendo por el gran cambio de la base de datos','2023-08-10'),(6638,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Primero que nada, hemos tratado de empezar a configurar los forms en la parte de los pasoso de compra para as poder empezar a realizar la transaccin de dinero de modo que podamos configurar esto y hacerlo funcional. Hasta el momento hemos configurado el paso 1 y 2, el 3 estara a medias, pues aun queda implementar el mtodo de pago para que este mismo funcione correctamente, ya sea por tarjeta de crdito, debito o mercado pago. Por el momento, solamente configuramos la recepcin de datos, tanto como los datos del comprador, su domicilio y demas, aunque obviamente faltara configurarla y desarrollarla mucho mas, lo cula veremos mas adelante.\r\n- Por otro lado, hemos realizado un par mas de inserts para comprobar si funcionan las demas pestaas de las secciones, donde se encuentran especficamente los producto relacionados a la seccin seleccionada. De este modo realizamos cierto insert con las medias, habiendo implementado mejor ello. nicamente faltara hacer mas inserts para tener mas productos y agregarlos en las dems secciones. Tambin seria necesario implementar otra tabla para la compra que se realizara, pero eso lo veremos mas adelante. \r\n\r\nEso fue todo por hoy. \r\n','2023-08-10'),(6639,295,'Cambio de proyecto','En el da de hoy nos inform nuestra scrum que ya no bamos a formar parte de la elaboracin del proyecto que tenamos en PP con mi compaero aparte de los dems ya que ahora formbamos parte de un nuevo proyecto que tiene como duracin tres meses. Gracias a este cambio hoy debamos empezar a investigar que tendramos que hacer con mi compaero en el rea que nos toco. Empezamos con la investigacin del lenguaje React.','2023-08-10'),(6640,291,'10-08-2023','Este dia me dedique a realizar varias cosas, lamentablemente la daily no pudo hacerse por la ausencia de los integrantes de mi grupo, durante toda la clase me dedique a investigar desde cero como realizar una pagina de ventas y todo lo que se necesita para llevarla a cabo, investigue cul es la forma ms ptima y viable para que se acomode a todo tipo de dispositivos como seria la PC y el telfono, investigue y compare distintas pginas de ventas unas con las otras para ver la forma ms cmoda y sencilla para estos dispositivos.\r\nTambin busque distintos videos que explicaban el cdigo de las pginas que ellos realizaron para tomarlos como ejemplos y tener una mayor idea de como realizar la pagina que estoy mentalizando.','2023-08-10'),(6641,286,'Comienzo del Nuevo Proyecto de Generacin T','En el da de la fecha, comenzamos con la investigacin necesaria para realizar el proyecto. Lo primero que hicimos fue buscar tutoriales que expliquen que es una API, y que tambin expliquen como crear una con PHP. En paralelo, junto con el resto de mis compaeros del equipo, pensamos la base de datos que utilizaramos para la pgina de la creacin de bitcoras. Luego, continuamos con la creacin de la API. Utilizando xampp, cre una carpeta dentro de htdocs y dentro de sta descargu un framework llamado Flight, el cual es un framework que permite simplificar la codificacin. Luego hice una base de datos sencilla, la cual puede insertar los alumnos. ','2023-08-10'),(6642,275,'Mejoras en el diagrama de caso de uso y mas','Hoy de nuevo me encargue de la revisin y documentacin de lo que ya llevamos haciendo en el trabajo, hoy tuvimos un pequeo inconveniente, Kevin llego a avanzar el trabajo pero lo hizo en casa y no se lo mando a el mismo as que tuvimos que replicarlo en clase,pero sacando eso hoy tambin avanzamos mucho en el trabajo de hoy, seguimos teniendo que ver lo del tema de la facturacin, hoy revise los diagramas (El GANTT por ahora lo va a dejar como esta hasta que avancemos mas o hagamos algo mas importante) pero tambin quise mejorar el diagrama de caso de uso, el cual ya lo tenia hecho practicante, con su documentacin y todo pero quise mejorarlo y adaptarlo mas a nuestro trabajo actual, por lo general hoy trabajamos todo el da(excepto cuando vino nuestra preceptora a hablarnos de materias que tenamos adeudadas o cuando se nos corto el internet)','2023-08-10'),(6643,284,'27','en el dia de hoy me uni al grupo de la Generacion T , estuve interiorisandome en el tema sobre APIS y Swagger , para poder documentar todo sobre el proyecto , \r\nhoy arranque con el diagrama de  caso de uso  del proyecto , faltan bastantes mas pero tengo otros 2 compaeros con los que estamos en tema de diagramas que me ayudan.','2023-08-10'),(6644,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Primero que nada, hemos tratado de empezar a configurar los forms en la parte de los pasoso de compra para as poder empezar a realizar la transaccin de dinero de modo que podamos configurar esto y hacerlo funcional. Hasta el momento hemos configurado el paso 1 y 2, el 3 estara a medias, pues aun queda implementar el mtodo de pago para que este mismo funcione correctamente, ya sea por tarjeta de crdito, debito o mercado pago. Por el momento, solamente configuramos la recepcin de datos, tanto como los datos del comprador, su domicilio y dems, aunque obviamente faltara configurarla y desarrollarla mucho mas, lo cual veremos mas adelante.\r\n- Por otro lado, hemos realizado un par mas de inserts para comprobar si funcionan las dems pestaas de las secciones, donde se encuentran especficamente los producto relacionados a la seccin seleccionada. De este modo realizamos cierto insert con las medias, habiendo implementado mejor ello. nicamente faltara hacer mas inserts para tener mas productos y agregarlos en las dems secciones. Tambin seria necesario implementar otra tabla para la compra que se realizara, pero eso lo veremos mas adelante. \r\n\r\nEso fue todo por hoy. \r\n','2023-08-10'),(6645,296,'Bitacora 21','Hoy termine de hacer la interfaz de crear cuenta y empec con la parte de ingresar productos y retirar,pero despus un compaero me dijo para realizar los diagramas junto a 2 compaeros ms sobre un nuevo proyecto el cual trata sobre bitacoras','2023-08-10'),(6646,289,'Dia 10-08','El da de hoy, hemos dejado un poco de lado el proyecto anterior para darle una remodelacin. Ademas que dos de nuestros compaeros se han ido por un tiempo a otro proyecto para que vengan Ciro y Alan. Hicimos un nuevo trello ademas de hablar sobre como seria nuestro proyecto y un nuevo boceto. Eso es todo por hoy, muchas gracias. ','2023-08-10'),(6647,280,'','El dia de hoy hubo cambios en la estructura del equipo. Se nos unieron 2 compaeros al proyecto y 2 de nuestros compaeros iniciales, estaran de baja en el mismo durante 2 meses aproximadamente. Ante todos los contratiempos que presentamos en el proyecto actual, decidimos cambiarlo. La idea ahora es hacer una app de recetas que tambien tenga un apartado nutricional. Lo que en un principio solo mostraria las recetas, te proveer la informacion sobre la comida en general y puede otorgarte planes para llevar una vida diaria mas saludable en distintos ambitos. Esto teniendo en cuenta tus proporciones corporales. Todo esto se le integrara el uso de php y react para poder agilizar el proceso de diseo de la pagina y la app para movil creando mas rapido las interfaces a usar','2023-08-10'),(6648,278,'Clase N27 10/08/23','En el da de hoy aprend a utilizar swagger , para documentar la API que estamos realizando en el nuevo proyecto de Generacin T. Comenc a realizar el DER y mis compaero Luca realizo el diagrama de Caso de uso y Amir el de Flujo de datos.\r\n\r\nEstos son los diagramas que tenemos que realizar : \r\ncaso de uso\r\ncaso de uso extendido\r\nGANTT\r\nKANBAN\r\nMANUAL DE USUARIO\r\nMANUAL DEPLOYER\r\nDIAGRAMA DE CLASE (si hay objetos)\r\nDFD\r\nDER\r\nPresentacin\r\nDiccionario de datos\r\nSwagger\r\n\r\nYo hoy como ya mencione realice el DER y comenc con una clase del diagrama de clases.\r\nCon respecto a swagger vi un video en YouTube que la verdad lo entend bastante rpido, espero la prxima clase poder implementarlo.\r\n','2023-08-10'),(6649,279,'Dia 21 del  Proyecto','En todo el da mis compaeros de grupo estuvieron trabajando en otro proyecto que fue asignados a ellos haciendo que quede yo solo para hacer el proyecto nuestro.','2023-08-10'),(6650,273,'Clase 10-08-2023','En el da de la fecha me dediqu a realizar y discutir sobre cmo se haran el proyecto de StreamBe, en especial el que tenemos encargado de una plataforma de bitcoras para una empresa de usuarios. Primero, discutimos sobre cmo sera la base de datos, las tablas que se realizaran y dems. Empec realizando una tabla de bitacoras, o &quot;logs&quot; en ingls, que despus podra estar sujeta a cambios. A su vez, nos pasaron una tabla de sql de usuarios hecha por los alumnos de la otra divisin, la cual decidimos no tocar. Luego, empec a realizar la base de datos en sql, que era de logs y contena distintos campos importantes para la bitacora, y tambin hice un prototipado de la tabla de usuarios. A su vez, tambin realice dos stored procedures: addLogs y addUsers. Para aadir usuarios, se pedan distintos campos tambin, pero para esto tambin se necesita transformar la contrasea en MD5. A su vez, tambin tengo que hacer una funcin en Java que convierta un string a MD5 y sirva para comparar ambos strings de sql y el hecho en java. Luego, empec a realizar las clases en Java que era Log y contena distintos atributos de la bitcora. Hice el mtodo constructor que no recibe ningn parmetro y tambin hice los getters and setters de estos respectivamente. ','2023-08-10'),(6651,294,'Investigacion de proyecto nuevo','En el da de la fecha nuestra Scrum Victoria nos comento a mi y a mi compaera que ahora pertenecamos a un nuevo proyecto ademas de el que pertenecamos que tiene como duracin dos meses de trabajo. Esto implicaba que hagamos una reforma completa de nuestra forma de estudio y nos dijeron que debamos investigar junto a mi compaera el lenguaje REACT. Empezamos con eso hoy ademas de que adquirimos un poco de conocimientos de lo que es una API.','2023-08-10'),(6652,285,'Da 28','Qu logr hacer hoy?\r\n\r\nHoy me dediqu de lleno a la creacin de una pgina web, y aunque solo pude completar una pgina, siento que va bastante bien. El proyecto se llama RealCook, y trabajamos en la creacin de dos logos utilizando herramientas de inteligencia artificial.\r\n\r\nLa verdad es que esta pgina ha sido mucho ms sencilla de disear en comparacin con la anterior, la de Ystoriya. El diseo principal (main) es ms simple y directo, lo que me da confianza de que la codificacin ser ms fcil y no me tomar tanto tiempo y esfuerzo.\r\n\r\nEn qu se me complic?\r\n\r\nAfortunadamente, no tuve mayores complicaciones hoy. Todo fluy de manera relativamente sencilla, y aunque solo logr completar una pgina, siento que estoy avanzando bien y que el proceso est siendo ms llevadero que en proyectos anteriores.\r\n\r\nQu estuve investigando?\r\n\r\nA lo largo del da, estuve investigando cmo optimizar el diseo web para que sea ms sencillo de codificar sin perder calidad en la apariencia visual. Busqu recursos y consejos sobre la creacin de logos utilizando inteligencia artificial, lo que result en los dos logos para RealCook. Tambin revis ejemplos de pginas web con diseos simples pero efectivos para inspirarme en el diseo del main de RealCook.\r\n\r\nAdems, revis herramientas y recursos que podran agilizar la fase de codificacin, como libreras de CSS y herramientas de desarrollo web. Aunque este proyecto parece menos complicado, siempre es importante mantenerme actualizado y aprender de nuevas tcnicas y herramientas que puedan hacer mi trabajo ms eficiente y efectivo. En general, el da fue productivo y estoy emocionado por cmo est tomando forma la pgina web RealCook.','2023-08-11'),(6653,292,'investigacin api php','en el da de la fecha ya que Enzo  nos dijo que tena que esperar a tener el prototipo de la pgina web, nos dijo que viramos cmo hacer una pi desde cero otra vez.\r\n     Para esto se le ocurri fijarse en freecodecamp, que es una pgina que usamos en otra materia con la que hacemos una certificacin de javascript. busc por la pagina y habia una certificacin para el desarrollo de back end y de apis \r\n   Con la ayuda de mi compaero Manuel Filippa tratamos de hacer el primer ejercicio cosa que se nos complic mucho(enzo me dijo que iba a llegar a hacer toda la certificacin y que cualquier cosa lo segua otro pero no pude ni terminar el primer ejercicio) ya que no lo podamos hacer lo llamamos a enzo luego del receso para ver si saba como resolverlo. cosa que no pudo ya que nos fijamos en github algunas posibles soluciones y nada de esto result, nos acercamos un poco ya que la pagina donde tenamos que poner el link de la pgina com el ejercicio result no tiraba error de que faltara algo pero tiraba error de tiempo, que era mucho por lo que no sabiamos que mas hacer ni si era de la pgina o del cdigo\r\n      Esta es la pgina externa que nos deca en freecode camp en la que deban hacer el ejercicio, al principio no entendamos nada de cmo se deba hacer y eso se mantuvo por casi toda la clase hasta que lleg enzo y nos explico un poco por encima sobre cmo era su funcionamiento.\r\n','2023-08-11'),(6654,274,'Investigacin sobre APIs, modificacin Base de Datos','En el da de la fecha lo que hice fue continuar viendo tutoriales acerca de como hacer una API. Continu mirando el tutorial que haba mirado el da de ayer pero me d cuenta de que segua sin saber cual era la funcionalidad de una API. Me d cuenta de esto ya que visualic otro video acerca de como realizar una API y cual era su funcin, pero eran tratados otros temas que no haba visto en el video anterior, ni en ninguna pgina. Fue por esto que decid buscar cursos acerca de APIs y encontr uno de Google. Pero el contenido del curso no estaba demasiado relacionado a lo que deba realizar.','2023-08-11'),(6655,283,'gracias wili x habilitar la bitacora','El dia de hoy conformamos un grupo mejorado de alta calidad. llegue, salude a mis compaeros. y luego pase a ayudarlos con su respectivo trabajo a cada uno. por que ese es mi trabajo de scrum . a alan le designe seguir con el prototipo en figma y a carolina le di la tarea de seguir con la base de datos. maxi se la paso averiguando como seguir con la base de datos y como encontrar busquedas aleatorias. ','2023-08-11'),(6656,282,'Proyecto Generacion T','Durante esta jornada realizar varias tareas Relacionadas al proyecto de generacin T.\r\nIntente realizar un prototipado el cul no resultado y dialogue acerca los diagramas con Geronimo Estigarribia y recomend cursos de FreeCodeCamp respecto a Backend, Api\'s, React y Redux para que consigan obtener los conocimientos necesarios para realizar el proyecto.','2023-08-11'),(6657,279,'Dia 22 del Proyecto','En este da pues la verdad mis compaeros de grupo siguieron con su trabajo con otro que les fue asignado as que quede yo con el proyecto haciendo la daily.','2023-08-11'),(6658,273,'Bitacora N 27 - Clase 11/08/2023','\r\nHoy llegu y me puse a realizar las distintas funciones que serviran para convertir cosas dentro de Java que posteriormente seran utilizadas en los controladores de la pgina. Por su