agara, la fecha de vencimiento, y por ultimo el DNI del dueo de la tarjeta. Aunque no esta totalmente terminada, por lo que lo veremos mas adelante. \r\n\r\nEso fue todo lo realizado por hoy.','2023-08-11'),(6661,288,'Clase 25','El da de la fecha nuestro compaero Federico Andres Tolivia nos ha abandonado por temas de estudiar otra materia que desconocemos totalmente. Mientras mi compaero Guerrero Joseph y yo terminamos de realizar el diseo de nuestras cards en la pagina principal, las cuales estarn en oferta, tambien pusimos letra verde y faltaria acomodar el espaciado entre las cards.','2023-08-11'),(6662,280,'','En el dia de hoy avanzamos por el lado del frontend y haciendo cambios en la estructura de la base de datos. Esto debido a que el mismo sistema que estamos empleando no nos permitia generar las consultas teniendo en cuenta la cantidad de cada uno de los ingredientes utilizados. Para arreglarlo decidimos utilizar la tabla de las recetas que contienen cada una de las cantidades y luego filtrarlas por el sql utilizando un join y un rand lo cual nos devolveria de manera aleatoria recetas que contengan esa misma cantidad de ingredientes','2023-08-11'),(6663,298,'Clase 26','Hoy empezamos a hacer la bdd de las recetas, incluyendo recetas fciles, rpidas y con pocos ingredientes. Tambin empezamos con la nueva pgina.','2023-08-11'),(6664,286,'Investigacin sobre APIS','En el da de la fecha ya que Enzo  nos dijo que tena que esperar a tener el prototipo de la pgina web, nos dijo que viramos cmo hacer una pi desde cero otra vez.\r\n     Para esto se le ocurri fijarse en freeCodeCamp, que es una pgina que usamos en otra materia con la que hacemos una certificacin de JS. Busc por la pgina y haba una certificacin para el desarrollo de backend y de apis \r\n   Con la ayuda de mi compaero Ezequiel Ledesma tratamos de hacer el primer ejercicio cosa que se nos complic mucho (Enzo me dijo que iba a llegar a hacer toda la certificacin y que cualquier cosa lo segua otro pero no 