opTypes, se escribe declarando el prop que vamos a usar, .propTypes y luego el tipo que queremos.\r\n','2023-08-11'),(6667,275,'11-08-2023','Pues nuevamente hoy me sentre mas que nada en el tema de los diagramas y si estaban terminados correctamente, ten bien hoye me sentre mas que nada en el tema de la documentacion del caso de uso por ahora quedo masomenos asiCaso de Uso \r\nLus shop \r\nActores\r\nCliente, Vendedor \r\nResumen \r\nUn cliente quiere comprar ropa, entre otros artculos en lnea, para eso el vendedor crea un pgina web donde venderlas y registrar las ventas. \r\nPropsito \r\nVender ropa \r\nPrecondiciones \r\nEl cliente tiene que haber iniciado sesin, el cliente no debe haber solicita un producto.\r\n                                                                      Flujo de eventos \r\nAcciones de actores \r\nAcciones de sistema \r\nEl cliente solicita el producto al vendedor \r\n1.El sistema le solicita al vendedor iniciar sesin en el sistema \r\nEl vendedor verifica si el producto est o no disponible. \r\n2. El sistema le da una respuesta al vendedor sobre la disponibilidad del producto solicitado\r\nEl vendedor le informa al cliente sobre la disponibilidad del producto deseado \r\n        \r\nEl cliente pide el producto \r\n       \r\nEl vendedor abre el men de ventas en el sistema  \r\n      5.El sistema muestra la interfaz grfica                        para iniciar la venta \r\nEl vendedor ingresa los datos de la venta: Datos del cliente (Nombre, Apellido, DNI). Detalle de la venta y tipo de pago.  \r\n      6.El sistema verifica los datos ingresados por el vendedor para realizar la venta. \r\n\r\n\r\nEl sistema emite un comprobante de pago \r\nEl vendedor entrega el comprobante de pago \r\n\r\ntenia una versin anterior a esta pero se elimino \r\n\r\n\r\n\r\n','2023-08-11'),(6668,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Base de Datos - Conexin','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos trabajando en el diseo de la pagina web, esta vez completando la parte de l Paso de Compra 3, agregandole los campos faltantes a la opcin de tarjeta de crdito, aunque aun falta configurar las dems opciones de tarjeta de debito y de mercado pago para que muestres los campos determinados a cada opcin, pero eso lo trabajaremos mas adelante. Hasta el momento hemos agregado un tipo de seleccionador en el que podrn seleccionar el tipo de tarjeta, ya sea MasterCard, Visa, etc., numero de la tarjeta, las cuotas con las que decidir pagar, cdigo de seguridad, nombre y apellido de la tarjeta con la que se pagara, la fecha de vencimiento, y por ultimo el DNI del dueo de la tarjeta. Aunque no esta totalmente terminada, por lo que lo veremos mas adelante. \r\n\r\nEso fue todo lo realizado por hoy.','2023-08-11'),(6669,278,'Clase N28 11/08/23','Hoy comenc con los diagramas , tuve que editar el diagrama de entidad relacion , ya que , hubo que rehacer la Base de datos. Avance con el diagrama pero no llegue a terminarlo , me faltaron algunas tablas.Las tablas que realice fueron: vacaciones , employer, proyecto, rea y bitcora. Tambin ayude a mi compaero Enzo que estaba comenzando a realizar realizar el prototipado rpido.','2023-08-11'),(6670,281,'Dia 21','El da de hoy estuvimos trabajando nuevamente solo 2 personas del grupo, Matias Ruiz y yo, nuestro compaero Federico Tolivia vino pero est realizando otro proyecto actualmente y por eso no pudo estar con nosotros. Igualmente realizamos solo una cosa la cual fue: buscar otro diseo de las tarjetas ya que nos pareca montono tener el mismo estilo en las dos pginas. Tambin acordamos que habrian solo 3 ofertas de los productos y que iran rotando aleatoriamente cada semana.','2023-08-11'),(6671,294,'Realizacin de ejercicios','En el dia de hoy estuvimos con el seguimiento de la investigacin/ejercicios del lenguaje REACT junto a mi compaera. Hicimos bastantes ejercicios en la pgina FREECODECAMP referidos a