as ni se me brind ningn tipo de comunicacin respecto asuntos a realizar, por lo cual prosegu realizando asuntos propios.','2023-08-17'),(6712,283,'LLLUVIA','Hoy hubo una llluvia torrencial muy zarpada, por lo cual de los 5  integrantes que tenemos ahora en el grupo solo vinimos 3. Dividi las tareas que tenian que hacer los chicos y los ayude dandole ideas de como tendria que ser la pagina Ayudandolos en como tenia que ser los logos, diseo de la pagina etc. hasta haciendo un prototipo de la pagina en paint para que luego lo pasen al figma y luego de todo eso a la pagina web. Luego de todo eso diseamos la pagina entre todos y listo. ese fue nuestro dia eN PRACTICAS PROFESIONALIZANTES','2023-08-17'),(6713,285,'Da 29','Qu logr hacer hoy?\r\n\r\nHoy me enfoqu en continuar con el diseo de la pgina web. Aunque enfrent algunos desafos ya que las preferencias de diseo de mi compaero eran un tanto cambiantes, logramos avanzar. Trabajamos en la creacin de dos nuevas pginas para el sitio. Realic algunos ajustes en el encabezado, moviendo elementos al costado para mejorar su apariencia. Adems, agregamos tarjetas interactivas que contendrn recetas y redirigirn a los usuarios a otras pginas para ms detalles. Una adicin divertida fue la incorporacin de una imagen de Maxi disfrutando de una hamburguesa, que le da un toque personal al sitio. Un saludo amistoso cerr nuestra jornada!\r\n\r\nEn qu se me complic?\r\n\r\nDurante el da, encontr ciertas complicaciones al tratar de satisfacer las preferencias cambiantes de diseo de mi colega. Aunque esto agreg un nivel de iteracin extra, pudimos superarlo y llegar a un diseo que nos satisfizo a ambos.\r\n\r\nQu estuve investigando?\r\n\r\nEn el transcurso del da, estuve investigando cmo implementar efectivamente elementos visuales en la pgina web. Investigu tcnicas para crear tarjetas interactivas y cmo enlazarlas con otras pginas para brindar una experiencia de usuario fluida. Tambin me sumerg en la optimizacin de imgenes para la web, para asegurarnos de que la foto de Maxi luciera ntida y se cargara rpidamente.\r\n\r\nPor otro lado, comenc a investigar sobre las mejores prcticas para el desarrollo del encabezado en una pgina web. A medida que mi colega Victoria Laura inicia este proceso, quiero asegurarme de tener un entendimiento slido para poder contribuir de manera efectiva cuando sea necesario. Estamos emocionados por las prximas etapas del proyecto.','2023-08-17'),(6714,284,'Bitcora 28','hoy empece con el caso de uso especializado para el proyecto  de generacion T sobre las bitcoras , y tambien tuve que modificar el caso de uso , sobre el tema de los recursos humanos , creo que voy a tener que hacer otro aparte o agregarlo al caso de uso que ya tenemos.','2023-08-17'),(6715,295,'Continuacion de react','En el da de la fecha con mi compaero estuvimos haciendo lo que sera lo mismo de la semana pasada que era realizar y poder llegar a finalizar los ejercicios que corresponden al curso de React en la pagina freeCodeCamp, estos mismos nos iban a ayudar porque el proyecto que debemos llevar a cabo bamos a necesitar tener conocimientos de este lenguaje. Logramos llegar al ejercicio 14 y aprendimos nuevas cosas.','2023-08-17'),(6716,281,'Dia 22','El da de hoy apenas llegu a la clase abr el proyecto que tenemos en github y me fije en los problemas que tenamos pendientes, entonces vi que en las pginas de los productos no se vea la imagen del perrito(Nuestro logo momentneo). Entonces me puse mano a la obra para arreglar eso. \r\nDespus termine de hacer la seccin de ofertas, puse los otros 2 productos que acordamos que estaran en oferta.\r\nY por ltimo charlamos con Federico Tolivia, el nico integrante del grupo que vino hoy, sobre cmo vamos a tener una seccin en la pgina donde organizaremos los productos segn 3 secciones: Anime, Series, Juegos.','2023-08-17'),(6717,286,'Carpeta de Campo y ejercicios de freeCodeCamp','El da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar.\r\n     Debido a que en el da de hoy, el Scrum Master Enzo Bartoletti y parte del grupo de trabajo para el proyecto de Streambe no se encontraba presente, decid trabajar en m mismo, ponindome al da con la carpeta de campo, revisando las bitcoras hechas los das anteriores en encuentrotecnologico.com.ar y copindolas en este documento form para ms tarde explayar de una forma que se entienda y explique al 100% lo que hice en el da. De 101 hojas pas a 107 con los nicos dos das que tena por colocar.\r\n     Ms tarde decid retomar el curso Back End Development and APIs de freeCodeCamp que haba dejado los anteriores das. Intent hacer el ejercicio para por lo menos avanzar un poco, empec desde cero pero el resultado fue el mismo, no pude completar el desafo.\r\n     Prob todas los nombres que se me ocurran para ponerle a author pero no hubo caso, prob el nombre que me daba de ejemplo la pgina del ejercicio, prob poner mi nombre normal, mi nombre de usuario, de todo, pero no hubo caso, por lo que decid recurrir a la seccin de Obtn un consejo. En dicha seccin, el mismo freeCodeCamp te da la solucin en caso de que no puedas dar con esta, pero an intentando copiar al pi de la letra la solucin, no hubo caso. \r\n      Ms tarde intent ver lo que escriba la gente que intentaba hacer el ejercicio para ver si encontraba a personas que tenan el mismo error que yo, por lo que v que 8310 personas le haban pasado lo mismo que a m y a mi compaero Ezequiel Ledesma. Me puse a leer las ayudas que pedan las personas para poder realizar el ejercicio y las respuestas a esas ayudas, pero aunque segu al pi de la letra las soluciones que algunas personas proponan, el problema segua persistiendo.\r\n     A pesar de recibir instrucciones de un lder, no pude resolver el ejercicio.\r\n','2023-08-17'),(6718,278,'Clase N29 17/08/23','En el da de la fecha contine con el diagrama de entidad relacin. Termine de realizar las tablas , solo me tocaba relacionarlas , relacione algunas pero otras no pude, entonces le ped ayuda al profesor y me envi otra base de datos con las claves primarias y forneas ya escritas, ya que, la anterior base de datos no las tenia. La intente agregar a PHPMyAdmin pero me daba error en algunas tablas y sus claves forneas , as que le ped ayuda a mi compaero Forte. Luego de eso pude relacionar algunas tablas que faltaban , pero tengo que corregir otras as que no pude terminarlo hoy.','2023-08-17'),(6719,277,'Vigsima cuarta clase','El da de hoy estuve siguiendo los ejercicios de React, ms concretamente desde el 20 hasta el 29. Estuve aprendiendo el uso del State, uno de los temas ms importantes en React, que consiste en cualquier dato que tu aplicacin necesite conocer y que pueda cambiar con el tiempo, se puede renderizar, heredarse a clases hijas y puede ser tan complejo o simple como nos convenga. Una vez definido, se puede mostrar visualmente donde nos convenga, a esto se le llama renderizar.\r\nTambin se pueden guardar estos States en funciones, para luego realizar clculos sobre estas u otras acciones. Usualmente el State se inicializa en el constructor, pero tambin hay una forma de cambiarlo en el componente, React cuenta con un mtodo para actualizar el State llamado setState. Este mtodo dentro de su clase se llama this.setState(), pasando un objeto con pares clave-valor. Las claves son tus propiedades de estado y los valores son datos de estado actualizados.\r\nAdems de configurar y actualizar el State, tambin aprend a definir mtodos para los componentes de una clase. Un mtodo de clase normalmente necesita usar la palabra clave this para que pueda acceder a las propiedades de la clase dentro del mbito del mtodo. Una forma comn es enlazar el this en el constructor para que se vincule a los mtodos de clase cuando el componente es inicializado.\r\nOtro punto a tener en cuenta es que React puede procesar mltiples actualizaciones de manera asncrona, osea, al mismo tiempo. Esto significa que no podes confiar en el valor anterior de this.state o this.props al calcular el siguiente valor, por lo tanto no podes sumarlos ni restarlos. En su lugar, hay que usar una funcin del setState que te permita acceder al state y a los props, esta funcin garantiza que ests trabajando con los valores ms actuales del state y del props.\r\nCon estos conocimientos logr hacer un contador simple donde hay tres botones, uno que suma uno, otro que resta uno y un ltimo que resetea a cero, debajo de los botones hay un texto con el nmero en cuestin.\r\n','2023-08-17'),(6720,274,'Creacin de APIs, investigacin sobre React','En el da de la fecha, lo primero que hice fue buscar videos que expliquen de manera sencilla cmo realizar una API para el registro de usuarios. Encontr un video donde se explicaba como realizar eso en PHP. Pero me d cuenta de que todava no habpiamos definido en qu lenguaje ibamos a crear las APIs. Luego busqu en YouTube videos acerca de cmo iniciar con React, que es una librera de JavaScript que permite un desarrollo mucho ms sencillo de pginas web.  En el video se mostraba cmo se podan crear variables en JavaScript e imprimirlas con mayor facilidad en un archivo html. Un compaero de mi equipo se estaba encargando de la base de datos del proyecto, pero al exportar la base de datos que ya contena los tipos de datos correctos y las claves foraneas definidas, apareca un error. Me consult cul poda ser el error que sala, y el mismo era que las claves forneas de la primera tabla estaban mal definidas. Esto se deba a que las tablas estaban ordenadas de manera errnea, por lo que en la primera tabla haban valores de las claves forneas que an no estaban definidos.','2023-08-17'),(6721,293,'Diagrama','hoy da contine con el diagrama de entidad relacional aun no esta terminada por que falta agregar mas cosas a la base de datos por eso hasta entonces esta incompleto.','2023-08-17'),(6722,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Conexin','