dad por lo que me puse a corregirlas, cosa que me llevo varias horas y mucho desgaste mental. no solo tena que mover hojas sino tambin completar escribir cosas para que no quede vaco','2023-08-17'),(6727,273,'Bitacora N 28 - 17/08/23','En el da de la fecha empec a realizar un proyecto de Spring desde 0, el cual servira de base para la creacin de la aplicacin REST-API que debo realizar. Tambin, tuve algunos errores al querer compilar el proyecto, que luego resolv. Finalizando, empec a realizar el mapeo de las clases JPA.','2023-08-17'),(6728,273,'Clase N 29 - 18/08/23','Hoy realic las clases Controller, Service, Repository y Models que sirven para interactar dentro de Spring. Dentro de cada una tuve que realizar distintos mtodos, que ya se encontraban importados desde Spring. De esta forma, poda empezar a interactar con el cdigo que realic, pero a la hora de hacer la prueba no me dejaba entrar al directorio donde estaba el controlador.','2023-08-18'),(6729,274,'Reunin, versionado de APIs','El da de hoy nos reunimos todos los integrantes del grupo para que uno de los integrantes nos explique lo que haba hablado previamente con uno de los docentes involucrados en el proyecto. Nos explic acerca de las APIs que tenamos que crear para llevar a cabo el proyecto y que haramos cada uno. Tras la reunin, lo que hice fue investigar en Google y en YouTube acerca de cmo versionar las APIs. Tambin discutimos acerca de qu lenguaje utilizaramos para realizarla, aunque nos dimos cuenta de que todos los grupos lo estabamos realizando en lenguajes distintos.','2023-08-18'),(6730,281,'Dia 23','El da de hoy no tuvimos mucho tiempo para realizar demasiado trabajo pero igualmente estuvimos buscando ideas de como hacer la pgina del producto en s, encontramos una plantilla muy buena en la que podemos basarnos y de ah agregarla al proyecto de Lilify.','2023-08-18'),(6731,283,'hola hermo','Hoy como siempre llegamos al colegio con la mayoria de chicos y dividimos lo q tenemos q hacer, terminamos el figma y empezamos la pagina. supuestamente se unio otro integrante mas al equipo pero seguramente no. este dia tuvimos poco tiempo pero vamos cada vez mejor. Ahora solo nos falta termina la base de datos y las paginas para luego unirlo con php. ','2023-08-18'),(6732,278,'Clase N30 18/08/23','En el da de la fecha la primer tarea que hice fue terminar el diagrama entidad relacin , aunque despus , me comunicaron que los chicos del turno maana ya lo tenan hecho as que el mio no lo bamos a usar.Entonces comenc a realizar el KANBAN y lo termine.Luego tuvimos una reunin con el equipo en la cual se hablo para ver como iba cada parte del proyecto.Por ultimo estuvimos revisando la Base de datos , ya que, nos segua dando error las claves forneas, seguimos sin poder solucionarlo.','2023-08-18'),(6733,285,'Da 30','Qu logr hacer hoy?\r\n\r\nHoy he estado enfocado en el diseo continuo de las pginas utilizando la herramienta Figma. Avanc en la creacin de varias pginas clave para el proyecto. He completado las pginas de inicio de sesin, as como la pgina de presentacin de recetas. En esta ltima, me asegur de disear una interfaz atractiva que muestre las fotos de las recetas proporcionadas por nuestros usuarios. Adems, trabaj en la implementacin de carrouseles en diferentes secciones de la pgina para mejorar la experiencia visual. Tambin dise la pgina individual de receta, donde he dispuesto cuidadosamente la informacin esencial: nombre, foto, descripcin y los pasos detallados a seguir para replicar la receta.\r\n\r\nEn qu se me complic?\r\n\r\nEn realidad, no he enfrentado mayores complicaciones durante el da. El proceso de diseo en Figma ha sido bastante fluido y las ideas se han plasmado segn lo planeado. No obstante, siempre estoy atento a posibles obstculos que puedan surgir en el proceso de desarrollo.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, no hubo una investigacin significativa. Principalmente, he estado aplicando mis habilidades de diseo en Figma para dar vida a las diferentes pginas. Sin embargo, mantuve una comunicacin constante con Vicky, quien est a cargo de la programacin. Intercambiamos ideas y avances para asegurarnos de que el diseo se adapte sin problemas a la implementacin en el desarrollo web. Estoy preparado para la prxima clase, donde me unir a Vicky en la programacin y continuaremos trabajando en equipo para llevar este proyecto a buen trmino.','2023-08-18'),(6734,289,'18/08','El dia de hoy, seguimos con la pagina. Mientras que mis compaeros seguian con el figma, yo me dedique a continuar con la pagina web con compaia de Caro, eso es todo por hoy,muchas gracias.','2023-08-18'),(6735,288,'Clase 26','El da de hoy nuevamente nos abandon nuestro compaero Federico Tolivia, este no est participando mucho actualmente pero ya nos ha ayudado mucho anteriormente y en el futuro nos ayudar an ms, es ms, tenemos una tarea pendiente para l. \r\nCon mi compaero Joseph Guerrero pudimos buscar ejemplos de pagina para utilizar al tocar el botn Agregar Al Carrito, y te lleve al apartado donde puedas ver el producto.','2023-08-18'),(6736,292,'carpeta de campo',' En el dia de la fecha llegue al aula correspondiente de prcticas profesionalizantes (que es otra distinta a la de los jueves)  estuve un rato hablando con mis compaeros Manuel Filippa y Christian Forte sobre el proyecto, esperando a que llegue Enzo ya que l nos dira que es lo que debamos hacer(esto tom gran parte de la jornada de hoy, exactamente hasta despus del receso) luego del receso enzo me llamo ya que debamos ir con un profesor para consultar una lnea de cdigo que tengo en un proyecto de otra materia(encripta las contraseas) y debamos preguntarle al profesor si esta lnea de cdigo nos serva para el proyecto que estamos haciendo de streambe/generacin t. pero no pudimos preguntarle ya que al buscarlo nos dijeron que se haba ido. \r\n\r\n     Luego enzo convoc una reunin para todos los miembros totales de este proyecto ya que somos varios e hizo una puesta en comn indicando que debamos hacer cada uno, manu, chris y yo todava no tendramos nada que hacer, tenemos que esperar a que se terminen las dems tareas como hacer una base de datos antes de que sigamos con la creacin de las Apis para la pgina. Se nos dijo que tendramos que hacer 3 Apis las cuales deban ser de usuario, una de bitcora y otra de proyecto, estas 3 nicamente con Apis (pueden variar hasta ser 4/5).\r\n','2023-08-18'),(6737,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Conexin','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- El dia de hoy seguimos trabajando en base la pagina web. No hemos realizado mucho mas a parte de cambiar algunos diseos de la pagina web, tales como las cards con los productos que se encuentran dentro de la pagina web, algunos toques dentro de la pestaa del producto y demas. Tambien planteamos el cambiar un aspecto dentro de la pestaa del carrito, pues pensamos configurar este mismo para determinar con algun tipo de select si el envio sera a domicilio o retiro al local, y que esto le cobre un monto determinado o sea gratis en algun caso y eso se sume al total a cobrar luego al realizar la transaccion.\r\n\r\nEso fue todo lo realizado el dia de hoy. ','2023-08-18'),(6738,279,'Dia 23 del Proyecto','Mis compaeros siguieron un poco continuando el otro proyecto asignado siendo de la generacin T.','2023-08-18'),(6739,293,'revisar diagrama ','hoy da me dedique a revisar algunos diagramas por el tema de las base de datos y aun se sigue trabajando en eso.\r\n','2023-08-18'),(6740,275,'Revision diagrama de camino critico','18/08/2023\r\n\r\nHoy nuevamente me estuve dedicando a los diagramas, aun que Kevin tambin nos pidi a Sez y a mi que si pudiramos hiciramos una base de datos para la que seria el sistema de pagos en una pagina web.\r\nHoy me dedique mas que nada a lo que seria el diagrama de Camino Critico, resumiendo mucho un diagrama critico es  es una tcnica que te permite identificar las tareas necesarias para finalizar un proyecto y determinar cierta flexibilidad en el cronograma. Una ruta crtica en la gestin de proyectos es la secuencia ms larga de actividades que deben finalizarse a tiempo para completar todo el proyecto. Cualquier retraso en las tareas crticas provocar el retraso del resto del proyecto.\r\n  ','2023-08-18'),(6741,286,'Charla con el Scrum Master','En el da de la fecha llegue al aula correspondiente de Prcticas Profesionalizantes (que es otra distinta a la de los jueves) estuve un rato hablando con mis compaeros Ezequiel Ledesma y Christian Forte sobre el proyecto, esperando a que llegue Enzo, nuestro Scrum Master ya que l nos dira que es lo que debamos hacer (esto tomo gran parte de la jornada de hoy, exactamente hasta despus del receso). Pero no pudimos preguntarle ya que al buscarlo nos dijeron que se haba ido. Luego Enzo convoco una reunin para todos los miembros totales de este proyecto de Streambe ya que somos como 10 integrantes, e hizo una puesta en comn indicando que debamos hacer cada uno, Ezequiel, Christian y yo todava no tendramos nada que hacer, tenemos que esperar a que se terminen las dems tareas como hacer una base de datos antes de que sigamos con la creacin de las Apis para la pgina. Se nos dijo que tendramos que hacer 3 Apis las cuales deban ser de usuario, una de bitcora y otra de proyecto, estas 3 nicamente con Apis (pueden varias hasta ser 4/5). Luego de eso, nos quedamos sin tiempo y termin la clase.','2023-08-18'),(6742,296,'Bitcora 23','Hoy comenc la especificacin de caso su uso pero tuvimos una mini reunion con el equipo y nos dijeron nuevas cosas,asi que fui cambiando un par de cosas del caso de uso y del DFD','2023-08-18'),(6743,277,'Vigsimo quinto clase','Hoy estuve adelantando el trabajo de Generacin T, finalmente me explicaron sobre que trata el proyecto, este siendo una pgina web para el guardado de bitcoras durante un trabajo en equipo. Una pgina donde se inicia sesin pero no se crea una cuenta, esta la crean los administradores desde adentro, y que solo se puede interactuar si la cuenta es activada por alguien de mayor rango.\r\nPor ahora estuve intentando llevar lo aprendido de React en FreeCodeCamp a algo ms prctico, vamos a estar utilizando NextUI que es una librera de React para hacernos la vida ms fcil, su funcionamiento es parecido a la librera de Bootstrap de HTML y har ms ameno el trabajo. \r\nEn eso estuve por la pgina oficial de React intentando crear un archivo, primero estuve viendo que hay dos formas de usar React, una completamente en este lenguaje y otra mediante HTML, no se cuales son las diferencias y no se cual deberia elegir pero por ahora estoy probando ambas, en HTML parece algo complicado ya que el cdigo se extiende e incluso cambia ligeramente, pero no se como utilizar solo React sin dependencias por el momento.\r\n','2023-08-18'),(6744,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Conexin','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- El dia de hoy seguimos trabajando en base la pagina web. No hemos realizado mucho mas a parte de cambiar algunos diseos de la pagina web, tales como las cards con los productos que se encuentran dentro de la pagina web, algunos toques dentro de la pestaa del producto y demas. Tambien planteamos el cambiar un aspecto dentro de la pestaa del carrito, pues pensamos configurar este mismo para determinar con algun tipo de select si el envio sera a domicilio o retiro al local, y que esto le cobre un monto determinado o sea gratis en algun caso y eso se sume al total a cobrar luego al realizar la transaccion.\r\n\r\nEso fue todo lo realizado el dia de hoy. ','2023-08-18'),(6745,295,'Proyecto generacion T','El da de hoy tuvimos una charla en grupo con el que es nuestro nuevo grupo, el cual tenemos para la realizacin del proyecto de generacin T, esta charla fue para que nuestro compaero de grupo nos explique bien como bamos a desarrollar el proyecto y que bamos a tener que hacer cada uno. ','2023-08-18'),(6746,294,'Organizacin de proyecto generacin T','En el da de la fecha, nuestro compaero de grupo de generacin T, realizo una charla para explicarnos al grupo  como bamos a empezar con el proyecto, ya que hasta ahora lo nico que habamos hecho, junto con mi compaera, era hacer el curso de React, entonces nos explico de manera mas detallada como iba a ser cada cosa y nos asigno un trabajo a cada integrante del grupo.\r\n ','2023-08-18'),(6747,282,'Reunion con colegas','En el dia de hoy trabaj arduamentre en lograr que mis colegas trabajen de la manera mas correcta posible.\r\nMe focalic en seguir ultimando detalles para posteriormente contarles a todos los integrantes del grupo respecto a como proseguir en las interfaces y las api\'s','2023-08-18'),(6748,298,'Clase 27','Hoy estuvimos haciendo la pgina con Vicky mientras los chicos hacan el figma','2023-08-18'),(6749,251,'BeCation - Generacin T pt4 - 22/08/2023','El da de hoy revis el cdigo de la semana pasada y ayude a Dylan con algunos mtodos faltantes en employerDAO','2023-08-22'),(6750,260,'','Estuve agregando algunas funcionalidades y haciendo pruebas con la libreria de fullcallendar','2023-08-22'),(6751,267,'22/08/2023','Hoy continuamos con el armado del robot SUMO, agregamos el sensor ultrasonido e hicimos un cdigo para testear las ruedas que segn la tecla que toques es la direccin que lleva','2023-08-22'),(6752,262,'22/8/2023','El dia de hoy comence con una vista del calendar de Requisitos de Datos para reservar vacaciones, lamentablmente la pc se congelo dos veces y no llegue a comitear lo realizado','2023-08-22'),(6753,254,'22/8/2023','termine el iniciar sesion y registrarse','2023-08-22'),(6754,270,'22/08/23','el da de hoy edit el cdigo de php para que la base de datos devuelva una pregunta random junto con sus 4 respuestas posibles','2023-08-22'),(6755,269,'22/8','Hoy contine con el curso de react','2023-08-22'),(6756,265