etas.','2023-08-22'),(6769,282,'Tareas GS1','Hoy finalmente. tras mas de cuatro das, me suministraron tareas de la empresa tanto Lucas Sosa como Tomas Sainato, siendo que ahora en tan solo una jornada laboral de cuatro horas me encuentro completamente saturado de tareas para realizar, teniendo tanto (en segundo plano) el Out de Cencosud referente a Febrero y (en primer plano) volver a revisar los recortes hechos en mi primera tarea dada al entrar a la empresa.','2023-08-22'),(6770,303,'22-08-2023','Modificamos el codigo para la funcionalidad del videojuego.','2023-08-22'),(6771,282,'Recortes VLA','Hoy fue un da saturante y catico, donde las tareas que deba realizar en el archivo respecto a marcas y recortes no quedaban claras y por cada asunto solucionado surgan nuevas problemticas an ms complejas. No encontrbamos principalmente el modo de hacer coincidir tanto la cantidad de marcas como la cantidad de recortes para lograr que ambas dieran exactamente el mismo nmero ni as mismo logrbamos descifrar el criterio a utilizar para realizar recortes. Siendo as, decidimos mantener los recortes del mismo modo que la marca, por lo tanto logramos 1751 filas idnticas, multiplicadas por 2 (recortes) y permitiendo as que estas se suban a la herramienta de una manera tal que esta no tire errores al realizar la carga de los datos.','2023-08-23'),(6772,263,'23/8','Hoy lamentablemente no pude avanzar mucho mas, me pare en seco debido a que importar una animacion es mas complicado de lo que yo creia, pero aun asi avance bastante y aprendi bastantes cosas','2023-08-23'),(6773,252,'Clase 39 - Swagger Create new user','El dia de hoy termin de documentar la parte de &quot;Add User&quot;. Hice una vista con Swagger UI que me muestre los usuarios creados y tambin permita crear usuarios de prueba. En Swagger UI se muestra cada usuario creado o &quot;posteado&quot; como un JSON.','2023-08-23'),(6774,251,'BeCation - Generacin T pt5 - 23/08/2023','El da de hoy cre las rutas y controladores de Rol y Area y luego probamos con Dylan los controladores. Quedan muchas cosas que corregir respectos al middleware y a algunos mtodos del controlador de vacaciones','2023-08-23'),(6775,262,'23/8/2023','El dia de hoy implente el full calendar al visual studio para comenzar a trabajar en unas de las vistas del proyecto StreamBe, implente algunos plugins, los cuales son: FullCalendar/Core, FullCalendar/React, FullCalendar/DayGrid','2023-08-23'),(6776,254,'23/08/23','Sigo corrigiendo errores del login','2023-08-23'),(6777,270,'23/08/23','el da de hoy continu con el cdigo tanto de php como de C# del videojuego y logr que la pregunta se imprima en textos separados en relaciona a sus respuestas para acomodar cada una de estas en una puerta en el escenario, ademas de que estas se actualizan a una random cada vez que se ejecuta el videojuego.','2023-08-23'),(6778,260,'','Despues de leer mas la documentacion de fullCalendar pude ver como tratar el responsive, para adaptar mejor el calendario a pantallas tamao celular, y tambien supe como hacer la customizacin CSS para cambiar el aspecto de algunos componentes de la UI.','2023-08-23'),(6779,253,'Mircoles 23/08/2023 - React','Hoy termin por fin con el login del proyecto nuevo que nos dieron.','2023-08-23'),(6780,250,'miercoles 23/8','hoy estuve arreglando la barra superior con ayuda de taro','2023-08-23'),(6781,255,'miercoles 23/8','hoy humille de forma atroz y despiadada a lucio en un codigo de css','2023-08-23'),(6782,257,'23/08/2023','Hoy avanzamos el patio del colegio, la entrada y la conexin para online ','2023-08-23'),(6783,268,'23-08-2023','El dia de hoy mi grupo y yo untamos todos los codigos de los componentes del robot.','2023-08-23'),(6784,258,'23-08','Hoy estuve haciendo un modo ( o mejor dicho testeando para que funcionara el multijugador)','2023-08-23'),(6785,261,'23/08/2023','El dia de hoy mi grupo y yo untamos todos los codigos de los componentes del robot.','2023-08-23'),(6786,266,'Avance y revision del backend d