 imagen puedas darle click y te mande a la pgina del producto en s.\r\nTambin estuvimos avanzando un poco con la pgina del producto, acordamos poner 3 imgenes del producto, y que se le pueda hacer zoom a estas.\r\nPor ltimo realizamos la creacin de nuestra cuenta de Tik Tok asi logramos tener un mejor alcance.\r\n','2023-08-24'),(6791,281,'Dia 24','El dia de hoy estuve retocando bastante la parte de productos ya que no estaba muy ordenada del todo y adems acordamos que sera mejor poner el precio en la pgina de productos, ya que si a alguien le interesa un producto ya podra ver el precio de este y despus entrar a la pgina del producto en si y ahi ver la descripcin y etc. Adems trate de incluir el sistema de compra (carrito) pero no pude, pero ya hice un gran avance ya que encontr una gran base donde podemos sacar bastante informacin de como hacerlo.\r\nEspero que en las prximas clases podramos concretar esto y ya tener gran parte de la pgina terminada. Ya que a mi punto de vista es bastante importante tener la parte de compra funcional.\r\nY tambin hice una propuesta ms en github que es para el tema del producto, que cuando pongas el cursor en la imagen puedas darle click y te mande a la pgina del producto en s.\r\nTambin estuvimos avanzando un poco con la pgina del producto, acordamos poner 3 imgenes del producto, y que se le pueda hacer zoom a estas.\r\nPor ltimo realizamos la creacin de nuestra cuenta de Tik Tok asi logramos tener un mejor alcance.\r\n','2023-08-24'),(6792,288,'Clase 27','El da de la fecha avanzamos bastante nuestro proyecto, cada producto tiene su propio botn que nos redirige a su pgina respectiva, con sus fotos y lista para comprar. Agregamos fotos las cuales se puede zoomear, tambin ttulo del producto, una Font especial para cada producto, la cual arreglaremos ms tarde porque no funcionan, aunque la idea est. Tambin incluir la descripcin del producto, el botn para agregar al carrito que nos llevar a los mtodos de pago, tarjeta, efectivo, entre 