 rea tiene la pagina principal , Crear Proyecto y Asignar Nuevos Usuarios. Realice todas las vistas en figma , aunque quedamos en corregir una parte de RRHH.','2023-08-24'),(6795,292,'prototipado interfaces ','en el dia de la fecha ya que enzo haba avisado que no vena y no sabia como hacer el proyecto de generacin t, por lo que ya abordado previamente con enzo me puse a hacer los prototipos de los distintos casos de incidentes de la nuev interfaz de usuarios, la cual contaba con seleccionar previamente un tipo de incidentes y en ese caso al seleccionar uno de estos, te llevara a una interfaz ms detallada sobre el incidente que se seleccion. \r\n     para hacer esto cont con un poco de la ayuda de mi compaero Manuel Filippa el cual me brindaba una mano mientras investigaba cmo hacer una api, cosa que tena que hacer desde antes. pudimos avanzar bastante con las interfaces ya que pudimos terminar con: accidente vehicular,acoso, disturbio, accidente peatonal \r\n      adems de las que ya completamos nos estaran faltando unas cuantas mas, hacer estas 4 nos llev casi todo el dia y lo tendramos que terminar en otro momento \r\n','2023-08-24'),(6796,274,'Investigacin versionado de APIs, prueba de API','En el da de la fecha, lo primero que hice fue seguir investigando acerca de como versionar una API. Tras haber entrado a cuatro pginas distintas y a un par de videos en YouTube, pude saber cmo realizar esto. Para versionar una API, se deba de crear una carpeta con el nmero de la nueva versin y dentro colocar los los archivos con las modificaciones. Tambin se debe cambiar la direccin URL. Luego segu investigando que era una API, ya que segua sin comprender como funcionaban. Tras ver un par de videos, pude comprender como funcionaban. Una vez que entend esto, me asignaron la tarea de hacer la API del apartado de proyectos. Lo que hice fue mirar un video que ya haba visto antes, pero ahora con los conceptos un poco ms claros. Intent hacer lo que se haca en el video pero utilizando la base de datos del proyecto, pero me d cuenta de que no tendra sentido ya que todas las tablas estaban relacionadas entre s, mientras que yo necesitaba usar una sola. As que lo que hice fue realizar una prueba con una base de datos sencilla, en la cual se almacenan usuarios. Agregu cuatro usuarios y posteriormente hice un cdigo para que los muestre en el archivo index en formato .json. ','2023-08-24'),(6797,285,'Da 31 - Tamao Obelisco','Qu logr hacer hoy?\r\n\r\nHoy me enfoqu en mejorar el diseo de una pgina utilizando Figma. Pas tiempo ajustando detalles para hacer el diseo ms atractivo y funcional. Adems, tuve una sesin de estudio sobre React junto a mi compaera Victoria Laura. Ella comparti una serie de videos conmigo, donde un experto introduca a React y realizaba demostraciones avanzadas de esta tecnologa.\r\n\r\nEn qu se me complic?\r\n\r\nConfieso que enfrent ciertas dificultades mientras aprenda React. Aunque Victoria Laura y los videos me ayudaron mucho, algunos conceptos resultaron un poco desafiantes. Sin embargo, sigo adelante con determinacin para superar estos obstculos.\r\n\r\nQu estuve investigando?\r\n\r\nMi enfoque de investigacin se centr en React. Me sumerg en los videos proporcionados por Victoria Laura para entender mejor los fundamentos de React y cmo se aplica en el desarrollo web. Investigu sobre las ventajas y desafos de esta biblioteca JavaScript, y busqu recursos adicionales en lnea para ampliar mis conocimientos.','2023-08-24'),(6798,276,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Conexin - CSS','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- El da de hoy hoy hemos considerado arreglar algo en el cdigo de nuestra pagina de modo de que este sea algo mas limpio y dinmico, pues la mayora de los elementos ingresados dentro de la paina web estn definidas con styles en cada elemento lo que lo hace muy largo y algo complicado de entender. Por ende, hemos considerado empezar a pasar dichos estilos a un archivo CSS en el que podamos editarlo de manera mas tranquila y eso reduzca un poco el cdigo que puede llegar a tener una sola pestaa. \r\n- Dado con el tema anterior, hemos considerado implementar la Media Queries dentro de nuestra pagina para que esta pueda adaptar los elementos de la pagina web, sus tamaos y dems en base a los tipos de pantallas en los que se ve, pues podra causar problemas que se vea diferente en otras pantallas a la que acostumbramos en la PC.\r\n\r\nEso fue todo lo realizado el da de hoy. ','2023-08-24'),(6799,289,'Clase 24-08','El dia de hoy, yo comence a trabajar con la pagina web, o bueno eso era la idea. Luego comenzamos con tener que comenzar con el curso de React por el hecho de que debemos utilizarlo en la realizacin de la pagina web.\r\nProseguimos a instalar React, y luego nos vimos en que debiamos aprender a utilizar React de algun lado, asi que el profesor nos paso unos videos de react().Tuve unos problemas para que me funcionara el codigo pero al final pude arreglarlos.\r\nLuego comenze a seguir los videos, y eso fue todo por hoy muchas gracias.','2023-08-24'),(6800,295,'Pagina Web - Generacion T','El da de hoy el integrante de mi grupo que estaba a cargo del prototipado de la pagina web, nos pas a mi compaero y a mi el diseo de como lo tenamos que hacer, como tenia que quedar maso menos la pagina y empezamos a intentar hacer algo con la ayuda de Google para saber como instalar React, lo cual era con unas lineas de cdigo en el cmd y despus tenamos que crear la carpeta e importar los cdigos que necesitbamos de la librera de React que nos recomend un compaero de grupo la cual se llama &quot;MUI&quot;, pero se nos complic  un poco que nos funcione los cdigos que importbamos, ya que nos daba error y esperamos poder maana resolverlo.','2023-08-24'),(6801,295,'Pagina Web - Generacion T','El da de hoy el integrante de mi grupo que estaba a cargo del prototipado de la pagina web, nos pas a mi compaero y a mi el diseo de como lo tenamos que hacer, como tenia que quedar maso menos la pagina y empezamos a intentar hacer algo con la ayuda de Google para saber como instalar React, lo cual era con unas lineas de cdigo en el cmd y despus tenamos que crear la carpeta e importar los cdigos que necesitbamos de la librera de React que nos recomend un compaero de grupo la cual se llama &quot;MUI&quot;, pero se nos complic  un poco que nos funcione los cdigos que importbamos, ya que nos daba error y esperamos poder maana resolverlo.','2023-08-24'),(6802,293,'diagrama','Hoy da estuve revisando y corrigiendo todo los diagramas por razones de que hubo mucho cambios ltimamente se sigue trabajando en eso.\r\n ','2023-08-24'),(6803,293,'diagrama','Hoy da estuve revisando y corrigiendo todo los diagramas por razones de que hubo mucho cambios ltimamente se sigue trabajando en eso.\r\n ','2023-08-24'),(6804,298,'Clase 28','Hoy continue con la bdd de ingredientes, agregu categoras para cada uno de los ingredientes y tuve algunos problemitas haciendo todo eso, luego voy a continuar con la bdd de recetas y seguramente haga todo de cero. (Miedo)','2023-08-24'),(6805,283,'Gualmayen','Hoy pudimos dividir las tareas e iniciar a hacerlas para luego darlas por finalizadas. Cuando recien llegamos di una tarea a cada uno de mis compaeros de equipo. por ejemplo a maximo le di la tarea de seguir con la base de datos y ayudar a los otros dos integrgrantes del equipo (Victoria y Alan). A estos dos les di la tarea de seguir con la pagina pero el tema es que para codear la pagina necesitamos usar react. ninguno de ellos dos saben usarlo por lo cuall yo con maxi nos pusimos a ayudarlos con esto. Luego de descargarlo los chicos empezaron un curso de react. cuando estos terminen este curso van a poder empezar a codear la pagina. Luego otra integrante qeu se decidio a venir... cof cof carolina. le di la tarea de finalizar la base de datos. Solo que tiene una condicion, si esta no termina la base de datos en tiempo y forma, se la quitaremos y se lo pondremos a otra persona y ella terminara los diagramas que quedan por hacer. Luego de que cada uno este con su tarea y haciendola, Creamos la daily. Este dai fue muy productivo. ','2023-08-24'),(6806,299,'Hoy','Hoy ya terminamos el trabajo y estuvimos recuperando el tiempo perdido','2023-08-24'),(6807,287,'Proyecto PP Lus Shop: &quot;VicSon&quot; - Codificacin - Conexin - CSS','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- El da de hoy hoy hemos considerado arreglar algo en el cdigo de nuestra pagina de modo de que este sea algo mas limpio y dinmico, pues la mayora de los elementos ingresados dentro de la paina web estn definidas con styles en cada elemento lo que lo hace muy largo y algo complicado de entender. Por ende, hemos considerado empezar a pasar dichos estilos a un archivo CSS en el que podamos editarlo de manera mas tranquila y eso reduzca un poco el cdigo que puede llegar a tener una sola pestaa. \r\n- Dado con el tema anterior, hemos considerado implementar la Media Queries dentro de nuestra pagina para que esta pueda adaptar los elementos de la pagina web, sus tamaos y dems en base a los tipos de pantallas en los que se ve, pues podra causar problemas que se vea diferente en otras pantallas a la que acostumbramos en la PC.\r\n\r\nEso fue todo lo realizado el da de hoy. ','2023-08-24'),(6808,280,'','puse a ayudar a mis compaeros en la siguientes tareas:\r\nRealizando una guia y en paralelo un par de cursos sobre react para aplicarlo al proyecto para poder generar la interfaz interactiva y renderizada que nos puede proveer react. \r\nTambien investigamos sobre las librerias next.iu y mui.iu que las mismas aprendimos como instalarlas y el como funcionan las dependencias de cada una. El proceso de inclusion de codigo, aun esta en proceso.\r\nPor otra parte rediseamos una parte de nuestra bd para incluir la categoria de los ingredientes para hacer un filtro de busqueda mas unico.\r\nAl margen de todo esto la guia de react aun esta realizandose y se planea terminar en la proxima semana todo el contenido basico para poder tenerlo a mano','2023-08-24'),(6809,279,'Dia 24 del proyecto','estuve haciendo la daily de hoy mirando que hacian mis compaeros ademas de ayudarlos en darles ideas para los prototipados nuevos para cuando haces una denuncia o incidente.','2023-08-24'),(6810,277,'Vigesimo sexta clase','El da de hoy estuve avanzando con el proyecto de Generacin T, ya tenemos por suerte un boceto de las interfaces para las pginas. \r\nPrimero tenemos la de derechos humanos, ya sabemos que la pgina se divide en tres tipos distintos de cuentas que tienen acceso a distintas interfaces, RRHH tiene tres estados, el primero debe tener dos botones, uno para crear un usuario y otro para habilitarlos, la interfaz de crear usuario debe tener cuatro inputs, uno para el nombre, para el apellido, para el DNI y uno para el mail, adems de un botn para envar los datos a la base de datos. Por otro lado, la interfaz de habilitar usuarios debe ser una lista de todos los nombres y apellidos en vertical, acompaados por un botn que habilite o deshabilite las cuentas que se requieran.\r\n Adems de derechos humanos, tenemos las interfaces del jefe de rea, su pgina principal debe tener dos botones, uno para crear proyectos y otro para asignar usuarios a dichos proyectos. En la creacin de proyectos debe tener cuatro inputs, uno para el nombre, dos para la fecha de inicio y final y una descripcin, adems de un recuadro para buscar participantes del proyecto. La parte de asignar usuarios sirve para habilitar a los ya asignados y asignar nuevos, tiene que tener un input donde ingresar en nombre del proyecto y debajo un recuadro para buscar usuarios que asignar, adems de un botn para confirmar la accin.\r\nPor ahora lo que estuve haciendo es estudiar cmo utilizar React, estuve probando cosas por Visual Studio Code, cre una aplicacin de React mediante el comando npx create-react-app . que crea toda una carpeta con muchos elementos, y luego us el comando npm start para iniciar la simulacin en el puerto local 3000.\r\nDe ah estuve siguiendo un video tutorial de Youtube que me explic con mucho detalle cmo utilizar React de forma eficiente y sin problemas, me descargue una extensin llamada Simple React Snippets que sirve para facilitar la escritura de cdigo agregando palabras claves que escriben automticamente lneas de cdigo que se utilizan con frecuencia.\r\nTambin estuve intentando implementar NextUI, una librera de React que sirve para embellecer las pginas de manera rpida y accesible, resulta que de rpida y accesible no tiene mucho ya que instalarlo fue un completo reto, ms que no usarlo dira yo, pero mi jefe de rea me pidi que lo use y ahora tengo que intentar desasnar su uso. Descargu la librera mediante el comando npm i @nextui-org/react framer-motion, pero luego de eso hay que descargar otra librera llamada Tailwind que tiene su propio tutorial de descarga, usando el comando npm install -D tailwindcss se descarga lo esencial para luego crear un archivo llamado tailwind.config.js donde ira toda la configuracin de tailwind.\r\nTailwind, al ser una librera externa que se puede utilizar por su cuenta, tiene una configuracin predeterminada para estas situaciones, el problema es que NextUI utiliza su propia configuracin y yo no me di cuenta de esto hasta ms tarde, as que al principio reciba muchos errores sin entender la razn.\r\nLuego de configurarlo correctamente hay que aadir el NextUIProvider al root del programa, por lo que entend el root es la conexin entre el cdigo y lo visual, es el envo de lo que escribo al body de un archivo HTML para mostrarlo grficamente, el problema es que no se donde se encuentra este root y la pgina de NextUI no te dice cual es el nombre, estuve intentando distintas ideas pero ninguna funciono y todas terminaban en un error.\r\nPor eso, luego de un rato me rend y decid dejarlo para otro da, me dedique a aprender React normal y a probarlo un poco, tanto que llegue a hacer un contador mediante un botn a tiempo real, donde cada vez que apretabas el botn el contador suba y cuando le dabas al otro el contador bajaba.\r\n','2023-08-24'),(6811,296,'Bitacora 24','Hoy si empec la especificacin de caso de uso y pude terminarla y hice unos pequeos cambios en la DFD','2023-08-24'),(6812,273,'Clase N 30 - 24/08/23','En el da de la fecha me dispuse a realizar distintos tests en spring, con lo que pude experimentar el cmo usarlo aunque tuve problemas con la implementacin de hibernate.','2023-08-24'),(6813,294,'Comienzo de pagina - Generacin T','Hoy estuvimos junto a mi compaera principalmente con la parte del comienzo de la pagina web que vamos a utilizar en el protecto. Estuvimos esperando tambien , el prototipado rpido que realiz mi compaero para poder llevar a cabo o tener una idea incial de como hacer la misma. Mientras esperabamos, descargamos React con las librerias en la pestaa del cmd. Lo ultimo que hicimos fue sacar bootstrap de React en una pgina llamada MUI IU en Google para poder armar alguna interfaz en nuestra pgina. Cosa que no resulto porque nos daba errores en sentido a las credenciales.','2023-08-24'),(6814,275,'Caso de uso colaboracin y Secuencia ','Hoy nuevamente me designaron para hacer/rehacer los diagramas , en este caso hice los ya mencionados Caso de uso, colaboracin y Secuencia, el diagrama de caso de uso es el diagrama que nos puede mostrar las interacciones entre el cliente usuario y sistema, el diagrama de colaboracin es parecido a un diagrama de secuencia solo que este muestra la informacin de diferente forma,es el diagrama que como y en que orden todo lo que se hizo en el proyecto funciona en conjunto, lo que hice por el da de hoy fue revisar estos planos y ver cuales estaban hechos y terminados de manera correcta.   ','2023-08-24'),(6815,291,'24-08-2023','El da de hoy empeze la clase abriendo todo lo que tenia ya realizado para ver si tenia algn error y corregirlo, en el transcurso de la clase me la pase arreglando algunos errores que tenia, uno de ellos eran unas cards que servan para sostenes imgenes, el precio y el nombr del producto, el problema era que se estaban superponiendo uno con otro, despus de investigar un rato pude arreglarlo, otro de los problemas que arregle fue de para que no se desconfigurara la pagina al hacer zoom y para qu se adapte al telfono.','2023-08-24'),(6816,281,'Dia 25','El da de hoy realice algunas correcciones a la pgina de producto tales como incluir nuestra imagen del perrito en la parte de la pestaa y en la esquina de esta. \r\nAdems arregle el estilo de la letra de la pgina de los 2 productos que tenemos hechos por ahora, es ms que nada para tener un ejemplo de como hacerlo para nuestras siguientes implementaciones.\r\n Y por ltimo le saque un pequeo espacio a la imagen del producto ya que nos pareca bastante tosco.','2023-08-25'),(6817,288,'Clase 28','El da de hoy pudimos solucionar el tema de las Fonts, letras de League of Legends y Genshin Impact que implementamos el da de ayer. Tambin estuve investigando sobre cmo agregar el sistema de carrito, ya tenemos la idea y el archivo JS pero nos falta implementarlo en nuestro trabajo, entenderlo y poder adaptarlo a nuestra pgina web. Tambin solucionamos el problema que tenamos en el icono de nuestra pgina web, al tocar Agregar al Carrito, la misma no sala, ahora ya sale normalmente. La prxima clase intentar informarme mas sobre lo que es la implementacin del archivo JS y que funcione el Carrito, terminar de disear cada Agregar Al Carrito que nos redirija a cada producto individualmente. Tenemos un arduo y duro trabajo por delante, y daremos como equipo lo mejor de nosotros para poder tener el trabajo realizado lo antes posible, adjunto imgenes del trabajo realizado hoy.','2023-08-25'),(6818,277,'Vigsima sptima clase','El da de hoy estuve trabajando en React, volv a descargar los archivos requeridos y esta 