stafa, narcotrfico, robo, violencia de gnero y hurto.\r\n     Debatimos entre Manuel y yo qu debamos hacer y llegamos a la conclusin de que entradera, estafa y narcotrfico no valan la pena de hacer ya que no tenan mucho sentido. Con la entradera no tiene lgica porque lo ltimo que uno pensara en esa situacin sera enviar un reporte a BaVigila. Estafa tampoco ya que lo pensamos desde el lado de estafa virtual y no nos convenca. Y con narcotrfico  lo pensamos desde el lado de una casa tomada porque si ves a alguien vendiendo puede ser que nunca ms lo vuelvas a ver y dudo que alguien tenga una plantacin de drogas en el patio de su casa en capital.\r\n\r\n\r\n     Despus de decidir no hacer estas interfaces seguimos con la de robo, la cual no la hicimos en serio y la hicimos escribiendo estereotipos de ladrones en modo de chiste, mientras hacamos esto vino Enzo ya que lo habamos llamado hace un rato, primero hablo un poco con chirs ya que l estaba haciendo lo de generacin t y despus sigui con nosotros, le mostramos un poco las interfaces hechas ayer para ver que pensaba y dijo que algunas estaban mal ubicadas o no se vean bien a la vista, cosa que l va a corregir. Le dijimos que habamos decido no hacer algunas de las interfaces que le propuso y se enoj un poco ya que l crea que si son necesarias pero es algo que debemos debatir entre todos ms adelante cuando se desocupen con lo de generacin t.\r\n     Despus de que se fuera seguimos un poco con la interfaz de robos pero la pudimos completar ya que nos habamos quedado sin tiempo(voy a seguir con esta interfaz fuera del horario escolar) por lo que me puse a hacer la bitcora lo ms rpido que pude mientras seguamos tirando ideas de que completar en la interfaz de robo, pero estas cosas que bamos diciendo no las aplicaba en la interfaz que vamos haciendo en la pgina web de trello, sino que eran ideas en el aire de las cual nos tendramos que acordar en el momento que sigamos completndola.\r\n','2023-08-25'),(6823,278,'Clase N 32