e complic?\r\n\r\nEl principal obstculo que enfrent hoy fue al intentar establecer el fondo de la pgina inicial. La dificultad radicaba en la calidad de la imagen, que inicialmente era baja y tena problemas para mostrarse correctamente. Esta complicacin result de un error en la referencia del archivo CSS, que afect la forma en que se aplicaban los estilos. Sin embargo, despus de identificar el problema y corregir el nombre del archivo, logr resolver este problema.\r\n\r\nQu estuve investigando?\r\n\r\nA lo largo del da, dediqu tiempo a investigar sobre React, ya que todava estoy en proceso de comprender plenamente su funcionamiento. React es un rea en la que siento que necesito un poco ms de claridad. Investigu sobre sus conceptos fundamentales y cmo se integra con el desarrollo de pginas web. Busqu recursos en lnea, tutoriales y ejemplos para obtener una comprensin ms slida de cmo utilizar React de manera efectiva en mis proyectos futuros. Aunque es un poco desafiante en este momento, estoy seguro de que con ms investigacin y prctica, podr dominar React y aprovechar sus ventajas en mis proyectos de desarrollo.','2023-08-31'),(6860,298,'30','Hoy segui agregando recetas a la base de datos, ya tengo 30. Tengo hambre.','2023-08-31'),(6861,280,'','El dia de hoy segui haciendo la guia de react, esta vez enfocandome directamente en como se crean componentes y como entender algunos ya creados que te provee el mismo react la primera vez que creas el proyecto.','2023-08-31'),(6862,292,'interfaces de robo/sustancias/robo vehicular ','en el dia de la fecha en la correspondiente jornada de prcticas profesionalizantes comenc con enzo con algo que ya venamos hablando desde hace unas horas que era sobre el mapa de bavigila el cual l se haba predispuesto a organizar el cdigo para que sea mas de entender sin la necesidad de haber sido parte del proyecto o haber trabajado en el cdigo como lo hice yo.\r\n\r\n\r\n     al principio tuvimos unos problemas ya que enzo no poda encontrar el ultimo codigo que habia hecho y yo no se lo poda encontrara ya que no me encontraba con una computadora a mi alcance, todo esto fue antes de practicas cuando estbamos yendo para la escuela, ya en el aula de prcticas me llam para hacer anotaciones del cdigo para que sea ms fcil de entender \r\n(codigo de las anotaciones)\r\n     me llam varias veces mientras transcurra la jornada para que le vaya sacando las dudas que l tena en el cdigo ya que no entenda lo que haba hecho o lo que hacan algunas funciones. Hubo un cambio que hizo y fue que cambi el style del cdigo(que estaba en la parte de html) y lo movi a otra carpeta de style.css\r\n\r\n     mientras haca esto contine con los prototipos de las interfaces de los incidentes con mi compaero Manel Filippa el cual me ayudaba con la cosas que no saba y no entenda que poner, lo primero que hicimos fue la interfaz de narcotrfico, que ya que sonaba muy fuertesegn l y enzo, le cambiamos el nombre a sustancias ilcitas. Al principio estuve igual de trabado que la ltima clase ya que no entenda que deba poner y termine poniendo lo mismo que la ltima vez hasta que llamamos a enzo y nos dijo que busquemos tipos de narcotrfico(cosa que yo haca bsquedas parecidas pero no poda encontrar lo que buscaba )\r\n     en esa bsqueda pude encontrara esta imagen\r\n la cual nos deca las cosas que debamos poner(ya que yo especificaba cada una) asique nos ayud para darle una mirada ms general, una de las ideas de enzo fue poner todos los tipos de drogas e hice 3 como ejemplo pero no le termino convenciendo, ni a l ni a manu y a mi por lo que lo sacamos (la idea era poner un boton que desplegara todos los tipos de drogas pero lo descartamos ya que no encajaba muy bien y no tena mucho sentido)\r\n      Terminaremos poniendo las cosas como estn en la imagen casi exactamente como estn puestas, salvo unas cosas ya que en distribucion sacamos transformacin y ruta, que no tendran mucho sentido y sacamos en su totalidad capital circulante. para remplazar este ltimo agregamos compra y venta de drogas a travs de aplicaciones y desde el internet, pero no se nos ocurri mucho mas, por no decir nada\r\n\r\n    No solo hicimos sustancias ilcitas, sino que hoy fue un da bastante productivo en el que hicimos 4 interfaces, entre ellas\r\nsustancias ilcitas\r\nterminamos de una vez robo(que no me acordaba que estaba incompleta)\r\nrobo vehicular \r\n','2023-08-31'),(6863,279,'Dia 25 del Proyecto','En este dia estuve haciendo la daily siendo este un poco mas completa que las anteriores 2 semanas y bueno explique como fueron avanzando cada uno como ledesma y Manu con los prototipados o forte con el codigo.','2023-08-31'),(6864,296,'Bitcora 26','Hoy empec a hacer el diagrama de gannt y estuve usando proyect libre pero luego de ir avanzando me di cuenta que tenia muchos problemas al momento de organizar los horarios entonces un compaero me dijo que mejor busque en internet otra aplicacin,y al final lo termine haciendo en onlinegannt y lo termine','2023-08-31'),(6865,277,'Vigesima octava clase','El da de hoy estuve trabajando con React, logr hacer una pgina de login donde el usuario ingresa su nombre y contrasea. Primero estuve intentando usar NextUI pero sigo sin saber como instalarlo, as que por ahora tengo un prototipo del inicio de sesin hecho completamente en React.\r\nHice un formulario donde hay dos inputs, uno para el nombre y otro para la contrasea, adems de un h1 y un botn que dicen Iniciar Sesin. Al darle al botn se enva el formulario y se comprueba si tanto el usuario como la contrasea tienen algn carcter, si alguno est vaco aparece un mensaje de error que dice Todos los campos son obligatorios. Esto es gracias a un setState de error que se cambia de false a true cuando se detecta mediante un if.\r\nSi la contrasea y el usuario son correctos, o vlidos al menos, el setState de error se mantiene en falso y se oculta el forms para mostrar el componente home, en este hay un gran ttulo dando la bienvenida y el nombre del usuario. Debajo de todo hay un botn que sirve para volver al inicio de sesin el cual no se si va a estar en el proyecto final.\r\nCuando se da al botn del formulario, para iniciar sesin, los datos se guardan en una constante llamada user, si se detecta que la cantidad de caracteres de user es mayor a cero, entonces se esconde el componente de inicio de sesin y se muestra el de home. Cuando se le da al botn de volver al inicio, en el componente home, lo que hace es declarar la variable user como vaca, entonces el anterior if detecta que user no es mayor a cero y se vuelve a mostrar el componente del formulario.\r\nEsto, si bien funciona para demostrar un poco como sera la pgina final, no es ni seguro ni la manera correcta de hacer cuentas, pero es un buen comienzo, sobre todo teniendo en cuenta que recin estoy aprendiendo React y que todava no fui capaz de utilizar NextUI.\r\nMi prximo objetivo es lograr instalar Next UI y mejorar visualmente la pgina, ya que en parte los datos estn bien guardados, otra cosa es que tengo que traer un pendrive desde mi casa ya que por ahora mi forma de guardar el proyecto es comprimiendo en un rar y dejndolo en la nube, pero esto toma bastante tiempo en comprimirse y extraerse, entre ambos facilmente se me van dos horas, as que sera mucho ms rpido traerlo directamente de un disco externo o pendrive.\r\n','2023-08-31'),(6866,281,'Dia 26','El da de hoy estuvimos trabajando en varias cosas, primero aadimos un prototipo del carrito, modificamos las imgenes de cada producto, tambin cambiamos el botn de aadir al carro que nos mandaba a la pgina del producto, ahora este se registra en el prototipo del carrito, ms adelante vamos a querer que este se registre y despus cuando entres a la pgina de carrito.php veas los productos que ingresaste.. Y pusimos el enlace(href) a las pginas de cada producto en su imagen para que sea ms elegante y prctico a la hora de usar la pgina.','2023-08-31'),(6867,278,'Clase N 33 31/08/23','En el da de hoy hable con mi compaero Enzo Bartoletti y me comunico que tenia que realizar el prototipado rpido de la vista de Inicio de Sesin del proyecto de Generacin T. El login que realice como primero opcin , no gusto en el equipo, por lo tanto tuve que editarlo.El login consiste de un input de usuario , otro de contrasea , una opcin de &quot;Olvide mi contrasea&quot; y un botn de Ingresar, utilice colores violetas ya que fue lo que me indico Enzo. Eso fue todo lo que realice hoy.','2023-08-31'),(6868,288,'clase 29','El da de hoy logramos avanzar en varias etapas de la pgina web, aadimos un prototipo del carrito, modificamos las imgenes de cada producto, aunque an faltan por agregar. Agregamos un href a las imgenes de las card para que nos redirija a el producto en ms detalle, y pronto pondremos un botn en el apartado carrito para que nos lleve a la pgina carrito.php y ah se agreguen los productos que deseemos comprar, aparecer el mtodo de pago, su envo, o ir a buscarlo, y listo! realizamos gran parte del trabajo de hoy con nuestro mayor esfuerzo y concentracin, la prxima clase planeamos terminar todo el diseo de la pagina web, y empezar a esforzarnos mas por el JS y lograr terminarlo de la mejor manera posible.','2023-08-31'),(6869,293,'Avance diagramas','hoy da contine con los diagramas que se estn cambiando diariamente por que no esta bien definidos.','2023-08-31'),(6870,286,'Breve continuacin sobre Denuncias de BaVigila 3 y Ayuda con Proyecto de Streambe','En el da de la fecha me sent junto a mi compaero Ezequiel Ledesma para continuar con los prototipos de las interfaces de los incidentes de BaVigila. Con Ezequiel nos ayudbamos mutuamente para hacer la interfaces nuevas o cambiar las anteriores, lo primero que hicimos fue la interfaz de &quot;Narcotrfico&quot;, que ya que sonaba muy fuerte segn Ezequiel y el Scrum Master Enzo Bartoletti, por lo que decidimos cambiar el nombre a &quot;Sustancias Ilcitas&quot;. Al principio estuve igual de trabado que la ltima clase ya que no entenda que deba poner y termine poniendo lo mismo que la ltima vez hasta que llamamos a Enzo y nos dijo que busquemos tipos de narcotrfico (cosa que yo haca bsquedas parecidas pero no poda encontrar lo que buscaba).\r\nDurante la bsqueda encontramos una imagen que describa perfectamente lo que buscbamos, por lo que nos ayud para darle una mirada ms general, una de las ideas de Enzo fue poner todos los tipos de drogas y coloqu 3 como ejemplo pero no terminamos convencidos por lo que lo sacamos (la idea era poner un botn que desplegara todos los tipos de drogas pero lo descartamos ya que no encajaba muy bien y no tena mucho sentido).\r\nTerminaremos poniendo las cosas casi como estn en la imagen, salvo unas cosas ya que en distribucin sacamos transformacin y ruta, que no tendran mucho sentido y sacamos en su totalidad capital circulante. Para remplazar este ltimo agregamos compra y venta de drogas a travs de aplicaciones y desde el internet, pero no se nos ocurri mucho mas, por no decir nada. Tambin ayud a mi compaero Christian Forte a realizar una tarea del curo de Streambe, debido a que en su computadora no lo poda solucionar.','2023-08-31'),(6871,276,'Proyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos logrado aplicar el Media Queries a varias de las pestaas de nuestra pagina web. Por un lado le hemos aplicado eso a las pestaas de Inicio y todas las demas pestaas relacionadas a las secciones donde se muestran todos los productos disponibles en nuestra pagina web, ya sea la seccion de lenceria, medias, etc (pues esas pestaas en especial tienen el mismo diseo, por lo que aplica un solo archivo css para todas ellas), de este modo alternamos por estilos y en base a la resolucion de la pantalla en la que se muestre nuestra pagina web, se adapta con estilos que pueden ser interpretados para dicha pantalla y asi evitar el desorden de los elementos. Esto mismo se lo aplicamos a la pestaa de producto con estilos diferentes, y tambien estamos intentando hacer lo mismo con la pestaa del Carrito de compras. \r\n- Por otro lado, hemos realizado algunos rediseos a algunos elementos en nuestra pagina, de modo que tenga un estilo mas agradable, lindo y dinamico en si. \r\n\r\nEso fue todo lo realizado el da de hoy.','2023-08-31'),(6872,275,'documentacin y css','Pues en el da de la fecha de hoy me dedique mas que nada a ver como estaban los diagramas, mas que nada la documentacin del diagrama de caso de uso y tambin ver como estaba el estado de la pagina web, cabe recalcar  que desde hace unos das me estoy recuperando de una gripe que tuve, as que no estoy al 100% de mis capacidades, pues bueno el da de hoy revise el estado de la pagina web que estuvimos haciendo, esta prcticamente en un estado optimo, casi terminado puesto que es capaz de hacer las funciones de una pagina de compra y venta de ropa, asi que la mayora de cosas que hicimos con la pagina son mas que nada cosas estticas, como cambiar las imgenes de productos que usamos, modificar el tamao o color de algunas partes de la pagina entre otras cosas, aparte de esto estuve viendo la documentacin del diagrama de caso de uso, esta seria maso menos la documentacin, esto se hace para especificar la comunicacin y el comportamiento de un sistema, todo esto dividindolo en acciones del sistema y acciones del actor.','2023-08-31'),(6873,287,'Proyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos logrado aplicar el Media Queries a varias de las pestaas de nuestra pagina web. Por un lado le hemos aplicado eso a las pestaas de Inicio y todas las demas pestaas relacionadas a las secciones donde se muestran todos los productos disponibles en nuestra pagina web, ya sea la seccion de lenceria, medias, etc (pues esas pestaas en especial tienen el mismo diseo, por lo que aplica un solo archivo css para todas ellas), de este modo alternamos por estilos y en base a la resolucion de la pantalla en la que se muestre nuestra pagina web, se adapta con estilos que pueden ser interpretados para dicha pantalla y asi evitar el desorden de los elementos. Esto mismo se lo aplicamos a la pestaa de producto con estilos diferentes, y tambien estamos intentando hacer lo mismo con la pestaa del Carrito de compras. \r\n- Por otro lado, hemos realizado algunos rediseos a algunos elementos en nuestra pagina, de modo que tenga un estilo mas agradable, lindo y dinamico en si. \r\n\r\nEso fue todo lo realizado el da de hoy.','2023-08-31'),(6874,294,'Avance con pagina web React','En el dia de hoy con mi compaera nos experimentamos un poco mas en el mbito del lenguaje React y avanzamos colocando un NavBar donde su origen fue en una pagina web de Google y tambien colocamos el fondo de la pagina que respecta a Generacin T. Nos costo un poco ya que tuvimos que corregir varios errores pero logramos modificar los valores por defecto que contenia dicho nav. ','2023-08-31'),(6875,289,'Clase 31-08','El dia de hoy, continuamos con la pagina.Comence con hacer algo a la barra de menu, por la razn que ciro el scrum deseaba que el icon de menu al no estar desplegado\r\neste en el centro. En ese instante pedi ayuda a chat gpt(en nada ayudo porque hacia lo que queria), como sea, al final me ayudo el profesor Olaso, gracias.\r\nLuego cambie algunos detalles, y por ultimo empece a hacer una seccin de comentarios que mostrara la imagen de quien hizo el comentario, y el respectivo comentario.\r\nEso es todo por hoy,muchas gracias.\r\n','2023-08-31'),(6876,295,'Seguimiento de Pagina Web - React ','Hoy con mi compaero seguimos lo que sera la pagina que venimos trabajando con el lenguaje React. Logramos colocar un fondo de pantalla que corresponde a Generacin T. Y tambien pudimos colocar un navbar sacado de una pagina de google, lo modificamos y pusimos lo requerido para la pgina. Logramos tambien corregir errores del mismo.','2023-08-31'),(6877,273,'Clase 32 - 31/08/23','Hoy llegu a la escuela y tena que realizar algunas correcciones sobre la API de Spring, que especificamente tena que tocar en la parte de la entidad de Logs (bitacoras). Lo resolv haciendo una funcin en userService que busca en la base de datos los registros que tengan el dni que yo quiero. Luego, empec a realizar el mapeo de las entidades que faltan en la base de datos.','2023-08-31'),(6878,294,'Problema con la localizacin de los archivos','En el da de la fecha con mi compaera tuvimos un gravsimo problema con los archivos que conformaban nuestra pagina hecha con React que seguimos ayer. Buscamos todo el tiempo la carpeta en el drive y resulta que encontramos una llamada igual pero con las modificaciones del 25/9 que no tenan casi nada de progreso. Con este problema no pudimos avanzar ni realizar nada sobre la pagina. Hoy no fue un da productivo.','2023-09-01'),(6879,295,'Pagina Generacin T - Problema','El da de hoy tuvimos un problema con mi compaero, ya que al intentar abrir el trabajo que hicimos ayer en clase, nos dimos cuenta de que no estaba una carpeta que era la fundamental en el proyecto, intentamos buscar esa carpeta en drive, la cual es la plataforma en la que guardamos los trabajos pero no pudimos encontrar esa carpeta. No pudimos solucionar ese problema ni intentar hacerlo otra vez debido a la falta de tiempo.','2023-09-01'),(6880,285,'Da 33 - hibridoo','Qu logr hacer hoy?\r\n\r\nHoy me enfoqu en el desarrollo de la pgina web desde casa. A pesar de las dificultades, logr avanzar en la creacin de la pgina. Inicialmente, trabaj en el diseo, pero no qued satisfecho con los resultados y tuve que rehacerlo. A pesar de las complicaciones, logr realizar un progreso significativo en el desarrollo.\r\n\r\nEn qu se me complic?\r\n\r\nSe me complic bastante la comunicacin con mis compaeros, ya que estamos trabajando desde casa y no pudimos tener interaccin directa. Esto