mejor a los estilos de pantallas diferentes que se puedan llegar a presentar y evitar que lo elementos que se encuentren dentro se superpongan uno encima del otro, aunque aun queda implementarlo de mejor forma para que se adapte de mejor manera. \r\n- Por otro lado, hoy hemos realizado un par de inserts extras para nuestra pagina web de modo de que ya podamos incluir mas producto dentro de nuestra pagina web y as darle un poco mas de pruebas a la misma, pues hasta el momento nicamente contbamos con 6 productos, por lo que empezar a implementar mas inserts dentro de nuestra base de datos nos sera mejor. \r\n- Tambin por otro lado, hemos investigado un poco sobre como implementar una API para poder realizar transacciones y recibimientos de plata desde la pagina web, habiendo optado por implementar ello con la API de &quot;Cuenta Digital&quot;, pero eso sera implementado mas adelante dentro de nuestro proyecto.\r\n\r\nEso fue todo lo realizado el da de hoy.','2023-09-01'),(6886,298,'Clase 31','Hoy empezamos las clases desde casa, me dedique a continuar con la base de datos de las recetas pero no pude hacer mucho, ya que mis compaeros me pidieron que agregara 15 recetas mas. Cuando terminen con la pagina voy a seguir agregando mas recetas, adems de los comentarios de las mismas.','2023-09-01'),(6887,282,'Modelo hibrido practicas profesionalizantes','Durante el da de hoy recurrimos a un nuevo tipo de modalidad para practicas profesionalizantes, la cual consista en realizar las tareas desde nuestras casas. Por lo cual divid los puntos del da y los asign a mis compaeros, dejando a Pedro y Federico en el rea del login y a Luciano, Geraldine y Christian en el rea de proyectos','2023-09-01'),(6888,287,'Proyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS - Base de Datos','\r\nEl da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos aplicado mas de las Media Queries, esta vez en la pestaa del carrito de compra para que esta se pueda adaptar mejor a los estilos de pantallas diferentes que se puedan llegar a presentar y evitar que lo elementos que se encuentren dentro se superpongan uno encima del otro, aunque aun queda implementarlo de mejor forma para que se adapte de mejor manera. \r\n- Por otro lado, hoy hemos realizado un par de inserts extras para nuestra pagina web de modo de que ya podamos incluir mas producto dentro de nuestra pagina web y as darle un poco mas de pruebas a la misma, pues hasta el momento nicamente contbamos con 6 productos, por lo que empezar a implementar mas inserts dentro de nuestra base de datos nos sera mejor. \r\n- Tambin por otro lado, hemos investigado un poco sobre como implementar una API para poder realizar transacciones y recibimientos de plata desde la pagina web, habiendo optado por implementar ello con la API de &quot;Cuenta Digital&quot;, pero eso sera implementado mas adelante dentro de nuestro proyecto.\r\n\r\nEso fue todo lo realizado el da de hoy.','2023-09-01'),(6889,277,'Vigesima novena clase','El da de hoy segu trabajando con React, hoy fue un da especial ya que tuvimos clases virtuales, as que trabaj desde mi casa.\r\nAproveche que me encuentro en un lugar ms tranquilo y con el que me encuentro ms cmodo para ver tutoriales en lnea de cmo utilizar React con NextUI, tambin estuve intentando descargar los programas necesarios en mi computadora por si en un futuro necesito adelantar algo en mi casa.\r\nLogre descargar React como tal pero no pude hacer funcionar NextJS. De todas formas si que estuve aprendiendo bastante el funcionamiento de este ltimo mediante tutoriales y algo de prctica.\r\n','2023-09-01'),(6890,293,'Diagramas','Hoy da eh continuado con los diagramas para que pronto esten finalizados.','2023-09-01'),(6891,292,'interfaz de hurto y violencia de genero ','en el dia de la fehca era nuestra primera clase con modalidad virtual, por ende desde nuestra cas debamos unirnos a un determinado meet para practicas profesionalizant