con su tarea.','2023-09-01'),(6895,274,'Desarrollo de API de proyectos','En el da de la fecha, lo que hice fue continuar con el desarrollo de la API de proyectos desde mi hogar. Inicialic el proyecto, instal express y continu con lo que vena haciendo ayer. Cre un archivo js dentro de la carpeta \'routes\' en el cual cre un objeto \'router\' y defin cinco endpoints: uno para obtener todos los proyectos (get), para obtener un proyecto en especfico (get), para crear un nuevo proyecto (post), modificar un proyecto (patch) y eliminar un proyecto (delete). Despus cre un archivo js en la carpeta \'controllers\', dentro del cual copi las funciones que haba escrito previamente en routes para que quede mejor organizado. Estas funciones fueron llamadas desde el archivo js de routes. Por ltimo, pegu la base de datos y escrib las funciones necesarias para capturar sus datos en un nuevo archivo js dentro de la carpeta \'services\'. Adems elimin el archivo index.js en el cual se mostraba un texto.','2023-09-01'),(6896,275,'Clases virtuales','En la jornada de hoy, vivimos una experiencia educativa nueva en nuestro colegio. Nos sumergimos en el mundo de la enseanza virtual, gracias a la implementacin de un novedoso enfoque educativo conocido como &quot;clases hbridas&quot;. Este mtodo me hizo acordar a cierta poca que odie/ame: la cuarentena del ao 2020, cuando nuestras vidas se trasladaron al mbito digital.\r\nNuestro encuentro tuvo lugar en un entorno virtual, a travs de la plataforma de videoconferencia Google Meet. En este encuentro virtual, nuestro profesor Damian Olaso (y tambin Nahuel que apareci para saludar) desempe un papel esencial, guindonos en esta aventura educativa que apenas comenzaba. Nos comparti las metas y objetivos de aprendizaje que nos esperaban en esta jornada nica.\r\n\r\nLas similitudes con la cuarentena anterior eran notables. Navegamos por las pantallas de nuestros dispositivos, conectndonos de manera remota para adquirir conocimientos. El docente, haciendo uso de herramientas digitales y su habilidad docente, nos introdujo en el contenido del da, marcando el comienzo de una experiencia educativa singular.\r\n\r\nEn mi da, me dediqu a seguir con el proyecto. Me concentr en la elaboracin y actualizacin de diagramas, especficamente, en la revisin y ajuste de fechas en el diagrama Gantt, detallando el inicio y finalizacin de cada fase del proyecto. Luego, continu donde lo dej ayer, avanzando en la documentacin del diagrama de caso de uso.\r\n','2023-09-01'),(6897,255,'martes 5 / 9','hoy arreglamos la pagina web de pana','2023-09-05'),(6898,261,'05/09/2023','Hoy trabaje con la aplicacion del robot sumo','2023-09-05'),(6899,263,'5/9','Comienza septiembre y tengo que seguir trabajando con el personaje y hacer capaz algunos agregados que me pueden servir para el mapa del colegio.','2023-09-05'),(6900,250,'Martes 5/9','Hoy arregle la barra superior de la pagina con flexbox uwuwuwuuwuwuwuuwwwwwwwwwwwwwwwu no.','2023-09-05'),(6901,267,'05/09/2023','Hoy empezamos a hacer una aplicacin para android que puede controlar el robot, contando con los modos de Automatico o Manual.','2023-09-05'),(6902,265,'05-09-2023','Hoy ayude a mi compaero a hacer la aplicacin web para controlar al robot ','2023-09-05'),(6903,268,'10/05/2023','Hoy trabaje con la aplicacion del robot sumo','2023-09-05'),(6904,257,'5/9/2023','hoy no pudimos hacer mucho, perdimos mucho tiempo descargando el proyecto en la compu y guardandolo en la memoria de mi telefono','2023-09-05'),(6905,260,'','Organizacion de ramas y carpetas en el repositorio','2023-09-05'),(6906,251,'BeCation - Generacin T pt7 - 05/09/2023','El da de hoy corregimos junto a Dylan errores en los endpoints de la API, ya que todas las funcionalidades ya fueron creadas.','2023-09-05'),(6907,262,'05-09-2023','El dia de hoy comenc con el codeo de la vista de configuracion de perfil','2023-09-05'),(6908,266,'Hoy estuvimos testeando','Hoy con nicolas estuvimos testeando toda la api, corriguiendo errores