09-06'),(6926,278,'Clase N 34 07/09/23','En el da de hoy me toco realizar el manual de usuario del proyecto de gestin de bitcoras. Fue la primera vez que realice uno , ya que , nunca haba hecho , sinceramente me gusto realizar esta tarea. El manual consta de un titulo , un indice con las 7 vistas que tiene la API. Para explicar cada vista coloque el prototipado rpido y abajo una screenshot de cada botn/campo continuada de una descripcin de que realiza cada uno de ellos.','2023-09-07'),(6927,279,'Dia 27 del Proyecto','En este da estuve mayormente ayudando con los otros chicos con el tema de los prototipados aunque al principio pens que seguiran con la generacin t aunque si un poco hicieron pero se pusieron mas las pilas con cambiar y adaptar los prototipados ademas de darle un estilo mas fresco que los que tenamos antes.','2023-09-07'),(6928,283,'wili rompio tdo y x su culpa casi morimos','El dia de hoy delegue tareas y cambie muchas cosas del figma y maana seguire con lo mismo para poder terminar el figma. ','2023-09-07'),(6929,273,'Clase 33 - 07/09/23','Hoy estuve realizando unas correcciones a la base de datos, borrando algunas tablas que no eran de mucha utilidad. Luego, estuve aadiendo algunos campos, tales como uno de email en string y otro de fecha - hora (creacion de la cuenta) hecho en timestamp. Todo esto lo aadi al controlador de Usuario y agregu ms al controlador de bitacora, donde aad la cantidad de horas que realiz el usuario a la base de datos.','2023-09-07'),(6930,285,'Da 34','Qu logr hacer hoy?\r\n\r\nHoy continu con el desarrollo de la pgina web. Para empezar, decid desechar la pgina que haba creado previamente en casa, ya que no era adecuada para nuestras necesidades. En su lugar, comenc a trabajar en una nueva pgina desde cero.\r\n\r\nEn esta nueva pgina, implement un sistema de inicio de sesin y registro. Adems, aad una animacin que hace que el formulario rote, alternando entre las opciones de registro y inicio de sesin de manera visualmente atractiva.\r\n\r\nAunque tuve algunos problemas al intentar incorporar la barra que Vicky haba creado, finalmente logr solucionarlos mediante ajustes en el cdigo CSS.\r\n\r\nUn detalle interesante del da es que las computadoras de mis compaeros fueron reseteadas, lo que result en la prdida de todos sus progresos en el proyecto, pero yo no tuve ningn problema en ese sentido!\r\n\r\nEn qu se me complic?\r\n\r\nMi principal complicacin surgi al intentar integrar la barra creada por Vicky en la pgina. Requiri un poco de trabajo extra con el CSS para que encajara perfectamente en el diseo general de la pgina. Sin embargo, con paciencia y algunos ajustes, pude resolver este problema satisfactoriamente.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, mi enfoque estuvo principalmente en el desarrollo prctico de la pgina web. No hubo necesidad de realizar investigaciones extensas, ya que estaba trabajando en la implementacin de funcionalidades concretas. La mayor parte de mi tiempo lo invert en escribir y depurar cdigo HTML, CSS y JavaScript para lograr el efecto de rotacin en el formulario de inicio de sesin y registro, as como para integrar la barra de Vicky de manera adecuada.','2023-09-07'),(6931,298,'Clase 32','Hoy lo mismo, segui agregando recetas a la bdd, voy cuarentaypico en total.','2023-09-07'),(6932,282,'Generacion T, GS1 Y BaVigila','Hoy durante la maana trabaj en GS1 con el OUT de Cencosud y durante la tarde con los proyectos tanto de Generacion T y BaVigila, realizando prototipados y asignando tareas','2023-09-07'),(6933,293,'Inser en la base de datos','hoy me dedique a continuar con los insert que faltaban hacer pero aun se sigue trabajando en eso.\r\n','2023-09-07'),(6934,296,'Bitcora 28','Termine de hacer el diccionario de datos y me dijeron que tena que agregar una tareas ms al Gantt y modificar ms fechas de unas tareas y los integrantes ','2023-09-07'),(6935,289,'07-09','El dia de hoy, seguimos con la pagina. Arregle el inicio, ademas de ponerle estrellas a las parte de comentario. Pero de mada sirvio, porque se apagaron las compus, eso es todo por hoy, muchas gracias.','2023-09-07'),(6936,276,'vProyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS - BDD','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos configurado la barra de bsqueda para que esta pueda por fin ser funcional, de modo que al ingresar alguna palabra en esta, pueda buscar las coincidencias en base a distintos campos. Bsicamente cada barra de bsqueda te dirige a una pagina llamada &quot;busqueda.php&quot;, la cual, al recibir un dato dentro del campo del buscador, se redirige al usuario a esta pestaa en la cual se ejecuta un cdigo el cual utiliza los caracteres dados en el campo del buscador para buscar coincidencias dentro de los mbitos de &quot;nombre del producto, marca, ID o tipo de producto&quot;, y si las encuentra, genera cards con todas las coincidencias encontradas. En caso de no encontrar coincidencias, se generara una card indicando que no se han encontrado coincidencias para la bsqueda realizada. \r\n- Tambin hemos aplicado los Media Queries a esta pestaa y configurado un par mas de diseos para otras pestaas. \r\n- Por otro lado, hemos realizado mas inserts dentro de la base de datos para asi tener un par mas de productos dentro de nuestra pagina web. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-09-07'),(6937,288,'Clase 30','El da de hoy, agregu cada parte de producto, todos las imagenes con su respectivo titulo, agregu un gif de Pochita, la cual queda perfectamente bien y mejor. Tambien solucione el tema de HREF de las imagenes, cada una te manda a su pagina de su producto, y en agregar al carrito se agrega al carrito, proximamente necesitaremos conectar la base de datos con lo que seria el PHP para que el producto de la base de datos se vea refllejado en el carrito.','2023-09-07'),(6938,287,'Proyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS - BDD','\r\nEl da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos configurado la barra de bsqueda para que esta pueda por fin ser funcional, de modo que al ingresar alguna palabra en esta, pueda buscar las coincidencias en base a distintos campos. Bsicamente cada barra de bsqueda te dirige a una pagina llamada &quot;busqueda.php&quot;, la cual, al recibir un dato dentro del campo del buscador, se redirige al usuario a esta pestaa en la cual se ejecuta un cdigo el cual utiliza los caracteres dados en el campo del buscador para buscar coincidencias dentro de los mbitos de &quot;nombre del producto, marca, ID o tipo de producto&quot;, y si las encuentra, genera cards con todas las coincidencias encontradas. En caso de no encontrar coincidencias, se generara una card indicando que no se han encontrado coincidencias para la bsqueda realizada. \r\n- Tambin hemos aplicado los Media Queries a esta pestaa y configurado un par mas de diseos para otras pestaas. \r\n- Por otro lado, hemos realizado mas inserts dentro de la base de datos para asi tener un par mas de productos dentro de nuestra pagina web. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-09-07'),(6939,286,'Breve continuacin sobre Denuncias de BaVigila 4','El da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. Con mi compaero de trabajo Ezequiel Ledesma nos dimos cuenta que todas las interfaces para las denuncias de BaVigila ya estaban hechas hasta que Enzo Bartoletti (nuestro Scrum Master) nos hizo dudar de si estbamos en lo cierto, por lo que abr la pgina &quot;Figma&quot; que es donde estuvimos haciendo todos los diagramas hasta el momento. Al rato revis, mientras esperaba que Enzo me mandara la interfaz principal, que l haba hecho para todos los tipos de incidentes. Despus de que nos mandara la interfaz principal notamos que nos faltaba hacer la interfaz de &quot;Violencia de Gnero&quot;, por lo tanto nos pusimos a trabajar en ella de inmediato. Con mi compaero nos pusimos a buscar en Google los distintos tipos de violencia de gnero. En la pgina que encontramos veamos los distintos tipos de violencia hasta que llegamos a la parte de &quot;Violencia Sexual&quot; entonces se nos ocurri agregar en otro apartado dentro del mismo formulario la seccin de &quot;Violencia Sexual&quot;, por lo que terminamos poniendo solo dos indicaciones debido a que algunas secciones no eran tan relevantes. Adems, grab un video para el perfil de Instagram de BaVigila, en donde se vea a mi grupo de trabajo trabajando. Antes de terminar tuvimos que seguir con el Pop-up del botn de emergencia, el cual permitir al usuario hacer una llamada de emergencia. Adems de dicho botn, estuve debatiendo con mis compaeros sobre cmo mejorar el aspecto de la interfaz general, el cual se le termin haciendo un cambio esttico, el cul fue agregarle sombras para darle un aspecto ms profesional.','2023-09-07'),(6940,275,'facturacin , diagrama de colaboracin','Para empezar el da de hoy, lo que hicimos fue tener una pequea conversacin para revisar lo que necesitamos completar en el proyecto. Principalmente, nos enfocaremos en la parte de facturacin. Con Kevin, estbamos considerando la posibilidad de utilizar una API para la pgina, aunque el profesor tambin mencion que podramos optar por un sistema de correos electrnicos u otra alternativa. Adems, me encargu de continuar trabajando en el diagrama de casos de uso, su documentacin y el diagrama de colaboracin.','2023-09-07'),(6941,288,'clase 31','Hoy ha sido un da en el que me he centrado en mejorar la experiencia de nuestros usuarios en nuestro sitio web. Uno de los cambios que he implementado con mucho entusiasmo ha sido la actualizacin de las imgenes para uno de nuestros productos estrella, el producto 1, destacando especialmente a la adorable Pochita.\r\n\r\nA pesar de que pueda parecer una tarea pequea, esta actualizacin de imgenes tiene un impacto significativo en la percepcin de nuestros productos por parte de los clientes. La eleccin de imgenes de alta calidad y atractivas puede marcar la diferencia en trminos de atractivo visual y atraer la atencin de los visitantes del sitio. Adems, al dar un toque fresco a nuestro producto 1 con la imagen de Pochita, no solo mantenemos a nuestros clientes actuales interesados, sino que tambin abrimos la puerta a nuevos clientes que puedan sentirse atrados por esta adicin.\r\n\r\nCada pequeo cambio que hacemos en nuestro sitio web es una oportunidad para mejorar y perfeccionar la experiencia de compra de nuestros usuarios. Aunque hoy solo me he enfocado en este ajuste en particular, este es solo uno de los muchos pasos que estamos tomando para garantizar que nuestro sitio web siga siendo atractivo y funcional. Estoy emocionado por las futuras mejoras que vendrn, y estoy seguro de que nuestros clientes apreciarn la atencin al detalle y el esfuerzo constante que ponemos en ofrecerles la mejor experiencia posible.','2023-09-08'),(6942,280,'','El dia de hoy se organizo las estructura de las carpetas en el proyecto, ya que se tenia un orden convencional que no permitia una buena visibilidad.\r\nSe actualizo la guia de react agregando contenidos nuevos de next js.\r\nEl dia de hoy en cuestin de la app en next.js, hubo problemas con la instalacin automtica ya que muchos de los paquetes no se podian instalar por el proxy de las computadoras de la escuela. El problema se pudo solucionar instalando manualmente los paquetes, algunos a travs del comando npm y otros incluyndolos en el archivo de package.json encontrado en la app de react creada anteriormente','2023-09-08'),(6943,279,'Dia 28 del Trabajo Practico','En este da estuve haciendo la daily como siempre ademas de que se hizo una Reunin de grupo que se hablo de posibles problemas que si se expande habra problemas que no habra en otros pases o provincias mas bien ademas de como nos organizaramos si esto lo haces de verdad y lucramos de este trabajo y no mucho mas.','2023-09-08'),(6944,283,'tdo mal con el login','El dia de hoy continuamos el figma y ayude a lana con su pagina de mierda de login que hizo pero el dice que no la hizo y le re cabe','2023-09-08'),(6945,298,'Clase 33','hoy no pude hacer mucho porque se me estuvo colgando la computadora, la clase que viene empiezo a actualizar los diagramas.','2023-09-08'),(6946,274,'APIs de proyecto','En el dia de la fecha lo que hice fue volver a escribir el cdigo que haba perdido el da de ayer debido al repentino reinicio de los ordenadores del establecimiento. Pero antes de esto, nos reunimos los integrantes de BAVigila para definir la manera en la que dividiramos las ganancias en caso de obtener las mismas. Tambin hablamos acerca de temas relacionados a la publicidad del proyecto. Una vez que termin de escribir el cdigo como lo haba dejado ayer, empec a programar la parte de la creacin de un proyecto desde el archivo projectControllers.JS. Esto lo hice utilizanod un condicional if para comprobar que hayan datos dentro de cada campo del proyecto.','2023-09-08'),(6947,296,'Bitcora 29','Hoy segu haciendo cambios en el Gantt y tambin ayude a un compaero con el tema de react para hacer el login de empleados ','2023-09-08'),(6948,278,'Clase N35 08/09/23','En el da de hoy mi compaero Enzo Bartolleti me propuso cambiar algunos colores de los prototipados rpidos que haba realizado la semana pasada , as que me puse con eso. Cambie las vistas de Inicio de Sesin y de Habilitar Usuarios del rea de Recursos Humanos. En el prototipado rpido antiguo la paleta de colores era rosa pastel con celeste ( similar al de la pagina oficial de Generacin T).En la nueva modificacin que realice hoy la paleta de colores es un violeta oscuro en degrade , acompaado de un rosa mas oscuro.Para el equipo queda mas esttico , si no hay ningn error , ya seria la forma definitiva.','2023-09-08'),(6949,286,'Discusin sobre el futuro de BaVigila','El da de la fecha comenz normalmente, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. Para empezar, decid junto a mi compaero Ezequiel Ledesma, seguir puliendo las imperfecciones de las interfaces hechas en los das anteriores, ya que debamos aplicarlas del prototipado a la pgina real.\r\nAl rato, nos llam Enzo Bartoletti (nuestro Scrum Master) para discutir unos temas relacionados a BaVigila: El principal era relacionados a los stickers que habamos pensado en comprar unos meses atrs que por falta de tiempo no hicimos.\r\nOtro de los temas era la idea propuesta por Enzo era comprarnos un porcentaje a cada uno del proyecto para compensar el gasto de los stickers. Mientras discuta este tema con mis compaeros,  me acord que una conocida hace stickers por lo que quedamos en que le hable y no comprar las de mercado libre.\r\nOtra idea de Enzo era la de vender nuestro proyecto por comunas y adaptarlo a estas.\r\nLa ltima idea era la de repartir las ganancias en caso de vender el proyecto, hacer un 50% para invertir el proyecto y el otro 50% para los integrantes, sino, 60% para nosotros y 40% para el proyecto. \r\n','2023-09-08'),(6950,299,'Hoy ','Hoy laburamos como nunca','2023-09-08'),(6951,293,'insert','hoy da contine con el insert pero con otra categora que el de ayer hice de boxers y se sigue trabajando en eso ya que no esta completa','2023-09-08'),(6952,273,'Clase 34 - 08/09/2023','En el da de hoy tuve que realizar nuevamente las clases que se haban perdido ayer por el reinicio de maquinas. Posteriormente, empec a hacer uso de modelos y vistas a travs de una clase de Spring, y tambin empec a usar Thymeleaf para visualizar los datos por archivos html.','2023-09-08'),(6953,285,'Da 35 - el scrum master esd un bobiiiinnnnn','Qu logr hacer hoy?\r\n\r\nHoy me dediqu a programar un elemento de verificacin (checkmark), aunque debo admitir que me cost un poco. A pesar de los desafos, logr avanzar en esta tarea, aunque todava necesito hacer algunos ajustes para que quede perfecto.\r\n\r\nEn qu se me complic?\r\n\r\nLa mayor complicacin del da fue la dificultad que enfrent al programar el checkmark. Requera un esfuerzo adicional para que funcione correctamente, y eso me tom ms tiempo del esperado. Adems, me encontr con la tarea de modificar la pgina web para satisfacer las preferencias del Scrum Master, lo cual, aunque no fue un obstculo importante, s aadi una carga extra de trabajo.\r\n\r\nQu estuve investigando?\r\n\r\nDurante el da, investigu principalmente sobre cmo programar y mejorar la funcionalidad del checkmark en la pgina web. Tambin investigu sobre las prcticas recomendadas para ajustar la pgina web segn las preferencias del Scrum Master. Aunque no mencion explcitamente la investigacin, estuve buscando informacin en lnea y recursos que me ayudaran a superar estos desafos tcnicos y de colaboracin.','2023-09-08'),(6954,276,'Proyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS - BDD','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos configurando algunos aspectos dentro de la Pagina web, tales como los Media Queries que seguimos implementando para as poder adaptar los elementos a las distintas resoluciones.\r\n- Por otro lado, consideramos el poder implementar el envi de Mails o Correos Electrnicos desde nuestra pagina web, pues, em primer lugar, tenemos pensado configurar un apartado para que, de ser necesario, un usuario pueda recuperar su contrasea en caso de haberla olvidado y a este mismo se le envi un mail y dems para que pueda recuperar o cambiar su contrasea, y en segundo lugar, hemos planteado reemplazar los pasos de compra por un envi de mail al administrador de la pagina con los elementos comprados y el monto a pagar de dicha compra, pero eso lo estaremos viendo mas adelante. \r\n- Por otro lado, seguimos realizando mas inserts dentro de la base de datos para tener mas productos. \r\n\r\nEso fue todo lo realizado por hoy.','2023-09-08'),(6955,277,'Trigesima primera clase','El dia de hoy estuve trabajando en React, sigo en la creacion de login para el proyecto de generacion T, estuve creando la aplicacion con nextJS y nextUI, instalando las cosas necesarias para su utilizacion en mi pendrive, asi la proxima vez que tenga que trabajar no tarde tanto en descargar el archivo y ya tenerlo guardado en un disco externo.','2023-09-08'),(6956,292,'charla sobre porcentajes de bavigila ','al llegar a la clase de hoy encendimos las computadoras para seguir puliendo las imperfecciones de las interfaces hechas en los das anteriores realizadas en figma,   ya que debamos aplicarlas del prototipado a la pgina real.\r\n    mientras esperbamos a que las computadoras encendieran nos llamo enzo para discutir unos temas relacionados a bavigila, el principal era relacionados a los stickers que habamos dicho de comprar unos meses atras y por falta de tiempo no lo hicimos, esto representa un gasto que si bien no es muy grande al menos a mi me costaria. por lo que la idea de Enzo era comprarnos un porcentaje a cada uno del proyecto para compensar el gasto de los stickers, cosa que rechace. \r\n     mientras decidiamos esto manuel se acord que una conocida suya hace sticker por lo que quedamos en que le hable y no comprar las que habas dicho de mercado libre.\r\n      otra idea de enzo era vender nuestro proyecto por comunas y adaptarlo a estas en caso de que las compre alguien que trabaje en ellas.\r\n','2023-09-08'),(6957,287,'Proyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS - BDD ','\r\nEl da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos configurando algunos aspectos dentro de la Pagina web, tales como los Media Queries que seguimos implementadno para asi poder adaptar los elementos a las distintas resoluciones.\r\n- Por otro lado, consideramos el poder implementar el envio de Mails o Correos Electronicos desde nuestra pagina web, pues, em primer lugar, tenemos pensado configurar un apartado para que, de ser necesario, un usuario pueda recuperar su contrasea en caso de haberla olvidado y a este mismo se le envie un mail y demas para que pueda recuperar o cambiar su contrasea, y en segundo lugar, hemos pplanteado reemplazar los pasos de compra por un envio de mail al administrador de la pagina con los elementos comprados y el monto a pagar de dicha compra, pero eso lo estaremos viendo mas adelante. \r\n- Por otro lado, seguimos realizando mas inserts dentro de la base de datos para tener mas productos. \r\n\r\nEso fue todo lo realizado por hoy.','2023-09-08'),(6958,282,'','Hoy fue un da complejo en practicas, arribando a las 15:40 a Practicas y juntando a mis compaeros de BaVigila para proponerles realizar una inversin y comprar los stickers propuestos en vacaciones a costo de un porcentaje de sus acciones en el proyecto. Ademas, agregu a Escobar a la realizacin del frontend ya que me lo pidi y considero que puede ser un aporte a cumplir los tiempos del proyecto.','2023-09-08'),(6959,294,'Vuelta a proyecto principal','En el dia de hoy entramos un poco tarde y nos decidimos con mi compaera volver a nuestro principal donde veniamos realizando  alrededor del ao, ya que habiamos perdido el trabajo donde estuvimos avanzando y el contenido se hacia muy denso.','2023-09-08'),(6960,295,'Charla con el grupo ','En el dia de la fecha con mi compaero decidimos dejar de lado el proyecto aparte de generacion T y darnos de baja. era lo mejor para todos ya que habiamos perdido nuestro trabajo y aparte nuestro equipo del proyecto anual nos necesitaba, asi que volvimos al proyecto de las recetas.','2023-09-08'),(6961,290,'Vigesimanovena','Despus de mucho tiempo olvidndome de hacer las bitcoras, volvi para hacer la bitacora del dia de hoy, en el dia de la fecha lo que hice fue basicamente terminar un documento que me llevo practicamente 1 semana y media, el cual tenia que hacer un diagrama explicando un largo proceso de altas.','2023-09-12'),(6962,258,'12-09','hoy vi un par de vieos y intente solucionar el problema de lag','2023-09-12'),(6963,271,'12/9/2023','En el da de hoy avance un poco con el cdigo para que me devuelva la respuesta correcta','2023-09-12'),(6964,251,'BeCation - Generacin T pt9 - 12/09/2023','El da de hoy cre los mtodos GET y el mtodo ADD de VacationService en el Frontend','2023-09-12'),(6965,257,'12/09/2023','Hoy al cargar perdimos algo de progreso, pero avance lo perdido y agregu 2 aulas ','2023-09-12'),(6966,263,'12/9','Hoy pude resolver el problema de los huesos que no se movian de manera independiente pero queda algunos temas sobre la animacion, pero igual es un gran avance.','2023-09-12'),(6967,261,'12/09/2023','Hoy cambie app de app inventor del robot controller y descargue la app para probarla ','2023-09-12'),(6968,260,'','Termin todo el responsive del calendar, y segu con el redireccionamiento aunque no lo pude terminar por que tuve conflictos con el hook useNavigate','2023-09-12'),(6969,268,'12-09-2023','El dia de hoy areglamos la app para manejar el robot y vimos como instalarla en el celular.','2023-09-12'),(6970,266,'Jornada de unificacion ','En la jornada de hoy estuve un poqutio por todos los secotres, backend, frontend y documentacion y estuve ayudando a completar las tareas.','2023-09-12'),(6971,250,'martes 12/9/2023','Hoy estuve corrigiendo las flexbox de toda la pagina principal sacando fotos para la carpeta de campo ','2023-09-12'),(6972,265,'12-09-2023','Hoy ayude a mo compaero a cambiar algunas cosas en app inventor y luego trate de descargar e instalar la aplicacin','2023-09-12'),(6973,252,'Clase 43 - Documentacin Terminado','Documentacin de todos los endpoints con Swagger finalmente terminado','2023-09-12'),(6974,262,'12/9/2023','El da de hoy realice el css de lo que seria la configuracion de perfil junto a una funcion handle que guarde los nuevos datos ingresados','2023-09-12'),(6975,282,'Gs1','Durante hoy trabaj virtualmente para GS1, siguiendo con la realizacin de recortes para Censocud en los meses de Marzo, Mayo y Junio y quedando pendiente a terminar en el da de maana.','2023-09-12'),(6976,303,'12-09-2023','Hoy seguimos con el codigo para la funcionalidad del juego.','2023-09-12'),(6977,297,'13/09/23','Realizamos salida didctica al encuentro de ADA 13 por el da del programador. ','2023-09-13'),(6978,254,'13/09/23','realizamos salida didctica por el da del programador a ADA 13. ','2023-09-13'),(6979,282,'Gs1','En el da de hoy me present de manera presencial en las oficinas de GS1, avanzando y finalizando el OUT de Cencosud respectivo a los meses 3,4 y 6. Una vez finalizado, nos juntamos con la totalidad del grupo de trazabilidad para analizar el documento en busca de errores. \r\nMientras tanto, en el tiempo restante, estudi con vistas a un examen previso para la proxima semana y para el cual creo an no estar capacitado, usando aproximadamente 1 hora y media de mi tiempo de oficina para esto.','2023-09-13'),(6980,266,'Salida didctica - da del programador','Hoy fuimos al evento ADA13 por el da del programador, tuvimos un montn de charlas y stands muy copadas, tambin hubo work shops y duelo de codigo, me lleve un par de premios y de nuevas herramientas ','2023-09-13'),(6981,252,'Clase 44 - ADA 13','Hoy fuimos al evento de ADA 13 por el da del programador. Participe en una trivia y me gan una remera de donweb. Tuvimos varias charlas en las que participaron el pelado nerd, mouredev, hola mundo, dalto, etc.','2023-09-13'),(6982,253,'Mercoles 13/09/2023 - ADA 13','Hoy fuimos al evento ADA 13 de Lucas Dalto (Soy Dalto). Estuvimos todo el da.','2023-09-13'),(6983,257,'13/09/2023','Hoy hicimos la excursin y fuimos a ada13, en la usina del arte','2023-09-13'),(6984,258,'13-09-2023','hoy fuimos a la usina del arte por el dia del programador','2023-09-13'),(6985,262,'13/9/2023','El da de hoy fuimos de excursion con todo el salon a la Usina del Arte al evento ADA 13 del gran programador y desarollador conocido Lucas Dalto en conjunto a DonWeb. Vimos varios programadores y desarolles y tambien hubo desafios de solucion de problemas a travez del lenguaje que manejamos','2023-09-13'),(6986,267,'13/09/2023','El da de hoy visitamos la Usina del arte, disfrut mucho las charlas y retos propuestos. Feli da!','2023-09-13'),(6987,256,'ADA 13','Hoy fuimos al evento de ADA 13 en la usina, hubo algunos juegos y competencias en los entre tiempos de cada charla.','2023-09-13'),(6988,255,'miercoles 13 9 2023','hoy fuimos de excursion al evento ADA13, por el da del programador. ','2023-09-13'),(6989,261,'13/09/2023','hoy fui ADA 13 en usina del arte por el da del programador','2023-09-13'),(6990,268,'13/09/2023','El dia de hoy fui a la Usina del arte para el evento delel da del programador llamado ADA 13.','2023-09-13'),(6991,251,'Excursin a ADA 13 - 13/09/2023','El da de hoy asistimos a la Usina del Arte para festejar el da del programador en ADA 13. Feliz da!\r\nTambin gan un duelo de cdigo usando Python desde el celular. Consista en sumar los nmeros pares e impares del 1 al 30 e imprimir ambas sumas. ','2023-09-13'),(6992,303,'13-09-2023','Hoy tuvimos la salida didctica al evento ada 13 por el da del programador.En el cual asistieron varios programadores conocidos y tambin los mismo dieron charlas.A la vez hubo &quot;juegos&quot; o eventos, como por ejemplo &quot;los duelos de codigos&quot;.','2023-09-13'),(6993,263,'13/9','Hoy fui a un evento de programacion en donde se encontraban muchos influencers sobre el tema, ademas hoy era el dia del programador','2023-09-13'),(6994,282,'Gs1','En el da de hoy me suministraron mediante la plataforma de Skype un nuevo documento, referente a la cadena de supermercados COTO, teniendo que hacer tareas exactamente iguales a las realizadas con Cencosud pero en una mayor extensin, abarcando del mes de Enero al mes de Julio todo dentro del mismo archivo','2023-09-14'),(6995,282,'Trabajos varios','Hoy trabaj en aspectos varios, delegando tareas de Generacin T a Lescano, Escobar, Forte y Estrigarribia. Posteriormente hablamos sobre las posibilidades de BaVigila y creamos un host remoto para nuestra landing page en NO-IP, una pgina gratuita.\r\nTambien analizamos las estadisticas de el reel subido a las 15 horas. siendo que cumpli con las expectativas, ya llegando a mas de 150 visualizaciones.','2023-09-15'),(6996,292,'pagina web','En el dia de la fecha en la primera y nica jornada de prcticas prefesionalizantes ya que debido a que los profesores tuvieron una capacitacin el da de ayer no tuvimos. al llegar a clases no tena pensado hacer mucho ya que tena que hacer un resumen para otra materia por lo que arranque con eso, mientras escriba le dije a manu que arrancara a hacer la nueva interfaz principal de la pgina web. Pero hubo un inconveniente ya que los prototipados que habamos hecho eran para la versin Mobile y no para la web, por lo que lo llamamos a enzo y mientras esperbamos que viniera para decirle el problema que tenamos hable un poco con manu sobre como podramos solucionar esto. Le probamos el problema y se mostr un poco desconcertado y lo que nos dijo que hagamos fue hacer un prototipado de la pgina web y ah fue cuando me puse a pleno a hacer el resumen de la otra materia. Al rato lo vi a manu mientras trabajaba con la pgina web e iba quedando bastante bien el problema es que hoy tampoco me acorde de subir la versin final del mapa que esta en la computadora de mi casa y por ende manu trabaj con una versin vieja e incompleta.','2023-09-15'),(6997,278,'Clase N36 15/09/23','En el da de hoy segu modificando los prototipados rpidos , primero cambie la vista de Crear Proyecto , lo nico que realice en esta fue cambiar el color del fondo a un degrade de violeta a uno mas oscuro. Tambin cambie el header y el footer ponindole un degrade rosado.En cuanto a la vista de Crear Usuario modifique todo el diseo del formulario ademas del fondo al igual que la vista anterior. Para el formulario coloque un contenedor de color blanco y dentro del mismo puse los campos del formulario acompaado con un botn , degradado igual que el fondo. Tambin agregue en el footer y el header un border de color rosa pastel.','2023-09-15'),(6998,285,'Da 36','Qu logr hacer hoy?\r\n\r\nHoy, logr avanzar en dos aspectos clave de nuestro proyecto. En primer lugar, finalic la pgina de inicio de sesin y registro. Est completamente funcional y lista para su revisin por parte del Scrum Master. Estar en ese estado hasta que se realicen cambios o ajustes segn las necesidades del equipo o hasta que se decida realizar modificaciones estticas.\r\n\r\nDespus de completar esa tarea, me dediqu a mejorar visualmente la pgina de recetas. Aunque an no la he terminado por completo, he realizado importantes mejoras visuales que incluyen la adicin de un apartado de estrellas para calificar recetas, la posibilidad de dejar comentarios y una organizacin ms clara de la informacin.\r\n\r\nEn qu se me complic?\r\n\r\nAfortunadamente, hoy no enfrent complicaciones significativas. El trabajo en la pgina de inicio de sesin y registro transcurri sin problemas, y las mejoras en la pgina de recetas fueron bien recibidas por el Scrum Master.\r\n\r\nQu estuve investigando?\r\n\r\nMi enfoque de investigacin hoy estuvo en la mejora visual de la pgina de recetas. Investigu tcnicas de diseo web para hacer que la pgina sea ms atractiva y funcional, como la implementacin de sistemas de calificacin con estrellas y la incorporacin de comentarios. Tambin explor estrategias para organizar el contenido de manera ms efectiva, lo que incluye dividir la informacin en secciones claras y accesibles.','2023-09-15'),(6999,286,'Continuacin de Pgina Administradores de BaVigila','El da de la fecha comenz normalmente pero con la diferencia de que el da anterior no tuve clases, por lo que perd un poco de tiempo, abr todas las aplicaciones que iba a usar, inici sesin en mis cuentas, descargu los archivos necesarios y me puse a trabajar. Empec teniendo una pequea charla con mi Scrum Master y con mi compaero Ezequiel Ledesma sobre la pgina de Usuarios de BaVigila, con Ezequiel tenamos la duda sobre cmo aplicar los prototipados que estuvimos haciendo las clases anteriores en el formulario desplegable, con lo que Enzo Bartoletti (el Scrum Master) respondi dicindome que deje esta tarea para ms tarde, ya que tendramos que plantearlo y disearlo bien, entonces propuse la idea de continuar con las ventanas desplegables que usarn los asministradores para insertar, modificar y/o eliminar reportes. Tambin se me ocurri agregar el mapa debajo de toda la interfaz, ya que con ello los administradores tendrn un acceso fcil y una visin rpida de la ubicacin donde se hacen los reportes, por lo que coloqu in &lt;iframe&gt; y apareci el mapa. Ms tarde, para hacer que los datos que los administradores ingresen desde el botn &quot;Ingresar&quot; se guarden en la Base de Datos, tuve que poner todos los input que se encuentran dentro del botn desplegable dentro de un form, abajo de todo, poner un botn tipo &quot;submit&quot; y tuve que hacer un nuevo archivo .php donde escribir mas tarde todas las funciones. Lamentablemente me qued sin tiempo, por lo que no pude hacer un gran avance, pero seguir la clase que viene.','2023-09-15'),(7000,293,'insert','hoy da me dedique a continuar con los insert que anteriormente estaba asiendo para que la pagina no este vaca de productos se sigue trabajando en eso','2023-09-15'),(7001,274,'Desarrollo de API de proyectos','En el dia de la fecha continu con el desarrollo de la API. Dentro del archivo &quot;projectController.js&quot; cre una funcin la cual llama a la ruta que sirve para actualizar un proyecto y se le pasan ciertos argumentos. Tambin enva una respuesta. Luego cre un nuevo archivo llamado &quot;utils.js&quot; dentro de la carpeta &quot;database&quot;. Dentro de este archivo import el lector de archivos de sistemas y una funcin que permite modificar el archivo que contiene la base de datos (.JSON).','2023-09-15'),(7002,279,'Dia 29 del Proyecto ','En el dia de hoy segui haciendo las dailys como siempre contando como siguieron trabajando los integrantes del proyecto.','2023-09-15'),(7003,283,'ni compro con hablar con mujeres. como me enseo mi novia B)',' El dia de hoy volvimos a dividir tareas y luego nos pusimos cada uno con sus tareas., igualmente la mayoria estudio para una prueba que tenemos en la siguiente hora que es de jujan mc lovin.\r\nPero alan y victoria laura siguieron la pagina. Luego nos falta ponerle el react y ya estaria. \r\n','2023-09-15'),(7004,296,'Bitcora 30','Hoy segui realizando cambios al Gantt aunque tuve muchos inconvenientes con la PC porque se trab varias veces y tuve que reiniciarla ms de una vez','2023-09-15'),(7005,273,'Clase 35 - 15-09-2023','En el da de hoy llegu al establecimiento y mediante el uso de Thymeleaf en html gracias a las dependencias que instal en java pude hacer un login. Primero, tuve que hacer una pgina nueva donde se registraran los usuarios, recibiendo los campos deseados y finalmente en el login indique que se debera logear mediante email y una contrasea. En la funcin del login, el parmetro password se convierte a un hash y luego se compara con la versin que se encuentra en la base de datos. Si este da true, dveuelve la informacin del usuario, y si da false no devuelve nada.','2023-09-15'),(7006,277,'Trigesima segunda clase','El da de hoy tuve varias dificultades a la hora de trabajar en el proyecto, sigo avanzando en la pgina de Generacin T y hoy me tocaba comenzar de una vez por todas con el login, utilice el pendrive que consegu la semana pasada para guardar la pgina y la abr con Visual Studio Code. Mientras vea un video para guiarme del uso de NextUI y React, la computadora se congel y dej de responder, tanto as que me vi obligado a reiniciarla forzosamente mediante el botn de apagado.\r\nPor suerte no perd mucho progreso pero si perdi mucho tiempo, esto se repitio varias veces durante el dia, en total cinco veces se me congelo la computadora y lo unico que logre avanzar fue la navbar de la pgina, esta es de color purpura y tan solo dice iniciar sesion.\r\n','2023-09-15'),(7007,276,'Proyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS - BDD ','El da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos realizando inserts dentro de nuestra base de datos para asi poder tener mas productos dentro de nuestra pagina web. Por otro lado, hemos considerado empezar a hashear los campos de contrasea que entran dentro de nuestra base de datos para asi poder tener un poco mas de seguridad en el manejo de las contraseas y asi evitar filtraciones de contraseas. \r\n- Por otro lado, estuvimos configurando un poco y practicando el envi de mails desde nuestra pagina web, que aunque aun no la hemos probado pero ya hemos hecho las extensiones con phpMailer de modo que esta pueda ser funcional, solo queda implementarla un poco y asi podremos despues configurar la pestaa de &quot;Recuperar Contrasea&quot; de modo que podamos enviarle un correo a la persona a la que se le olvido la contrasea. Aunque aun deberemos crear una forma de configurar esta pestaa pero lo veremos mas adelante. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-09-15'),(7008,289,'15/09','El da de hoy contine con la pagina web del proyecto, eso es todo por hoy muchas gracias!','2023-09-15'),(7009,287,'Proyecto PP Lus Shop VicSon - Codificacin - Conexin - CSS - BDD ','\r\nEl da de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos realizando inserts dentro de nuestra base de datos para asi poder tener mas productos dentro de nuestra pagina web. Por otro lado, hemos considerado empezar a hashear los campos de contrasea que entran dentro de nuestra base de datos para asi poder tener un poco mas de seguridad en el manejo de las contraseas y asi evitar filtraciones de contraseas. \r\n- Por otro lado, estuvimos configurando un poco y practicando el envi de mails desde nuestra pagina web, que aunque aun no la hemos probado pero ya hemos hecho las extensiones con phpMailer de modo que esta pueda ser funcional, solo queda implementarla un poco y asi podremos despues configurar la pestaa de &quot;Recuperar Contrasea&quot; de modo que podamos enviarle un correo a la persona a la que se le olvido la contrasea. Aunque aun deberemos crear una forma de configurar esta pestaa pero lo veremos mas adelante. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-09-15'),(7010,294,'Comienzo de React del proyecto del principio','En el da de hoy nuestra compaera del grupo inicial nos envi el prototipado rpido que hizo el grupo para poder realizar la pgina que respecta a las recetas, siempre necesitando React, lo cual no lo haban hecho todava. Entonces hoy empezamos la pagina pasando el codigo de html a lenguaje React con mi compaera.','2023-09-15'),(7011,295,'React con proyecto inicial','En el dia de hoy empezamos de nuevo con el proyecto inicial que veniamos recorriendo todo el ao. Con mi compaero iniciamos con la pagina web fabricada en React, lo que tuvimos que hacer fue pedirle el prototipado rapido hecho por mis otros compaeros. Pasamos todo lo hecho en html anteriormente y lo pasamos a React.\r\n\r\n\r\n\r\n','2023-09-15'),(7012,282,'Tareas GS1','Hoy trabaj para la empresa GS1 Argentina desde la virtualidad de mi casa, avanzando en la realizacin del nuevo archivo para COTO correspondiente a los meses 1, 2, 3, 4, 5, 6 y 7 del ao 2023. Progresando en parte sustancial del segundo mes, finalizando su conversin de pesos y sus envases. Siendo que en dicho momento descubr que los envases totales de todos los meses a completar era de tan solo 380, proponindome para el da de hoy realizar esos envases para finalizarlos dentro del archivo, teniendo que hacer solo marcas y recortes.\r\nAl finalizar el da me quedaron pendientes alrededor de 50 para realizar en el da de maana.','2023-09-19'),(7013,258,'19-09','hoy vi video sobre como hacer una cinematica en unity (feno termina la escuela por dios)','2023-09-19'),(7014,262,'19/9/2023','El dia de hoy me encarge de hacer la funcion para que mientras toque el logo se muestre la seccion deseada a realizar cambios y guardarlos y definir detalles de la vista de configuracion de perfil','2023-09-19'),(7015,261,'19/09/2023','El da de hoy instalamos el ultimaker cura para mejorar en los tiempos de impresin de los diseos 3d.','2023-09-19'),(7016,257,'19/09/2023','hoy avance con el colegio, perdi un poco de progreso pero lo recupere y ya empece el diseo del primer piso','2023-09-19'),(7017,263,'19/9','Hoy por tonto no pude hacer mucho porque me olvide de subir la ultima actualizacion que le di a mi personaje en la pc de mi casa, la proxima voy a subirlo a la nube.','2023-09-19'),(7018,270,'19/09/23','el dia de hoy, consultando con chatgpt, probamos algunas opciones de codigo para este problema que estamos teniendo con comprobar la respuesta seleccionada por el jugador, pero sin exito(al final del da se me ocurrieron algunas ideas para intentar el proximo dia).','2023-09-19'),(7019,268,'19-09-2023','El da de hoy instalamos el ultimaker cura para mejorar en los tiempos de impresin de los diseos 3d.','2023-09-19'),(7020,260,'','Termin la vista del calendario de RRHH para visualizar las vacaciones pedidad y con el fetch a las vacaciones','2023-09-19'),(7021,250,'Martes 19/9/2023','hoy estuve completando la carpeta de campo y explicando sobre la practica en javaScript y como fui diseando y comprendiendo el codigo escrito en la practica de javaScript','2023-09-19'),(7022,267,'19-09-2023','El da de hoy instalamos el ultimaker cura para mejorar en los tiempos de impresin de los diseos 3d.','2023-09-19'),(7023,265,'19-09-2023','Hoy estuve tratando el programa para saber un tiempo estimado de cuanto tardara mi impresin ','2023-09-19'),(7024,259,'Martes 12 - Miercoles 13 - Martes 19 Nahuel Moreno Practicas Profesionalizantes','martes 12/9:\r\nEste dia me busque e informe viendo videos acerca de libreras de Interfaz q no sean Tkinter, mientras revisaba un poco el Backend\r\n\r\nMircoles 13:\r\nTuvimos la excursin a Ada 13 en la Usina del Arte, un evento bastante entretenido\r\n\r\nHoy, Martes 19:\r\nContine mi carpeta de campo','2023-09-19'),(7025,251,'BeCation - Generacin T pt10 - 19/09/2023','El da de hoy hicimos debugging del cdigo frontend con Dylan y resolvimos un error al agregar las vacaciones. Tambin ayud a la profesora Belen Tyavelosky con su cdigo que tenia un problema al intentar conseguir campos de una bdd.','2023-09-19'),(7026,255,'Martes 19/9/2023','Hoy estuve retome mi redaccin de lo que hice en el ao dentro de la carpeta de campo.','2023-09-19'),(7027,266,'Me dedique a terminar la funcionalidad de agregar vacaciones','En el dia de hoy termine las funcionalidades para agregar las vacaciones, anda todo, incluso le puse un modal alerta','2023-09-19'),(7028,253,'Mircoles 19/09/2023 - Register','Hoy continu con la vista de register con React.','2023-09-19'),(7029,252,'Clase 45 - Swagger terminado y funcionando','El da de hoy termin finalmente con la documentacin de Swagger y funciona correctamente desde Swagger Ui. Adems, al agregsr una vacacion por ejemplo, si vas a la pestaa del calendario de vacaciones, se puede ver como se cre la nueva vacacin, tambin funciona al editarla y eliminarla','2023-09-19'),(7030,271,'19/9/2023','El dia 13-9-2023, olvide hacer mi bitacora sobre la salida a Usina del arte.\r\nCon respecto al dia de hoy, probamos el codigo que chat gpt me habia propuesto como solucion el dia 12-9-23, pero finalmente no nos funciono, y aun seguimos buscando la solucion a este problema.','2023-09-19'),(7031,282,'Nuevas tareas en GS1','Hoy fue un dia distinto el cual lo disfrut mas de lo habitual. Al llegar, 20 minutos anticipadamente, empec a realizar las tareas propias del OUT de COTO. Pero al llegar Tomas y Rocio me pidieron hablar y me comentaron acerca de si estaba dispuesto a capacitar e integrar a mis tareas a Tobias, oficiando como algo similar a un jefe para l. Esto se deba a que las tareas de su sector estaban finalizadas y no tenian nada para darle, por lo que vieron coherente que yo le asigne tareas, dandole como primer punto la conversin de 1000 contenidos netos a Kilogramos, lo cual realiz satisfactoriamente en aproximadamente 30 minutos de trabajo bajo mi atenta mirada. Tras esto, a pesar de que no se me fu solicitado, lo capacite en la realizacin de recortes de marcas y le di los datos del mes de marzo para que realice sus recortes. Al ver que era capaz y podra ayudarme mas, directamente le d dos meses mas para que realice recortes y marcas manuales, logrando que l haga cerca de 50 recortes tiles para mi trabajo, previa validacin por mi parte respecto a los datos ingresados.\r\nUna problematica que surgi durante el da fue que los GTIN al usar CSV delimitado por comas se transformaron a exadecimales y se rompieron, dejando de ser los correctos y debiendo ser reemplazados. Yo plantee integrar un BUSCARV para asignar los GTIN a las descripciones, pero Tomas piensa (correctamente) que la mejor decisin es aplicar un BUSCARV entre los GTIN y la columna idproducto, la cual es nica.','2023-09-20'),(7032,282,'Nuevas tareas en GS1','Hoy fue un dia distinto el cual lo disfrut mas de lo habitual. Al llegar, 20 minutos anticipadamente, empec a realizar las tareas propias del OUT de COTO. Pero al llegar Tomas y Rocio me pidieron hablar y me comentaron acerca de si estaba dispuesto a capacitar e integrar a mis tareas a Tobias, oficiando como algo similar a un jefe para l. Esto se deba a que las tareas de su sector estaban finalizadas y no tenian nada para darle, por lo que vieron coherente que yo le asigne tareas, dandole como primer punto la conversin de 1000 contenidos netos a Kilogramos, lo cual realiz satisfactoriamente en aproximadamente 30 minutos de trabajo bajo mi atenta mirada. Tras esto, a pesar de que no se me fu solicitado, lo capacite en la realizacin de recortes de marcas y le di los datos del mes de marzo para que realice sus recortes. Al ver que era capaz y podra ayudarme mas, directamente le d dos meses mas para que realice recortes y marcas manuales, logrando que l haga cerca de 50 recortes tiles para mi trabajo, previa validacin por mi parte respecto a los datos ingresados.\r\nUna problematica que surgi durante el da fue que los GTIN al usar CSV delimitado por comas se transformaron a exadecimales y se rompieron, dejando de ser los correctos y debiendo ser reemplazados. Yo plantee integrar un BUSCARV para asignar los GTIN a las descripciones, pero Tomas piensa (correctamente) que la mejor decisin es aplicar un BUSCARV entre los GTIN y la columna idproducto, la cual es nica.','2023-09-20'),(7033,270,'20/9/23','el dia de hoy continuamos intentando el codigo de verificacion de respuesta correcta en C# con algunas ideas nuevas e intentando recurrir a chatgpt pero no logramos que funcione.','2023-09-20'),(7034,251,'BeCation - Generacin T pt11 - 20/09/2023','El da de hoy nos reunimos todo el grupo de desarrollo de BeCation para definir que vistas tenamos que crear, cmo hacerlas y cmo repartirnos el trabajo. Tras algunos dibujos, nos dividimos las pginas y se me asigno trabajar con la vista VacationManagerCalendar.','2023-09-20'),(7035,261,'20/09/2023','Hoy hice un nuevo diseo 3d en tinkerkat del robot sumo','2023-09-20'),(7036,267,'20/09/2023','El da de hoy trabaje con el modelado 3D, empezando uno nuevo y corrigiendo los errores y aadiendo mejoras del que ya imprimimos','2023-09-20'),(7037,268,'20-09-2023','El dia de hoy despues de descargar el programa de ayer empese con un nuevo diseo 3d para el robot sumo y para el auto.','2023-09-20'),(7038,259,'miercoles 20/9 Nahuel Moreno Practicas Profesionalizantes','Contine con mi carpeta de campo igual que ayer, y ya planifique lo que hare la clase siguiente EN CASO DE AUN NO HABER LLEGADO A LAS 150 HOJAS de carpeta de campo.\r\n','2023-09-20'),(7039,265,'20-09-2023','Hoy avance con el modelo 3d pero principalmente avance con la carpeta de campo ','2023-09-20'),(7040,257,'20/09/2023','Hoy avance el primer piso y la planta baja, fue una lstima que perdimos mucho de eso porque se freezo la computadora, pero avanzamos lo que perdimos, se puede avanzar mas','2023-09-20'),(7041,260,'','Pasamos la mitad de la jornada debatiendo que nuevas vistas quedaban y como nos ibamos a dividir, mergeamos lo posible asi cada quien empezaba con lo que se le asign estando todos desde el mismo punto y continu la funcionalidad del vacation manager','2023-09-20'),(7042,263,'20/9','Hoy estuve haciendo unas copias de el personaje ya hecho pero cambiando de color para asi hacer en el futuro skins.','2023-09-20'),(7043,266,'organizacion y delegacion de todas las pantallas ','Hoy como senti que estaba todo muy desproblijo en cuanto a la division de cosas para hacer, le dije a diego que hay que anotar todo. Nos pusimos todos en la pantalla y empezamos a dibujar un diagrama de caso de uso mezclado con un diseo de las pestaas. pensamos todas las posibilidades que tendria el usuario y llegamos a la conclusion que con 8 paginas ya alcanza. entonces las desarrollamos pensandolo bien y las dividimos. ','2023-09-20'),(7044,252,'Clase 46 - Profile Manager View','El da de hoy cree una nueva vista para la aplicacion de BeCation, la vista de la administracion de perfiles. Va a ser una vista que va a tener RRHH para poder deshabilitar, editar. resetear la contrasea o crear un nuevo usuario. Mi idea es tratar de usar NextUI, tengo que importar la libreria de nextui y de tailwind. Tratar de hacer todo lo ms rpido posible pero que quede excelente ','2023-09-20'),(7045,254,'20/09/2023','Cambiamos a php el proyecto','2023-09-20'),(7046,250,'Miercoles 20/9','Hoy estuve documentando todo el proceso del curso de flexbox y llegue a las 144 paginas\r\n\r\n','2023-09-20'),(7047,255,'Miercoles 20/9','hoy estuve haciendo la carpeta de campo','2023-09-20'),(7048,328,'Clase 1','Analizando las posibles ideas de proyectos que se pueden realizar a lo largo del ao, por lo visto tenemos 3 preparados por ahora, uno sobre cocina, idioma y trabajo.Mejor que sobren ideas antes que falten ya que en cualquier momento pueden pedir un proyecto nuevo','2024-03-08'),(7049,319,'Segunda clase.','En un principio, descargu mi CV en formato PDF y lo sub como tarea, luego me dispuse a crear un repositorio para mi proyecto en Github.\r\nTras eso, me registr en SCRUMstudy para anotarme en la clase de fundamentos de SCRUM. Una vez hecho eso, comenc la tarea del Modulo 2, la cual no llegu a completar.','2024-03-08'),(7050,324,'2da clase de PP','En el dia de la fecha 08/03/2024 creamos las cuentas en encuentrotecnologico, despues me registre en la pagina de SCRUM para poder sacar el certificado obligatorio, me asignaron la fecha del 15/03/2024 y escribo esta bitacora.','2024-03-08'),(7051,323,'Organizacin ','Hoy estuve hablando con mis compaeros de equipo ya que no tuve una computadora el da de la fecha. hice una breve lectura de los dos primeros mdulos del DET pero mi celular esta en muy malas condiciones y esto me deshabilito la habilidad de seguir avanzando.','2024-03-08'),(7052,330,'Clase 1','Analizamos y conversamos sobre las normas APA y PP, ademas de adelantar al hacer el CV y una cuenta de linkedin para hacer las certificaciones obligatorias para poder avanzar a los modulos ','2024-03-08'),(7053,316,'Aprendiendo a utilizar godot','Hoy estuve con mi compaero Mangialavore estuvimos completando cada quien nuestra carpeta de campo, pero sobre todo estuvimos buscando y aprendiendo en base a un curso de YouTube como utilizar el programa godot, el cual sera el motor grafico de nuestro juego.','2024-03-08'),(7054,310,'Aprendiendo a usar Godot','En el da de hoy estuvimos viendo una gua de como usar Godot para comenzar a programar el videojuego. A la ves estuvimos mirando y leyendo desde el modulo 1 al 3 para poder hacerlo.','2024-03-08'),(7055,304,'0.0.1','El dia de hoy debido a la escaces de recursos informaticos decidimos dedicar la tarde a organizar el equipo e idear ideas para el proyecto venidero. Tambien e leido distinta info para luego hacer las tareas','2024-03-08'),(7056,306,'Clase nro. 2','En esta clase termine el formulario del modulo 1, a la vez que me anotaba en el curso de SCRUM fundamentals.','2024-03-08'),(7057,312,'Segunda clase','Hoy explore hay contenidos como dot modulo 0 y 1, carpeta de campo y nomas apa .Por otra parte hice una visualizacin profunda sobre los certificados obligatorios','2024-03-08');
INSERT INTO `bitacora` VALUES (7058,315,'clase N2','en la clase de hoy realice varias tareas propuestas  de ayer para este mes la tarea n1,n2,n3,n4 aparte de haber creado mi cuenta de linkedin  leer los pdfs de guias de pp,guia de cvs entre otras , tambien un ingreso a la cuenta de scruble y la reserva de uno de sus cursos el dia viernes 15','2024-03-08'),(7059,318,'Segunda Clase','Hoy explore los diferentes certificados que hay que hacer y me cree un cuenta de Linkedin. Tambin empeze con la carpeta de Campo.','2024-03-08'),(7060,320,'Certificacin Microsoft Linkedin 1','Comenz a hacer el linkedin de desarrolla de software.\r\nTambin el test de computrabajo pero nos como descargar los resultados en PDF','2024-03-08'),(7061,317,'Clase1','analizamos y conversamos sobre las normas pp, creamos el github, el reglamento de practicas profesionalizantes  ','2024-03-08'),(7062,322,'Segunda clase','En la clase del dia de hoy me empece a organizar para saber en que orden debera empezar a hacer las tareas correspondientes a la materia.\r\nPor lo que hoy realice la inscripcion al curso de SCRUM requerido para la empresa.','2024-03-08'),(7063,327,'','en dia de ayer 07/03/24 los comentaron como iba la materia y nos pidieron que plantearamos ideas para nuestro proyecto que fueron de kiosko  y tienda virtual de ropa y un mapa interactivo. en el dia de la fecha 08/03/2024 empeze hacer el curso de analisis de linqued in.','2024-03-08'),(7064,314,'Clase 1 8/3/2024','Estuve Creando mi CV en CompuTrabajo, actualizando mi C.V. y fijndome en los materiales que tengo que realizar y el plan de como funciona la clases. ','2024-03-08'),(7065,305,'2da clase de PP','En el dia de la fecha 08/03/2024 me inscribi para el certificado scrum, un certificado obligatorio. Me asignaron para el dia 15/03/2024 en el horario de 12:00 a 17:00. Despues empece y realice la tarea N1 de PP y ahora me registre en encuentrotecnologico para crear esta bitacora.','2024-03-08'),(7066,309,'certificacin de microsoft-linkdin','dedique el tiempo en leer las gua de documentacin y me inscrib al curso de analisis de datos  ','2024-03-08'),(7067,307,'Clase 1','analise las normas apa y pp, se creo el computrabajo en base a mi informacion y experiencia laboral, ademas se agrego lo registrado a la carpeta de campo','2024-03-08'),(7068,321,'clase-2 aprendizage','hoy estube con mi compaera milena monte negro viendo como instalar godot y como se utiliza aprendimos algo de lo basico y vimos que era mas facil de entender que unity','2024-03-08'),(7069,326,'Certificacin obligatoria','El da de hoy estuve haciendo el curso de Microsoft-linkedin sobre la IA generativa. De momento complet el capitulo 1 titulado &quot;Qu es la IA generativa?&quot; donde aprend en lineas generales como funciona una IA generativa, en que se diferencia de otros tipos de IA y la importancia de la IA generativa. ','2024-03-08'),(7070,311,'Organizacin y CompuTrabajo','El da de la fecha 08/03/2024 realize un registro a la plataforma de CompuTrabajo y organice con mis cmpaeros de equipo como vamos a trabajar en el futuro y con quien.','2024-03-08'),(7071,313,'planeo del trabajo y terminando mdulos ','hoy empezamos discutiendo de que tratara el juego mas con el apartado de que si este tendr una historia etc. tambin todava no tenemos planeado el estilo de arte de este mismo pero tenesmos la base ya decidida como que sera con una especie de dageon que nuestro personaje recorrer para conseguir puntos para que este se mejore tambin continuamos con investigaciones de aplicacin que utilizaremos para crear el juego que sera Godot. yo contine con terminar los diferentes pdf que requerimos como el cv y los test termine un test y el cv as que me falta los certificados que los continuare en mi casa para que en la siguiente semana ya comencemos con la app','2024-03-08'),(7072,325,'Clase 1','lei los pdf que explicaban los articulos de la ley de ed tecnica y todo lo relacionado al marco normativo pp. Adelante el cv en computrabajo y lei lo que habia en la seccion del classrom  llamado modulo 0','2024-03-08'),(7073,308,'Clase 07/05 y 08/05','El dia de ayer se analizo y formaron ideas para el proyecto, teniendo 3 ideas principales y otras 2 mas pero fueron descartadas. Hoy se avanzo con la tarea N1 leyendo el pdf, luego seguimos con computrabajo y el test de ingles','2024-03-08'),(7074,331,'clase 1','hice una certificacin y cree mi carpeta de campo ','2024-03-08'),(7075,329,'2','El dia de hoy 08/03/2024 estuve profundizando mas el tema de la PP a Base de las tareas asignadas que nos dieron. Estuve aprendiento el tema de los formatos, los tipos de formatos, el perfil, lo que hacen en un simulacro de una empresa y ahora por ultimo, nos registramos en encuentrotecnologico para hacer un nuevo registro de bitacora.','2024-03-08'),(7076,337,'Formulario 2, 3, 4','Hicimos junto a Ian Kickbush los formularios numero dos, tres y cuatro','2024-03-13'),(7077,336,'Relleno de formularios.','Hoy realice el formulario N7, el CV y comenc la tarea N6.','2024-03-13'),(7078,333,'Avances en la tarea 7 del modulo 5','Hice un avance en la tarea 7 &quot;Introduccin a los Proyectos  Institucionales de Prcticas Profesionalizantes&quot;','2024-03-13'),(7079,335,'Modulo 1 y 2','Hoy termine el modulo 1, le el documento, vi los 2 videos y complete el cuestionario, y el modulo 2. hice el mapa el conceptual del archivo &quot;Introduccin a las Prcticas Profesionalizantes&quot;','2024-03-13'),(7080,334,'Modulo 1 y 2','Hoy pude realizar los mdulos 1 y 2 junto con sus formularios y otras tareas que pedan. Vi los videos incluidos y le la teora. ','2024-03-13'),(7081,341,'Curriculum Vitae','el da de hoy estuve leyendo material sobre como realizar mi currculum y empec a hacerlo','2024-03-13'),(7082,342,'Tarea Nm1 &quot;Introduccion a las practicas profesionalizantes&quot; y Tarea Nm2 &quot;Mapa conceptual&quot;','En el da de la fecha hice la tarea Nm1 que era un cuestionario de Google con preguntas introductorias a practicas profesionalizantes que tenamos que sacar la informacin de un pdf que nos mandaron. y hice la tarea Nm2 que tenamos que hacer un mapa conceptual del pdf que nos haban dado en la Tarea Nm1','2024-03-13'),(7083,340,'Formularios','Termin el formulario 3, 4 y el 5 que era muy largo','2024-03-13'),(7084,347,'tareas y modulo 2','hice el mdulo dos, estoy empezando el tres ya resolv la primera tarea, me queda pendiente la siguiente tarea','2024-03-13'),(7085,345,'CV y Formulario 5','Estuve toda clase con la compu crasheandose, solo pude terminar el cv y poco menos de la mitad del 5','2024-03-13'),(7086,344,'Formularios','Termin el mapa conceptual del trabajo n2, el formulario n3 y el  currculum. ','2024-03-13'),(7087,339,'Bitcora de PP','Hoy termine el mapa conceptual de la tarea numero 2, y el formulario del modulo 3 (&quot;Habilidades Blandas y Competencias  Profesionales&quot;), empece con el cuestionario de la tarea 5 del modulo 4 (&quot;Gua de Empresa Simulada -\r\nCuestionario&quot;) y con mi Currculum Vitae del modulo 3.','2024-03-13'),(7088,348,'Formulario 2','Hice el mapa conceptual y reinicie la pc como 15 veces, escribo rpido antes de que se me crashee, conclusin la pase medio mal porque siento que me atrase mucho por el tema de la pc\r\n\r\nPD: es la segunda vez que lo escribo pq terminando de escribir lo anterior se me crasheo.','2024-03-13'),(7089,338,'BItacora 13/03/2024','Realice la tarea 2, 3 y 4 de las que me asignaron en la materia.\r\nTuve que hacer diagramas, mapas conceptuales, currculum y cuestionarios. \r\nInvestigu en internet sobre como realizar un buen currculum ya que quera que esta tarea tambin me sirva para utilizarlo despus . \r\n','2024-03-13'),(7090,346,'Formulario 2, 3, 4','El da de hoy realic los formularios 2, 3 y 4-','2024-03-13'),(7091,348,'formulario 2 ','Hice el mapa conceptual y reinicie la pc como 15 veces, escribo rapido antes de que se me crashee, conclucion la pase medio mal porque siento que me atrase mucho por el tema de la pc','2024-03-13'),(7092,306,'Clase nro. 3','Me cre una cuenta de LinkedIn, con la cual acced al curso de IA Generativa para conseguir el certificado de Microsoft-LinkedIn. Tambin complet el cuestionario de la tarea nmero 3.','2024-03-14'),(7093,319,'Tercer clase PP.','En un principio, complet la tarea N2, realizando el mapa conceptual correspondiente. Luego, le el material\r\ndel Modulo 3 sobre las Habilidades Blandas, tras eso, realic el formulario correspondiente, adjunt mi CV y mi\r\nperfil de LinkedIn y complet las tareas N3 y 4. Al rato largo, finaliz la tarea N7, que constaba de un formulario\r\nextenso, el cual complet luego de leer el material &quot;5.1 Introduccin a los Proyectos Institucionales de Prcticas\r\nProfesionalizantes. ','2024-03-14'),(7094,324,'Tercera clase de pp','En el da de hoy le las normas APA para poder crear la carpeta de campo, dicha carpeta ya esta creada. Mire el video de la tarea numero 2 y termine la tarea ya mencionada, tambin me hice un LinkedIn y me met al curso de ciberseguridad. ','2024-03-14'),(7095,325,'Clase 14/03','Me registre para ingresar al curso de Scrum el da 06/04. Tambin me registre el LinkedIn y realice el test de ingles de 50m de EF SET. Avance con la carpeta de campo y decidiendo ya el grupo para el proyecto hicimos una mini lluvia de ideas para posibles paginas/proyecto.','2024-03-14'),(7096,305,'3er dia de PP','en el da de la fecha 14/03/2024 le, analice la informacin dadas por los tutores respecto a las tareas 2, 3 y 4. En la Tarea 2 realice un mapa conceptual de PP. En la tarea 3 hice un cuestionario de habilidades blandas y competencias profesionales. Y por ultimo cree mi CV y mi perfil de linkedin','2024-03-14'),(7097,314,'Curso de Linkedin y anotacion de Scrum','Estuve analizando los cursos y me anote a de cyberseguridad y me anote para rendir el curso de Scrum el dia viernes 22 a las 5 am.','2024-03-14'),(7098,304,'0.1.0','Hoy avanc con los cursos, me anote en el curso de SCRUM y eleg mis cursos de microsoft x linkedin, termine el TP 1, empec el curso de IA con su respectiva carpeta. Cerramos el grupo con el que har el proyecto y estuvimos hablando sobre que bamos a hacer aunque teniendo ciertas dudas.','2024-03-14'),(7099,327,'3','en el dia de hoy empeze hacer la parte de los modulos terminando el modulo 0 , el modulo 1 y tambien pedi una clase para scarp','2024-03-14'),(7100,316,'Bitacora 2 - Un poco de todo','Hoy con mi grupo estuvimos hablando mucho sobre el juego y cual seria su estilo de historia y batalla, la historia se contara mediante un RPG mientras que el estilo de batalla todava no lo decidimos, por otro lado, yo por mi propia cuenta empece haciendo el modulo 1 de 6.','2024-03-14'),(7101,326,'Certificaciones MICROSOFT-LINKEDIN: IA generativa','Realice el curso sobre la IA generativa, el da de hoy termine el capitulo 2 llamado &quot;Modelos principales&quot; y el capitulo 3 &quot;El futuro de la IA&quot;. En el capitulo 2 aprend acerca de las GAN y VAE para deteccin de anomalas. En el capitulo 3 se habl brevemente de predicciones futuras respecto a el futuro de la IA.','2024-03-14'),(7102,330,'Curso de linkedin e inicio de seccion de SCRUM','Adelante los cursos de linkedin de curso de cyberseguridad terminando el primer video de 44 min llamado Concienciacin en ciberseguridad: Terminologa de ciberseguridad y termine el 2 segundo video de 2h 52min que son los fundamentos de la cyberseguridad','2024-03-14'),(7103,315,'','realizacion del tp 56789','2024-03-14'),(7104,329,'Modulos Y Perfil profesional','El dia de hoy estuve haciendo los trabajos de los modulos de la tarea n3 en las cuales nos ensea como hacer y formar nuestro cv y la importancia de las habilidades &quot;Blandas&quot;. Terminando el fromulario de la tarea N3 hice la tarea n4 que todavia esta en proceso y que voy a terminarla en &quot;Computrabajo&quot; para adjuntar mi cv en Linkedln :D.','2024-03-14'),(7105,317,'Clase 14/03','En esta clase, saque el turno para la certificacin de scrum, termine la primera certificacin de LinkedIn, avance con la carpeta de campo, empece a hacer idea con mi compaero sobre el proyecto anual para la pagina','2024-03-14'),(7106,323,'varias tareas','Realice la registracin para sacar el certificado de scrum SFC.\r\nLuego mire el video de charla de motivacin trabajo nuevas tecnologas BDT Group.\r\nRealice la creacin de una cuenta de linkedin y comenc la realizacin de uno de los cursos de Microsoft- linkedin, este curso es el curso de Fundamentos profesionales del desarrollo de software, por Microsoft y Linkedin.\r\nNo pude continuar porque la batera de mis auriculares muri entonces decid realizar los mdulos de DET.\r\nTermine el primer modulo de DET.\r\nTambin decidimos el cuarto integrante de equipo y pensamos en que va a ser nuestro  proyecto.\r\n','2024-03-14'),(7107,311,'Dia3 campeta de campo, curso scrum y Link','Empece anotndome a un curso de scrum en espaol para el dia 6/4 a las 7 hasta las 11 luego empece a crear mi carpeta de campo poniendo lo que habia hecho hasta ahora y luego me cree una cuenta en LinkedIn Donde me fije en varios cursos y decid empezar con el curso de CIRBESEGURIDAD, luego me junte con mi grupo hablamos y unimos al integrante que nos faltaba y luego empezamos hablar sobre el proyect que haramos ','2024-03-14'),(7108,321,'conseptos pasicos 14/3/2024','Nos pusimos de acuerdo de como seria el sistema de batalla.\r\nsera un sistema de combates estilo mortal kombat en este estilo podemos hacer versus mas dinamicos','2024-03-14'),(7109,309,'Modulo 1, Modulo 2','Termine de hacer la encuesta del modulo 1 y avance bastante con el modulo 2 hicimos los grupos y se pensaron ideas para el proyecto','2024-03-14'),(7110,349,'14-03','hoy fue mi primer da, as que no hice mucho, primero entre a hacer la certificacin de SCRUM, despus empece con el modulo 0, lo le, y luego empece con el modulo 1, y modulo 2 ','2024-03-14'),(7111,320,'Carpeta de campo','comenze a hacer la carpeta de campo registrando todo lo que hice hasta el dia de hoy','2