','2024-11-20'),(8489,348,'hoy presentamos el ecommerce','','2024-11-20'),(8490,339,'','hoy hice un poco mas de carpeta de campo, y hoy tuvimos la presentacion final del proyecto ','2024-11-20'),(8491,346,'Presentacin final del proyecto ','','2024-11-20'),(8492,347,'20/11/2024','exposicion proyecto','2024-11-20'),(8493,340,'Presentacin final','Hoy hicimos la presentacin del proyecto y la entrega de la carpeta de campo. ','2024-11-20'),(8494,345,'Presentacin de la pagina','Presentamos la pgina y, si la carpeta de campo est bien, doy por cerrada la materia','2024-11-20'),(8495,348,'hoy solo vinimos para dar el presente :)','','2024-11-27'),(8496,344,'Presente','Hoy vine a dar el presente','2024-11-27'),(8497,341,'VINE A HACER CARPETA DE CAMPO','HICE 15 PAGINAS, VOY POR LA 175 Bv','2024-11-27'),(8498,337,'Avance carpeta de campo','En el da de la fecha para practicas profesionalizantes, estaba en 93 pginas y llegue a un total de 104, avanc 11 pginas bastante rpido','2024-11-27'),(8499,343,'','','2024-11-27'),(8500,335,'Nada','No hice nada','2024-11-27'),(8501,378,'Mdulo 1','Termin el mdulo 1 de DET y empec a trabajar en el segundo.','2025-03-12'),(8502,371,'Introduccion','Dia: 12/03/25\r\nTuvimos la charla sobre las Practicas Profesionalizantes con Consorti, sobre como eran, funcionaban y que era lo que ibamos a  hacer si entrabamos a una empresa o algo.\r\nVimos los primeros videos del modulo 1 y hicimos la actividad que venia cone ella. \r\n\r\nPrimer video de instroduccion: Explicacion de los alumnos de universidades y escuelas de su experiencia en las empresas,\r\n el ambiente, como se sentian y sobre todo lo que pensaban sobre el lugar, en como iba a hacer su desarollo en su trabajo.\r\n\r\nSegundo video de instroduccion: Hablan varias personas importantes (Eric Engler, Juliana Bertevello(2), Silvina Brites(2), \r\nAriel Ratti, Diego Guerrero) sobre lo que empiezan a hacer lo/as alumnos de 6 ao de las escuelas tcnicas en las Practicas Profesionalizantes ','2025-03-12'),(8503,368,'Introduccin a Prcticas Profesionalizantes','En el comienzo de la clase escuchamos y discutimos el reglamento y funcionamiento de Prcticas Profesionalizantes y Laboratorio\r\nLuego comenc a realizar los mdulos 0, 1 y 2 junto a sus respectivas tareas en el tiempo restante de la clase. ','2025-03-12'),(8504,374,'Introduccin a practicas profesionales','En el da de hoy hemos hablado acerca de la materia como se aprueba y como es el funcionamiento del mismo y en los ultmos bloques he trabajado con el material a entregar para este mes, como por ejemplo creacin de CV y avanc con el modulo 0,1 y 2 de la DET con el fin de comprender el funcionamiento de la materia. ','2025-03-12'),(8505,366,'Introduccion a las Practicas Profesionalizantes','Hoy fue la primera clase de Practicas Profesionalizantes, el profesor estuvo explicndonos todo como funciona, los mdulos, eleccin de proyectos, practicas externas, etc.\r\nLuego empece a hacer los mdulos, hoy pude hacer el modulo 1 y 2.','2025-03-12'),(8506,367,'Introduccin a PP','Me dediqu a la elaboracin de los mdulos 0, 1 y 2 de  la DET con el fin de comprender el funcionamiento de las Prcticas Profesionalizantes. ','2025-03-12'),(8507,373,'Introduccin a las Prcticas Profesionalizantes','En el da de hoy, en el horario de contra turno.\r\nTuvimos una introduccin a las PP (Practicas Profesionalizantes), en la cul se nos explicaron conceptos bsicos, reglamento y cosas a tener en cuenta, nos comentaron acerca del CCD y nos encomendaron empezar a leer y completar los mdulos de PP. ','2025-03-12'),(8508,381,'Introduccin a la materia','Escuchamos al profesor dar la introduccin a la materia. Y empezamos a realizar los mdulos. ','2025-03-12'),(8509,362,'modulo 1, modulo 3, modulo 7, test de ingles para el CV','realize el modulo 1 de el DET (el Cuestionario), realize el modulo 3 del DET (tambien del Cuestionario) y por temas de tiempo deje por la mitad el modulo 7, complete el test de ingles para el CV con la 2da puntuacion mas baja','2025-03-12'),(8510,380,'Introduccin a la materia PP','Recibimos del profesor la introduccin general y futura sobre PP, despus de eso nos registramos en Encuentro Tecnolgico y empezamos a realizar los mdulos DET','2025-03-12'),(8511,360,'Introduccin a PP','Escuchamos el reglamento f funcionamiento de PP por nuestro profesor y consultamos nuestras dudas. Despus empec a hacer el mdulo 1, 2 y 3','2025-03-12'),(8512,365,'introduccin a PP e Inicio de mdulos DET ','El da de la fecha se explico brevemente cual es el propsito de PP y los objetivos para poder aprobar la materia. Posterior a esto se nos dio diferentes tareas, pero el da de hoy se limito a finalizar el modulo 0 y 1  de las tareas DET.','2025-03-12'),(8513,375,'Introduccion a Practicas Profesionalizantes','Hoy fue el primer dia de la Materia de Practicas Profesionalizantes, nos comentaron y ensearon los conceptos basicos a tener en cuenta para todo el ao, ademas de aclarar dudas mientras explicaban como seria el reglamento y la modalidad de la asignatura, nos recomendaron empezar con los Modulos DET.','2025-03-12'),(8514,364,'Inicio de PP','El da de hoy se nos dio una charla previa antes de empezar la clase. Esta charla de basa en como nos vamos a trabajar y desarrollar nuestros proyectos en PP tanto dentro como fuera de la escuela.\r\n\r\nDespumes empezamos a leer la introduccin mas bien conocido como mdulo 0 para posteriormente hacer el Trabajo Practico nmero 1 de PP el cual son preguntas bsicas sobre PP en general.','2025-03-12'),(8515,363,'Introduccion a PP e inicio de los modulos','el dia de hoy escuchamos la explicacion sobre la materia de parte del profesor, explicando cada parte de lo que vamos a hacer en el ao. Luego lei el modulo 0 y empece a resolver el modulo 1','2025-03-12'),(8516,361,'Introduccin a PP','Charlamos sobre el reglamento y caractersticas de la materia. Luego realic los mdulos 0, 1 y 2 obligatorios de Prcticas profecionalizantes','2025-03-12'),(8517,377,'Introduccion al PP','Hoy nos explicaron de como va a ser el funcionamiento de la materia a lo largo del ao. Tambien profundisamos como va a funcionar la eleccion de proyectos, los modulos, la carpeta de campo y varios temas mas. Despues de abarcar los temas se hizo una ronda de preguntas sobre el funcionamiento de la materia. ','2025-03-12'),(8518,369,'Introduccion de las PP','En el dia de hoy nos dieron una charla sobre las practicas profecionalizantes y como se va a llevar durante el ao y nos dieron unos modulos con videos y informacion para realizar el cuestinario','2025-03-12'),(8519,382,'Det','Nos hicieron la introduccin de lo que bamos a hacer durante el ao y empec los mdulos de DET','2025-03-12'),(8520,370,'Bitcora de PP da 12 de Marzo 2025','Hoy tuvimos una charla de como iban a ser las prcticas profesionalizantes y nos explicaron como y que tenamos que hacer. No tuvimos conflictos.','2025-03-12'),(8521,376,'Primer da P.P','Hoy nos explicaron que vamos a hacer en la materia, los distintos tipos de metodologas para aprobar la materia que son con un proyecto en la escuela o con las prcticas externas, que vamos a tener varias salidas didcticas, que hay una cierta cantidad de horas necesarias para poder aprobar la materia que son 216 horas. Despus de esta introduccin a la materia nos puse a hacer los primeros mdulos que manda la det','2025-03-12'),(8522,387,'13/3','Hoy en el primer dia de la asignatura, los profesores nos explicaron como iba a ser la materia durante todo el ao, que debiamos cumplir con ciertos requisitos para aprobar, que ciertos chicos iran a practicas fuera del colegio mientras otros las realizaran aca internamente. Tambien que debemos contar con una carpeta de campo de 200 hojas minimo, que debemos realizar los cursos obligatorios etc.','2025-03-13'),(8523,405,'13/03/25','Hoy me registre en la pagina de encuentro tecnologico, tambien lei el documento PDF de Introduccion a practicas profesionalizantes y realice el formulario correspondiente.','2025-03-13'),(8524,389,'13/03/2025','Hoy el profesor nos explico las cosas, luego empece a hacer el Det modulo 0, leyendo y marcndolo como echo, luego hice el modulo 1 entregndolo el da de hoy.','2025-03-13'),(8525,386,'13/3/25','O toda la explicacin sobre la materia, y discutimos puntos un tanto confusos sobre todo el plan de la materia, comenc a realizar los mdulos de la DET, y le eche un ojo al test de ingles.\r\nTambin, en grupo definimos el proyecto a realizar en el ao, lo charlamos con los docentes, y finalmente fue aceptado.\r\n','2025-03-13'),(8526,395,'13/03/2025','hoy tuvimos la charla de lo que significa la materia y de los que vamos hacer en todo el ao, nos reguistramos en encuentro tecnologico y el slack de pp y estaba haciendo los formularios del DET.','2025-03-13'),(8527,390,'13/03/25','El da de hoy nos informamos a como seria la materia a lo largo del ao, junto con sus etapas, mtodos a evaluar, tareas a completar, entre otras cosas. Tambin, armamos grupos en el saln y estuve realizando y finalizando el formulario inicial, el modulo 0 y el modulo 1. ','2025-03-13'),(8528,397,'13-03-25','Los profesores nos hizo una introductorio a la materia explicndonos los que vamos hacer durante el ao a su vez nos encargaron las hacer hacer el DET modulo 1','2025-03-13'),(8529,400,'13/3/2025 clase - 1','al inicio de la clase hablamos sobre el funcionamiento de las practicas profesionalizantes, como se organiza esta, sus objetivos y la manera en la que estaremos trabajando todo este ao. tambin fuimos informados acerca de lo importante que es aprobar esta materia. el resto de la clase\r\nle los PDF y mire algunos videos de los mdulos 1 y 2  termine el formulario del modulo 1 y  el mapa conceptual del modulo 2','2025-03-13'),(8530,388,'13-03-25','Hoy iniciamos PP los profesores nos dieron una introduccin a la materia, nos explicaron de forma resumida los contenidos que vamos a llevar durante el ao, hoy arranque leyendo el modulo cero que fue todo muy terico y nos asienta pautas y bases para iniciar los proyectos futuros. A continuacin prosegu con el modulo siguiente (modulo 1) que inclua como teora un pdf y dos videos explicativos, una vez ledo realice un corto formulario con preguntas relacionadas al tema.','2025-03-13'),(8531,392,'13/3/2025 Introduccin.','Primera clase del ao:\r\nHoy conocimos un poco de la materia, como se ira desarrollando a lo largo del ao, de que manera, que factores tendra para la aprobacin de la misma.\r\n\r\nEn el da de la fecha, realice el primer formulario del modulo DET. Siendo esta misma una introduccin.\r\nCaractersticas, formatos posibles, Diseo Curricular, comprensin de dinmicas con otro actores y requisitos para su aprobacin.\r\n\r\n\r\n','2025-03-13'),(8532,404,'13/03/2025','Hoy tuve la charla de PP sobre que se va a realizar a lo largo del ao en la asignatura, pude resolver algunas consultas que tenia, despus me registre en la pgina de encuentro tecnolgico, le la introduccin a Prcticas Profesionalizantes y logr realizar el formulario del mdulo 1. ','2025-03-13'),(8533,406,'13/03/25','Estuve haciendo el formulario (Introduccin a las Prcticas Profesionalizantes, vi videos que hacan en los encuentros PP.\r\nTambin me registre en Encuentro Tecnolgico  y me un al canal de Slack de PP','2025-03-13'),(8534,394,'13/03/2025','El da de la fecha hablamos con los tutores sobre en qu consiste la materia en s, y nos explicaron que es DET. Luego de eso empec a realizar los mdulos, le y vi los videos dados para realizar el mdulo 1. Tambin realic el formulario de laboratorios. ','2025-03-13'),(8535,384,'13/03/2025','Lo que realizamos hoy fue un extenso desarrollo de una introduccin de lo que va a hacer prcticas profesionalizantes. Se explic como va a funcionar los formatos ya sea acadmicos como el formato en formacin en ambientes productivos. Como se a a gestionar los proyectos dentro de la institucin y la seleccin de equipos asignados para todo el transcurso del ao. Como primer objetivo del da se nos entreg el classroom y como tarea realizar todos los mdulos, del 0 al 6. Para luego aclarar que se debe terminar un curso de ingles de 90 minutos para evaluar nuestro nivel de ingls y presentarlo como un certificado.','2025-03-13'),(8536,398,'13-03-2025','Hoy estuvimos viendo de que se trata la materia Practicas Profesionalizantes y que cosas se estn por venir en todo lo que queda del ao. Estuve haciendo el Modulo 1 del DET y pude terminarlo y enviarlo.','2025-03-13'),(8537,393,'13/3/25','Hoy fue la primera clase de Prcticas profesionalizantes en la que los docentes nos explicaron y dieron a entender lo que es PP, ademas de todo lo que vamos a ver durante el ao, esto implica la Formacin en Ambientes Productivos, Proyectos y Empresas, en la que realize el DET - Modulo 1, que nos explica aun mas sobre PP y que en base a eso complete el Cuestionario de este Modulo.','2025-03-13'),(8538,401,'13/02/2025','Escuchamos todas las consignas que vamos a tener que realizar en todo el ao entero, esto implica la realizacin de los dets cursos(test de ingles, CVs, y certificacin de SCRAM) proyectos y pasantas.\r\nHoy termine el el det numero 1 con todo y poco mas y avanzando un poco en el numero 2.','2025-03-13'),(8539,399,'13-03-2025 Clase 1','Comenzar con los formularios del DET. Nos explicaron todo de esta materia.','2025-03-13'),(8540,403,'13/3/2025','Este da vimos y escuchamos sobre lo que seria la materia de practicas profesionalizantes o PP para ','2025-03-13'),(8541,385,'Clase de Introduccin','En el da de la fecha, los docentes nos explicaron arduamente en que consistir esta asignatura. Despus realizamos la primer actividad del Modulo 1, lemos PDF y vimos vdeos informativos para despus poder realizar un cuestionario sobre lo aprendido.','2025-03-13'),(8542,402,'Primera clase','El da de hoy tuvimos una clase introductoria, donde los tutores nos dieron una charla con respecto al reglamento del laboratorio, el como se van a ir desarrollando las cosas a lo largo del ao con respecto a las prcticas, hablando sobre los proyectos que posiblemente surjan a futuro y tambin respecto a la carpeta de campo. \r\nSe plante el tema de los grupos y en el periodo de tiempo posterior, form un grupo con Agustina Heck, Mximo Celli y Nicols Pea. y estuvimos charlando respecto a posibles proyectos que se puedan desarrollar a futuro.','2025-03-13'),(8543,383,'Dia I','En el da de hoy tuvimos la introduccin a PP, la cual trata de introducirnos en una simulacin del mbito laboral, escuche sobre todo y ya decidimos nuestro grupo y nuestro proyecto. Arranque con los mdulos del DET y termine uno y casi 2.','2025-03-13'),(8544,396,'P.P primera clase','Hoy tuvimos nuestra primera clase, se habl sobre varias cosas, entre esas cosas los proyectos a futuro, la carpeta de campo, los grupos y las condiciones para aprobar. Yo form un grupo con Anderson Snchez, Mximo Celli y Nicols Pea \r\n\r\n','2025-03-13'),(8545,391,'DIA I','Hoy nos explicaron el funcionamiento bsico de la materia y nos dijeron que empecemos a completar los diagnsticos del DET cosa que hice hasta el horario de cierre de la materia tambin ya pensamos con el mi equipo sobre el proyecto a hacer.','2025-03-13'),(8546,395,'14-03-2025','Hoy estuve haciendo los mdulos, cree mi pgina de LinkedIn y tambin estuve haciendo mi cv para poder entregarlo junto al test de ingls ','2025-03-14'),(8547,389,'14/03/2025','Hoy entre a clase y no haba wifi, luego de que hubo, me puse a hacer el modulo 2, es decir el mapa conceptual, termine a tiempo y lo compart con mis compaeros. Me puse a hacer el modulo 3 y ya lo voy a entregar ya que no tengo todava algunos elementos.','2025-03-14'),(8548,383,'Dia 2','En el da de hoy, tuvimos que seguir con todo lo del DET, empezamos a hacer un mapa conceptual sobre la introduccin a PP (Practicas Profesionalizantes) lo cual nos llevo casi toda la hora.','2025-03-14'),(8549,398,'14-03-2025','Hoy se cort el internet en el laboratorio de redes y estuvimos como 20 minutos intentando encontrar otra forma de realizar los trabajos hasta que el internet finalmente volvi. Estuve haciendo el modulo 2 del DET y el curriculum vitae.','2025-03-14'),(8550,385,'Clase 2','Al ingresar no haba conexin internet, tuvimos que realizar las actividades que nos quedan asignadas mediante archivos brindados por el profesor mediante la red local, hasta que la conexin volvi y pudimos seguir realizndolas con normalidad.','2025-03-14'),(8551,386,'14/03','Leve inconveniente con la conexin a Wifi, resuelta en la misma clase, realic el mapa conceptual del archivo 1.1 de la DET','2025-03-14'),(8552,384,'11/03/2025','En el da de hoy tuvimos inconvenientes con el servicio de conexin a internet, tuvimos este problema durante aproximadamente 40 Minutos hasta que los profesores pudieron solucionarlo. Una vez que se solucion el problema, empezamos con la creacin del perfil de Linkedin y adaptar mi CV a uno profesional especficamente en el rubro que elegimos. Finalizando esto subimos el trabajo y nos pusimos a realizar los cursos de Microsoft Y linkedin.','2025-03-14'),(8553,405,'14/03/2025','Comenc a realizar la segunda actividad la cual consiste en hacer un mapa conceptual de el documento &quot;Introduccin a las practicas profesionalizantes&quot;, no he podido terminarlo debido a problemas con la conectividad de la escuela, aun as he logrado introducir la mayora de lo que el documento presenta en el mapa conceptual.','2025-03-14'),(8554,397,'Clase 2','Hoy se corto el internet al entrar al aula durante 20 minutos, ante la urgencia el profesor nos dio los archivos ya descargado, despus de que volvi el internet me puse hacer los mdulos 2 y 3 ','2025-03-14'),(8555,392,'14/3/2025','Hoy avance en las tareas correspondientes a la materia, me mantengo haciendo los mdulos 2, 3 y 4.\r\nTambin repasamos el tema de los Diseos Curriculares y los perfiles en Linkedin. \r\nEn general, avanzando las tareas y resolviendo dudas.\r\n\r\n\r\n','2025-03-14'),(8556,387,'14-03','Hoy en la segunda clase, al principio se corto el internet durante 40 minutos, luego estuve avanzando en los modulos del PP, donde mejore mi cv previamente creado, tambin cree mi perfil de LinkedIn. Avanzamos con los cursos de Microsoft con linkedin. Termine el formulario del modulo 3. Organice bien mi semana para poder hacer todo con tiempo y de buena forma','2025-03-14'),(8557,407,'14/03/25','En el da de hoy el profesor Olaso me hizo una breve explicacin sobre la materia y comenc con la serie de escritos sobre la materia con msica de minecraft de fondo.','2025-03-14'),(8558,393,'14/3/25','Hoy empece hacer el modulo 3 de DET, que era una cuestionario, respond todo pero al final me peda hacer un cv, y hasta el final de la clase me quede hacindolo, sin poder terminarlo ','2025-03-14'),(8559,394,'14/03/25','Hoy no haba wifi cuando llegu, as que el tutor nos dio una IP para poder ingresar a los pdf y as poder ver y realizar las actividades. Al rato ya tuvimos y empec a realizar el mdulo 3, el cual le y despus respond el formulario dado, el mismo inclua la realizacin de nuestro cv, as que tambin estuve trabajando un poco en eso. Luego ayud a mi compaera Abi con el mapa conceptual. ','2025-03-14'),(8560,388,'14-03','Hoy al principio de las practicas no pudimos avanzar mucho por cuestiones de una falla en la conexin de internet en la escuela. Luego, complete los mdulos avanzando bastante, y a su vez complete el test de EF de ingles para saber mi nivel.','2025-03-14'),(8561,401,'14-03-2025','Hoy termine la tarde con el trabajo numero tres la cual hablaba de las habilidades blandas, como sirven, como nos ayudan y cuales tengo.\r\nLuego arranque el CV, y me cree la cuenta de LinkedIn y empec con los cursos. Todo eso con la temtica de que al principio de la clase no haba internet','2025-03-14'),(8562,402,'Segunda clase','Complet el formulario del laboratorio y estuve repasando para responder el modelo 1','2025-03-14'),(8563,396,'Clase 2','Repaso para presentar el TP del modulo 1','2025-03-14'),(8564,365,'Modulos DET ','El da de hoy finalice el