a 9 (video de introduccin grupal). A su vez modifiqu el currculum vitae.','2025-03-25'),(8653,373,'Ideando Proyecto de PP','En el da de hoy en conjunto a mis compaeros de grupo nos encargamos de pensar distintas problemticas que puedan ser resueltas mediante un proyecto.\r\nTambin estuvimos buscando satisfacer a cierto sector de personas, por lo que nos decidimos por realizar un juego. Lo siguiente fue empezar a idear, por lo que estuvimos gran parte de la hora pensando de que tratar este juego, que grficos tendr, que estilo, entre otros. ','2025-03-25'),(8654,362,'modulo 4 del DET, modulo 5 del DET, modulo 7 del DET','entregue el modulo 4 del DET que ya haba completado (el CV), complete y entregue el modulo 5 del DET (preguntas en PDF) y deje a 1/4 de terminar el modulo 7 (cuestionario)','2025-03-25'),(8655,372,'Bitcora de PP da 25 de marzo 2025','Hoy continuamos con los mdulos de prcticas profesionalizantes, contine hasta el mdulo 6, y avanzando un poco del mdulo 7','2025-03-25'),(8656,408,'25/3/25','Hoy estube dicutiendo las ideas que podiamos realizar :\r\n\r\n13. Desarrollo de una aplicacin mvil bsica (consorti?)\r\nDescripcin: Crear una aplicacin mvil sencilla, como una aplicacin de notas o un recordatorio de eventos. Puedes usar herramientas como Flutter o React Native para crear aplicaciones multiplataforma.\r\n\r\n\r\nHerramientas: Flutter, React Native, Android Studio.\r\n7. Desarrollo de un chatbot simple (posible cliente)\r\nDescripcin: Crear un chatbot que interacte con los usuarios de manera bsica. Puede ser un chatbot para responder preguntas frecuentes sobre un producto o servicio. Puedes usar herramientas como Dialogflow o escribir tu propio chatbot con Python.\r\n\r\n\r\nHerramientas: Python, NLTK, ChatterBot, Dialogflow.\r\n\r\n\r\n8. Sitio web de portafolio personal (cliente)\r\nDescripcin: Desarrollar tu propio sitio web de portafolio para mostrar tus proyectos y habilidades. Este proyecto te permitir aprender ms sobre diseo web, implementacin de SEO y optimizacin de sitios web.\r\n\r\n\r\nHerramientas: HTML, CSS, JavaScript, Bootstrap, GitHub Pages.\r\n10. Juego bsico en 2D (consorti?)\r\nDescripcin: Desarrollar un juego simple en 2D, como un &quot;Juego de la serpiente&quot; o un &quot;Tic Tac Toe&quot;. Esto te ayudar a practicar tus habilidades de programacin orientada a objetos, fsica bsica de juegos y gestin de eventos.\r\n\r\n\r\nHerramientas: Unity (C#), Godot, Pygame (Python).\r\n11. un sistema para registro de citas para una barberia masculina \r\n\r\nPara desarrollar un sistema de registro de citas para una barbera, necesitas varios componentes. Aqu te explico qu necesitas y qu programas o tecnologas puedes usar. \r\n\r\nlo cual aun no decidimos\r\n','2025-03-25'),(8657,365,'Planificacin de proyectos ','El da de hoy mis compaeros y yo nos reunimos con el propsito de planificar y plantear los posibles proyectos a realizar. Muchos de ellos estaban relacionados con lgica aplicada a hardware, pero mis compaeros se fueron ms por un videojuego.','2025-03-25'),(8658,409,'Modulo 4, 5 y 6','Hoy estuve trabajando en terminar los modulos 4, 5 y 6, los cuales trataron sobre cuestionarios en base al pdf &quot;Guia de empresas simuladas&quot;, con el cual tuve que trabajar, tambien estuve formando el guion para lo que seria el tp 9, enfocandome en mis habilidades sobre ciberseguridad y desarrollo, para poder grabarlo en mi casa y maana empezar con los cursos de linkedin y empezar a charlar formalmente el proyecto de practicas profesionalizantes con mis compaeros y profesores.','2025-03-25'),(8659,412,'Modulo 2 ','finalice la tarea 2 del mapa conceptual del modulo 2','2025-03-25'),(8660,371,'CV (casi terminado)','El dia de hoy estuve hacinedo mi CV para los trabajos/pasantias y estaba viendo que me falta capacitarme mas en un par de cosas (idioma, lenguages de programacion, algun que otro proyecto personal, etc), ahora cuando vuelva a mi casa termino el modulo 3 y seguire con los demas y vere como seguir jajaj