 datos para el proyecto.','2025-04-01'),(8731,408,'creacin de prototipo ','Fecha: 01/04/2025\r\n\r\nHoy trabaj en el desarrollo del prototipo de baja fidelidad para la interfaz de usuario (IU) del sistema de gestin de stock para la panadera. Utilic Figma como herramienta principal para estructurar las diferentes pantallas y organizar los elementos clave de la interfaz.\r\n\r\nPantallas diseadas:\r\n\r\nInicio de sesin: Formulario con campos para usuario y contrasea, adems de un botn de acceso.\r\nPgina de inicio: Panel con acceso rpido a las principales funcionalidades del sistema.\r\nGestin de stock: Tablas organizadas para visualizar y administrar los productos disponibles.\r\nMdulo de ventas: Seccin para registrar y consultar transacciones.\r\nReportes: Panel con datos estructurados para anlisis de ventas y stock.\r\nConfiguracin: Opciones de personalizacin y ajustes del sistema.\r\n\r\nEnfoque y consideraciones:\r\n\r\nPriorizacin de una navegacin intuitiva con una distribucin clara de los elementos.\r\n\r\nEstructura modular, facilitando futuras mejoras en el diseo.\r\n\r\nUso de elementos bsicos para definir la jerarqua visual antes de pasar a un diseo de alta fidelidad.\r\n\r\nPensado para mejorar la experiencia de usuario y optimizar la gestin del sistema.\r\n\r\nSiguientes pasos: Refinar detalles de interaccin y avanzar en la fase de diseo en alta fidelidad con la paleta de colores y estilos definidos.','2025-04-01'),(8732,369,'pert','hice el diagrama de pert para el proyecto de PP','2025-04-01'),(8733,371,'Desarrollo web y Ultimo modulo ','Hoy termine mi vergonzoso video para presentar ante las empresas diciendo lo que me gusta y gustara hacer cuando este.\r\naparte estuve laburando en el proyecto de desarrollo de sistema donde vi el diagrama Gantt y como se usa, tengo que seguir investigando al respecto...','2025-04-01'),(8734,364,'Da de hoy (Proyecto)','Realizamos en conjunto con Sufyan el DER de nuestro proyecto asignado','2025-04-01'),(8735,367,'Subo la tarea 9 al classroom y hacemos las preguntas para la entrevista ',' Subi al classroom el video correspondiente a la tarea 9 e hicimos las preguntas para la entrevista al cliente, correspondiente al proyecto anexo de Desarrollo de Sistemas. ','2025-04-01'),(8736,382,'Documentacin ','\r\nSe complet el anlisis FODA y la elaboracin del diagrama de Gantt.\r\n\r\nDetalles:\r\n\r\nSe identificaron fortalezas, oportunidades, debilidades y amenazas del proyecto.\r\n\r\nSe establecieron estrategias clave para abordar cada aspecto del FODA.\r\n\r\nSe cre un diagrama de Gantt con actividades, plazos y responsables.\r\n\r\n\r\nResultados:\r\n\r\nDefinicin clara de factores internos y externos del proyecto.\r\n\r\nCronograma estructurado para la ejecucin de tareas.\r\n\r\n\r\n\r\n\r\n','2025-04-01'),(8737,414,'Creacion de presentacion del Proyecto','El dia de hoy inicie con la presentacion del Proyecto,creando animaciones para el powerpoint y efectos.\r\nAntes de finalizar el dia voy a terminar con la presentacion y voy a  comenzar con el gantt para el proyecto. y voy a dar una ayuda con las partes criticas del proyecto. (encargada jocsi)','2025-04-01'),(8738,380,'Sexta clase de PP','Debido a la unin de los proyectos de desarrollo de sistemas, contine con este, haciendo el Figma de la parte cliente y usuario','2025-04-01'),(8739,368,'Continuacin de los Mdulos DET y proyecto','Continu trabajando en el desarrollo del video entrevista de la tarea numero 9.\r\nA su vez, en equipo, proseguimos con la formulacin de preguntas para la entrevista al cliente en el proyecto de Desarrollo de Sistemas.','2025-04-01'),(8740,373,'Finalizacin del diagrama FODA','En el da de hoy, en conjunto a mi equipo nos encargamos de finalizar las tareas ya asignadas en clases anteriores para cumplir con las fechas establecidas. Empezamos haciendo el &quot;Daily&quot; que consisti en el Scrum Master entrevistando a cada integrante para tener un panorama de lo que se hizo y se realizar en cuanto a trabajos. En cuanto a m, realic con xitos el Diagrama FODA en la plataforma de Canva.','2025-04-01'),(8741,361,'Progreso documentacion del proyecto','Continuando con la elaboracin de la documentacin proced a realizar el FODA (Fortalezas, Oportunidades, Debilidades, Amenazas) del proyecto. Posteriormente ayud en la creacin del DER (Diagrama Entidad-Relacin) y las preguntas que le haremos al cliente.','2025-04-01'),(8742,366,'1-4','Hoy estuve terminando los modulos det y despues arrancamos con gennaro a hacer un cuestionario para la aplicacion web que vamos a desarrollar este ao, y ya empezamos a difundirlo','2025-04-01'),(8743,365,'Primer daily','El da de ayer me reun con mis compaeros con el propsito de realizar el daily, con el fin de asignar los roles correspondientes y poder dividir adecuadamente las tareas de la documentacin. Una vez hecho esto, cada uno prosigui con su tarea asignada.','2025-04-01'),(8744,374,'Trabajo desarrollo sistemas','En el dia de hoy he trabajado con mi equipo en la creacion de encuestas y diagrama de caso de uso, De mi parte yo estaba haciendo la documentacion del mismo y diagrama DER','2025-04-01'),(8745,412,'curso de linkedin','comenze a ver videos del curso y sus actividades\r\n','2025-04-01'),(8746,385,'Clase 7','Empezamos a hacer la carpeta de campo y el proyecto.','2025-04-03'),(8747,397,'Clase 6','Hoy estuvimos charlando con mi equipo para dividirnos la tarea, como tuvimos acto se nos redujo un poco el tiempo, pero pude empezar hacer la carpeta de campo y algo de la presentacin con power point.','2025-04-03'),(8748,402,'Clase 7','El da de hoy charlamos sobre distintas metodologas para aplicar en el proyecto, los beneficios y sus contras. As mismo con Agustina Heck avanzamos con la tarea 6 del mdulo 4','2025-04-03'),(8749,389,'3/4/2025','subi el resto de los tps y ahora solo me quedan 2, inicie con la carpeta de campo ','2025-04-03'),(8750,404,'03-04-2025','Hoy con mi equipo de proyecto realizamos un anlisis de como trabajar con la aplicacin