ril, finalic el Mdulo 4, especficamente la Tarea N6. Con este avance, he comenzado a organizar y estructurar la carpeta de campo para Prcticas Profesionales (PP), asegurndome de cumplir con los requisitos establecidos y aplicando las normas APA (7 edicin) en la presentacin de los documentos.','2025-04-03'),(8768,403,'03/04/25','Comenc a hacer el tp/formulario n7 del modulo 5, segu con las tareas del modulo 4 llegue a terminar el cuestionario pero me falto terminar el organigrama y por ultimo nos repartimos las tareas del proyecto.','2025-04-03'),(8769,402,'Clase 8','Con Agustina Heck terminamos la actividad 6 del mdulo 4 ','2025-04-04'),(8770,389,'04-04-2025','Termine los mdulos y grabe el video','2025-04-04'),(8771,398,'04-04-2025','Hoy no hice nada, simplemente eso','2025-04-04'),(8772,395,'4-04-2025','estuve terminando los mdulos restantes. ','2025-04-04'),(8773,383,'04-04','El dia de hoy fue virtual se arranco haciendo la base de datos, el der y planeacion de como vamos a encarar el proyecto con respecto a el product list y etc\r\n','2025-04-04'),(8774,390,'04/04/2025','El da de hoy, estuve finalizando los TP\'s que me quedaban pendientes sobre los DET\'s, as que ya con mi grupo armado, empezamos a gestionar algunas tareas y organizarnos para nuestro objetivo','2025-04-04'),(8775,386,'4/4','Hoy en reunion virtual, debatimos como grupo todo el tema de los diagramas, ya llevando a cabo aquellos que vimos pertinentes.','2025-04-04'),(8776,399,'04-04-25 Clase 8','Ver y aprender videos de Diseo UI ','2025-04-04'),(8777,392,'04/04/2025','En el da de la fecha, tuvimos que realizar la clase virtual debido a que en la institucin no dispona de electricidad en el segundo piso.\r\nTambin avanzamos con la carpeta de campo. Teniendo en cuenta los avances e ideas planteadas el da de la fecha.','2025-04-04'),(8778,415,'04-04-2025','Realize una investigacion acerca las APIs ','2025-04-04'),(8779,384,'04/04/25','Lo que se realiz hoy una salida didactica a la escuela N23 De 13 para la reunion explicativa de Jovenes Hackers.','2025-04-04'),(8780,400,'Clase 8','Investigue mas hacerca del backend, tratando de entender buenos hbitos y nuevas formas de organizar mi cdigo backend. Mi equipo y yo repasamos la metodologa scrum. Definimos el stack de tecnologa que vamos a usar durante el proyecto. No s pudo hacer la entrevista con el cliente debido a motivos personales de este.\r\nNo haba luz en la escuela est clase fue por meet','2025-04-04'),(8781,394,'04/04/2025','En el da de la fecha estuve realizando la tarea nr.9, el cual era realizar un video, pero lo tengo que editar un poco para poder entregarlo. ','2025-04-04'),(8782,387,'4-4','En el da de la fecha, fuimos un grupo de 4 hasta Flores, para asistir a la audicin de Jvenes Hackers, una capacitacin donde nos explicaron como van a ser las semanas y el curso en si, si tenemos suerte luego de la entrevista que nos tomen podemos quedar y formar parte del proyecto','2025-04-04'),(8783,403,'04/04/25','Este da hicimos las clases virtualmente debido a que haba problemas en la escuela, avance y termine con el tp n6 del modulo 4 que trataba de hacer un organigrama en este caso yo hice la empresa nike.','2025-04-04'),(8784,404,'04-04-2025','Hoy termin un curso de Linkedin y adems empezamos a trabajar con mi grupo para el proyecto.','2025-04-04'),(8785,405,'4/4/2025','El dia de hoy me encargue de progresar en las actividades de los mudulos de DET, organizar el proyecto con mi grupo y me anote en uno de los cursos recomendados por los profesores de PP','2025-04-04'),(8786,391,'DIA VIII','Hoy fui a la capacitacion de jovenes hacker la cual es muy extensa y interesante','2025-04-04'),(8787,397,'Clase 7','Hoy tuvimos clases virtuales por la falta de luz en el colegio. En casa desarrolle ms la presentacin del proyecto y tambin hice una entrevista para el clientes.','2025-04-04'),(8788,385,'Clase 8','Realize algunos requerimiento del cliente en el codgio backend para poder integrar la api de payway.','2025-04-04'),(8789,407,'04-04-2025','Hoy en da fui a jovenes hackers','2025-04-04'),(8790,401,'04-04-2025','Hoy avanzamos con el Diagrama de Flujo de Datos (DFD), el diagrama de flujo y comenzamos a definir la estructura base de la base de datos. Esto nos permiti visualizar mejor los procesos y organizar la informacin clave del sistema.','2025-04-04'),(8791,396,'octava clase','El da de hoy se termino la tarea numero 6 del modulo numero 4','2025-04-04'),(8792,388,'04-04-2025','Hoy solamente me dedique a continuar con el figma para que el cliente pueda recibir el feedback cuanto antes.','2025-04-04'),(8793,393,'4/4/25','Durante la jornada de hoy, 4 de abril, estuve trabajando en la realizacin del video correspondiente a la tarea N. 9 del Mdulo 6 de Prcticas Profesionales. Si bien ya tengo gran parte del contenido grabado, an me resta mejorar varios aspectos tcnicos y realizar la edicin final del mismo para que quede prolijo y completo.\r\nAdems, dediqu parte del da a seguir aprendiendo sobre JavaScript, con el objetivo de fortalecer mis conocimientos en programacin web. Para ello, estuve viendo distintos videos explicativos y tutoriales, los cuales me resultaron tiles para comprender mejor conceptos clave del lenguaje.\r\n\r\n','2025-04-04'),(8794,364,'Da de hoy','Adelanto y revisin de los diagramas UML sobre el proyecto asignado','2025-04-08'),(8795,408,'8/4/25',' Actividades realizadas hoy:\r\nRedaccin y consolidacin de la documentacin del proyecto:\r\n\r\nIntroduccin al sistema de stock y contexto del problema.\r\n\r\nDetalle de las funcionalidades del sistema (CRUD, alertas, gestin de usuarios, reportes, etc.).\r\n\r\nDefinicin clara de los roles de los integrantes del equipo.\r\n\r\nRequerimientos funcionales y no funcionales.\r\n\r\nListado y organizacin de componentes clave del proyecto:\r\n\r\nInclusin de diagramas requeridos: caso de uso, secuencia, clases, DER, Gantt, CPM, etc.\r\n\r\nDesarrollo del anlisis FODA del proyecto.\r\n\r\nDefinicin del entorno de desarrollo y tecnologas utilizadas (HTML, CSS, Node.js, Prisma, etc.).\r\n\r\nIncorporacin de secciones importantes:\r\n\r\nPropuesta funcional final del sistema.\r\n\r\nMtodos de seguridad (hash, JWT, validaciones).\r\n\r\nQA (pruebas de caja negra).\r\n\r\nEntrevistas, encuestas y recopilacin de feedback.\r\n\r\nPrototipado en Figma y su validacin.\r\n\r\nImplementacin de metodologa SCRUM.\r\n\r\nRepositorio del proyecto en Git (TAINGA).\r\n\r\nManual de usuario y manual de despliegue.\r\n\r\n\r\nPrximos pasos sugeridos:\r\nRealizar los diagramas (Caso de uso, DER, Gantt, Clase, etc.) con herramientas como Draw.io o Lucidchart.\r\n\r\nTerminar el prototipo funcional en Figma.\r\n\r\nSubir los avances al repositorio Git (si no se hizo).\r\n\r\nCrear los archivos PDF finales de la documentacin y manuales.\r\n\r\nRealizar pruebas funcionales del sistema (QA).\r\n\r\nPreparar presentacin oral o defensa si es necesario.\r\n','2025-04-08'),(8796,374,'Avance proyecto buffet ','En el da de hoy, con mi equipo hemos avanzado con las tareas asignadas como el diagrama de gantt, diseo de la web etc. Por otro lado hice la daily con el equipo para saber si tienen problemas y avanzar con el proyecto. Por otro lado yo hice avance con la documentacion acerca del servicio. ','2025-04-08'),(8797,409,'ViajesTech DB','Estuve desarrollando una base de datos orientada a una agencia de viajes digital(ViajesTech), mi proyecto de pp y sistemas, con el objetivo de centralizar y organizar toda la informacin relacionada con los usuarios, sus membresas y los distintos servicios tursticos que pueden contratar, como vuelos, hoteles, actividades y transportes. La idea es permitir que los usuarios puedan planificar sus viajes de forma integrada desde una sola plataforma, visualizando y gestionando todos los elementos de su viaje en un nico lugar. Esta base de datos busca facilitar la conexin entre los distintos servicios y optimizar la experiencia del usuario al armar su itinerario de forma personalizada y eficiente.\r\n\r\nEstuve trabajando en el diseo del diagrama DER (Entidad-Relacin) para estructurar correctamente la base de datos de la aplicacin, asegurndome de contemplar todas las entidades necesarias como usuarios, membresas, viajes, hoteles, vuelos, actividades y transportes, junto con sus respectivas relaciones. Actualmente estoy esperando el visto bueno de Consorti para validar el diseo, y una vez aprobado, planeo comenzar con la implementacin del cdigo y el desarrollo funcional del sistema en MySQL.\r\n\r\nAdems, realic el diagrama PERT para planificar y visualizar las tareas del proyecto, identificando el orden, la duracin estimada y la dependencia entre actividades, lo que ayuda a organizar mejor los tiempos y recursos de desarrollo.','2025-04-08'),(8798,363,'Terminamos lo diagramas','El da de hoy estuve terminando de organizar y planificar con el scrammaster el diagrama de gantt. Luego empezamos a investigar y a ver como hacer el diagrama UML (secuencia) ya que es el ultimo diagrama que falta.','2025-04-08'),(8799,361,'Creacin perfil de Linkedin y documentacin','Finalmente cree mi perfil de Linkedin personal y avanc en su configuracin. Posteriormente estuve detallando y retocando distintos aspectos de la documentacin del proyecto. Como sus funcionalidades, diagrama DER, FODA, descripcin general, etc.','2025-04-08'),(8800,360,'Charla y vista del perfil','Hoy estuve charlando con mi grupo sobre el proyecto en si y como nos vamos a manejar la distribucin de ciertas cosas. Ayud a terminar el prototipado y empec el video del mdulo 9. Especifiqu a Caete (el product owner de nuestro grupo) sobre que le preguntara al cliente ms detalles y as saber especficamente que es lo que est ltimo est buscando.','2025-04-08'),(8801,366,'8-4','Hoy continuamos con el proyecto, tuvimos nuestra primera daily y por mi parte estuve diseando las vistas','2025-04-08'),(8802,371,'Charla y vista','Estuvimos hablando sobre perfiles(mas especifico sobre que tendra o lo que no, fue bastante agotador eso ajaj), tablas y la vista de como quedara, de paso hicimos un boceto de como quedara el perfil normal y del admin.','2025-04-08'),(8803,367,'Curso de LinkedIn','Completamos el curso de LinkedIn de gestion de proyectos para mejorar mis capacidades laborales ','2025-04-08'),(8804,362,'vista de perfil y discusin sobre el producto y preguntas hacia el cliente','hice la vista de perfil en base a los criterios del cliente, que logro sacar un tema de discusin por funciones innecesarias y se logro acordar que el ProdOwner (yo) aclare bien el tema con el cliente para luego volver a presentar la idea, volver a discutir y si es necesario volver a redisear ','2025-04-08'),(8805,368,'Comienzo de las certificaciones de Linkedin','Comenc con el curso de certificacin de Linkedin sobre Fundamentos profesionales de anlisis empresarial, por Microsoft y LinkedIn. A su vez, continuamos con el desarrollo de la documentacin sobre el proyecto de la agencia de viajes (Desarrollo de Sistemas)','2025-04-08'),(8806,380,'Sptima clase de PP','Hoy nos organizamos para confirmar el diseo que va a tener el proyecto y empeze a crearlo con las indicaciones que me dieron','2025-04-08'),(8807,382,'Camino critico','Hice el camino crtico en general y comenc a hacer el inicio de sesin de la pgina ','2025-04-08'),(8808,378,'Documentacin','Estuve trabajando con el diagrama de GANTT y modifiqu la documentacin','2025-04-08'),(8809,373,'Investigacin de Problematicas','En el da de hoy en conjunto con mis compaeros nos encargamos de realizar la investigacin sobre la problemtica dentro de la empresa y planteamos nuestro punto de vista y una solucin.','2025-04-08'),(8810,365,'Segundo Daily ','El da de hoy realizamos el daily correspondiente y nos asignamos las tareas, teniendo en cuenta que lo principal pendiente es el diagrama de secuencia y la mejora de la documentacin del proyecto.\r\n\r\n','2025-04-08'),(8811,365,'','','2025-04-08'),(8812,381,'Documentacin del proyecto','El da de hoy estuve completando las secciones del documento &quot;documentacin del proyecto&quot; que podemos completar, junto con Benjamn N. Castro M. completando las partes que estn relacionadas con la situacin actual de la empresa, el sistema actual que tiene nuestro cliente y desglosando esta informacin en puntos clave para luego esturcturarla en un texto con mucho ms sentido y coherencia.','2025-04-08'),(8813,370,'Bitcora de PP da 8 de Abril, 2025','hoy me dedique a hacer la documentacion del proyecto que abarcara toda la materia junto a Desarrollo de Sistemas, no hubo conflictos','2025-04-08'),(8814,375,'Desarrollo de Documentacion - Proyecto','Hoy estuve desarrollando, ampliando y mejorando el diagrama DER para la documentacin con la ayuda de un compaero de equipo.','2025-04-08'),(8815,384,'09/04/2025','Hoy fuimos a visitar GS1 como excursin y ver si podemos ver las pasantias ','2025-04-09'),(8816,364,'Da de hoy','Salida didctica a GS1 y posterior inauguracin de carpeta de campo con la documentacin de la salida a GS1','2025-04-09'),(8817,365,'Excursion ','El da de la fecha fuimos a la sede de GS1, donde nos explicaron cmo funcionaban las prcticas profesionales en dicha empresa, las cuales se basan en la modalidad de pasantas.\r\nNos comentaron que es una organizacin sin fines de lucro que se encarga de la administracin y gestin de la identificacin mediante cdigos de barra. Esta actividad tiene una proyeccin global, con el fin de estandarizar dichas identificaciones. Esta asociacin est compuesta por sus socios, ya que trabaja conjuntamente con el Gobierno Nacional y mltiples empresas del mbito privado. Todo esto lo realizan mediante la adaptacin tecnolgica de los datos, procurando mantenerse actualizados con las tecnologas ms recientes.\r\n','2025-04-09'),(8818,360,'Visita al GS1','Hoy fuimos al GS1 a recibir una charla sobre las pasantas y lo que ofrecan a los alumnos. Despus de esto, trabaj en el FODA de nuestro proyecto y lo termin. Para finalizar, hice la daily junto con mi grupo.','2025-04-09'),(8819,375,'Desarrollo del Prototipado - Proyecto','Hoy estuve ayudando a desarrollar el prototipado en el proyecto, antes de esto tuve una excursin a GS1 donde nos hablaron y dieron la oportunidad de trabajar con ellos en una pasanta.','2025-04-09'),(8820,380,'Octava clase de PP','Hoy tuvimos una excursin a GS1 en cul nos hablaron sobre que eran, como funcionaban, entre otras cosas. Adems contine con el diseo que se me haba asignado','2025-04-09'),(8821,409,'Carpeta De Campo','Comenc a realizar la carpeta de campo del proyecto organizando toda la informacin recopilada durante las primeras etapas, incluyendo el desarrollo del diagrama DER, el diagrama PERT y los avances tcnicos relacionados con la base de datos. Para complementar el contexto del proyecto, tambin inclu una seccin sobre la visita a las oficinas de GS1 Argentina, donde nos recibieron para explicarnos en detalle qu es la empresa, cmo funciona y cul ser nuestro rol como pasantes. Esta experiencia fue muy til para entender el entorno profesional en el que se aplicarn nuestros conocimientos y para comenzar a documentar el proyecto desde una perspectiva ms integral y realista.','2025-04-09'),(8822,370,'Bitcora de PP da 9 de Abril 2025','Hoy fuimos con todo el grupo al GS1 a las 14:30 y nos dieron una charla de lo que era ese lugar, nos dieron una gua por unos sectores y cuando volvimos, empezamos a hacer la carpeta de campo de Prcticas Profesionalizantes. No hubo conflicto ','2025-04-09'),(8823,361,'Visita didctica a GS1','Hoy visitamos la empresa de GS1 para conocer ms sobre los ambientes laborales y las pasantas que estaramos realizando durante el ao. All nos comentaron sus labores, las habilidades que buscaban fomentar y las especificaciones de los puestos ofrecidos para las prcticas','2025-04-09'),(8824,382,'Salida didctica ','Estuvimos la mayor parte de la tarde en una charla de gc1, nos mostraron lo que nos iban a ofrecer, como seran las pruebas y al llegar al cole empece a hacer el inicio de sesin ','2025-04-09'),(8825,371,'FODA y Excursion al GS1','Completamos las carecteristicas de el foda, diciendo sus formtalezas, amenazas, etc.\r\nSolo nos faltaria hacer el gantt, y el cpm. Aparte que fuimos al GS1, estuvo bastante bueno y me gustaria ir, estuvo bueno la verdad.\r\nFin de la bitacora','2025-04-09'),(8826,363,'Salida didactica y seguimos terminando los diagramas','El da de hoy tuvimos una salida didctica a una empresa llamada GS1 orientada a anlisis de datos en la cual nos explicaron en que consista la practica externa en esa empresa y como ser parte a partir de postularse y dar la evaluacin para entrar. \r\nLuego de la salida llegamos y corregimos los diagramas y ahora tenemos que pasar el diagrama DER a otra plataforma ya que la que habamos hecho era &quot;vaga&quot;','2025-04-09'),(8827,369,'GS1','en el dia de hoy fuimos a visitar GS1 nos dieron una charla y nos hicieron un mini recorrido por la empresa, con mi compaero corregimos un diagrama del proyecto y arranque a hacer la carpeta de campo','2025-04-09'),(8828,372,'Bitacora de PP dia 09 de Abril de 2025','el da de hoy fuimos al GS1, en el cual nos dieron una charla explicativa de como se dividen las reas, en las cuales uno puede decidir a cual ir si decide hacer la pasanta ah , y de como se distribuirn los das para poder realizarlas sin afectar nuestros horarios de clase. Ademas empezamos con la carpeta de campo en el cual hablamos de nuestra experiencia en el GS1.','2025-04-09'),(8829,368,'Visita Guiada y Comienzo de Carpeta de Campo','En el dia de hoy fuiamos a la empresa GS1 la cual se encarga de darle los codigos de barra a los productos. Recibimos una charla por parte de los ex alumnos de la escuela que trabajan alli y de los empleados/mentores, en la cual nos hablaron de como se debe comportar y en que se basan las pasantias.\r\nLuego volvimos al establecimiento educativo para comenzar a documentar en la carpeta de campo sobre nuestra visita a la empresa.','2025-04-09'),(8830,373,'Salida a GS1 e Investigacin de Diagrama UML de Secuencia','En el da de hoy, en conjunto a mis compaeros de grupo, aula y profesores. Fuimos citados para realizar una salida didctica a una oficina en particular de GS1 dedicada especficamente al diseo e implementacin de estndares globales y soluciones para mejorar la eficiencia y la visibilidad a lo largo de la cadena de valor.\r\nLuego de la salida, junto a mi grupo de Prcticas Profesionalizantes realizamos el Daily y nuestro Scrum Master nos asign la tarea de reversionar el diagrama UML de secuencia, por lo que con mi compaera Agus Gonzlez Herrera nos encargamos de la investigacin del mismo para luego realizarlo. ','2025-04-09'),(8831,378,'Excursin','Hoy sal a la excursin al GS1 y estuve escribiendo en la carpeta de campo sobre la salilda.','2025-04-09'),(8832,362,'excursin, opciones de vista de perfil y actualizacin de diagrama entidad relacin','tuvimos una excursin al GS1 (empresa de creacin de QR), al llegar me puse a actualizar el diagrama entidad relacin( agregando jerarquizacin, perfiles y ttulos/etiquetas, y cree una vista mas con ayuda de mi compaero Nicols Lpez Arias para darle opciones al cliente para que elija un modelo de prototipado para el perfil de usuario/admin./vendedor.','2025-04-09'),(8833,367,'Salida didctica a GS1','Hoy participamos de una salida didctica en GS1, donde escuchamos las experiencias de exalumnos de la escuela 32. Ademas me dedique a configurar ciertas cosas menores, en el repositorio de GitHub. ','2025-04-09'),(8834,366,'Salida didactica a gs1','Hoy tuvimos nuestra primera salida didactica a gs1, cuando volvi empece con la carpeta de campo anotando esta salida y despues continue con el diseo del proyecto en figma','2025-04-09'),(8835,387,'9-4','Hoy fuimos a la CG1 donde nos dieron una charla explicativa de como serian las practicas dentro de la empresa en caso de quedar. Nos explicaron tambin el origen de la misma y como era su modelo de trabajo y a que se dedicaban. Fue una salida muy interesante','2025-04-09'),(8836,385,'Salida Didactica 1','Hoy fuimos a la primer empresa, en este caso CG1 donde nos contaron varias cosas y dos tipos de trabajos para hacer.','2025-04-09'),(8837,415,'09-04-2025','Hoy se realizo la salida didacta a GS1, donde nos explicaron que era GS1, como es la pasanta (en 2 sectores) y cuales son las cualidades que ellos buscan.\r\nsector 1: renen datos de los productos y hacen su trazabilidad.\r\nsector 2: analizan datos, hacen diagramas y tratan de mejorarlos (ya sea produccin u organizacin) tambien hacen un registro de todo el trabajo realizado.','2025-04-09'),(8838,405,'9/4/25','El dia de hoy fui junto a mi curso y el curso del turno maana de salida didactica a GS1 argentina, donde recibimos una charla explicativa de las actividades que se llevan a cabo en la empresa, y nos explicaron las diferentes secciones de la empresa a las que nos podemos postular para trabajar.','2025-04-09'),(8839,381,'GS1 e investigacin para el diagrama UML','Tuvimos una charla de la empresa GS1, que se dedica a hacer los QRs  y cdigos de barra siguiendo un estndar globalizado. Comentaron un poco en qu se basan sus prcticas, las cuales son principalmente el manejo, gestin y administracin de datos y proyectos. Nada de desarrollo. De vuelta en la escuela Consorti corrigi el DER de mi grupo y me puse a investigar para rehacer el UML.','2025-04-09'),(8840,404,'09/04/2025','Hoy visitamos GS1 en donde nos dieron una charla sobre en que consistia la empresa y las pasantias. Despus recorrimos un poco.','2025-04-09'),(8841,395,'90-04-2025','hoy tuvimos una charla en GS1,  donde nos hablaron como se utilizan los cdigos de barras en distintos sectores, como en el telepase, en almacenamiento de productos, que tambin sirve para ver el seguimiento del mismo, hasta llegar a la tienda destinada. y muchas cosas interesantes, como la capacitaciones que te dan , lo que te ofrecen como empresa','2025-04-09'),(8842,386,'10/4','Tuve una serie de conflictos en mi