a bien. Fue un proceso de prueba y error, pero me ayud a afianzar mucho los conceptos de diseo de bases de datos.\r\n\r\n\r\n','2025-04-16'),(8911,375,'Caso de Uso - Proyecto','Hoy estuve armando el diagrama de caso de uso para la documentacion, avance cerca de la mitad pero faltan varias partes para completarlo.','2025-04-16'),(8912,365,'Investigacion de lenguaje','El da de hoy, tras corregir el diagrama DER y revisar la documentacin, comenc nuevamente a investigar los posibles candidatos para desarrollar la aplicacin web. Una vez ms, descartaron los frameworks React, NestJS y NextJS con Redis.','2025-04-16'),(8913,380,'decima clase de PP','En la clase de hoy segu avanzando con el diseo de nuestro proyecto, terminando el apartado de las formas de pago, el modelo de la generacin de una orden y el apartado del seguimiento del pedido hecho','2025-04-16'),(8914,363,'Sigo con el diagrama (otra vez)','hoy estuve terminando por fin el diagrama de caso de uso con lo que pude entender de lo que hizo mi compaero que lo empez. Aunque estuve esperando mucho tiempo a que el profe venga a corregirlo para poder continuar ','2025-04-16'),(8915,406,'16/04/25','Hoy con el grupo le presentamos al profe nuestro proyecto una parte del proyecto','2025-04-16'),(8916,381,'Siguiendo con el diagrama de secuencia','Luego de muchas correcciones de Consorti, me puse a corregir lo que ya tena hecho, agregando el intermediario del Frontend, llegando a actualizar las funciones de Agregar, Eliminar, Modificar Usuario y el Login. Tambin hablamos con el grupo, repartiendo una vez ms las tareas y arreglando mejor el documento.','2025-04-16'),(8917,361,'Modificacion documentacion','Avance con la documentacion del proyecto. Especificamente en el paso de la documentacin al formato correspondiente. Avanzamos principalmente en la descripcion general del proyecto, los problemas que resuelve, sus objetivos, antecedentes, etc.','2025-04-16'),(8918,364,'Da de hoy','Investigacin sobre react','2025-04-22'),(891