er).\r\n\r\n\r\nObservaciones:\r\n\r\nRevisar y solucionar los problemas que impidieron terminar la pgina principal en la prxima clase.\r\n\r\nContinuar con el desarrollo del resto de la interfaz una vez resueltos los inconvenientes','2025-04-22'),(8935,375,'Desarrollo de la Documentacion 2 - Proyecto','Hoy estuve ayudando a agregar los diagramas en la documentacin y a explicar mas temas que tengan que ver con los diagramas, todo esto es para poder terminar la documentacion sin mas retrasos.','2025-04-22'),(8936,365,'Documentacion para presentar','El da de hoy estuve complementando la documentacin para que est lista para entregarla, como requisito de Consorti. Adems, establec el primer sprint, que implica la investigacin de las tecnologas seleccionadas.','2025-04-22'),(8937,363,'Documentacion','Hoy, junto con el resto de los integrantes del grupo, nos dedicamos a completar el documento principal de la documentacin, incorporando lo que sabamos y los diagramas que ya habamos hecho','2025-04-22'),(8938,371,'InformeFinal ','Aunque haya sido tarde entregamos el trabajo y est bastante bien, pero estos das lo estamos mejorando/completando, maana me parece que ya termina ','2025-04-22'),(8939,366,'Reunion con consorti','Hoy estuvimos hablando con consorti acerca del avance del proyecto, principalmente con la documentacin. Lo tenemos casi completo y el lunes vamos a arrancar con el primer sprint. Por mi parte continue viendo un poco de tutoriales de typescript','2025-04-23'),(8940,367,'MVP proyecto','Corregimos algunos aspectos de la documentacion y quedamos a la espera del feedback del MVP para empezar a la fase de investigacin. ','2025-04-23'),(8941,374,'reunion con consorti','En el dia de hoy con el profesor Consorti nos hemos juntado para poder avanzar con el sprint. Nos ha dado el OK pero nos falto agregar informacion detallada acerca del producto y algunos diagramas e info q se ha borrado.','2025-04-23'),(8942,409,'Del Proceso de Revisin Microdocumental y la Espera Epistmico-Operativa ante la Validacin del Artefacto Preliminar en el Marco del Proyecto ViajesTech','En el transcurso de la presente jornada laboral, se llev a cabo en el marco de una dinmica intersubjetiva de cooperacin tcnico-documental entre los miembros constitutivos del equipo de trabajo un proceso exhaustivo de identificacin, categorizacin, y rectificacin minuciosa de micro-discrepancias y disfuncionalidades epistmico-estructurales dentro del corpus documental preliminar que sustenta, en su dimensin fundacional, la arquitectura lgica y operativa del emprendimiento tecnolgico identificado bajo la nomenclatura provisional ViajesTech. Este accionar fue desarrollado en una atmsfera de reciprocidad metodolgicamente articulada, orientada a la consolidacin semntica, sintctica y pragmtica de la documentacin, cuya funcin excede lo meramente instrumental para convertirse en garante de la coherencia interna del proyecto a nivel ontolgico y procesual. Simultneamente, se experimenta un estado de latencia operativa provocado por la necesidad imperativa de obtencin de la anuencia formal de carcter autorizante y legitimador por parte del agente decisorio designado, a saber, Gonzalo, cuya intervencin resulta ser condicin sine qua non para la superacin del umbral validativo representado por el Producto Mnimo Viable (MVP), entendido no solo como artefacto tcnico-funcional, sino como instancia liminar de performatividad proyectual. Solo una vez alcanzado dicho consenso evaluativo ser posible inaugurar, en trminos operativos y epistmicos, la fase ulterior del ciclo de desarrollo: una etapa caracterizada por la convergencia entre la indagacin heurstica orientada por paradigmas investigativos emergentes y la produccin escalonada de artefactos tecnolgicos bajo marcos de ingeniera iterativa, en consonancia con los preceptos del diseo centrado en el usuario, la escalabilidad infraestructural y la sostenibilidad sociotcnica del sistema en ciernes.','2025-04-23'),(8943,408,'','Hoy con mi co