amBE','En el da de hoy me encargu de completar las tareas pendientes que tengo de StreamBe. Hoy en particular use las horas para realizar y hacer la entrega del trabajo prctico numero 4 de StreamBe que bsicamente consista en trabajar con window.alert() y javascript para hacer una calculadora de jubilaciones con ciertas condiciones.','2025-06-24'),(9396,372,'bitacora de PP 24 de junio de 2025','el dia de hoy continuamos en jira nuestras tareas correspondientes e iniciamos con el frontend inicio de nuestro proyecto, empezando tambien y backend.','2025-06-24'),(9397,362,'actualizacin de el diseo esttico del producto con creacin de nuevas vistas, finalizacin de los mdulos del DET y investigacin sobre frontend (next.js)','Realic una actualizacin integral del diseo esttico del producto digital, orientada a mejorar la experiencia visual del usuario mediante la aplicacin de principios de diseo UI/UX contemporneos, como el uso de layouts responsivos, tipografas jerarquizadas, espacios negativos bien administrados y una paleta cromtica coherente con la identidad del producto. Paralelamente, dise y desarroll nuevas vistas que amplan la estructura funcional del sistema, incorporando componentes reutilizables y patrones visuales consistentes. Tambin finalic los mdulos correspondientes al DET (Diseo Estructural de la Tecnologa), asegurando su integracin esttica y funcional con el resto del sistema. Finalmente, llev a cabo una investigacin tcnica sobre herramientas y frameworks de desarrollo frontend, con nfasis en Next.js, analizando su sistema de renderizado hbrido (SSR/SSG), enrutamiento dinmico y capacidades de optimizacin del rendimiento, para fundamentar decisiones futuras en el diseo y construccin del producto.','2025-06-25'),(9398,369,'pagina proveedores','en el dia de hoy empece con la pagina de administrar proveedores, tuve un poco de dificultades al no tener el boceto de figma pero la estuve haciendo de igual manera y haciendo que sea responsive','2025-06-25'),(9399,371