ero avance con la carpeta de campo','2025-07-11'),(9528,370,'Bitcora de PP da 16 de Julio, 2025','hoy en la hora de practicas profesionalizantes, tuvimos una salida didctica, fuimos a la Universidad de Buenos Aires (UBA) por la semana de la computacin e hicimos diversas actividades, jugamos mini juegos, resolvimos la clave para evitar un hackeo en la UBA y utilizamos un programa de msica para crear nuestras propias melodas a travs de cdigo (Sonic Pi)','2025-07-16'),(9529,375,'Salida Didactica','Hoy fuimos al colegio tecnico huergo donde estuve viendo varias carreras para empezar la universidad y estuve en una charla sobre la biotecnologia y a su vez, luego de termine esta primera salida, tambien fuimos a la ciudad universitaria donde estuvimos viendo como programar canciones y yo pude ver y aprender como hacer proyectos con sensores.','2025-07-16'),(9530,373,'Salidas Didcticas a La Huergo y Ciudad Universitaria','En el da de hoy tuvimos dos encuentros muy importantes para nuestra formacin como tcnicos. Hoy tuvimos dos salidas. Una a la escuela La Huergo y otra en Ciudad Universitaria. La primera fue una especie de convencin donde varas universidades se reunan para entregar folletos e hacerles llegar a los alumnados que materias o especialidades se cursaban en dicha institucin. La misma tuvo varas charlas que se daban simultneamente en diversos horarios\r\nPor otro lado, fuimos a Ciudad Universitaria cerca de Aeroparque. En el lugar nos hicieron visitar diversos stands con &quot;proyectos&quot; que preparaban los alumnos que cursaban ah para interiorizarnos en los contenidos de las materias que se cursaban en la institucin. A su vez, tuvimos el placer de participar en dos actividades relevantes como lo fue el &quot;Escape Room&quot; que consista en resolver una serie de &quot;puzzles&quot; que nos serviran para poder resolver el caso que se nos encomend. Luego tuvimos una actividad de Programacin musical donde mediante un programa y una breve introduccin al mismo nos ensearon como tocar notas, o incluso con un poco de creatividad y paciencia, una cancin mediante el programa.','2025-07-16'),(9531,371,'Excursin ','Hoy fuimos a la escuela tcnica llamada Huergo y a la Ciudad Universitaria pabelln 0+??, donde en estos lugares nos dieron capacitacin para ver la carrera que bamos a tomar para nuestro futuro  ','2025-07-16'),(9532,367,'Fuimos a la Ciudad Universitaria y al Huergo','Estuvimos recorriendo el Huergo, y tambien la ciudad universitaria, en eventos que podrian despertar nuestro interes en seguir nuestra formacion profesional en un instituto universitario. ','2025-07-16'),(9533,374,'Salida didactica','En el dia dehoy fuimos al ciudad universitaria al pabellon 0 infinito por la semana de la computaciom y a elegir la carrera para nuestro futuro','2025-07-16'),(9534,369,'salida didactica','en el dia de hoy tuvimos una salida didactica en el huergo(feria de facultades) y la uba(nos mostraron mas o menos que trabajan en algunas materias) ','2025-07-16'),(9535,379,'Bitcora 16/07','Hoy realizamos dos salidas didcticas a la et n9 como a ciudad universitaria, en la et n9 tuvimos varias charlas sobre carreras y universidades y en ciudad universitaria hicimos actividades sobre diferentes carreras guiadas por estudiantes','2025-07-16'),(9536,379,'Bitcora 16/07','Hoy realizamos dos salidas didcticas a la et n9 como a ciudad universitaria, en la et n9 tuvimos varias charlas sobre carreras y universidades y en ciudad universitaria hicimos actividades sobre diferentes carreras guiadas por estudiantes','2025-07-16'),(9537,414,'Salida didctica ','Hoy fuimos a la salida didctica.\r\nLa primera fue la de el Huergo dnde tuvimos una charla en el auditorio y despus fuimos a la uba donde tuvimos distintas actividades.','2025-07-16'),(9538,365,'Salida didctica ','El da de hoy nos dirigimos a la Escuela Tcnica N. 9 &quot;Luis Huergo&quot;. El motivo de la visita fue asistir a diferentes charlas vocacionales organizadas con el propsito de brindarnos una visin a futuro sobre las carreras universitarias a las que podramos aspirar. La jornada estuvo orientada a estudiantes de nivel secundario prximos a egresar, en un momento donde se vuelve fundamental pensar en el camino a seguir una vez finalizada esta etapa.','2025-07-16'),(9539,408,'15 y 16/7/25','hoy no vino el profesor, y no estuvo habilitada la bitacora asi que la registro hoy 16/7...\r\n\r\nCrear una interfaz web que permita registrar productos que ingresan al stock, visualizar el historial de ingresos y contar con una navegacin lateral funcional.\r\n\r\n???? Tecnologas Utilizadas\r\nHTML5: estructura semntica.\r\n\r\nCSS3: estilos personalizados y diseo responsivo.\r\n\r\nJavaScript: manipulacin DOM, lgica del formulario, control de fecha/hora y men interactivo.\r\n\r\n???? Etapas de Desarrollo\r\n???? 1. Estructura base HTML\r\nSe cre una estructura dividida en dos partes:\r\n\r\nMen lateral (sidebar) con accesos a diferentes funciones del sistema.\r\n\r\nSeccin principal (main-content) con:\r\n\r\nTtulo: &quot;PRODUCTO RECIBIDO&quot;.\r\n\r\nFormulario para cargar productos.\r\n\r\nTabla para el historial de productos ingresados.\r\n\r\n???? 2. Formulario de Registro\r\nCampos incluidos:\r\n\r\nNombre del producto, tipo, descripcin.\r\n\r\nCantidad recibida, unidad de medida, estado (nuevo/usado).\r\n\r\nOrigen, trabajador que lo recibi, observaciones.\r\n\r\nAl presionar &quot;Registrar&quot;, los datos se procesan y se agregan a la tabla con fecha y hora en tiempo real.\r\n\r\nSe utiliz new Date().toLocaleString() para obtener la hora local.\r\n\r\n???? 3. Lgica con JavaScript\r\nPrevencin del envo automtico del formulario.\r\n\r\nCaptura de datos del formulario y creacin dinmica de una nueva fila (&lt;tr&gt;) en la tabla.\r\n\r\nReset del formulario despus de cada ingreso.\r\n\r\nCorregido un error de sintaxis: la insercin de HTML deba usarse con template literals (``).\r\n\r\n????? 4. Men Lateral Interactivo\r\nBotn hamburguesa (?) que despliega/oculta el men lateral.\r\n\r\nFuncin toggleMenu() alterna clases CSS (.open, .shift) y oculta el botn cuando el men est abierto.\r\n\r\nSe reemplaz el antiguo cono de logo por el botn de &quot;???? Casa&quot;.\r\n\r\nEl botn hamburguesa fue reubicado donde antes estaba el logo.\r\n\r\n???? 5. Mejoras progresivas\r\nSe implement una tabla que organiza los datos en orden cronolgico inverso (los ms recientes arriba).\r\n\r\nSe aadi un buscador por nombre de producto, eliminando el filtro por fecha a pedido del usuario.\r\n\r\nSe centr el ttulo &quot;Historial de productos ingresados&quot;.\r\n\r\nSe agreg en la esquina superior derecha un crculo con la palabra Perfil como elemento visual representativo del usuario activo.\r\n\r\n???? Diseo Visual (CSS)\r\nPaleta de colores:\r\n\r\nFondo: #F6F2DE (beige claro)\r\n\r\nElementos principales: #5D3A32 y #3E2723 (tonos marrn y chocolate)\r\n\r\nFuentes legibles y modernas.\r\n\r\nBotones estilizados con hover suave.\r\n\r\nFormulario en cuadrcula (grid) para mejor organizacin.\r\n\r\nTabla con contrastes claros para una visualizacin ptima.\r\n\r\n???? Resultados\r\n? Funcionalidad completa de registro de producto.\r\n\r\n? Men responsive y dinmico.\r\n\r\n? Historial visualmente ordenado.\r\n\r\n? Mejora progresiva con filtros y perfil visual.\r\n\r\n? Cdigo optimizado, limpio y funcional.\r\n\r\n???? Pendientes o ideas futuras\r\nConexin a base de datos real (backend).\r\n\r\nAutenticacin de usuarios.\r\n\r\nExportacin del historial en CSV o PDF.\r\n\r\nDiferenciacin por roles (trabajador, supervisor, administrador).\r\n\r\nNotificaciones de productos en bajo stock.\r\n\r\nhoy 16/7/25 tuvimos salida para charlas de facultad\r\n\r\nestuvimos en el huergo con facultades referente a nuestra carrera, la cual me fui por DISEO GRAFICO, hable con gente de la UADE y otra facultades referente al diseo, luego a la tarde tuvimos que ir a la ciudad universitaria, la cual nos dieron al principio proyectos para probar o juegos referente a programacion o juegos, gicimos sala de escape a un estilo de programacion y luego fuimos a otra aula donde pudimos hacer musica con codigo etc...\r\n\r\n','2025-07-16'),(9540,360,'Excursin a la escuela tcnica N9 y a Ciudad Universitaria, UBA','El da de hoy en prcticas profesionalizantes fuimos a la escuela tcnica N9 y nos dieron una charla de orientacin vocacional as como muchos stands donde distintas universidades tales como la UADE, UCA, y la UTN nos ofrecian sus carreras y nos explicaban como funcionaban sus materias curriculares, recib multiples folletos. Despus fuimos a la Facultad de ciencias exactas y naturales UBA en Ciudad universitaria donde ofrecian Licenciatura en Ciencia de datos y licenciatura en ciencias de la computacin y estuvimos recorriendo un rato, probando juegos interactivos que tenan.','2025-07-16'),(9541,364,'Da de hoy','Hoy tuvimos dos salidas didacticas a la escuela tecnica N9 &quot;Huergo&quot; y la ciudad universitaria, las dos salidas se basaban en carreras, linceciaturas, etc.','2025-07-16'),(9542,381,'Excursiones','Fuimos a la expo universitaria en el Huergo, donde daban charlas vocacionales y hablaban de algunas opciones de universidades. Despus fuimos a la uba por la semana de las siencias. Hoy especficamente estaba dedicado a la computacin y anlisis de datos, nos ensearon alguunos juegos y &quot;trucos&quot; con algoritmos tipicos y algunas otras actividades.','2025-07-16'),(9543,406,'16/07','Hoy fuimos a la huergo y nos dieron varias charlas de cursos y despus fuimos a la Ciudad universitaria que ah hicimos juegos de computacin ','2025-07-16'),(9544,378,'salidas','El da de hoy tuvimos el placer de disfrutar de dos salidas didcticas. Una al huergo para charlas universitarias y otra a la ciudad universitaria por las semanas de las ciencias','2025-07-16'),(9545,380,'trigsima clase de PP','En el dia de hoy fuimos a dos excursiones, una a la tecnica N9 y la otra a la UBA. En la primera excursin estuvimos teniendo algunas charlas sobre algu